INSERT INTO beerbuddies_db.beer VALUES (27, 878, 5, 72, '175 Bloor Street East', 'Toronto', 'Ontario', 'Canada', 'This full-bodied ale is brewed with roasted malts and a hint of Dark Belgian sugar for a perfectly balanced taste.', '', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.6706, -79.3824', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (28, 935, 3, 31, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'We took the traditional IPA, originally shipped from England to India in the 1700''s, and made it bolder and more flavorful - American Style. We''ve added new varieties of highly aromatic American hops to create a distinctive bitterness profile and an incredible hop character.', '', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (29, 1271, 8, 95, '1401 Miner Street', 'Idaho Springs', 'Colorado', 'United States', 'Ornery Amber is brewed with a blend of the finest European hops and gently roasted malts.', 'http://www.tommyknocker.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7418, -105.518', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (30, 935, 2, 25, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'Not quite a stout but definitely no lightweight, Cutthroat Porter is smooth and robust. Inspired by the classic London porters, we use dark roasted malts to create a deep, rich color and flavor that hint at chocolate and coffee. We named it Cutthroat Porter as our tribute to the Colorado state fish - with its own rich heritage and unmistakable dark coloring. And while we''re big fans of small batches, here''s to the currently threatened Cutthroat population reaching mass quantities.', '', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (31, 1271, 3, 38, '1401 Miner Street', 'Idaho Springs', 'Colorado', 'United States', 'Maple syrup is added to each barrel of Maple Nut Brown Ale to impart roasted sweetness balancing the nut flavor produced by chocolate malts.', 'http://www.tommyknocker.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7418, -105.518', '2018-10-05');
