INSERT INTO beerbuddies_db.beer VALUES (40, 1307, 5, 70, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Quelque Chose was launched in January 1996. This versatile beer was specifically developed as a winter beer because, when warmed to 70ÂºC (160ÂºF), it can be taken as a hot drink. On the other hand, on the rocks, it is a wonderful aperitif. The cherries are soaked for months in slightly bitter ale before being blended into the beer. Quelque Chose is made with dark roasted malts, and the end result is something commonly known as an authentic nectar. The most original of the Unibroue line, it is highly appreciated by winter-sports enthusiasts.', 'http://www.unibroue.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
