INSERT INTO beerbuddies_db.beer VALUES (43, 723, 3, 38, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'A rich brown ale inspired by the enigmatic monastic brews of Belgium, and the mysterious mist shrouded jungles of the tropics. Brewed with real cacao, and spiced with cinnamon and sweet orange peel for a sensual delight. A brew to be sipped, savored, and enjoyed!', 'http://www.jollypumpkin.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
