INSERT INTO beerbuddies_db.beer VALUES (45, 723, 5, 72, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'Aged in large oak casks and refermented in the bottle, Calabaza Blanca is a Belgian Biere Blanche. Spiced with orange peel and corriander, you''ll find it refreshingly tart, with a wonderfully dry finish.', 'http://www.jollypumpkin.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
