INSERT INTO beerbuddies_db.beer VALUES (58, 1221, 3, 31, '4811 Dusharme Drive', 'Brooklyn Center', 'Minnesota', 'United States', 'Like Hops? You''ll like this fire-hued beer. This is the beer I have always dreamed of making. This is the beer that would come to mind while spending the last two years tearing down walls, hanging sheetrock, moving kegs, power washing the ceilings, arguing with various agencies, and cutting the water main. Without Golden Promise malt, made by family-owned Simpsons Malt, Furious would just be pissed off-ed. From Scotland, this malt is still produced in the tradition of turning over the barley by hand, resulting in a malt that is unsurpassed in its quality. Golden Promise is also used extensively by premium whisky distilleries such as The Macallan. This malt provides the backbone for the intense hop character. Four American hop varieties are used at a rate of over three pounds per barrel. The result is a rich malt sweetness infused with bright hop flavor and aroma from beginning to end. Oh yeah, it''s about 6% alcohol and around 100 IBUs.', 'http://www.surlybrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '45.0429, -93.3246', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (59, 1221, 3, 38, '4811 Dusharme Drive', 'Brooklyn Center', 'Minnesota', 'United States', 'This beer is an amalgamation of styles; brown/porter/apa. Five distinct malts, including two from Belgium, give this beer added complexity and depth. We also add oatmeal to this beer to give it a smooth texture not usually associated with this type of beer. We add large amounts of American finishing hops to give Bender a citrus hop aroma because... we like hops. This is a session beer weighing in around 5% alcohol and 25 IBUs. Grab one today, we think you will want another!', 'http://www.surlybrewing.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '45.0429, -93.3246', '2018-10-05');
