INSERT INTO beerbuddies_db.beer VALUES (63, 935, 11, 141, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'Ever been in a warm, cozy cabin and had a secret desire to get snowed in? To celebrate the winter season, we offer our Isolation Ale - a traditional winter brew made with premium malts imported from England. It''s just one of the reasons Isolation Ale stands alone.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
