INSERT INTO beerbuddies_db.beer VALUES (80, 1202, 4, 50, 'KendlerstraÃŸe 1', 'Salzburg', '', 'Austria', 'Stiegl Weizengold. It has 12o original gravity; the choicest ingredients and a top fermentation process are responsible for the highest possible quality and an unmistakable flavor. It is brewed according to the classic wheat beer recipe: 60 % wheat malt and 40 % barley malt, top fermentation and in compliance with the Purity Law of 1516. This fine yeast wheat beer specialty is a refreshing, natural and stimulating beer brand.', 'http://www.stieglbrauerei.at/', 5.10, 0.00, 0.00, 0, '9999-01-01', '47.8005, 13.0444', '2018-10-05');
