INSERT INTO beerbuddies_db.beer VALUES (124, 441, 3, 38, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'By 1915, Bend, Oregon, was alive with the sound of the buzz saw, as two of the country''s largest pine sawmills set up shop on the banks of the Deschutes River. The mills are gone now, but the smokestacks still stand testament to Bend''s humble beginnings. Buzzsaw Brown is an easy-drinking beer that is refreshing after a hard dayâ€™s work. The timber mills in Bend may be closed, but whether your adventure includes a day of scaling rock faces, hitting 18 holes or skiing the slopes in spring, Buzzsaw Brown is the perfect end to a fun-filled day. â€œBuzzsaw Brown is one of my favorite beers,â€ says Deschutes Brewery Brewmaster Larry Sidor. â€œThe unique combination of European and American malts makes it a very food friendly beer that pairs well with a wide variety of flavors.â€', 'http://www.deschutesbrewery.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (125, 369, 3, 26, 'Rua Bahia, 5181', 'Blumenau', 'Santa Catarina', 'Brazil', '', 'http://www.eisenbahn.com.br/', 0.00, 0.00, 0.00, 0, '9999-01-01', '-26.8914, -49.1223', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (126, 584, 7, 90, '980 NE Fourth Street', 'McMinnville', 'Oregon', 'United States', 'This is one of our rare lagers brewed in the style of the German Heiliges Geist Bock, or Holy Ghost Bock. The name refers to the lighter nature of the beer as opposed to the darker and heavier Doppel Bock and Mai Bock also brewed during the spring in Germany. There is a rich malt flavor, a firm German style lager head, and a clean lagered finish to this beer. Available on draft or in 12 oz. bottles.', 'http://www.goldenvalleybrewery.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '45.2104, -123.189', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (127, 623, 2, 25, '4301 Leary Way NW', 'Seattle', 'Washington', 'United States', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '47.6592, -122.366', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (128, 397, 1, 10, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'A dark brew full of promise. Coopers Dark Ale is a journey in taste, starting fresh and creamy, and finishing with a lingering coffee flavour. Conditioned and naturally brewed using the top fermentation method, Coopers ''Dark'' is made using roasted and chocolate malts, giving it a rich dark colour and unique flavour. Coopers Dark Ale has no additives and no preservatives.', 'http://www.coopers.com.au/', 4.50, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (129, 441, 3, 33, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Cinder Cone Red''s diverse selection of hops and barley captivates thirsty palates with its toffee-like flavor, intense citrus aroma and defined bitterness. Located on the northern slope of Mt. Bachelor, the Cinder Cone was also known as "Red Hill" due to its reddish color that is revealed as the seasons change, the weather warms and the snow melts. It''s spring. Time to get outside.', 'http://www.deschutesbrewery.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
