INSERT INTO beerbuddies_db.beer VALUES (138, 935, 3, 33, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'The Rocky Mountain Goat is no ordinary goat. Just like Odell Red is no ordinary red. We took the American-style red to a whole new level by adding a variety of aggressive American hopsâ€”giving this ale a distinctive fresh hop aroma and flavor. We think you''ll agree this red has some serious kick.', '', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
