INSERT INTO beerbuddies_db.beer VALUES (171, 604, -1, -1, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Looking for something a little different? Brewed with rice and barley malts, Samurai is an easy drinking, unfiltered ale that changes the status quo for unfiltered beers. The addition of rice gives Samurai a slightly fruity, crisp, refreshing and clean taste. This is definitely not your everyday unfiltered beer.', 'http://www.greatdivide.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
