INSERT INTO beerbuddies_db.beer VALUES (179, 859, 3, 43, 'Slien 2, 2. tv', 'KÃ¸benhavn', '', 'Denmark', 'Breakfast is the most important meal of the day, many say, and if you are a beer geek there is no better way to start the day than with a powerful, complex morning stout. The unique mix of oats and coffee gives this beer large body and power, while the coffee, at the same time, creates a nice balance.', 'http://www.mikkeller.dk/', 7.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
