INSERT INTO beerbuddies_db.beer VALUES (184, 397, -1, -1, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'If fine wine were beer it would no doubt be Coopers Extra Strong Vintage Ale. This strong ale imparts rich full flavours that are suitable for maturation. Brewed with choice malts and an extended top fermentation, Coopers Extra Strong Vintage Ale will improve with age, becoming more interesting and complex in flavour for up to 18 months. The results are well worth the wait!', 'http://www.coopers.com.au/', 7.50, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
