INSERT INTO beerbuddies_db.beer VALUES (188, 481, 3, 33, '1777 Alamar Way', 'Fortuna', 'California', 'United States', 'Eel River Brewing Company, brewers of California''s first Certified Organic Ale, proudly brings you our Organic Amber Ale. Unique in flavor and purity, this medium bodied beer has a hoppy bouquet and a distinctive rich taste with a caramel-like sweetness that is balanced with a liberal dose of certified organic Pacific Gems and Hallertau hops, imported from New Zealand. Pure taste, pure ingredients, pure good.', 'http://eelriverbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.5793, -124.153', '2018-10-05');
