INSERT INTO beerbuddies_db.beer VALUES (208, 935, 1, 7, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'We introduced 90 Shilling, our flagship beer, at our opening party in 1989. For a while, we''d been wondering - what would happen if we lightened up the traditional Scottish ale? The result is an irresistibly smooth and delicious medium-bodied amber ale. The name 90 Shilling comes from the Scottish method of taxing beer. Only the highest quality beers were taxed 90 Shillings. A shilling was a British coin used from 1549 to 1982. We think you''ll find this original ale brilliantly refreshing, and worth every shilling.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (209, 905, 11, 116, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'SUNSHINE WHEAT is a great beer for trouncing thirst. Yet, it has a depth of character that inspires a quiet momentâ€™s reflection. Sunshine Wheat swirls in the mouth with ripples of coriander and orange peel tartness, settling nicely into a tranquil sea of apple and honey tones. A filtered wheat beer, Sunshine offers a crisp, refreshing alternative to heavier-bodied heffe-weizens.', 'http://www.newbelgium.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
