INSERT INTO beerbuddies_db.beer VALUES (214, 161, 3, 38, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Our first new year-round brand launch since 1996, Lunar Ale is in a category all its own. Brewed using a unique aromatic yeast, this refreshing variety is best described as a cloudy brown ale with a complex, malty aroma and flavor, and a crisp, dry finish.', 'http://www.blvdbeer.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (215, 604, 3, 26, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Historically Great Divideâ€™s flagship beer, DPAâ€™s record speaks for itself. By continually garnering national and international recognition, DPA has risen to become one of the most award-winning English-style pale ales in the world. Sporting a brilliant copper hue and an assertive floral hop aroma, DPA is known for its smooth, malty middle, which is expertly complemented with hearty and complex hop flavor. DPAâ€™s extraordinary hop finish is marked by crisp yet moderate hop bitterness. Its well-balanced profile makes DPA the perfect beer to accompany a hearty mountain picnic or a night on the town. For those who seek beers characterized by excitement, flavor and distinction, Denver Pale Ale is the natural choice.', 'http://www.greatdivide.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
