INSERT INTO beerbuddies_db.beer VALUES (221, 296, 5, 60, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', 'This name became a reference. This beer is mostly pointed out with its product name: â€œa Paterkeâ€. This â€œPaterkeâ€ is a chestnut coloured dark beer with a high fermentation (6.7 alcohol content) and a full taste.', 'http://www.sintbernardus.be', 6.70, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
