INSERT INTO beerbuddies_db.beer VALUES (223, 905, 3, 37, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Ever tried a Skinny Dip? You wouldn''t be alone. Featured by both Men''s Journal and the Today Show as a favorite summer brew, this full-bodied, highly drinkable beer makes a splash every summer in our Seasonal line-up. Cascade hops frolic with a hint of lime leaf, giving the beer complexity that''s surprisingly refreshing.', 'http://www.newbelgium.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
