INSERT INTO beerbuddies_db.beer VALUES (226, 905, -1, -1, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Our first venture into organically-produced beer, Mothership Wit Organic Wheat Beer elevates the zesty Wit or White beers of Belgium. Our far-flung Beer Rangers affectionately refer to our Fort Collins brewery as the Mothership, a name that conjures images of earth shot from space and the interconnectivity of it all. Mothership Wit is brewed with wheat and barley malt, as well as coriander and orange peel spicing resulting in a balance of citrus and sour flavors held in suspension by a bright burst of carbonation.', 'http://www.newbelgium.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
