INSERT INTO beerbuddies_db.beer VALUES (249, 923, 3, 43, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'We think the russian tsar would have liked his stout this way. A dark, rich ale in which a generous sweetness with roasted malt bitterness. Serving temp.10Â°C/50Â°F. Great with vanilla ice cream or dark chocolate.', 'http://nogne-o.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (250, 923, 2, 25, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'In this quite dark ale, dark malts provide flavors of coffee and dried fruit. Recommended serving temperature 10Â°C/50Â°F. Try with dark chocolate, cheese, or red meat dishes.', 'http://nogne-o.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (251, 923, 3, 26, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'A refreshing light and hoppy ale. Probably our best allrounder. Recommended serving temperature 8Â°C/45Â°F. Ideal with barbequed or smoked meat dishes.', 'http://nogne-o.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
