INSERT INTO beerbuddies_db.beer VALUES (335, 935, 3, 33, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'Levity is our lighter take on the amber ale. Munich and honey malts give it a full-bodied flavor and a happy-go-lucky personality. Then we let the finishing hops shine, for a beer that''s crisp instead of bitter, as many ambers are. Levity was named by our brewers partly for its light color - and partly for the way it just refuses to take itself too seriously. Hey, we could all use a little levity once in a while.', '', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (336, 935, 11, 116, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'Light and refreshing, Easy Street Wheat is an unfiltered American-style wheat beer. Leaving in the yeast gives the beer a nice, smooth finish and a slightly citrusy flavor. Easy Street Wheat gets its name by brewers "taking it easy" and not filtering the beer. However, for ultimate enjoyment, we encourage you to work just a little harder in pouring it: just pour 2/3 of the beer into a glass, swirl what''s left to stir up the yeast, then pour the rest and enjoy.', '', 4.60, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (337, 161, 3, 26, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Boulevard Pale Ale is a smooth, fruity, well-balanced beer with year-round appeal. A variety of caramel malts impart a rich flavor and amber color, while liberal use of whole hops adds zest and aroma. Pale Ale is the first beer we brewed, and continues to be a perennial favorite.', 'http://www.blvdbeer.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (338, 161, 2, 25, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'The intense flavors of dark-roasted malt in Boulevardâ€™s rendition of the classic English porter are perfectly balanced by a generous and complex hop character. Bully! Porterâ€™s robust nature makes it the ideal companion to a variety of foods, from seafood to chocolate.', 'http://www.blvdbeer.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
