INSERT INTO beerbuddies_db.beer VALUES (345, 161, 3, 42, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Velvety black and perfectly opaque, our bottled Dry Stout is the somewhat livelier companion to our popular draught version of this enduring style. This surprisingly smooth, drinkable beer is a delightful harmony of smoky roasted flavors and tangy, coffee-like notes.', 'http://www.blvdbeer.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
