INSERT INTO beerbuddies_db.beer VALUES (350, 272, 5, 65, 'Roeselarestraat 12b', 'Esen', 'West-Vlaanderen', 'Belgium', 'An arabier is a pure malt beer 8Â°vol/alc brewed with flower Nugget-hops from Poperinge. It has the special dry-hopping taste and aroma, so appreciated by beer lovers all over the world. It is one of the two main beers from De Dolle Brouwers throughout the year. Aging time is limited due to the fact that hop bitterness is declining with the time. Store arabier cool and dark and serve cool at 10Â°C. Cheers!', 'http://www.dedollebrouwers.be/', 9.00, 0.00, 0.00, 0, '9999-01-01', '51.0281, 2.9038', '2018-10-05');
