INSERT INTO beerbuddies_db.beer VALUES (360, 7, 5, 62, 'Rue de l''Abbaye 8', 'Rochefort', 'Namur', 'Belgium', 'Reddish-brown colour, with a very compact head and an aroma of figs, feels like honey in the mouth. The alcohol profile is a major component in the flavour of this rich ale. It is very similar to 6 and 8, but has much more of everything. Some may find the high alcohol content to be disagreeable.', '', 11.30, 0.00, 0.00, 0, '9999-01-01', '50.1999, 5.2277', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (361, 167, 3, 29, 'Rue du Village 32', 'Houffalize-Achouffe', 'Luxembourg', 'Belgium', 'Description : Dark Ale, strong, spicy, lightly hoppy, with evoluting taste. Natural Beer, bottle refermented, unfiltered, not pasteurised and without any additives Alcohol : 8,5% alc./vol. Original gravity : 16 Â°Plato Storage : Store the bottles vertically in a cold place, sheltered from light. The yeast deposit can either be drunk or left according to taste Serve at : 8 to 12Â°C (botlle)', '', 8.50, 0.00, 0.00, 0, '9999-01-01', '50.1507, 5.7442', '2018-10-05');
