INSERT INTO beerbuddies_db.beer VALUES (397, 609, 3, 35, '1430 Vantage Court #104A', 'Vista', 'California', 'United States', 'Our American-style Barleywine undergoes a three hour boil to intensify the caramel malts and the enormous Pacific Northwest hop charge. The result is a rich, estery brew with toffee notes and citrus hop flavors layered throughout. Enjoy this brew fresh today or lay it down for aging to see how the flavors of each vintage evolve.', 'http://www.greenflashbrew.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.136, -117.225', '2018-10-05');
