INSERT INTO beerbuddies_db.beer VALUES (400, 1023, 4, 55, 'Emil-Ott-Strasse 1-5', 'Kelheim', '', 'Germany', 'Dark-ruby, almost black-colored and streaked with fine top-fermenting yeast, this beer has a compact and persistent head. This is a very intense wheat doppelbock with a complex spicy chocolate-like arome with a hint of banana and raisins. On the palate, you experience a soft touch and on the tongue it is very rich and complex, though fresh with a hint of caramel. It finishes in a rich soft and lightly bitter impression.', 'http://www.schneider-weisse.de', 8.20, 0.00, 0.00, 0, '9999-01-01', '48.9175, 11.8735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (401, 905, 5, 61, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Our Trippel Belgian Style Ale (pronounced triple) opens with a bold blast of hops that slowly gives way to the fruity esters implied by our Belgian yeast strain. The Three Graces hand-painted on the label are Zeusâ€™s daughters Aglaia (splendor), Euphrosyne (mirth) and Thalia (good cheer). In the Belgian tradition of brewing singles, doubles and triples, Trippel is the strongest with the longest fermentation. Remarkably smooth and complex, our bottle-conditioned Trippel is spiced with a trace of coriander.', 'http://www.newbelgium.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
