INSERT INTO beerbuddies_db.beer VALUES (403, 905, 5, 60, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Winner of four World Beer Cup medals and eight medals at the Great American Beer Fest, Abbey Belgian Ale is the Mark Spitz of New Belgiumâ€™s lineup - but it didnâ€™t start out that way. When Jeff and Kim first sampled the beer at the Lyons Folks Fest, reviews were mixed at best. One of founder Jeffâ€™s first two Belgian style homebrews (along with Fat Tire), Abbey is a Belgian dubbel (or double) brewed with six different malts and an authentic Belgian yeast strain. Abbey is bottle-conditioned, weighs in at 7.0% alcohol by volume, and pairs well with chocolate (or boldly served by itself) for dessert.', 'http://www.newbelgium.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
