INSERT INTO beerbuddies_db.beer VALUES (406, 1054, 3, 26, '2323 N Milwaukee Ave', 'Chicago', 'Illinois', 'United States', 'An amber pale ale dry hopped with a blend of American hops.', 'http://revbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9234, -87.6982', '2018-10-05');
