INSERT INTO beerbuddies_db.beer VALUES (408, 723, 5, 65, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'Brewed in the Franco-Belgian tradition of strong golden ales. Spicy and peppery with a gentle hop bouquet and the beguiling influence of wild yeast.', 'http://www.jollypumpkin.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (409, 723, 3, 33, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'An artisan amber ale brewed in the Flanders tradition. Deep amber with earthy caramel, spice, and sour fruit notes developed through natural barrel aging. Unfiltered, unpasteurized and blended from barrels ranging in age from two to ten months.', 'http://www.jollypumpkin.com', 7.20, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (410, 919, -1, -1, '455 North Main Street', 'Fort Bragg', 'California', 'United States', '', 'http://www.northcoastbrewing.com/home.htm', 9.00, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (411, 441, 3, 26, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'This Fresh Hop Pale Ale is all about celebrating the hop harvest in the fall. Fresh picked hops have to be added to the brew immediately and in abundance. Roughly 270 pounds of Crystal hops from Doug Weathers'' farm outside Salem, Oregon will be added to the 50 barrel batch in addition to some dry kilned whole flower hops. That adds up to approximately 5.5 pounds of hops per barrel brewed. Another deliciously interesting beer in our Bond Street Series.', 'http://www.deschutesbrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (412, 130, -1, -1, '2598 Telegraph Avenue', 'Berkeley', 'California', 'United States', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.8634, -122.259', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (413, 1192, -1, -1, 'Franseplaats 1', 'Nijmegen', '', 'Netherlands', '', '', 12.00, 0.00, 0.00, 0, '9999-01-01', '51.8486, 5.8639', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (414, 604, 1, 13, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Great Divideâ€™s award-winning Hibernation Ale is Coloradoâ€™s original strong ale â€“ it has been our winter seasonal each year since 1995. Since that time, Hibernation has become the most sought-after winter beer in Colorado. Hibernationâ€™s massive flavors are so intense that it requires over three months of aging each year. Each summer, while our brewers are still spending their weekends in flip-flops and shorts, they prepare for Julyâ€™s Hibernation brewing schedule. We cellar Hibernation until late October, when it reaches the peak of perfection. This lengthy aging process gives Hibernation its revered malty richness, complex hop profile and hearty warming character, which is perfect right out of the bottle or cellared for longer periods of time. Hibernation is a lively treat that really beats the winter chill. This scrumptious, collectible, and imminently cellarable ale is only available for six weeks each year, from November 1 to December 15. Hibernation Ale is the perfect gift or accompaniment to your winter festivities.', 'http://www.greatdivide.com/', 8.10, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (415, 623, 1, 15, '4301 Leary Way NW', 'Seattle', 'Washington', 'United States', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '47.6592, -122.366', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (416, 905, 1, 5, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Pull on your wool socks and crack open a 2Â° Below Ale. This tasty winter warmer started life as a small batch beer brewed for the Al Johnson Uphill Downhill â€“ a telemark ski race in Crested Butte, Colorado. The Uphill Downhill celebrates the exploits of Al Johnson, letter carrier extraordinaire, who delivered mail by ski in the late 1800â€™s. Dry hopping during fermentation creates a floral nose with a hint of pepper and spicy, subtle undertones. 2Â° Below provides a bright, hoppy palate and a cheery warm afterglow.', 'http://www.newbelgium.com/', 6.60, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (417, 425, 2, 25, 'Camwal Road', 'Harrogate', 'North Yorkshire', 'United Kingdom', '', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '53.9999, -1.501', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (418, 425, -1, -1, 'Camwal Road', 'Harrogate', 'North Yorkshire', 'United Kingdom', '', '', 4.10, 0.00, 0.00, 0, '9999-01-01', '53.9999, -1.501', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (419, 604, 3, 31, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Hoppier, maltier and with more alcohol than a standard IPA, Hercules Double IPA definitely is not for the faint of heart. Hercules Double IPA is, however, an elixir fit for the gods. A brash but creamy wonder, Hercules pours a deep orange-coppery color, forming substantial lace in the glass. Hercules Double IPA delivers a huge amount of piney, floral, and citrusy hop aroma and flavor from start to finish. A hefty backbone of nutty, toffee-like malt character balances Herculesâ€™ aggressive, punchy hop profile.', 'http://www.greatdivide.com/', 9.10, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (420, 604, 3, 26, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'The September hop harvest is a once-a-year opportunity to brew with fresh hops, also called â€œwet hops.â€ Given the perishable nature of just-harvested hop cones, they are shipped overnight to Great Divide shortly after harvest. The morning of the scheduled hop delivery in Denver, Great Divideâ€™s brewers begin brewing Fresh Hop and are ready to hop the beer just as the fresh hops are delivered. Using fresh hops is a big endeavor, requiring four to five times the volume of hops compared to the usual process of using pelletized hops. This complex process brings impressive results: Fresh Hop is an American-Style Pale Ale with moderate hop bitterness marked by a unique and intensely grassy hop flavor and aroma. Fresh Hop is a superbly refreshing, medium bodied, light-copper colored pale ale.', 'http://www.greatdivide.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
