INSERT INTO beerbuddies_db.beer VALUES (423, 441, 3, 31, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'After several months of experimentation, energy and obsession, Deschutes Breweryâ€™s brewers have triumphed once again. Inversion I.P.A.''s trio of American hops delivers an over-the-top nose with hints of orange and grapefruit. Inversion is then dry-hopped for seven days resulting in an added hoppy kick. To balance the hop character, Deschutesâ€™ brewers used crystal and caraston malts that weave throughout the beer providing soft, complex caramel flavors. Just like clear days up on the mountain, Inversion I.P.A. will deliver a path to higher ground. Inversion I.P.A. is a phenomenal NW-style I.P.A., beckoning all beer drinkers and enticing I.P.A. lovers to invert their world and find clarity above the routine of the everyday.', 'http://www.deschutesbrewery.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
