INSERT INTO beerbuddies_db.beer VALUES (431, 905, 7, 77, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Climb on in and grab a paddle. Our first foray into lagered beers, Blue Paddle Pilsener-Lager, is a Czech style pilsener with a refreshing crispness from noble hops and a rich, malty finish. â€˜Blue Paddleâ€™ refers to the implement our warehouse managerâ€™s Grandma once used to lovingly paddle his a** when she caught him stealing sips of her beer. With more body than a traditional Belgian pils, Blue Paddle is reflective of Europeâ€™s finest pilseners.', 'http://www.newbelgium.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
