INSERT INTO beerbuddies_db.beer VALUES (439, 905, -1, -1, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'La Folie Wood-Aged Biere, is our original wood-conditioned beer, resting in French Oak barrels between one and three years before being bottled. . Peter Bouckaert, came to us from Rodenbach â€“ home of the fabled sour red. Our La Folie emulates the spontaneous fermentation beers of Peterâ€™s beloved Flanders with sour apple notes, a dry effervescence, and earthy undertones. New in 2010, we''ll do a single bottling of La Folie for the year. Collect the 22oz unique to 2010 designed bottle and start a yearly wood-aged collection of goodness.', 'http://www.newbelgium.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (440, 296, 5, 62, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', 'The absolute top quality in the hierarchy of the St. Bernardus beers. It is also the beer with the highest alcohol content (10.50 %). A dark ivory coloured beer with a high fermentation. The show piece of the brewery. Thanks to its soft and unconditionally genuine aroma, the beer can be smoothly tasted. The Abt has a very fruity flavour.', 'http://www.sintbernardus.be', 10.00, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
