INSERT INTO beerbuddies_db.beer VALUES (475, 296, 5, 60, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', 'This noble delicious beer with a high fermentation has a ruby purple colour with a full malty and fruity taste (8% alcohol content). This beer has a beautiful round froth due to the second fermentation with a taste that creates a perfect balance between sweet and sour.', 'http://www.sintbernardus.be', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
