INSERT INTO beerbuddies_db.beer VALUES (480, 757, 7, 86, 'Lichtenfelser Strae 9', 'Kulmbach', 'Bayern', 'Germany', 'Schwarzbier means "black beer" in German. It is a medium-bodied, malt-accented dark brew, very opaque and deep-sepia in color, with a chewy texture and a firm, creamy, long-lasting head. In spite of its dark color, it comes across as a soft and elegant brew that is rich, mild, and surprisingly balanced. It never tastes harsh, toasty or acrid. The beer is often referred to as a Schwarzpils, a "black Pils," but, unlike a blond Pils, which can be assertively bitter, the hop bitterness in Schwarzbier is always gentle and subdued. In a glass, Schwarzbier looks much like a British dark ale, but looks can be deceiving. Schwarzbier, unlike a British ale, has a clean lager taste that leaves next to no perception of fruitiness on the palate. Instead, Schwarzbier produces very mild, almost bittersweet, notes of chocolate, coffee, and vanilla. Like most traditional German lagers, Schwarzbier has a malty middle, but the sweetness is never cloying or overpowering. The beer is moderately to well attenuated and the finish tends to be dry. Its alcohol level by volume is in the range of 4.5 to 5%, rarely higher. To accentuate the Schwarzbier''s dark elegance and appealing head, always serve it in a tall, fluted or tulip-shaped glass.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '50.106, 11.4442', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (481, 296, 5, 61, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', 'This beer, with high fermentation, has a pale amber colour and a flowery, fruity taste with a harmonious balance between sweet and sour (8% alcohol content). This beer has a thick and vivid froth and strikes by its balanced taste with a delicate bitterness.', 'http://www.sintbernardus.be', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (482, 296, -1, -1, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', '', 'http://www.sintbernardus.be', 0.00, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
