INSERT INTO beerbuddies_db.beer VALUES (485, 7, 3, 29, 'Rue de l''Abbaye 8', 'Rochefort', 'Namur', 'Belgium', 'eddish colour, almost like autumn leaves, very consistent texture with a slightly spicy aroma and an intense taste of caramel, fruit, and hints of raisins. It is only brewed about once per year, representing approximately 1% of total beer production, thus is quite difficult to obtain.', '', 7.50, 0.00, 0.00, 0, '9999-01-01', '50.1999, 5.2277', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (486, 277, -1, -1, 'Brugsstraat 43', 'Wevelgem', 'West-Vlaanderen', 'Belgium', '', '', 8.50, 0.00, 0.00, 0, '9999-01-01', '50.8105, 3.1857', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (487, 262, 5, 61, 'Antwerpsesteenweg 476', 'Westmalle', 'Antwerpen', 'Belgium', 'Was first brewed in 1934 and the recipe has not changed since 1956. It is made with pale candy sugar and has a very pale color produced from a mash of light pilsener malts. Styrian Goldings hops are used along with some German varieties and the classic Saaz pilsener hop. After a long secondary fermentation, the Tripel Westmalle is bottled with a dose of sugar and yeast. This beer holds up well in the bottle over time and seems to soften with age.', 'http://www.trappistwestmalle.be', 9.50, 0.00, 0.00, 0, '9999-01-01', '51.2974, 4.6881', '2018-10-05');
