INSERT INTO beerbuddies_db.beer VALUES (717, 842, 3, 42, '13300 Bothell-Everett Highway #304', 'Mill Creek', 'Washington', 'United States', 'Black as the darkest night, rich as the most decadent dessert, Terminator is for the true stout lover. This is a full bodied and flavor packed ale which draws it''s robust complexity from kiln-baked specialty grains. Look for a wide array of toasted, chocolate, nutty and coffee-like flavors in every pint! The devoted swear by it, and it remains one of our top selling ales year after year.', '', 6.45, 0.00, 0.00, 0, '9999-01-01', '47.8774, -122.211', '2018-10-05');
