INSERT INTO beerbuddies_db.beer VALUES (764, 526, 3, 31, '515 Jefferson Street SE', 'Olympia', 'Washington', 'United States', 'Fish Tale Organic India Pale Ale is a medium-bodied beer with a rich golden color. The organic pale and crystal malts lay down a firm malt body. This provides the backbone for an assertive hop profile featuring organic Pacific Gem. The moment the Mighty Fish Brewers sampled this pungent and resinous New Zealand hop, they knew it would be perfect for their Organic I.P.A. The result: A Cascadian treasure.', 'http://www.fishbrewing.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '47.0437, -122.897', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (765, 526, 3, 26, '515 Jefferson Street SE', 'Olympia', 'Washington', 'United States', '', 'http://www.fishbrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '47.0437, -122.897', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (766, 526, 3, 33, '515 Jefferson Street SE', 'Olympia', 'Washington', 'United States', 'Medium-bodied with an appealing amber hue, this is the First Ale of the Republic. Its organic pale, Munich, and crystal malts create a gentle sweet character that is difficult to resist. From organic Hallertauer hops come a zesty flavor and aroma that beautifully balance Organic Amber''s malt profile. The result: Truly delicious ale that salutes organic farmers and all the goodness they bring to our tables.', 'http://www.fishbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '47.0437, -122.897', '2018-10-05');
