INSERT INTO beerbuddies_db.beer VALUES (821, 1204, 3, 31, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'An "India Pale Ale" by definition is highly hopped and high in alcohol (ours is 6.9% alc./vol.). Medium Bodied Refreshing Ale Light-medium malt character with a heavy dose of over the top hops! Two full weeks of "dry hopping" give this beer its abundant hop aroma and crisp hop flavor.', 'http://www.stonebrew.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
