INSERT INTO beerbuddies_db.beer VALUES (832, 919, 3, 43, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'Produced in the tradition of 18th Century English brewers who supplied the court of Russia''s Catherine the Great, Old Rasputin seems to develop a cult following wherever it goes. It''s a rich, intense brew with big complex flavors and a warming finish.', 'http://www.northcoastbrewing.com/home.htm', 9.00, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (833, 604, 3, 43, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Traditionally, Imperial Stouts, the biggest and boldest of all stouts, were brewed with massive amounts of roasted malts and hops, resulting in a velvety smooth but robust beer characterized by high alcohol content and extremely high hop bitterness. Meeting the challenge of this aggressive, challenging beer style, Great Divideâ€™s Yeti Imperial Stout is an onslaught of the senses. An almost viscous, inky-black brew, Yeti opens with a massive, roasty, chocolate, coffee malt flavor that eventually gives way to rich toffee and burnt caramel notes. Packed with an enormous quantity of American hops, Yetiâ€™s hop profile reveals a slightly citrusy, piney, and wonderfully dry hoppy finish.', 'http://www.greatdivide.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
