INSERT INTO beerbuddies_db.beer VALUES (876, 1307, 5, 72, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Topped by a sumptuous head of foam, La Terrible possesses a fruity aroma enriched with notes of roasted malt and Madeira. Its long lasting flavour is both elegant and full bodied. La Terrible is a dark brown beer on lees and is part of a collection of exotic and refined Unibroue beers brewed using 100% natural raw materials. It may be drunk as an aperitif or as an after dinner digestive. It is equally a perfect accompaniment to the above-mentioned dishes or a pleasant alternative to coffee.', 'http://www.unibroue.com', 10.50, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
