INSERT INTO beerbuddies_db.beer VALUES (879, 935, 1, 1, '800 East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'The distinctive hop character of our 5 Barrel Pale Ale is due to the extraction of essential oils from select hops. We treat 5 Barrel Pale Ale to an infusion of fresh whole hop flowers in the Hop Back and the Fermentor, as well as four hop additions during the kettle boil. We like how this gives the beer a fresh, lively flavor and aroma.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.5894, -105.063', '2018-10-05');
