INSERT INTO beerbuddies_db.beer VALUES (908, 604, 3, 35, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Old Ruffian is a hefty, hop-forward Barley Wine. Seemingly mellow at first sniff, with its subtle fruit aromas and complex caramel sweetness, this deep mahogany-hued ale quickly shows its true character marked by bold hop flavors and massive hop bitterness. Old Ruffianâ€™s rich, slightly creamy, caramel malt mouthfeel balances its grapefruit, pine, and floral hop flavors, working wonders on your palate.', 'http://www.greatdivide.com/', 10.20, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
