INSERT INTO beerbuddies_db.beer VALUES (917, 1177, 3, 31, '1195-A Evans Avenue', 'San Francisco', 'California', 'United States', 'No lightweight, Big Daddy I.P.A tips the scales with a huge hop flavor and a clean, dry finish that leaves the scene without a trace.', '', 6.50, 0.00, 0.00, 0, '9999-01-01', '37.7387, -122.381', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (918, 604, 3, 31, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Traditionally India Pale Ales, the hoppiest of all pales, were brewed with more alcohol and large quantities of hops in order to survive the lengthy ocean journey from the U.K. to India. Unlike our brewing forefathers, Great Divide enjoys the modern benefits of refrigeration and we donâ€™t have any plans to ship Titan IPA to India. Instead, we brew Titan IPA for hop disciples â€“ independent beer drinkers seeking out robust, flavorful beers characterized by their abundance of hops flavor, aroma and bitterness. As a big, aggressively hopped India Pale Ale, Titan IPA fills this bill â€“ beginning with piney hop aromas and citrus hop flavors, and finishing with a rich, malty sweetness that is carefully balanced with crisp hop bitterness.', 'http://www.greatdivide.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (919, 1185, 1, 1, 'St Peter''s Hall', 'Bungay', 'Suffolk', 'United Kingdom', 'Water is extracted from our own 300â€™ deep borehole and combined with Soil Association accredited light malted barley from Norfolk. Organic hops provide the distinctive palate. The yeast used is St. Peterâ€™s own single strand variety. The result is a delicate, clean, crisp, lightly carbonated, traditional English Ale with a full â€˜citrus hopâ€™ aftertaste. This lovely beer won the Soil Associationâ€™s top prize in 2002 and a silver medal in 2006.', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '36.7282, -76.5836', '2018-10-05');
