INSERT INTO beerbuddies_db.beer VALUES (932, 604, 3, 43, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Crack open Yeti Imperial Stoutâ€™s sophisticated sibling â€“ Oak Aged Yeti Imperial Stout. Although these beers come from the same clan, they have entirely different personalities. Aging on a blend of French and toasted oak chips infuses a subtle oak and vanilla character into Yetiâ€™s already intense chocolate, roasted coffee malt flavor and hugely assertive hop profile. Who says you canâ€™t tame a Yeti?', 'http://www.greatdivide.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
