INSERT INTO beerbuddies_db.beer VALUES (942, 823, 11, 121, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Ruby colored ale fermented with over 500 pounds of real black and red raspberries for a distinct berry aroma and a tart, sweet flavor. This beer is gently filtered to preserve its delicate profile and is made with both Belgian Ale Yeast and our Proprietary Lager Strain.', 'http://www.manayunkbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (943, 823, 3, 35, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'This winter warmer will knock the chill away until summer. It used as much malt as our brew house can handle and armloads of fresh hops and lovingly laid in our fermentor for four months. Massively malty and balanced with burly bitterness it is truly the king of beers, approaching wine in strength. A definitive one to have when youâ€™re only having one. Adoringly served in brandy snifters to preserve precious properties.', 'http://www.manayunkbrewery.com/', 12.70, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (944, 823, 3, 32, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Imperial, or super IPAâ€™s were spawned out of the fascination of hops by the American consumer and are beyond Pale Ales and IPAâ€™S in terms of both hop and alcohol content. Our interpretation is orange-gold in color, lightly bitter but highly hoppy with a firm malt backbone. Weâ€™ll gladly put this head-to-head with the best that those California Hophead/Brewers have to offer.', 'http://www.manayunkbrewery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
