INSERT INTO beerbuddies_db.beer VALUES (945, 823, 7, 84, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'In strict accordance with the German purity law of 1516, we present to you this annually brewed festbier. Traditionally brewed in March and stored deep in the caves of Germany, this beer was brought to the masses to celebrate in October. It is a Vienna-style lager with a bit more malt and hops making a malty but balanced beverage. Copper-orange in color, it sports a toasty malt backbone that wonderfully compliments itself with many of our menu items.', 'http://www.manayunkbrewery.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (946, 823, 1, 1, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'A true English session ale brewed in the pale ale style using ye olde techniques of yesteryear. Specially crafted to inspire you and your thirstiest mates barstool conversations. Light copper in colour. This pint is quite malty with just enough East Kent hops for a nice, earthy hoppiness. Naturally cask conditioned, this may be served a little cold for a true Brit but is a complimentary double nod to one of the 1st beer styles. Cheers mate!', 'http://www.manayunkbrewery.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (947, 823, 3, 26, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'A well-balanced, hoppy American style pale ale with a generous usage of Caramel and Crystal malts. This beer is amber in color and is finished with fresh Cascade, Columbus and Mt. Hood hops from the Pacific Northwest for a wonderful floral aroma. World Beer Cup Bronze Medal winner and a Perennial favorite here at the Brewery. Also available in bottles to go.', 'http://www.manayunkbrewery.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (948, 823, -1, -1, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', '', 'http://www.manayunkbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (949, 823, 7, 77, '4120 Main Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Our lightest beer â€“ pale blonde in color with a crisp, softly sweet malt flavor, smooth finish and very subtle bitterness. Went to the final judging table at the GABF alongwith the Mega Breweries last year!', 'http://www.manayunkbrewery.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.0236, -75.2202', '2018-10-05');
