INSERT INTO beerbuddies_db.beer VALUES (980, 409, 3, 37, '237 West Butler Avenue', 'Chalfont', 'Pennsylvania', 'United States', 'For those who enjoy a clean, crisp, refreshing beer this medium copper colored brew is perfect. With its low level of hop bitterness and slightly sweet flavor it is one of our lightest ales. We use the lightest grains with Kent Goldings and Liberty hops. This beer is an excellent choice for the not so brave.', 'http://www.crabbylarrys.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '40.2795, -75.2143', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (981, 409, 2, 22, '237 West Butler Avenue', 'Chalfont', 'Pennsylvania', 'United States', 'Rich and smooth on the pallate this ale is a near perfect "Irish Red". A variety of hops, Mt. Hood, Liberty & Fuggles combined with some roasted barley make an agreeable brew.', 'http://www.crabbylarrys.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.2795, -75.2143', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (982, 409, 3, 33, '237 West Butler Avenue', 'Chalfont', 'Pennsylvania', 'United States', 'A rich, malty beer made with classic American hops for a full and complex flavor. Very smooth in aroma and palate. The caramel overtones leave a nice finish.', 'http://www.crabbylarrys.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.2795, -75.2143', '2018-10-05');
