INSERT INTO beerbuddies_db.beer VALUES (1006, 700, -1, -1, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'Traditional Belgian-style golden ale, complex aroma and flavor of plums, spice and bananas with a refreshing balanced bitterness.', 'http://www.ironhillbrewery.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1007, 700, 2, 25, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'Historically, porter had its heyday in 18th century London, where it was the beer of the working class. It doesn''t take much to work up a thirst for this flavorful beer. The distinct roasted and chocolate notes are well balanced by a slight bitterness.', 'http://www.ironhillbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1008, 700, 3, 26, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'Hold onto your beer mugs, because this medium-bodied beer has been overwhelmed with hop additions. Brewed as an American pale ale, it''s a celebration of American hop varieties: Cascade, Crystal, Centennial and Chinook. You won''t be disappointed.', 'http://www.ironhillbrewery.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1009, 700, -1, -1, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', '', 'http://www.ironhillbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1010, 700, 1, 5, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'English style best bitter. It is a traditional English pub ale that is easy drinking, often referred to as a "session beer". It is medium-bodied and copper colored with a noticeable malt flavor up front that finishes with a hop bitterness and floral hop flavor.', 'http://www.ironhillbrewery.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
