INSERT INTO beerbuddies_db.beer VALUES (1013, 549, 1, 15, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'Founders flagship beer. Dirty Bastard is an absolute beautiful beer to behold. Dark ruby in color and brewed with ten varieties of imported malts this beer continuously lives up to its reputation as a bold and powerful ale. Dirty Bastard is complex in the finish with hints of smoke and peat paired with a malty richness, finalized with a good bit of hop attitude. This beer ain''t for the wee lads.', 'http://www.foundersbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
