INSERT INTO beerbuddies_db.beer VALUES (1020, 62, 5, 66, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'The Beast is a seducer - accommodating, complicated, powerful, dark and created to last the ages. With a deep burgundy color and aromas of honey, nutmeg, mandarin orange and pineapple, this massive and challenging brew has flavors akin to a beautiful Carribean rum. Dates, plums, raisins and molasses are dominant in a rich vinous texture. Cellarable for 10+ years.', 'http://www.averybrewing.com/', 14.90, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
