INSERT INTO beerbuddies_db.beer VALUES (1159, 540, 7, 84, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'Dogtoberfest are shrouded in mystery, but scholars think it has everything to do with an insane German king and a crazed Oompah band. You can read the full historical record of Dogtoberfest at FlyingDogAles.com. Dogtoberfest is deep mahogany in color with an intriguing caramel finish and brewed with 100% imported German ingredients for a true German flavor.', 'http://www.flyingdogales.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
