INSERT INTO beerbuddies_db.beer VALUES (1170, 869, 1, 21, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'This is our darkest and most heavy regular offering. It is virtually black in color and features rich roasted malt flavor with a delicate caramel and vanilla finish. It is carbonated and served with the use of nitrogen gas, giving the Black Water a beautiful cascading pour and thick, creamy foam atop your glass. Made with only the freshest American malts and English hops.', 'http://www.townhallbrewery.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1171, 869, 3, 31, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'Our brewers believe an American IPA should be full of American hops. Masala Mama uses three different West Coast varieties, over five hop additions. This copper-colored ale is not strictly about hops; American pale barley and several caramel malts balance the flavor for a green, toasted caramel finish. The British realized an abundance of hops will help preserve beer â€¦ we realized hops can preserve our customers.', 'http://www.townhallbrewery.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1172, 869, 8, 95, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', '', 'http://www.townhallbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1173, 869, -1, -1, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', '', 'http://www.townhallbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1174, 869, 1, 15, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'Hope and King is a full-body brew and is rich in malt complexity. Brewed with both English and American barley and many, many specialty malts this deeply colored ale has hints of roasted chocolate, caramel and raisins with very little hop presence. Our interpretation of the classic ale that originated in Glasgow, Scotland.', 'http://www.townhallbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1175, 869, 1, 1, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'Most welcoming British pubs off a house ale or "pub ale" â€” this is ours. We use only the finest English barley, hops and yeast to create this classic English-style pale ale. It is noted for its nice malt flavor balanced with a medium hop presence. The pub ale is often referred to as our house "session beer" (a beer you can drink a number of and not fall off your barstool).', 'http://www.townhallbrewery.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1176, 869, 3, 37, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'This American-style golden ale is our lightest, in both color and flavor. Bright Spot is brewed with locally malted 2-row barley and the finest American, Czech and German hops lending a well-balanced, refreshing taste. A compliment to nearly any of our menu choices.', 'http://www.townhallbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
