INSERT INTO beerbuddies_db.beer VALUES (1200, 953, 3, 42, 'Quoyloo', 'Orkney', 'Scotland', 'United Kingdom', 'Dragonhead is a legendary stout: dark, intense and fully-flavoured, it is our tribute to the Vikings and their cultural legacy in Orkney. On the nose, this black stout has a smooth roasted malt aroma giving bitter chocolate, dark roasted coffee and Smokey notes balanced by hints of spicy Goldings hop. On the palate, the dark roasted malts combine to give a rich, rounded palate with chocolate, toast and nut flavours, with a satisfying spicy hop finish.', 'http://www.orkneybrewery.co.uk/', 4.00, 0.00, 0.00, 0, '9999-01-01', '59.0697, -3.3135', '2018-10-05');
