INSERT INTO beerbuddies_db.beer VALUES (1238, 524, 3, 33, '1400 Ramada Drive', 'Paso Robles', 'California', 'United States', 'A British Pale Ale never tasted so fresh. We challenge our good friends across the pond to match this one. Canâ€™t be done. Weâ€™ve honored the traditions of the great British Pale brewers of Burton-on-Trent using our patented Firestone Union oak barrels. Youâ€™re left with a mild blend of vanilla and toasted oak flavor touched with an elegant hint of English noble hops. DBA is the flagship of our company and wildly popular.', 'http://www.firestonewalker.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.5953, -120.694', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1239, 404, 3, 31, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'Our Islander IPA is a powerful West Coast IPA. This beer bites back with an intense hoppy zing and high alcohol content. The Islander IPA is dry hopped with tons of Centennial & Chinook hops and its fruity aroma will win your approval.', 'http://www.coronadobrewingcompany.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1240, 404, 2, 25, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'A robust porter, very dark in color and a roasted malt flavor from chocolate malts. Its slight bitterness is rightfully balanced with a sweet smooth finish. A full-bodied beer with medium hop bitterness and aroma.', 'http://www.coronadobrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
