INSERT INTO beerbuddies_db.beer VALUES (1256, 29, 3, 32, '2351 Alpine Boulevard', 'Alpine', 'California', 'United States', 'A West Coast Double IPA So mega-hopped it will take you to hop heaven. Weâ€™ve used hops in the boil, more hops in the giant hopback, and added to that, an incredible amount of dry-hopping for that cutting-edge â€œhop bite.â€ Once youâ€™ve tasted this unique beer, all others pale in comparison. 1.072 OG Classified IBU 8%ABV', 'http://www.alpinebeerco.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '32.8355, -116.765', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1257, 1204, 2, 25, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Stone Smoked Porter is dark, rich and complicated. A porter is substantially darker than a pale ale, but not as black or opaque as a stout. Our Smoked porter has a captivatingly deep mahogany color, complimented by silky dark tan head. Rich, full bodied and robust. Smooth, with chocolate and coffee-like flavors balanced by the subtle "smoky" character of just the right amount of peat-smoked specialty malt.', 'http://www.stonebrew.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1258, 1204, 3, 26, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Our flagship ale, Stone Pale Ale is our Southern California interpretation of the classic British pale ale style. Deep amber in color, Stone Pale Ale is robust and full flavored. A delicate hop aroma is complemented by a rich maltiness. This is an ale for those who have learned to appreciate distinctive flavor. Stone Pale Ale is great by itself, or with food that requires a beer of character.', 'http://www.stonebrew.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
