INSERT INTO beerbuddies_db.beer VALUES (1361, 853, 5, 72, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'This traditional Belgian Whitbierre is the multiple gold medal winning Pierre Celis original. White and cloudy in appearance, brewed with wheat and seasoned with orange peel and coriander. A refreshing unfiltered ale that is both sweet and tart.', 'http://www.michiganbrewing.com/', 3.90, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1362, 255, 3, 31, '1313 NW Marshall Street', 'Portland', 'Oregon', 'United States', 'Our award-winning IPA sparkles with effervescence, the result of natural-conditioning, a process where the beer is double-fermented in each bottle, keg or cask. Brewed with a blend of five hop varieties, BridgePort IPA presents a floral, citrusy aroma and full hop flavor, while downplaying the bitterness. The beer pours smooth in the glass, emitting its signature golden glow.', 'http://www.bridgeportbrew.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '45.5311, -122.685', '2018-10-05');
