INSERT INTO beerbuddies_db.beer VALUES (1431, 512, 4, 50, '811 Edward Street', 'Utica', 'New York', 'United States', 'This traditional style German Wheat beer (pronounced) Hah-fuh-vite-zen) remains unfiltered to preserve it''s natural smooth flavor and aroma. Don''t be alarmed by its cloudy appearance or noticeable sediment. The slight banana and clove aroma comes from the authentic German Hefeweizen yeast. It has a light refreshing finish.', 'http://www.saranac.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1432, 1301, 2, 25, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'In 1767 a great Sauk leader was born. His name meant "the black sparrow hawk." He came to be known as Black Hawk. Strong beliefs, independent thinking and an unwavering commitment to his family and his people earned him a reputation as a man of integrity and courage. In 1832, along with 1,200 of his people, Black Hawk was driven from his ancestral home during a war that bears his name. We celebrate this Sauk leader and his courage with our BlackHawk Porter, the kind of beer that make you say, Ma-ka-tai-she-kia-kiak! Chief BlackHawk Porter is a robust black and sharply bittersweet ale. This style was traditionally the session beer consumed by the porters in London.', 'http://www.tyranena.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
