INSERT INTO beerbuddies_db.beer VALUES (1540, 919, -1, -1, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'Pranqster Belgian Style Golden Ale Belgian Ales represent the height of the brewers'' art. Sophisticated brewing techniques, yeast blends and unique flavoring elements have elevated the beers of Belgium to the status enjoyed by wine in other countries. PranQster follows in this tradition using a mixed culture of antique yeast strains that produce a floral nose, a full fruity flavor and a clean finish. Available in 12oz 4 packs and 750 ml traditionally corked and wired bottles. Vital Statistics Style: Belgian Style Golden Ale Color: Soft Gold ABV: 7.6% Bitterness: 20 IBU''s -http://www.northcoastbrewing.com/beer-Pranqster.htm', 'http://www.northcoastbrewing.com/home.htm', 7.60, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
