INSERT INTO beerbuddies_db.beer VALUES (1549, 520, 3, 26, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'We at FiftyFifty believe that beer is good. Especially this beer. Manifesto is one of FiftyFifty''s flagship beers. This beer is a delight for those who take pleasure in craft beers and are looking for something that they can enjoy a few pints of. Manifesto has a restrained malt backbone of flavor with mild biscuit and caramel notes, and the hop character is light to moderate with mild earthiness evolving to a slightly more moderate citrus/piney finish. This is a beer of principle.', 'http://www.fiftyfiftybrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
