INSERT INTO beerbuddies_db.beer VALUES (1551, 85, -1, -1, '137 High Street', 'Burton-upon-Trent', 'Staffordshire', 'United Kingdom', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '52.8046, -1.6281', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1552, 727, 1, 13, 'Middleton Junction', 'Manchester', 'Manchester', 'United Kingdom', '', '', 11.50, 0.00, 0.00, 0, '9999-01-01', '53.5412, -2.1734', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1553, 94, 3, 31, '345 Healdsburg Avenue', 'Healdsburg', 'California', 'United States', 'This is a hoppy IPA. Did I say hops? Your brewer is a hop head! This is a full bodied beer using American grains. The goal was to create a base for showing off the unique floral qualities of two Pacific Northwest hops, Columbus and Cascade. Columbus is a new hybrid High Alpha Acid hop used mostly for bittering, but used heavily as an aromatic in this strong brew. Cascade is the balance that ties the malt and bittering hops together. It is a true specialty ale and is our brewer''s statement on this style.', 'http://www.bearrepublic.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.6112, -122.871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1554, 919, 1, 13, '455 North Main Street', 'Fort Bragg', 'California', 'United States', '', 'http://www.northcoastbrewing.com/home.htm', 11.40, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1555, 769, -1, -1, '1872 North Commerce Street', 'Milwaukee', 'Wisconsin', 'United States', '', 'http://www.lakefrontbrewery.com/index.html', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0547, -87.9053', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1556, 1142, -1, -1, '1075 East 20th Street', 'Chico', 'California', 'United States', '', 'http://www.sierranevada.com/', 9.60, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1557, 94, 3, 43, '345 Healdsburg Avenue', 'Healdsburg', 'California', 'United States', 'Big Bear, as the name implies, is a hefty, black, Russian Imperial-style stout. This bold stout boasts a rich, caramel sweetness lavished by a robust, deep-roasted heartiness you can sink your teeth into. ...Big Bear''s bold flavors are produced using a blend of Belgian and English roasted barley and crystal malts. Some unique flavors come forth in the malt character. ...Louisiana sweet molasses and dark brown sugar. This dark brew is well hopped with Chinook and Cascade hops, which are somewhat, masked by the malt. This is a balanced bold brew boasting an A.V.B. of 8.1% that can creep up on you, "so don''t get mauled". It has a dry roasted quality that masks its'' high alchohol content, so drink responsibly. 2004 California State Fair, Silver Medal Winner; 2002 World Beer Cup, Gold Medal Winner; 2002 Annual Bistro Beer Festival, Hayward, Gold Medal Winner; 2001 North American Brewers'' Award, Honorable Mention - og 1.076, ABV 8.1%, IBU 68.', 'http://www.bearrepublic.com/', 8.10, 0.00, 0.00, 0, '9999-01-01', '38.6112, -122.871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1558, 857, 5, 61, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Cellar aged, subtly complex and deceptively strong. Using two of the old world''s brewing traditions, we have combined British ingredients and methods with Belgian ale qualities.', 'http://www.middleagesbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
