INSERT INTO beerbuddies_db.beer VALUES (1710, 1181, 4, 50, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', 'This coarse-filtered wheat ale is fermented with a German yeast culture for a refreshingly light spiciness and hints of citrus fruit. A cloudy appearance and an immense creamy head are characteristic of this lightly hopped Bavarian Brew.', 'http://www.sprecherbrewery.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1711, 1181, 7, 90, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', 'A flavorful blend of dark roasted and sweet caramel malts defines this smooth and robust lager. The rich, nourishing flavors of a full-bodied Munich bock make this Bavarian-style brew perfect for those long winter nights.', 'http://www.sprecherbrewery.com/', 5.75, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1712, 1181, 7, 86, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', 'This intensely dark Kulmbacher style lager has a superb malt complexity with the distinctive flavors and aromas of coffee, caramel and chocolate. A renowned smoothness and a creamy, tan head make it a world champion.', 'http://www.sprecherbrewery.com/', 5.86, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1713, 1181, 8, 95, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', '', 'http://www.sprecherbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (1714, 520, 2, 25, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'Sustenance to get you through those long, cold winters, the Donner Party Porter is another of FiftyFifty''s flagship beers. Reminiscent of dark chocolate, espresso, and dark dried fruits with a long complex finish, this beer is good for one of those nights where you''ve dug yourself into a snow bank because the ski trip didn''t go quite as planned. Deep brown with mahogany highlights, the hops and malt are very well balanced leaving one to contemplate the myriad of flavors as the beer warms. Moderate to slightly heavy, this beer is heaven in a glass.', 'http://www.fiftyfiftybrewing.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
