INSERT INTO beerbuddies_db.beer VALUES (2008, 810, 3, 35, '195 Taylor Way', 'Blue Lake', 'California', 'United States', 'Our Seasonal Offering. We honor the Harvest & Holidays each year by brewing a traditional Barleywine style ale, using a variety of ingredients. The Label, created by local artist Janis Taylor, is a folksy woodcut based on the tale of John Barleycorn in verse. Brewed in small 10-barrel batches with Certified Organic barley malt, this crimson hued ale has a sweet caramel nose with a zesty spicy, citrus taste. It has a slight hop finish and leaves a warm, tingling sensation on the tongue. A great winter warmer! Starting Gravity 1.098 Finish Gravity 1.020 ABV 9.5 IBU 96 -http://www.madriverbrewing.com/pages/brews/john_barleycorn.html', '', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.879, -123.993', '2018-10-05');
