INSERT INTO beerbuddies_db.beer VALUES (2181, 1307, 3, 33, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Launched in March 1995, Raftman is a beer with a coral sheen that is slightly robust. It contains 5.5 percent alcohol and combines the character of whisky malt with the smooth flavours of choice yeast. It has a subtle and exceptional bouquet that creates a persistent smooth feel. Raftman complements fish, smoked meat and spicy dishes. . It is brewed to commemorate the legendary courage of the forest workers These hard working men knew when to settle their differences and share their joie de vivre with a beer and a whisky.', 'http://www.unibroue.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
