INSERT INTO beerbuddies_db.beer VALUES (2222, 193, 3, 37, '', 'Ronchin', '', 'France', 'Beer of top fermentation, Belzebuth represents the achievement of a more than one hundred year-old know-how, the one of the Brewery Grain d''Orge. Under its copper colour, it hides a strong character for the lovers of sensations. It owes its strength to the subtle mixture of pure malts, hops and yeasts especially selected by our Master-Brewer. At one time this beer was 15%. After the name change it was lowered to 13%.', '', 13.00, 0.00, 0.00, 0, '9999-01-01', '50.6054, 3.0775', '2018-10-05');
