INSERT INTO beerbuddies_db.beer VALUES (2290, 1301, 3, 31, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'Lest we forget Aunt Cal, an early resident of Lake Mills. Local history remembers her for blindly running into a hitching post and saying, "Excuse me, Dr. Dodge!" It was said that she was an old sweetheart of the famous American poet, Henry Wadsworth Longfellow. And she still had the love letters to prove it! Sadly, Aunt Cal never wed. We brewed our Bitter Woman IPA the way we imagine Aunt Cal may have been, very fruity and intensely bitter. So lift up a pint of Bitter Woman IPA and toast Aunt Cal and the bitter woman you know. Cheers! Bitter Woman IPA is our Wisconsin variation of an India Pale Ale. This beer is intensely bitter with a mighty hop flavor and aroma.', 'http://www.tyranena.com', 5.75, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
