INSERT INTO beerbuddies_db.beer VALUES (2316, 1301, 7, 92, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'The sun barely breaks the horizon, the arctic winds bite, and snow blankets the land. Itâ€™s winter in Wisconsin! Throughout the area, youâ€™ll find armies of fisherman, clad in blaze orange parkas and snowmobile suits, dragging their crudely built ice shanties onto the frozen lakes. While they vary in size, shape and color, each shanty contains an enthusiast braving the cold; spinning their tall tales; staring deeply into that hole in the ice; and, of course, enjoying a Legendary Wisconsin Beer. Brewed in the fall to help you survive our Wisconsin winters. Shantytown Doppelbock is brewed in the style of a German Doppelbock. Brown in color with malty sweetness and a full body.', 'http://www.tyranena.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
