INSERT INTO beerbuddies_db.beer VALUES (2407, 797, 8, 95, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', '"Smooth" is the first word from your mouth after a taste of Big Bark Amber. This Vienna-style lager has a reddish-amber color with a smooth, malty flavor and low hop bitterness. It is made from Czech and German malts and German hops. "All Bark, No Bite." Everyone likes this beer.', 'http://www.liveoakbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
