INSERT INTO beerbuddies_db.beer VALUES (2414, 853, 3, 31, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Our interpretation of a legendary style ale is not for the timid. Assertively hoppy and dangerously seductive. A skillful blend of three premium barley malts with generous amounts of Northern Brewer and Cascade Hops creates a special ale to satisfy even the most demanding palate.', 'http://www.michiganbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
