INSERT INTO beerbuddies_db.beer VALUES (2447, 68, 3, 31, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'ndia Pale Ale is a style of beer that was developed in England during the period of the British Empire. It is derived from bitter ales but contains even more alcohol and hops. This helped preserve the beer on its long sea journey around Cape Hope to India. British troops returning from India brought their love of this beer back with them so breweries began brewing it for the home market as well. Sadly, the style had mostly died out in England by the late twentieth century. American home brewers began to brew I.P.A. because of their love for the intense hoppiness of the style. In time American I.P.A.s became much more aggressively bitter and hoppy than their historical predecessors. Big Eye I.P.A. is our version of this wonderful style. American Centennial hops are used exclusively to bitter, flavor, finish, and dry hop the Big Eye. Its full hop flavor is guaranteed to please the palate of the true hop head.', 'http://www.ballastpoint.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
