INSERT INTO beerbuddies_db.beer VALUES (2530, 956, 3, 32, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Emphasizing that complexity of character can arise from simple elements, this ale is made with three malts and one hop. Its light amber color and slightly spicy malt character are derived from the use of German Dark Munich Malt and Rye Malt respectively. North American 2-row barley combines with the other grains to lay the foundation for the hop onslaught to come. Summit hops are used exclusively in the boil for bitterness, flavor and aroma but it doesnâ€™t end there. Post-fermentation dry hopping allows the 9.5% ABV monstrosity to gently coax the citrus rind and grapefruit aroma to join the 100 IBUs already present. This beer should greet you with a pungent citrus blast, provide a spicy yet round middle and finish with a brisk, clean bitterness.', 'http://www.oskarblues.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
