INSERT INTO beerbuddies_db.beer VALUES (2561, 953, 1, 7, 'Quoyloo', 'Orkney', 'Scotland', 'United Kingdom', 'Dark Island is an iconic beer: a standard-bearer for traditional Scottish ales. In cask, this beer has twice won CAMRAâ€™s Champion Beer of Scotland. On the nose, this dark beer offers bitter chocolate, figs, toffee and hints of fruit. On the palate, this resolves into beautiful, silky-smooth, coffee-and-chocolate flavours, followed by figs, dates and dried fruits, with a very appealing, lingering aftertaste of fruits and hop bitterness.', 'http://www.orkneybrewery.co.uk/', 4.60, 0.00, 0.00, 0, '9999-01-01', '59.0697, -3.3135', '2018-10-05');
