INSERT INTO beerbuddies_db.beer VALUES (2629, 358, 3, 26, '351 Allen Street', 'Amherst', 'Wisconsin', 'United States', 'This crisp, zesty American pale is characterized by the sharp bitterness missing in many domestic pale ales. The clean finish and slight fruity notes help make our flagship brew a delightful treat.', 'http://www.centralwaters.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4419, -89.2797', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (2630, 358, 2, 25, '351 Allen Street', 'Amherst', 'Wisconsin', 'United States', 'A robust, yet surprisingly refreshing porter, Mud Puppy is a favorite of dark beer lovers. Characterized by a thick, rocky head and luscious chocolate-like nose, the malty profile is balanced by liberal hopping for its style.', 'http://www.centralwaters.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4419, -89.2797', '2018-10-05');
