INSERT INTO beerbuddies_db.beer VALUES (2637, 1301, 7, 91, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'The Finches will get you if you donâ€™t watch out!" In the early days of southern Wisconsin, falling into the clutches of the "Fighting Finches" was the ultimate threat. Moses Finch fathered 21 offspring whose most notable talents were stealing horses and robbing stagecoaches. From their stronghold in the impenetrable marshes west of Lake Mills, the Finches raided the farms of local settlers and held up the early travelers between Madison and Milwaukee. The Finches are long gone, but their legend lives on. So enjoy a pint of our Fighting Finches Bockâ€¦ or you better watch out, â€˜cause the Finches are gonna get you!', 'http://www.tyranena.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (2638, 1301, 3, 26, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'The legend of Tyranena began 3,000 years ago, with a group of pyramids and effigy mounds constructed in a remote valley formed by a vast, slow-moving glacier. Today, these ancient "stone tepees" lie 60 feet below the surface of Rock Lake in Jefferson County, Wisconsin. No one is certain how or why they were built, but many have speculated on their origin, purpose and the people who built them. We invite you to develop your own theories on the legend and mystery of Tyranena while enjoying a Stone Tepee Pale Ale. Stone Tepee Pale Ale is brewed in the tradition of an American pale ale. This beer celebrates the American hop, with its characteristic bitterness, flavor and aroma.', 'http://www.tyranena.com', 5.75, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
