INSERT INTO beerbuddies_db.beer VALUES (2748, 708, 7, 90, '1 Jefferson Avenue', 'Chippewa Falls', 'Wisconsin', 'United States', 'In 1888, After enduring one of the coldest winters on record, the employees of Jacob Leinenkugel''s spring brewery crafted their first seasonal beer to celebrate the coming of spring. They blended dark and pale roasted malted barley with select hops and allowed for longer aging to create a robust beer with an exceptionally creamy head. Unchanged since 1888, You''ll find our bock''s sturdy bod and deep color perfect to draw you out of one season and the into next.', 'http://www.leinie.com/welcome.html', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.9449, -91.3968', '2018-10-05');
