INSERT INTO beerbuddies_db.beer VALUES (3102, 1179, 8, 95, '603 East Brewery Street', 'Shiner', 'Texas', 'United States', 'Kosmos Spoetzl knew how to brew great beer. Born in Bavaria, Kosmosâ€™ mastery of German brewing carried him as far as Egypt before he found his way to the small Texas town of Shiner. Our proud brewery still carries his name and commitment to excellence in brewing. This full-flavored, hop-jacked lager is every bit as unique as the man himself and our way of saluting the brewmaster who started it all.', 'http://www.shiner.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '29.426, -97.1607', '2018-10-05');
