INSERT INTO beerbuddies_db.beer VALUES (3106, 1091, 3, 38, '2522 Fairway Park Drive', 'Houston', 'Texas', 'United States', 'A beautiful, deep copper brown ale. It has a full, malty body with hints of chocolate, a touch of sweetness and a light hop flavor. A complex malt character is created by combining five different types of malts. It has a rich, creamy head with a fine lace. The light fruitiness, characteristic of ales, is derived from a proprietary yeast strain. Saint Arnold Brown Ale is best consumed at 45-50Â° Fahrenheit.', 'http://www.saintarnold.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '29.8123, -95.4675', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3107, 1370, 3, 33, '', 'Wauwatosa', 'Wisconsin', 'United States', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0495, -88.0076', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3108, 953, 1, 15, 'Quoyloo', 'Orkney', 'Scotland', 'United Kingdom', 'Skull Splitter is our strongest ale: which is named after Thorfinn Einarsson who was the 7th Viking Earl of Orkney. Sophisticated, satiny smooth with a deceptively light character, it is a tribute to our colourful forbear. On the nose, this strong beer has a fruity malt character, with hints of dark fruit, spicy hop, dates and figs. On the palate, rich and complex with sweet toasted malt, molasses, fresh and dried fruit and hints of warming spices.', 'http://www.orkneybrewery.co.uk/', 8.50, 0.00, 0.00, 0, '9999-01-01', '59.0697, -3.3135', '2018-10-05');
