INSERT INTO beerbuddies_db.beer VALUES (3350, 441, 11, 141, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Did you know that Jubelale was the first beer ever bottled by Deschutes Brewery? Highly anticipated every fall, Jubelale is in a category of its own with a flavor and following that is impossible to match. Dark crystal malt creates that â€œlusciousâ€ holiday note while the roasty flavor and bountiful hops excite your tastebuds, reminding you why Jubelale is the perfect holiday beer', 'http://www.deschutesbrewery.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3351, 1054, 3, 37, '2323 N Milwaukee Ave', 'Chicago', 'Illinois', 'United States', 'An american blonde ale with bursts of fruity aroma and a dry finish.', 'http://revbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9234, -87.6982', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3352, 1142, 3, 26, '1075 East 20th Street', 'Chico', 'California', 'United States', 'The cornerstone of our Harvest series is the beer that started the modern-day fresh hop ale phenomenon in America, our original Harvest Ale. Created in 1996, Harvest Ale features Cascade and Centennial hops from the Yakima Valley in Eastern Washington. These hops are harvested and shipped as â€œwetâ€ un-dried hopsâ€”the same day they are pickedâ€”to our brewery in Chico where our brewers eagerly wait to get them into the brew kettle while their oils and resins are still at their peak.', 'http://www.sierranevada.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
