INSERT INTO beerbuddies_db.beer VALUES (3458, 674, 11, 141, '6300 Folsom Boulevard', 'Sacramento', 'California', 'United States', 'Our Holiday Ale is a â€œspecialâ€ version of our flagship product - Hoppy Faceâ„¢ Amber Ale; only bigger for you to enjoy during this holiday season!!! Characterized by its distinctive hop aroma and rich, ruby color, Hoppy Claus redefines the way you think about a holiday ale. Hoppy Claus uses only the finest two row malted barley, hops grown in the great Pacific Northwest, and some secret spices that we would love to tell you about; but are unable to do so. This combination results in a clean, crisp, and refreshingly unique hand-crafted experience. Hoppy Brewing Company has never used any artificial preservatives, flavors, or colors in any of its ales. The Hoppy label is your guarantee of purity.', 'http://www.hoppy.com', 7.80, 0.00, 0.00, 0, '9999-01-01', '38.5551, -121.43', '2018-10-05');
