INSERT INTO beerbuddies_db.beer VALUES (3461, 674, 3, 42, '6300 Folsom Boulevard', 'Sacramento', 'California', 'United States', 'Total Eclipse Black Ale has been described as similar to a light, dry stout. Characterized by its distinctive hop aroma and rich, black color, Total Eclipse redefines the way you think about a dark ale. Brewed at a low temperature to create a refreshingly dry finish, Total Eclipse uses only the finest two row malted barley and hops grown in the great Pacific Northwest. This combination results in a clean, crisp, hand-crafted experience. Hoppy Brewing Company has never used any artificial preservatives, flavors, or colors in any of its ales. The Hoppy label is your guarantee of purity. Itâ€™s â€œtotallyâ€ out of this world delicious!!!', 'http://www.hoppy.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '38.5551, -121.43', '2018-10-05');
