INSERT INTO beerbuddies_db.beer VALUES (3480, 674, 3, 37, '6300 Folsom Boulevard', 'Sacramento', 'California', 'United States', 's a unique, all-natural style of beer that currently falls under the category of a Specialty Ale. In other words, there is no true category for this beer... Characterized by its distinctive Mount Hood hop aroma and beautiful blonde color, Liquid Sunshineâ„¢ is brewed at a low temperature to create a nice light dry finish. Using only the finest 2-row malted barley, wheat, rye, and great northwestern grown hops, this combination results in a clean, crisp, and uniquely refreshing beer. As usual, no artificial preservatives have been added to our beer during and/or after the brewing process... Thereâ€™s nothing like it under the sun!!!', 'http://www.hoppy.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '38.5551, -121.43', '2018-10-05');
