INSERT INTO beerbuddies_db.beer VALUES (3483, 674, 3, 31, '6300 Folsom Boulevard', 'Sacramento', 'California', 'United States', 'Is an award-winning, traditional, all-natural style of beer that falls under the category of a "West Coast" India Pale Ale (IPA). Characterized by its high hop content, high alcohol content and deep amber color, Hoppy Faceâ„¢ is brewed using water with a high mineral content. Using only the finest 2-row malted barley and great northwestern grown hops, this combination results in a clean, crisp, well-balanced beer. As usual, no artificial preservatives have been added to our beer during and/or after the brewing process... It will put a smile on your face!!!', 'http://www.hoppy.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '38.5551, -121.43', '2018-10-05');
