INSERT INTO beerbuddies_db.beer VALUES (3557, 259, 3, 38, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'A mix of Northern and Southern English Brown Ales, blending 6 malts into an All-American beer.', 'http://www.brooklynbrewery.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3558, 259, -1, -1, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'Brooklyn Lager, the Brewery''s flagship label, is New York''s "hometown" beer, brewed to a pre-Prohibition recipe that dates back to the days when Brooklyn was the brewing capital of the East Coast. Brooklyn Lager has won numerous awards. Wrote Michael Jackson in the Simon & Schuster Pocket Guide to Beer: "The dry-hopped, fresh, flowery, firm, flavourful, Brooklyn Lager **-*** started well, in 1988, and has gained in character since.";"0', 'http://www.brooklynbrewery.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3559, 520, 3, 37, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'The lightest of FiftyFifty''s ales, Base Camp is a thirst quenching delight. Pale straw to light gold in color, this beer has a mild malt flavor combined with light bitterness and hop flavor. This beer finishes dry and is very light and refreshing on the palate. Base Camp is a "session beer", meaning you can easily toss back a few in one sitting. So go ahead, pull up a chair and camp out for awhile.', 'http://www.fiftyfiftybrewing.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
