INSERT INTO beerbuddies_db.beer VALUES (3602, 157, 5, 70, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams Cranberry Lambic is a fruit beer that draws its flavor not just from the cranberries it is brewed with, but also from the unique fermentation character imparted by the rare wild yeast strain. The result is a flavor rich in fruitiness and reminiscent of cranberries and bananas, cloves and nutmeg. The yeast fermentation also will create a slight sourness on the sides of the palate, a signature of the original Lambic style which, with the subtle cereal note from the wheat malt, remind its drinker that, as fruity a beer as this is, it is still a beer.', 'http://www.samueladams.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
