INSERT INTO beerbuddies_db.beer VALUES (3621, 1031, 1, 13, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'A rich, full-bodied winter warmer crafted in the British tradition of holiday beers. This deep mahogany colored brew balances complex fruit flavors with a refreshingly smooth texture, making Snow Cap a highly drinkable and desirable cold weather companion.', 'http://www.pyramidbrew.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3622, 441, 3, 42, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Obsidian Stout gets is inspiration from one of the world''s largest obsidian flows at Newberry Volcano--just a few miles south of the brewery. "The Big Obsidian Flow," as they call it, covers more than 700 acres with shiny black obsidian.', 'http://www.deschutesbrewery.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
