INSERT INTO beerbuddies_db.beer VALUES (3646, 333, 8, 95, '1 Kendall Square #100', 'Cambridge', 'Massachusetts', 'United States', '', 'http://www.cambrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3664, -71.0911', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3647, 333, 3, 26, '1 Kendall Square #100', 'Cambridge', 'Massachusetts', 'United States', 'Big and bold, our Pale Ale distinguishes itself by its huge, fresh hop aroma and flavor. A combination of Cascade and Centennial hops, both in the kettle and during an extensive dry-hopped conditioning time, gives this beer its nectarious flavor.', 'http://www.cambrew.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.3664, -71.0911', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3648, 333, -1, -1, '1 Kendall Square #100', 'Cambridge', 'Massachusetts', 'United States', 'Brewed in the tradition of the fresh, blond ales of Cologne, Germany, our Golden ale is light in body, crisp and very refreshing. Its soft malt flavor is balanced by delicate, spicy hop flavors and finishes.', 'http://www.cambrew.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '42.3664, -71.0911', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3649, 333, 2, 25, '1 Kendall Square #100', 'Cambridge', 'Massachusetts', 'United States', 'Charles River Porter Deep and dark, full-bodied and robust, our Porter is crammed full of rich, roasted malt character. With underlying notes of fruitness, caramel and toffee, it finishes with a strong hop presence', 'http://www.cambrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.3664, -71.0911', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3650, 333, 3, 33, '1 Kendall Square #100', 'Cambridge', 'Massachusetts', 'United States', 'Well balanced, medium-bodied, with a deep amber-red color, this beer''s complex palate covers all the bases. A malty caramel sweetness is followed by notes of chocolate and a dry, slightly roasty finish, complemented by a touch of fruity, spicy hops.', 'http://www.cambrew.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '42.3664, -71.0911', '2018-10-05');
