INSERT INTO beerbuddies_db.beer VALUES (3740, 1379, 7, 84, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'Our flagship brew is a smooth, amber beer that combines the malty goodness of an Octoberfest lager with the slight fruitiness of an ale. Hearty but refreshing.', 'http://www.wynkoop.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
