INSERT INTO beerbuddies_db.beer VALUES (3761, 122, 11, 116, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'Trout Slayer is a filtered wheat ale, fermented at cool temperatures, making it a smooth drinkable session beer. Brewed with Palisade, Glacier, and Mt. Hood hops, this straw colored beer is sure to please any craft beer drinker. IBU 35 SRM 5 ABV 4.7%', '', 4.70, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5340, 338, -1, -1, '7734 Terrace Avenue', 'Middleton', 'Wisconsin', 'United States', 'Munich Helles style Lager', 'http://www.capital-brewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0949, -89.5163', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3747, 1286, 3, 33, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'TrÃ¶egs Breweryâ€™s Flagship beer, HopBack Amber Ale derives its name from a vessel in the brewhouse called a hopback. As the â€˜wortâ€™ is being transferred from the brewhouse to fermentation it passes through the hopback vessel. Packed full of fresh whole flower hops, the wort slowly circulates through this vessel extracting the essence of the aromatic hops. This vessel adds more time and more hop character that creates a fresh, spicy taste and rich caramel note that defines this signature ale. TASTING NOTES Deep amber in color under a huge creamy head. The aroma very apparent, bold and spicy with a slight floral character. Balanced with caramel malt, this well-rounded amber ale has an up-front floral spice that builds with a flush of sweetness', 'http://www.troegs.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3748, 1286, 7, 92, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'The Troegenator Double Bock, is a dark, strong lager (8.2% abv). It pours into a glass with a bronze to brown color, fluffy white head and bready malt aroma. The Troegenator leaves a rich, warming feeling and subtle spicy flavors. The style, Double Bock, dates back a century or so ago. During periods of fasting without solid foods, the Monastic brewers relied on the double bock; a stronger, richer beer to fulfill their basic nutritional needs. Known to them as "liquid bread," a double bock has a strong malt aroma and chewy rich body. Traditionally these brewers ended the name of their double bock with the suffix "ator", ex. Celabrator, Illuminator, Subliminator... In the spirit of the tradition we give you the Troegenator to provide warmth and richness through the early spring months. A double bock of epic proportions, beware, the Troegenator is deceiving smooth and delicious.', 'http://www.troegs.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3749, 1286, 11, 116, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Long toasty days, cool breezy nights and a splash of magic provide the inspiration for the Troegs brothersâ€™ dreamiest Single Batch creationâ€”Dreamweaver Wheat. Combining four wheat types with Munich and Pils malts, noble Saaz hops, and a yeast strain that imparts a spicy, peppery, clove taste with a slight hint of bananas, Dreamweaver Wheat is an unfiltered blast of spicy, mouthwatering joy.', 'http://www.troegs.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3750, 1286, 2, 25, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'In the 14th Century, Sailors would rely on sheer skill to get from a starting point to a final destination. They called this Dead Reckoning. We see our beer the same way. We know where to begin and know where to go, but there are hundreds of ways to get there. Dead Reckoning is unfiltered and weighs in at 5.8% abv and 53 IBUâ€™s. It features Pilsner, Caramel, Chocolate and Roasted malts along with Chinook and Vanguard hops. â€œThe outstanding taste and flavor of Dead Reckoning originates in the chocolate and roasted malts,â€ says John Trogner. "There is a nice hoppiness in the front of the beer, but the rich, smooth mouth feel is what really stands out.";"0', 'http://www.troegs.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3751, 1286, 3, 42, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'TrÃ¶egs Oatmeal Stout is our interpretation of the classic dry stout style. Dark and creamy with hints of chocolate and black currants, our Oatmeal Stout includes a healthy dose of Centennial and Chinook hops creating a unique stout perfect for the late Fall and Winter.', 'http://www.troegs.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3752, 1286, 8, 95, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'TrÃ¶egs Bavarian Lager is an authentic German style lager, brewed with Munich malts, Hallertau Hops and fermented at cool temperatures followed by a full month of aging, or "lagering", to impart a range of complex maltiness and subtle aromas only found in traditional German lagers.', 'http://www.troegs.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3753, 1286, 1, 5, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'TrÃ¶egs E.S.B. "extra special bitter" is dry hopped in the old world traditions. It has a full bodied caramel malt flavor an spicy hop aroma. A generous amount of Golding hops are added before fermentation to impart a pleasant "bouquet nose" and balanced with pronounced caramel malts to create a complex, malty, aromatic amber ale.', 'http://www.troegs.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3754, 540, 4, 50, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'In-Heat Wheat Hefeweizen She taunts and teases... In-Heat Wheat is our German-style Hefeweizen. She is a full flavor beer, perfect for the more adventurous craft beer drinker. The addition of malted white wheat gives this brew its smooth, full mouthfeel. A proprietary yeast creates intriguing flavors of bananas and cloves.', 'http://www.flyingdogales.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3755, 540, 1, 13, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'The psycho in the pack... K-9 Cruiser is a dark, sweet and malty winter warmer that will captivate any adventurous craft brew drinker. A true Flying Dog original, K-9 Cruiser is the perfect brew to warm you up in those cold winter months.', 'http://www.flyingdogales.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3756, 1286, 3, 26, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'A TrÃ¶egs Brewery classic, our Pale Ale is copper colored with generous amounts of Cascade hops to create a floral, aromatic pale ale that smells as delicious as it tastes.', 'http://www.troegs.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3757, 1286, 3, 33, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Squeeze those hops for all theyâ€™re worth and prepare to pucker up: Nugget Nectar Ale, will take hopheads to nirvana with a heady collection of Nugget, Warrior and Tomahawk hops. Starting with the same base ingredients of our flagship HopBack Amber Ale, Nugget Nectar intensifies the malt and hop flavors to create an explosive hop experience.', 'http://www.troegs.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3758, 1286, -1, -1, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'The Mad Elf, a cheerful creation to warm your heart and enlighten your tongue. The combination of Cherries, Honey, and Chocolate Malts delivers gentle fruits and subtle spices. Fermented and aged with a unique yeast, this ruby red beer has significant warming strength that underlies the pleasant character of this intriguing yet delicious Ale. The Mad Elf, a jolly and delicious beer for the Holidays.', 'http://www.troegs.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3759, 540, 3, 31, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'More cunning than a snake in the bush... Snake Dog India Pale Ale is a Colorado-style IPA, power hopped with specialty hops from the Pacific Northwest. This is the brewery''s hop monster, and the citrus fruit aroma will hypnotize the senses of the most hardcore of craft drinkers.', 'http://www.flyingdogales.com/', 7.10, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3760, 539, 1, 21, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'A rich, dark and malty ale with plenty of roasted barley flavor. Blackbird has a silky smooth oatmeal finish. It is one of our NEW flagship''s and is now available year round.', 'http://www.flyingbisonbrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3762, 122, 2, 25, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'It''s chocolate brown in color with a creamy texture. A malty beer with just enough hop presence to keep it from being too sweet. The aroma mostly comes from the malt with a hint of spice added by the hops. Moose Drool is brewed with pale, caramel, chocolate, and whole black malts; and Kent Goldings, Liberty, and Willamette hops. It has an original gravity of 13 degrees Plato, and is 4.2% alcohol by weight, 5.3% by volume.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3763, 122, 3, 26, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'Scape Goat is our award-winning Pale Ale. It is a very smooth brew, refreshing and well-balanced. Scape Goat took home the Gold Medal from the North American Brewers'' Association competitions as the best English-style pale ale brewed west of the Mississippi, but only because it is the best. Scape Goat is brewed with pale, crystal malts, and Kent Goldings and Crystal Hops. Scape Goat is 3.8% alcohol by weight and 4.7% by volume.', '', 4.70, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3764, 122, 1, 13, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'Two words describe Montana winters... Cold, dark, and snowy. And we wouldn''t have it any other way, because it''s the only time of year for Powder Hound, our Northern Rockies Winter Ale. Rich malt taste and an avalanche of hops will make you want to say these three words- "I''ll have another Powder Hound!', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3765, 122, 8, 95, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'Summer Honey is a full-flavored summer seasonal ale. Brewed with a unique, balanced blend of spices, Northwest Hops, and Montana honey. Summer Honey is brewed during the early days of spring and released around the first of May each year. Light colored, light bodied, and very drinkable, Summer Honey sacrifices nothing to create a flavorful beer that can be enjoyed during the height of the Summer. Available April through September', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3766, 122, 3, 31, '5417 Trumpeter Way', 'Missoula', 'Montana', 'United States', 'In Montana, many classic memories are made right after someone says, â€œHold my beer and watch this.â€ These bold, assertive moments deserve a bold, assertive beer â€“ Big Sky IPA. A distinct hop presence and malty backbone will leave you refreshed and ready for your moment of glory. Hang on tight and enjoy the ride.', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '46.9223, -114.073', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3767, 907, 8, 95, '2400 State Highway 69', 'New Glarus', 'Wisconsin', 'United States', 'Pure and crisp this is a beer with nothing to hide. Wisconsin two-row barley malt ensures a mellow and smooth body. We imported Noble Hop varieties from Germany and the Czech Republic to ensure a fine mature aroma with no coarse bitterness. Expect this beer to pour a delicate golden hue that sparkles in the summer sun. This lager is brewed using all natural ingredients with no artificial additives of any kind. Kick back, relax and enjoy the simple unadorned flavor. This is beer at its most basic.', 'http://www.newglarusbrewing.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '42.8171, -89.6306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3768, 907, 8, 95, '2400 State Highway 69', 'New Glarus', 'Wisconsin', 'United States', 'Our little village brewery in New Glarus, Wisconsin is proud to offer to you Edel-Pils. This "Noble-Pilsner" is the creation of our brewmaster. He brought special yeast from Bavaria, combined it with Wisconsin barley and the finest Bavarian and American hops. Then employing traditional brewing methods, this Pilsner is finished with a long cold rest in our cellars. Expect this bier to be creamy and full-bodied with a smooth finish. It will complement any fine meal or friendly gathering. We took our time in brewing so that you might take your time enjoying.', 'http://www.newglarusbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.8171, -89.6306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3769, 907, 3, 38, '2400 State Highway 69', 'New Glarus', 'Wisconsin', 'United States', 'One deceptively spring like winter day, Brewmaster Dan walked home from the brewery, sat down to dinner and said, "Boy, there are some fat squirrels out there. They''re running all over the place. I think I should brew a Fat Squirrel Nut Brown Ale." Deb agreed and so another beer legend was born. 100% Wisconsin malt of six different varieties impart the natural toasted color to this bottle conditioned unfiltered ale. Clean hazelnut notes result from these carefully chosen barley malts. Hops from Slovenia, Bavaria and the Pacific Northwest give Fat Squirrel its backbone. When the going gets tough, remember to relax a moment and enjoy the "Fat Squirrel" in your neighborhood.', 'http://www.newglarusbrewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.8171, -89.6306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3770, 907, 3, 33, '2400 State Highway 69', 'New Glarus', 'Wisconsin', 'United States', 'Cask conditioned ale has been the popular choice among brews since long before prohibition. We continue this pioneer spirit with our Wisconsin farmhouse ale. Brewed with flaked barley and the finest Wisconsin malts. We even give a nod to our farmers with a little hint of corn. Naturally cloudy we allow the yeast to remain in the bottle to enhance fullness of flavors, which cannot be duplicated otherwise. Expect this ale to be fun, fruity and satisfying. You know you''re in Wisconsin when you see the Spotted Cow.', 'http://www.newglarusbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.8171, -89.6306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3771, 908, 3, 31, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Dry-hopping provides a distinctive and floral hop aroma, while the lively and hoppy body is subtly balanced with delicious malt notes. Hatterâ€™s hop character makes it a great fit for spicy dishes, bitter greens and beef.', 'http://newhollandbrew.com', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3772, 908, 5, 61, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Golden in color with a slightly sweet body. Its ester-laden character reveals an enigmatic dance between Belgian ale yeast and candy sugar complimented by a pleasing dry finish. Black Tulip is a versatile beer for food. Enjoyable pairings include mild bleu cheeses, berries and other light desserts.', 'http://newhollandbrew.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3773, 545, 8, 95, '1900-B East Lincoln Avenue', 'Fort Collins', 'Colorado', 'United States', 'A unique flavored lager that goes well with any food. A slight aromatic smoke flavor-but not over-powering. A very popular beer with its own following wondering where''s YOUR Z?', 'http://www.fortcollinsbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.5832, -105.042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3774, 119, 8, 95, '15133 Highway 10', 'Surrey', 'British Columbia', 'Canada', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.1049, -122.69', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3775, 540, 3, 26, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'Doggie Style Pale Ale Meet the Alpha of the pack ... Flying Dog Classic Pale Ale is brilliant amber in color and dry hopped with buckets full of Cascades for an unrivaled hop flavor and aroma. This is a true representation of an American-style pale ale, using the finest ingredients. Flying Dog Classic Pale Ale is a multi-award winning product and is consistently ranked as one of the best pale ales in the U.S. This is what craft beer is all about.', 'http://www.flyingdogales.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3830, 1326, 3, 43, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'With a huge, Pacific Northwest hop aroma & character upfront, Storm King subsides into massive, roast malt complexity. More flavor than mere words can adequately describe. Rich and substantial, it will warm your heart.', 'http://www.victorybeer.com', 9.10, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3776, 812, 3, 26, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Not quite pale ale. A beer cloaked in secrecy. An ale whose mysterious unusual palate will swirl across your tongue and ask more questions than it answers. A sort of dry, crisp, fruity, refreshing, not-quite pale ale. #9 is really impossible to describe because there''s never been anything else quite like it. Our secret ingredient introduces a most unusual aroma which is balanced with residual sweetness.', 'http://www.magichat.net/', 4.60, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3777, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'Launched in 2007, Miller Chill is the only light beer brewed with a hint of lime and a pinch of salt to provide a truly refreshing beer experience. Through all of our marketing efforts, beer drinkers will see that Miller Chill is a celebration and fusion of the best of two cultures, great light beer from America and the chelada style from Mexico. It''s the new alternative in mainstream low-cal beers ... one that provides a crisper, smoother, more refreshing beer experience.', 'http://www.millerbrewing.com', 4.10, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3778, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'Miller High Life, the "champagne of beers," dates back to 1903. Miller High Life is a classic American-style lager recognized for its consistently crisp, smooth taste and classic clear-glass bottle. Miller High Life embraces its rich heritage and is positioned as common sense in a bottle. Its drinkers know Miller High Life is an authentic, unpretentious beer. As the best beer value in America, we encourage our target consumers to "Celebrate the High Life.";"0', 'http://www.millerbrewing.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3779, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'Miller Genuine Draft debuted in 1985 with fresh, smooth flavor that''s a result of being cold-filtered four times. As we capitalize on the growing trend towards "mainstream sophistication," MGD is positioned as the only beer refined to ideal smoothness for those who pursue their passion with integrity and conviction. For our target consumer, MGD is a brand that celebrates their experiences ... past, present, and future. Because, ultimately, in beer as in life, "Experience is Golden.";"0', 'http://www.millerbrewing.com', 4.66, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3780, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'Milwaukee''s Best Light is Miller Brewing Company''s lead low-calorie brand in the near-premium segment. Brewed to uncompromising standards using select pale malt, cereal grains and yeast, this is a smooth, highly drinkable beer at an affordable price. Available nationwide, Miller first rolled out Milwaukee''s Best Light in 1986 with an ambition to become the beer choice for guys. Our marketing, including sponsorship with the World Series of Poker and award-winning TV spots, takes a humorous approach to reinforce the idea that "Men should act like men and light beer should taste like beer.";"0', 'http://www.millerbrewing.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3781, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'America''s first domestic ice beer, Icehouse is traditionally brewed, fermented and, just before aging, its temperature is lowered to below freezing. This process imparts the beer''s smoothness and an alcohol content that''s slightly higher (5.5% by volume) than other regular premium beer brands. Icehouse was introduced in 1993 and has reinforced its position as the ultimate beer for wind-up and pre-game occasions. Blending humor and high-energy excitement, Icehouse marketing encourages its target consumers to take occasions to the next level with a great-tasting beer.', 'http://www.millerbrewing.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3782, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', '', 'http://www.millerbrewing.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3783, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.anheuser-busch.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3784, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Introduced nationally in 1982, Bud Light is brewed using a blend of domestic and imported hops as well as a combination of barley malts and rice. It contains more malt and hops by ratio of ingredients than Budweiser, which gives the brew a distinctively clean and crisp taste.', 'http://www.anheuser-busch.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3785, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Bud Select is a new beer offering a bold taste with a full and distinct flavor that finishes clean. Budweiser Select was developed using two-row and roasted specialty malts for a rich color. It offers excellent drinkability and a taste that does not linger.', 'http://www.anheuser-busch.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3786, 1211, 5, 61, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'The Triple is a strong, full-bodied Belgian abbey-style ale. The authentic Belgian yeast strain used in fermentation contributes to a rich array of spicy, phenolic, and fruit-like flavors and noticeable alcoholic warmth. This unfiltered ale has an irresistible pale orange-colored hazy glow.', 'http://www.stoudtsbeer.com/brewery.html', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3787, 1326, 5, 61, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Strong and sensual, this golden, Belgian-style ale glows with goodness. The richness of German malts and Belgian yeast are tempered by a sparkling approach and overall light body. Considerable depth of character with abundant herbal, fruity notes make this one to savor.', 'http://www.victorybeer.com', 9.50, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3788, 45, 3, 35, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Our Barley Wine is dark red in color and has an original gravity of 1.120 (24 Plato). The malt complexity of this classic ale style is incredible. The Broad Street Market is located just blocks from the Appalachian Brewing Company. This indoor farmers market was built in 1863 and is one of the oldest continuously operating farmers markets in the United States. The beautiful brick faÃ§ade and natural wood doors are typical of the structures in Downtown Harrisburg; including our own building.', 'http://www.abcbrew.com', 8.70, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3789, 45, 11, 116, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This light refreshing wheat beer is sure to delight. Our special yeast and blend of malted and unmalted wheat provide the haze in our unfiltered style ale. This beer is traditionally served with a lemon slice on the side. There are many water gaps along the Appalachian Trail. These water gaps were established where large rivers cut through the Appalachian Mountain Range. The Susquehanna River creates one of the more visually appealing water gaps just north of Harrisburg in the area at the Dauphin Narrows.', 'http://www.abcbrew.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3831, 1326, 5, 72, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Heady with a aromatic fruity start and taste, this amber ale features hints of pear and apricot in its well-nuanced flavor. The initial impression of fruitiness concludes in a refreshing dryness that begs you to sip again. Be fore- warned, this ale is immense as it registers 12% abv.', 'http://www.victorybeer.com', 12.00, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3790, 45, 8, 95, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'The Dortmunder-Export style of beer was developed in Westfalen, Germany, and is a classic light lager with great character. This style boasts a light golden blonde color and exhibits a moderate hop palate. The finish of our Mountain Lager is rich yet mellow. Our brewers have developed this beer as a tribute to the Appalachian Mountains where we live and play.', 'http://www.abcbrew.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3791, 45, 4, 55, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Volks Weizenbock combines the strong malty component of a bock bier with the tangy, spiciness of the Hefe Weizen. This beer is brewed 1 1/2 times stronger than our Hefe Weizen and is aged commensurately longer for extra smoothness! Volks Weizenbock is "The Peoples Beer"!', 'http://www.abcbrew.com', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3792, 45, 3, 26, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Our light copper pale ale has a delicate malt attribute balanced by an aggressive hop flavor and aroma. Many American micros have developed their own version of this classic English style beer. Our brewers anticipate that you will enjoy their variation. Hikers on the Appalachian Trail are considered "purist hikers" if they cover every inch of the trail during the hike. Our brewers refuse to compromise the quality of our products with the "purist hiker" in mind.', 'http://www.abcbrew.com', 4.90, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3793, 45, 1, 15, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This flavorful sweet ale has a smooth malt finish balanced against a light hop flavor. This beer is very quaffable and has become a brewpub favorite throughout the United States. "Jolly Scot" was a famed local beer produced by R.H. Graupners Brewery that was located at 10th and Market â€“ one block from our brewery.', 'http://www.abcbrew.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3794, 45, 3, 31, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This IPA is an exciting beer with a floral in aroma and an incredible hop flavor. The maltiness is increased (over a regular pale ale) to help balance the aggressive hop usage. This contributes to the higher alcohol content as well. When India was part of the British Empire, pale ale shipped to the troops would often spoil due to the rough voyage and temperature extremes. The brewers had a theory that if they loaded the beer with extra hops, the hops would preserve the beer. Of course, this added significantly to the beerâ€™s flavor and aroma. When the troops returned to Britain, they had become "hop-heads", appreciating the beauty of the hop "over-influence". Regular pale ale was simply not enough anymore! A new beer style, India Pale Ale, had been created: an aggressively hoppy and now quite happy to be home pale ale.', 'http://www.abcbrew.com', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3795, 45, 3, 42, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This representation of the classic Irish Dry Stout has a smooth roast flavor due to the use of specially roasted barley. The barley kernels are kilned at very high temperatures until they are dark brown to black in color. The Susquehanna River is named after the Susquehannock Indians who settled in our area. This shallow river is over one mile wide in the Harrisburg area and flows from southern New York through Pennsylvania to the Chesapeake Bay.', 'http://www.abcbrew.com', 4.60, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3796, 45, 8, 95, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Zoigl is a golden, unfiltered lager beer which was originally brewed only in the region of Eastern Bavaria, between Franconia and the Czech Republic. For centuries, Zoigl was brewed in brewhouses owned by the town or an association of small brewers. The Zoigl-Star, a six-angular star similar to the Star of David, was the sign of brewers in the middle ages. The star symbolizes the three elements (water, earth, and fire) and the three ingredients (water, malt, and hops) used for brewing. The importance of the yeast was not yet known in the 1400â€™s.', 'http://www.abcbrew.com', 5.90, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3797, 45, 5, 72, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Abbey Roade is brewed in the tradition of the famous Belgian Abbey-style ales. This wonderful brew is soft and sweet up front. The complex and spicy middle palate is in most part due to the generous addition of dark Belgian candy sugar. This semi-dry ale has notes of ripe plum and pear with a peppery finish. The origins of the Abbey-style ale date back to the Middle Ages. Monks residing in monasteries, called Abbeys, brewed beer as a source of nutrition during their frequent and often lengthy fasting periods.', 'http://www.abcbrew.com', 6.40, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3798, 45, 3, 33, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This wonderful red ale has a perfect balance of hops and malt. The clean finish will leave your palate begging for more.', 'http://www.abcbrew.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3799, 45, 7, 77, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This Czechoslovakian style Pilsner is golden in color and hopped with a bunch of genuine Czechoslovakian Saaz hops. These hops provide a special floral aroma and a delightfully hoppy finish. Peregrine Falcons were recently reintroduced to the Harrisburg area as well as other large cities in Pennsylvania. This Falcon is one of the fastest birds, reaching speeds in excess of 200 miles per hour. Its unique ability to rid urban areas of its nemesis, the pigeon, has cities throughout the region clamoring for the Peregrine as a permanent resident.', 'http://www.abcbrew.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3800, 45, 7, 91, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'The Maibock style was traditionally produced in the winter and released in early May to celebrate the coming of Spring. This malty lager is deep golden in color and medium in body. The finish holds a bold sweetness that is balanced by a subtle hop flavor and aroma. We will be releasing this beer every spring in celebration of our Anniversary.', 'http://www.abcbrew.com', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3801, 45, 4, 50, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'A special German wheat ale yeast produces clove and banana flavors during fermentation leaving this unfiltered beer with an incredibly spicy and fruity complexity! Our Brewmaster has acquired many medals at the Great American Beer Festival for this beer style. A difficult, four-step infusion mash schedule produces the complexity of this traditional beer style.', 'http://www.abcbrew.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3802, 45, -1, -1, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'The first in a series of two new specialty beers coming this year! This KÃ¶lsch-styled ale is clean, crisp, and delicately balanced. It has very subtle pear flavors and aromas. The subdued maltiness leads to a pleasantly refreshing finish. A fantastic summer brew! The KÃ¶lner Dom (Cologne Cathedral), is one of the best-known architectural monuments in Germany and has been Cologne''s most famous landmark since its completion in the late 19th century. True KÃ¶lsch can only be brewed if the brewery has a view of this famous cathedral, thus itsâ€™ appearance on our tap markers.', 'http://www.abcbrew.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3803, 45, 7, 84, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This Oktoberfest style Marzen is a favorite at the famous Bavarian fall beer festivals. The distinct toasted malt flavor of this amber lager finishes quite crisp due to the extensive lagering of this beer. One sip and youâ€™ll swear youâ€™re in Munich. "Kipona" is the Indian word for "sparkling water". Each year, over Labor Day weekend, Harrisburg celebrates Kipona with a carnival and festival along the Susquehanna River and on City Island.', 'http://www.abcbrew.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3804, 45, 3, 38, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Trail Blaze Organic American Brown Ale exhibits a beautiful deep copper color and an evident hop bitterness & aroma. This is balanced against roasted caramel-like characteristics and hints of chocolate. Our first in a series of organic beers is named for the markers that keep a hiker on the correct path. Many of the hiking trails in our area have simple to very distinguished trail blazes. After a long hike, there is nothing better at the end of the trail than ABC organic ale.', 'http://www.abcbrew.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3805, 45, 2, 25, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This full-bodied dry cousin of the stout has a slight roast flavor and is dark brown in color with a red hue. This is Londonâ€™s classic beer style named for the baggage carriers that appreciated it so much. Governor Pennypacker was one of Pennsylvaniaâ€™s more notable politicians. He oversaw the construction and held the lavish ceremonies designating the opening of the Commonwealthâ€™s beautiful Capitol Building', 'http://www.abcbrew.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3806, 45, 3, 33, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This amber ale is dosed with cinnamon, nutmeg, ginger, and fresh orange zest. It is well balanced with low hop flavor and nice hint of the spices in the finish. This spiced ale is not overbearing; rather it is smooth and very drinkable.', 'http://www.abcbrew.com', 5.70, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3807, 45, -1, -1, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This Braggart Mead styled ale is light and refreshing with an essence of orange blossoms, pear, and honey in the aroma and a balanced fruity and clean finish. This style was developed by our Brewmaster to have the perfect carbonation and crispness on our summerâ€™s hot and humid Pennsylvania days.', 'http://www.abcbrew.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3808, 45, 2, 25, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'Based on the winning Homebrew Contest entry by John Slotterback and Fred Rogers, this dark, roasty porter is infused with fresh coconut which produces a sweet finish. The coconut balances the chocolaty notes, producing a taste not unlike German chocolate cake in a glass! This will be brewed in Camp Hill and distributed in limited quantity to Harrisburg and Gettysburg.', 'http://www.abcbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3809, 45, 11, 116, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This American wheat beer is infused with 20% wildflower honey resulting in a light, semi-sweet refreshing beverage. This beer represents the next evolution of Sophieâ€™s Sparkling Ale as we have added the wheat base, essentially combining two of our most popular beers. This will be brewed in Camp Hill and distributed in limited quantity to Harrisburg and Gettysburg.', 'http://www.abcbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3810, 812, 3, 31, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A deep golden IPA with a firm malt body, finishing with a big hop aroma.', 'http://www.magichat.net/', 5.80, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3811, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', 'Our flagship brand, Miller Lite, is the great tasting, less filling beer that defined the American light beer category in 1975. We deliver a clear, simple message to consumers: "Miller Lite is the better beer choice." What''s our proof? 1) Miller Lite is the original light beer. 2) Miller Lite has real beer taste because it''s never watered down. 3) Miller Lite is the only beer to win four gold awards in the World Beer Cup for best American-style light lager. (2006, 2002, 1998, 1996) 4) Miller Lite has half the carbs of Bud Light and fewer calories*. "Miller Lite. Good Call.";"0', 'http://www.millerbrewing.com', 4.20, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3812, 1388, 8, 95, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'Yuengling Traditional Lager is an iconic American lager famous for its rich amber color and medium-bodied flavor. Brewed with roasted caramel malt for a subtle sweetness and a combination of cluster and cascade hops, this true original promises a well balanced taste with very distinct character. Its exceptional flavor and smooth finish is prevalently enjoyed by consumers with even the most discerning tastes. Our flagship brand, Yuengling Traditional Lager is an American favorite delivering consistent quality and refreshment that never disappoints. In fact, it''s so widely known and unique in its class, in some areas you can ask for it simply by the name "Lager.";"0', 'http://www.yuengling.com', 4.40, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3813, 1388, 8, 96, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'True to its American heritage, Yuengling Light Lager is an exceptional brew that appeals to consumers who don''t want to sacrifice character for a low-calorie light beer. It has been masterfully developed to maintain the full flavor profile akin to our flagship Lager brand. Skillfully pairing a caramel malt flavor and mild hop character creates a beautifully rich-colored beer with deep amber highlights that finishes smooth and clean. With only 99 calories, Yuengling Light Lager is a uniquely refreshing beer that brings new dimension to the meaning light beer.', 'http://www.yuengling.com', 3.40, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3814, 1388, 2, 25, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'Yuengling Dark Brewed Porter is an original specialty beer that has been brewed expressly for tavern owners and family trade since 1829. We are proud to be recognized as one of the largest porter producers in the US. An authentic craft-style beer, our Porter calls for a generous portion of caramel and dark roasted malts, which deliver a rich full-bodied flavor and creamy taste with slight tones of chocolate evident in every sip. It pours dark, topped with a thick foamy head, and imparts a faint malty aroma. This smooth and robust Porter has a unique character that complements any meal from steak or seafood to chocolate desserts. Yuengling Dark Brewed Porter is enjoyed by even the most discerning consumer for its flawless taste and unwavering quality.', 'http://www.yuengling.com', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3815, 1388, -1, -1, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'Yuengling Original Black & Tan is a pioneer brand that models a traditional English Half & Half. Introduced in 1986, Yuengling produced one of the first hand-crafted draft blends to lead this style of American brewing. Black & Tan combines our popular Dark Brewed Porter and Premium Beer to create a brew that is rich and dark in color, with a well balanced flavor that finishes smooth and satisfying. It has a faint sweetness with hints of caramel and coffee from the dark roasted malts. One sip and you''ll appreciate how Yuengling raised the bar with our Original Black & Tan.', 'http://www.yuengling.com', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3816, 1388, 3, 26, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'One of our distinct classic beers brewed since 1829, Yuengling Lord Chesterfield Ale has as much rich heritage as it does flavor and appeal. Crafted in a unique two-stage European brewing style for enhanced bitterness, it utilizes both conventional kettle hopping and dry hopping after fermentation resulting in a dry sharp finish. Brewed with select hops, its distinct robust flavor is derived from a delicate combination of sweet maltiness and lingering herbal bitterness. Lord Chesterfield Ale''s bright gold color is complemented by a lightly laced foam head and fragrant zesty aroma. This fine Ale compares with the very best crafty-style beers. It pairs flawlessly with many foods including seafood dishes and fine cheeses.', 'http://www.yuengling.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3817, 1388, 8, 95, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'A regional favorite, Yuengling Premium Beer is popular among local beer drinkers for its thirst quenching taste. It is a pilsner-style brew, gold in color with pale malt character that finishes crisp and clean. Premium flawlessly blends both two-row and six-row barley malt for a well balanced flavor that is always refreshing. Traces of the slight hop aroma are evident in every delicious sip of Premium Beer. Discover this well kept secret and enjoy the superior quality and taste you''ve come to expect from America''s Oldest Brewery.', 'http://www.yuengling.com', 4.40, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3818, 1388, 8, 96, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'Yuengling Light Beer is skillfully crafted to deliver a consistently refreshing brew with only 98 calories. Drawing from traditional brewing techniques, our Light Beer is brewed longer to reduce the sugar content and produce fewer calories in each thirst-quenching drink. Its pale golden color is complemented by a light-bodied flavor. Yuengling Light maintains a well balanced character of malt and hops, with slight carbonation for a crisp satisfying finish. We sacrifice nothing to produce a premium light beer that is low in calories and full of flavor. This combination delivers the ultimate refreshment in Yuengling Light Beer.', 'http://www.yuengling.com', 3.50, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3819, 1326, 8, 95, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Our Crisp, lighter in body, yet still full flavored brew. Before Prohibition, thirst quenching lagers were firm and substantial, and enjoyed in huge volumes. This recipe incorporates yeast from the C. Schmidt Brewery of Philadelphia and a small portion of brewer''s corn to recreate an "industrial" lager of the turn of the century. Released April 6 to celebrate Prohibition''s repeal 73 yrs. ago, Throwback Lager is a draft only release that should flow into June', 'http://www.victorybeer.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3820, 1326, 7, 77, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Heaps of hops give this pale lager a bracing, herbal bite over layers of soft and smooth malt flavor. This refreshing combination of tastes makes Prima a classy quencher in the tradition of the great pilsners of Europe. Dry and delightful, this is an elegant beer.', 'http://www.victorybeer.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3821, 1326, 8, 95, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Perfectly balanced, this authentic version of a German helles-style lager satisfies gloriously. Lean, German malts and fine European hops offer subtle harmony.', 'http://www.victorybeer.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3822, 1326, 7, 91, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'A full-bodied lager beer of exuberant and robust character. Itâ€™s muscle-man body comes from decocted German malts and noble German hops. Lagered long and cold to refine its strong temperament, St. Boisterous emerges smooth and seductive, with a malty sweet charm. This classic rendition of the German â€˜maibock'' style will warm your heart.', 'http://www.victorybeer.com', 7.30, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3823, 1326, 4, 50, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'As invigorating as the morning rays of the summer sun, Sunrise Weissbier satisfies when the heat is on, too. This unfiltered, Bavarian style ale is true to its origins with all ingredients except for the water having been imported from Germany. It remains unfiltered to feature the tangy, fruity flavors of its unique yeast. The imported German malt contributes greatly to add a crisp, citric snap that makes this beer a superb summertime refresher.', 'http://www.victorybeer.com', 5.70, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3824, 1326, 5, 67, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'A swirling dynamo of flavor, with a steady calm of satisfaction at its heart, that''s Whirlwind Witbier. Offering a tamed tempest of flavors both spicy and sublime, this softly fermented ale greets the nose and tingles the tongue. Imported Belgian yeast charges Whirlwind with an energy all its own. It is a refreshing interpretation of the classic, Belgian ''white beer'' style.', 'http://www.victorybeer.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3825, 1326, 7, 84, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Seductively smooth, this medium-bodied amber beauty is akin to the great Oktoberfest beers of Munich. All German malts and whole flower European hops make this lager true to style.', 'http://www.victorybeer.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3826, 1326, 3, 32, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'We celebrate the pioneering spirit of old Horace ''Hop'' Wallop and those who dare mighty adventurous things in this vivid, robust ale. As our annual homage to the hop harvest, expect loads of aromatic splendor and bitter beauty.', 'http://www.victorybeer.com', 8.50, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3827, 1326, 4, 55, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'This dark amber wheat beer features fruity and spicy aromas galore. Significant strength underlies the pleasant citric appeal of this bock beer. Redolent with the flavors of harvest fruit, Moonglow typifies the traditional weizenbock-style so thoroughly enjoyed throughout Bavaria. Left unfiltered, its unique yeast strain gives Moonglow a radiance all its own.', 'http://www.victorybeer.com', 8.70, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3828, 1326, 3, 35, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'A luxurious, warming barleywine rich with aromatic hops and dark, candied fruit character that hides its epic strength masterfully.', 'http://www.victorybeer.com', 10.50, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3829, 1326, 8, 95, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'From the tradition started by the monks of St. Francis of Paula in 1634 comes this warming beer of rich heritage. A dark, rich lager of sublime complexity and character, St. Victorious is created from multiple German malts. Laborious decoction mashing yields the choicest elements of the malt. Long, cold aging mellows the strong temperament of this subtle beer. Celebrate the end of winter with a warming draft of St. Victorious Doppelbock!', 'http://www.victorybeer.com', 7.60, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3849, 960, 3, 42, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A dry Irish-style stout served via nitrogen. Black Mo is a very smooth and creamy beer with a pleasant roasted malt character.', 'http://www.ottospubandbrewery.com/index.php', 4.60, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3832, 1326, 3, 31, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Menacingly delicious, with the powerful, aromatic punch of whole flower American hops backed up by rich, German malts. HopDevil Ale offers a roller coaster ride of flavor, coasting to a smooth finish that satisfies fully.', 'http://www.victorybeer.com', 6.70, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3833, 399, 8, 96, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Coors beer, first introduced by Adolph Coors in April, 1874, is brewed in the Rockies for a uniquely crisp, clean and drinkable "Mile High Taste.', 'http://www.coors.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3834, 399, 8, 96, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Coors Light is Coors Brewing Company''s largest-selling brand and the fourth best-selling beer in the U.S. Introduced in 1978, Coors Light has been a favorite in delivering the ultimate in cold refreshment for more than 25 years. The simple, silver-toned can caught people''s attention and the brew became nicknamed the "Silver Bullet" as sales climbed.', 'http://www.coors.com', 4.20, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3835, 399, 8, 95, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Coors'' Extra Gold Lager is a rich, full-flavored lager that has a deep golden color. Extra Gold Lager starts with the slow aging of its roasted malts, which are then combined with its other premium ingredients and slow-brewed to produce this exceptional, refined lager.', 'http://www.coors.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3836, 878, 8, 95, '175 Bloor Street East', 'Toronto', 'Ontario', 'Canada', 'Molson beers are imported directly from Canada. Crystal-clear, pure Canadian water, the finest Canadian prairie grains and select European hops give Molson a brewing heritage that dates back to 1786. Molson Canadian is Molson Brewing Company''s flagship brand. Starting with crystal clear water, malted barley and the finest hops, Molson Canadian is slowly fermented to produce a smooth, refreshing beer with a genuine taste. Clean and clear, crisp and cold, Molson Canadian is a classic lager.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.6706, -79.3824', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3837, 399, 11, 123, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'This amber-colored, naturally pumpkin flavored ale is brewed only in the autumn and combines the flavor of vine-ripened pumpkin and spices. If you''re in the mood for something unique and different to go along with the change of season, autumn is the perfect time to try Blue Moonâ„¢ Pumpkin Ale. Available mid-September through December.', 'http://www.coors.com', 5.70, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3838, 399, -1, -1, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Zima is redefining refreshment. Zima flavored malt beverages are a great choice for adult consumers who seek variety and new and different products. Zima was reformulated in 2007 and is available in three citrus-based flavors. Zima is lighter in carbonation and alcohol content, making it more drinkable and lower in calories than the old formula.', 'http://www.coors.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3839, 399, 5, 67, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Blue Moon Belgian White, Belgian-style wheat ale, is a refreshing, medium-bodied, unfiltered Belgian-style wheat ale spiced with fresh coriander and orange peel for a uniquely complex taste and an uncommonly smooth finish. The name "Belgian White" is a reference to the cloudy white, opaque appearance of the beer. "Belgian White" also refers to the style of beer, which has been brewed in Belgium for about 300 years. This type of ale is brewed with malt, wheat and oats. It is unfiltered, which allows protein and yeast to remain suspended in the beer and creates the cloudy appearance. This also adds to the smoothness and full body of the beer. Putting a new twist on the lime ritual, Blue Moon is traditionally served with a slice of orange. Blue Moon was launched in 1995.', 'http://www.coors.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3840, 399, 8, 95, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Killian''s Irish Red is a traditional lager with an authentic Irish heritage, based on the Killian family''s recipe created for the Killian''s brewery in Enniscorthy, Ireland in 1864. Coors acquired the rights to brew and market the product in America and Killian''s was introduced to the U.S. in 1981. Killian''s Irish Red derives its distinctive red-amber color and taste from a special caramel malt that has been roasted at a high temperature longer and more slowly than most malts. There are no coloring agents or artificial additives used in brewing Killian''s. The brew is known for its rich amber color and thick, creamy head.', 'http://www.coors.com', 4.90, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3841, 1286, 7, 77, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Hop fans rejoice! Sunshine Pils combines the crisp taste of European style pilsners with a kicked-up hop character to create a balanced, refreshing seasonal beer. Golden in color with a fluffy white head, Sunshine Pils is the perfect beer for Summer.', 'http://www.troegs.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3842, 1326, 5, 72, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Our latest release in the V Series of bottle conditioned, Belgian-inspired ales is heady with an earthy, aromatic hop start. Involving hops from the Czech Republic, Germany and England, this flavorful ale slides into flavors of honey and mildly tart fruit. Leaving a refreshing impression of dryness, this is a quenching, invigorating ale, despite it substantial strength at 7.5% abv.', 'http://www.victorybeer.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3843, 960, 11, 116, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A light American wheat ale with the delicate aroma and flavor of apricot. ABV 4.7%', 'http://www.ottospubandbrewery.com/index.php', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3844, 960, 8, 95, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'This light refreshing American lager has a malty smooth character and low hop bitterness.', 'http://www.ottospubandbrewery.com/index.php', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3845, 960, 8, 95, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A Vienna-style lager with a smooth malt palate and a dry finish. ABV 5.2%', 'http://www.ottospubandbrewery.com/index.php', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3846, 960, 3, 26, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'An American red ale brewed with Northern Brewer for the bittering and Liberty in the hopback. Very malty and crisp, this ale has all the fun without the AMD. ABV 5.0%', 'http://www.ottospubandbrewery.com/index.php', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3847, 960, 3, 26, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'An American pale ale brewed with Centennial hops and hopbacked with Cascade, it''s a real refresher that has a spicy, citrus aroma and a slightly nutty malt flavor. ABV 5.0%', 'http://www.ottospubandbrewery.com/index.php', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3848, 960, 3, 32, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'Hopheads rejoice! This strong IPA takes the style to a new level. It''s a big Imperial IPA packed with Nugget, Palisade, and Amarillo hops. ABV 8.2%', 'http://www.ottospubandbrewery.com/index.php', 8.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3850, 960, 5, 61, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'An Abbey-style Tripel ale. This light colored traditional tripel is made with Pils malt and candisugar and fermented with a traditional yeast strain. Esterey and strong best describe this unique specialty beer.', 'http://www.ottospubandbrewery.com/index.php', 9.60, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3851, 960, 5, 60, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'An Abbey-style Dubbel ale. This dark amber brown ale is full of apple, raisin, and banana esters with a smooth malty finish.', 'http://www.ottospubandbrewery.com/index.php', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3852, 960, 3, 26, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A cask-conditioned American Pale Ale. This is a bright dry ale brewed only with American Nugget hops.', 'http://www.ottospubandbrewery.com/index.php', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3853, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Blue is the best-selling Canadian beer in the world. Introduced in 1951 as Labatt Pilsener, it was named for the colour of its label by fans of the Winnipeg Blue Bombers football team. Blue was the first brand in Canada with a twist-off cap and won the silver medal in the International Lager category at the 1998 Brewing Industry International Awards. Labatt Blue, brewed using specially selected aromatic hops, is a well-balanced, fully matured, full-flavoured beer with a fruity character and a slightly sweet aftertaste.', '', 4.70, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3854, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Ice, introduced in 1993, was the worldâ€™s first Ice-Brewedâ„¢ beer and the most successful new brand introduction in Canadian brewing history. Labatt Ice is a fully fermented beer that is allowed to mature at cold temperatures. Labatt Ice uses selected North American hops to complement its smooth, full flavour.', '', 5.60, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3855, 762, 8, 96, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Blue Light was introduced in 1983 as a lower alcohol, lower calorie version of Canadaâ€™s most popular brand. Blue Light uses specially selected North American aromatic hops and the same strain of lager yeast as the one used to produce Labatt Blue. The result is a crisp, clean and delicately balanced beer, with a slight sweetness and citrus-like hop character.', '', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3856, 762, 7, 77, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Bleue Dry, the second addition to the Bleue family, is brewed with the same care and attention to detail as Labatt Bleue. Labatt Bleue Dry is mashed longer than regular beers to leave less carbohydrate (sugar) in the finished beer, giving a clean, crisp finish. Using select aromatic hops and a blend of the finest quality North American barley malts, this lager is clean-flavoured with no aftertaste.', '', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3857, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Crystal was introduced to Ontario in the late 1800s as one of the first lagers brewed by Labatt. World-renowned Saaz hops are used to give this beer a clean, almost sweet taste which nicely balances the fuller body, higher bitterness and richer taste typically associated with traditional lagers.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3858, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Labatt Extra Dry was the first national launch of a dry beer in Canada. Labatt Extra Dry is mashed longer than regular beers to leave less carbohydrate in the finished product, giving a lighter flavour with little aftertaste.', '', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3859, 762, 3, 26, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'John and Hugh Labatt, grandsons of founder John K. Labatt, launched Labatt 50 in 1950 to commemorate 50 years of partnership. The first light-tasting ale introduced in Canada, Labatt 50 was Canadaâ€™s best-selling beer until 1979 when, with the increasing popularity of lagers, it was surpassed by Labatt Blue. Labatt 50 is fermented using a special ale yeast, in use at Labatt since 1933. Specially-selected North American hops and a good balance of dryness, complemented by a fruity taste, provide Labatt 50 with all the distinguishing features of a true ale.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3860, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Originally introduced in 1992, Genuine Lager has evolved into a truly definitive Canadian Lager. Balancing a blend of quality aromatic and bittering hops with its medium body, Genuine Lager is a smooth, refreshing and easy-drinking beer with a subtle hop aroma and a hint of malty sweetness.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3861, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Genuine Honey Lager was introduced in 2005 in response to consumer demand for honey lagers. Labatt Genuine Honey uses genuine, all-natural, 100% Canadian honey to give consumers a softer, smoother taste. This naturally-aged lager is brewed to the same uncompromising standards applied to every Labatt beer. Genuine Honey Lager is the real thing!', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3862, 762, 8, 95, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'Wildcat is a popular priced, quality lager introduced in 1993. Conventional brewing processes are used to produce a quality mainstream lager using corn adjunct to deliver a light, dry flavour.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3863, 762, 8, 96, '150 Simcoe Street', 'London', 'Ontario', 'Canada', 'With only 88 calories per 341 ml bottle, Labatt Sterling is a light, refreshing beer with 1/3 less calories than regular beers. In other words, it''s a great tasting beer...that won''t slow you down.', '', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.9778, -81.2467', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3864, 302, -1, -1, 'Stoopkensstraat 46', 'Hoegaarden', 'Vlaams Brabant', 'Belgium', 'Hoegaarden, both unique and very refreshing, is an authentic Belgian wheat beer. In fact, it is the original â€œWitâ€ beer! First brewed in 1445, this top-fermented beer is refermented in the bottle or keg. Hoegaarden has a distinctive, cloudy yellow colour and a uniquely refined taste that balances a slight spiciness from a touch of coriander and orange peel.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.7778, 4.8877', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3865, 975, 7, 77, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Our flagship brand! An amber Vienna-style lager beer that is smooth, mellow and full bodied, with delicate hop aroma. Uses two-row barley malt and caramel-roasted malt. Based on founder Tom Pastorius'' favorite German bier.', 'http://www.pennbrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3866, 975, 8, 95, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Nationally acclaimed as the best Munich-style beer made in America. Penn Gold is a light-colored, medium bodied lager beer with a delicate hop aroma.', 'http://www.pennbrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3867, 975, -1, -1, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Munich and various roasted malts give it a very malty, rich flavor with a hint of burnt flavor. 100% imported Hallertau hops, moderate bitterness and aroma.', 'http://www.pennbrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4996, 459, 11, 123, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A full-bodied brown ale with smooth hints of pumpkin and brown sugar. Perfect to warm-up with, as the season cools.', 'http://www.dogfish.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3868, 975, 4, 50, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Authentic wheat beer, brewed in the Southern German tradition, won the Silver Medal in 1997 and the Gold Medal at the 2000 in Denver, Colorado. Penn Weizen is top-fermented, cask-conditioned, and very effervescent with a slight hint of tangy clove flavor.', 'http://www.pennbrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3869, 975, -1, -1, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'A spring fest beer that is amber in color, Penn MÃ¤rzen has full flavor and body. Highly rated by the National Beverage Tasting Institure.', 'http://www.pennbrew.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3870, 975, 7, 90, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Introduced on May 1, 2007. Available May and June. Distributed throughout our network of wholesalers in draft and 22 oz. bottles.', 'http://www.pennbrew.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
