INSERT INTO beerbuddies_db.beer VALUES (3872, 698, 8, 95, '3340 Liberty Ave.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Augustiner is a premium amber lager with a smooth, full-bodied flavor. From the rich copper color to the subtle caramel taste and clean finish, itâ€™s brewed to please the beer drinker who appreciates the best. This distinctive, well-balanced brew is quickly becoming Pittsburghâ€™s most talked-about beer. Upgrade to Augustiner!', 'http://www.ironcitybrewingcompany.com/Default.aspx', 4.30, 0.00, 0.00, 0, '9999-01-01', '40.461, -79.9653', '2018-10-05');
