INSERT INTO beerbuddies_db.beer VALUES (3875, 1211, 3, 26, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'This uniquely American beer offers a crisp, medium body with a light amber color. Generous additions of Cascade hops provide a refreshing bitterness and vibrant citrus aroma.', 'http://www.stoudtsbeer.com/brewery.html', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3876, 1211, 8, 95, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'Stoudt''s Gold Lager is widely recognized as one of the finest German-style beers brewed in America. Brewed with the finest specialty malts and noble hops, this light bodied, easy drinking lager features a subtle balance of sweet malt and clean crisp hops.', 'http://www.stoudtsbeer.com/brewery.html', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3877, 1211, 1, 5, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'This English-style ale is brewed with Marris Otter and Caramel malts for a rich, reddish-copper color and smooth malty palate. The use of bittering and aroma addition hops balances the regal, sweet maltiness and imparts a softly perfumed aroma', 'http://www.stoudtsbeer.com/brewery.html', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3878, 1211, 7, 77, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'Reflective of the traditional German style, Stoudt''s Pils is delicately dry with firm bitterness. This crispness of Saaz hops and a dry malt finish make the Pilsener an excellent aperitif.', 'http://www.stoudtsbeer.com/brewery.html', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3879, 771, 3, 26, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Our multi-grain pale ale summons the sweetness of oats, the complexity of rye and the smoothness of malted wheat, balanced by a generous dry-hopping of imported, noble Saaz hops.', 'http://www.lancasterbrewing.com/index.html', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3880, 771, 11, 116, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Just in time for summer, this American wheat lager style beer with the subtle suggestion of real, fresh strawberries, is the perfect pint of true refreshment. Light and crisp, our Strawberry Wheat is a "must try" for fruit and beer lovers alike.', 'http://www.lancasterbrewing.com/index.html', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3881, 771, 3, 42, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'We are proud to offer one of the few surviving examples of this traditional English style sweet stout. A bold dark ale, bursting with roasted barley dryness and mellowed by hints of chocolate and coffee.', 'http://www.lancasterbrewing.com/index.html', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3882, 771, 3, 31, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Our hoppiest beer to date. This formidable India Pale Ale has a hop aroma that demands attention. The bold, citrus hop flavor is balanced by a dry malt character that makes this refreshing ale a true classic.', 'http://www.lancasterbrewing.com/index.html', 7.90, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3883, 963, 8, 96, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'PBR is not just any beer- so you would expect the history to be a bit unusual, and it is. Pabst was originally called "Select," but people started asking for that "Blue Ribbon" beer in 1882 when we started tying silk ribbons to the bottles. We officially added the words "Blue Ribbon" to the bottle in 1895. Pabst was the first brewery to put beer in cans back in 1935. This was Blue Ribbon beer but it was called "Export" when sold in the can. Our first cans had a picture of a can opener on the side with instructions on how to open the can of beer, with the can opener. Today, this classic American brew has been adopted by a whole new generation of PBR drinkers. Currently, PBR is one of the fastest growing domestic beer brands. When you''re this good, quality always comes through-PBR ME ASAP!', 'http://www.pabst.com/', 4.74, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3884, 963, 8, 96, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'PBR is not just any beer- so you would expect the history to be a bit unusual, and it is. Pabst was originally called "Select," but people started asking for that "Blue Ribbon" beer in 1882 when we started tying silk ribbons to the bottles. We officially added the words "Blue Ribbon" to the bottle in 1895. Pabst was the first brewery to put beer in cans back in 1935. This was Blue Ribbon beer but it was called "Export" when sold in the can. Our first cans had a picture of a can opener on the side with instructions on how to open the can of beer, with the can opener. Today, this classic American brew has been adopted by a whole new generation of PBR drinkers. Currently, PBR is one of the fastest growing domestic beer brands. When you''re this good, quality always comes through-PBR ME ASAP!', 'http://www.pabst.com/', 4.19, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3992, 385, 3, 31, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Loose Cannon Hop3 Ale - called Hop 3 (hop cubed) ale to reflect the enormous amount of hops in this beer: over 3 pounds per barrel! Also the beer is hopped 3 ways - in the kettle, in the hop back, and dry hopped. Winner of the Overall Best of Show Award in the Maryland State Governor''s Cup 2005 Competition and voted the #1 IPA by Mahaffeyâ€™s Pub. We are very excited about this new product and have decided to make this beer available year round!', 'http://www.ccbeer.com/', 7.25, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3885, 963, 8, 95, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'Old Milwaukee. A trusted, high quality beer that continually receives the highest awards and accolades from Beer experts across America. Old Milwaukee has a long history of celebrating "Blue Collar" sensibility. Simply said, good beer at a fair price. Old Milwaukee has always represented America''s core values: Honesty, integrity, hard work and love for your family. Speaking of family, the Old Milwaukee Family has a beer that is right for you. Old Milwaukee when you want a full bodied, full flavor American Lager. OM Light when you are in the mood for a lighter tasting beer with fewer calories. And don''t forget OMNA, our flavorful non-alcoholic beer for those moments when you want the taste of America'' best tasting beer without the alcohol content.', 'http://www.pabst.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3886, 963, 8, 96, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'It took â€œThe Beer Drinkerâ€™s Beerâ€ to introduce a real draft in a canâ€”and you can still taste that milestone in brewing history today with every can of Piels. Our Draft Style delivers unsurpassed flavor and character like it was drawn straight from the tap!', 'http://www.pabst.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3887, 963, 8, 96, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'Over a century of brewing skill, along with the finest ingredients obtainable, has resulted in a beer unique for its balance of lightness and delicious flavor.', 'http://www.pabst.com/', 3.79, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3888, 963, -1, -1, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'St. Ides High Gravity Premium Malt Liquor is the brand of choice with the new generation of malt liquor drinkers. With its high quality, high strength flavor, St. Ides compliments the lifestyle of the fast paced, urban, edgy malt liquor drinker of today.', 'http://www.pabst.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3889, 963, -1, -1, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'For over 4 decades, Colt 45 Premium Malt Liquor has been the "class of all malt liquor brands". With its smooth and distinct flavor and historic affiliation with Billy Dee Williams, it has become an urban American icon. If you''re looking for a thick 40, or an ice cold shorty, Colt 45 is the malt liquor that works EVERYTIME!', 'http://www.pabst.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3890, 698, 8, 96, '3340 Liberty Ave.', 'Pittsburgh', 'Pennsylvania', 'United States', 'IC Light is an original, not a watered down copy, and brewed to be light from start to finish.', 'http://www.ironcitybrewingcompany.com/Default.aspx', 4.15, 0.00, 0.00, 0, '9999-01-01', '40.461, -79.9653', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3891, 771, 3, 26, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Extra Pale Ale with a subtle Rye flavor, this beer Pours a light orange-amber color with a thin light beige head. A refreshing summer beer. Available at the Brewery from April - September', 'http://www.lancasterbrewing.com/index.html', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3892, 771, 1, 13, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Our classic Olde Ale redefines the term "full-bodied" with its deliverance of complex and firm malt flavor. A fine blend of British and American hops provides an even bitterness as this beer finishes with a warming alcohol flavor.', 'http://www.lancasterbrewing.com/index.html', 8.90, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3893, 771, 8, 95, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'A traditional German style lager. Characterized by a deep copper color and rich malt flavor. Balanced with German hops. Available at the Brewery and in bottles & cases from March - May.', 'http://www.lancasterbrewing.com/index.html', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3894, 771, 7, 84, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'This smooth brew ushers in Autumn with an invitingly tawny color complemented by an assertive maltiness. A noble crispness from German and Czech hops completes this very traditional lager-style beer, Available from August to November. Available at the Brewery and in bottles & cases from September - December.', 'http://www.lancasterbrewing.com/index.html', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3895, 771, 7, 90, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'A mighty lager-style brew, dark in color. Our Doppelbock brings a big malty sweetness together with the classic lager smoothness, topped off with a slightly evident alcohol flavor. A toasty brew to battle even the coldest winter nights. Available at the Brewery and in bottles & cases from March - May.', 'http://www.lancasterbrewing.com/index.html', 8.10, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3896, 771, 4, 50, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Light and refreshing! This very bubbly Munich style weizen beer is highlighted by a spicy, banana finish. Available at the Brewery from May - October', 'http://www.lancasterbrewing.com/index.html', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3897, 771, 7, 77, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Crisp and refreshing, this classic Bohemian Pilsner brings noble hop flavor and traditional German maltiness into perfect union before another healthy dose of imported hops tips the scales towards a decidedly hoppy finish.', 'http://www.lancasterbrewing.com/index.html', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3898, 1009, 3, 33, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', '', 'http://www.portbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3899, 1009, 3, 31, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'This one is dedicated to everyone who has gotten up at the butt crack of dawn, headed towards the shores and found it 4-6 feet and offshore only to find 30 of your "buddies" have already claimed the peak. As you paddle out, a swell arrives from nowhere signaling your turn to go. The surf Gods are shinning on you today. You turn, stroke like mad for the wave. Standing up you are alone and blammo you Wipeout....blowing the only chance of a right hander all to yourself. You know who you are. We''ve all been there too. It''s inside each and every one of us. Welcome to the waters of Wipeout IPA, a massively hopped India Pale Ale with enough substance and body to overcome even the worst and most tragic of on the water spills. We brew Wipeout IPA for everyone- especially those hardy souls who brave the cold winter water and monster sets produced by an amazing northwest swell. Only a tidal wave of hops can overcome the surging tide of malt that is required to produce a beer of this shape. We invite you to drop in, hang on and kick out the backside. That is, unless you enjoy wiping out and all the glory that goes with it. Malts- Two Row, Wheat, Carapils and English Crystal Malts Hops- Amarillo, Centennial and Simcoe Yeast- White Labs California Ale Original Gravity- 1.064 Terminal Gravity- 1.008 7.0% ABV Draft- Available in Southern California and Arizona 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.', 'http://www.portbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3993, 385, 3, 43, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'A dry Imperial stout with rich black color and aromas of roasted coffee, molasses, dark chocolate, toffee and caramel. Rich, powerful, and lingering.', 'http://www.ccbeer.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3900, 1009, 8, 95, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'Because everyone needs a friend. It seems only natural that with San Diego being one of the closest cities to the Mexican Border that you would find a beer like Amigo. Brewed in the San Diego Lager style, this all malt lager is a refreshing way to start or finish a drinking session. The product of a true lager fermentation, this beer is crisp and lighter in body than most ales of similar strength making it a friendly choice for any occasion. Malts- Pilsner and Two Row Hops- German Magnum and Czech Saaz Yeast- White Labs German Lager Original Gravity- 1.048 Terminal Gravity- 1.010 5.0% ABV Draft- Available in Southern California and Arizona', 'http://www.portbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3901, 1009, 3, 32, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'First brewed in 2002 to celebrate the 15th Anniversary of the Pizza Port in Solana Beach, Hop 15 was imagined and designed by Tomme Arthur and Jeff Bagby. It was to be a celebration of 15 years of "Good Beer Brings Good Cheer." So there are 15 different hop varieties that are added to the beer every 15 minutes. Over the years, Hop 15 has racked up numerous accolades. It has won two silver medals at the Great American Beer Festival. It also was named Alpha King in 2004 and received a first place award at the Bistro Double IPA beer festival in Hayward, CA. Hop 15 remains won of the stickiest most resinous beers we have ever tasted and for that, we are thankful it is on tap at our brewery each and every day. Malts- Two Row and English Light Crystal Hops- We use 15 Different Varieties on a strictly don''t ask don''t tell policy Yeast- White Labs California Ale and Proprietary Yeast Strains Original Gravity- 1.086 Terminal Gravity- 1.014 9.7 % ABV Draft- Available in Southern California 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.', 'http://www.portbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3902, 1009, 1, 13, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', '"Not your Dad''s Wimpy 30 Weight is how our original label used to describe this massive chewy and thick beer. Code named by our brewers-"The Big Black Nasty," this is monstrous dark ale is brewed to no particular style. Thick and sludgy like oil from the crankcase of a wheat threshing combine, Old Viscosity blurs the boundaries of Porter, Stout, Old Ale and Barleywines. A blended beer that mixes old and new brewing traditions into one finished beer, Old Viscosity starts out with 80% of the packaged beer produced from a stainless steel fermentation. It then joins another 20% Barrel Aged Old Viscosity (from a previous batch) that has been aging in bourbon barrels. The blend of the two beers yields an incredibly rich and luscious ale that reveals chocolate and cocoa notes melded to silky body of burnt wood, vanilla and ash. Malts- Two Row, Wheat, Domestic and English Crystal, Carafa III and Chocolate Malts Hops- German Magnum Yeast- White Labs California Ale and Proprietary Yeast Strains Original Gravity- 1.092 Terminal Gravity- 1.014 10.5 % ABV Draft- Available in Southern California and Arizona 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.', 'http://www.portbrewing.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3903, 975, 7, 90, '800 Vinial St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'A very rich, dark bock beer. dark ruby in color with subtle tones of chocolate and burnt malt. It will warm you on a cold winter night and brighten your days. The perfect holiday gift for the beer drinker.', 'http://www.pennbrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.4569, -79.9915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3904, 871, 8, 95, '238 Lake Shore Drive', 'Minocqua', 'Wisconsin', 'United States', 'This unique, award-winning lager combines the smoothness of traditional barley with the warm, nutty flavor of wild rice. Truly an original brew!', 'http://www.minocquabrewingcompany.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '45.8722, -89.7097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3905, 871, 3, 26, '238 Lake Shore Drive', 'Minocqua', 'Wisconsin', 'United States', 'An amber-colored ale with a pronounced floral aroma and a flavor contributed by Cascade hops. Hop lovers will savor this bold version of an American classic.', 'http://www.minocquabrewingcompany.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '45.8722, -89.7097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3906, 871, 3, 38, '238 Lake Shore Drive', 'Minocqua', 'Wisconsin', 'United States', 'Perhaps the most ancient style of beer, our brown ale is robust with a hint of nut flavor. With definable malt characteristics, this dark ale is sure to please any beer enthusiastâ€™s palate.', 'http://www.minocquabrewingcompany.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '45.8722, -89.7097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3907, 871, 3, 33, '238 Lake Shore Drive', 'Minocqua', 'Wisconsin', 'United States', 'Deserving of its name, this red/amber colored ale is sure to knock you off your feet. Crystal and caramel malts contribute to a balance of sweetness and smoothness.', 'http://www.minocquabrewingcompany.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '45.8722, -89.7097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3908, 871, 2, 25, '238 Lake Shore Drive', 'Minocqua', 'Wisconsin', 'United States', 'This dark, full bodied ale has a hint of rye accompanied by chocolate malt. The perfect brew for relaxed sipping!', 'http://www.minocquabrewingcompany.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '45.8722, -89.7097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3909, 755, 5, 61, '', 'Morrisville', 'Vermont', 'United States', '', '', 5.90, 0.00, 0.00, 0, '9999-01-01', '44.5617, -72.5984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3910, 6, 5, 61, 'Rue de Maredsous, 11', 'Dene', 'Namur', 'Belgium', 'Moortgat''s Maredsous 10 is an orangy-blond big sweet tripel nudging into a barley wine.', 'http://www.maredsous10.be/', 10.00, 0.00, 0.00, 0, '9999-01-01', '50.3093, 4.7646', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3911, 6, 5, 60, 'Rue de Maredsous, 11', 'Dene', 'Namur', 'Belgium', 'Moortgat''s Maredsous 8 is a fine strong dubbel that is sweet when young but develops a stout like flavour as it ages.', 'http://www.maredsous10.be/', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.3093, 4.7646', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3912, 6, 3, 37, 'Rue de Maredsous, 11', 'Dene', 'Namur', 'Belgium', 'Blonde Ales are one of the fastest growing beer styles in Belgium, France and the UK. Moorgat''s Maredsous 6 is an easy drinking Blonde with a balance of graininess and aromatic hop.', 'http://www.maredsous10.be/', 6.00, 0.00, 0.00, 0, '9999-01-01', '50.3093, 4.7646', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3913, 526, 3, 31, '515 Jefferson Street SE', 'Olympia', 'Washington', 'United States', 'The Mighty Fish Brewers first produced Ten Squared Anniversary Ale to celebrate Fish Brewing Companyâ€™s tenth anniversary. The ale was so good and the response to it so overwhelmingly positive that it has become the crown jewel of REEL ALEs. Ten different hops: Horizon, Chinook, Columbus, Willamette, Tradition, Northern Brewer, Santiam, Tettnanger, Cascade and Golding, in the order of their use -- give Ten Squared a unique hop character which has to be tasted to be believed. Even with 100 IBUs, this brew sports a strong malt backbone. Two-row Pale, Caramel 40, Caramel 75, Special B and Aromatic malts impart remarkable balance for such a hop monster. This is smooth ale with surprising similarities to ten year old malt whiskey. Produced for the holidays, 10 102 Anniversary Ale is usually available into late spring.', 'http://www.fishbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '47.0437, -122.897', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3994, 385, 5, 74, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'This beer is brewed in the Belgian Saison style (country farm house ale). A potent yet delicate ale, brewed with a unique Belgian yeast which develops a spicy, fruity flavor. Enormously complex. Available from May to around August.', 'http://www.ccbeer.com/', 7.25, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3914, 157, 8, 95, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams Boston LagerÂ® is the best example of the fundamental characteristics of a great beer, offering a full, rich flavor that is both balanced and complex. It is brewed using a decoction mash, a time consuming, traditional four vessel brewing process discarded by many contemporary brewers. This process brings forth a rich sweetness from the malt that makes it well worth the effort. Samuel Adams Boston LagerÂ® also uses only the finest of ingredients including two row barley, as well as German Noble aroma hops. The exclusive use of two row barley not only imparts a full, smooth body but also gives the beer a wide spectrum of malt flavor ranging from slightly sweet to caramel to slightly roasted. The Noble hops varieties, Hallertau Mittelfruh and Tettnang Tettnanger, add a wide range of floral, piney and citrus notes, which are present from the aroma, through the flavor, to the lingering smooth finish. We take great pride in the Noble hops used in our beers. They are hand selected by Jim Koch and our other brewers from the world''s oldest hops growing area. Among the world''s most expensive, they cost twenty times as much as other hops.', 'http://www.samueladams.com/', 4.75, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3915, 157, 7, 90, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Intense and warming, a meal in a bottle. One can not help but appreciate Samuel AdamsÂ® Double Bock''s huge malt character. We use an enormous amount of malt, half a pound per bottle, to brew this intensely rich lager. Its deep brown-ruby color is all made in the kettle - no black malt is used, resulting in a rich sweetness that is free of the rough taste of burnt malt. All that remains is the velvet smooth flavor and mouthfeel of the two row malt. Samuel AdamsÂ® Double Bock''s intense malt character is balanced with a subtle piney, citrus hop note from the German Noble hops. Due to legal restrictions, Samuel AdamsÂ® Double Bock can not be sold in the states of Alabama, Arizona, Georgia, Iowa, Louisiana, Missouri, North Carolina, Ohio, South Carolina, Tennessee, and West Virginia.', 'http://www.samueladams.com/', 8.80, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3916, 157, 11, 116, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'right and citrusy, brewed with mysterious grains of paradise. Samuel Adams® Summer Ale is an American wheat ale. This summer seasonal uses malted wheat as well as lemon zest and grains of paradise, a rare pepper from Africa first used as a brewing spice in the 13th Century to create a crisp and spicy flavor and body. The ale fermentation imparts a background tropical fruit note reminiscent of mangos and peaches. All of these come together to create a quenching, clean finishing beer perfect for those warm Summer days', 'http://www.samueladams.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3917, 157, 3, 26, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'A smooth, refined version of a classic ale. Samuel AdamsÂ® Boston Ale was first brewed to celebrate the opening of our Boston Brewery. Like Samuel Adams Boston LagerÂ®, it was an old family recipe that was rescued by Jim Koch from his father''s attic. Samuel AdamsÂ® Boston Ale, a Stock Ale, has a complex, caramel malt character balanced with distinct spicy and herbal hop notes. Our proprietary ale yeast imparts a variety of fruit and ester notes in both the nose and flavor which are indicative of the style.', 'http://www.samueladams.com/', 4.94, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3918, 157, 7, 86, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'When one sees a beer with a darker complexion these days, more often than not it', 'http://www.samueladams.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3919, 157, 7, 90, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Bold and rich, with a touch of holiday spice The first thing one notices in a Samuel Adams® Winter Lager is its color: the deep brown of winter. Then comes the magical aroma which promises something special on the tongue. The warm aroma of cinnamon and ginger which blends with the roasty sweetness of the malted barley and hint of citrus from the orange peel. And after that first sip the promise is fulfilled. On the palate Samuel Adams® Winter Lager is rich and full bodied, robust and warming, a wonderful way to enjoy the cold evenings that come with this season.', 'http://www.samueladams.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3920, 1352, 5, 61, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Merry Monks'' Ale is a Belgian style Abby Trippel without limitation. This style was created by Trappist Monks in Belgium over 500 years ago. To be true to the style, Merry Monks'' Ale is bottle conditioned. This means we add a bit of sugar and yeast just prior to bottling. This imparts a special effervescence to the beer, a creamier carbonation, and also extends the shelf life. The on-going fermentation inside the bottle will change the character of the beer as it ages, and you''ll find it becomes dryer with age. You may want to lay down a few bottles for future evaluation. We suggest storing at cellar temperatures -around 55 degrees F- and away from light. When you try this beer you''re in for a unique treat. The special effervescence and creaminess are immediately apparent when pouring. The Pilsner malts combined with the Belgian yeast strains yield a remarkable and complex flavor- perhaps you''ll note subtle hints of fruit or spice. The flavor is nicely balanced and the finish moderate to dry , begging for the next sip. You might ask why we go through all this trouble and expense for just a beer, but one taste and you''ll know the Merry Monks'' Ale (9.3% ABV) will more than complement any meal it accompanies. Enjoyed best around 48 degrees F, it also makes a fine after-dinner drink.', 'http://www.weyerbacher.com/', 9.30, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3921, 1352, 11, 141, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'At Weyerbacher we''ve created a Winter Ale that is a must for any malty beer lover. Winner of a Silver Medal in the 1998 World Beer Championships, Weyerbacher Winter Ale is brewed with deep-roasted chocolate malt. The taste predominates with a warm, roasty flavor, balanced out with a slightly dry finish. It''s smooth but not cloying, with a warming belt of alcohol (5.6% ABV). Although winter ales predate history, they are believed to have their origin in the pagan celebrations of winter solstice. Later, when monasteries produced the local brew, winter ales were made each year to commemorate the birth of Christ. Back then, winter ales were brewed full-bodied as a source of nutrition for the upcoming winter months. Today, winter ales are typified by their seasonality, their rich, malty flavors and by their deep, dark coloration. Generally available November-March, Weyerbacher Winter Ale is the perfect libation for a winter meal, with good friends, or beside a warm fire fending off a cold winter night.', 'http://www.weyerbacher.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3956, 541, 3, 31, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'At the request of you hopheads, we produced this I.P.A. with a deep golden color, plenty of hop bitterness balanced by malt sweetness. Because of the extensive dry hopping, there''s a floral and citrus hop finish. It''s then lightly filtered to maintain the appropriate body and flavor. The beer features a combination of American, English and German malts to balance the large amount of hops. The HopFish also uses three hop varieties at five different times and has been dry-hopped for two weeks with 22lbs of Nugget whole leaf hops.', 'http://www.flyingfish.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3922, 1352, 7, 84, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'AutumnFest is Weyerbacher''s own unique twist on the German Oktoberfest style. Copper-amber in color, AutumnFest is made with Vienna and Munich malts for that authentic, Bavarian easy drinking taste. Each sip imparts a wonderful roastiness of malt on the tongue followed by a smooth, consistent finish. Wonderfully balanced with a clean, velvety, slightly fruity taste, AutumnFest is the perfect beer for the Fall- a nice transition between the lighter beers of summer and the darker, heavier winter brews. It''s a favorite of many Weyerbacher aficionados, who anticipate the end of summer with this wonderful beer. Weyerbacher AutumnFest ( ABV 5.4%) is generally available in stores August through December. Pick up a case to celebrate the change of seasons. Prost!', 'http://www.weyerbacher.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3923, 1352, 2, 25, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Coming in at an ABV of 7.0%, Our Black Hole satisfies the transition from dark ale to stout. We think of this as slightly "Porter-ish" with a strong malt body and a very light hop finish. This is brewed year round and is available in Pennsylvania in the regular Variety Pack. This will help the ale drinker among us maintain their own balance!', 'http://www.weyerbacher.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3924, 1352, 5, 67, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Clean, refreshing and perhaps just a bit tart, our brewers developed Weyerbacher Blanche just after their trip to Belgium during the winter of 2000. Blanche, meaning "white", takes its name from the whitish haze in this pale gold brew, which is a result of the raw wheat and wheat malts used to brew this Belgian-style beer. In 2002, Blanche was named as Best of the Mid-Atlantic/Southeast in the Belgian Specialty category at the US Beer Tasting Championships. White beers are well known as the principal product from Hoegaarden, a small town in a wheat-growing region east of Brussels. Light, cloudy and smooth, Weyerbacher Blanche brings you authentic Belgian-style flavor along with microbrewed quality and freshness. Blanche is a thirst quenching beer that combines character and flavor with a moderate alcohol content. Just try a bottle. In the nose you''ll notice spiciness from the coriander seeds and dried curacao orange peels added during the boil. In the mouth you''ll find a mild and refreshing ale with a hint of dryness from the wheat ingredients. A clean finish follows with just a hint of tart spiciness.', 'http://www.weyerbacher.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3925, 1352, 5, 62, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'First released in March 2007, Blasphemy is our award winning QUAD aged in bourbon barrels. But not overaged, so we''ve picked up gentle vanilla oaky notes which complement rather than supercede the complex qualities that already make QUAD such an incredible beer. Expected to be an annual Spring seasonal, supplies are limited. ABV is 11.8%.', 'http://www.weyerbacher.com/', 11.80, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3926, 1352, 3, 35, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'At Weyerbacher, we prefer to brew things true to European style guidelines. Consequently our barley wine is on the malty side, yet not overly sweet. Notes of date or perhaps fig on the palate follow a pleasurably malty aroma to your taste buds. The finish is warm and fruity, and begs for the next sip. Enjoy Blithering Idiot in a brandy snifter or wine glass, preferably in front of the fire, or accompanying a literary classic. This is the finest life has to offer and should be treated as such. Moments of reflection make all the toil worthwhile, and Blithering Idiot is for moments like these. Share it with your family over the holiday dinner. Lay a few down, aging only helps a barley wine develop more class. At 11.1 % ABV (alcohol by volume) this fine ale will keep for years. Our expected maximum shelf-life is 2 to 3 years. Although it might see a decade, beyond the 3rd year most barley-wines have a tendency to decrease in complexity, so don''t wait too long', 'http://www.weyerbacher.com/', 11.10, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3927, 1352, 3, 33, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Decadence is our Tenth Anniversay spiced amber ale. This is a very limited production, brewed only once, to celebrate ten fantastic years in business. This ale weighs in at 13% ABV and is a fantastic sipper, especially after dinner or consider paring it with a good book on a cool fall evening. Decadence is brewed with honey, cardamom spice and gentian (a rare botanical!) This ale is very unique and will develop finer character when aged at cellar temperatures.', 'http://www.weyerbacher.com/', 13.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3928, 1333, 1, 21, '9322 State Route 414', 'Lodi', 'New York', 'United States', 'Pours a very deep black with a pleasant aroma and a thick brown head. It has the usual coffee taste you would expect with a hint of chocolate. There is quite a lot of carbonation but is very drinkable.', '', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.5739, -76.8582', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3929, 1352, 3, 32, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Double Simcoe IPA, 9.0% abv, is our incredible reward for Hopheads seeking over the top flavor in a Double IPA, without the harshness. Brewed with Simcoe hops, developed and trademarked by Select Botanicals Group, LLC, in the year 2000. This hybrid hops was created to allow maximum aromatic oils, along with low cohumulone(harshness) levels, so that brewers can really load up a lot of ''em in a beer and not have any harshness. The piney, citrusy notes are all here, and in a very clean (non-harsh) way, as well as having an aroma with impact. Introduced by Weyerbacher in 2005 originally as a seasonal, this brew has garnered numbers so high on Beer Advocate, and been in such high demand by consumers, we decided to add it to our year-round line-up in March 2007. Check it out, and you''ll soon see why everyone''s talking about it.', 'http://www.weyerbacher.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3930, 1352, 5, 61, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Our Eleventh anniversy ale, released in July 2006 only is a Triple IPA made exclusively with Phoenix hops. 11.7% abv make this Triple IPA powerful, but the Phoenix hops keep it smooth. Phoenix is another one of those hops with low cohumulone levels, which means when used in very large quantities (as we do in Eleven) the hops flavor is very smooth, not a hint of harshness for the enormous amounts of hops in the brew. As with all of our Anniversay ales, this one will age fantastically and will never be made again, as each anniversary is an entirely different brew.', 'http://www.weyerbacher.com/', 11.70, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3931, 1352, 3, 43, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'This incredibly intriguing Imperial Stout is made by aging our Old Heathen in some very famous Oak barrels that were used for aging bourbon! What do we have when we are done? A stout whose very essence has been enhanced. A stout whose complexity has been increased. A stout with notes of Oak, whiskey and vanilla melding together to create a new sensation. Have we gone too far this time? We don''t think so. Heresy is a step above and a leap beyond the extraordinary. Taste it and see what everyone is talking about. 8.0% ABV', 'http://www.weyerbacher.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3932, 1352, 3, 31, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Hops Infusion is loaded with piney, citrusy notes, much hops complexity, and a strong foundation of malt underneath it all.. Glowing a deep amber color, Hops Infusion is brewed with seven types of hops. Simcoe, Magnum, Cascade, Liberty, Saaz, Fuggles and E. Kent Goldings give this beer the complexity that''s so interesting. Our brewers intention on Hops Infusion was to create a complexity of hops flavor and aromas, not found in any other beer. Originally developed for our BrewPub (no longer open), Hops Infusion was ahead of its time in 1998, but eventually became over shadowed by plethora of entries from other brewers in the India Pale Ale category, with everyone pushing the envelope on hops content more and more. So, in late 2005 we redesigned this beer with an entirely new recipe and new packaging as well. The results are unmistakable, Hops Infusion is clearly a leading IPA once again. We brew Hops Infusion (6.2% ABV, 1.068 OG) all year ''round. So if your local beer store doesn''t have it, tell ''em to get moving!', 'http://www.weyerbacher.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3933, 1352, 3, 33, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'House Ale, our 4.5% session ale, was first brewed in 2006. Our goal was to brew a beer that was a little bit lower in alcohol, but did not lack for body and flavor. We''re sure you''ll agree, that''s just what we achieved with this tasty brew. Brewed with Pale, Caramunich, and Carapils malt for flavor and body, then hopped exclusively with expensive Tettnang hops, a very delicate, delicious hops that perfectly fits this beer with just the right snap of flavor. Available only in Pennsylvania, in our Variety Pack Case.', 'http://www.weyerbacher.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3934, 1352, 11, 123, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Yes that''s right! The mother of all Pumpkin Ales is currently in transit to our wholesalers and should be out on shelves around mid-September. This 8.0% ABV pumpkin ale is heartier, spicier, and more "caramelly" and "pumpkiny" than its faint brethren! Perfect finisher on a cool autumn night, or match it up with a slice of pumpkin pie and fresh whipped cream. If you don''t agree this is the mother of all pumpkin ales, then you just don''t like mothers!', 'http://www.weyerbacher.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3935, 1352, 3, 35, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Insanity, just released this past November, 2004, is Weyerbacher''s latest creation in the world of cutting edge beers. Insanity is made by aging our perfectly balanced Blithering Idiot Barleywine in oak bourbon casks. This incredible combination creates a melange of flavors such as malt, dates, oak, vanilla, and bourbon just to name a few. Insanity is 11.1% ABV. It is best enjoyed in a brandy snifter and served at 45-50 degrees F.', 'http://www.weyerbacher.com/', 11.10, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3936, 1352, 5, 74, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Muse, a Farmhouse Ale, is brewed "somewhat" in the tradition of the style, but it has Weyerbacher fingerprints all over it! Made with Pale malt, a little carapils, raw wheat and raw oats, this warm weather seasonal is dry and ever so slightly tart on the pallet from the wheat and oats. At 6.2% abv, its a bit higher than your strictly traditional farmhouse, but not out of the realm, really. The wheat and oats makes the mouthfeel silky and light at the same time. They also bring some cloudiness to the brew, but don''t be afraid! Hopped with Styrian Goldings and finished with Saaz, this beer has a noticable hoppy dryness which makes it a fine thirst quencher, something the original Farmhouse Ales were intended to be, served to workers out in the fields on hot summer days as a restorative. Fermented with Forbidden Fruit yeast, at a very high temperature (78F), the spiciness developed is entirely from this traditional yeast strain, not from any kettle additions. Unfiltered, to enjoy this natural beauty, and imagine yourself out in the flat fields of Belgium! Cheers!', 'http://www.weyerbacher.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3937, 1352, 3, 43, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Rich, velvety and deliciously complex, Old Heathen is a truly distinctive winter warmer. We use seven types of malt and two varieties of hops to bring forth this big brew. Quite robust and roasty on the palate, Old Heathen imperial stout has a wonderfully fruity nose and a moderately dry finish. The taste is highly complex- perhaps you''ll even discern notes of espresso or chocolate. Old Heathen imperial stout is our interpretation of a beer style that originated in the 18th century. Brewed in England and exported to Germany, Scandinavia and Russia, these beers became fashionable among the members of the Czar''s court. In order to survive long voyages they were brewed with high alcohol content to prevent spoilage. And at 8.0% ABV (alcohol by volume) Old Heathen definitely contains a warming belt. You may want to lay down a few bottles for future evaluation- this beer keeps well and will only get better with age. Like most of our beers, Weyerbacher Old Heathen is a perfect accompaniment to foods. Try it with rich stews, oysters, caviar or roasted meats. Old Heathen is also a perfect companion to chocolate desserts. Old Heathen is now available year-round.', 'http://www.weyerbacher.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3938, 1352, 5, 61, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Prophecy is our third ale to be aged in bourbon barrels. We''ve taken our Merry Monks'' Ale and carefully aged it in bourbon barrels. The result is a fabulous unique ale, softened with hints of vanilla and oak, with an intriguing finish to it. Prophecy is a limited release so when it''s here, be sure to grab a case or two to lay away before its gone. 9.3% ABV.', 'http://www.weyerbacher.com/', 9.30, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3939, 1352, 5, 62, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Grand Champion in the 2000, and again in 2004 at United States Beer Tasting Championship, Weyerbacher QUAD is the first quadrupel style beer to be commercially brewed and bottled in the United States. In December 2002 QUAD won Mid-Atlantic Champion at the USBTC for the third year in a row. Massively big and delicious, QUAD is an elegant and dark ale. Rich with complexity and flavor, try savoring it after a long day or during a fine dinner. You also might enjoy it as an aperitif or as an accompaniment to a dessert, but QUAD stands alone quite well. We recommend enjoying QUAD in a brandy snifter or wineglass so you can drink in the aroma of this fine elixir. QUAD, with an alcohol content of 11.8% (by volume) is the strongest beer we make, so please pay proper accord as you enjoy it. As with any higher alcohol beers, QUAD will be at its best after a period of 6 or 12 months in the bottle, perhaps longer. We expect a shelf life of 3-5 years, but go ahead, we know you can''t wait (we couldn''t either). Enjoy one now, and another every month or two, and you''ll be truly amazed as QUAD gains smoothness and complexity over time as it ages.', 'http://www.weyerbacher.com/', 11.80, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3991, 385, 5, 72, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'From the centuries-old tradition of Belgian Abbey monks comes our "Ãœber Abbey" Ale. Aromatic and full bodied, pouring deep burgundy in color, it''s bold, it''s Heavy Seas. Grab a line...Holy Sheet!...or you''ll be swept overboard. Seasonally available in February while supplies last.', 'http://www.ccbeer.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3940, 1352, 3, 43, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Enjoyed alone as a winter-warmer or as the perfect finish to any fine meal, our Raspberry Imperial Stout is a wonderfully full-flavored beer with just a "kiss" of raspberry flavor. When we brew this beer we add just a touch of real raspberries during the fermentation process. The result is a modest fruit flavor which enhances--- without dominating the rich, malty, stout taste. Our Raspberry Imperial Stout (8.0% ABV) is great alone or as an after-dinner accompaniment. It''s especially good with chocolate desserts. We brew it only during the winter months, so check out the Brewing Schedule on the "What''s New" page for the next time it will be coming to a beer store near you.', 'http://www.weyerbacher.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3941, 1352, 3, 35, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Our 12th anniversary brew is a Rye Barleywine. Checking in at 10.2% abv, Twelve is being released in July and through the end of the year. Made from 50% Rye Malt and 50% Barley Malt, this strong ale is extremely viscous. The rye adds a tantalizing note of flavor on the palate with a hint of tartness you''ve come to expect from Rye. Slightly warm when its young, the beer will age very well, perhap 5 years or more. We''re guessing that peak taste will be in the 1 to 2 year old range, with 3 and 4 not far behind. Be sure to lay some down in your collection.', 'http://www.weyerbacher.com/', 10.20, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3942, 157, 7, 84, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'The first thing you notice when pouring a glass of this seasonal beer is the color. Samuel AdamsÂ® Octoberfest has a rich, deep golden amber hue which itself is reflective of the season. Samuel AdamsÂ® Octoberfest is a malt lover''s dream, masterfully blending together five roasts of barley to create a delicious harmony of sweet flavors including caramel and toffee. The beer is kept from being overly sweet by the elegant bitterness imparted by the German Noble hops. Samuel AdamsÂ® Octoberfest provides a wonderful transition from the lighter beers of summer to the winter''s heartier brews.', 'http://www.samueladams.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3943, 157, 1, 15, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'This is a brew for adventurous beer drinkers. It is brewed with four malts: two row pale Harrington, Munich malt, chocolate malt, and a rare peat smoked malt commonly used by distillers of Scotch malt whiskey. This unique malt gives Samuel Adams® Scotch Ale its distinct, subtle smoky character and deep amber hue. Samuel Adams® Scotch Ale is brewed using traditional English hops, Goldings and Fuggles. This is a big brew dominated by malt flavors and aromas, rich and full bodied, slightly sweet. Its layered malt complexity lingers to a smooth and silky finish.', 'http://www.samueladams.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3944, 540, -1, -1, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'Proving the French may actually know something we don''t... Garde Dog is a traditional French Biere de Garde or "beer for keeping". This classic farmhouse ale was brewed in March for drinking during the spring and summer months. With it''s toasted aroma and spicy, malty sweetness Garde Dog will liberate you from the winter doldrum.', 'http://www.flyingdogales.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3945, 399, 3, 33, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'Brewed only in spring. Has a crisp taste, thanks to the kieffer lime leaves and lime added in. Has a light amber color and absolutely delicious!', 'http://www.coors.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3946, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.anheuser-busch.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3947, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.anheuser-busch.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3948, 49, 8, 95, 'St. James''s Gate', 'Dublin', '', 'Ireland', 'The best selling premium irish import lager in the world today. This rich, golden pilsner style lager, with a smooth, refreshing hoppy taste, is brewed the irish way, using only the finest barley and pure spring water from the Cooley Mountains of Dundalk, Ireland.', 'http://www.guinness.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '53.3433, -6.2846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3949, 812, 3, 31, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', '', 'http://www.magichat.net/', 6.80, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3950, 459, 3, 32, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Too extreme to be called beer? Brewed to a colossal 45-degree plato, boiled for a full 2 hours while being continuously hopped with high-alpha American hops, then dry-hopped daily in the fermenter for a month & aged for nother month on whole-leaf hops!!! Our 120 Minute I.P.A. is by far the biggest I.P.A. ever brewed! At 20% abv and 120 ibus you can see why we call this beer THE HOLY GRAIL for hopheads! -changed to be 18% for aging purposes according to Dogfish Head brewery.', 'http://www.dogfish.com', 18.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3951, 459, 3, 32, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Esquire Magazine calls our 90 Minute .IPA., "perhaps the best I.P.A. in America." An Imperial I.P.A. brewed to be savored from a snifter. A big beer with a great malt backbone that stands up to the extreme hopping rate. This beer is an excellent candidate for use with Randall The Enamel Animal!', 'http://www.dogfish.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3952, 459, 3, 31, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Our flagship beer. A session India Pale Ale brewed with Warrior, Amarillo & ''Mystery Hop X.'' A powerful East Coast I.P.A. with a lot of citrusy hop character. THE session beer for beer geeks like us!', 'http://www.dogfish.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3953, 541, 2, 25, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'This robust dark brew has been created using rich Colombian dark roast coffee to celebrate our 10th anniversary in royal fashion. The enticing regal aromas of toffee and licorice lead to the coronation of taste; a palate of malty richness exhibiting chocolate and coffee notes, balanced by the noble and novel Mt. Rainer hop, all topped with a rich creamy crown. This very special offering will warm your soul and lift your spirits. Oh yeah, it also packs a royal kick at 8% alcohol.', 'http://www.flyingfish.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3954, 305, -1, -1, 'Beukenhofstraat 96', 'Vichte', 'West-Vlaanderen', 'Belgium', 'DUCHESSE DE BOURGOGNE from Brouwerij Verhaeghe is the traditional Flemish red ale. This refreshing ale is matured in oak casks; smooth with a rich texture and interplay of passion fruit, and chocolate, and a long, dry and acidic finish. After the first and secondary fermentation, the beer goes for maturation into the oak barrels for 18 months. The final product is a blend of younger 8 months old beer with 18 months old beer. The average age of the Duchesse de Bourgogne before being bottled is 12 months.', '', 6.20, 0.00, 0.00, 0, '9999-01-01', '50.8322, 3.3884', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3955, 541, 5, 72, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'A tribute to the highly drinkable "every day" beers from French-speaking Belgium. Contains Belgian two-row pale malt and 7% wheat. This beer is lightly filtered with an earthy, spicy hop character from imported Styrian Goldings hops and a beautiful rich creamy head from the wheat.', 'http://www.flyingfish.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3957, 541, 5, 60, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'This Belgian-style Abbey Dubbel is an exceptionally complex beer with many interwoven flavors. This classic-style Abbey beer features an immense head with a fruity nose and a generous body. Malty in the middle, the beer features a clean, almondy dry finish and a slight alcohol warmth. More like a wine than a beerâ€”it has a lot of the qualities of a fine Burgundy. Beer writer Michael Jackson has praised the Flying Fish Dubbel as "a wonderful example of the style.";"0', 'http://www.flyingfish.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3958, 541, 1, 4, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'This ESB is a classic British extra special bitter made fresh with an American slant. A beautiful copper color with an amber head, this classic style features five different malts, including imported English malts, and three hop varieties. The rich malty start features caramel notes that develop into a smooth, pleasurable hop finish.', 'http://www.flyingfish.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3959, 541, 3, 26, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'An original American pale ale, our XPA highlights the subtle, sophisticated flavors and aromas of our Midwestern two-row malt and imported aromatic and Munich malts. Washington-grown Mt. Hood and Magnum hops create an extremely balanced beer with a beautiful straw color.', 'http://www.flyingfish.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3960, 541, 7, 84, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'First released in 2002, and sold out in two weeks. A tribute to the classic Fest styles of Germany the O''Fish uses European malts hops and yeast. A beautiful reddish color, a savory malt profile and nice hop flavor, make this Fest beer quite drinkable. OktoberFish is great with food and especially great with Lederhosen.', 'http://www.flyingfish.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3961, 541, 5, 72, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'This Belgian-style strong golden ale showcases a variety of the ingredients and brewing methods that help differentiate Flying Fish beers. The Grand Cru is fermented at a higher temperature than our other beers adding an undercurrent of fruitiness (although there is no fruit in the beer). Very lightly filtered, the Grand Cru exhibits complex mouthfeel, strong malt flavors, a spicy hop presence and a soothing alcohol warmth, followed by a clean, dry finish. It is excellent with food as well as served by itself.', 'http://www.flyingfish.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3962, 1352, 1, 15, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Exceptionally smooth and thoroughly robust, Weyerbacher Scotch Ale has a deep delicious flavor that will warm you down to your wee little bones. Malty and roasty on the palate, and with distinctive caramel notes, this beer will satisfy the desires of any malty beer aficionado. Weyerbacher Scotch Ale is our interpretation of a beer style originating from Scotland, where the chilly damp weather calls for a hearty beer. Lacking the preservative powers of hops, scotch ales were brewed with high alcohol content to prevent spoilage. And at 8.7% ABV (alcohol by volume) Weyerbacher Scotch Ale definitely contains a warming belt. We brew Weyerbacher Scotch Ale mostly in the cooler months of the year. Check out the Upcoming Events and Beers page for the next time it will be at a beer store near you.', 'http://www.weyerbacher.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3963, 459, -1, -1, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A refreshing neo-BerlinerWeisse fermented with honest-to-goodness peaches to (get this!) 4.5% abv! Because extreme beers don''t have to be extremely boozy! Available in 4-pack and draft during the sweaty months.', 'http://www.dogfish.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3964, 1099, 3, 38, 'High Street', 'Tadcaster', 'North Yorkshire', 'United Kingdom', 'Often called â€œmildâ€ if it is on draft, brown ale is a walnut-colored specialty of the North of England. A festive-occasion beer, brown ale is one of the oldest English brewing styles, mentioned in literature in the 16th century. Beers brewed at the old brewery have a round, nutty flavor because of the Yorkshire square system of fermentation.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '53.8834, -1.2625', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3965, 981, 3, 26, '2423 Amber St', 'Philadelphia', 'Pennsylvania', 'United States', 'This is a real drinkin'' beer! - a golden session ale that boasts both a European birthright and a thirst-quenching Philadelphia sensibility. Ke n zinger is refreshingly crisp and smooth, with a spirited flavor that grabs the attention of taste buds everywhere. Get some!', 'http://philadelphiabrewing.com/index.htm', 4.50, 0.00, 0.00, 0, '9999-01-01', '39.9827, -75.1275', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3966, 981, 3, 31, '2423 Amber St', 'Philadelphia', 'Pennsylvania', 'United States', 'Hop shortage be damned! We love IPA''s, Philadelphia loves IPA''s, we''re going to brew an IPA. Rekindle your passion for your favorite Phi ladelphia brewery by enjoying our substantial, aromatic India Pale Ale. Newbold is aggressively hopped, with a crimson hue and depth of flavor that will satisfy the most demanding devotee of this revived style. Newbold I.P.A. tells it like it is.', 'http://philadelphiabrewing.com/index.htm', 6.50, 0.00, 0.00, 0, '9999-01-01', '39.9827, -75.1275', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3967, 981, 5, 74, '2423 Amber St', 'Philadelphia', 'Pennsylvania', 'United States', 'From our city of neighborhoods we offer you this "BiÃ©re de Mars," or ruby farmhouse ale. In true Philadelphia fashion, we meld American and European ingredients into a complex ale with flavors of toasted malt and rye. Rowhouse Red is the perfect accompaniment for some quality time in the backyard garden (or on the front stoop) of your urban farmhouse.', 'http://philadelphiabrewing.com/index.htm', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.9827, -75.1275', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3968, 981, 5, 67, '2423 Amber St', 'Philadelphia', 'Pennsylvania', 'United States', 'The American poet WaltWhitman once portrayed a sunset over Philadelphia as, "...a broad tumble of clouds, with much golden haze and profusion of beaming shaft and dazzle." Pour yourself a bottle of Walt Wit Belgian White-Style Ale and see what he was talking about. A pinch of spice and a whisper of citrus lend complexity to this fragrant, satisfying ale.', 'http://philadelphiabrewing.com/index.htm', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.9827, -75.1275', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3969, 157, 3, 26, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams® Pale Ale is a delicious, lighter bodied beer with a delightfully fresh taste. Its unique blend of two row malts add a rich harmony of sweet flavors that are complimented by the traditional earthy hop character imparted by authentic British hops. The fermentation character of the ale yeast adds a rich bouquet of fruit and ester notes that add another layer of complexity to this popular style', 'http://www.samueladams.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3970, 894, 5, 67, '210 Swanson Avenue', 'Lake Havasu City', 'Arizona', 'United States', 'A Belgium Wheat Ale, Spiced With Orange Reel & Coriander, Strong & Smooth', 'http://www.mudsharkbrewingco.com/', 7.90, 0.00, 0.00, 0, '9999-01-01', '34.4686, -114.341', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3995, 385, 7, 77, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'We call this beer an Ãœber Pils - a pilsner style bock lager. Rich, malty, and well rounded but with a firm structure of noble hops. Surprisingly pale in color for such a powerful, complex beer. Available year round beginning Feb. 05''. Silver Medal- World Beer Championship 2007', 'http://www.ccbeer.com/', 7.25, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3971, 1326, 3, 42, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'Truly a worldly beer. Baltic Thunder represents the Baltic Porter style admirably. Exhibiting the enticing, toffee roast of the British porter that originated the style in the 18th century, and the soothing, subtle fruit nuance of contemporary brews that flourish from Helsinki to Vilnius today, this dark lager honors the Baltic god of thunder. Created by an inspired collaboration of brewers and tempered with a touch of turmoil, Baltic Thunder rolls on to bring you enchanting light as the darkness fades.', 'http://www.victorybeer.com', 8.50, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3972, 894, 8, 96, '210 Swanson Avenue', 'Lake Havasu City', 'Arizona', 'United States', 'A Light American Lager, Our Lightest, Lowest Carb. Beer', 'http://www.mudsharkbrewingco.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '34.4686, -114.341', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3973, 894, -1, -1, '210 Swanson Avenue', 'Lake Havasu City', 'Arizona', 'United States', 'Watch Your Pint Cascade From Brown to Black, As This Chocolaty Settles, Creamy, Dark, Not Too Bitter Finish', 'http://www.mudsharkbrewingco.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '34.4686, -114.341', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3974, 894, 3, 33, '210 Swanson Avenue', 'Lake Havasu City', 'Arizona', 'United States', 'A Full Body Ale Balanced With Assertive Oregon Hops, Deep Amber In Color', 'http://www.mudsharkbrewingco.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '34.4686, -114.341', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3975, 894, 4, 50, '210 Swanson Avenue', 'Lake Havasu City', 'Arizona', 'United States', '70% Wheat Malt Makes This A Light & Refreshing Ale For A Hot Day!', 'http://www.mudsharkbrewingco.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '34.4686, -114.341', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3976, 44, 5, 70, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Wild Blue is brewed with a blend of German hops from the Hallertau region in Bavaria and classic Aroma hops from the Willamette Valley in the Pacific Northwest. A combination of two- and six-row barley malt was also chosen specifically for this recipe. Beer lovers will also appreciate this specialty fruit-infused lager''s striking burgundy color, ripe blueberry aroma and its ability to stand up to the strongest of foods.', 'http://www.anheuser-busch.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3977, 44, 5, 67, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Shock Top is an unfiltered Belgian-style wheat ale (also known as a â€œWhiteâ€ or â€œWitâ€ beer due to its appearance) that is naturally cloudy with a billowy white foam head, light golden hue and slight taste of orange citrus peel and coriander.', 'http://www.anheuser-busch.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3978, 2, 3, 37, '563 Second Street', 'San Francisco', 'California', 'United States', 'Light golden color. Sweet dry aroma with crisp, clear bitterness. Brewed with imported German hops.The perfect beer to have when you''d like to have more than one.', 'http://www.21st-amendment.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3979, 2, 1, 4, '563 Second Street', 'San Francisco', 'California', 'United States', 'An American session beer. Loaded with hop character and a malty presence, but lower in alcohol.', 'http://www.21st-amendment.com/', 3.60, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3980, 2, 5, 70, '563 Second Street', 'San Francisco', 'California', 'United States', 'The definition of summer in a pint glass. This unique, American-style wheat beer, is brewed with 400 lbs. of fresh pressed watermelon in each batch. Light turbid, straw color, with the taste and essence of fresh watermelon. Finishes dry and clean. Now Available in Cans!', 'http://www.21st-amendment.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3981, 2, 3, 26, '563 Second Street', 'San Francisco', 'California', 'United States', 'Rich golden hue color. Floral hop with sweet malt aroma. Medium mouth feel with malt sweetness, hop quenching flavor and well-balanced bitterness.', 'http://www.21st-amendment.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3982, 2, 1, 4, '563 Second Street', 'San Francisco', 'California', 'United States', 'Traditional English E.S.B. made with English malt and hops. Fruity aroma with an imparted tart flavor brought about by replicating the water profile in England at Burton on Trent.', 'http://www.21st-amendment.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3983, 2, 3, 33, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep amber color. Subtle hop floral nose intertwined with sweet crystal malt aromas. Rich malt flavors supporting a slight bitterness finish.', 'http://www.21st-amendment.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3984, 2, 2, 25, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep toffee color with rich roasty and subtle hop aroma. Chocolate flavors dominate the palate and interact with back-end sweetness.', 'http://www.21st-amendment.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3985, 2, 3, 31, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep golden color. Citrus and piney hop aromas. Assertive malt backbone supporting the overwhelming bitterness. Dry hopped in the fermenter with four types of hops giving an explosive hop aroma. Many refer to this IPA as Nectar of the Gods. Judge for yourself. Now Available in Cans!', 'http://www.21st-amendment.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3986, 2, 3, 42, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep black color. Chocolate milk color head, providing an array of Belgian lace. Toffee and light roasty aromas and flavors. A malty sweet taste is evident but, this rich oatmeal based stout finishes dry. Made with 20 lbs. of oysters, in the boil, from our good friends at Hog Island Oyster Company.', 'http://www.21st-amendment.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3987, 2, 3, 42, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep black color, toasted black burnt coffee flavors and aroma. Dispensed with Nitrogen through a slow-flow faucet giving it the characteristic cascading effect, resulting in a rich dense creamy head.', 'http://www.21st-amendment.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3988, 2, 3, 32, '563 Second Street', 'San Francisco', 'California', 'United States', 'Deep, golden, rich malt flavor huge citrus, fruity grassy, ethanol sweetness aroma with a profound bitterness, yet balanced malt back bone with grapefruit, mellow citric overtones. Dry hopped three times in the fermenter. Brewed with over 65 lbs of hops for 300 gallons of beer. The beer to bring world peace and end the war. Bronze Medal - 2006 Imperial IPA Festival at the Bistro in Hayward, California.', 'http://www.21st-amendment.com/', 9.80, 0.00, 0.00, 0, '9999-01-01', '37.7825, -122.393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3989, 385, 3, 35, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Created to celebrate Clipper Cityâ€™s 10th Anniversary â€“ extremely limited and â€œvintageâ€ dated â€“ this extravagantly malty barley wine will show well upon release but continue to evolve for years. Seasonally available in December while supplies last. Voted #1 beer by Mahaffeyâ€™s Pub.', 'http://www.ccbeer.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3990, 385, 4, 55, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Hang Ten is the Heavy Seas wheat beer youâ€™ve been waiting for. A classic German-style weizen bock, slightly cloudy and bursting with flavor. Hang on and surf the Heavy Seas wave! Seasonally available in July while supplies last.', 'http://www.ccbeer.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3996, 385, 1, 5, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Our "winter warmer" ale, brewed with copious helpings of English malts and US and English hops, a ruddy hued "Imperial ESB" in style. Full malty flavors dancing with powerful hop aromas and a lingering, firm hop bitterness. Seasonally available from mid October to February. Gold Medal, International Pale Ale Category- World Beer Cup', 'http://www.ccbeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3997, 4, 3, 29, 'Ole Steensgt. 10 Postboks 1530', 'Drammen', '', 'Norway', 'The Norwegian JuleÃ¸l can be traced back more that 1000 years. The "Gulatinglov", one of the first Norwegian laws written in the 9th century, has a chapter on brewing beer for the midwinter celebration in January. The festivities were held to celebrate the Norse Gods; Odin, FrÃ¸y and Njord as well as the "return" of the sun. Furthermore, the tradition was adopted by the Vikings that brought Christianity to the country between 1000 and 1100. They moved the tradition to December in connection with the birth of Jesus. In those days a farmer that did not set aside the best crop to produce the beer could lose his house to the king and the church. The law has been changed, but we promise you that we still use the very best of malt, yeast, hops, and pure Norwegian water to produce our Christmas beer. Aass JuleÃ¸l has won most of the Norwegian JuleÃ¸l taste test conducted over time. For those of you that know what "lutefisk" is, Aass JuleÃ¸l is the perfect choice of beverage to this traditional Norwegian dish.', 'http://www.aass.no', 5.90, 0.00, 0.00, 0, '9999-01-01', '59.7451, 10.2135', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3998, 4, 7, 90, 'Ole Steensgt. 10 Postboks 1530', 'Drammen', '', 'Norway', 'The Aass Bock is a dark "lager" also produced in accordance with the "Purity law". The malted barely is produced in the Scandinavian countries. It is a combination of bayer-, color- and caramel malt. We use the very best of hops from the Hallertau area in Germany, and the water is pure Norwegian mountain water. The Aass Bock is largered at cool temperatures, and it is allowed to mature for as long as 6 months before bottling. The beer is sold in a caracteristic nice-looking green bottle containing 11.2 fl. oz or 330 ml.', 'http://www.aass.no', 5.90, 0.00, 0.00, 0, '9999-01-01', '59.7451, 10.2135', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (3999, 4, 7, 77, 'Ole Steensgt. 10 Postboks 1530', 'Drammen', '', 'Norway', 'The Aass Genuine Pilsner is a premium "lager" produced in accordance with the "Purity law". The malted barely is a pilsnermalt produced in the Sandinavian countries. We use the very best of hops known under the name as Sazer and Hallertau, and the liquid is pure Norwegian mountain water. The pilsner is largered at cool temperatures, and it is allowed to mature for as long at 3 months before bottling. The beer is sold in a caracteristic nice- looking green bottel containing 11.2 fl. oz or 330 ml.', 'http://www.aass.no', 5.50, 0.00, 0.00, 0, '9999-01-01', '59.7451, 10.2135', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4000, 4, 8, 95, 'Ole Steensgt. 10 Postboks 1530', 'Drammen', '', 'Norway', '"Aass Classic" is a classical "lager" The beer is slightly darker in color than our Genuine Pilsner. It is of course produced in accordance with the "Purity law". The malted barely is produced in the Scadinavian countries. It is a combination of pilsner-, bayer- and caramelmalt. We use the famous Sazer and Hallertau hops, and the water is as pure as the Norwegian nature. The Classic is largered at cool temperatures, and it is allowed to mature for approximately 3 months before bottling. The beer is sold in caracteristic nice looking green bottel containing 11.2 fl. oz or 330 ml.', 'http://www.aass.no', 5.50, 0.00, 0.00, 0, '9999-01-01', '59.7451, 10.2135', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4001, 540, 2, 25, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'Gonzo Imperial Porter is deep and complex. This turbo charged version of the Road Dog Porter is mysteriously dark with a rich malty body, intense roasted flavors, and a surprisingly unique hop kick. With Gonzo weighing in at 7.8% ABV, it will bite you in the ass if you don''t show it the proper respect.', 'http://www.flyingdogales.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4002, 540, 3, 33, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'This dog enjoys his days in the sun... Old Scratch Amber Lager is a malty, mellow beer that is fermented at medium temperatures to develop both ale and lager characteristics. "Gold Scratch" raises the standard in the amber lager category.', 'http://www.flyingdogales.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4003, 11, 1, 5, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', 'Rich fruitcake aromas â€“ almonds, zest and conserved fruit. A wonderful balance of malt and hop flavours. A beer to savour and rich in flavour.', 'http://www.adnams.co.uk', 6.30, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4004, 11, 1, 3, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', 'A golden bitter suffused with the aromas of a grapefruit grove. The massive citrus attack will burst on your palate allowing all the flavours of the imported New World hops to deliver their fruity bitterness.', 'http://www.adnams.co.uk', 5.50, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4005, 11, 1, 5, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', 'Adnams Suffolk Special Bitter, at 4.5% alcohol by volume, is a dry, crisp, refreshing, and distinctly hoppy example of its style. This beer is also available in some markets in tradtional cask form, as Adnams Bitter. At only 3.7% alcohol, Adnams Bitter is the classic English ''ordinary,'' though we think you''ll agree that there''s full of flavor. Despite its rich heritage and enduring fame, Adnams is not a company willing to rest on its laurels. Its continued commitment to quality and innovative packaging designs has made it Britainâ€™s fastest growing brewery over the last two years. To top it off, Adnamsâ€™ head brewer was recently chosen as Britainâ€™s Brewer of the Year by a panel of his peers.', 'http://www.adnams.co.uk', 4.50, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4006, 11, 3, 38, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', '', 'http://www.adnams.co.uk', 3.20, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4007, 11, 3, 33, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', 'The Winter seasonal from Adnams, Fisherman is described as an old ale. If your local pub has the good sense to serve cask beer, look for Fisherman on draught from January through March. Clean and refreshing yet dark and mysterious, Fisherman is a deep coppery red, conjuring roasted nuts and dark chocolate, with a lingering taste of liquorice and dried fruits.', 'http://www.adnams.co.uk', 4.50, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4008, 11, 3, 35, 'IP18 6JW', 'Southwold', 'Suffolk', 'United Kingdom', 'The original winter warmer, Tally-Ho is actually a barley wine brewed to a nineteenth century recipe. It''s sweet; it''s heart-warming; it''s rich - but watch out, it''s got a kick like a drayman''s horse!', 'http://www.adnams.co.uk', 7.50, 0.00, 0.00, 0, '9999-01-01', '52.3277, 1.6802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4009, 3, 5, 70, 'Hoogstraat 2A', 'Beersel', 'Vlaams Brabant', 'Belgium', '', 'http://www.3fonteinen.be/index.htm', 6.00, 0.00, 0.00, 0, '9999-01-01', '50.7668, 4.3081', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4010, 265, 8, 95, 'Vaartstraat 94', 'Leuven', 'Vlaams Brabant', 'Belgium', 'Stella Artois was first brewed as a Christmas beer in leuven. It was named Stella from the star of Christmas, and Artois after Sebastian Artois, founder of the brewery. It''s brewed to perfection using the original Stella Artois yeast and the celebrated Saaz hops. It''s the optimum premium lager, with it''s full flavour and clean crisp taste.', '', 5.20, 0.00, 0.00, 0, '9999-01-01', '50.8853, 4.7008', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4011, 774, 8, 96, '', 'Latrobe', 'Pennsylvania', 'United States', '', '', 4.60, 0.00, 0.00, 0, '9999-01-01', '40.3212, -79.3795', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4012, 459, -1, -1, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'This recipe is the actual oldest-known fermented beverage in the world! Our recipe showcases the known ingredients of barley, white Muscat grapes, honey & saffron found in the drinking vessels in King Midas'' tomb! Somewhere between a beer, wine and mead, this smooth, dry ale will please with Chardonnay or I.P.A. drinker alike.', 'http://www.dogfish.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4013, 459, 3, 38, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A cross between a Scotch Ale, an I.P.A., and an American Brown, this beer is well-hopped and malty at the same time. It is brewed with Aromatic barley and caramelized brown sugar.', 'http://www.dogfish.com', 7.20, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4014, 459, 3, 26, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'This is our original brew and our most approachable beer. It''s brewed with a premium barley and whole-leaf Glacial & Warrior hops. Our Shelter Pale Ale has a fine malt backbone and a slightly nutty flavor. A versatile, quaffable beer. The Shelter Pale Ale is available exclusively in the Mid-Atlantic region.', 'http://www.dogfish.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4015, 459, 3, 42, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A dark beer made with a touch of roasted chicory, organic Mexican coffee, St. John''s Wort, and licorice root. Brewed with whole-leaf Cascade and Fuggles hops, the grains include pale, roasted & oatmeal.', 'http://www.dogfish.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4016, 850, 3, 31, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Our IPA is an unfiltered cross between an English and American IPA, with a strong, dry bitterness balanced with a slight malty sweetness. A mixture of first-rate U.S. and Belgian malts, combined with English roasted barley and highly hopped with Cascade and Warrior hops make our IPA a brewery favorite.', 'http://www.mercurybrewing.com', 6.30, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4017, 850, 3, 26, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Named one of the World''s Ten Best Beers by Wine Spectator Magazine, Ipswich Ale has satisfied discerning craft beer drinkers since 1991. A North Shore classic, Ipswich Ale is a medium-bodied, unfiltered English style pale ale with subtle hoppiness and a smooth malty flavor.', 'http://www.mercurybrewing.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4018, 850, 1, 21, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Deep, rich, and malty with hints of chocolate and coffee. It''s what espresso would be if it had the gumption to be beer. We use three different hop additions, specially selected crystal malts, roasted barley, and oatmeal to give it a soft and silky mouth feel. Makes a great dessert. Or meal.', 'http://www.mercurybrewing.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4019, 850, 3, 38, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Rich in color and bold in taste, our U.S. style Brown Ale combines roasted malt with two additions of specialty selected hops to produce a well-balanced ale with a satisfying finish.', 'http://www.mercurybrewing.com', 6.30, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4020, 850, 3, 38, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'A smooth, hoppy brown ale, full-bodied with caramel and chocolate malt flavors.', 'http://www.mercurybrewing.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4021, 850, 2, 25, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Named due to it''s popularity with London railroad porters, it''s known for its dark, rich, and roasty notes.', 'http://www.mercurybrewing.com', 5.90, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4022, 850, 3, 37, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'A light-bodied, unfiltered Blonde ale that retains the bold flavors typical of an Ipswich Ale, our Summer Ale is light enough for a hot summer day and can satisfy even the most scorching thirst.', 'http://www.mercurybrewing.com', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4023, 850, 3, 33, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'Highly regarded among hop-lovers, our Harvest Ale is a balanced and flavorful autumnal offering, to be enjoyed during the cool, crisp days of fall. We use a darker Caramunich malt and just a touch of chocolate malt along with a blend of Warrior, Ahtanum, and Columbus hops.', 'http://www.mercurybrewing.com', 6.90, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4024, 850, 1, 13, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', 'A British style Old Ale perfect for easing the cold winter months, our Winter Ale offers a malt selection with hints of fig and chocolate, creating the perfect cozy balance of hops and malt.', 'http://www.mercurybrewing.com', 6.20, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4025, 850, 3, 35, '23 Hayward St.', 'Ipswich', 'Massachusetts', 'United States', '', 'http://www.mercurybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.6728, -70.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4026, 1316, 3, 37, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Gold Coast Blonde is light in malt and hops and of course, golden in color. A great choice if youâ€™re looking for true American beer flavor with a bit more malt than a light beer has to offer.', 'http://www.upstreambrewing.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4027, 1316, 1, 5, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'A Silver Medal winner at the 2005 Great American Beer Festival in the Bitter category, our Extra Special Bitter (ESB) is a medium-bodied ale highly hopped and loaded with flavor.', 'http://www.upstreambrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4028, 1316, 5, 70, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'This easy drinking beer is made with pale and Munich malts, wheat, honey and fresh raspberry puree. Honey Raspberry Ale is refreshing and mildly sweet.', 'http://www.upstreambrewing.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4029, 1316, 11, 116, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'A Silver Medal Winner in the American Hefenweizen category at the 2004 Great American Beer Festival, our American Wheat has a crisp and refreshing flavor.', 'http://www.upstreambrewing.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4030, 1316, 1, 15, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Our Dundee Scotch Ale begins with a traditional sweetness and finishes with a full, malty flavor. Donâ€™t be fooled by the dark colorâ€”this beer is delicious and surprisingly easy to drink.', 'http://www.upstreambrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4031, 1316, 8, 96, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Our lightest beer has all of the great attributes of a light American lager with the unmatched freshness and taste only a local brew pub like Upstream can offer. If you like great tasting beer, O! Gold is the beer for you.', 'http://www.upstreambrewing.com/', 3.80, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4032, 1316, 3, 26, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Our English-style pale ale is a medium-bodied amber beer. Light, malty flavors combine with aromatic hops for a beer that is thirst quenching and easy to drink. One of our most popular beers.', 'http://www.upstreambrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4033, 1316, 3, 31, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Our India Pale Ale is a full-bodied, golden-colored ale that is exceptionally refreshing. The â€œDoubleâ€ refers to the beerâ€™s huge hop character and malt base that give this beer its great complexity.', 'http://www.upstreambrewing.com/', 6.30, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4034, 1316, 3, 42, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', 'Bold with a soft finish, our darkest beer has plenty of malt flavor with undertones of coffee and chocolate. The addition of oatmeal to the brew adds extra smoothness and a thick creamy head.', 'http://www.upstreambrewing.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4035, 1316, -1, -1, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', '', 'http://www.upstreambrewing.com/', 9.20, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4036, 1316, 3, 26, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', '', 'http://www.upstreambrewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4037, 1316, -1, -1, '514 South Eleventh Street', 'Omaha', 'Nebraska', 'United States', '', 'http://www.upstreambrewing.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '41.2553, -95.9306', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4038, 1173, 3, 26, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'After sampling a wide array of great beers, the duo hit upon an idea. "I''ve got it!" exclaimed Matt, "we''ll use vast amounts of whole hops, the finest malt, and put a little love in each batch." "Eureka!" shouted Phin. And thus became a beer so fresh and tasty they had to put their names on it.', 'http://www.southerntierbrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4039, 1173, 3, 31, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'IPA stands for India Pale Ale and ours is an American version of the classic style. IPA''s namesake lies in its colonial roots. British soldiers on their way to India drank a lot of beer, but found it would go stale on the long voyages. Meanwhile, brewers knew that by adding more hops the beer would stay fresh. Voila! A new style was born and it is one we are proud to brew. Southern Tier IPA is triple-hopped on its journey to your glass for a fully aromatic experience.', 'http://www.southerntierbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4040, 540, 3, 32, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'Back by popular demand, our original "Wild Dog Release" is back, and this time it''s for good. Double Dog Double Pale Ale is a generously hopped ale with a deep red color and pours with a nice frothy head. The abundance of hops will conjure some provocative aromas with hints of raisins and citrus.', 'http://www.flyingdogales.com/', 11.50, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4041, 1086, 3, 31, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Blind Pig IPA was originally brewed by Vinnie at Blind Pig Brewing Co. in Temecula CA. Inspired by the original Blind Pig IPA, this beer is loaded with hop character but only has 6.0% ABV.', 'http://www.russianriverbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4042, 1307, 3, 26, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', '', 'http://www.unibroue.com', 11.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4043, 1307, 5, 61, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Don de Dieu displays an appealing orange-golden hue with a stable, creamy head of foam. Its fruity, malty and yeasty flavor is quickly succeeded by a palate-warming finish of roasted nuts and spices. This smooth, exceptionally strong triple wheat ale offers a complex flavor that is slightly fruity, malty, nutty and yeasty, with a hint of unfiltered sake.', 'http://www.unibroue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4044, 1307, 5, 66, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Maudite has a deep amber-red color with a rocky foam head and an appealing aroma of wild spices and floral hop notes. It is spicy, vinous, and deliciously complex with a crisp hop finish. The robust maltiness and spiciness of our amber-red ale is counterbalanced by an assertive hop finish, offering a distinctive flavor that is cognac-like in complexity.', 'http://www.unibroue.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4045, 1307, 3, 29, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'Trois Pistoles has a dark brown color topped with a rich foam mousse. Its slightly sweet taste is enhanced by accents of roasted malt, cocoa, ripe fruit and dark spices with a smooth finish like an old port. Brewed with four selected malts and four exotic spices, Trois Pistoles beckons with a subtle sweetness that makes it surprisingly smooth and satisfying for a beer of such strength and complexity.', 'http://www.unibroue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4046, 771, 2, 22, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Our version of the traditional Irish Amber Ale. This beer combines the richness of German and Austrian malts with the delicate and spicy British hops for a taste worthy of the Red Rose City.', 'http://www.lancasterbrewing.com/index.html', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4048, 157, 5, 67, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Spicy yet smooth. Brewed with 10 exotic spices. This beer''s roots are in Belgium, and the classic Wit biers produced by Belgium''s brewers. The style gets its name from the white, milky appearance of this unfiltered wheat ale. The brewers of Samuel AdamsÂ® beer, taking inspiration from the Belgians, have created a classic of their own. On the malt side, we use malted two row Pale barley, malted wheat, and Munich malt to give this beer a crisp, malty, cereal finish and smooth mouth feel. The hops used are Noble Tettnang Tettnanger hops. At the end of the kettle boil, we add a proprietary spice blend to give Samuel AdamsÂ® White Ale a unique and complex flavor, without being overpowering or cloying. The spice blend includes orange and lemon peel, dried plum, grains of paradise, coriander, anise, hibiscus, rose hips, tamarind, and vanilla. It is this special blend of spices that gives Samuel AdamsÂ® White Ale its unique character, complexity and refreshing drinkability. The beer is coarse filtered, leaving a white haze from the malt proteins. Our proprietary top fermenting ale yeast ferments the beer, imparting its signature character - bright and slightly fruity.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4049, 157, 8, 96, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Great tasting yet drinkable, with a clean smooth finish. Sam Adams Light® is not just a lighter version of our Samuel Adams Boston Lager® but rather the culmination of over two years of tireless research and brewing trials to create a flavorful Light beer. And it has proved to be worth the wait. Brewed using only the finest two row malt and German Noble hops it has a smooth, complex roasted malt character that is superbly balanced with the subtle orange fruit notes of the Noble hops. Sam Adams Light® finishes crisp and smooth without any lingering bitterness, leaving you yearning for more.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4064, 551, 4, 57, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'This beer was brewed in honor of our brewer Melissa''s wedding to fellow brewer Derek Osbourne of B.J.''s in Chandler. The Alt Ball and Chain is a German Altbier. These beers are generally full-bodied with sweet malt flavor. The crispness, dry finish, and moderate hop aroma make an alt a great beer for summertime enjoyment. Our Alt has been lagering in our cellar for two weeks and contains 5.2% abv.', 'http://www.fourpeaks.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4050, 157, -1, -1, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Spicy and Bold, a big Christmas cookie of a beer. Samuel Adams® Old Fezziwig® Ale is the Christmas cookie of beer. Bursting with spices of the season and a remarkably full body, it helps those long winter nights pass much quicker. The full body hits the palate first with a depth of malt character ranging from sweeter toffee and caramel notes to the more dark, roasty chocolate notes. Then come the spices in full force. Cinnamon, ginger and orange peel dance on the tongue bringing with them the celebratory spirit that goes hand in hand with the season.', 'http://www.samueladams.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4051, 157, 2, 25, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'A Traditional, British style. Robust and full bodied. Introduced as a member of the Winter Classics Mix Pack in 2004, Samuel Adams® Holiday Porter with its rich malt complexity has become a favorite among our winter seasonal brews. In total, five varieties of malted barley are used in the brewing process including a variety of German malt called Carafa®. The Carafa® gives our Holiday Porter its smooth, roasted malt character. Add generous portions of imported hops to the mix and one has a brew that is both robust and high in drinkability.', 'http://www.samueladams.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4052, 157, 1, 10, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Ale brewed with Cherries, crisp and fruity with a hint of honey. Samuel Adams Cherry Wheat® follows the centuries old American tradition of brewing beer with native ingredients, in this case Michigan cherries as well as a touch of honey. The sweet fruitiness of the cherries is balanced against the crisp, cereal note from the malted wheat and the subtle citrus flavor from the Noble hops. The end result is a sweet, refreshing beer that is light on the palate but long on complexity.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4053, 551, 1, 4, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Now In Bottles!! Our award winning 8th Street Ale is based on an English-style "Best Bitter" which is the most common ale served in British pubs. What makes 8th Street Ale uncommon is its mellow bitterness and its slightly sweet malt flavor. It''s aroma is derived from rare, imported Kentish hops, and lots of them. Alcohol content approximately 4.5% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4054, 960, 1, 13, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A big malty ale brewed in the style of English Old Ales. Deep ruby in color and lightly bittered with a big malty backbone.', 'http://www.ottospubandbrewery.com/index.php', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4055, 551, 1, 15, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Our award-winning Flagship ale is now in bottles!! This is an ale made in the tradition of the great strong ales of Scotland. Amber colored, malty sweet with underlying note of smokiness. Alcohol content approximately 6.0% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4056, 551, 4, 50, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'This is a Bavarian ale which uses 51% wheat malt in the recipe. Very low bitterness. It is unfiltered so the characteristic cloudiness is achieved. The haze comes from suspended yeast. Hefe-Weizen literally means "yeast-wheat." The aroma is reminiscent of cloves and banana and is put out by the yeast. While some of this aroma carries over to the flavor, the dominant flavor is the malty wheat. Alcohol content approximately 5.0% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4057, 551, 3, 31, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Our Hop Knot IPA is made only from American malt and lots of American hops, which produce a big, broad-shouldered, hoppy beer backed up by a character as warm as, well, Mom and apple pieâ€¦ Hop Knot IPA get its peculiar name from the weaving of four different hops added at four separate times during the brewing process. Including our cavernous hop-back, which gets so stuffed with whole leaf hops that we feel genuine guilt for its excess. Hop Knot is an ale that is to be enjoyed with friends, spicy food or any time you need a good hop fix without the harsh bitterness. We hope you enjoy this pioneering beer made in the bold spirit of Americans everywhere. Alcohol content approximately 6.0% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4058, 551, -1, -1, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'A very light golden ale that is malty sweet, almost honey-like in the nose. This ale has a light to medium body and a very delicate flavor. Easy drinking, it has very low bitterness and a soft dry finish. 5.2% alcohol/volume. This style originates from the city of Cologne, Germany where all twenty eight breweries are dedicated to brewing only KÃ¶lsch. Coming soon in cans. (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4059, 551, 3, 31, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'A strong India Pale Ale that is marked by intense hop flavor and high hop bitterness. This style of beer needed the high hop and alcohol to survive the trip around Africa. Medium to light body and very bitter. Alcohol content approximately 6.9% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4060, 551, 1, 21, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Our Oatmeal Stout is definitely a local favorite but it gets its origins from one of London''s oldest breweries. The Oatmeal Stout differs from the popular Irish stout in its more subtle roastiness and subdued dryness. The addition of flaked oats rounds out these sometimes harsh characteristics producing a velvet smooth ale. This black stout has a flavor profile unique to all of North America. Subtlety is not a strong point as it is a stout after all, rich and eminently drinkable. Alcohol content of approximately 5.0% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4061, 551, 5, 70, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'The dominating character of this beer is of course peach flavor and aroma. It is a little more subtle than most fruit beers which makes it more approachable. Light in body and color. Alcohol content of approximately 4.0% by volume (ALWAYS ON TAP!!)', 'http://www.fourpeaks.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4062, 551, 5, 72, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'A Belgian Double Abbey.', 'http://www.fourpeaks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4063, 551, 3, 38, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Leroy''s BIG Brother. Sweet floral hop aroma balances out the big malty roasted body with the slightest bitter spiced-chocolate finish. A very untraditional hopping technique gives this beer a unique character significantly more robust than our traditional Leroy Brown Ale. The beer weighs in at 5.0% alc./vol. Cheers!!', 'http://www.fourpeaks.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4065, 551, 5, 72, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'This is the old tried and true Blind Date Ale of old. It is based on an English Olde Ale but has an addition of 300 pounds of Arizona grown Medjool dates. The dates contribute a complexity and sweetness that the malt alone cannot. This Blind Date has been aged for three months in Jim Beam oak bourbon barrels. The oak and bourbon lend flavors of vanilla, wood, and of course, bourbon. These flavors layered with the dates created a big, multi-leveled ale. The alcohol content is about 7.5% alc/vol. You''ll have to get to Four Peaks quick since we only have a few kegs of this unique beer.', 'http://www.fourpeaks.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4066, 551, 5, 67, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Belgian Wits originated in Belgium, in the area of Brabant just east of Brussels. This are was a part of the Netherlands in the early 1800''s and was the wheat growing region. In this era, the Dutch basically controlled the spice trade, thus, coriander as well as Curacao orange peel made its way into the beer. Spices were used well before the widespread use of hops in beer. At one point there were more than thirty breweries producing a Wit, but overtime the style died off and in 1954 the last of the breweries ceased operations. One of the most famous brands of Belgian Wits is Hoegaarden (pronounced "Who Garden") produced by Pierre Celis back in 1966. This revived the style and by the 1980''s it was popular again! Belgian Wits are similar to a Hefeweizen with respect to the cloudiness of the beer and some phenolic (clove) and tart flavors. Wits should have white, rocky head when poured and should be almost white in appearance, hence the name. You will smell oranges and coriander which is different than a Hefeweizen that smells of banana and clove. Our version of a Belgian Wit is called "Hoof - Hearted Wit," and it is brewed to style with dried bitter and sweet orange peel and coriander seeds.', 'http://www.fourpeaks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4067, 551, -1, -1, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'One of a kind ale. Brewed with 600 pounds of Arizona grown Medjool Dates added to the kettle. 1998 Gold Medal GABF. Alcohol content varies as every brew is slightly different. Usually very strong with sherry or port-like flavors. Brewed quarterly. Alcohol content approximately 7-9% by volume.', 'http://www.fourpeaks.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4068, 551, 7, 86, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'This almost black lager originates from Germany and is most closely associated with Porter. The difference being the long maturation period (or lagering time) required to produce a true Schwartzbier. The flavor is reminiscent of treacle, coffee and toasted malt. It is not and should not be perceived as burnt or ashy like some stouts. Black Betty has 5% alc/vol and a smooth character that marks most lager beers. The name, of course, comes from the Huddy Ledbetter song from the 1940â€™s which was made popular by the band Ram Jam and later by the Black Crows and U2, among others.', 'http://www.fourpeaks.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4069, 551, 11, 119, '1340 East Eighth Street #103', 'Tempe', 'Arizona', 'United States', 'Our rye beer is made with 20% flaked rye and rye malt. The addition of rye creates a dry, spicy flavor with a crisp, grainy aroma. We went with a lighter color and lower bitterness to compliment these flavors. It has an alcohol content of around 4.9%.', 'http://www.fourpeaks.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '33.4194, -111.916', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4070, 1173, 2, 25, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4071, 1173, 11, 116, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'A golden wheat beer brewed with the finest North American malted barley and wheat. It''s then lightly hopped with the choicest European varieties. The smooth, crisp golden wheat beer is then finished with a hint of rasberry. Enjoy this beer any time of the year.', 'http://www.southerntierbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4072, 378, 5, 60, 'Route de Charlemagne 8', 'Chimay', '', 'Belgium', 'First sold in 75 cl (25.4 fl.oz.) bottles, it is noted for its coppery colour which makes it particularly attractive. Topped with a creamy head, it gives off a light, fruity apricot aroma produced by the fermentation. The taste perceived in the mouth is a balance confirming the fruity nuances noticed in the fragrance. Its taste, which imparts a silky sensation to the tongue, is made refreshing by a light touch of bitterness. To the palate, the taster perceives a pleasant astringency which complements the flavour qualities of this beer very harmoniously. This top fermented Trappist beer, refermented in the bottle, is not pasteurised.', 'http://www.chimay.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '50.0355, 4.3777', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4073, 378, 5, 61, 'Route de Charlemagne 8', 'Chimay', '', 'Belgium', 'Named Cinq Cents in 75 cl (25.4 fl.oz.) bottles, this beer with its typical golden colour, its slightly hazy appearance and its fine head is especially characterised by its aroma which results from an agreeable combination of fresh hops and yeast. The beer''s flavour, as sensed in the mouth, comes from the smell of hops: above all it is the fruity notes of muscat and raisins that give this beer a particularly attractive aroma. The aroma complements the touch of bitterness. There is no acidity, but an after-bitterness which melts in the mouth. This top fermented Trappist beer, refermented in the bottle, is not pasteurised.', 'http://www.chimay.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.0355, 4.3777', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4074, 157, 3, 42, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'The Cappucino of beers. Roasty, smooth and sweet. Samuel Adams® Cream Stout is a true cream stout, balancing body and sweetness with the natural spiciness of grain and hand selected English hops. Our Brewers use generous portions of roasted chocolate and caramel malts as well as unroasted barley to impart a fullness of body, a roasty malt character and rich, creamy head. Its dark mahogany color make it almost as easy on the eyes as it is on the palate.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4075, 157, 4, 50, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Unfiltered wheat ale, fruity, bright, with a crisp flavor of wheat. Samuel Adams® Hefeweizen beer is a traditional spin on a classic American craft brewing style. The brewers of Samuel Adams® used both malted and unmalted wheat, and two row Pale barley for a clean malty, cereal note. This bright, fruity wheat ale is unfiltered, retaining a natural haze from malt proteins, crisp, bright flavors of wheat, and fresh, fruity ester complexity from our proprietary ale yeast. Accentuated with Noble Spalt-Spalter hops, Samuel Adams® Hefeweizen has an elegant and pleasant bitterness, finishing smooth and clean.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4096, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'When the loveable "hopheads" at Humpy''s Great Alaskan Alehouse requested a winter version of alehouse favorite Sockeye Red IPA, our brewers instinctively spawned CoHoHo Imperial IPA. CoHoHo begins with generous measures of pale two-row and specialty malts along with spirit-boosters like maple syrup, brown sugar and honey. Hefty doses of Cascade, Centennial and Simcoe hops beautifully balance that outrageous malt bill and heighten the festive character of this exuberant beer.', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4076, 157, 3, 38, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'rk in color yet medium bodied. Rich and smooth. Samuel Adams® Brown Ale is a study in flavor, body, and style. Supported by an interesting blend of malts, it shines with a deep mahogany luster. The roasted malt blend is complex and deep as well, with notes of biscuit, nut and caramel. The hops are imported from Europe; Noble Spalt from Germany and citrusy Goldings, a traditional British ale hop selected from a single farm in East Kent. With moderate hop bitterness, a deep malt body, and a fruity ale fermentation character, Samuel Adams® Brown Ale satisfies the soul and doesn', 'http://www.samueladams.com/', 5.35, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4077, 157, 2, 25, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'A dark, full flavored English porter with Scottish heather honey. Samuel Adams® Honey Porter is a full-flavored, full-bodied English porter with a substantial roasted malt character, offering a smooth, rounded finish. This beer is brewed with traditional English Ale hops and is dry-hopped with East Kent Goldings, known for their spicy aroma and distinctive, earthy flavor. We brew Honey Porter with Scottish heather honey which balances the spiciness of the hops. This brew is the perfect complement to glazed ham, spicy chili, and roasted vegetables like beets and carrots, which bring out the herbal notes found in the hops and the sweetness of the honey. Samuel Adams® Honey Porter also pairs well with rich desserts such as baklava and molasses cookies.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4078, 157, 2, 22, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Malty and slightly sweet, balanced by earthy notes from the hops. The gentle rain and fertile soil of Ireland helped inspire this style of ale, known for being remarkably balanced. Pale and Caramel malts give the beer its rich, deep red color and distinctive caramel flavor. The sweetness of the malt is pleasantly balanced by a pronounced hop bitterness and an earthy note from the East Kent Goldings hops. Samuel Adams® Irish Red finishes smooth and leaves you wanting to take another sip.', 'http://www.samueladams.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4079, 17, 1, 13, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Alt. The name of this beer style comes from the German word "alt" meaning "old". This refers to the aging that alts undergo since they ferment more slowly and at colder temperatures than most ales. Slow fermentation helps condition the flavors in Alaskan Amber, contributing to its overall balance and smoothness. Richly malty and long on the palate, with just enough hop backing to make this beautiful amber colored "alt" style beer notably well balanced. Alaskan Amber is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row pale and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and the more than 90 inches of rainfall we receive each year.', 'http://www.alaskanbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4080, 17, 3, 37, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Golden Ale. A blonde, lighter bodied beer with a floral aroma and a crisp, hoppy finish that''s not bitter. The hop character of Alaskan Pale is due to dry hopping by hand during the fermentation process. A clean, softly malted body with a hint of citrus overtones, followed by a hop-accented dry, crisp finish. Alaskan Pale is made from glacier-fed water and a generous blend or European and Pacific Northwest hop varieties and premium two-row pale and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and the more than 90 inches or rainfall we receive each year.', 'http://www.alaskanbeer.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4081, 17, 1, 21, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Oatmeal Stout. The origins of Oatmeal Stout go back hundreds of years when oats were added to Stouts to promote a healthier image than other beers available during that time period. The unique blend of the oats and malts in Alaskan Stout produce a balanced, smooth beer with hints of coffee and caramel. Alaskan Stout is made from glacier-fed water and a generous belnd of European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and the from the more than 90 inches of rainfall Juneau receives each year.', 'http://www.alaskanbeer.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4082, 17, 1, 5, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Extra Special Bitter Ale. Alaskan ESB is darker and hoppier and is brewed and fermented at different temperatures than our popular Alt-style Amber. It has an exquisite copper color derived from Crystal malt and an aggressive, yet pleasant hop character. Malty with roasted overtones, Alaskan ESB has a crisp finish resulting from the use of premium Northwest hops. Alaskan ESB is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and from the more than 90 inches of rainfall we receive each year.', 'http://www.alaskanbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4083, 17, 3, 31, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'India Pale Ales are characterized by intense hop flavor and aroma accompanied by higher alcohol content. This style possesses medium maltiness and body while also being crisp and dry. Citrus flavors and aromas are moderate to very strong. Alaskan IPA is honey gold in color with a fruity, citrus aroma. An enticing blend of hops and our dry hopping process, in which hops are added directly to tanks during fermentation, give this brew a very intense, complex aromatic character with a refreshing hop finish. Alaskan IPA is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500-square-mile Juneau Ice Field and from more than 90 inches of rainfall each year.', 'http://www.alaskanbeer.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4084, 17, 2, 25, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Smoked Beer. Known as "rauchbier" in Germany, smoke-flavored beers were virtually unknown in the U.S. until Alaskan Smoked Porter was developed in 1988. The dark, robust body and pronounced smoky flavor of this limited edition beer make it an adventuresome taste experience. Alaskan Smoked porter is produced in limited "vintages" each year and unlike most beers, may be aged in the bottle much like fine wine. Water, five types of malt, 2 varieties of hops and yeast with no adjuncts, no preservatives and no pasteurization. Our glacier-fed water originates in the 1,500 square-mile Juneau Ice Field. Prior to brewing, selected malts are smoked in small batches under carefully controlled conditions in a commercial food smoker using local alder wood.', 'http://www.alaskanbeer.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4111, 25, 11, 123, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Our Holiday beer is made with real pumpkins, cloves, ginger, all-spice, nutmeg and cinnamon. This light copper colored winter ale will tantalize your taste buds. Pumkin pie in a glass!', 'http://www.thebrewworks.com/allentown-brewworks/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4085, 17, 11, 141, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'English Olde Ale. Traditionally malty with the warming sensation of alcohol, Olde Ales are brewed in the fall as winter warmers. Brewed in the style of an English Olde Ale, this ale balances the sweet heady aroma of spruce tips with the clean crisp finish of noble hops. Its malty richness is complemented by the warming sensation of alcohol. Alaskan Winter is made from glacier-fed water, Sitka spruce tips and a generous blend of the finest quality European and Pacific Northwest hop varieties and specialty malts. Our water originates in the 1,500-square-mile Juneau Ice Field and from the more than 90 inches of rainfall we receive each year.', 'http://www.alaskanbeer.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4086, 17, -1, -1, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Based on the traditional style of KÃ¶lsch beer brewed in Cologne, Germany. Alaskan Summer Ale balances a softly malted palate with the clean freshness of Hallertauer hops. In the tradition of the style, neither overpowers the other. Both hops and malt come together to refresh and renew the palate. The straw-gold color and easy drinkability are an enjoyable way to celebrate summer. Alaskan Summer Ale is made from glacier-fed water and a generous blend of European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and from the more than 90 inches of rainfall Juneau receives each year.', 'http://www.alaskanbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4087, 17, 3, 35, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Alaskan Barley Wine is produced in small batches each year. Typically this higher alcohol beverage is brewed in the spring, cellared in the tunnels of the Alaska-Juneau Gold Mine for the summer and retrieved in time for its release at the Great Alaska Beer and Barley Wine Festival in January. The cool tunnels of the mine shaft provide natural refrigeration and a prime environment for the aging process. Like a fine wine, Alaskan Barley Wine can be aged for years. The bottling of the 2007 vintage of Alaskan Barley Wine will allow individuals to age it to their liking. â€œWe figured weâ€™d leave it up to individuals as to how long to age their Alaskan Barley Wine,â€ said Quality Assurance Analyst Ryan Harvey. â€œSome people like barley wines fresh, and others store it for years.â€', 'http://www.alaskanbeer.com/', 10.40, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4088, 17, 7, 90, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', '', 'http://www.alaskanbeer.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4089, 1144, 3, 26, '2195 Old Steese Highway', 'Fox', 'Alaska', 'United States', '', 'http://www.ptialaska.net/~gbrady/', 0.00, 0.00, 0.00, 0, '9999-01-01', '64.9583, -147.622', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4090, 858, 3, 38, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Rugged yet smooth, Kodiak Brown Ale balances caramel and roasted malts with enticing Northwest hops. Inspired by the adventurous spirit readily found in Alaska, Kodiak Brown Ale invites you to take the road less traveled. Like true Alaskans, we are not afraid of the dark.', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4091, 858, 2, 25, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Inspired by local artist & roaster Michael Allen''s eccentricly-named blend of coffee beans, Midnight Sun''s brewers designed a beer recipe and infusion process that perfectly captures the alluring aroma, satisfying flavor and curious legend of Allen''s Arctic Rhino Coffee. Arctic Rhino Coffee Porter combines two quintessential Pacific Northwest favorites: coffee and ale. The result is wonderfully romantic and robust--a duel-fueled porter that melds charismatic dark malt with freshly roasted coffee beans. The (un)rest is up to you.', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4092, 858, 3, 31, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', '', 'http://www.midnightsunbrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4093, 858, 5, 61, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Free spirited Panty Peeler pours rambunctiously into your glass, releasing its engaging aroma. Curacao (bitter) orange peel and coriander create a beautiful yet bolder tripel by infusing color, citrus and spice. Belgian yeast adds playful character. Bottle conditioning assures a perfectly heady experience. Brewed as a Belgian tripel but with American boldness, Panty Peeler is delicious yet spirited. Originally named Extreme Polar White Bier, it got nicknamed "Panty Peeler" along the way. Then we translated it to French for a while: E''pluche-culotte. Now we''re back to calling it Panty Peeler and we''ve kicked up the coriander and orange peel to represent its original design. Availability: AK - 22-oz bottles (year-round) and draft (on occasion) OR - 22-oz bottles (year-round)', 'http://www.midnightsunbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4094, 858, 3, 29, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Dark and strong as the style implies, La Maitresse du Moine dances across the palate with complexity and mystery--just as the Northern Lights move across the night sky, delighting the senses and enlightening the mind. In the tradition of monks who have devoutly brewed beers of character and strength for centuries, La Maitresse du Moine Dark Strong Ale reflects the passion and dedication required to create a beer this heavenly. This Mistress of the Monk is seductive, pensive and intriguing. We say it in French: La Maitresse du Moine.', 'http://www.midnightsunbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4095, 858, -1, -1, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Arctic Devil Barley Wine, aptly named after the ferocious wolverine of the north, is an English-style (meaning malt-inclined) barley wine. Though the recipe and process for Arctic Devil have evolved over the years, it is typically brewed in January then aged in oak barrels for several months before the entire batch is blended, bottled and released on the Friday after Thanksgiving. In its youth, Arctic Devil gnarls and snarls its way across the palate. Containing this beast of a beer for long periods in oak barrels--some having previously aged port, wine or whiskey--tames the unleashed malt and fierce hop flavors, melding and mellowing this powerful liquid into an incredible elixir worthy of a brewer''s table. Each annual batch of Arctic Devil Barley Wine represents the brewers'' resolve to create an intriguing and sought-after barley wine by precisely brewing to well-designed specifications, carefully selecting the type and combination of barrels to use for aging, and meticulously checking the beer as it ages. Distinct nuance and complexity are contributed by the wood''s previous tenants, resulting in unique flavor profiles in each batch that continue to change over time. We invite you to savor Arctic Devil Barley Wine upon its release then cellar some for future enjoyment. Midnight Sun''s elusive Arctic Devil Barley Wine is Alaska''s most awarded barley wine.', 'http://www.midnightsunbrewing.com/', 13.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4112, 25, 3, 29, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Our silver medal winning Belgian style Holiday beer brewed with dark Belgian candied sugar and special spices. This brew has a spicy aroma and flavor with a sweet malt taste. At 10.5% alcohol it is sure to warm you up during the Holiday season.', 'http://www.thebrewworks.com/allentown-brewworks/', 10.50, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4097, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'The days are long but the season is short. So what gives? Sleep! After doing more before midnight than most Outsiders do in a week, Alaskans deserve some down time. And these moments of relaxation demand more than that ordinary, non-distinct lawn mower beer. Celebrate a day well done with a beer done wellâ€”a seriously delicious IPA with some scorchinâ€™ hops. Our new seasonal double IPA is designed to keep you incredibly hopped up spring through summer.', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4098, 858, 4, 50, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'This is our perennial summer seasonal beer, first brewed in Summer 1995 when we opened. Affectionately called "Spunky and Chunky", Old Whiskers Hefeweizen is a traditional Bavarian-style unfiltered wheat beer. Created with equal parts malted wheat and pale two-row malt, Old Whiskers is lightly hopped to style. A unique Bavarian strain of yeast imparts a clove- or banana-like aroma and flavor. (We swear we did not put cloves into the brew. It is the magical powers of The Yeast.) Old Whisker is delicious and refeshing--the perfect summer quencher, served with or without a slice of lemon.', 'http://www.midnightsunbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4099, 858, 11, 141, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', '', 'http://www.midnightsunbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4100, 858, 5, 65, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Fallen Angel Golden Strong Ale, brewed on 6-6-6, is named in the tradition of Belgian golden strong ales--after the devil himself. Midnight Sun''s Fallen Angel Golden Strong Ale is a traditional Belgian-style golden ale--beautiful gold in color with tiny, conniving bubbles forming a very thick, meticulous head. Effervescent and crisp, this seriously delicious elixir tempts the palate with apple (oh so Garden of Eden), pear and a little earthy mustiness. Fallen Angel captivates your senses with its lightness and brightness while its 8% ABV strength breathes fire into your soul, warming you from the inside out. Angel-like in appearance, the devil is in its strength. With its introduction in 2006 and its immediate cult following, Fallen Angel is now brewed and released about once a year.', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4101, 858, 3, 29, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Conspiracy Belgian-style Black Beer is the result of a collaboration between Midnight Sun brewers Gabe Fletcher and Ben Johnson and Pelican Pub (Pacific City, OR) brewer Ben Love. These brewers conspired during barley wine fest week to brew up a deviously delicious dark Belgian-style beer. Conspiracy is opaque black with a creamy beige head. Black malt shrouds it in mystery; the Belgian yeast imparts intriguing flavor; the alcohol adds danger. If you''re up for this mission, watch your back. Conspiracy will be released in Anchorage and Portland in April 2007.', 'http://www.midnightsunbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4102, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses. Obliteration III is yet another dynamic Double IPA. Its aroma is pungent with fragrant notes of citrus, spice, pine and alcohol. A sturdy malt platform provides the perfect stage for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. Obliteration III finishes with poignant bitterness.', 'http://www.midnightsunbrewing.com/', 7.60, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4103, 145, 3, 26, '217 North Main Street', 'Greenville', 'South Carolina', 'United States', 'A classic American pale ale with a taste not unlike fresh citrus follwed by a crisp and spicy bitterness.', 'http://www.blueridgebrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '34.8531, -82.3983', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4104, 227, 1, 15, '111 Main Street', 'Lucan', 'Minnesota', 'United States', 'Originally brewed exclusively for beer shows, this award-winning ale has always been a Brau Brothers favorite! This is not your typical Scotch Ale. Combined with traditional malt sweetness is a distinct smoke flavor derived from authentic peat-smoked malt. This beer will change your opinion about Scottish ales due to its drinkability. Hop flavor and bitterness are minor, yet balance out this malty beer. Brau Scotch Ale is copper to amber in color with an off-white head of tightly laced bubbles. Wide-bowled glassware will allow the sweet and smoky aroma to escape. This ale can be served from 34- 50 degrees Fahrenheit. Lower temps will make it easier to drink while higher temps will enhance both malt and hop flavor. Portion control is important as this beer.', 'http://www.braubrothersbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '44.4105, -95.4107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4105, 25, 7, 77, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Crisp Clean and refreshing Golden Lager brewed with German Malt and Hops for an authentic flavor. Pig Pen Pils is a great introduction into the world of Craft Brewed beer.', 'http://www.thebrewworks.com/allentown-brewworks/', 4.70, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4106, 25, 3, 33, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Amber Colored lager with a nice caramel malt flavor backed by a nice dose of Imported Hersbrucker Hops for a nice easy drinking lager.', 'http://www.thebrewworks.com/allentown-brewworks/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4107, 25, 5, 67, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Unfiltered Belgian Style beer is brewed with special yeast that lends a unique refreshing flavor to the beer. Brewed with Chamomile, Curacao Orange peel and Coriander to create a smooth citrus finish. Usually enjoyed with a slice of lemon.', 'http://www.thebrewworks.com/allentown-brewworks/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4108, 25, 3, 31, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Hoppiest Brew Works beer ever? The smell of grapefruit, a sweet malt flavor, and oh by the way, lots of hop bitterness. Brewed in the tradition of West Coast ales, we have put loads of malt and hops in our kettle to come up with this sensational ale. Brewed with pale, and crystal malts, hopped with Tomahawks for Yakima Valley, WA. This beer styled has made many a microbrewery famous and this one is sure to please all those who love hops.', 'http://www.thebrewworks.com/allentown-brewworks/', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4109, 25, 2, 25, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Dark brown with ruby highlights this brew has a deep chocolate flavor backed by a smooth caramel finish. Brewed with English malt and hops for an authentic flavor', 'http://www.thebrewworks.com/allentown-brewworks/', 5.70, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4110, 25, 11, 116, '814 W Hamilton St', 'Allentown', 'Pennsylvania', 'United States', 'Unfiltered wheat beer brewed with apricots creating a smooth and thirst quenching full flavored fruit beer.', 'http://www.thebrewworks.com/allentown-brewworks/', 5.40, 0.00, 0.00, 0, '9999-01-01', '40.6016, -75.474', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4113, 106, 3, 26, '569 Main St', 'Bethlehem', 'Pennsylvania', 'United States', 'This light copper, dry finishing American Pale Ale is an excellent addition to the Brew Works fleet of pale ales. A hefty sling load weight of Chinook hops gives this beer its distinctive bite. Chinook and Amarillo hops contribute to its almost citrus aroma. A hopheads delight!', 'http://www.thebrewworks.com/bethlehem-brew-works', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.622, -75.382', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4114, 106, 5, 70, '569 Main St', 'Bethlehem', 'Pennsylvania', 'United States', 'Aged for over a year! This traditional classic Belgisn style lambic is brewed using several varieties of Belgian lambic yeast and a generous amount of black currant concentrate to create a complex tart flavor. This brew is sure to become a Brew Works favorite!', 'http://www.thebrewworks.com/bethlehem-brew-works', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.622, -75.382', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4115, 106, 4, 57, '569 Main St', 'Bethlehem', 'Pennsylvania', 'United States', 'Smooth and malty dark copper German ale common to Duseldorf. Brewed with imported Munich malts, tettnang hops and imported yeast giving this brew a unique flovor.', 'http://www.thebrewworks.com/bethlehem-brew-works', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.622, -75.382', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4116, 319, -1, -1, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'This lightly colored ale has a delicate floral aroma and flavor reminiscent of Williamsports first breweries, clean and crisp with just a touch of lingering sweetness leading to a dry, balanced finish.', 'http://www.bullfrogbrewery.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4117, 319, 3, 26, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'Named in honor of Ed Kiessling, the worlds greatest contractor. This American pale ale is assertively hopped and dangerously drinkable. Hopheads rejoice!', 'http://www.bullfrogbrewery.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4118, 319, 1, 21, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'A big, burly Oatmeal Stout full of chocolate, caramelized malt and coffee flavors. This stout has a rich mouthfeel and a smooth, roasty finish.', 'http://www.bullfrogbrewery.com', 6.20, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4119, 319, 3, 31, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'As the story goes, I was redesigning our I.P.A. to be bigger and better but as it came together it started to take on a life of its own. After much deliberation and several pints of our new creation we decided to name him after the master of macabre, Edgar Allen Poe, as a tribute to his aptly named short story "HOP FROG." As Edgar fermented and spewed his almost abusive hop aroma throughout the pub, his legend and our thirst grew until finally one day, he was released into the world. We hope Edgar amuses you as much as he has us but stay on his good side because much like the story, this Hop Frog bites back!', 'http://www.bullfrogbrewery.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4120, 319, 3, 33, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'A big addition of caramel and Munich malts give this beer its rich mahogany color along with its juicy palate. Its medium body and wonderful balance of hops from the Pacific Northwest make this a luscious and aromatic brew.', 'http://www.bullfrogbrewery.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4121, 319, 2, 25, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'A big, RICH dark ale with a complex combination of beechwood smoked malts, chocolate, coffee and caramel flavors rounding out the beers smooth creamy body.', 'http://www.bullfrogbrewery.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4122, 319, 7, 91, '231 W. Fourth Street', 'Williamsport', 'Pennsylvania', 'United States', 'A springtime favorite, this traditional German Maibock (my-bock) is golden in color with a rich maltiness and a long, spicy finish.', 'http://www.bullfrogbrewery.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '41.2404, -77.0057', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4123, 87, 3, 33, '429 W. 3rd St', 'Williamsport', 'Pennsylvania', 'United States', 'Hammerinâ€™ Ale is the Barbarianâ€™s first beer. Brewed to be a well-balanced, easy-going beer, Hammerinâ€™ Ale comes from a rather simple recipe which yields a deep amber color and a sublime balance of malt character and hop flavors. This beer goes very well with grilled meats and is meant to be enjoyed year-round. Hammerinâ€™ Ale is an excellent choice for â€œBarbariansâ€ who are new to craft beer.', 'http://www.bavarianbarbarian.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '41.238, -77.0103', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4124, 87, 3, 38, '429 W. 3rd St', 'Williamsport', 'Pennsylvania', 'United States', 'Headbangerz Brown Ale is based on an English brown ale style. Its color is a demonic, dark reddish-brown. This beer is subtly sweet and punctuated with roasty, nutty flavors. The hops take a back seat and simply complement the malt character. Headbangerz Brown Ale is perfect for any Autumn outdoor activities or for relaxing on Summer evenings. Headbangerz Brown Ale is named in honor of Barbarian Chief''s, Mike Hiller, hardworking former co-workers â€“ heavy metal freaks and masters of metal fabrication.', 'http://www.bavarianbarbarian.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.238, -77.0103', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4125, 87, 3, 31, '429 W. 3rd St', 'Williamsport', 'Pennsylvania', 'United States', 'Weldspatter IPA is not your typical India Pale Ale. First of all, it isnâ€™t as aggressively hopped as many other American versions. Second, it isnâ€™t quite as pale. Balance is a lovely thing in beers and Weldspatter IPA achieves balance without compromising hop presence. The hop flavor and aroma abound, but the bitterness is held in check to give our IPA a pleasant malt character as well.', 'http://www.bavarianbarbarian.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '41.238, -77.0103', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4126, 87, -1, -1, '429 W. 3rd St', 'Williamsport', 'Pennsylvania', 'United States', 'Square Feet Wheat is loosely based on a Berliner Weisse style of beer from Germany. It has a refreshing, yet slight wheat and malt sweetness that is supported by a distinct hop presence. On hot Summer days, Square Feet Wheat will cool you off. Bring it along to pool parties, picnics and backyard cookouts. Instead of a boring wedge of lemon or orange, try Square Feet Wheat with a splash of raspberry extract or a dash of essence of Woodruff â€“ both a customary addition to Berliner Weisse beers in Berlin.', 'http://www.bavarianbarbarian.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.238, -77.0103', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4127, 100, 11, 116, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'An American wheat ale brewed with Saaz hops. Spicy and fruity, Oberon is the color and scent of a summer afternoon.', 'http://www.bellsbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4128, 100, 2, 25, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A robust porter for all occasions. A blend of dark malts give this beer flavors of coffee and chocolate with subtle roasted notes.Gold medal winner in the Brown Porter category Brewers Association World Beer Cup 2008.', 'http://www.bellsbeer.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4129, 100, 8, 95, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'As refreshingly crisp as a morning swim in a Great Lake, this brew is crafted with Pils and Munich malts. The pronounced hop character of this golden lager sparks thoughts of sandy beaches and rocky islands.', 'http://www.bellsbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4130, 100, 1, 13, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A barley wine with deep amber color. The brandy of ales, this beer has vintage character and will mature in the bottle at cellar temperature for years.', 'http://www.bellsbeer.com/', 10.20, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4131, 100, 3, 37, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A golden beer brewed with pale malts. Large American hop additions contribute a crisp refreshing bitterness. A tribute to the Great Lakes, T.C.B. is a truly quaffable beer.', 'http://www.bellsbeer.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4132, 100, 3, 26, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A refreshing, blond colored pale ale. Bell''s pale ale is made almost exclusively from pale malt. It expresses a spicy floral hop aroma and taste.', 'http://www.bellsbeer.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4133, 100, 3, 31, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'India Pale Ale style well suited for Hemingway-esque trips to the Upper Peninsula. American malts and enormous hop additions give this beer a crisp finish and incredible floral hop aroma.', 'http://www.bellsbeer.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4134, 100, 1, 20, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A full-bodied stout with plenty of roast flavor. Kalamazoo Stout is available year round, leading our vast portfolio of stouts.', 'http://www.bellsbeer.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4135, 100, 5, 67, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A Wheat Ale brewed with American Wheat and a proprietary blend of Hefe and classic Belgian-style yeasts. A refreshing winter alternative created from the subtle fusion of two classic flavors.', 'http://www.bellsbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4136, 100, 3, 33, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'Our flagship beer is made from mostly pale malt with some Munich and caramel malts. This gives it a slightly sweet flavor that is balanced by a melange of American hops. The result is a deep copper color and rich flavor.', 'http://www.bellsbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4137, 100, 3, 38, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'Rich brown ale perfect for the fall and winter. Plenty of malt character and smooth sweet finish give this brown ale its distinct character.', 'http://www.bellsbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4138, 100, 11, 121, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A rich and powerful beer with tart cherry appeal, make this a fine stout.', 'http://www.bellsbeer.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4139, 100, 7, 92, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A traditional dopplebock fermented with a Bohemian lager yeast. Reddish brown in color, with a mild hop profile, Consecrator is a well balanced, full bodied beer with hints of caramel and molasses in its smooth, malty finish.', 'http://www.bellsbeer.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4140, 100, 1, 20, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'Sweeter and smoother than Kalamazoo Stout. A beer for special winter occasions. Great with chocolate desserts.', 'http://www.bellsbeer.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4141, 100, 3, 43, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'The vintage port of American stout. A good ale for the cellar. Well suited for November storms and trips across the Sahara.', 'http://www.bellsbeer.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4142, 100, 3, 29, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A brew that gives you either sympathy for the devil or the courage to face him. Goes especially well with your favorite lost my girl/truck/dog/trailer song.', 'http://www.bellsbeer.com/', 7.70, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4143, 100, 3, 32, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A biting, bitter, tongue bruiser of an ale. With a name like Hopslam, what did you expect?', 'http://www.bellsbeer.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4144, 100, 3, 43, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'The satisfying elements of both stout and coffee come together in this full-bodied treat. A marriage of Sumatra''s best with rich chocolate and roasted malt provides for a truly enlightening beer.', 'http://www.bellsbeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4145, 100, 7, 84, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A coppery amber lager that showcases a full bodied, malty flavor that is balanced by a refreshing bitterness derived from fine noble hops.', 'http://www.bellsbeer.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4146, 100, 5, 67, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'Batch 8,000 is part of our commemorative series celebrating our progress with special brews. Our 8,000th batch is a special recipe to be brewed only once. It is wheat ale spiced with Coriander, Orange Peel, and Paradise Seed. Best consumed fresh.', 'http://www.bellsbeer.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4147, 100, 3, 43, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'Batch 7000 is part of our commemorative series celebrating our progress with special brews. Our 7,000th batch is a special recipe to be brewed only once.', 'http://www.bellsbeer.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4148, 784, 3, 33, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'A blend of Pacific Northwest hops and three different caramel malts combine to give this beer its unique character.', 'http://www.libertysteakhouseandbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4149, 784, 5, 67, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'Wheat-based beer brewed with coriander and orange peel to produce a mild citrus flavor.', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4150, 339, -1, -1, '1100 New York Ave, NW', 'Washington', 'District of Columbia', 'United States', 'This lager like ale is modeled after the official beer of KÃ¶ln, Germany. Kolsch is delicate and refreshing with a slight fruitiness and supportive, yet unobtrusive hop bitterness', 'http://www.capcitybrew.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '38.8999, -77.0272', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4151, 339, 3, 33, '1100 New York Ave, NW', 'Washington', 'District of Columbia', 'United States', 'A medium bodied west coast style amber ale. This is aggressively hopped with Perle and Cascade hops, and is held together by its sweet malty center.', 'http://www.capcitybrew.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '38.8999, -77.0272', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4152, 339, 2, 22, '1100 New York Ave, NW', 'Washington', 'District of Columbia', 'United States', 'Just in time for St. Patrickâ€™s day, this Irish style red ale definitely has a big malt profile. This beer is the antithesis of our Amber Waves ale. It has a low hop bitterness and aroma, this allows the caramel malt flavors to dominate. It has a medium body, and is very easy going down.', 'http://www.capcitybrew.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '43.8042, -91.2526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4225, 1255, 3, 42, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'A traditional dry Irish Stout. Very Flavorful while low in calories and alcohol. An easy drinking â€œsession beerâ€ that has a nice caramel flavor an smooth finish.', 'http://www.thirstydog.com', 3.10, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4153, 540, 5, 61, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'The long-awaited arrival of our Belgian-style Tripel is upon us. Named after the mythical Greek three-headed dog that guards the gates of hell, Kerberos is a traditional Belgian-style Tripel with a dark golden color has a sweet flavor with a dry and spicy finish. This nectar of the Gods is deceptively strong at 8.5% and is bottle conditioned for an authentic flavor.', 'http://www.flyingdogales.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4154, 812, 4, 50, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'THE Hefeweizen. Unfiltered and unfettered, Circus Boy is a unique and refreshing American-style Hefeweizen. Is he a who? Or a what? Or perhaps some of both? Brewed with organic lemongrass.', 'http://www.magichat.net/', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4155, 812, -1, -1, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', '', 'http://www.magichat.net/', 7.50, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4156, 812, 2, 22, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', '', 'http://www.magichat.net/', 4.60, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4157, 812, -1, -1, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A stupendous Midland Mild Ale whose epic malt infused acts of sweet caramel sensations leave all who pour it speechless. Its roasted notes of sun soaked grain are appearing in the Summer Variety Show in a not to be missed engagement. Brewed with Belgian Candi Sugar.', 'http://www.magichat.net/', 3.60, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4158, 812, 3, 26, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A Commemmorative Brew Single Chair celebrating the uniqueness of the Mad River Glen Cooperative Ski Area in Vermont. Medium bodied & ideally balanced for all tastes, Single Chair Ale''s tempting light golden color, heady aroma & smooth liquid go down effortlessly and often!', 'http://www.magichat.net/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4159, 812, 3, 33, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A wintry amber ode to the open road. Our wintry amber ramble of sweet carmelized malt and spicy hops is for those who make their own roads. Dry hopped with simcoe hops.', 'http://www.magichat.net/', 5.80, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4160, 812, 1, 15, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'An ale for dancing bonfires and falling leaves. Jinx prepares the bones for snow. It''s a full bodied strong ale the color of maple''s golden leaves in the season''s fading sun. Finished with a touch of peat-smoked whiskey malt, Jinx offers sweet, toasty aromas of caramel, tea, and smoke. Deep flavors of dark candy sugar and warming alcohol notes are balanced by a spicy hop bitterness.', 'http://www.magichat.net/', 6.90, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4161, 812, 11, 121, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Our Holiday Offering In pre-christian times, the Celebration of darkness and light was marked with great halls filled with smoke & mirrors. Guilded goblets brimming with seasonal brews were lifted to lips, speaking a language no longer known. Centuries pass. The winter wind finds its way through heavy wood doors. There is a solemn business of monks to be done. But also brewing, a season of celebration is about to begin.... More years pass. The modern age. The present connects the past through the brewer''s art and a new beer is born. Feast of Fools... A perfect dessert beer brewed exclusively for the holiday season. Hand bottled, champagne corked. Our inky, rich, black stout, with the addition of raspberries.', 'http://www.magichat.net/', 5.30, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4162, 812, 3, 35, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Aged Barleywine Ale infused with the copper glow of more than 1,000 setting suns. This exceptional offering has infinite body... a big, sweet malty tumult followed by a long, balanced, hop symphony.', 'http://www.magichat.net/', 10.80, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4163, 812, -1, -1, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'An Ale Brewed with Honey Our inaugural Epic Elixir, Braggot is a most remarkable honey ale, made with specialty malts & wildflower honey from Vermont''s Champlain Valley. The honey adds smoothness with subtle hints of chamomile. Braggot is an ale of shining perfection that simply must be experienced to be understood. But hurry ... for Braggot, as with each entry in our Humdinger series, vanishes almost as soon as it arrives. Get a bottle of Braggot today and come to know a new ''Ale of Legend''. Wild Flower Honey, primarily Red Clover and Alfalfa from Champlain Valley Apiaries in Middlebury, Vermont. This represents 50% of the total fermentable sugars. Chamomile: Whole Chamomile flowers steeped in hot wort.', 'http://www.magichat.net/', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4164, 812, 3, 43, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Our Vermont Imperial Stout Past the dark and into the deep lies this stout and hearty hale ale from a far off forsaken age. Black like shimmering shades of furthest night, this ale will warm your cold limbs and light your mind''s fire. Thumbsucker(tm), big full-bodied, dark beer with a rich, roasted malt flavor and balanced by an assertive hop bitterness, is our salute to the rarest Imperial Stouts of lore.', 'http://www.magichat.net/', 7.80, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4165, 1383, 5, 74, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Saisons were historically brewed to keep the farmhands happy and hydrated during the warm summer months. Crafted using Belgian pilsen malt and candi sugar, this golden Belgian style ale is a refreshing change from your usual beer lineup.', '', 4.70, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4166, 1383, 2, 25, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'By George, I think we''ve got it. Days of debate and deliberation at Independence Hall were often followed by nights of debate and deliberation (and a few libations) at the City Tavern, where our forefathers would gather to exchange revolutionary ideas. Rich and warming with a deep garnet hue, the molasses-based Tavern Porterâ„¢ reflects Washington''s admiration of Philadelphia-style porters and follows a recipe Washington used himself, when brewing beer to satisfy his thirsty field officers. Enjoy a taste of history, courtesy of Yards Brewing Company, Philadelphia''s premier brewer and bottler. Historical note: Our new brewery is located just blocks away from the site of Robert Hair''s brewery, where Washington''s favorite Philadelphia Porter was crafted.', '', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4167, 157, -1, -1, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'An amazing treat for hops lovers. Samuel Adams Hallertau Imperial Pilsner is a celebration of the extraordinary Hallertau Mittelfrueh hop variety. This rare Noble Bavarian hop, considered to be one of the best in the world, is prized for its quality and aromatic characteristics. The beer, which is a deep golden color with a rich, creamy head, gives off an intense and complex Noble hop aroma unlike any other brew. With the first sip, beer enthusiasts will experience an explosion of hop flavor. The intensity of deep citrus, spicy Noble hop flavor is balanced with the slight sweetness from the malt. Due to the quality of the hops, this beer remains balanced and smoothly drinkable from beginning to end. The lingering "hop signature" is an amazing treat for hops lovers.', 'http://www.samueladams.com/', 8.80, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4168, 262, -1, -1, 'Antwerpsesteenweg 476', 'Westmalle', 'Antwerpen', 'Belgium', 'Westmalle Dubbel is a dark, reddish-brown Trappist beer with a secondary fermentation in the bottle. The creamy head has the fragrance of special malt and leaves an attractive lace pattern in the glass. The flavour is rich and complex, herby and fruity with a fresh-bitter finish. It is a balanced quality beer with a soft feel in the mouth and a long, dry aftertaste. The Dubbel contains 7% alcohol.', 'http://www.trappistwestmalle.be', 7.00, 0.00, 0.00, 0, '9999-01-01', '51.2974, 4.6881', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4169, 919, 3, 26, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'This easy-drinking Pale Ale revives the name of one of the early icons of California brewing. Clean-tasting and pleasantly malty, Acme Pale is brewed with Yakima Valley hops, American two-row malt and British specialty malts for depth.', 'http://www.northcoastbrewing.com/home.htm', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4170, 919, 7, 77, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'Named for the delicate engravings popularized by 19th century seafarers, Scrimshaw is a fresh tastingPilsner brewed in the finest European tradition using Munich malt and, Hallertauer and Tettnang hops. Scrimshaw has a subtle hop character, a crisp, clean palate, and a dry finish.', 'http://www.northcoastbrewing.com/home.htm', 4.40, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4171, 1072, 3, 33, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'The Malt Advocate described Saint Rogue Red as "An ale with great character and plenty of hops to satisfy. Full aromatic punch of caramel, citrus fruit and melon, with underlying fresh earth tones. Sweet caramel notes up front are quickly taken over by an array of fruit and hops bitterness that lingers into the night. A more adventurous ale than most.', 'http://www.rogue.com', 5.10, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4172, 1072, 7, 91, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Gratefully dedicated to the Rogue in each of us. In the early 1990s Dead Guy Ale was created as a private tap sticker to celebrate the Mayan Day of the Dead (November 1st, All Souls Day) for Casa U Betcha in Portland, Oregon. The Dead Guy design proved popular and was incorporated into a bottled product a few years later with Maierbock as the elixir. Strangely, the association with the Grateful Dead is pure coincidence. Dead Guy is a German-style Maibock made with Rogues proprietary "PacMan" ale yeast. It is deep honey in color with a malty aroma, rich hearty flavor and a well balanced finish. Dead Guy is created from Northwest Harrington, Klages, Maier Munich and Carastan malts, along with Perle and Saaz Hops. Dead Guy Ale is available in 22-ounce bottles, 12-ounce 6-pack, and on draft.', 'http://www.rogue.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4173, 1072, 3, 33, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Tawny amber in color with a coffee aroma and tight head. A delicate roasted malt accent, generous use of hops and a smooth finish. American Amber, originally known as Ashland Amber (created at Rogues original brewpub in Ashland, Oregon which was destroyed by flooding several years ago), is created from Northwest Harrington and Klages, 95-115 and 135-165 Crystal Malts. Kent Golding and Cascade Hops. American Amber is available in a 22-ounce bottle, 12-ounce 6-pack (new for 2005), and on draft.', 'http://www.rogue.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4174, 1072, 8, 95, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'A vienna style lager', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4175, 1072, 1, 5, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'An imperial bitter style using exotic traditional floor malts, citrus hoppy flavor, stupendous hop aroma. Hedonistic!"Mellow Beer Emboldened by Hops," Elaine Louies article in the New York TimesDining Out Section, (March 24, 1999) announced the release of latest Rogue elixir to be bottled. The article states that "The newest beer of Rogue Ales sounds more aggressive than it is. Brutal Bitter is actually full-bodied, deeply flavored, intensely hoppy brew. There is nothing brutal about the rich, deep, mellow taste. Its crackling but not sharp... This beer may raise eyebrows, but it wont pucker lips. The aftertaste is clean.', 'http://www.rogue.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4176, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'An unfiltered strong ale that is amber in color and has an intense piney hop aroma. The beer is named in honor of Charlie Papazian, president of the Association of Brewers, founder of the American Homebrewers Association and homebrewing guru. John Maier, Brewmaster for Rogue Ales, made his first batch of beer in 1981 using Papazians influential book "The New Complete Joy of Homebrewing.', 'http://www.rogue.com', 8.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4177, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Dedicated to Spanish author Juan de la Cueva, who, in 1575, wrote of a an dish that combined seedless chipotles with beer: Chipotle Ale is based on Rogues American Amber Ale, but delicately spiced with smoked jalapeno (chipotle) chile peppers. Deep amber in color with a tight head, rich malty aroma, delicately smooth and crisp flavor, and subtle chipotle chili finish. Chipotle Ale is created from Northwest Harrington, Klages, and Maier Munich Malts; Willamette and Cascade hops; and Chipolte (smoked jalapeno) Peppers. Available in a 22-ounce (12/case), 12-ounce (24 loose/case) screened bottles, and on draft. Blend it with Rogue Chocolate Stout and create a Mole black and tan!', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4178, 1072, 3, 42, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'The recipe for Rogue Chocolate Stout was created several years ago for export to Japan. The exported twelve ounce Chocolate Bear Beer bottle label is in Kanji and features a teddy bear with a pink heart on his belly. Chocolate Stout was released for Valentines Day in 2001 in a twenty-two ounce bottle for the US market. The label features a Roguester (Sebbie Buhler) on the label. The bottled of Chocolate Stout is available on a very limited basis in the US, so get it while you can! Hedonistic! Ebony in color with a rich creamy head. The mellow flavor of oats, chocolate malts, and real chocolate are balanced perfectly with the right amount of hops for a bittersweet finish. Chocolate Stout is brewed with 10 ingredients: Northwest Harrington and Klages, Crystal 135-165 and Beeston Chocolate Malts, Cascade Hops, Rolled Oats and Roasted Barley, Natural Chocolate Flavor, Free Range Coastal Waters and PacMan Yeast. Chocolate Stout is available year-round only in the classic 22-ounce bottle and on draft.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4179, 1072, 3, 38, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'HazelNut Brown Nectar is a nutty twist to a traditional European Brown Ale. Dark brown in color with a hazelnut aroma, a rich nutty flavor and a smooth malty finish. Dedicated to the homebrewer in each of us--the homebrewer who inspired this creation is Chris Studach, a friend of Rogues resident wizard John Maier, who added a Northwest twist to the classic style by adding hazelnuts for the host homebrew at the 1993 American Homebrewers Association convention. Chris put the nut in nut brown! Hazelnut Brown Nectar Ale is a blend of Great Western 2-row Pale, Munich, Hugh Baird Brown, Crystal 80 and Crystal 135, Carastan, and Beeston Pale Chocolate malts; hazelnut extract; Perle and Saaz hops. HazelNut Brown Nectar is available in a 22-ounce bottle, a special commemorative 3-litre bottle with ceramic swing-top, and on draft.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4180, 1072, 11, 113, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Honey Cream Ale is fermented warm like traditional cream ales but features an added twist--wildflower honey from Oregon. Honey imparts a dry, refreshing character to the beer because it ferments almost completely. The honey comes from a beekeeper in Blodgett, a tiny town 20 miles east of Newport. Rogues Honey Cream Ale is a light, smooth, medium bodied ale, with a creamy head, hints of honey and a crisp light finish. Brewed with two-row Harrington, Klages and Munich malts and Crystal hops. Discontined for distribution in late 2005, available on tap only at Rogue Ales Public Houses.', 'http://www.rogue.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4181, 1072, 3, 32, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Above and beyond an India Pale Ale--I2PA is radically hopped with an intense aroma and hop bitterness. Unfiltered and aged for 9 months before it leaves the brewery--not for the faint of heart. I2PA is brewed with two-row Pipkin Pale malts, Saaz, Cascade and Northwest Golding hops. I2PA is available in a new 750ml Silkscreened black ceramic bottle and on draft.', 'http://www.rogue.com', 9.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4182, 1072, 11, 126, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Juniper Pale Ale: the new package for Yellow Snow Ale (winter 2004/2005). While the recipe (a pale ale infused with whole juniper berries) on the label remain the same, the name and label are new for 2005. Juniper Pale Ale is available in the classic 22-ounce bottle and on draft.', 'http://www.rogue.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4183, 1072, 5, 67, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Half-e-Weizen (formerly Mo Ale), was inspired by, and dedicated to, Mo and Dutch Niemi, real people inspiring a real product. Mo was a restaurateur and raconteur whose clam chowder is world-famous; Dutch a leader by example for coastal fisherman. Together their spirit indelibly shapes the daily lives of the Newport, OR waterfront. Half-e-Weizen is a refreshing, unfiltered fusion of wheat and Northwest Harrington malts, coriander, ginger, and Saaz hops in the Belgium style. Half-e-Weizen is available in the classic 22-ounce bottle and on draft.', 'http://www.rogue.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4184, 1072, 2, 25, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Dedicated to the chocolate lover in each of us. Mocha Porter was once known as New Porter, in honor of the town of Newport, Oregon and home of Rogue Ales. The January/February 1995 issue of Mens Health magazine features a bottle of Rogue New Porter (todays Mocha Porter) in the Fifth Annual Collection of Good Advise, Health News, Dire Warnings, Notable Folks and Unsolicited Opinion. New Porter is described as the Best New Beer for 1994! The caption reads: "Oh, Hoppy Day: For a beer- drinking experience order up a bottle of this microbrew from Oregon.', 'http://www.rogue.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4185, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Mogul is a complex blend of 5 malts and 7 hops. This years Mogul (12/05) will only get better with time...its a hedonistic mouthful with layers of rich malt and tremendous bitterness. A quote from John "more hops" Maier, "Keep Warm, Drink Mogul ~ Prost!" This batch of Mogul was brewed with Pale, Munich, Dark caramunich, Melanoidin, and Amber malts. Moguls hops include Newport, Amarillo, Chinook, Horizon, Cascade, Centennial and Crystal...and Mogul (12/05) is dry-hopped with Amarillo and Centennial at the rate of 1 pound per barrel! Oh Hoppy Day!', 'http://www.rogue.com', 6.25, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4186, 1072, 3, 38, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Let us give praise to our maker and glory to his bounty by learning about beer." ~ Friar Tuck The debut of Monk Madness began with the Johns Locker Stock draft program before being released to the Rogue Nation in the autumn of 2006 in 22-ounce bottles and kegs. Five layers of malt create a complex, slightly sweet flavor balanced by five different hop varieties. A versatile and robust ale, we recommend pairing this with spicy foods, stong cheeses, and/or with dessert. Monk Madness Ale is brewed with 12 ingredients: 2-row Pale, Belgian Munich, Belgian Special B, Weyermann Melonodon, and Amber Malts; Belgian Nobles, Chinook, Amarillo, Centennial, and Summit Hops; along with free-range coastal water and Rogues proproetary PacMan Yeast. Available in 22 ounce bottles and kegs. Note, Monk Madness was not brewed in the winter of 2007-2008 due to shortages of the speciality malts.', 'http://www.rogue.com', 7.40, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4187, 1072, 11, 121, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'The Morimoto Black Obi Soba Ale is part of the Rogue Ales Signature Series with internationally acclaimed Chef Masaharu Morimoto--a James Beard awarded chef and one of the stars of the Food Network series, Iron Chef. Black Obi Soba Ale is dedicated to Phred Kaufmann, Rogues Distributor in Japan for the past decade--an International Rogue who runs Beer Inn Mugishutei in Sapporo (http://www.ezo-beer.com/index-e.html). Black Obi Soba is brewed with roasted buckwheat and malts (2-row pale, Munich, C-15, c-60 and Weyermann - note, this beer contains Gluten) providing a rich nut-laced flavor, while the 3 hop varieties (Horizon. Sterling and Cascade) blend to provide a refreshing zest. Morimoto Black Obi Soba Ale is packaged in a 22oz screened bottle and is available in select markets. To learn more about the Chef, visit Morimotos web page.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4188, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Imperial Pilsner, part of the Morimoto Signature Series, was launched in September 2003. The beer was selected by internationally acclaimed Chef Masaharu Morimoto--a James Beard awarded chef and one of the stars of the Food Network series, Iron Chef. Brewed with four ingredients: 100% French Pilsner Malt, 100% Sterling Hops, Free Range Coastal Water and Czech Pilsner Yeast. Imperial Pilsner is golden in color with a dry hop floral aroma and intense hop bitterness supported by a big malty backbone. Available in a swing-top 750 mil ceramic bottle and 13.2 gallon sankey kegs. To learn more about the Chef, visit Morimotos web page.', 'http://www.rogue.com', 8.80, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4189, 1072, 3, 35, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'In Britain, seasonal brews for winter are high in alcohol, robust, malty, and dark. The two main styles of these brews are Old Ales and Barleywines. As the name suggests, barleywines are similar to wines in alcohol and need aging but are derived from grain, not the grape. Rogues barleywine is described by beer expert Stuart Ramsey as: "A masterful, intense creation from brewer John Maier....it has achieved a depth and complexity usually associated with well-ages strong ales. I hope the brewery bottles some before it disappears." We call it the cognac of beers. An unfiltered and unfined Barleywine. Intense, robust, malty and dark. The cognac of beers. A hugh beer in a little bottle, this is a beer designed for sipping. Old Crustacean is brewed with eight ingredients, Great Western Harrington, Klages, Hugh Baird Carastan and Munich Malts, Chinook and Centennial Hops, free-range coastal water and PacMan yeast. Old Crustacean is best when aged for one year. Old Crustacean is available in a new 750-ml ceramic swingtop bottle (replacing the much older 7-ounce and more recent 12 ounce XS-line package) and on draft.', 'http://www.rogue.com', 11.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4190, 1072, 11, 121, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'The Morimoto Soba Ale is part of the new Signature Series of Rogue Ales, launched in the Spring of 2003 with internationally acclaimed Chef Masaharu Morimoto--a James Beard awarded chef and one of the stars of the Food Network series, Iron Chef. Soba (also known as buckwheat) is not a type of wheat but a member of the rhubard family (a fruit, not a grain!) Soba has been a longtime staple of Japanese cuisine because of its nutritional value. Buckwheat is high in potassium, phosphorous, vitamin B (50 percent more than wheat) and protein, and its virtually fat-free. The fruits of buckwheat plant are like small beechnuts, which are milled to separate the edible groats from the dark brown hulls. The groats are then roasted and used more or less like a grain (a good example is Kasha). Morimoto Soba Ale is brewed with Roasted Buckwheat, Pale malt, Munich Malt, 13-17 Carastan Malt, and Crystal Hops. (Note, this beer contains Gluten.) The flavor is unique, toasty-nutty sensation with medium body and good hop bitterness. Morimoto Soba Ale is available in a 22 ounce silkscreened bottle and 13.2 gallon sankey kegs. To learn more about the Chef, visit Morimotos web page.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4191, 1072, 3, 37, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Oregon Golden Ale is the original Rogue brew dating back to 1988 and the days of the old Ashland brewpub location (which was destroyed by a flood several years ago). Deep golden in color with a rich malty aroma. Delicately smooth and crisp flavor and an herbal finish. Oregon Golden Ale is created from Northwest Harrington and Klages, and Maier Munich Malts (18% speciality grains, .19 lbs grain per bottle). Kent Golding and Cascade hops. Oregon Golden Ale is available in a 22-ounce bottle (the 12-ounce 6-pack was phased out in early 2005), and on draft.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4192, 1072, 3, 33, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Rogues annual holiday offering, Santas Private Reserve, is a variation of the classic Saint Rogue Red, but with double the hops--including Chinook, and Centennial, and a mystery hop called Rudolph by head brewer John "more hops" Maier!This holiday elixir is brewed with two-row Harrington, Klages and Munich malts, along with Hugh Baird 30-37, Carastan 13-17, and Crystal 70-80 malts, plus free range coastal water and Johns proprietary top-fermenting Pacman yeast. Available in both 22-ounce bottles, 12oz Loose packs for Winter 2005, and 12oz six packs for 2006.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4193, 1072, 3, 42, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Stout was first introduced by Guinness in Ireland as "Extra Stout" (a stronger version of their Porter). Later, the stronger Imperial and Double Stouts emerged. Sweet, Milk, and Oatmeal Stouts are English adaptations with less alcohol and less bitter then the dry Irish Stouts. Victorian England recognized Oatmeal Stouts nutritional value and it is traditionally the drink of choice for nursing mothers and athletes. It is a beer equally at home with oysters as it is with a homemade pizza and freshly tossed green salad (or as a float over ice cream). Rogues Shakespeare Stout received a 99, the highest score of the 309 beers in 44 categories at the 1994 World Beer Championships. The June/July 1998 issue of Mens Journal included Rogue Ales Shakespeare Stout as one of "The 100 Best Things to Eat in America."Based on Stuart Kallens book, "The 50 Best Beers in the World", Shakespeare Stout was ranked the third best beer in the world and best American Beer--which makes it the Worlds Best Stout! Rogues Shakespeare Stout is ebony in color, a rich creamy head and a mellow chocolate aftertaste. It is made from Northwest Harrington, Crystal, and Chocolate malts, roasted barley and rolled oats, along with Cascade hop. Shakespeare Stout is available in the classic 22-ounce bottle, a commemorative 3-litre bottle with ceramic swing-top, and on draft.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4194, 1072, 3, 33, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', '', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4195, 1072, 3, 26, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'a special bottle dedicated to Jim Steen, member of the Professional Rodeo Coyboys Association and rogue extrodinaire.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4196, 1072, 3, 32, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Brew 10,000: One Brewer, Eighteen Years, Ten-Thousand Batches of Beer. Brew 10,000 is not so much a style of beer, rather it is a new recipe using some of the best ingredients John Maier has ever brewed with... Vienna, French Special Aroma, and Maris Otter Pale Malts; Yakima Summit and German Saphir Hops, Free-range Coastal Waters, and PacMan Yeast. Brew 10,000 was brewed only once, so its allocated and very, very limited. Its packaged in the swing-top 750-ml ceramic bottle and available only at select retailers. Note, Brew 10,000 was sold out at the brewery in early 2007, however, very limited amounts may still available in the retail trade, email Schuyler@rogue.com for a retailer near you.', 'http://www.rogue.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4197, 1072, 3, 42, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Deserving the title "Emperor of Ales" (unlike the bourgeois "King of Beers"), Imperial is the strongest and fullest of all stouts. Imperials originally were brewed with large quantities of hops and a high alcohol content to withstand long, unrefrigerated journeys. Rogue Imperial Stout, considered the high end of stouts, is made of 2-row Great Western Harrington & Klages, Hugh Baird XLT-80, Black, Munich and Chocolate Malts; Willamette, Cascade and Chinook hops; rolled oats; and two secret ingredients. Unfiltered and unfined, Imperial Stout is best when aged for one year. Imperial Stout is available in a new 750-ml ceramic swing-top bottle (replacing the much older 7-ounce and more recent 12-ounce XS-line packaging) and on draft.', 'http://www.rogue.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4198, 1072, 7, 77, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'A German style Pilsner, pale gold in color, medium bodied with a malty aroma and a crisp hop bitterness (100% Sterling hops). Uber Pils is brewed with three Great Western and two Weyermann malts, Czech Pils Yeast and Free Range Coastal Waters. UberFest Pils is available in the classic Rogue 22-ounce bottle and kegs, from late autumn through early spring. No Chemicals, Additives, or Preservatives', 'http://www.rogue.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4199, 1072, 11, 116, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'An American style wheat beer and an Issaquah Brewhouse origina. Light in color and body and served with a lemon, Bullfrog is crisp, refreshing and goes down easy. Take a flying leap! Bullfrog Ale took the Silver Medal at the 2004 Great American Beer Festival in the American Wheat category.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4226, 1255, 7, 91, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Golden, easy drinking, traditional example of Maibock. All German grains, yeast and hops.', 'http://www.thirstydog.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4227, 1255, 7, 84, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'A traditional old world German Oktoberfest made with German grains, yeast and hops.', 'http://www.thirstydog.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4200, 1072, 3, 26, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Chamomellow is an herbal golden ale infused with chamomile, which provides an enticing floral aroma. Chamomile is one of the oldest garden herbs used by ancient Egyptians and other cultures to battle illness, promote calm and relieve anxiety, hence the name Chamomellow. Dedicated to Caleb McLoughlin, a revolutionary brewer who created this elixir at Rogues Issaquah Brewhouse and won a Gold medal in the Herbs & Spice category at the 2003 Great American Beer Festival. Chamemollow is created from Northwest Harrington and Klages, and Maier Munich Malts (18% speciality grains, .19 lbs grain per bottle). Kent Golding and Cascade hops, and infused with Chamomile. Available in a limited edition 22-ounce bottles (originally as Test Batch 1 - Gold Medal Series), and on draft at Rogues six Public Houses.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4201, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', '"This aint your Dads malt liquor" - Brewmaster John Maier After the death of his wife, Henry Jackson Smart was left to raise 6 young children alone. His courage, love, selflessness and dedication inspired his daughter, Sonora Smart Dodd, to organize the First Fathers Day on June 19th, 1910. In 1924 President Calvin Coolidge proclaimed the third Sunday in June as Fathers Day. President Nixon, in 1972, established it as a permanent day of national observance. Dads is brewed with Harrington and Klages malts, Flaked Corn, Crystal Hops, Free Range Coastal Water, and Czech Pils Yeast. Available in the spring of 2005 in the classic 22-ounce Rogue micropiece.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4202, 1072, 11, 141, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'A strong, but well balanced winter warmer, this ale has extreme complexity made for a holiday feast. The addition of Raisins and Molasses in the brewing process produces unusual spiced rum like flavors to go along with the well balanced malt and hops. No Chemicals, Additives or Preservatives.', 'http://www.rogue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4203, 1072, 5, 72, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'A Belgian - Style Pale Ale. The Belgian yeast produces flavors of cloves, banana, and other spices that meld perfectly with the malt and hops. Ingredients: Pilsner Malt, Saaz Hops, Blegian Yeast, Free Range Cascade Water. No Chemicals, Additives or Preservatives.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4204, 1072, 11, 116, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Honey Orange Wheat is an unfiltered wheat beer and has flavors of honey and orange balanced with a nice medium-sweet malt character. It is medium bodied with no harsh bitterness and a nice honey-orange finish. It is made from Northwest Two-Row and Wheat Malts; Willamette Hops; #48 Oregon Wildflower Honey, Orange Juice, and Free Range Coastal Waters. It is currently available on draft.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4205, 1072, 3, 31, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'A Northwest Style IPA. Nice Balance of Malt and Hops, not too extreme in either direction. 2 Ingredients: Maris Otter Malt, Amarillo Hops.', 'http://www.rogue.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4206, 1072, 3, 33, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Imperial Red is the newest addition to Rogues award winning Imperial Family of XS products. The Imperial Red recipe originates from Rogues Eugene City Brewery and is being produced in Newport for distribution (note, initially during 2007 in kegs only to JLS accounts. A 750-ml ceramic swing-top bottle and 13.2 gallon kegs will be available in 2008.) Imperial Red has already garnered international acclaim and awards, including a Bronze Medal at the 2006 Great American Beer Festiva and recently it was named Grand Champion at the US Beer Tasting Championships! Deep copper chestnut color with toffee, brown sugar, nuts, and spice amomas. A rich supple entry leads to an off-dry medium body of tangy raisins and citrus marmalade, bittersweet chocolate, and mild spice flavors. It finishes with a long nutty, fruity fade. Imperial Red is brewed with Crystal, Chocolate, Munich and two-row Pale Malts; Palisade and Aroma Crystal hops, Pacman Yeast, and Free Range Coastal Waters.', 'http://www.rogue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4207, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'This special coffee stout includes NAFTA approved, organic, shade grown coffee beans from Costa Rica, Indonesia, and Ethiopia roasted by the brewmaster at local coffee roaster Red Twig in Edmonds, Wa. Hints of your morning cup are evident in the aroma, flavor and finish of this breakfast beer (but not just for breakfast). No Chemicals, Additives or Preservatives.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4208, 1072, 8, 95, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'In 1998 the McAleese Brothers, owners of Kells Irish Pubs in Portland, OR, Seattle, WA, and San Francisco, CA, wanted to make an American beer that would float Guinness. Gerard and Patrick McAleese asked John Maier to create a beer with a green apple bite flavor profile. It took four batches to get it just right. John used acidulated malts imported from Europe to get the crisp, lemony/apple flavor the McAleese Brothers wanted. The bottle label reflects the McAleese family heritage, puctures the Kells Irish Pub logo, and a traditional Irish flutist. The first Kells Irish Pub opened in Seattle in October 1983 in Post Alley, above the historic Pike Place Market. The restaurant will remind you of the Old Country with its warm, cozy atmosphere and traditional surroundings. Theres also a patio outside thats a great place to feel the breeze from the Puget Sound and the buzz from the Market. Kells has Seattles largest selection of Single Malt Scotch. The Kells Irish Pub in Portland is a local landmark and has been named the #1 Irish Entertainment venue in America. Sit by the fire, belly up to the bar, check out the cigar room, and dont miss the St. Patricks Day Festival, the largest Irish Fest in Oregon. The Pub in San Francisco is next to the historic North Beach neighborhood and reflects the Old World charm and hospitality the McAleese family brought with them from Ireland. Kells Irish Lager has won world-wide acclaim by winning 8 medals from the World Beer Championship and a Gold Medal at the Australian International Beer Awards. Kells Irish Lager is brewed with 7 ingredients: Great Western Pale, Crystal, Wheat and Acidulated Malts; Sterling Hops; Free Range COastal Water and Czech Pilsner Yeast.', 'http://www.rogue.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4209, 1072, 5, 61, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Belgian Style Tripel using same Abbey Yeast. Monster aromas and sweet flavors coming from the yeast and a huge amount of Belgian Candi Sugar. Ingredients: Weyermann Pilsner Malt, Belgian Candi Sugar, Saaz Hops.', 'http://www.rogue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4228, 1255, 11, 123, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Brewed with summer''s harvest of pumpkin, squash, honey, ginger, and love of great beers.', 'http://www.thirstydog.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4229, 1255, -1, -1, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Spiced for the holidays with honey, cinnamon, ginger, nutmeg and Santa''s secret recipe.', 'http://www.thirstydog.com', 7.80, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4210, 1072, -1, -1, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Rogue Smoke(previously known as Welkommen on draft) is a German style Rauchbier (Smoke Beer), which was inspired by the Fall of the Berlin Wall. Most rauch brews are bottom fermented, however Rogue Smoke, is top fermented. It is orange-amber in hue with a delicate smoke aroma and flavor with an intense hop finish. In All About Beer, August, 1995 issue, Christopher Brooks writes "Alder wood, indigenous to the Northwest, is the smoking agent, though a small amount of Bamberg malt is used in the mash, too. Beech is drier than alder, reports brewmaster John Maier, so we use a little of that for added complexity. Welkommen, a smoky, nutty ale, is also very dry, which given the 15 pounds of hops (perle and Saaz) added to each 15-barrel batch, is no surprise." The seven medals in nine years which Rogue Smoke won at theGreat American Beer Festival in Denver are also a tribute to this unusual brew. Rogue Smoke is brewed with Great Western Harrington, Klages, Munich, Hugh Baird Crystal, Carastan (30-37 and 13-17), Chucks Alderwood Smoked Munich and Bamberg Beechwood Smoked malts; plus Perle and Saaz hops. Rogue Smoke is available in the classic 22-ounce seriograph bottle (replacing the older 7 ounce bottle) and on draft.', 'http://www.rogue.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4211, 1072, 3, 31, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Offering a hop-heads paradise, this unfiltered Northwest-Style India Pale Ale introduces a big floral hop character to the aroma, flavor and finish. Hops, Hops, Hops from front to back but nicely offset with a malty richness that prevents this ale from being overbearing. Tracktown is made from 100% Floor Malted Maris Otter, 100% Northwest Amarillo Hops, Free Range Coastal Water, and absolutely No Chemicals, Additives, or Preservatives.', 'http://www.rogue.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4212, 1072, 3, 31, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Let Battle Commence... Trafalgar is a Gold Medal Award winning bottle conditioned India Pale Ale brewed to a 19th Century recipe. Listed in the Top 500 Ales in the World, Trafalgar measures 6% ABV. Brewed in the Royal Forest of Dean at Freeminer Brewery in the UK and distributed by Rogue Ales in the US. Trafalgar IPA is a true India Pale Ale, brewed to an original 19th Century recipe. IPA''s were brewed at high APV and heavily hopped to enable their preservation on the long journey to the colonies from England. This Ale is brewed from the oldest working traditional floor maltings in Warminster, Wiltshire. The hops are traditional "Goldings" variety grown around Ledbury, Herefordshire as they have been for centuries.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4213, 1072, 1, 5, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Our original Rogue Ale, Youngers Special Bitter (affectionately nicknamed YSB) is a classic English Special Bitter named after Bill Younger of the infamous Horse Brass Pub in Portland, Oregon. The Malt Advocate described Youngers Special Bitter as "rich and flavorful. A triad of caramel maltiness, fruitiness (apricots?), and hop bitterness in aroma and flavor. A fuller malt foundation than some other pale ales, with some background spiciness. Dry, hoppy finish." In the SouthWest Brewing News, Feb/March 1994 issue, George Fix wrote "A strong case could be made for Rogue Ale being included among the top 5 ales brewed in the US.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4214, 247, 1, 10, '23 Commerce Street', 'Mineral Point', 'Wisconsin', 'United States', 'To quote Dr. John Harrison, a great influence on my brewing, "Mild ale is the only beer with an uninterrupted history from medieval times to the present day." The "mild" means low hop bitterness, "...which is the only essential feature of a mild ale." They can be light or dark in color, high or low in alcohol, dry or sweet. This is difficult for modern style wiennies to grasp. How can one style be so many things? How can I judge it good or bad?. The current Brewery Creek Dark Mild is medium brown, soft hops and about 3.5% abv. It could be a bit more estery. It is a lovely style.', 'http://www.brewerycreek.com/', 3.50, 0.00, 0.00, 0, '9999-01-01', '42.8606, -90.1772', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4215, 247, 3, 42, '23 Commerce Street', 'Mineral Point', 'Wisconsin', 'United States', '"Guinness" is the prototype of all modern stouts. Many people, however, don''t realize that there are different varieties of "Guinness" brewed around the world. "Draught Guinness* and "Foreign Extra Stout" are the two primary types brewed in Ireland. Foreign Extra is the one I have emulated. It is closer in style to the London Porters of old than to modern stout. Very dark and rich, not as dry as Draught, about 6% abv and around 60 IBUs (that''s hop bitterness). I used "First Gold" hops because that''s what I could get. Guinness use Nitrogen mixed with carbon dioxide to dispense their stout which adds to the creamy mouth-feel. BTW: The "Imported" Guinness you buy here in the US comes from Canada. It could just as well be brewed in the US but the common wisdom in the brewing world is that Americans prefer "imported" beers and will pay more for them.', 'http://www.brewerycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.8606, -90.1772', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4216, 1255, 3, 37, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'A blonde ale that is very light in color and body with no bitterness. A thirst quenching, American light-bodied blonde ale.', 'http://www.thirstydog.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4217, 1255, 3, 33, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'The complex charactor of American hops and amber colored caramel malts make it crisp & refreshing.', 'http://www.thirstydog.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4218, 1255, 3, 43, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Imperial Stouts are by far the "GRAND - DADDY" of all stouts. For those who demand flavor, this is the perfect libation.', 'http://www.thirstydog.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4219, 1255, 2, 25, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'A robust porter, dark brown in color and full bodied with a malty sweet taste.', 'http://www.thirstydog.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4220, 1255, 11, 121, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'The inviting flavor and aroma of freshly picked raspberries is naturally infused in this unique, refreshing fruit beer. Raspberry Ale is brewed in the typical Thirsty Dog fashion, full of flavor and uninhibited', 'http://www.thirstydog.com', 3.90, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4221, 1255, 1, 15, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Caramelized sugars lend a unique flavor and aroma to this lightly hopped, malty smooth, Scottish Export Ale.', 'http://www.thirstydog.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4222, 1255, 5, 61, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'This beer is made with one grain and 4 Belgian yeasts, a deceptive golden color, and a malty palate lend complexity to this Belgian Trippel Ale.', 'http://www.thirstydog.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4223, 1255, 5, 60, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'Orthus was the two-headed hell hound brother of Cerberus, the three-headed dog that guarded the gates of hell. Orthus is a Belgian Dubbel brown in color, 7 grains, 3 hops, Trappist high gravity yeast. Very Drinkable.', 'http://www.thirstydog.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4224, 1255, 8, 95, '529 Grant St. Suite B', 'Akron', 'Ohio', 'United States', 'A Traditional German Lager brewed with all German grain & yeast. Very drinkable.', 'http://www.thirstydog.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.0689, -81.5172', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4230, 643, 1, 21, '', 'New York', 'New York', 'United States', 'Hearty, creamy oatmeal stout has hints of espresso and an elegant dark chocolate sweetness. Flavor and aroma are characteristic of Espresso and Dark Chocolate. It has a rich, silky, full, and complex body with a long, rich, smooth finish.', 'http://www.heartlandbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.7323, -73.9874', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4231, 905, 3, 33, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Named in honor of our founder Jeff''s bike trip through Belgium, Fat Tire Amber Ale marks a turning point in the young electrical engineer''s home brewing. Belgian beers use a far broader pallet of ingredients (fruits, spices, esoteric yeast strains) than German or English styles. Jeff found the Belgian approach freeing. Upon his return, Jeff created Fat Tire and Abbey Belgian Ale, (assuming Abbey would be his big gun). He and his wife, Kim traveled around sampling their homebrews to the public. Fat Tire''s appeal quickly became evident. People liked everything about it. Except the name. Fat Tire won fans is in its sense of balance: toasty, biscuit-like malt flavors coasting in equilibrium with hoppy freshness.', 'http://www.newbelgium.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4232, 5, -1, -1, 'Dinant', 'Dinant', 'Namur', 'Belgium', 'Dark brown with a nice tan head. Sweet and aromatic. Smooth and best served cold from a goblet or chalice. I have had this on tab, in a 12oz bottle and 1 liter bottle. It is very common on to be on tap in Belgium and Paris as well as in a bottle in the UK. I have not seen it in the US nor can I find a distributor that could get it.', '', 6.80, 0.00, 0.00, 0, '9999-01-01', '50.2606, 4.9122', '2018-10-05');
