INSERT INTO beerbuddies_db.beer VALUES (4234, 343, 3, 42, 'The Goods Store, Station Road', 'Carlow', '', 'Ireland', 'Unlike the image, does not have the creamy head like many Irish stouts (Beamish, Guinness, Murphys) and as a result lighter on the stomach and nice with a meal. Very distinctive taste which may put off those not accustomed to drinking stouts.I would recommend it for the more adventurous pallette. Roast barley comes through in the taste.', 'http://www.carlowbrewing.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '52.7196, -6.846', '2018-10-05');
