INSERT INTO beerbuddies_db.beer VALUES (4238, 1357, 3, 26, '8149 Honeygo Blvd', 'White Marsh', 'Maryland', 'United States', '2007 Maryland Governor''s Cup Bronze Medal: A golden colored ale with crisp malt character and a slightly spicy hop aroma. We use a good amount of wheat and some German malt in this one to give it a very refreshing taste. Avenue Ale is a true session beer, so sit down and prepare for a long one.', 'http://www.redbrickstation.com/', 4.10, 0.00, 0.00, 0, '9999-01-01', '39.3722, -76.4638', '2018-10-05');
