INSERT INTO beerbuddies_db.beer VALUES (4240, 423, 1, 4, '38 Evergreen Drive', 'Portland', 'Maine', 'United States', '"A classic British pale ale with a nod to the legendary beers of Burton-on-Trent. Copper-colored, dry, clean and crisp with lots of late hope taste in an appetizing complex with ale fruitiness from imported Hampshire yeast." ~ http://www.gearybrewing.com/pages/pale.php', 'http://www.gearybrewing.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.7076, -70.3149', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4241, 650, 7, 90, 'Dominikanerstrae 6', 'Bamberg', 'Bayern', 'Germany', 'A smoked bock beer for Bamberg''s strong beer season (October through December). Matured for months in ancient rock-cellars underneath Bamberg and tapped freshly from the oakwood cask. Similar to, but much bigger than the classic Maerzen style.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '49.892, 10.8853', '2018-10-05');
