INSERT INTO beerbuddies_db.beer VALUES (4243, 616, 11, 116, 'Brouwerslaan 1', 'Enschede', 'Overijssel', 'Netherlands', 'Grolsch Premium Weizen is the main wheat beer made by Grolsch. It is made according to the German Reinheitsgebot ("German Beer Purity Law"), meaning that it is made exclusively with (wheat)malt, water, hoppes and barley.', 'http://www.grolsch.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '52.2081, 6.8163', '2018-10-05');
