INSERT INTO beerbuddies_db.beer VALUES (4245, 616, 7, 77, 'Brouwerslaan 1', 'Enschede', 'Overijssel', 'Netherlands', 'Grolsch Speciale Pilsner is a special version of the Grolsch Premium Pilsner. It has a fruitier taste than the Premium Pilsner.', 'http://www.grolsch.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '52.2081, 6.8163', '2018-10-05');
