INSERT INTO beerbuddies_db.beer VALUES (4247, 713, 3, 29, 'Castle Brewery', 'Cockermouth', 'Cumbria', 'United Kingdom', 'A dark beer with a reddish tinge derived from the use of coloured malts, full of complex flavours, which create an intriguing beer of great character. In Northern English dialect sneck means door latch and a sneck lifter was a manâ€™s last sixpence which enabled him to lift the latch of a pub door and buy himself a pint, hoping to meet friends there who might treat him to one or two more.', 'http://www.jenningsbrewery.co.uk/', 5.10, 0.00, 0.00, 0, '9999-01-01', '54.6649, -3.3634', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4248, 378, -1, -1, 'Route de Charlemagne 8', 'Chimay', '', 'Belgium', 'Named Grande RÃ©serve in 75 cl (25.4 fl.oz.) bottles, it is principally distinguished by its character of a strong beer. This is a beer whose fragrance of fresh yeast with a light, flowery rosy touch is especially pleasant. Its flavour, noticed when tasting it, only accentuates the pleasant sensations perceived in the aroma , while revealing a light but pleasant touch of roasted malt. This top fermented Trappist beer , refermented in the bottle, is not pasteurised.', 'http://www.chimay.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '50.0355, 4.3777', '2018-10-05');
