INSERT INTO beerbuddies_db.beer VALUES (4295, 328, 3, 26, '540 Clover Lane', 'Ashland', 'Oregon', 'United States', 'Available in 12 oz. cans and kegs. A West-Coast-style pale ale balancing plenty of hops with a malty backbone.', 'http://www.calderabrewing.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.1844, -122.663', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4256, 1298, 5, 74, '30 Butterfield Road', 'Warrenville', 'Illinois', 'United States', 'Domaine DuPage is a rural, northern France, amber colored ale. This well balanced beer is full and sweet up front with caramel, toasty, and fruity characters. The finish has a gentle floral and spicy hop balance that cleanses the palate.', 'http://www.twobrosbrew.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '41.8206, -88.2068', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4257, 1298, 3, 26, '30 Butterfield Road', 'Warrenville', 'Illinois', 'United States', 'Very drinkable light golden ale. Extremely refreshing hop finish', 'http://www.twobrosbrew.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '41.8206, -88.2068', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4258, 765, 3, 31, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '', 'http://www.lagunitas.com/', 8.40, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4259, 55, -1, -1, '15 Knox Rd.', 'Bar Harbor', 'Maine', 'United States', 'A good, clean nutbrown ale with a malty body. This is our most popular ale due to its smooth and malty flavor. We use a mixture of pale, crystal and black malts in this one, and our primary hop is Target, though we also add some Whitbread Goldings Variation as well. The Real Ale is best fresh, so fresh in fact, that it''s great right out of the bright tank.', 'http://www.atlanticbrewing.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.3996, -68.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4260, 656, 8, 95, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'From the Brewer''s Website: The Dundee family began with Honey Brown Lager in the early 1990''s during the height of the craft brewing resurgence. Introduced by then brewery head Jack "JW" Wehle, Honey Brown was a full bodied lager brewed with natural honey provided by Wixon''s Farm in the Finger Lakes town of Dundee, New York. The brand was an overwhelming success that defied definition as a style and grew to tremendous acclaim, garnering several medals at the World Beer Cup and the Great American Beer Festival.', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4261, 1031, 4, 50, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Brewed by the original Wheat Beer Pioneers, Pyramid Apricot Weizen Ale is left unfiltered for extra flavor and aroma. The gold medalist of fruit beers, Pyramid Apricot Weizen is an adventurous wheat ale that offers the pleasing aroma and flavor of fresh apricots, and smooth and refreshing character for which our wheat beers are known. Original Gravity: 11.75 Alcohol By Volume: 5.10% Malts: 2-Row Barley, Malted Wheat, Caramel Hops: Nugget Availability: Year Round Best Paired With: Appetizers, salads, and desserts such as pies and pastries. Best of the Northwest/Pacific in the "Fruit Beer" category at the 2000 United States Beer Tasting Championship, 2000 Gold Medal, GABF, "Fruit and Vegetable Beers", 1994', 'http://www.pyramidbrew.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4262, 198, 1, 21, '5080 Rue St-Ambroise', 'Montreal', 'Quebec', 'Canada', '', 'http://www.mcauslan.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '45.4682, -73.5913', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4263, 198, 11, 116, '5080 Rue St-Ambroise', 'Montreal', 'Quebec', 'Canada', 'Apricot Wheat Ale blends various barley malts with malted wheat and natural apricot essence to create an original-tasting beer with a clean, fruit nose. 5% alc/vol Available in Bottles and Draft', 'http://www.mcauslan.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '45.4682, -73.5913', '2018-10-05');
