INSERT INTO beerbuddies_db.beer VALUES (4267, 226, 7, 86, 'Am Brauhaus 8b', 'Dresden', 'Sachsen', 'Germany', 'dark, bottom-fermented, more on the sweet side, made of 100% barley malt according to ther description, very good to meat', 'http://www.waldschloesschen.de', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4268, 161, 11, 116, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Boulevard Unfiltered Wheat Beer is a lively, refreshing ale with a naturally citrusy flavor and distinctive cloudy appearance. This easy-drinking American-style wheat beer has become our most popular offering, and the best-selling craft beer in the Midwest.', 'http://www.blvdbeer.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4269, 130, -1, -1, '2598 Telegraph Avenue', 'Berkeley', 'California', 'United States', '"This richly textured, roasty dry stout has a boost of bitter and charismatic flavor from the addition of cocoa powder in the mash. We blend five unique organic malts to create Bison''s most award winning beer." from http://bisonbrew.com/chocolate-stout.asp And I concur. This is a relatively mild stout, with a malty rich flavor. Adding this to my list of preferred beers.', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.8634, -122.259', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4270, 1142, 2, 25, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Dark and rich, Sierra Nevada Porter is a delicious, medium-bodied ale with a creamy head. The Porterâ€™s smooth flavor (malty with hints of caramel) comes from a blend of deep-roasted barley malts. â€œâ€¦there can be little doubt that this is one of the best porters being brewed anywhere in the world today.â€ â€” Christopher Finch, A Connoisseurâ€™s Guide to the Worldâ€™s Best Beer FIRST PLACE California Brewers Festival (Robust Porter: 2000) Colorado State Fair (Porter: 1996)', 'http://www.sierranevada.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4271, 1142, 3, 26, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Our most popular beer, Sierra Nevada Pale Ale, is a delightful interpretation of a classic style. It has a deep amber color and an exceptionally full-bodied, complex character. Generous quantities of premium Cascade hops give the Pale Ale its fragrant bouquet and spicy flavor. â€œSierra Nevada Pale Ale is the flagship beer, the one that made Chico famous. It is a flawless beer that opens with bright, perky high notes of maltiness and orange blossom and segues into a delectable hoppiness.â€ â€“ Elaine Louie, Premier Beerâ€”A Guide to America''s Best Bottled Microbrews GOLD MEDAL WINNER Great American Beer Festival (American Pale Ale: 1995, 1994, 1993; Classic English Pale Ale: 1992; Pale Ale: 1990, 1989, 1987)', 'http://www.sierranevada.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4272, 1142, 11, 116, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Pale, smooth, and light-bodied, Sierra Nevada Wheat Beer is brewed from premium malted wheat and light barley malts, utilizing our traditional ale yeast. This unfiltered ale is finished with the characteristically spicy Strissel Spalt hops from the Alsace region of France. â€œThe lightest Sierra Nevada beer is this refreshing wheat beer made with barley & wheat for a very light character but loads of flavor!â€ â€“ BevMo.com SILVER MEDAL WINNER California State Fair (American Wheat: 2000)', 'http://www.sierranevada.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4296, 360, 8, 95, 'Av.Alfonso Reyes Norte No.2202', 'Monterrey', 'Nuevo Leon', 'Mexico', '', 'http://www.ccm.com.mx/', 4.50, 0.00, 0.00, 0, '9999-01-01', '25.7091, -100.314', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4498, 1086, 5, 72, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Damnation has extraordinary aromas of banana and pear with mouth filling flavors of sweet malt and earthy hops. The lingering finish is dry and slightly bitter but very, very smooth.', 'http://www.russianriverbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4273, 1142, 3, 42, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Creamy, malty, and full-bodied, the Sierra Nevada Stout is satisfyingly rich. Caramel and Black malts give the Stout its deep, dark color and pronounced roasted flavor. â€œSierra Nevada Stout is admirable from nose to finish, with notes of malty sweetness to the palate but plenty of bitterness available to set up a stimulating counterpoint.â€ â€“ Christopher Finch, A Connoisseurâ€™s Guide to the Worldâ€™s Best Beer GOLD MEDAL WINNER California State Fair (Stout, Sweet & Foreign: 2000)', 'http://www.sierranevada.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4274, 1142, 3, 26, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Our ESB combines the best of English tradition with West Coast style. A blend of malts featuring British-grown Maris Otter is balanced with the earthy spiciness of hand-selected English and US hops. The ale is left unfiltered, which enhances mouthfeel and hop aroma creating a slightly reddish-copper hue', 'http://www.sierranevada.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4275, 1142, 7, 77, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Our Summerfest® is a refreshing, pilsner-style lager. Its incredible smoothness comes from an extra-long lagering period. Lighter in body than our ales but just as complex in character, Summerfest® quenches your thirst with big aroma and a tangy hop bite. GOLD MEDAL WINNER California State Fair (European Light Lagers: 1999)', 'http://www.sierranevada.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4276, 1142, 3, 31, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: Each fall we celebrate our anniversary as one of Americaâ€™s craft brewing pioneers with a special beer. This year, in celebration of our 27th year, we have made this beer available to the public for the first time, and aptly named it Anniversary Ale. Anniversary Ale is an American-style IPA featuring Cascade hops, the signature hop used in our Pale Ale. The beer has a pronounced pine and citrus hop aroma balanced by the sweetness of two-row pale and caramel malts. The result is an unusually well-balanced IPA that proves an IPA can be both assertive and elegant. Anniversary Ale is a medium-bodied, well-hopped ale that finishes with a slight malt sweetness.', 'http://www.sierranevada.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4277, 1142, 3, 31, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: The long, cold nights of winter are a little brighter with Celebration® Ale. Wonderfully robust and rich, Celebration® Ale is dry-hopped for a lively, intense aroma. Brewed especially for the holidays, it is perfect for a festive gathering or for a quiet evening at home.', 'http://www.sierranevada.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4278, 1142, 3, 35, '1075 East 20th Street', 'Chico', 'California', 'United States', 'From the Sierra Nevada Brewing Co. website: This year marks the 25th release of Bigfoot®. Our award-winning barleywine boasts a dense, fruity bouquet, an intense flavor palate and a deep reddish-brown color. Its big maltiness is superbly balanced by a wonderfully bittersweet hoppiness.', 'http://www.sierranevada.com/', 9.60, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
