INSERT INTO beerbuddies_db.beer VALUES (4282, 23, 5, 67, '100 Industrial Way', 'Portland', 'Maine', 'United States', 'Our interpretation of a traditional Belgian wheat beer, Allagash White is unique and truly refreshing. Brewed with a generous portion of wheat and our own special blend of spices, this beer is light and slightly cloudy in appearance, with a spicy aroma. Overall, it is a beer that is very drinkable and smooth any time of the year. Available in: 12 oz and 750 ml bottles, 15.5 and 5.17 gal kegs ABV: 5.0% Original Gravity: 1048 Recommended Serving Temp: 34Â°F to 50Â°F', 'http://www.allagash.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.7028, -70.3166', '2018-10-05');
