INSERT INTO beerbuddies_db.beer VALUES (4297, 10, 11, 116, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Purple Haze is a crisp, American style wheat beer with raspberry puree added after filtration. Therefore, you may see raspberry pulp in the beer. The raspberries provide the lager with a subtle purple coloration and haze, a fruity aroma, and a tartly sweet taste.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
