INSERT INTO beerbuddies_db.beer VALUES (4299, 1048, 8, 95, '6901 Konica Drive', 'Whitsett', 'North Carolina', 'United States', 'Red Oak Amber is a Munich Urtyp (Old Style) Lager. We begin the brewing process with custom kilned imported Munich Malt. Red Oak is then hopped with Spalt Noble Hops imported from Bavaria, the oldest hop growing region in the world. Before fermentation we add a yeast strain from Weihenstephen, the oldest brewery in the world, founded before 1040 AD. Weeks of aging gives Red Oak the smooth taste it is known for.', 'http://www.redoakbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '36.0613, -79.5695', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4300, 1048, 7, 90, '6901 Konica Drive', 'Whitsett', 'North Carolina', 'United States', 'Battlefield Bock is a smooth and creamy Bavarian Style Bock Lager. It is brewed with our proprietary blend of Bavarian Dark Roasted Malts giving it a distinct taste with hints of coffee and chocolate. We add Noble Czech Saaz Hops to balance the flavor of this rich full bodied lager. Battlefield Bock is slow cold aged for a minimum of 8 weeks.', 'http://www.redoakbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '36.0613, -79.5695', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4301, 1048, 8, 96, '6901 Konica Drive', 'Whitsett', 'North Carolina', 'United States', 'Hummin'' Bird is a Light Lager or Hell (Helles) similar to those found throughout Bavaria. We use carefully selected Pilsner Maltâ€¦then it is delicately hopped with imported Tettnang Noble Hops. Then we add a proprietary lager yeast strain which is not filtered out providing ones daily supply of vitamin B. Hummin'' Bird is slow-cold aged for over one month resulting in a lush mouth feel.', 'http://www.redoakbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '36.0613, -79.5695', '2018-10-05');
