INSERT INTO beerbuddies_db.beer VALUES (4309, 698, 8, 95, '3340 Liberty Ave.', 'Pittsburgh', 'Pennsylvania', 'United States', 'Iron City has been the â€˜Burghâ€™s signature beer since 1861. This premium lager has become a proud tradition of the city and its people. Just try to imagine a Pittsburgh football, baseball or hockey game without an ice cold Iron. We still brew Iron City fresh daily â€“ but now, instead of delivering it to Pittsburgh neighborhoods in horse-drawn buggies, we deliver it to your favorite hangouts. You can get an Iron at national restaurant chains, upscale eateries, and â€“ of course â€“ your favorite local bar. You can also find it at more than 330 regional beer distributors. Because Iron City is brewed locally, it goes from the brewery to you within a matter of days. You wonâ€™t find a fresher beer anywhere in Pittsburgh!', 'http://www.ironcitybrewingcompany.com/Default.aspx', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.461, -79.9653', '2018-10-05');
