INSERT INTO beerbuddies_db.beer VALUES (4312, 1361, 4, 50, '929 North Russell Street', 'Portland', 'Oregon', 'United States', '"A golden unfiltered wheat beer that is truly cloudy and clearly superb. Ever since Widmer introduced Hefeweizen to America in 1986, ours has been the standard by which all other Hefeweizens are judged. 1998 and 2006 GABF Gold Medal Award Winner 2004 Gold Medal Beer Cup', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '45.5408, -122.676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4313, 1361, 3, 31, '929 North Russell Street', 'Portland', 'Oregon', 'United States', '"Broken Halo IPA is a beer produced in the spirit of traditional IPA products shipped from the UK to India in the late 1800s. The almost excessive amounts of Cascade and Columbus hops used in Broken Halo give it notable citrus and grapefruit aromas and flavors. The beer bitterness measures high but tastes smooth due to the full-bodied, Caramel malt sweetness. The finish is juicy, clean, and short lived. A devilishly bold, heavenly smooth India Pale Ale.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '45.5408, -122.676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4314, 1361, 3, 33, '929 North Russell Street', 'Portland', 'Oregon', 'United States', '"A rich, flavorful Amber that''s smooth and easy to drink. Drop Top is fermented by an American Ale yeast to produce beer with a clean flavor and fruity aroma. The velvet texture is from using Honey malt and a touch of milk sugar. The Alchemy bittering hops provide soft bitterness. Simcoe, a newly developed hop variety, adds unique hop flavor and aroma. 2004 GABF Gold Medal Award Winner', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '45.5408, -122.676', '2018-10-05');
