INSERT INTO beerbuddies_db.beer VALUES (4316, 1361, 11, 116, '929 North Russell Street', 'Portland', 'Oregon', 'United States', '"Our Brewmasters'' Release - The three different red, caramelized, and dark wheat malts give this beer an intense red color that runs as deep as the flavor. The toasted grain flavors blend perfectly with the subtle spiciness of the hops just as the entirety fades to a smooth quick finish. 2007 Great American Beer Festival Silver Medal Award Winner.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '45.5408, -122.676', '2018-10-05');
