INSERT INTO beerbuddies_db.beer VALUES (4318, 83, 8, 95, '544B W. Liberty St.', 'Cincinnati', 'Ohio', 'United States', 'Frank Duveneck was a famous Cincinnati painter who produced such masterpieces as Whistling Boy andOld Man In a Fur Cap. Our Dortmunder is a medium- bodied golden lager showcasing a delicious malt profile balanced with Noble German hops. This beer is designed to satisfy even the stodgiest of old beer curmudgeons!', 'http://www.barrelhouse.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '39.1136, -84.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4319, 83, 3, 26, '544B W. Liberty St.', 'Cincinnati', 'Ohio', 'United States', 'Early Cincinnati brewers shipping their beers into Tennessee would generously hop their beer to prevent spoilage during the long arduous trip over the Cumberland Trail. This classic interpretation of the American Pale Ale features a solid foundation of pale malt loaded with fresh Cascade hops. Hereâ€™s to getting where youâ€™re going!', 'http://www.barrelhouse.com', 4.60, 0.00, 0.00, 0, '9999-01-01', '39.1136, -84.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4320, 83, 3, 33, '544B W. Liberty St.', 'Cincinnati', 'Ohio', 'United States', 'In the old days, runners who made it to third base were rewarded with a mug of beer! This is the way the game was meant to be played; pitchers throwing side- armed and a half barrel on the field. Our Red Legg Ale is an American Amber Ale with a rich, malty flavor, slightly sweet on the finish. An All-Star in any line- up!', 'http://www.barrelhouse.com', 4.90, 0.00, 0.00, 0, '9999-01-01', '39.1136, -84.526', '2018-10-05');
