INSERT INTO beerbuddies_db.beer VALUES (4336, 708, 11, 116, '1 Jefferson Avenue', 'Chippewa Falls', 'Wisconsin', 'United States', 'Get a taste of the freshest flavor under the sun - Leinenkugelâ€™s Summer Shandy. A shandy is a lemonade flavored beer, a European favorite during the warmer months. And the light, crisp flavor makes it a great summer refresher. Each batch is carefully brewed using the finest wheat, malted barley and just a hint of real Wisconsin honey. Then, our brewmasters mix in fresh lemonade and citrus flavors to create an adventurous taste thatâ€™s perfect for those lazy days of summer.', 'http://www.leinie.com/welcome.html', 4.20, 0.00, 0.00, 0, '9999-01-01', '44.9449, -91.3968', '2018-10-05');
