INSERT INTO beerbuddies_db.beer VALUES (4345, 959, 3, 38, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Copper Ale, a medium bodied, amber ale inspired by the Altbiers of Northern Germany. Brewed with six different malts, three hop varieties and our special house yeast, Copper Ale is characterized by a well-balanced blend of malty notes and mild bitterness.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4346, 959, 7, 84, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Oktoberfest is our version of the perennial favorite Bavarian Autumn beer. Oktoberfest''s deep golden hue helps bring to mind the old country and its time honored traditions. Brewed with Hallertau and Tettnang hops to balance its clean, malty sweetness, it''s the perfect brew for a crisp Autumn day. Available from August to November.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4368, 605, 5, 72, '2516 Market Avenue', 'Cleveland', 'Ohio', 'United States', 'A Belgian Wit Ale spiced with orange peel, chamomile and coriander.', 'http://www.greatlakesbrewing.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '41.4844, -81.7042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4369, 605, -1, -1, '2516 Market Avenue', 'Cleveland', 'Ohio', 'United States', 'A holiday ale brewed with honey and spiced with fresh ginger and cinnamon. Availability, November to December.', 'http://www.greatlakesbrewing.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '41.4844, -81.7042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4370, 605, 3, 42, '2516 Market Avenue', 'Cleveland', 'Ohio', 'United States', 'A smooth and creamy medium-bodied stout with soft malty notes and dry finish.', 'http://www.greatlakesbrewing.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '41.4844, -81.7042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4347, 41, 3, 42, '17700 Boonville Rd', 'Boonville', 'California', 'United States', 'With its deep, dark brown-black color, thick, full-bodied, velvety-smooth mouth feel, mocha character, and, strong yet subtle hop bite, Barney Flats Oatmeal Stout is one of the thickest, richest, and most complex stouts on the market today. In 1990, it became our first gold medal winner, at the Great American Beer Festival. Barney Flats was judged so superior to the other stouts that no other medals were even awarded in its catagory. Try it and see why Stewart Kallen described it as, "Slippery, creamy, dark, and sweet as a Pacific May morning," in his book, The 50 Greatest Beers in the World Barney Flats Oatmeal Stout Most recently won the Silver Medal at the 2004 World Beer Cup® and the Bronze Medal at the 2004 GABF , as well as several other medals . Click the blue ribbon to see the entire list. As with all of our products, Barney Flats Oatmeal Stout is never sterile filtered nor heat pasteurized, and should be stored in refrigeration. However, to fully enjoy its rich and complex flavor, it should be served between 40° and 45°F', 'http://avbc.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '39.0014, -123.356', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4348, 959, 3, 33, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Pale Ale is a golden amber brew, made with Cascade hops from the Yakima Valley. Adding Cascades during conditioning captures the rich aroma of the hop, and completes the clean, well-balanced flavor of our American pale ale. Crisp, refreshing, exotically aromatic, and available all year.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4349, 959, 2, 25, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Stovepipe Porter is made in the traditional porter stlye, and is a favorite with all porter lovers. Ruby-black in color, Stovepipe Porter has a rich palate and a roasted, hoppy aroma. It is delicious on its own or with a meal, and tastes great with chocolate.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4350, 959, 5, 67, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'White Sail is a Belgian-style white beer, craft brewed with wheat, malted barley, hops, and a little bit of coriander and orange peel. It is mild yet flavorful, with fruity undertones and a haze from the yeast and wheat. This ale is delicious on its own, or with a slice of orange.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4351, 959, 8, 95, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'A classic European style lager. We take the time to brew this beer as a true lager should be brewed. And it''s well worth the wait! You can enjoy the drinkability of this light-gold, refreshing beer with friends at the pub or at home after a long day.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4352, 801, 4, 57, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'Long Trail Ale is a full-bodied amber ale modeled after the "Alt-biers" of DÃ¼sseldorf, Germany.', 'http://www.longtrail.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4353, 801, 3, 31, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'The first IPAs were unfiltered and featured extra hops and higher strength as a preservative for the long trip from England to the colony of India. Our Traditional IPA is naturally carbonated, dry-hopped & unfiltered like the old days.', 'http://www.longtrail.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4354, 801, 5, 60, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'This malty, full-bodied double alt is also know as "Stickebier" - German slang for "secret brew". Double Bag was originally offered only in our brewery taproom as a special treat to our visitors.', 'http://www.longtrail.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4355, 801, 4, 50, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'Here is our "Wheat Beer with Yeast", or Hefeweizen. Beers brewed with a high proportion of wheat yield a crisp and refreshing flavor profile, while the addition of our special yeast adds a blend of complex citrus and spice flavors.', 'http://www.longtrail.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4356, 801, 3, 38, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'A light & malty experience modeled after one of our favorite old style English brews.', 'http://www.longtrail.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4357, 801, 1, 15, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'This robust and malty brew will take the bite from a cold winter night.', 'http://www.longtrail.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4358, 801, 11, 116, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'Light & refreshing with a hint of blackberry at the finish makes this beer a real thirst quencher. For the health conscious, Blackbeary Wheat has less than 6 grams of carbs and contains 0 fat.', 'http://www.longtrail.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
