INSERT INTO beerbuddies_db.beer VALUES (4360, 801, 5, 67, 'Route 4 & 100A', 'Bridgewater Corners', 'Vermont', 'United States', 'Our Belgian White Ale is modeled after the original Belgian Witbiers brewed in monasteries during the early 14th century. The soft notes of citrus and spice are topped with a light, fluffy head that finishes clean and crisp. This all natural ale is our latest seasonal brew, perfect for lounging lake-side or celebrating at trail''s end.', 'http://www.longtrail.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '43.5882, -72.6563', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4361, 1307, 5, 61, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'La Fin du Monde has a brilliant golden color with vigorously effervescent foam. It is midly yeasty with a complex palate of malt, fruit and spice notes followed by a smooth, dry finish.', 'http://www.unibroue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4362, 963, 8, 96, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', '"Lone Star Light mimics its full-bodied counterpart with an award winning premium light taste. This beer retains the complimentary ratio of barley, cereal grains, and hops of its parent brand.";"0', 'http://www.pabst.com/', 3.85, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
