INSERT INTO beerbuddies_db.beer VALUES (4371, 618, 8, 95, '', 'Mexico City', '', 'Mexico', 'Negra Modelo has long been the dark beer alternative for Mexican beer drinkers. It has been identified as one of the few surviving examples of Vienna style lager - a style that was largely replaced in European breweries with Oktoberfest, a slightly lighter lager, in the early twentieth century. Negra Modelo pours with an off-white, medium head. The body is clear with a rich amber/copper color. The aroma is sweet with hints of apple. The impression at the first sip is sweet. This gives way only a bit to some hops bitterness which gives some balance but leaves the beer firmly in the sweet category. It has no real lager snap at the end, just lingering hops. This actually makes the second sip more balanced than the first. There is some complexity and depth here but the flavors are very delicate. They are obliterated by the aggressive flavors of the Mexican food that Modelo is often served with making it a sweet balance to the savory and sometimes hot cuisine.', 'http://www.gmodelo.com.mx/', 6.00, 0.00, 0.00, 0, '9999-01-01', '19.427, -99.1276', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4372, 127, 7, 90, 'Viale Venezia 9', 'Udine', '', 'Italy', 'Birra Moretti La Rossa is a double boch beer produced using high quality 100% malted barley, giving it a rich sweet taste and an intense fragrance of roasted malt. The amber color that characterizes the beer, comes from the kind of malt used in the recipe (malt is dried, roasted barley). Another key ingredient is hops, the variety used is particularly aromatic, giving a characteristic bitter aftertaste and a delicate fragrance to the beer. The Master Brewers advise a service temperature between 10Â° and 12Â° C.', '', 7.20, 0.00, 0.00, 0, '9999-01-01', '46.0597, 13.2269', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4373, 586, 1, 21, '1800 West Fulton Street', 'Chicago', 'Illinois', 'United States', '', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.8871, -87.6721', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4374, 963, 8, 95, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'The National Beer of Texas "Lone Star beer uses the finest hops from the Pacific Northwest with hearty grains from the Central and Northern Plains. The GABF recognized Lone Star as a high quality American Cream Lager by awarding it with a silver medal. Malted barley and corn extract combine to provide Lone Star with nature''s finest ingredients for brewing. Lone Star''s ingredients give this beer its full natural flavor. The choicest hops lend complexity and aroma to this beer, and its proprietary mashing regimen creates the perfect balance of alcohol, body, and character.', 'http://www.pabst.com/', 4.65, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4375, 1258, 2, 22, '16 Tobey Road', 'Bloomfield', 'Connecticut', 'United States', 'Thomas Hooker''s traditional Irish-Style Red Ale gets its warm, ruby color from an interesting blend of pale, caramel and roasted malts which promote a sweetness that''s balanced with crisp, authentic, English-style hops. A very unique and drinkable red ale that''s also favored by amber lovers. Hooker Irish Red is drinks well year-round, not just on St. Paddy''s day.', 'http://www.hookerbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '41.8087, -72.7108', '2018-10-05');
