INSERT INTO beerbuddies_db.beer VALUES (4377, 44, 8, 96, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Introduced in 1989 Bud Dry is the first dry-brewed beer produced by an American brewer. It is brewed with select hops, grains and barley malt, which results in a lighter body and less-sweet taste. As with all Anheuser-Busch beers, it is cold-filtered for a smooth draft taste, but then goes through a second cold-filtered finishing process to provide its unique taste.', 'http://www.anheuser-busch.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
