INSERT INTO beerbuddies_db.beer VALUES (4433, 1195, 8, 95, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'Every year in Vancouver there are a few days when the air is cool & crisp, the sun shines brightly, and the leaves show their vibrant colours -- then it starts to rain incessantly. Anyway, our Cascadia Cream Ale is dedicated to the spirit of mountains, oceans, golden days and gentle mist. Caramel and honey malts lend this ale a mellow, grainy maltiness which is balanced by the subtle presence of English finishing hops. Cheers, our Cascadia Cream Ale will be sure to brighten up even the wettest West Coast day.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4395, 304, -1, -1, 'Lindenlaan 25', 'Ertvelde', 'Oost-Vlaanderen', 'Belgium', 'Gulden Draak is a beer in a class of its own. It is a beer that is rich and glowing, so full of its very own characteristic flavour, that it reminds some who try it of chocolate and others of coffee. In 1998 Gulden Draak was crowned â€œbest beer in the worldâ€ by the American Tasting Institute! This beer has won many other awards too. Gulden Draak is named for the golden statue at the top of the clock tower of the Belgian city of Gent. The statue was originally given to the city of Constantinople by the Norse King Sigrid Magnusson in 1111, during the crusades; hence the form of a Viking ship that the beast was given. During a later crusade, Boudewijn IX (Count of Flanders and Emperor of Constantinople) took it back to Flanders with him because it was so beautiful. In 1382, the cities of Brugge and Gent did battle for the statue. Gent won.', '', 10.50, 0.00, 0.00, 0, '9999-01-01', '51.1766, 3.7462', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4396, 50, 8, 95, '23-1 Azumabashi 1-chome', 'Tokyo', 'Kanto', 'Japan', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
