INSERT INTO beerbuddies_db.beer VALUES (4398, 1239, -1, -1, '', '', '', 'Israel', 'The best beer ever!', 'http://www.tempo.co.il/', 4.90, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4399, 486, -1, -1, '', '', '', 'Egypt', 'Stella is the most famous brand of beer in Egypt. It has been manufactured in Egypt since the 19th century and so many Egyptian, and actually many experienced travelers, prefer it to any other kind of beer. One will not find a single bar in Egypt that doesnâ€™t sell Stella or even have the Stella logo on the bar or shop. Stella can even be found in many bars in Europe', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4400, 1322, 3, 37, '', 'Ingelmunster', '', 'Belgium', 'Slightly dangerous beer - tastes like an 8% blonde, delivers like nothing else. A little tart around the edges, due to the higher alcohol content, but otherwise a pleasant strong pils taste : not too much hop on the palate.', '', 11.00, 0.00, 0.00, 0, '9999-01-01', '50.9205, 3.2541', '2018-10-05');
