INSERT INTO beerbuddies_db.beer VALUES (4402, 252, 3, 29, '', '', '', 'Czech Republic', 'Very good dark beer. Not as heavy as stout.', 'http://drinksunion.qbizm.cz/de/pages/vyrobky_p_breznak.htm', 3.70, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4403, 1375, 3, 29, 'The Eagle Maltings', 'Witney', 'Oxford', 'United Kingdom', '', '', 5.50, 0.00, 0.00, 0, '9999-01-01', '51.7523, -1.2558', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4404, 304, 3, 37, 'Lindenlaan 25', 'Ertvelde', 'Oost-Vlaanderen', 'Belgium', '"Piraat is a ''living'' beer, which means that after the primary fermentation in the keg, the beer also continues to evolve during the secondary fermentation in the bottle or in the keg after packaging. This is a world-class amber colored beer. American beer connoisseurs give it 98 out of 100. No other beer scores better. The flavor is so complex and so rich that every swallow conjures up new associations. Note the spicy light sweetness, which is richly balanced with the robust bitterness of the hops. It is an adventure of a beer, a treat.";"0', '', 10.50, 0.00, 0.00, 0, '9999-01-01', '51.1766, 3.7462', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4405, 1308, 7, 90, '', '', '', 'Portugal', '"Authentic Flavour" Super Bock is the leading beer brand on the Portuguese market and is the only brand to have won 19 consecutive gold medals in the international contest "Monde SÃ©lection da la QualitÃ©', 'http://www.unicer.pt', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4406, 144, 8, 95, '161 River Avenue', 'Patchogue', 'New York', 'United States', 'TOASTED LAGER Blue Point Brewing''s award-winning Toasted Lager is our flagship product. Copper in color this brew is made from six different malts including: English Pale, Crystal, Munich, Carapils, Wheat and Belgian Caravienna. Toasted Lager displays a balanced flavor of malt and hop which makes for easy drinking. Special lager yeast is used to produce that long lasting, smooth finish. The "toasted" part of the name refers to our direct-fire brew kettleâ€™s hot flames that impart a toasted flavor to our most popular microbrew.', 'http://www.bluepointbrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4407, 586, 3, 31, '1800 West Fulton Street', 'Chicago', 'Illinois', 'United States', 'From the Goose Island website: "Our IPA recalls a time when ales shipped from England to India were highly hopped to preserve their distinct taste during the long journey. The result, quite simply a hop lover''s dream. And this classic ale adds a fruity aroma, set off by a dry malt middle, to ensure that the long hop finish is one you''ll remember.";"0', '', 5.90, 0.00, 0.00, 0, '9999-01-01', '41.8871, -87.6721', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4408, 95, 7, 77, '', '', '', 'Germany', 'German Pilsner beer, with quite a bit of hops taste.', 'http://www.becks.de/', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4409, 480, 8, 95, 'Aschaffenburger StraÃŸe 3-5', 'GroÃŸostheim', 'Bavaria', 'Germany', 'A classically brewed export beer with a slight aroma of hops. Awarded with the gold medal by German Agriculture Society-DLG 2005, 2006 and 2007 Monde Selection, BrÃ¼ssel 2003 and 2005 2007 with Grand Gold and with the silver medal by World Beer Cup, Colorado 2002', 'http://www.eder-heylands.de', 5.50, 0.00, 0.00, 0, '9999-01-01', '49.9211, 9.0715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4410, 203, -1, -1, '68 route d''Oberhausbergen', 'Strasbourg', '', 'France', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '48.593, 7.7149', '2018-10-05');
