INSERT INTO beerbuddies_db.beer VALUES (4412, 520, 3, 31, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'If being in one of the coldest places in the US isn''t extreme enough, the contents of this beer may very well redefine your commitment to the pursuit of hops. Rockslide IPA is brewed in the ''West Coast'' style with aggressive amounts of American hops such as Amarillo, Centennial and Summit hops. You are greeted with a full frontal assault of citrus/grapefruit/pine hop character, followed up with malt to balance the mouthfeel. This beer is all about hops.', 'http://www.fiftyfiftybrewing.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4413, 1224, 3, 26, '195 Ottley Drive', 'Atlanta', 'Georgia', 'United States', '', 'http://www.sweetwaterbrew.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '33.8087, -84.3813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4414, 769, 8, 95, '1872 North Commerce Street', 'Milwaukee', 'Wisconsin', 'United States', 'Delicious', 'http://www.lakefrontbrewery.com/index.html', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0547, -87.9053', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4415, 1026, 3, 31, '', 'Portland', 'Maine', 'United States', 'Below-average but drinkable IPA, cheaply priced (~$1/bottle), and available at Trader Joe''s.', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.6615, -70.2553', '2018-10-05');
