INSERT INTO beerbuddies_db.beer VALUES (4418, 249, 5, 62, '656 County Highway 33', 'Cooperstown', 'New York', 'United States', '', '', 9.80, 0.00, 0.00, 0, '9999-01-01', '42.6818, -74.9255', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4419, 635, 3, 31, '336 Ruth Carney Drive', 'Windsor', 'Vermont', 'United States', 'From their site: "Harpoon IPA is an interpretation of the classic English style using hops and malt grown in the United States.', 'http://www.harpoonbrewery.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '43.513, -72.4015', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4541, 37, 8, 96, 'Antwoordnummer 7181', 'Amsterdam', '', 'Netherlands', '', 'http://www.amstel.com', 3.50, 0.00, 0.00, 0, '9999-01-01', '52.3738, 4.8909', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4420, 634, 4, 50, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'From Harpoon''s site: "UFO Hefeweizen is an American unfiltered wheat beer. Perhaps UFOâ€™s initial sensory perception is also its most prominent: a cloudy golden color and a dense, frothy head. The yeast, which has not been filtered out, accounts for the cloudiness of UFO. Wheat malt tends to create a larger head than barley malt, the cereal grain most often used in brewing. When served in a traditional wheat beer glass with a lemon, UFO presents an appealing and distinctive visual image. The aroma has a faint but clear citrus-like character. This is produced by the special yeast and accounts for the Bavarian tradition of serving hefeweizens with a lemon. The lemon accentuates the yeastâ€™s fruity, tart fragrance. UFO has a soft mouthfeel and a refreshing, light body. The wheat malts and subtle hopping give the beer a mild, delicate flavor. UFO has a clean finish. Unlike some imported hefeweizens, UFO does not have the spicy, tropical flavors typical of European-brewed style. The overall character is a cloudy appearance with a citrus-like aroma, light body, and clean finish. Serve with a lemon.";"0', 'http://www.harpoonbrewery.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4421, 634, 3, 26, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'From Harpoon''s site: "When first seeing Harpoon Ale in a glass, you will notice its golden caramel color. You will also see that it is not excessively carbonated. High carbonation would mask this beerâ€™s subtle flavor. The first aroma will be fruity. This is produced by the yeast and is a signature characteristic of Harpoonâ€™s proprietary yeast strain. The second perceptible aroma is from the malt, with a delicate caramel note. Upon tasting Harpoon Ale, you will find that the malty, fruity character is nicely balanced by the mild hop bitterness. It has a smooth, medium body. The finish of this beer is crisp but not dry. The overall character of this beer is fruity, balanced, and mild.";"0', 'http://www.harpoonbrewery.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4422, 302, 11, 116, 'Stoopkensstraat 46', 'Hoegaarden', 'Vlaams Brabant', 'Belgium', 'Hoegaarden is the authentic Belgian wheat or white beer. It has a unique and extremely complex brewing process whereby the brand is first top fermented and then is refermented within the bottle - ending up in a unique cloudy-white appearance. The brand''s unique appearance is mirrored by its one-of-a-kind taste - sweet and sour beer with a little bitterness, slightly spicy, with a strong touch of coriander and a hint of orange, perfect for warm summer days, instead of other refreshing beverages. Refreshing, a little quirky, and decidedly different - naturally.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '50.7778, 4.8877', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4423, 1204, 3, 29, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'The inspiration for making a Black IPA (or should we say "India Black Ale/ IBA"?) has been over a year in the making. As soon as we wrapped up the brewing of the Stone 10th Anniversary IPA, we started brainstorming ideas for the Stone 11th Anniversary Ale, and the Black IPA concept was born. This was a challenging brew to formulate and achieve what we considered the ideal flavor balance of intense up-front hops with balanced roasted malt flavors, a deep, rich flavor, and a hearty bitterness.', 'http://www.stonebrew.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4424, 1260, 11, 116, '9750 Indiana Parkway', 'Munster', 'Indiana', 'United States', 'Three Floyds official summer beer highly dry hopped American wheat beer. Quite hoppy. Gumballhead is brewed from red wheat and amarillo hops. It has a medium haze, due to bottle conditioning; once the beer is bottled, extra yeast is added for a secondary fermentation. The hops give off a pronounced citrus note on the nose. Notes of bread - from the yeast - and a good malt undertone. Medium carbonation.', 'http://www.threefloydspub.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '41.5354, -87.5158', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4425, 585, 1, 4, '1800 North Clybourn Avenue', 'Chicago', 'Illinois', 'United States', 'Honkerâ€™s Ale combines a spicy hop aroma with a rich malt middle to create a perfectly balanced ale that is immensely drinkable. A smooth, drinkable English Bitter for those looking for more from their beer.', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9137, -87.6543', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4426, 1374, 4, 50, 'Hchberger Strae 28', 'Wrzburg', 'Bayern', 'Germany', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.792, 9.915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4427, 963, 8, 95, 'PO Box 1661', 'San Antonio', 'Texas', 'United States', 'A rich golden liquid with a unique flavor and aroma that comes from a touch of raw Hawaiian cane sugar. Primo is a premium lager that represents the best of both worlds; the rich taste of a craft-brewed beer with the drinkability of a lighter lager. -http://www.thatsprimo.com/Recipe.aspx', 'http://www.pabst.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '29.43, -98.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4428, 39, 11, 116, '1705 Mariposa Street', 'San Francisco', 'California', 'United States', 'Anchor Summer is the first American wheat beer in modern times. Our first brew of this light and refreshing beer was in the summer of 1984. Anchor Summer is an all-malt beer, and over 50% of its malt comes from malted wheat. It is fermented with a Triticum aestivum, AKA wheat traditional top-fermenting "ale" yeast because we prefer the clean flavors developed by this yeast. We believe that this style best celebrates the refreshingly light flavor of malted wheat. You may notice that the head on this beer is unusually abundant, with a consistency similar to whipped egg whites. This is due to protein contributed by the wheat. The brewers at Anchor are proud to have revived not only rich hearty dark beers, but also this light crisp style of a modern American wheat beer. Summer getaway Wheat malt contributes to an unusual lightness and dryness to the palate, and thisâ€”combined with the distinctive flavor of the wheatâ€”makes for a perfect thirst-quenching beverage. It is the ideal drink for beer lovers who appreciate tradition and character in their beer, but also seek a lighter, refreshing style, perfect for warm weather. -http://www.anchorbrewing.com/beers/summerbeer.htm', '', 4.60, 0.00, 0.00, 0, '9999-01-01', '37.7635, -122.401', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4429, 1385, 1, 20, '26 Osiers Road', 'London', '', 'England', 'A rich, creamy stout with roasted chocolate flavors. A perfect dessert beer.', 'http://www.youngs.co.uk', 5.20, 0.00, 0.00, 0, '9999-01-01', '51.4611, -0.1966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4430, 813, 1, 4, '1398 Haight Street', 'San Francisco', 'California', 'United States', 'Diacetyl dominated cask bitter.', 'http://www.magnoliapub.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '37.7702, -122.445', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4431, 509, 8, 95, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', '', 'http://www.epbrewery.net/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4432, 1195, 8, 95, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'While ales are fermented for relatively short periods of time at room temperature, lagers employ a special variety of yeast and much cooler fermentation temperatures to achieve their truly clean, dry flavour profile. Our Lion''s Gate Lager has a light body, a very crisp palate and a soft, hop finish, which is imparted by the exquisitely gentle Czech Saaz hop variety. The Lions would approve.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4475, 10, 7, 84, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Fall Fest is an Octoberfest lager available September-November. It is brewed with German Hersbrucker hops and pale, crystal and chocolate malts. The result is a full-bodied, malty beer with a strong hop character and a beautiful amber color. Celebrate the season with Abita Fall Fest and your favorite German food', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4434, 1195, 3, 33, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'The term "Pale Ale" dates back to the 1800s when all beer was dark brown in colour. New malting techniques led to the development of pale malt, a barley malt kilned at low temperatures which contributed very little colour to the finished beer. Hence the birth of Pale Ale, an amber- to copper-coloured ale you could actually see through. Plenty of British Crystal malt in the grist lends this ale its rich colour, its caramel maltiness, and adds the occasional whiff of toffee to the nose. An addition of American and German hops to the kettle at the end of the boil is used to suffuse our Pale Ale with a gently spicy hop finish.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4435, 1195, -1, -1, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'Our regulars have many reasons for frequenting our premises. Some come for the comfy chairs, a game of pool, or to exude some seriously suaveness at the oyster bar on a Friday evening. For the truly devoted, however, who come in search of truth, it''s the Nut Brown they''re after. Often they arrive with a glazed look in their eyes, having endured days of office drudgery or the unknowable hardships of securing a parking spot. Set your cares aside, for all can find solace in this ale''s yin-yang of nutty maltiness and delicate, dryish hoppiness. For our Nut Brown, an ale deep auburn in colour, we use a blend of Munich, caramel and chocolate malts to create a rich malty palate with a lingering dry chocolatiness.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4436, 1195, 3, 32, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'During the heyday of the British Empire, India Pale Ale was born as a strong pale ale brewed especially to endure the rigors of the long journey to the colonies. In order to guard against spoilage, I.P.A. was brewed with a high alcohol content and with liberal amounts of hops, which act as a natural preservative. This ale''s golden amber colour only hints at its full-bodied flavour. Its sumptuous maltiness is tempered by a goodly amount of bitterness and a mouth-filling hop flavour. In order to finish our I.P.A. with a truly fresh hop bouquet, we dry hop this ale in the serving tank with both East Kent Goldings and Mount Hood hops.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4437, 1195, 1, 21, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'There are some things in life that require a certain sense of bravado: these might include ordering a quadruple espresso, deciding to sleep without a nightlight, or choosing to live in a region of the continent that is gradually sinking into the Pacific Ocean. If you''re no longer scared of the dark, then there''s no reason to be afraid of our stout. A generous portion of rolled oats and lots of black roasted barley give this beer a warm, roasted nose, and a distinct dryness that succumbs to waves of lingering satisfaction.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4438, 1195, 7, 77, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'Our Pilsner is a true beer drinker''s beer inspired by the first golden lagers brewed in the Czech town of Pilsn. This full-bodied lager is hopped with copious amounts of Sterling hops, lending it a refreshing, citrusy finish.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4439, 1195, 4, 50, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'Our Hefeweizen is a faithful version of the traditional Bavarian wheat beer. Hefe is the German word for ''yeast'' and weizen means ''wheat''. This beer is made with 40% wheat malt and is brewed with a special yeast that tends to stay in suspension, giving the beer its cloudy appearance. Bavarians are so convinced of the healthful qualities of this yeasty brew that doctors there are known to prescribe two Hefeweizens a day to feeble patients. The yeast used for this brew also imparts its unique spicy, clovey flavour. Some people even detect a light banana flavour. All of these wacky flavours are the natural ''signature'' left by this specific yeast strain during its fermentation of the beer and no additional spices are added.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4440, 1195, 2, 25, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'As you look out over Vancouver''s Coal Harbour, relax with this creamy delight. Don''t let the colour fool you - this porter is rich but not overpowering with a head that lingers all the way down the glass. Just about anything goes with our Coal Porter, and you don''t have to belong to "High Society" to enjoy a glass with oysters.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4441, 1195, 11, 123, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'A spiced ale that tastes just like pumpkin pie in a glass. The Pumpkin Ale is a malty, copper coloured brew that''s spiced with cinnamon, cloves, nutmeg and ginger. We add 100 lbs of pumpkin directly to the mash and the resulting beer tastes just like pumpkin pie in a glass.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4442, 1195, 11, 121, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'An intriguing fruit beer brewed with fresh sour cherries. Our Sour Cherry Ale is inspired by the centuries old Belgian tradition of brewing beer with cherries. This high gravity brew undergoes a slow second fermentation with tons of fresh, whole Montmorency cherries from a local orchard in the Fraser Valley. The result is a most intriguing beer with an elegant cherry perfume, a tart, fruity flavour, and a subtle almondy finish.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4443, 1195, 5, 67, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', '"Tall and tan and young and lovely', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4444, 1195, 11, 121, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'A ruby-red raspberry beer with a luscious, pink head Our Frambozen is inspired by the centuries old Belgian tradition of brewing beer with raspberries. This high gravity brew undergoes a slow second fermentation with tons of fresh, whole Fraser Valley raspberries. The result is a ruby-red fruit beer with a intense raspberry flavour, a nice tart finish and a luscious pink head.', 'http://www.steamworks.com/gastown_index.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4445, 1195, 11, 121, '375 Water Street', 'Vancouver', 'British Columbia', 'Canada', 'A strong, fruity, belgian-style trippel 8.5% alc./vol. Our aptly named Christmas Ale is based on the strong beers traditionally brewed by Belgium''s trappist monasteries. Trippel is typically at least 8% alc./vol. and has a light golden colour. Because of its high strength this beer has an intensely fruity palate. Up front it has a honeyish sweetness but the finish is dry and champagne-like. Most weary Christmas shoppers would be well advised to benefit from the warmth and ''ho-ho-ho factor'' that only a beer of the Biltzen''s calibre can provide.', 'http://www.steamworks.com/gastown_index.htm', 8.50, 0.00, 0.00, 0, '9999-01-01', '49.2849, -123.11', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4476, 10, 11, 121, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', '', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4477, 765, 2, 22, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '', 'http://www.lagunitas.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4446, 1210, 3, 31, '310 Commercial Drive', 'Vancouver', 'British Columbia', 'Canada', 'â€œA complex, flavourful and fascinating ale lies just on the edge of being totally out of control.â€ â€”Stephan Beaumont, Celebrator Beer News India Pale Ale dates back to the 1700â€™s when Britain needed a hearty beer to ship to her troops in India. Because the ships had to cross the equator twice to get there, spoilage was a major problem until some clever brewer realized that both alcohol and hops are natural preservatives. James brews Hurricane I.P.A. in this tradition, and packs it with enough hops and alcohol to survive crossing the orbit of Mercury twice. The grist is 100% Gambrinus premium 2-row barley malt, copiously hopped with fresh Centennial and Willamette. The result is a rich, golden, intense beer with bitterness in perfect balance with residual sweetness.', 'http://www.stormbrewing.org', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2821, -123.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4447, 1210, 3, 42, '310 Commercial Drive', 'Vancouver', 'British Columbia', 'Canada', 'Derives its name from the historical fact that at one time in Europe beer was about the only safe liquid to drink. Black Plague is Irish style dry stout brewed only in fall and winter and only in small batches to ensure the freshness so paramount to such an intensely roasted beer.', 'http://www.stormbrewing.org', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2821, -123.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4448, 1210, 1, 15, '310 Commercial Drive', 'Vancouver', 'British Columbia', 'Canada', 'While hugely popular in Scotland, this style of beer escapes most North Americans. Designed and brewed by the Scottish punk rocker David â€œMaltyâ€ Macanulty, this creamy, nutty, malty, dark ale is true to its origins. David drives James crazy over this beer, insisting on rigid fermentation temperatures, traditional mild hops for bittering, and even some weird caramelizing ritual as the kettle is being filled. The beer continues to undergo subtle evolutionary changes because the stubborn Scottish bastard will never be satisfied.', 'http://www.stormbrewing.org', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2821, -123.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4449, 1210, 7, 77, '310 Commercial Drive', 'Vancouver', 'British Columbia', 'Canada', 'A true North German Style Pilsner. Light in body and packed full of Czech Saaz hops. The distinctive Pilsner aroma and dry, refreshing taste make a great accompaniment to a hot Vanouver day.', 'http://www.stormbrewing.org', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2821, -123.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4450, 1210, 11, 121, '310 Commercial Drive', 'Vancouver', 'British Columbia', 'Canada', 'These authentic Belgian-style ales are intensely sour, dry and complex. All three of the lambics - Raspberry, Blackberry and Black Cherry - are aged in oak casks for more than one year. 15 kg, give or take, of whole unpasteurized fruit is added to each 200 litre oak barrel of fermented beer. The naturally occurring wild yeasts cause a second, slow fermentation, breaking down the fruit sugars to total dryness.', 'http://www.stormbrewing.org', 0.00, 0.00, 0.00, 0, '9999-01-01', '49.2821, -123.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4451, 1211, 1, 21, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', '', 'http://www.stoudtsbeer.com/brewery.html', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4452, 1211, 3, 32, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'Strong, full-bodied ale with an intense hop character and deep golden color', 'http://www.stoudtsbeer.com/brewery.html', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4453, 1307, 5, 67, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', '(White of Chambly) was the first bottle refermented ale produced by Unibroue. It is brewed from a blend of pale barley malt, wheat malt and unmalted wheat, to which we blend selected spices and hops. Blanche de Chambly is only partially filtered, retaining its natural cloud of yeast that is characteristic of the original white ales brewed during the Middle Ages. We recommend this remarkably refreshing', 'http://www.unibroue.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4454, 1307, 5, 67, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'White ale brewed with apple must Redolent of ripe Granny Smith apples, this unique white ale pleases the palate with a delicate balance of fruit and spice notes and just a hint of sweetness. Ã‰phÃ©mÃ¨re apple satisfies with each sip and refreshes in all seasons, especially when paired with an artisan cheddar cheese, pork tenderloin served with apple chutney or Vidalia onion soup. We developed the Ã‰phÃ©mÃ¨re (Ephemeral) series to feature a seasonal fruit in a refreshing, lightly spiced white ale. The label depicts a fairy, an ephemeral spirit associated with fruits picked at the peak of ripeness during each harvest season. Ã‰phÃ©mÃ¨re apple flavor is brewed with apple must, which consists of the freshly-pressed juice from apples. Enjoy this beer ''alfresco'' while dining in the afternoon sun, relaxing at a family gathering or at a picnic in the back yard. Winner of 3 Gold Medals from the Beverage Testing Institute since 2002', 'http://www.unibroue.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4455, 1307, 3, 33, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'The copper-colored body and generous foam head of this amber ale tantalize the eyes but it''s the complex flavor of Seigneuriale that delivers a pleasant surprise. It is slightly sweet, malty and spicy, but a distinctive hop character and notes of apricot brandy give Seigneuriale a truly unique character. We recommending pairing it with carved ham, apricot-glazed duck or squab, Thai shrimp curry or a holiday fruit cake.', 'http://www.unibroue.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4456, 1307, 3, 29, '80 Des Carrires', 'Chambly', 'Quebec', 'Canada', 'The opaque blackness and beige-colored foam mousse of Chambly Noire belie its light, refreshing body and clean, long finish, featuring hints of roasted coffee beans, toast and toffee. We recommend pairing it with grilled salmon, steak or tuna au poivre, smoked meats, coffee-crusted rack of lamb, or chocolate espresso flan.', 'http://www.unibroue.com', 6.20, 0.00, 0.00, 0, '9999-01-01', '45.4416, -73.2595', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4457, 1391, 3, 29, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'Many Mexican beer styles today are descendants of old Austrian styles, from when Austria ruled Mexico in the late 19th century. Our Dos Perros is made with German Munich malt, English Pale malt, and Chocolate malt, and hopped with Perle and Saaz hops. To lighten the body, as many Mexican brewers do, we add a small portion of flaked maize. The result is a wonderfully bready malt aroma, balanced with some maize sweetness and a noble hop finish. Food Pairings: The toasty malt flavors go great with barbeque, grilled salmon, carmelized onions, and most hot and spicy foods. Try it with Mexican or Thai dishes. OG: 10.4 Plato FG: 3.3 Plato IBUs: 21 SRM: 13 3.5% abv', 'http://www.yazoobrew.com', 3.50, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4458, 1391, 2, 25, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'A rich, chocolaty English Porter with a clean finish. We use the finest floor-malted Maris Otter malts from England, the same malts used for the best single-malt scotch. A portion of malted rye gives a spicy, slightly dry finish. Food Pairings: The rich, chocolate notes pair well with the carmelized surface of steaks, pork tenderloins and lamb, but save this beer for dessert if youâ€™re having chocolate or crÃ¨me brulÃ©e. OG: 14.40 Plato FG: 3.8 Plato IBUs: 28 SRM: 29 5.7% abv', 'http://www.yazoobrew.com', 5.70, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4542, 863, -1, -1, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', '', 'http://www.millerbrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4459, 1391, 3, 26, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'A new version of an American classic. Our Yazoo Pale Ale bursts with spicy, citrusy hop aroma and flavor, coming from the newly discovered Amarillo hop. The wonderful hop aroma is balanced nicely with a toasty malt body, ending with a cleansing hop finish. Made with English Pale, Munich, Vienna, and Crystal malts, and generously hopped with Amarillo, Perle, and Cascade hops. Fermented with our English ale yeast. Food Pairings: The bracing bitterness of this beer can hold its own with spicy foods, while helping to cleanse the palate after rich, creamy dishes. The citrus hop flavors go exceptionally well with any dishes using cilantro, such as Mexican salsas. OG: 14.0 Plato FG: 3.3 Plato IBUs: 55 SRM: 6 5.8% abv', 'http://www.yazoobrew.com', 5.80, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4460, 1391, 3, 42, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'The tan lace clings to the glass as you raise the pint to your lips. Close your eyes and smile as the rich espresso notes fade to a dry, roasted finish. Exceptionally smooth and satisfying. Made with English Pale malt, roasted barley, black patent malt, and flaked barley. Hopped with East Kent Goldings and Target hops, and fermented with our English ale yeast. Food Pairings: The combination of Onward Stout and oysters is a match made in heaven. It also goes well with other shellfish, grilled steaks, and believe it or not, rich chocolate desserts. Carbonade Flamande, seared beef cubes simmered in Stout for several hours, is a classic Belgian dish. OG: 11.3 Plato FG: 4.3 Plato IBUs: 35 SRM: 45 3.8% abv', 'http://www.yazoobrew.com', 3.80, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4461, 1391, 1, 5, '910 Division St', 'Nashville', 'Tennessee', 'United States', '', 'http://www.yazoobrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4462, 1391, 4, 50, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'An authentic example of a Bavarian Hefeweizen. â€œHefeâ€ means cloudy or yeasty and â€œweizenâ€ means wheat. This beer is made with mostly wheat and uses a true Hefeweizen yeast that gives it a fruity, banana aroma with just a hint of cloves. The tart finish makes this the perfect summer beer. Food pairings: Almost anything goes well with Hefeweizen but it especially shines when paired with salads and omelets. OG: 12.0 Plato FG: 2.3 Plato IBUs: 13 SRM: 3 5.0% abv', 'http://www.yazoobrew.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4463, 658, 3, 33, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'A deep amber colored American ale, featuring a rich malty body. Cascade and Willamette hops add a complex hop flavor and aroma. This ale is exceptionally balanced between malty sweetness and delicate hop bitterness. IBU: 32 Alcohol content: 5.8% by volume Hops: Chinook, Willamette and Cascade Calories per 12 oz. 172.5 Carbs per 12 oz. 17.86', 'http://www.highlandbrewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4464, 658, 2, 25, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'A unique Highland creation, this robust beer is black in color, very malty with hints of chocolate-roasted flavor and a well balanced hop character. IBU: 32 Alcohol content: 5.8% by volume Hops: Chinook, Willamette and Cascade Calories per 12 oz. 191.16 Carbs per 12 oz. 19.42', 'http://www.highlandbrewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4465, 658, 3, 26, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'A golden pale having a slightly malty body balanced by an assertive American hop flavor. This pale ale displays a delicate hop nose due to the process of dry hopping. A crisp and refreshing beer perfect for any occasion. IBU: 24 Alcohol content: 5.2% by volume Hops: Chinook and Cascade Calories per 12 oz. 170.1 Carbs per 12 oz. 15.65', 'http://www.highlandbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4466, 658, 3, 31, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'A brilliant, dry pale ale with an aggressive hop character balanced with a smooth finish. A bold beer best consumed with a stiff upper lip. IBU: 60 Alcohol Content: 5.6% by volume Hops: Stryian Goldings, Mt. Hood, Fuggles, Magnum, Willamette *Contains Wheat Calories per 12 oz 190.85 Carbs per 12 oz 16.82', 'http://www.highlandbrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4467, 658, 3, 42, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'Highland''s most robust beer, having a very malty body with a large, roasted chocolate flavor. It is black in color with a very clean finish and a moderate hop flavor. IBU: 25 Alcohol content: 5.3% by volume Hops: Chinook and Mt. Hood *Contains Wheat Calories per 12 oz. 216.81 Carbs per 12 oz. 24.99', 'http://www.highlandbrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4468, 658, 11, 141, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'Our ever-changing spiced winter seasonal. A tasty brew that complements all your holiday festivities. It is typically malty in body, lightly hopped, and rounded out with spices that we vary from year to year.', 'http://www.highlandbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4469, 972, 7, 92, '', 'Munich', '', 'Germany', 'Paulaner Salvator, with its strong, typically malty flavour, is what you could call the "original" Paulaner. The bottom-fermented "Doppelbock" beer combines the finest hops and dark barley malt. The Paulaner monks used to drink Salvator as a food substitute during Lent. The most famous master brewer was Frater Barnabas, who took over the Paulaner monastery brewery in 1773. His original recipe remains practically unchanged to this day. In order to preserve the original, Paulaner registered the name "Salvator" with the patent office in 1896. Salvator: 18.3% original wort; 7.9% alcohol; 70.6 kcal/100 ml', 'http://www.paulaner.com/', 7.90, 0.00, 0.00, 0, '9999-01-01', '48.1391, 11.5802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4470, 972, 7, 84, '', 'Munich', '', 'Germany', 'Paulaner Oktoberfestbier is festive, full-flavoured and ultra delicious, and is brewed specially for the most famous festival in the world. Every year, more than one million liters are served at the Oktoberfest. You can create your own "beer tent atmosphere" at home with this golden yellow, mildly hoppy seasonal speciality - but only between July and October. Oktoberfest Bier: 13.7% original wort; 6.0% alcohol; 50 kcal/100 ml', 'http://www.paulaner.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '48.1391, 11.5802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4471, 972, 4, 50, '', 'Munich', '', 'Germany', 'Paulaner Hefe-WeiÃŸbier is the best-selling beer by the Paulaner Brewery. Specially produced top-fermented yeast is what gives it its unmistakeable character: sparkling light, fruity, and just a tiny bit bitter. Because it is not filtered during the brewing process, it retains its originality and the many vitamins, minerals and trace elements. Hefe Weissbier NaturtrÃ¼b: 12.5% original wort; 5.5% alcohol; 44 kcal/100 ml', 'http://www.paulaner.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '48.1391, 11.5802', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4472, 765, 3, 42, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', 'Ale Brewed with Columbian Coffee. Brewed with Sebastopol''s Own Hard Core Coffee.', 'http://www.lagunitas.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4473, 49, 3, 42, 'St. James''s Gate', 'Dublin', '', 'Ireland', 'Adored since 1959, it', 'http://www.guinness.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '53.3433, -6.2846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4474, 47, 3, 43, '103 West Michigan Avenue', 'Battle Creek', 'Michigan', 'United States', 'Great chocolate stoudt.', 'http://www.arcadiaales.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.322, -85.1851', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4478, 530, 3, 26, '115 S. Fifth St.', 'Columbia', 'Missouri', 'United States', 'A great summer fruit beer, with 168 pounds of blackberry puree added to a light ale base. The blackberries add a distinct purple haze, and hopping is light to allow the berries to be the featured flavor. The ABV is 5.2% and hop bitterness is 22 BU''s.', 'http://www.flatbranch.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '38.95, -92.3323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4479, 530, 1, 21, '115 S. Fifth St.', 'Columbia', 'Missouri', 'United States', 'Black as diesel oil, Oil Change is big in roasty chocolate flavors. A large amount of flaked oats gives this stout a velvety smoothness. Oil Change is nitrogen charged to give it a thick creamy head.', 'http://www.flatbranch.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.95, -92.3323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4480, 56, 8, 95, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'Atwater Block beers are brewed using traditional German methods to create a distinctly fresh and flavorful character. Our classic Helles (German for Pale) is a crisp lager that is sure to please.', 'http://www.atwaterbeer.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4481, 41, 3, 33, '17700 Boonville Rd', 'Boonville', 'California', 'United States', '', 'http://avbc.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '39.0014, -123.356', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4482, 41, 3, 31, '17700 Boonville Rd', 'Boonville', 'California', 'United States', 'Hop Ottin'' IPA is as hoppy as they come. The name means "hard working hops," in Boontling, and that tells it all. Generous additions of high-alpha Pacific Northwest hops added during a vigorous boil, plus traditional dry hopping, with whole hop cones, give this ale a delicious citrus aroma, and an intense hoppy bite. This IPA is a hop lover''s dream.', 'http://avbc.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.0014, -123.356', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4483, 611, 11, 121, '153 Pond Lane', 'Middlebury', 'Vermont', 'United States', 'It is made using 100% Granny Smith apples. This cider has a mouth-watering flavor that is tangy and tart, with just a touch of sweetness.', 'http://www.gmbeverage.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.0344, -73.1735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4484, 611, 11, 121, '153 Pond Lane', 'Middlebury', 'Vermont', 'United States', 'Woodchuck Amber is the original Woodchuck Cider. It''s made from a blend of apples and fermented with champagne yeast to produce a great tasting and refreshing alcoholic drink. It''s available in 6-packs and 12-packs, as well as on draft.', 'http://www.gmbeverage.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.0344, -73.1735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4485, 285, 5, 65, 'Brusselse Steenweg 282', 'Melle', 'Oost-Vlaanderen', 'Belgium', 'The particular character and the unique taste of "Delirium Tremens" result from the use of three different kinds of yeast. Its very original packing, which resembles cologne ceramics, and the colourful label contribute to its success.', '', 8.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4486, 285, 5, 66, 'Brusselse Steenweg 282', 'Melle', 'Oost-Vlaanderen', 'Belgium', '', '', 9.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4487, 459, 3, 38, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Palo Santo Marron (Holy Tree Brown) An unfiltered, unfettered, unprecedented brown ale aged in handmade wooden brewing vessels. The caramel and vanilla complexity unique to this beer comes from the exotic Paraguayan Palo Santo wood from which these tanks were crafted. Palo Santo means "holy tree" and it''s wood has been used in South American wine-making communities. This beer is a 12% abv, highly roasty, and malty brown ale aged on the Palo Santo wood. It was a huge hit at our Rehoboth Beach brewpub when first released in November of 2006, so it''s coming back... into full production! At 10,000 gallons each, these are the largest wooden brewing vessels built in America since before Prohibition. Click below to watch "Take Time," the short film we released with the first full-production batch of Palo Santo Marron in February 2008. It''s all very exciting. We have wood. Now you do too.', 'http://www.dogfish.com', 12.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4488, 1179, 8, 95, '603 East Brewery Street', 'Shiner', 'Texas', 'United States', '', 'http://www.shiner.com', 4.40, 0.00, 0.00, 0, '9999-01-01', '29.426, -97.1607', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4489, 470, 3, 33, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'This medium bodied amber ale has a smooth, malt character with a hint of roasted (dark) malt flavor. This beer has just enough hops to balance and goes well with many foods.', 'http://www.duclaw.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4490, 470, 3, 31, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'From the first sip this American-style India Pale Ale gets in your face with an unruly hop bitterness, big floral flavors and aroma, and just enough malt character to keep you from giving in and acting up.', 'http://www.duclaw.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4491, 470, 2, 25, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'A complex, robust porter, Bad Moon is medium to full bodied with a slightly sweet, malty presence combined with hints of chocolate and coffee. This is a full-bodied beer that gets its chocolate and coffee-like flavors and color from the use of generous amounts of roasted malts. It has a smooth finish and a balanced hop character.', 'http://www.duclaw.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4492, 470, 7, 86, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'Succumb to this dark, medium bodied German-style dark lagerâ€™s smooth roasted flavors and light hoppy bitterness. Donâ€™t worry, youâ€™ll remember everything the next morning.', 'http://www.duclaw.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4493, 470, -1, -1, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'Just like the miracle cure-alls of old, Professor Wagnerâ€™s Imperial Pilsner possesses no verifiable medicinal qualities whatsoever. And yet, taken internally, this golden elixir is guaranteed to cure what ails you. Snake Oil is a crisp, Medium-bodied lager with a complex maltiness and heavy hop presence â€“ well-rounded and refreshing.', 'http://www.duclaw.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4494, 470, 3, 26, '901 S. Bond St.', 'Baltimore', 'Maryland', 'United States', 'This American-Style Pale Ale is aggressively hopped giving it a citrusy flavor and aroma. No antidote needed. This beer is dark-golden, medium-bodied and very â€œhoppy.â€ It is American-style because American-grown hops are used rather that European.', 'http://www.duclaw.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.2807, -76.5944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4495, 242, 5, 72, '1106 N. Charles St.', 'Baltimore', 'Maryland', 'United States', 'Brewer''s Art''s answer to the Belgian "devil" beers (i.e. Lucifer, Duvel, etc.). Both rich and dry, this beer is all too easy to consume in large quantities. Hopped with Styrian Goldings.', 'http://www.belgianbeer.com', 7.25, 0.00, 0.00, 0, '9999-01-01', '39.3028, -76.6164', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4496, 242, 5, 60, '1106 N. Charles St.', 'Baltimore', 'Maryland', 'United States', 'During the fermentation of the first batch of this Abbey-style dubbel, the yeast "died" and was "resurrected" by brewer Chris Cashell. Made with five types of barley malt and lots of sugar, this beer is quite flavorful, without being too sweet.', 'http://www.belgianbeer.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.3028, -76.6164', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4497, 242, -1, -1, '1106 N. Charles St.', 'Baltimore', 'Maryland', 'United States', 'Black, smooth and easy to drink, this is a beer for the people!', 'http://www.belgianbeer.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.3028, -76.6164', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4543, 1247, -1, -1, '357 Salmon Brook Street', 'Granby', 'Connecticut', 'United States', 'German Style Light Ale. Smooth, easy drinking with subtle noble hop character.', 'http://www.cambridgebrewhouse.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '41.9658, -72.793', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4499, 1086, 3, 32, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'A true leader in the hop-wars of the west coast, Pliny the Elder hits you over the head with hoppy bitterness and manages to smooth the rough edges out enough to become an enjoyable brew.', 'http://www.russianriverbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4500, 1086, 3, 32, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Pliny the Younger was Pliny the Elder''s nephew, in the case of this beer, the "Younger" is a triple IPA. Pliny the Younger is hopped three times more than our standard IPA, and is dry hopped four different times.', 'http://www.russianriverbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4501, 1086, -1, -1, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'This nitrogenated dry stout is low in alcohol but big in flavor. Its smooth roasted coffee like aromas and flavor are clean and drinkable.', 'http://www.russianriverbrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4502, 1086, 3, 37, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Aud Blonde has a refined characteristic, which can be contributed to us blending pilsner malt with a unique hop called crystal. The distinctive characteristic of the crystal hop lends a citrus, almost eucalyptus quality in the aroma and mouth feel of the brew, while leaving the beer with a long dry finish.', 'http://www.russianriverbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4503, 1354, 1, 5, '206 W. Pratt St.', 'Baltimore', 'Maryland', 'United States', '', 'http://www.thewharfrat.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.2866, -76.6182', '2018-10-05');
