INSERT INTO beerbuddies_db.beer VALUES (4506, 1262, 3, 31, '7401 North La Cholla Boulevard', 'Tucson', 'Arizona', 'United States', 'The Granddaddy of Pale Ales, this style got its start as a special brew for English soldiers living in India. Our IPA is a medium bodied ale, with a light copper color characterized by an intense hop flavor, with a full flowery hop aroma and higher alcohol content.', 'http://www.thundercanyonbrewery.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '32.3407, -111.015', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4507, 320, 11, 121, '', 'Hereford', '', 'United Kingdom', 'Strongbow is a brand of cider manufactured in England by Bulmers. It is the UK''s most popular cider[citation needed], accounting for more than half of the draught cider sold in British pubs. Strongbow is also unique in that it is produced with a Royal Warrant.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '52.056, -2.7175', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4508, 41, 11, 113, '17700 Boonville Rd', 'Boonville', 'California', 'United States', '"This copper colored ale is smooth, malty, and lightly sweet, with a delicate hint of spice for that oh-so-drinkable, extra velvety flavor. The character is lighter in body than its cousin our wildly popular Winter Solstice Seasonal Ale. This is a silky, creamy dream, perfect as a warm weather beer.";"0', 'http://avbc.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.0014, -123.356', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4509, 765, 3, 31, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '"This is our unique version of an ancient style. A style as old as the ocean trade routes of the last centuries Great Ships. Not as old as the equator they had to cross twice enroute, nor as old as the 10,000 or so miles of Di-Hydrogen Oxide and Sodium upon which they sailed, but older than the Circulithium-4 Lentloid that binds the Lupulin Quartnate onto your taste buds. Weird. Think about it. Now stop. OK, go again, now stop. Think again, and stop. But we digress. Made with 43 different hops and 65 various malts, this redolent ale will likely float your boat, whatever planet you''re on. ";"0', 'http://www.lagunitas.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4510, 520, 3, 43, '11197 Brockway Road', 'Truckee', 'California', 'United States', '', 'http://www.fiftyfiftybrewing.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4511, 1224, 11, 121, '195 Ottley Drive', 'Atlanta', 'Georgia', 'United States', 'Sweetwater Blue is a unique light bodied ale enhanced with a hint of fresh blueberries. This euphoric experience begins with an appealing blueberry aroma and finishes as a surprisingly thirst-quenching ale.', 'http://www.sweetwaterbrew.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '33.8087, -84.3813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4512, 1224, 3, 38, '195 Ottley Drive', 'Atlanta', 'Georgia', 'United States', 'It''s definitely one of the finer American Brown Ales. A deep, copper colored, mild brown ale. SGB is accentuated by a slight nuttiness from its malt character. Designed to be a session beer it has a real smooth finish with a subtle hop character.', 'http://www.sweetwaterbrew.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '33.8087, -84.3813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4513, 1224, 5, 67, '195 Ottley Drive', 'Atlanta', 'Georgia', 'United States', 'SweetWater Hummer is a tasty Belgian White Ale brewed with coriander and orange peel. Cloudy with subtle fruit tones and a lingering finish. Everybody loves a Hummer!', 'http://www.sweetwaterbrew.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '33.8087, -84.3813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4514, 44, 7, 90, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.anheuser-busch.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4515, 62, 3, 32, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'From Website: Maharaja is derived from the sanskrit words mahat, - "great" and rajan - "king". Much like its namesake, this imperial IPA is regal, intense and mighty. With hops and malts as his servants, he rules both with a heavy hand. The Maharaja flaunts his authority over a deranged amount of hops: tangy, vibrant and pungent along with an insane amount of malted barley - fashioning a dark amber hue and exquisite malt essence. This newest Avery Dictator completes the "Dictator Series" joining the likes of The Kaiser & The Czar. Be aware that The Maharaja is a limited release only available for the summer. Welcome to his kingdom! Availability: * 22 oz. bottles * 5.17 gallon keg * 15.5 gallon keg * Available March through August ABV: * 10.5% (2008) * 9.78% (2007)', 'http://www.averybrewing.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4516, 62, 5, 62, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'Belgian-Style Quadrupel Ale', 'http://www.averybrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4517, 304, -1, -1, 'Lindenlaan 25', 'Ertvelde', 'Oost-Vlaanderen', 'Belgium', 'A sweet and sour beer that gets its flavor from mixing old and new ales. An unusual, yet perfect, combination.', '', 5.50, 0.00, 0.00, 0, '9999-01-01', '51.1766, 3.7462', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4518, 1019, 11, 116, 'Franz-Brombach-Strae 1-20', 'Erding', 'Bayern', 'Germany', 'The famous Bavarian specialty Erdinger Weissbier ''crystal clear'' is particularly welcome as a tasty thirst-quencher for hot summer days. This specialty wheat beer gets its ''crystal clear'' appearance from a particularly long filtration process, known in the industry as "fine filtration", whereby the beer becomes completely clear. This gives Erdinger Weissbier ''crystal clear'' its sparkling and refreshing character - which also makes it the ideal wheat beer for warm summer days. Brewed in strict accordance with our own traditional recipe, Erdinger Weissbier ''crystal clear'' meets the highest quality standards and satisfies the most sophisticated palate.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '48.3153, 11.8911', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4568, 546, 1, 3, '', '', '', 'Australia', 'http://www.fostersbeer.com/home.aspx?fullbrowser=h', 'http://www.fostersbeer.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4569, 48, -1, -1, 'Schlossalle 1', 'Moos', 'Baden-Wurttemberg', 'Germany', '', 'http://www.arcobraeu.de', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4519, 1176, -1, -1, 'Marsstrae 46-48', 'MÃ¼nchen', 'Bayern', 'Germany', 'Franziskaner Hefe-Weisse Dunkel wins supporters with its refreshing yet aromatic and full-bodied flavour. This dark, cloudy specialty is a special treat for weiss beer connoisseurs and bock beer aficionados. All of Franziskaner''s weiss beer products - Hefe-Weisse Hell and Hefe-Weisse Dunkel - are top-fermentation beers noted for their agreeable carbonation levels and zesty wheat flavour. The consistently high quality of our products makes Franziskaner weiss beers a refreshing taste sensation of a special sort. All Franziskaner weiss beers are brewed in strict adherence to the Bavarian Purity Law of 1516.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4520, 459, 3, 29, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A bigger, bolder version of our Raison D''Etre. This is a bulbous, brown ale brewed with a bunch of malt, brown sugar and raisins. In case you care... the average 12 oz. serving has approximately 425 calories.', 'http://www.dogfish.com', 20.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4521, 955, 3, 31, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A strong but smooth medium-bodied copper ale with a furity nose, big dry hop flavor, and assertive hop bite that rest upon a subtle but supportive background of complex malt flavors.', 'http://www.orlio.net/', 5.40, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4522, 955, -1, -1, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A light to medium bodied deep golden ale that starts with an elegantly creamy malt complexity and ends with a firm but understated hop finish that balances the initial sweetness with a touch of bitterness.', 'http://www.orlio.net/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4523, 955, 7, 86, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'A rich medium-bodied black lager whose sweet deep malt flavor is balanced by a moderate hop bite and roasted malt tartness that creates notes of bitter chocolate and a slight lingering sweetness.', 'http://www.orlio.net/', 4.50, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4524, 611, 11, 121, '153 Pond Lane', 'Middlebury', 'Vermont', 'United States', '', 'http://www.gmbeverage.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.0344, -73.1735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4525, 611, 11, 121, '153 Pond Lane', 'Middlebury', 'Vermont', 'United States', '', 'http://www.gmbeverage.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0344, -73.1735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4526, 920, 11, 113, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This style of beer is light to medium in body (mouth-feel) with very little hop character. The brewer says â€œa good beer to try if youâ€™re a Northern Lite drinkerâ€', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4527, 920, 3, 38, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This smooth Ale has an even display of hop bitterness and bold malt flavor, with a hint of nutty flavor from the dark malt, to produce a superior brown ale taste', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4528, 920, 2, 22, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This is a true Celtic Red ale thatâ€™s as faithful as its namesake. With a smooth balance between malt and hops, itâ€™s sure to become a pubhouse favorite', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4529, 920, 2, 22, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This red is a rich, malty, ruby-colored ale with a smooth finish.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4530, 920, 3, 33, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'An amber-colored beer, lightly hopped, with a nice malty finish; go ahead, salute your brew.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4531, 920, 3, 26, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This clean, crisp ale was dry-hopped and is as refreshing as a plunge in the Slippery Rock Creek.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4532, 920, 3, 31, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'The discovery of the true I.P.A. (India Pale Ale) made right here in Slippery Rock. The British added hops to oak barrels to help preserve the beer for its long voyage to British-controlled India. Brewed in this same English tradition, we dry-hopped our ale, giving the beer a very aromatic quality as it travels to your mug.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4533, 920, 3, 31, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'Double your fun, double your pleasure and try and stay out of double trouble with this hopped up I.P.A.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4534, 920, 2, 25, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This robust porter has a lot of caramel and chocolate flavor balanced with the flavor and aroma of fuggle hops.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4535, 920, 1, 21, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This robust, hearty stout is as sturdy as its namesake. Roasted barley is the trademark of stout, a bittersweet separation from its cousin Porter. The deep character of roasted barley is further enhanced by the addition of oatmeal for an incredible silky finish.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4536, 920, 4, 50, '141 South Main Street', 'Slippery Rock', 'Pennsylvania', 'United States', 'This unfiltered, true German wheat beer has hints of clove and banana which the yeast produces during fermentation.', 'http://www.northcountrybrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0638, -80.0556', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4537, 426, 3, 32, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'From their website: "Have you read the description for the regular Crooked Tree yet? Well this beer is almost the same just double. We actually took the Crooked Tree recipe and doubled all of the ingredients except the water, just the way a DOUBLE should be made. Big hops balanced with tons of malt give this beer a huge body. Although this beer is as cool as "the Fonz" when first purchased, it gets really mellow and smooth with some age. After a year or two stored in a cool dark place you''ll notice the heavy caramel and malt flavors are trying to sneak past the hops, theyâ€™re just not fast enough. This beer is hugely delicious so it will need your undivided attention (the chores can wait....trust us).";"0', 'http://www.darkhorsebrewery.com/', 13.60, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4538, 47, 3, 32, '103 West Michigan Avenue', 'Battle Creek', 'Michigan', 'United States', 'The first in our Brew Crew Big Beer Series, Hopmouth Double IPA is a hop loverâ€™s delight! Deep amber hue with a generous white head, Hopmouth showcases a rich, toasty flavor and a sweet caramel notes as a result of the high-quality Maris Otter Malt, imported from the UK. The hops are right up front in the aroma, reminiscent of citrus and pine, while the resin-like flavors linger well after the last sip. This is a BIG beer. True to our original vision, we have achieved a level of balance and drinkability rarely found in this style. Delicious on its own, Hopmouth is also a brilliant pair with many boldly-flavored foods, including many cheeses and desserts.', 'http://www.arcadiaales.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.322, -85.1851', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4544, 1247, 3, 31, '357 Salmon Brook Street', 'Granby', 'Connecticut', 'United States', 'Traditional English India Pale Ale brewed with all English malt & hopped with a blend of English & American hops. High in strength, bitterness & aroma.', 'http://www.cambridgebrewhouse.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '41.9658, -72.793', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4545, 1247, 4, 57, '357 Salmon Brook Street', 'Granby', 'Connecticut', 'United States', 'Alt, German for "old," is a traditional medium-bodied ale in which we use an array of the finest German malts & a generous smount of noble hops to produce a crisp, clean and refreshing "bier.";"0', 'http://www.cambridgebrewhouse.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '41.9658, -72.793', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4546, 1247, 1, 5, '357 Salmon Brook Street', 'Granby', 'Connecticut', 'United States', 'As English style extra special bitter, brewed using the finest malt and hops from England to produce a well balanced medium body pint.', 'http://www.cambridgebrewhouse.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '41.9658, -72.793', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4547, 1247, 3, 42, '357 Salmon Brook Street', 'Granby', 'Connecticut', 'United States', 'Our Stout is brewed with English malt, hops and oats to produce a smooth coffee-like richness with a pleasant bittersweet finish.', 'http://www.cambridgebrewhouse.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '41.9658, -72.793', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4548, 35, 3, 26, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Light gold in color, slightly malty and hoppy, with a mild flowery hop finish.', 'http://www.amherstbrewing.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4549, 35, 3, 38, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Light brown medium bodied ale. Smooth, malty and slightly roasted flavor.', 'http://www.amherstbrewing.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4550, 35, 3, 43, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Dark, rich, hearty, smooth and chocolaty. The two siloettes on the logo are Marina and Kshusha adopted from Russia by Amherst Brewing Company''s owners, John and Terrie.', 'http://www.amherstbrewing.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4551, 35, 11, 126, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', '2003 Silver medal winner herb and spice catagory Great American Beer Fest, made without hops, 100% heather flowers giving it a flowery aroma, subtle sweetness, and crisp, clean finish.', 'http://www.amherstbrewing.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4552, 35, 7, 84, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Amber, full-bodied lager made in the traditional style with German hops. Brewed in early August and put on tap with a keg of the previous years batch by October of each year. This beer is brewed in memory of "Lewis", the owners beer-drinking long-haired Dachsund, who passed away at 17-1/2 on 8/17/99.', 'http://www.amherstbrewing.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4553, 35, 3, 38, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Our Massatucky Brown Ale with a subtle raspberry flavoring', 'http://www.amherstbrewing.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4554, 35, 4, 50, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Light crisp American style wheat with a medium hop finish. Made using 25% German wheat malt. Brewed and on tap each summer.', 'http://www.amherstbrewing.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4555, 35, 3, 33, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Reddish amber in color, mild and malty with hop aroma and finish.', 'http://www.amherstbrewing.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4556, 35, 3, 26, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Golden pale ale, slightly hoppy. Brewed each May for the upcoming graduates. It took you four hard years to graduate so we made this one easy to drink. Congratulations!', 'http://www.amherstbrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4557, 35, 7, 77, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'A traditional European Pilsner light in body and color. This brew possesses mild hoppy flavors and a crisp clean finish. It is made with traditional European hops: Hallertau and Saaz.', 'http://www.amherstbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4558, 35, 1, 5, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Amber in color, medium body with very hoppy aroma and bitter finish. Dry hopped with Oregon Goldings', 'http://www.amherstbrewing.com/', 5.35, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4559, 35, 7, 77, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Crisp light lager, slightly malty with subtle hints of wildflower honey. Finished with Hallertau and Saaz hops', 'http://www.amherstbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4560, 35, 2, 25, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Dark, full bodied ale with a prominent smoked malt flavor', 'http://www.amherstbrewing.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4561, 35, 7, 90, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Light in color, full bodied and very malty, this lager has a toasted malt flavor. Brewed in February and usually on tap by May with a keg of the previous year''s batch.', 'http://www.amherstbrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4562, 35, 3, 37, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Just another day at the bank. Very light, mild ale with a subtle hop finish. Brewed once a year in early Spring.', 'http://www.amherstbrewing.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4563, 35, 1, 15, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Amber in color, full-bodied strong ale with a prominent malt flavor delicately balanced with Goldings hops. Made with a hint of molasses, this beer is usually on tap for Super Bowl with a keg or two of the previous year''s batch.', 'http://www.amherstbrewing.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4564, 35, 3, 31, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Light in color, medium body, with a hop bitterness and Cascade hop finish.', 'http://www.amherstbrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4565, 35, 4, 57, '24 North Pleasant Street', 'Amherst', 'Massachusetts', 'United States', 'Brewed for August each year to celebrate our Anniversary this strong ales maltiness is balenced by a generous amount of hops', 'http://www.amherstbrewing.com/', 6.85, 0.00, 0.00, 0, '9999-01-01', '42.3763, -72.5199', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4566, 131, 7, 77, 'RÃ¶mermauer 3', 'Bitburg', 'Rheinland-Pfalz', 'Germany', 'Bitburger guarantees premium quality and enjoyment. Drawing on almost 200 years of expertise, the full-bodied, light, Bitburger Premium Beer is of course brewed according to the German Purity Law. Its popular, dry-finished, hoppy taste has secured Bitburger Premium Beer position as Germany''s no. 1 draught beer. -http://www.bitburger.com/bitburger_beers/bitburger_premium_beer/product_bitburger_premium_beer/index.html', '', 4.80, 0.00, 0.00, 0, '9999-01-01', '49.974, 6.5227', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4567, 113, 5, 72, '1249-A Wicker Drive', 'Raleigh', 'North Carolina', 'United States', 'This style originated in Belgium to compete with the pilsners from Czechoslovakia, Germany, and Poland. It is a fruity ale with very strong carbonation, with complex, spicy flavors like cloves.', 'http://www.bigbossbrewing.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '35.8104, -78.6179', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4570, 399, 11, 116, '311 Tenth Street', 'Golden', 'Colorado', 'United States', 'The Gold Medal-winning Honey Moon Summer Ale is a classic summer ale made even better with real clover honey, fresh orange peel and both pale and white wheat malts. Proff that brewing the perfect summer ale is a true art.', 'http://www.coors.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.7599, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4571, 998, 7, 77, 'Nadrazni 84', 'Praha', '', 'Czech Republic', 'Classic famous czech beer from Praha, one of the best beers of the world', 'http://www.staropramen.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.0685, 14.4067', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4572, 113, 3, 38, '1249-A Wicker Drive', 'Raleigh', 'North Carolina', 'United States', 'This dark brown ale is slightly sweet with a caramel and dark fruit finish. A show case of fine English malts, floor malted the old way. We use pale, chocolate, and crystal malts to produce a complex, but easy drinking dark ale. Very reminescent of northern English ales.', 'http://www.bigbossbrewing.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '35.8104, -78.6179', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4573, 113, -1, -1, '1249-A Wicker Drive', 'Raleigh', 'North Carolina', 'United States', 'Our KÃ¶lsch is a refreshingly pale German style Ale. It is cold fermented and cold conditioned to achieve a beautiful balance between biscuit malt flavors and floral hop notes. It is light bodied and finishes somewhat dry to enhance it''s easy drinking nature.', 'http://www.bigbossbrewing.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '35.8104, -78.6179', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4574, 76, 3, 38, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'This traditional American style brown ale has medium body with a sweet Carastan maltiness. A rich deep chocolate color, our Antler Brown Ale is mildly hopped with Mt. Hood hops. Check out the Antler tap handle... locally grown! This has been our most popular beer over the years... a very easy drinking brew.', 'http://www.barleycreek.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4575, 76, 3, 37, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'Another one of our most popular brews. Navigator Gold has a crisp and slighly hoppy finish. It''s cold filtered and moderately carbonated.', 'http://www.barleycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4576, 76, 8, 96, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'Our lightest brew, this ale has a lower alcohol content than other Barley Creek brews. The Munich malt and Saaz and Hallertau hops give it a distinct German profile. Refreshing with a clean, dry finish.', 'http://www.barleycreek.com/', 3.22, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4577, 76, 7, 86, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'Dark and delightful, this is an easy-drinking brew. Once a seasonal favorite now we brew it all the time as part of our variety case. Brewed with five different malts and three different hops, then pitched with Bavarian lager yeast.', 'http://www.barleycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4578, 76, 3, 31, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'Hopped four separate times with pure Centennial hops for one of the hoppiest brews around. With a nice dry finish, Rescue IPA is our Mug Club''s favorite.', 'http://www.barleycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4579, 76, 5, 67, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'A Belgian-style summer favorite. Malted wheat, Pale, Munich and Cara Vienna malt, then moderately hopped with Saaz and a double dose of Hallertau. Served unfiltered with an orange wedge, this is fun in a glass.', 'http://www.barleycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4580, 76, 7, 91, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'A German style lager. Light in color, with medium to full body and mild hop bitterness.', 'http://www.barleycreek.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4581, 76, 3, 35, 'RR 1 Box 185', 'Tannersville', 'Pennsylvania', 'United States', 'First brewed in 1998 to be served on our fifth anniversary (December 15, 1999), this beer just gets better every year. And, every year around our anniversary, we brew a new vintage. With an original gravity of 1099, this Barley Wine is dark and sweet, and is served in a snifter like an after-dinner drink. You''ll want to savor it slowly.', 'http://www.barleycreek.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '41.0523, -75.3354', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4582, 209, 5, 67, 'Hindenburgstrasse 9', 'Bayreuth', '', 'Germany', '', 'http://www.maisel.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '49.9477, 11.5659', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4583, 1023, 11, 116, 'Emil-Ott-Strasse 1-5', 'Kelheim', '', 'Germany', '', 'http://www.schneider-weisse.de', 5.40, 0.00, 0.00, 0, '9999-01-01', '48.9175, 11.8735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4584, 512, 8, 95, '811 Edward Street', 'Utica', 'New York', 'United States', 'Our classic German lager has a perfect balance of caramel malt sweetness. Look for a rich, amber color and medium body.', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4585, 1099, 3, 37, 'High Street', 'Tadcaster', 'North Yorkshire', 'United Kingdom', 'A delicately flavored golden ale in which subtle fruity esters from the Samuel Smith yeast strain interact with a background of maltiness and fresh hops.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '53.8834, -1.2625', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4586, 549, 3, 43, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'A fine companion to end a meal or relax in front of the hearth with, this robust ale will cellar well for years. Brewed with ten varieties of malted barley this stout is extremely smooth, complex and rich in body. We recommend serving at cellar temperature. Sit back and enjoy its richness and complexity, your about to drink the ultimate winter warmer.', 'http://www.foundersbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4587, 549, 3, 26, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'A testament to Cascade hops in a bottle. Our medium-bodied, Pale Ale has a distinctive floral hop aroma and refreshing citrus flavor. Founders Pale Ale has a slight malty sweetness with a balanced hop finish. A perfect beer to enjoy while mowing the lawn, boating, grilling with friends or just taking it easy.', 'http://www.foundersbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4588, 549, 11, 119, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'This beer will surprise you with a big hop flavor and a toasty sweet aroma. Pours black from the chocolate and de-bitterized black rye malts. This ale is medium bodied and is well flavored with hints of toffee, nutty undertones and a dry crisp finish.', 'http://www.foundersbrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4589, 549, 3, 43, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'You''ve got to love coffee to truly appreciate this phenomenal brew. Brewed with an abundance of flaked oats, bitter and sweetened imported chocolates, Sumatra and Kona coffee. Breakfast Stout has an intense fresh roasted coffee nose toped with a cinnamon colored frothy head that seems to never fade and makes you wish breakfast could last forever.', 'http://www.foundersbrewing.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4608, 512, 8, 95, '811 Edward Street', 'Utica', 'New York', 'United States', 'Brewed with a special blend of domestic and Belgian malts for a delicate nut-like character, you''ll love this Lager''s rich taste and signature hop aroma. The exceptional full-bodied taste reflects our Brewery''s extraordinary commitment to brewing beers of the highest standard of quality.', 'http://www.saranac.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4590, 549, 11, 121, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'As promised Founders Brewing Company has created something unlike the rest. Amongst this summers over croweded race to cloudy wheat beers, we have decided to embark down a path all our own. Using only fresh rasberries, rubaeus translates into intese flavors combined with a no hesitation malt bill. In fermentation we add fresh rasberries at five separate stages to achieve the ulttimate balance between tartness and sweetness.', 'http://www.foundersbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4591, 549, 1, 13, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'This Old Ale conjures up thoughts of classic sea fairing ports, there local pubs and the weathered fisherman that frequent them. In traditional style Curmudgeon is brewed with an intense focus on the malt bill creating a very strong, rich, malty characteristic and a sweetness indicative of its cousin the barleywine. We are especially proud of the balance in this beer making it deceptively smooth and drinkable at 9.3% alcohol by volume.', 'http://www.foundersbrewing.com/', 9.30, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4592, 549, 3, 43, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'A bit of backwoods pleasure without the banjo. This stout is brewed with a hint of coffee and vanilla then aged in oak bourbon barrels. Our process ensures that strong bourbon undertones come through in the finish in every batch we brew. We recommend decanting at room temperature and best enjoyed in a brandy snifter.', 'http://www.foundersbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4593, 549, 3, 32, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'Founders most complex, most innovative, most feared and yet most revered ale produced. Massive in complexity the huge malt character balances the insane amount of alpha''s used to create this monster. More IBU''s than any brewery has documented, more than you would believe and dry-hopped for twenty-six days straight with a combination of 10 hop varieties. Dangerously drinkable and deliciously evil. We dare you to dance with the Devil.', 'http://www.foundersbrewing.com/', 13.00, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4594, 549, 11, 119, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', 'Pours a spectacular crimson red with a creamy tan head. Brewed with four varieties of Belgian caramel malts imparting a sweet richness. Red''s Rye is impressively balanced with its hop bitterness and huge citrus bouquet achieved from the immense amarillo dry hop. The generous amount of malted rye used accentuates a spicy crisp finish.', 'http://www.foundersbrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4595, 512, 3, 26, '811 Edward Street', 'Utica', 'New York', 'United States', 'A beer that would make the English jealous! This true English Pale Ale is rich and fruity, yet finishes crisp. You''ll love the copper amber color and medium body.', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4596, 512, 3, 38, '811 Edward Street', 'Utica', 'New York', 'United States', 'This Brown Ale is brewed with American malt and hops, and traditional ale yeast. Look for a sweet, chocolaty taste, with balanced bitterness resulting in a full flavored but smoothly drinkable beer.', 'http://www.saranac.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4597, 512, 3, 31, '811 Edward Street', 'Utica', 'New York', 'United States', 'A hop lover''s delight. In the India Pale Ale tradition this brew is very hoppy in both aroma and flavor from the generous amounts of cascade hops used in brewing. Look for a medium to full body and golden straw color.', 'http://www.saranac.com', 5.80, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4598, 512, 7, 86, '811 Edward Street', 'Utica', 'New York', 'United States', 'A Bavarian black beer with distinctive carmel malt sweetness and rich creamy trademark head. Flavorful, yet smooth; it is very drinkable!', 'http://www.saranac.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4599, 512, -1, -1, '811 Edward Street', 'Utica', 'New York', 'United States', 'A beer lover''s dream! This classic irish stout and amber lager blend is malty, yet pleasantly bitter with many complex flavor notes. Look for a deep brown-black color and full-body.', 'http://www.saranac.com', 5.10, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4600, 512, 8, 95, '811 Edward Street', 'Utica', 'New York', 'United States', 'A simple well-made Classic American Lager brewed with only choice ingredients. It is extremely mellow refreshingly smooth, glass after glass.', 'http://www.saranac.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4601, 512, 11, 121, '811 Edward Street', 'Utica', 'New York', 'United States', 'This wholesome combination of unfiltered wheat beer and real pomegranate juice makes a smooth refreshing beer with all the goodness of pomegranate. Look for a light body with a slight tart finish and golden straw color.', 'http://www.saranac.com', 4.70, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4602, 512, -1, -1, '811 Edward Street', 'Utica', 'New York', 'United States', 'This golden sparkling blond ale was brewed to pay homage to a 1000-year tradition rooted in Cologne, Germany. Clear, crisp and easy to drink, the Kolsch of today is lighter than the "House" beer that was served in Cologne 200 years ago - the city that made Kolsch famous. We hope you''ll enjoy it!', 'http://www.saranac.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4603, 512, 5, 67, '811 Edward Street', 'Utica', 'New York', 'United States', 'Our Belgian Style White beer is smooth, tangy and very thirst quenching. Brewed with a delicate combination of oats, wheat and barley malt, we season it ever so lightly with hops. Then we add sprinklings of coriander and orange peel for a refreshing brew with a citrus aroma. Don''t be fooled by the cloudy appearance, that''s expected of a classic Belgian-style "Whitbier" or white beer.', 'http://www.saranac.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4604, 512, 11, 116, '811 Edward Street', 'Utica', 'New York', 'United States', 'ith more than 2,800 bodies of water in the Adirondacks, it''s not too hard to find a sunny place to relax, rest your feet and look out over the water. To celebrate summer in the Adirondacks, we''ve brewed a beer with generous amounts of wheat malt for a light, refreshing taste. Look for subtle hints of lemon.', 'http://www.saranac.com', 4.70, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4605, 512, 7, 77, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Pilsener is a light bodied American Wheat Beer that is judiciously hopped with Cascade and Tettnang hops. "Dry-Hopping" imparts the distinctive hop aroma and finish. Look for a smooth, crisp taste and brilliant golden color. Enjoy!', 'http://www.saranac.com', 5.10, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4606, 512, 7, 84, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Octoberfest is a med-bodied, copper colored lager. It''s rich, malty taste is subtly balanced by Saaz and Tettnang hops. The beer is aged slowly in the tradition of the Octoberfest beers of Munich.', 'http://www.saranac.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4607, 512, 11, 123, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Pumpkin Ale is brewed with Pumpkin, Cinnamon, Allspice, Cloves, Ginger and Vanilla. Look for a full-body and amber color. We''re sure you''ll enjoy this special brew!', 'http://www.saranac.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4706, 280, 5, 60, '', 'Achel', '', 'Belgium', '', 'http://www.achelsekluis.org/', 8.00, 0.00, 0.00, 0, '9999-01-01', '51.2515, 5.546', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4609, 512, 2, 25, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Caramel Porter is a Robust, flavorful porter Reminiscent of a by-gone era. True to brewing tradition, we''ve used dark caramel malt, as well as Fuggles and East Kent Goldings hops for smooth, yet slightly bitter, roasted flavor, look for hints of the real caramel used in brewing this delicious beer!', 'http://www.saranac.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4610, 512, 7, 90, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Black Diamond Bock is a rich, malty brew, made with traditional German malts and hops and fermented with a lager yeast. Aged for months for a rich but smooth malty taste. A nice reward for enduring your winter months.', 'http://www.saranac.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4611, 512, 1, 21, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Oatmeal Stout is brewed with a delicate balance of the finest grown oats, selected hops, and our traditional ale yeast. Look for a sweet, dark chocolate and roasted taste.', 'http://www.saranac.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4612, 512, 7, 90, '811 Edward Street', 'Utica', 'New York', 'United States', 'Brewed in the tradition of great German Bock beers with only German malts and hops, using 20% rye, malt to give it a distinctive spicy, yet smooth character. You''ll love the rich flavors and deep red color of this unique German Brew.', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4613, 512, -1, -1, '811 Edward Street', 'Utica', 'New York', 'United States', 'Bigger..Richer...Smoother, are all ways to describe a Marzenbier. Look for a toasted malt character balanced with slight hop bitterness. Marzenbiers are traditionally aged for months and unveiled to great celebration.', 'http://www.saranac.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4614, 512, 3, 38, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Nut Brown Ale''s soft mellow malt character is rich and smooth with a medium body. Look for hints of toasted malt flavor, slight hop bitterness and amber brown color.', 'http://www.saranac.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4615, 512, 3, 42, '811 Edward Street', 'Utica', 'New York', 'United States', 'Combines the rich roasted flavor of our traditional stout with a deep, robust mocha. Look for a full-bodied taste with a crescendo of complex flavor notes.', 'http://www.saranac.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4616, 512, 1, 15, '811 Edward Street', 'Utica', 'New York', 'United States', 'We use 100% Scottish Maris Otter Malt. Traditionally used in the distilling industry. The combination of the Scottish Malt and slow aging process produces a unique brew as distinctive as single malt whiskey with a flavor than any other beer.', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4617, 512, 5, 72, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Belgian Ale is Deliciously Fruity. It is brewed with a generous amount of Belgian Aromatic Malt, Hand selected hops, and a traditional Belgian ale yeast. Brewed in the "Trappist Style".', 'http://www.saranac.com', 5.90, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4618, 512, 11, 121, '811 Edward Street', 'Utica', 'New York', 'United States', 'This Delicious Fruity ale is brewed with blackberries, raspberries and sweetened with a touch of blueberry honey. Light and refreshing.With a reddish-Amber color, be sure to look for the ale bitter and berry sweetness. Enjoy!', 'http://www.saranac.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4619, 512, -1, -1, '811 Edward Street', 'Utica', 'New York', 'United States', 'There comes a time every year in the Adirondacks when a heavier, more malty brew compliments the cold winter months. This brew showcases a variety of dark roasted malts, producing a beer with a rich chocolaty flavor.', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4620, 512, 7, 90, '811 Edward Street', 'Utica', 'New York', 'United States', 'Bock is not from the bottom of the barrel! It is a rich malty beer brewed with traditional German ingredients and aged for months to give it a smooth malty character. Look for a rich full-bodied beer.', 'http://www.saranac.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4621, 512, -1, -1, '811 Edward Street', 'Utica', 'New York', 'United States', 'This malty German style lager is brewed with Bamberg smoked malt using only the best German hops and traditional lager yeast. Look for a smooth malty flavor with a hint of smoke in the finish.', 'http://www.saranac.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4622, 512, 1, 5, '811 Edward Street', 'Utica', 'New York', 'United States', 'Bitters are popular pub beers in England and are closely related to the more well known pales ales. Saranac Extra Special Bitter has a rich, malty taste balanced by the pleasant bitterness of Williamette Hops. The finish is dry with a hint of the Foral English Fuggle and Spicy Saaz hop. Enjoy!', 'http://www.saranac.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4623, 512, 3, 32, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Imperial IPA is part our new High Peak Series, a line of beers that are bigger, more complex and flavorful; beers that are meant to be sipped and savored. Saranac Imperial IPA is brewed with 10 different malts and 10 different hops to make a delectably flavorful and complex Imperial IPA - at 85 IBU''s and 8.5 % alc/vol.', 'http://www.saranac.com', 8.50, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4624, 512, 3, 43, '811 Edward Street', 'Utica', 'New York', 'United States', 'Saranac Imperial Stout is part of our "High Peaks Series," a line of beers that are bigger, more complex and flavorful; beers that are meant to be sipped and savored. Saranac Imperial Stout is brewed with 11 malts to balance a deliciouse chocolate and coffee roasted flavor with a spicy herbal character of the generous kettle and dry hops.', 'http://www.saranac.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4625, 512, 1, 15, '811 Edward Street', 'Utica', 'New York', 'United States', 'This Scotch Ale is a full-bodied, malty sweet ale. True to Scottish brewing tradition, this malty flavor and deep copper brown color are a result of Scottish two row malt and roasted barley.', 'http://www.saranac.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.1045, -75.2452', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4626, 674, 3, 33, '6300 Folsom Boulevard', 'Sacramento', 'California', 'United States', 'Hoppyâ€™s gift to those who like their beers Malty. Dark Caramel and Chocolate Malts lend their deep crimson silkiness, and judicious additions of Nugget and Cascade hops give just enough bitterness for balance. Ask your serverâ€™s favorite beer and itâ€™s probably this one.', 'http://www.hoppy.com', 5.60, 0.00, 0.00, 0, '9999-01-01', '38.5551, -121.43', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4627, 538, 3, 37, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'Our lightest beer in body and color, Humbles has proven to be our most popular offering.', 'http://www.eatatflyers.com/', 3.50, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4628, 538, 4, 50, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'A Bavarian style Hefeweizen, a cloudy brew with slight hints of bannana and clove. Light and refreshing.', 'http://www.eatatflyers.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4629, 538, 8, 95, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'This copper colored lager is brewed with hybrid yeast that ferments at warmer temps, giving that clean refreshing taste of a lager with the slight fruitiness of an ale.', 'http://www.eatatflyers.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4630, 538, 1, 3, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'An English style ale, copper in color with subtle English malt hints balanced nicely with fresh Washington grown Yakima Valley hops.', 'http://www.eatatflyers.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4631, 538, 3, 31, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'A hop lover''s delight! Our I.P.A. is loaded with Ahtanum, Tohmahawk, Palisade, East Kent, Goldings and finished with the ever popular Cascades, balanced with generous amounts of floor malted crisp Maris Otter barley.', 'http://www.eatatflyers.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4632, 441, 3, 32, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'HOP HENGE IMPERIAL IPA â€“ The Ultimate in Hop Innovation Hop Henge Imperial IPA returns to the Bond Street Series line-up this April in extreme fashion. Staying true to the experimental nature of the series and the â€œnever settleâ€ philosophy of Deschutes, our brewers went back to the drawing board to create an amplified version of last yearâ€™s monument to hops. Head Brewer Brett Porter says, â€œThis is a truly exciting and groundbreaking beer. We reformulated everything about the hop recipe to give Hop Henge an extraordinary aroma and flavor similar to a fresh hop beer.â€ In addition to the Cascade and Centennial hops, Deschutes Brewery is experimenting with a hop variety so new that it has yet to be named. The team here at Bend Public House recommends Hop Henge as the perfect accompaniment for a variety of spicy foods, so be sure to have a bottle handy next time you make a batch of hot wings and go for the five alarm award. The high-octane hoppiness is a wildly refreshing antidote to a wide array of hot foods. Limited Availability April through June. Donâ€™t miss this amazing hop experiment that is sure to leave your taste buds begging for more. -http://www.deschutesbrewery.com/Brews/Bond+Street+Series/default.aspx Available April through June. Hop Henge I.P.A. was first brewed in 2006 as an agressive West Coast style I.P.A. In 2007, Hop Henge is going Imperial! Several pounds of Centennial, Cascade and Northern Brewer hops are in each barrel with a heavy dry-hop presence to top it off. A blend of crystal, pale and caraston malts creates an overall biscuity characteristic that is dense and muscular, building the alcohol base to support the monstrous hop profile. Like the rest of the Bond Street Series, Hop Henge highlights the creativity and curiosity of our brewers. Bolder than its English ancestors, with huge hops and a bitter finish, this IPA is no wallflower. Alcohol By Volume: 8.1% IBU 95 When one of our brewers suggested we name our new IPA Hop Henge, he also came up with the idea of actually recreating Stonehenge, only with hop bales. We were up for the challenge and even though the weather did not want to cooperate, we pulled it off and threw a party afterwards. photo: chris mather Ratings, Awards & Notables World''s Best Strong Pale Ale (Imperial IPA) 2007 World Beer Awards World''s 50 Best Beers 2006 International Beer Challenge Gold Medal, 92 Points 2006 World Beer Championships Silver Medal, India Pale Ale Category 2006 Australian International Beer Awards Modern Brewery Age, February 12, 2007 5 out 5 stars Hop Henge started its life as an India Pale Ale, but this year it was bumped up to â€œImperial IPAâ€ status, with a hefty dose of additional hops. â€œThis one is lovely,â€ said taster Tom Conti. â€œThey got it just right.â€ It pours out a deep amber, with an appealing rocky head, and rich hop aroma wafting from the glass. â€œThey sure dosed it with a lot of hops...[thereâ€™s] a lot of hop bitterness in the taste,â€ one taster observed. In addition to the Imperial-level hopping, Hop Henge also boasts Imperial-level alcohol content, with 8.1% a.b.v. This was the top-rated beer during its tasting session, and tasters had to dig deep for new superlatives to describe it. â€œThis is a beautiful beer,â€ concluded taster Gregg Glaser. â€œFull of flavor and hops and malt and hops again.â€ â€œNot for the timid,â€ said taster Robert Lachman. -http://www.deschutesbrewery.com/BrewPub/OnTap/125352.aspx', 'http://www.deschutesbrewery.com/', 8.75, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4633, 538, 3, 33, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'Our first beer brewed right here at Flyers. This ale has brownish red hues with a mild maltiness balanced by an herbal hop character without being bitter.', 'http://www.eatatflyers.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4634, 538, 3, 38, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'As the name implies, a rich deep brown ale in color with dark amber highlights. The flavor is slightly sweet with hints of nuts and toffee finishing smooth with no after taste.', 'http://www.eatatflyers.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4635, 538, 2, 25, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'A robust porter in style, a dark and full bodied ale with hints of roasted barley and flavors of coffee and bitter sweet chocolate on the palate.', 'http://www.eatatflyers.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4636, 538, 3, 43, '32295 State Route 20', 'Oak Harbor', 'Washington', 'United States', 'A rich and very dark Imperial Stout that has a complex flavor profile with hints of molasses and caramel. Brewed in July to allow time for aging, Sick Duck finishes very smooth for such a big beer.', 'http://www.eatatflyers.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '48.2992, -122.652', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4637, 314, -1, -1, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'Clean, crisp, easy drinking Colonge, Germany style ale. Kolsch''s smoothness comes from special Kolsch yeast, German Hallertau hops, a slow fermentation and lager like conditioning.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4638, 459, -1, -1, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'This is a hybrid of ale and mead made with 51% malted barley (Pale and Munich malted barley) and 49% Orange blossom honey, it is lightly hopped, spiced with Hibiscus flowers and fermented with Australian ale yeast. Our Milton, DE microbrewery brewer Jon Talkington came up with this beer because of his love of different kinds of meads and his interest in Nordic lore and mythology. The name Beewolf is the name Beowulf translated, meaning bear. Color- light amber. Aroma- Pear like fruitiness, with a clean malt and floral honey nose. Flavor- sweet malt and honey with a subtle fruitiness and a hint of caramel. ABV 7.0% IBU''s 25 Due to the limited availability of Beewolf Braggot, we are sorry that we are not able to offer growlers to go.', 'http://www.dogfish.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4639, 314, 3, 33, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'This was the first draught on tap in November 2001. It has developed to a very quaffable ale. the slight sweet malt flavor is balanced with East Kent Golding hops to produce this delicious reddish-amber ale.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4640, 314, 3, 42, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'This dark full bodied stout is perfect with a meal or as a meal. Rolled oats give this beer an enjoyable mouthfeel while chocolate and roasted malts lend to its distinctive flavor.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4641, 314, 11, 121, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'The perfect thirst quenching summertime ale. The subtle flavor of kiwi and strawberry blend with traditional German wheat and hops. Great for a hot summer day.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4642, 314, 3, 38, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'Another one of our first recipes, which we have improved with experience. This ale is pleasantly malty with nutty and toffee like undertones. East Kent Golding hops were used to compliment this English style ale.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4643, 314, 4, 50, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'This traditional German-style wheat beer is rich in banana and clove undertones, with a wonderful frothy head.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4644, 314, 3, 31, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'Bube''s rendition of this classic style is made with fine 2-row malted barley and West Coast hops. A wonderful malt finish with a delicate citrus aroma, reminiscent of its Old-World cousin.', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4645, 1286, 4, 55, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Red and white wheat combined with darker malts add body to this hazy, unfiltered ale. Fermented with the same yeast as DreamWeaver Wheat replicating the pepper, clove and all-spice flavors found in our year-round beer.', 'http://www.troegs.com/', 7.90, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4646, 1286, 1, 3, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Next up, we present Scratch Beer #11-2008, a Bitter. Back in the day, we used to brew a little number called TrÃ¶egs ESB. Even though this beer was retired almost six years ago, we still get numerous TrÃ¶egs old-schoolers (Martha) begging for its return. Well hang onto your boot straps because Scratch #11 is about as close as we can get to the original ESB without firing up the old brew kettle. The Scratch #11 recipe originates from Chrisâ€™ stint at Englandâ€™s University of Sunderland brewing program. After returning to Colorado the brothers drew on Chrisâ€™ experience and brewed pilot batches tweaking that recipe. The ESB production recipe has direct bloodlines to these pilot batches. The Thames Valley ale yeast and the roasted barley create a biscuit flavor with nutty undertones. Combining these flavors with the earthiness of East Kent Golding hops creates one hell of a fine session beer. Take in the deep mahogany beauty of this beer and breathe in the full hoppy nose. Itâ€™s not the ESB, but itâ€™s damn special.', 'http://www.troegs.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4647, 1286, 5, 61, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'he third time just might be the charmâ€”Scratch #10-2008 is our third triple in the Scratch Beer series. This grand cru has been lovingly aged since late-February, yet still unleashes the slightest hint of alcohol heat. Scratch #10-2008 also has a triple flavor inspiration combining the caramel/toffee notes of dememera sugar and molasses, with citrus and licorice flavors created by the orange peel and star anise; lastly we create a peppery/spicy finish with the same trappist yeast has been used in each Scratch Beer Triple.', 'http://www.troegs.com/', 10.20, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4648, 1286, 5, 61, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Revisiting Scratch #3, we take the same Tripel recipe, add beet and cane sugars to the kettle, and run the wort through our hopback brimming with juniper berries, coriander and yarrow flowers. Inspired by the herbaceous nose of gin, the berries and flowers give a slight pine/citrus aroma with floral undertones. Scratch #8 has a dry, yeasty finish and noticeable alcohol warming when consumed.', 'http://www.troegs.com/', 10.10, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4649, 1286, 8, 95, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Old world brewing techniques combine with Noble hops for Scratch #6-2007. This Export Lager features a single stage decoctionâ€”a first for TrÃ¶egs Brewery. After combining barley and water we transfer a portion of the mash to the brew kettle for a quick boil. The heated mash is then returned to the mash kettle and the brewing process continues. This process deepens the malt character and adds a subtle toffee backbone to this delicious lager. Weâ€™ve added Magnum hops for bittering and Czech Saaz hops for aroma to create a classic European Noble hop flavor. Scratch #6-2007 is unfiltered, so there will be a slight haze to the beer.', 'http://www.troegs.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
