INSERT INTO beerbuddies_db.beer VALUES (4656, 90, 2, 25, '636 East Main Street', 'Louisville', 'Kentucky', 'United States', 'Think of Guinness but with a "smooth bite" to it. This is a wonder beer for those of us who enjoy a porter.', 'http://www.bluegrassbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.2546, -85.7401', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4657, 55, -1, -1, '15 Knox Rd.', 'Bar Harbor', 'Maine', 'United States', 'It does have a nice hint of wheat and blueberries to it.', 'http://www.atlanticbrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.3996, -68.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4658, 90, 4, 50, '636 East Main Street', 'Louisville', 'Kentucky', 'United States', 'It is a good clean hefe.', 'http://www.bluegrassbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.2546, -85.7401', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4659, 459, 3, 29, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A deep, mahogany ale brewed with beet sugar, green raisins, and Belgian-style yeast. As complex as a fine, red wine. Voted "American Beer of the Year" in January 2000 by Malt Advocate Magazine.', 'http://www.dogfish.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4660, 459, 11, 121, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A strong ale brewed with a ridiculous amount of pureed raspberries (over a ton of em!).', 'http://www.dogfish.com', 18.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4661, 459, 3, 26, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Lawnmower is our intro for those who need a little help jumping feet first into the crazy world that is Dogfish Head beer. It''s a starter beer, but it''s not dumbed down. Lawnmower is made with quality ingredients and is a great thirst quencher - perfect to enjoy after a day in the sun mowing the lawn (or anything else that gets you hot and bothered)! Draft-Only, Limited Distribution', 'http://www.dogfish.com', 4.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4662, 459, -1, -1, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'This beer is based on chemical analysis of pottery fragments found in Honduras which revealed the earliest known alcoholic chocolate drink used by early civilizations to toast special occasions. The discovery of this beverage pushed back the earliest use of cocoa for human consumption more than 500 years to 1200 BC. As per the analysis, Dogfish Headâ€™s Theobroma (translated into ''food of the gods'') is brewed with Aztec cocoa powder and cocoa nibs, honey, chilies, and annatto (fragrant tree seeds).', 'http://www.dogfish.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4663, 459, 11, 121, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A belgian-style Strong ale fermented with blackberries and blueberries.', 'http://www.dogfish.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4664, 459, 5, 67, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A big, belgian-style Wit brewed with coriander and orange peel and fermented with Pinot Noir juice. After fermentation a fraction of the batch is aged in Oregon Pinot Noir barrels, and another fraction is aged on oak staves. The beer is blended together before packaging. This has been one of our most popular Limited Edition beers at both our Rehoboth Beach, DE brewpub and at festivals. It successfully marries the refreshing citrusy qualities of a Belgian-style white beer with the robust complexity of a bold red wine.', 'http://www.dogfish.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4665, 459, 11, 121, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Brewed with luscious apricots, finished with whole-leaf hops. A "fruit beer for hop heads..." Ale Street News', 'http://www.dogfish.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4666, 1235, 3, 33, '', 'La Crosse', 'Wisconsin', 'United States', '', 'http://www.taproom21.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '43.8014, -91.2396', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4667, 741, -1, -1, '', '', '', 'Japan', 'From Brewery''s site: With his gold label and Special Premium Reserve appellation, Ichiban outclasses and outperforms. In 1990, Ichiban''s debut made a splash in the world of super premium beers. The luxurious single wort (or first press) process yields a unique, complex flavor. With his gold label and "Special Premium Reserve" appellation, Ichiban outclasses and outperforms. But don''t be fooled by a snooty attitude -- this is a great beer that goes with anything. What makes Ichiban great Prominent wort. Finest barley malt, premium hops, smooth finish, no bitter aftertaste.', 'http://www.kirin.com/', 4.95, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4668, 741, 8, 96, '', '', '', 'Japan', 'From Kirin''s Site: With just 95 calories and full-flavor, Kirin Light is one of the few great world-class Lights. You might think Kirin Light would be a lightweight contender, content to let his sturdier siblings steal the show. But this fitness-minded newcomer won''t compromise. You won''t have to compromise either - with just 95 calories and full flavor, Kirin Light is one of the few great world-class lights. What makes Kirin Light great Canadian barley malt, Czech hops, rich golden color', 'http://www.kirin.com/', 3.31, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4707, 280, -1, -1, '', 'Achel', '', 'Belgium', '', 'http://www.achelsekluis.org/', 9.50, 0.00, 0.00, 0, '9999-01-01', '51.2515, 5.546', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4669, 459, 11, 126, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', '9000 year old Chateau Jiahu stands apart as the most ancient, chemically-attested alcoholic beverage in the world. Its recreation is based on painstaking excavation by Chinese archaeologists of Jiahuin the Yellow River basin, state-of-the-art microanalysis of pottery residues by American laboratories, and the inspired "Neolithic" brewing of Dogfish Head Craft Brewery. Chateau Jiahu, then as now, opens a window into the world of our ancestors.', 'http://www.dogfish.com', 9.50, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4670, 1248, 3, 26, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'When the British introduced draught pale ale to America, the Pipe Organ Pale Ale is what they had intended. It is truly British in character. Brewed with pale ale malt and a touch of caramel malt, it has a light copper color and subtle body. The maltiness is carefully balanced with only the best English hops - East Kent Goldings. Although this beer has a fair amount of hops, the caramel maltiness perfectly balances its profile.', 'http://churchbrew.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4671, 1248, -1, -1, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'Gold Medal Winner of the Great American Beer Festival. Our beer is fairly dark in color, but donâ€™t be afraid. It is a perfect example that dark beers are not always strong beers. The body is surprisingly mellow, and the alcohol content is a bit lower than most people might think. It has a wonderfully clean and roasty aroma. Hop bitterness levels are kept in line, but is has a noticeable hop flavor.', 'http://churchbrew.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4672, 1248, 5, 61, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'A Belgian Trippel is a very special type of beer. A Belgian Trippel could be called the beer version of a Champagne. It is very light in color and highly carbonated giving an appearance similar to Champagne. The flavor is somewhat sweet and malty as well as strong.', 'http://churchbrew.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4673, 1248, 7, 77, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'This beer is golden in color with a light bubbly effervescence. The light body makes this lager beer appropriate for a business lunch or your evening sipping beer. The light malt flavor also accentuates the hop flavor. From the start, you will notice a fine hop aroma. As you sip the Celestial Gold, the subdued maltiness blends with a slight hop flavor. When this beer finishes, you will notice a pleasant hop bitterness. The bitterness will be mild and quite appropriate. Celestial Gold has been known to induce Celestial bliss.', 'http://churchbrew.com/', 4.10, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4674, 1248, 1, 21, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'Stouts have typically been a staple beverage in the UK. There are many variations of stouts available. You can find dry stouts, milk stouts, Imperial stouts, American stouts, and even stouts made with oats. At the Church Brew Works we have crafted delicious Toasted Oatmeal Stout. The oats were blended with the best barley malt we have â€“ and we didnâ€™t stop there. To give this beer a wonderful roasted flavor, we added unmalted, very darkly roasted barley. The roasted barley is mixed with a generous portion of chocolate colored malt giving the Blast Furnace Stout a beautiful ruby hue. We used our finest hops unsparingly to create a delicately balanced bitterness with a rich roastiness and fresh hop aroma. The Fuggles and East Kent Goldings hops were added with heavy hands at two different times. This unbridled addition grants a full hop flavor to our heavenly drink. A typical oatmeal stout is a bit lower in alcohol than most other stouts as does the Blast Furnace Stout. Ours, though not typical, does have a welcome medium body. As you drink this beer, notice the rich, creamy brown head. Drink it slowly and savor the flavors. We donâ€™t think you will be disappointed. Beer is not just for breakfast anymore.', 'http://churchbrew.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4675, 1248, 7, 84, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'Our Oktoberfest is a light amber colored beer. It is malty in both flavor and aroma making it a delicate beer which is very drinkable. The hop bitterness is kept low to accentuate the maltiness. Notice the crisp clean character and enjoy. We brewed three batches of this beer so that we can bottle some of it in order to enhance our bottle beer selection.', 'http://churchbrew.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4676, 1248, 7, 91, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'A bock beer is required by German law to start at 17Â°Plato. For those who are interested, Â°Plato is a measurement of the sugar content before fermentation. It is a very malty lager beer with medium hop bitterness. A maibock is a light to amber colored bock beer. A Maibock is very similar to a Helles/pale bock. Maibocks were originally brewed for the coming of spring, hence the name Mai (German for May). The Mad Brewer Maibock is medium amber in color. Though similar in color to our Pipe Organ Pale Ale, it is very different in character. Donâ€™t let it get you though, itâ€™s a very strong beer at about 7% alcohol. It has a very clean and malty nose. The hop bitterness is evident, but not dominant. The Mad Brewer Maibock will finish quite full and have a delicate sweetness.', 'http://churchbrew.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4677, 1248, 4, 50, '3525 Liberty Avenue', 'Pittsburgh', 'Pennsylvania', 'United States', 'Iâ€™m sure everyone here knows, Pittsburgh has some humid summers. What can you do to escape the heat and enjoy yourself? Well Iâ€™ve got the answer. How about a light thirst quenching Hefe Weizen (pronounced hefa Vite zen) in the cool environment of our Hop Garden patio. I can hear you wondering, what is a hefe weizen? Allay your fears my friends because Iâ€™m going to tell you. A hefe weizen is a special style of beer made with malted wheat and malted barley. Hefe weizens are from Germany. This beer is top fermented (an ale) with a very special yeast. The Hop levels are kept deliberately low in order to bring out the character of the yeast. If you notice the nose of the beer, it has a clove-like or fruity aroma. The grain bill includes 50% wheat malt and 50% barley malt. It is served very carbonated and a touch cloudy. It is cloudy because it is served unfiltered. The remaining yeast contributes flavor, adds B vitamins, and improves the beer as it ages.', 'http://churchbrew.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.4624, -79.9645', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4678, 1286, 3, 31, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'In our never-ending pursuit of answering the burning question of whatâ€™s new, we present Scratch #12-2008, an IPA. The IPA is a fickle beast; too much malt and you veer into a high-octane hopbomb, while too little hops can question a beerâ€™s virility. In these chaotic days of shrinking hop harvests, balance is key to a proper IPA. Scratch #12-2008 delivers an intense pine nose married with a subtle wildflower aroma. The Thames Valley yeast adds an earthy nod to traditional English IPAs, while the American hops provide a bold contrasting bitterness. Breath deep, relax, enjoy.', 'http://www.troegs.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4762, 882, 3, 31, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'Like its namesake, this ale is known for the sneak attack. Hop-heads will enjoy its assertive bitterness and huge floral, dry hop aroma.', 'http://www.moonriverbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4679, 690, 7, 77, 'Brouwerijplein 1', 'Leuven', '', 'Belgium', 'Jupiler is the most famous and most popular beer in Belgium. This delicious lager is brewed with the finest ingredients (malt, maize, water, hop, yeast), using undisputed craftsmanship, ensuring an outstanding beer quality. Jupiler offers refreshment on a wide variety of occasions, thanks to its digestibility and accessible taste. Jupiler (5,2 % ABV) is ideally served at a temperature of 3Â°C. The low-alcoholic variant Jupiler N.A. (0.5%) should be served at 1-2Â°C. Jupiler has an outspoken image of masculinity, courage and adventure. Furthermore, Jupiler understands men like no other brand and shares their best moments. This combination of male bonding, self-confidence and self-relativation, speaks to all men and makes Jupiler an ally on their road through life. Jupiler is the official sponsor of the highest Belgian football division, the Jupiler League, and also supports the Belgian national football team. Just like football, Jupiler is all about competence and ruggedness, effort and effort reward, team spirit and... festivity!', 'http://www.inbev.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '50.8865, 4.7069', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4680, 263, 5, 62, 'Donkerstraat 12', 'Westvleteren', 'West-Vlaanderen', 'Belgium', 'This Belgian beer has an everlasting tast. It has been choosen as the best beer in the world for several years!', '', 11.20, 0.00, 0.00, 0, '9999-01-01', '50.8961, 2.7222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4681, 263, 5, 72, 'Donkerstraat 12', 'Westvleteren', 'West-Vlaanderen', 'Belgium', '', '', 5.80, 0.00, 0.00, 0, '9999-01-01', '50.8961, 2.7222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4682, 1013, 3, 43, '56 Market Street', 'Portsmouth', 'New Hampshire', 'United States', 'The granddaddy of stouts. Intended for export to the Imerial Court of Russia''s Catherine the Great. Jet black. Full-bodied. Very strong.', 'http://www.portsmouthbrewery.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '43.0781, -70.7575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4683, 1260, 3, 43, '9750 Indiana Parkway', 'Munster', 'Indiana', 'United States', 'Gargantuan Russian Stout brewed with coffee, molasses, and honey.', 'http://www.threefloydspub.com/', 13.00, 0.00, 0.00, 0, '9999-01-01', '41.5354, -87.5158', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4684, 1244, 3, 37, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'Our lightest beer, and our Bronze Medal Winner 2006 World Beer Cup German pilsner malt and American hops give this brew a light, crisp finish. Made with the light beer drinker in mind.', 'http://www.alchemistbeer.com/', 4.33, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4685, 1244, 3, 33, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'Named after Donovan''s, a 19th century Irish restaurant in downtown Waterbury. This medium-bodied, red-colored ale has a nice hop flavor and aroma.', 'http://www.alchemistbeer.com/', 5.16, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4686, 1244, 2, 25, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'This dark mahogany ale has agreat and delicious malt depth, yet is balanced with supple, energizing bitterness.', 'http://www.alchemistbeer.com/', 5.42, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4687, 1244, 3, 31, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'For hops lovers - this bitter ale is pale colored and made with a blend of 6 different malts and 5 different hops. This ale is dry-hopped for extra flavor and aroma.', 'http://www.alchemistbeer.com/', 5.16, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4688, 1244, 3, 32, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', '', 'http://www.alchemistbeer.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4689, 1244, 3, 26, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'An American pale ale made entirely with amarillo hops.', 'http://www.alchemistbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4690, 1244, 3, 31, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'Our holiday ale. This I.D.A., India Dark Ale, is crisp, bitter and overflowing with the aroma of spruce. Perfect for the holidays.', 'http://www.alchemistbeer.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
