INSERT INTO beerbuddies_db.beer VALUES (4699, 1244, 1, 10, '23 South Main Street', 'Waterbury', 'Vermont', 'United States', 'An American mild ale brewed with Horizon hops. The crisp, bitter finish is helpd up by a balanced malt body.', 'http://www.alchemistbeer.com/', 3.30, 0.00, 0.00, 0, '9999-01-01', '44.3372, -72.756', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4700, 296, 5, 67, 'Trappistenweg 23', 'Watou', 'West-Vlaanderen', 'Belgium', 'This traditional Witbier (Wheat beer) has been developed in cooperation with Master Brewer Pierre Celis, the Godfather of Hoegaarden and Celis White. This beer as well has a second fermentation in the bottle, giving this beer its specific taste (5.5% alcohol content).', 'http://www.sintbernardus.be', 5.50, 0.00, 0.00, 0, '9999-01-01', '50.8425, 2.6362', '2018-10-05');
