INSERT INTO beerbuddies_db.beer VALUES (4702, 378, 5, 72, 'Route de Charlemagne 8', 'Chimay', '', 'Belgium', 'Brewed from very similar ingredients as the Red, but paler and spiced differently. It is intended only to be drunk at the abbey or at the nearby inn Auberge de PoteauprÃ© which is associated with the abbey. The monks themselves drink this variety rather than the stronger three. The DorÃ©e is not sold commercially and the rare bottles which make their way out are through unofficial sources. Even the brewery''s own web site makes no mention of this variety.', 'http://www.chimay.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '50.0355, 4.3777', '2018-10-05');
