INSERT INTO beerbuddies_db.beer VALUES (4708, 441, 3, 43, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'The Abyss has immeasurable depth inviting you to explore and discover its rich, complex profile. Hints of molasses, licorice and other alluring flavors draw you in further and further with each sip. And at 11% alcohol by volume, you will want to slowly savor each and every ounce. November 2008 marks the third release of this dark and mysterious imperial stout. Limited availability in wax-dipped 22-ounce bottles and on draft at a few select establishments. â€œThe Abyss was one of those beers I didnâ€™t want to end. I was totally blown away - this is precious stuff.â€ Christian DeBenedetti, beer writer and Menâ€™s Journal contributor', 'http://www.deschutesbrewery.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4709, 441, 3, 33, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Discover Deschutes Breweryâ€™s intriguing amber ale, our Ode to Mother Earth. Experience its mellow malt profile intertwined with subtly surprising hop flavors. Green Lakes Organic Ale is brewed with five types of 100% organic malted barley and balanced with Liberty and Salmon-Safe Sterling hops. Easy to drink. Easy on the Environment. Downright Delicious. Who knew celebrating Mother Earth could taste so good. After working with Oregon Tilth for nearly six months, Deschutes Brewery received organic certification for its 50 barrel brew house and can now brew tasty organic ales for year-round enjoyment. Fish need cool clean water. So do you. Thatâ€™s why we sourced Salmon-Safe certified Sterling hops for our first organic beer. The way these flavorful, rich hops are grown makes sure that streams are shaded and there is not runoff to nearby waterways. That way the rivers stay cool and clean for migrating salmon. Not only is our Green Lakes beer organic, it helps protect our rivers as well.', 'http://www.deschutesbrewery.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4710, 441, 1, 3, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', '"The Traditional British Pint" lives on at Deschutes Brewery & Public House. One of the original three packaged beers, it is still available year-round, but only at our pub. Coppery in color and robust in flavor, Bachelor Bitter will leave your taste buds humming. Galena, Willamette and Kent Golding hops create fantastic hop bitterness, aroma and flavor. Bachelor Bitter also kicked off the Bond Street Series that launched in April 2005. The Bond Street Series is a specialty line of beers available in 22-ounce bottles.', 'http://www.deschutesbrewery.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4711, 441, 3, 26, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Stretching the longer summer days into Twilight! There is something magical about the time of day that falls between light and dark, the high-desert summer day fading into a warm evening with brilliant skies. Twilight Ale is a lighter, but full flavored ale with a balanced malt profile and a harmonious blend of four hops. A final dry hopping of bold Amarillos creates the distinctive finishing touch. Twilight is best enjoyed when chilled and consumed outdoors.', 'http://www.deschutesbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4712, 441, 7, 90, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Broken Top Bock is a malt forward, high gravity lager with a subtle aroma and warming sweetness. Czech Saaz hops balance a diverse malt composition that creates the flavor, color and mouth feel. The lager yeast chosen for this beer plays an important role in the flavor contribution, adding sweet fruit overtones. This bock boasts a clever 7% alcohol by volume so donâ€™t let it â€œkickâ€ you off of your stool.', 'http://www.deschutesbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4713, 430, 5, 72, 'Walplein 26', 'Brugge', 'West-Vlaanderen', 'Belgium', 'Brugse Zot is a goldenblond beer with a rich froth and a fruity flavouring. The beer is brewed with four different kinds of malt and two aromatic varieties of hop which give the beer its unique taste. With an alcochol degrees proof of 6 % Vol it is a well balanced, easy drinking beer with character. Brugse Zot is a natural beer born out of a selection of only the best ingredients. Thanks to the refermentation in the bottle, the beer has a longer natural life.', 'http://www.halvemaan.be/', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.2026, 3.2242', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4714, 430, 5, 72, 'Walplein 26', 'Brugge', 'West-Vlaanderen', 'Belgium', 'Besides the goldenblond ale, a darker version of the townbeer has been created : Brugse Zot double, with 7,5 % Vol alc. It is brewed with 6 special kinds of malt, which give the beer a rich taste. The worldly renowned Tcheque Saaz hop from Zatec has been chosen to give the beer this unique bitter note. Brugse Zot double is a fill and stronger beer, highly appreciated by the beerlovers.', 'http://www.halvemaan.be/', 7.00, 0.00, 0.00, 0, '9999-01-01', '51.2026, 3.2242', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4715, 1273, 5, 72, '', 'Westerlo', 'Antwerp', 'Belgium', 'DOUBLE BROWN 6Â° Red brown beer with a smooth gentle aroma, a full flavour and a slightly roasted aftertaste.', 'http://www.tongerlo.be', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.0873, 4.9178', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4716, 1273, 5, 72, '', 'Westerlo', 'Antwerp', 'Belgium', 'DOUBLE BLONDE 6Â° Copper-coloured beer with a honey aroma, a full and smooth flavour and a gently evolving aftertaste', 'http://www.tongerlo.be', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.0873, 4.9178', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4717, 1273, 5, 61, '', 'Westerlo', 'Antwerp', 'Belgium', 'Blond beer with a fruity and hoppy aroma and a balanced flavour with a slightly bitter aftertaste.', 'http://www.tongerlo.be', 8.00, 0.00, 0.00, 0, '9999-01-01', '51.0873, 4.9178', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4718, 1273, 5, 72, '', 'Westerlo', 'Antwerp', 'Belgium', 'TONGERLO CHRISTMAS 6,5Â° Copper-coloured beer of pure spring barley, with a touch of vanilla in the aroma, a fruity and complex flavour and a smooth aftertaste.', 'http://www.tongerlo.be', 6.50, 0.00, 0.00, 0, '9999-01-01', '51.0873, 4.9178', '2018-10-05');
