INSERT INTO beerbuddies_db.beer VALUES (4721, 826, 8, 96, '', 'Jacksonville', 'Florida', 'United States', '', 'http://www.landsharklager.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '30.3617, -81.6966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4722, 857, 11, 121, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A refreshing and delightful ale with the subtle flavor and aroma of apricots. A wonderful change from the ordinary. This is not a sweet fruit beer.', 'http://www.middleagesbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4723, 857, 3, 42, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Generous portions of roasted barley, black and chocolate malts which leave "coffee" overtones lingering on the palate.', 'http://www.middleagesbrewing.com/', 6.60, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4724, 857, 3, 35, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'An epic barleywine, made in the tradition of British Farmhouse Brewing. Lavished with a velvety blend of six different malts this is a warming beer with a lush mouthfeel. The complexities your discriminating palate will detect are ever changing as this barleywine matures. When young, an assertive hop character predominates and with age the beauty of the big malt balance unfolds.', 'http://www.middleagesbrewing.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4781, 669, 8, 96, '8113 Fenton St.', 'Silver Spring', 'Maryland', 'United States', 'The right choice when you desire a flavorful beer with a ''lighter'' body. Only 94 calories!', 'http://www.hookandladderbeer.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.9911, -77.0237', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4725, 857, 1, 15, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A Scottish-style brown ale with an attractive dark cherry color; a soft, lightly chewy body and a hint of licorice in its malt character. Rich and dark yet not too strong. 1996 Best Show at the Chicago Real Ale Festival.', 'http://www.middleagesbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4726, 857, 1, 15, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A Scottish "90/-" ale. Brewed only once a year, this ale is rich and full with a dryness that is beautifully balanced with a classic malt sweetness.', 'http://www.middleagesbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4727, 857, 1, 5, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Typically Yorkshire. A strong Ale in which all English grown hop varieties are used. The grassy earthy character of Kent Goldings hops is the keynote in the aroma and finish. Try with fish and chips or a meat pie.', 'http://www.middleagesbrewing.com/', 6.60, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4728, 857, 11, 121, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A scintillating ale with just the right amount of hops and ripe berry flavor.', 'http://www.middleagesbrewing.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4729, 857, 5, 67, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A wheat beer brewed in the style of a Belgian wit bier while using British ingredients. Lite and refreshing spiced with coriander and orange peel.', 'http://www.middleagesbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4730, 857, 3, 26, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A Sparkling golden ale with a complexity of malt and hop flavor brewed in a similar style to a turn of the century Canadian ale.', 'http://www.middleagesbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4731, 857, 3, 32, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Brewed in the style of an American Double IPA in celebration of our 10th anniversary. This beer is golden in color, has medium to full body, intense hop bitterness, flavor and aroma. Ten additions of American hops are made throughout the brewing process.', 'http://www.middleagesbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4732, 857, 1, 15, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A sensual dark brew with the softness of a Scotch ale crafted with the malt make-up of an English Porter.', 'http://www.middleagesbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4733, 857, -1, -1, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Dark and robust brewed in the style of a American strong ale, full bodied and screaming with hops.', 'http://www.middleagesbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4734, 857, 11, 116, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'Subtle Seasonal spices, in this dark, rich wheat beer are smooth and easy for the discerning palate.', 'http://www.middleagesbrewing.com/', 6.30, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4735, 857, 11, 141, '120 Wilkinson Street', 'Syracuse', 'New York', 'United States', 'A hearty british style strong ale with a deep chestnut color. A warming elixir that''s magically delicious.', 'http://www.middleagesbrewing.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '43.0508, -76.1617', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4736, 415, 8, 95, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'The East Coast Lager is an easy drinking â€œgoldenâ€ lager with a wonderful balance of crisp malt flavors and flowery hop finish. Built specifically with very low bitter aftertaste, the aroma is as clean as the taste.A difficult beer to brew because of the gentlenessâ€¦ this beer is magnificent!', 'http://www.crickethillbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4737, 415, 3, 33, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'Our American Ale is a favorite everywhere - an amber ale with a wonderful balance of caramel sweetness and hop flavor. The aroma has a slight note of citrus and rock candy. There is not an imported Ale on the market that tastes this fresh!', 'http://www.crickethillbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4738, 415, 3, 31, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'No mere beverage could satisfy the thirst of the courageous and gallant soldiers who stood guardover the colonies of the British Empire. Their thirst could only be quenched by a full-bodied hearty Ale; an Ale balanced with rich flavorful hops. We are proud to offer our interpretation of this English style India Pale Ale for those who loong for the time when once your duty was complete, the taste of a fine Ale was reward enough for a job well done.', 'http://www.crickethillbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4739, 144, 3, 26, '161 River Avenue', 'Patchogue', 'New York', 'United States', '', 'http://www.bluepointbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4740, 765, -1, -1, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '', 'http://www.lagunitas.com/', 9.90, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4741, 956, 3, 32, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Gordon is a hybrid version of strong ale, somewhere between an Imperial Red and a Double IPA. We make it with six different malts and three types of hops, then dry-hop it with a mutha lode of Amarillo hops. It is 8.7% alcohol by volume, and has 85 International Bittering Units. It features a gooey, resiny aroma and a luscious mouthfeel. Gordon is brewed with dash of chocolate malt in it, to round out its load of hops and balance the beer. The result is an assertive yet exceptionally smooth version of strong beer. We brew Gordon in tribute to the late Gordon Knight. In addition to opening some of Coloradoâ€™s first microbreweries, Knight was a Vietnam vet, grade-A citizen, and huge promoter of craft beer. He lost his life in 2002 while fighting a wild fire outside of Lyons, Colorado. Originally our winter seasonal beer, it has become a cult favorite of extreme-beer lovers, so we now brew occasional batches of Gordon throughout the year. Released in bottles in 2003 and 2004, Gordon is now sold in four packs of hand-labeled cans and on draft in select markets. --http://www.oskarblues.com/brew/', 'http://www.oskarblues.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4742, 956, 3, 26, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Dale''s Pale Ale is our flagship beer and America''s first hand-canned craft beer. It''s an assertive but deftly balanced beer (somewhere between an American pale ale and an India Pale Ale) brewed with hefty amounts of European malts and American hops. It features a merengue-like head, a copper color, and a hoppy nose, thanks to a big post-boil addition of Centennial hops. To complement its hoppy first impression, Dale''s also sports a rich middle of malts and hops, and a bracing finish. Dale''s is 6.5% alcohol by volume, and features 65 International Bittering Units. We think of it as the perfect, everyday beer for hopheads like us. Dale''s Pale Ale''s rich flavor has helped us make many new fans, and its numerous honors have helped us kick huge holes in the misconceptions regarding cans.', 'http://www.oskarblues.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4812, 853, 3, 26, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'True Hefeweizen yeast and malted wheat give this ale its authentic German flavor and aroma. Hints of banana flavor and aroma are present in this medium to full bodied, pale colored cloudy, unfiltered ale.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4743, 956, 1, 15, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Old Chub is a Scottish strong ale brewed with hearty amounts of seven different malts, including crystal and chocolate malts, and a smidge of US and UK hops. Old Chub also gets a dash of beechwood-smoked grains imported from Bamburg, Germany, home of the world''s greatest smoked beers. Old Chub is 8% alcohol by volume. While Dale''s satisfies our hop addiction, Old Chub takes care of our deep affections for malt. The cola-colored beer (almost black) features a tan head, a creamy, skim-milk mouthfeel, and rich, semi-sweet flavors of caramel and chocolate throughout. The addition of smoked grains gives Old Chub a delicate kiss of smoke on the finish. Old Chub is the beer equivalent of a lightly smoked single malt scotch, or your favorite dark chocolate. We call it Rocky Mountain Mutha''s Milk. People who tell us defiantly, "I don''t drink dark beer," often fall deeply in love with Old Chub. We can''t blame them.', 'http://www.oskarblues.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4744, 956, 3, 43, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Ten FIDY Imperial Stout - Now (11-21-07) available in cans, our winter seasonal beer is immensely viscous and loaded with neck-deep flavors of chocolate, malt, coffee, cocoa and oats. It''s the beer equivalent of decadently rich milkshake made with malted-milk balls and Heavenâ€™s best chocolate ice cream. Ten FIDY is about 10% ABV and is made with enormous amounts of two-row malts, chocolate malts, roasted barley, flaked oats and hops. Its huge-but-comforting flavors hide a whopping 98 IBUs that are deftly tucked underneath the beerâ€™s mountains of malty goodness. Ten FIDY is the ultimate Rocky Mountain winter warmer, and further proof of the creative muscle of our beloved brewing staff. Look for fourpacks of Ten FIDY in select beer stores in Colorado. Out of state? We hope to send a few cases to a few of our other states in early ''08.', 'http://www.oskarblues.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4745, 956, 3, 38, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'This big tasting brew is only available in the brewpub. Very smooth and balanced with a deep clear brown color. Lightly hopped.', 'http://www.oskarblues.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4746, 236, 2, 25, '471 Kalamath Street', 'Denver', 'Colorado', 'United States', 'Awesome Porter! Smooth, the vanilla makes this beer very drinkable. Enjoy!!', 'http://www.breckbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7236, -105.001', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4747, 848, 5, 67, '', 'Saratoga Springs', 'New York', 'United States', 'This Limited Edition unfiltered Belgian Style Ale, brewed with premium unmatted wheat has a crisp & refreshing flavor. This thirst quenching ale has a blend of sweet orange peel, a subtle hint of coriander and a delicate twist of lemon.', 'http://www.mendobrew.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '43.0831, -73.7846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4748, 1115, -1, -1, 'Eggenberg 1', 'Vorchdorf', '', 'Austria', 'Brewed only once a year on December 6. Samichlaus is aged for 10 months before bottling. This beer is perhaps the rarest in the world. Samichlaus may be aged for many years to come. Older vintages become more complex with a creamy warming finish.', '', 14.00, 0.00, 0.00, 0, '9999-01-01', '47.9904, 13.9238', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4749, 100, 3, 33, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'This beer is brewed especially for the Grand Hotel located on Mackinaw Island, Michigan.', 'http://www.bellsbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4750, 967, 3, 33, 'Steenhuffeldorp 3', 'Steenhuffel', 'Brabant', 'Belgium', 'Since 250 years Palm, a top-fermented amber beer, is brewed in the Belgian province of Brabant. It has a soft, full and fruity taste. It is only available in the Benelux. In France it is known as "Palm Belgique" with 6% alcohol percent.', 'http://www.palmbreweries.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '50.9953, 4.2835', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4751, 960, 7, 77, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A well hopped medium bodied lager brewed in the Czech style of pilseners. This beer displays the distinct flavor and aroma of saaz hops.', 'http://www.ottospubandbrewery.com/index.php', 5.60, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4752, 960, 1, 10, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A British-style mild ale. Milds are a common ale type in England where session ales are lower in alcohol but not low on flavor. Ours has a strong malt backbone and is very quaffable.', 'http://www.ottospubandbrewery.com/index.php', 3.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4753, 960, 3, 38, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A brown ale brewed by Otto''s for KClinger''s Tavern in Hanover Pennsylvania.', 'http://www.ottospubandbrewery.com/index.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4754, 960, 3, 35, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A big, bold ale brewed in the style of classic barleywines. Served lightly carbonated through the handpump at cellar temperature.', 'http://www.ottospubandbrewery.com/index.php', 11.80, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4755, 960, 4, 50, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A south German style wheat ale. This beer is served traditionally cloudy due to the suspended yeast (hefe=yeast). Strong spicy clove flavors and light banana esters are characteristics of a different yeast strain we are trying.', 'http://www.ottospubandbrewery.com/index.php', 7.10, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4756, 960, 4, 55, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A strong dark German style wheat bock. This wheat beer is estery like the hefeweizen, but bigger with more of everything.', 'http://www.ottospubandbrewery.com/index.php', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4757, 882, 5, 61, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'The Belgian Trippel tradition calls for a moderately heavy grist of golden pilsner malt and "Candy" sugar that sends the yeast into overdrive. We used local Dixie Crystal.', 'http://www.moonriverbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4758, 954, 11, 121, '1301 Atlanta Avenue', 'Orlando', 'Florida', 'United States', 'Orange Blossom Pilsner or OBP is an easy drinking craft beer. Even beer drinkers that prefer lightest of beers enjoy the crisp and refreshing taste of OBP and love is subtle hony nuance. OBP is the perfect craft beer for the tropical Florida lifestyle.', 'http://www.orlandobrewing.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '28.5265, -81.3827', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4759, 882, 11, 121, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'This hard cider is fresh-pressed with delicious, sweet-tart "Pink Lady" apples from the Mercier Orchards in the North Georgia mountains.', 'http://www.moonriverbrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4760, 882, 5, 67, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'Our Wit (white) beer is an old style Belgian wheat-ale, spiced with Curacao bitter orange peel and corriander. Light and exotic... A party in your mouth!', 'http://www.moonriverbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4761, 882, 7, 91, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'This German-style Festival bier has a rich orange hue. Its medium body is complemented by a Munich malt toastiness and premium German hops which are a blend of Hallertau, Spalt, Hersbruck and Saaz, yielding a spicy, "noble hop" aroma.', 'http://www.moonriverbrewing.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4763, 882, 2, 25, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', 'Our porter is a full bodied, semi-sweet dark ale, with distinct notes of caramel and chocolate. A touch of English grown Fuggles gives balance to the complex malty sweetness. Brewed in the loving memory of our Brew master''s grandfather, the Captain.', 'http://www.moonriverbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4764, 456, 3, 33, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'Dock Street Amber is a classic, top fermented ale and is the company flagship beer. It is brewed with American Cascade hops and two row imported pale and caramel malts and then dry hopped. Our traditional brewing process gives this beer its subtle, complex and fruity character and its distinctive hop "nose." The result is an exceptionally balanced premium full bodied ale that finishes clean and smooth on the palate. It appeals to gourmets and beer aficionados. Our goal in brewing the Dock Street Amber was to produce a phenomenal tasting American beer. At the time it was created, most all full-bodied beers were imports.";"0', 'http://www.dockstreetbeer.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4765, 456, 7, 77, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'Bohemian Dock Street Pilsner is brewed in the style of the original Pilsner beers of Bohemia, in what is now the Czech Republic, in a tradition that dates to 1842. We use costly Bohemian Saaz hops and pale imported malts to produce its rich golden color, and soft malty flavor using traditional techniques of the old world. True Pilsners are the most difficult to brew as there are no dark malts or flavorings used to mask flaws. Pilsner is the best known style of beer in the world. A good pilsner balances hops and malts to a refreshing, clean tasting, every-mood kind of beer. The Bohemian can stand alone or join a party easily.', 'http://www.dockstreetbeer.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4766, 456, 3, 31, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'An aggressively hopped American Style Pale Ale brewed with Simcoe and Amarillo hops. The use of 20% rye gives this ale a unique dry and spicy character.', 'http://www.dockstreetbeer.com', 6.80, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4767, 456, 11, 116, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'A smooth refreshing American Wheat Ale brewed with fresh ginger. This Summer Session is much more exciting than the one you had to sit through in high school.', 'http://www.dockstreetbeer.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4768, 456, 3, 42, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'A bold roasty stout with 50lbs of organic fair trade espresso beans. A tribute to the best coffee house in town. Coffee lovers will easily embrace this delicious brew.', 'http://www.dockstreetbeer.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4769, 456, 5, 67, '701 S. 50th Street', 'West Philly', 'Pennsylvania', 'United States', 'A swanky interpretation of a double strength wheat beer, fermented solely by champagne yeast. Notes of tart citrus and white grape soothe the pallet in this sparkling ale.', 'http://www.dockstreetbeer.com', 7.10, 0.00, 0.00, 0, '9999-01-01', '39.9478, -75.2229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4770, 780, 3, 33, '545 Canal Street', 'Reading', 'Pennsylvania', 'United States', 'Wickedly tasty red ale packed with a full aroma from dry hopping and a massive hop flavor. Specially brewed with all European malts and West Coast whole flower hops. The result is a rich ruby red color; lacy collar and a feast of hop aroma and flavor.', 'http://www.legacybrewing.com', 7.10, 0.00, 0.00, 0, '9999-01-01', '40.3256, -75.9283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4771, 780, 5, 67, '545 Canal Street', 'Reading', 'Pennsylvania', 'United States', 'Midnight Wit is a Belgian-style white ale with a medium body and spicy, citrus overtones. The texture is silky, creamy, and refreshingly delightful. Brewed with European Pilsner malt, unmalted wheat, a blend of 5 different spices and then fermented with a classic Belgian yeast strain. Our Brewmaster learned the art of brewing tantalizing and award-winning white beers during his time in Belgium and this beer shows it.', 'http://www.legacybrewing.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.3256, -75.9283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4772, 780, 3, 32, '545 Canal Street', 'Reading', 'Pennsylvania', 'United States', '', 'http://www.legacybrewing.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.3256, -75.9283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4773, 780, 4, 57, '545 Canal Street', 'Reading', 'Pennsylvania', 'United States', 'Our Altbier is brewed in the classic German-style brown ale tradition. The â€œaltâ€ translates to "old" in German and is one of the original ale types brewed in Germany. Brown Aled Girl is dark brown in color, medium in carbonation with a great balance between malt and hops.', 'http://www.legacybrewing.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.3256, -75.9283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4774, 404, 3, 33, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'A well balanced, medium-to full bodied beer, red in color and very flavorful. The red color and slight caramel-roasted flavor comes from generous amounts of caramel malts and a touch of chocolate malts. Well hopped to balance the malty sweetness, and dry-hopped with cascade for a full hop flavor and aroma.', 'http://www.coronadobrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4775, 404, 3, 38, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'Medium-bodied and light brown in color. This mild ale has a sweet maltiness and roasted character. Unlike English brown ales, this brown ale has a noticeably hoppy flavor from its Willamette hops. Donâ€™t be afraid to have a Nutter!', 'http://www.coronadobrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4776, 404, 3, 42, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'Extremely dark in color, with a malty flavor dominated by caramel and chocolate malts and a slight hoppy bitterness. This full-bodied ale has a nice smooth lasting finish.', 'http://www.coronadobrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4777, 404, 3, 31, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'The CBC Idiot IPA is an all natural India Pale Ale. A big beer with an 8.5% ABV and brewed with over 3 lbs of hops per barrell. Watch out, this unfiltered "San Diego IPA" has been known to reduce even the most intelligent to a blithering "idiot".', 'http://www.coronadobrewingcompany.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4778, 404, 4, 50, '170 Orange Avenue', 'Coronado', 'California', 'United States', 'The Coronado ''Islandweizen'' is our version of an American-styled Hefeweizen or unfiltered wheat beer. It''s lightly hopped with Nobel Tettnang and Saaz hops to create a great full-bodied beer. This refreshing beer can be enjoyed with a slice of lemon.', 'http://www.coronadobrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.6976, -117.173', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4779, 669, 11, 116, '8113 Fenton St.', 'Silver Spring', 'Maryland', 'United States', 'A crisp, clean American Ale. Perfect for extinguishing your fiery thirst or when you crave an ice-cold beer. A great step up in flavor from the macro-produced American and imported beers.', 'http://www.hookandladderbeer.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.9911, -77.0237', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4780, 669, 3, 38, '8113 Fenton St.', 'Silver Spring', 'Maryland', 'United States', 'A smooth and refreshing beer loaded with flavor. Specialty malts balanced with just the right amount of cascade hops give it a roasted taste and beautiful brown color. This drinkable brown ale easily rivals an expensive import.', 'http://www.hookandladderbeer.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.9911, -77.0237', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4782, 609, 3, 31, '1430 Vantage Court #104A', 'Vista', 'California', 'United States', 'This West Coast-Style India Pale Ale is extravagantly hopped, full flavored, medium bodied and copper colored. A menagerie of hops is combined throughout the brewing process to impart specific characteristics. Hops used include Simcoe for a unique fruitiness and grapefruit zest, Columbus for strong hop pungency, Centennial for pine and citrus notes, and Cascade for floral aroma.', 'http://www.greenflashbrew.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '33.136, -117.225', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4783, 507, 1, 15, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Erie, Pennsylvania was an important railroad hub in the midâ€“nineteenth century, the city being the site where three sets of track gauges met. Railbender Ale, Erie Brewing Co.â€™s flagship ale, named after the laborers who laid the railroad tracks is brewed with pride, strength and purity symbolic of Erieâ€™s historic railroadâ€™s and railroad workers. Railbender, a strong Scottish style ale smooth malt flavor and astonishing drinkability will have you "Hopping on the train and riding off the rails." All Aboard!', 'http://www.eriebrewingco.com', 6.80, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4784, 507, 7, 77, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Presque Isle and the bay it creates have played many significant roles in the history of Erie and our young nation. The US Government chose this location to build a fleet of ships during the war of 1812 because it formed the only protected harbor on Lake Erie. In 1813, during the battle of Lake Erie, Commodore Oliver Hazard Perry successfully defended Lake Erie against the British with ships that were built on Presque Isle Bay, making a significant mark on the pages of history. Presque Isle Pilsner, a tribute to history is a hand crafted pilsner that is "A noble beer for Noble People.";"0', 'http://www.eriebrewingco.com', 4.20, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4785, 507, 3, 26, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Anthony Wayne adopted a military career at the outset of the American Revolutionary War, where his military exploits and fiery personality quickly earned him a promotion to the rank of brigadier general and the sobriquet of "Mad Anthony". Erie Brewing Coâ€™s Classic American Pale Ale features a balanced malt and hop flavor, which we feel the Nutty General would approve of despite his revolutionary tendencies.', 'http://www.eriebrewingco.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4786, 507, 3, 31, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'The view from Oliver Perry Monument across Lake Erieâ€™s historic Misery Bay provides a constant reminder of the hardships endured during the Battle of Lake Erie. Misery Bay IPA is brewed as a tribute to Misery Bay and Graveyard Pond, final resting place for many brave sailors and soldiers. Misery Bay IPA offers a complex malt profile loaded with American hops at 75 IBUâ€™s, and finishes at 6.5 % alcohol by volume.', 'http://www.eriebrewingco.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4787, 507, 4, 57, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Erie Brewing Co. Heritage Alt Beer - a classic, old style dark German ale possessing a subtle hint of roasted and chocolate malt flavor, with a smooth balanced finish. Erie Brewing first brewed this annually for the Erie German Heritage Festival. Erie Brewingâ€™s Heritage Alt Beer popularity lead this beer from a commemorative beer for the festival to a complete packaged seasonal release for all to enjoy, whether you are of German Heritage or not. Prost!', 'http://www.eriebrewingco.com', 5.40, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4788, 507, 7, 91, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'As spring emerges, Golden Fleece Maibock captures center stage. This fine lager is a pleasurable reward for enduring the doldrums of Erie Pennsylvaniaâ€™s harsh Lake-Effect ice and snowstorms. Celebrate the transition into spring! Golden Fleece Maibockâ€™s deep golden color leads into a sweet malty flavor with a light hop finish. Maibock says, â€œRAM ITâ€ to winter with 8.5% alcohol by volume â€“ just enough to take the chill off your day.', 'http://www.eriebrewingco.com', 8.50, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4789, 507, 7, 84, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'History states that the first Oktoberfest was on October 12, 1810: For the commemoration of the marriage between Crown Prince Ludwig and Princess Therese of Saxe-Hildburghausen. Keeping up with Erie Brewingâ€™s German brewing influence, our brewer creates Fallenbock, a classic Oktoberfest lager that is a harmonious marriage of classic malts and hops that has a wonderful clean and crisp flavor to celebrate Autumn and Oktoberfest.', 'http://www.eriebrewingco.com', 7.80, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4790, 507, 5, 67, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Hot, Hazy summer days call for a craft beer that refreshes. Have no fear â€“ Sunshine Wit is here! Sunshine Wit is a refreshingly smart-assed ale that will satisfy, especially when the mercury is rising. Add a slice of orange for an extra blast of flavor! Sunshine Wit is a â€œwhite aleâ€ or â€œwitâ€ â€“ a hazy yellow wheat beer with a subtle citrus flavor and remarkable drinkability at 4.0% alcohol by volume. Let sunshine wit help you chill out on the hottest, humid, heat-stricken days of summer.', 'http://www.eriebrewingco.com', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4791, 507, 1, 15, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Erie Brewing presents the Beer formally known as Red Ryder BIG BEER - A beer dubiously awarded two cease and desist letters for its name. Olâ€™ Red Cease and Desist brings more to the table than just a big malty flavor and climaxing warming sensationâ€¦a legal record! This beer so recognized and loved by many deserves a unique name to match its unique history. What better name than Olâ€™ Red Cease and Desist â€“ a name inspired by the long arm of the law!', 'http://www.eriebrewingco.com', 10.10, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4792, 507, 1, 21, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'In 1859 Col. Edwin L. Drake successfully drilled the first oil well in Northwest Pennsylvania. Because of the project known as "Drake''s Folly," Pennsylvania was actually responsible for almost half of the world''s oil production until the 1901 oil boom in Texas. Erie Brewing Co. reflects on our regions oil history and oil rush by producing a crude oil Black, silky smooth, malt bonanza oatmeal stout.', 'http://www.eriebrewingco.com', 6.80, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4793, 1309, -1, -1, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'A pale golden German ale with subdued, clean-tasting malt flavor and aroma. This is a beer from the "old" brewing tradition before lagers become popular. Fermented at a lower temperature than normal ales, and followed by several weeks of cold lagering.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4794, 1309, 8, 95, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'Dortmunder style lager with full body and deep golden color. Brewed using four specialty malts with moderate hopping for a smooth clean flavor and aroma.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4889, 1173, 5, 74, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4795, 1309, 7, 91, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'A pale bock with fresh maltiness in the aroma and palate. Deep golden color with a generous amount of pure honey to smooth the high alcohol finish. Perle and Cluster hops for bittering and Sazz and Hallertau for finishing. Original gravity above 19 Plato.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4796, 1309, 3, 26, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'A translucent amber-red ale with a moderately high IBU of 36. Bittering hops include Kent Golding and Cascade. A generous amount of Kent Golding is used in the dry hopping to further enhance the aroma.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4797, 1309, 3, 42, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'A nutritious st our that has a distinct, smooth and firm body. Specialty malts create a hint of nuttiness, coffee, chocolate, and roasted flavors.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4798, 1309, 7, 92, '6 N. Reamstown Road', 'Reamstown', 'Pennsylvania', 'United States', 'Dark Dunkle style lager with an original gravity above 19 degrees Plato. Rich and malty, this is a strong bock with a mellow finish.', 'http://www.unionbarrelworks.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2118, -76.1232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4799, 919, 3, 31, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'Acme IPA is profoundly hoppy, finished with over a pound of fresh whole hops per barrel. The result of this generous hopping is a beer that is deliciously dry, and eminently drinkable in spite of its apparent strength.', 'http://www.northcoastbrewing.com/home.htm', 6.50, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4800, 1204, -1, -1, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Our Anniversary Ale this year stems from 2 pilot beers that were brewed by members of Team Stone. The first was Jeremy Moynierâ€™s incredibly delicious Oatmeal Stout, and the second was Jake Ratzkeâ€™s amazing homebrewed Imperial Stout that had authentic Oaxacan chocolate added to the boil. We loved both beers so much that we decided to combine the recipes to make this yearâ€™s Anniversary offering: Stone 12th Anniversary Bitter Chocolate Oatmeal Stout. This beer pours deep black with a rich brown head of foam. The aroma is dominated by roast malt and cocoa. Upon tasting, the cocoa (we used unsweetened, unprocessed cacao sourced through our friends at Chuao Chocolatier) really comes through with a deep chocolate flavor and a long lasting bitter finish. The roasted grains used add coffee and licorice accents. It is a thick beer, but not sweet, with the addition of oatmeal in the mash providing a rich, silky mouthfeel that adds to the creamy texture.', 'http://www.stonebrew.com/', 9.20, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4801, 1204, 3, 32, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Stone 10th Anniversary IPA harkens back to our earlier Anniversary Ales, with abundant hopping at many stages of the brewing process. Appropriately, the aroma is over-the-top, with pronounced piney and resiny hop flavors combined with tropical fruit esters and more subtle notes of toasted malts and alcohol. Our Stone 10th Anniversary Ale weighs in at 10% alcohol by volume (perfect for a 10th anniversary beer), and has a little more color and malt character than our other IPAs. In addition to using the new Summit hop variety in the brewhouse to provide the powerful bitterness, we went back through our records and found some of our favorite hops over the years, and used them to flavor this brew, including Chinook, Crystal, and large doses of Simcoe in the dry-hop to provide a huge, complex, piney, fruity and floral hop character. This is a colossal beer, big in every sense: hoppy, malty, rich, and strong! Right up our alley.', 'http://www.stonebrew.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4802, 381, 3, 33, '925 South Third Street', 'La Crosse', 'Wisconsin', 'United States', '', 'http://www.citybrewery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4803, 908, -1, -1, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'A kÃ¶lsch-style beer, Full Circle is a refreshing celebration of our breweryâ€™s belief in balance. The soft, well-rounded malt character, light hop profile and crisp finish bring us back around to the familiar tastes of classic, thirst-quenching beer. We recommend Full Circle with fish and just about anything from the grill.', 'http://newhollandbrew.com', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4804, 908, 3, 33, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Sundog is an amber ale as deep as the copper glow of a Lake Michigan sunset. Its biscuit malt give Sundog a toasty character and a subtle malty sweetness. Sundog brings out the best in grilled foods, caramelized onions, nutty cheese, barbecue, or your favorite pizza.', 'http://newhollandbrew.com', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4805, 908, 1, 21, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'The Poet has a rich, smooth malt character enveloped in tones of roast and chocolate. A soft mouth-feel brings luxurious flavors and soothing aroma. It pairs wonderfully with earthy flavors such as mushrooms and beef, while remaining the perfect accent to any chocolate.', 'http://newhollandbrew.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4806, 853, 3, 43, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Take an India Pale Ale and feed it steroids! Although open to the same interpretation as its sister styles, you should expect something robust, malty, alcoholic and with a hop profile that might rip your tongue out. The Imperial usage comes from Russian Imperial stout, a style of strong stout originally brewed in England for the Russian Imperial Court of the late 1700s; though Double IPA is often the preferred name.', 'http://www.michiganbrewing.com/', 10.40, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4807, 853, 3, 26, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A classic American style pale ale. A well balanced, light copper colored, medium bodied ale with a distinctive hop bitterness and aroma.', 'http://www.michiganbrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4808, 618, 8, 96, '', 'Mexico City', '', 'Mexico', 'Handcrafted with all-natural ingredients, Modelo Especial has built a solid reputation as a classic, thirst-quenching beer. The brand represents the can-package of Grupo Modelo''s portfolio and is also available in non-returnable bottles. Modelo Especial is a must for those looking to capture the flavor of Mexico. Modelo Especial has 145 calories per 12 ounce serving.', 'http://www.gmodelo.com.mx/', 0.00, 0.00, 0.00, 0, '9999-01-01', '19.427, -99.1276', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4809, 853, 3, 38, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A mild, roasted nut and caramel flavored ale with a deep brown color. It is a medium-bodied beer with a mild to medium hop bitterness and aroma.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4810, 853, 8, 95, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A refreshing, crisp and clean amber colored lager. Made in a Vienna-style with distinct caramel malt flavor and aroma.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4811, 853, 2, 25, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Full-flavored and robust ale with heavy notes of roasted malt. There are hints of coffee and chocolate flavors, complimented by medium hop bitterness and a hint of smokiness.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4813, 853, 5, 72, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'An authentic Belgian fruit flavored and spiced ale with a pronounced raspberry flavor and aroma, accented by orange peel and coriander. Clear and bright golden color with a raspberry tint.', 'http://www.michiganbrewing.com/', 3.90, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4814, 853, 5, 72, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A Belgian, lightly spiced pale ale. This caramel colored, light-bodied brew has a mild caramel flavor, a hint of orange peel and coriander and slight hop bitterness.', 'http://www.michiganbrewing.com/', 3.90, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4815, 853, 5, 72, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A GABF Gold Medal winner for 2007, this Belgian style strong ale, bright and golden colored is brewed with a hint of orange peel and coriander. This balanced, pleasant to drink brew, will sneak up on you. Consume with caution.', 'http://www.michiganbrewing.com/', 7.60, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4816, 853, 8, 95, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Made popular in the 19th century in Dortmunder, Germany, these pale golden lagers exhibit a classic clean character with notes of biscuity malts. Bitterness is akin to a German Pilsner with an aromatic aroma. Mouthfeel is firm and even, with an overall dry tone.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4817, 853, 3, 38, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A Russett colored brown ale with a thinner but well defined white head, grainy aromas with a touch of caramel flavors.', 'http://www.michiganbrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4818, 853, 8, 95, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Brightly filtered, highly carbonated, golden premium-style lager. It is lightly hopped with Polish Lublin hops. The beer will appeal to those who prefer the lighter American style beers.', 'http://www.michiganbrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4819, 853, 3, 42, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'All the good stuff and just a little bit more. Michigan Brewing Company is proud to offer this thick and creamy stout with all the roasted, coffee-like flavor you can handle. Need we say more?', 'http://www.michiganbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4820, 660, 8, 95, '', 'Seoul', '', 'Korea, Republic of', 'Hite lager is golden in colour and is styled upon traditional European and American lagers.', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '37.5665, 126.978', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4821, 951, 8, 95, '', '', '', 'Korea, Republic of', 'OB Lager is a pale lager available in cans and bottles, and served on draft in Korea.', '', 4.40, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4822, 428, 3, 37, 'pastoor de katerstraat 24', 'baarle-hertog', '', 'Belgium', 'pure malt blond ale with a touch of wheat malt. great hop-aroma due to hop-filtering the hot wort. bottle-conditioned.', 'http://www.dedochtervandekorenaar.be', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.4421, 4.9232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4823, 428, -1, -1, 'pastoor de katerstraat 24', 'baarle-hertog', '', 'Belgium', 'copper -coloured complex tasting ale with a soft smokey taste combined with some caramel-malt to give it a long lasting chocolate-like aftertaste', 'http://www.dedochtervandekorenaar.be', 7.00, 0.00, 0.00, 0, '9999-01-01', '51.4421, 4.9232', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4824, 1086, 3, 31, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'An abundance of hops and malt are added to our IPA to create and preserve its distinctive flavors. Not only do we use generous portions of hops in the kettle, but we also dry hop this ale for one week after fermentation. The dry hopping process adds to this beer''s floral and citrus aroma. This is truly a tasty adult beverage!', 'http://www.russianriverbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4825, 1086, 1, 4, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', '', 'http://www.russianriverbrewing.com/', 5.68, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4826, 1086, 3, 26, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', '', 'http://www.russianriverbrewing.com/', 5.55, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4827, 1086, 3, 26, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Wouldn''t it suck to have a job where nobody likes you? And, regardless of your name, people always call you Rita, as in "Lovely Rita?" Sometimes people just shorten it to the simpler "meter maid." The funny thing about that is the Webster dictionary defines a "meter maid" as "a female member of a police department who is assigned to write tickets for parking violations." You have to wonder how the male "meter maids" feel about that! Parking Violation is an American style pale ale using lots of American hops, lots of quarters, and several trips back and forth to the parking lot. So, remember to drink responsibly and feed your meter.', 'http://www.russianriverbrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4828, 1086, 8, 95, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', '"If you can''t feel good about your beer... what else is worth feeling good about.', 'http://www.russianriverbrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4829, 700, 8, 95, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'This amber Austrian lager has a distinct bready malt aroma and flavor, followed by a crisp, clean finish typical of lager styles. The nose also shows plenty of the spicy hop aroma contributed by the use of Saaz hops.', 'http://www.ironhillbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4830, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Named after the Roman god of war, Mars radiates red color and brilliant beauty yet enrages the taste buds with wrathful force. This Imperial IPA seizes its intense bitterness from an immense amount of hops. Belgian yeast retaliates, adding complexity and character.', 'http://www.midnightsunbrewing.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4831, 858, 1, 20, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Mother Earth is the rich fertile â€œlivingâ€ planet. Our EARTH combines pale and dark malts for essential body. Cocoa nibsâ€”decadent chocolate in its most elemental formâ€”add distinction. Lush lactose creates incredible creaminess. But Earth gains amazing ground with extensive aging on Bergenfield extra dark cocoa.', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4832, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Messenger of the gods, Mercury symbolizes commerce, travel, thievery, wit and wealth. MERCURY cleverly stole its essence from mistress lover VENUS. Second runnings of the voluptuous quadrupel created this small yet fascinating beer. Indian coriander acknowledges the traveler; a distinct Belgian yeast contributes wit & charm.', 'http://www.midnightsunbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4833, 858, 5, 66, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'LUST Belgian-style Dark Strong Ale stirs shameless desire in men (and women) with its captivating appearance, enticing aroma and satisfying flavors. Aged in bourbon oak barrels for twelve months, Lust is worldly, smooth and decadent. Sour cherries contribute tartness while brettanomyces brings muskiness to this naughty brew. The pleasure you derive from this dark beer is beyond words. LUST. Regret. Repent. Repeat.', 'http://www.midnightsunbrewing.com/', 11.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4834, 858, 5, 65, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'RIDE Belgian-style Strong Pale Ale boasts a glorious deep gold color and an amazing yet arrogant head. Plentiful pale malt creates beautiful, agile body. Assertive hops and Belgian yeast achieve charismatic floral and spice notes in aroma and flavor. But Prideâ€™s predominant and unique character comes from its exposure to Brettanomyces in French oak Chardonnay barrels. At once tart and refreshing yet earthy and musty, Pride is unlike most beers on earth. And itâ€™s bitter, lingering finish demands another sip. Awarded a BRONZE medal at World Beer Cup 2008, Pride has much too much to boast about.', 'http://www.midnightsunbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4835, 858, 3, 43, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'SLOTH Belgian-style Imperial Stout is deliberately dark as hell. The pour is slow and sluggish. Its head is menacing, becoming torn and tattered Belgian lace on the sides of the glass as you cautiously consume this brewâ€”sip by insidious sip. The aroma is sweet from heavy malt and big alcohol with notes of vanilla, coconut and whiskey from the oak. The depth & breadth of roasted malt flavors loiters on the palate while the robust finish lingers, well, forever. SLOTH...Just add couch.', 'http://www.midnightsunbrewing.com/', 10.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4836, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'WRATH Belgian-style Double IPA is fiercely bitter with notes of spice and earth. Its fury slowly and purposefully unfurls on the tongue, relentlessly bringing on more and more enraged flavor with each sip. Wrath wreaks havoc on your taste buds. Anything you drink after this may as well be water.', 'http://www.midnightsunbrewing.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4837, 858, 5, 64, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With a summer release in mind, GREED Belgian-style Single was created miserlyâ€”relatively speakingâ€”with one type of malt and two varieties of hops. At 5% ABV and 30 IBUs, Greed is the lightest in our series of 2007 Deadly Sin Beers. However, the Belgian yeast used in fermentation and conditioning contributes an earthy, somewhat spicy flavor and a crisp finish. We invite you to be greedy before itâ€™s gone. GREED...Less [for you] is More [for me].', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4838, 858, -1, -1, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'ENVY Imperial Pilsner obsessively desires to be better than the worldâ€™s most common lager. Envy vies for attention with its beautifully bright, golden color and tightly-formed crown. Intense yet true pilsner malt provides the perfect base for profuse citrus, floral and spicy hop flavor. Envy achieves distinction, making other beers turn green.', 'http://www.midnightsunbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4839, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'GLUTTONY Triple IPA overindulges the palate with profound malt, powerful hops and abundant body. Its deep decadent golden orange color presents an appetizing invitation for extravagant enjoyment. Its aroma entices with citrus, pine and alcohol while the flavor provides a smorgasbord of sweet malt, fresh tangerine/grapefruit and a resinous hop character that lingers well beyond the finish. GLUTTONY...More than a mouthful.', 'http://www.midnightsunbrewing.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4840, 61, 8, 96, '229-255 Old Melbourne Road', 'Little River', 'Victoria', 'Australia', 'King Lager is brewed to an all Australian full strength formula in Germany, by the Giessener Brauhaus who have over 100 years of brewing knowledge. Made 100% naturally, King Lager complies with the strict German Purity Law of 1516 resulting in a superior tasting lager of world standing. Only the highest quality barley malt, hops, water and yeast, have been combined to give King Lager its unique malt character and crisp, distinctive taste. The sophisticated King Lager packaging reflects the quality of this exceptional, full flavoured beer. The sleek, contoured bottle, stylish 4 pack design and premium labelling makes this lager stand out amongst the best in any environment. King Lager is full strength with 5.2% alc/vol, 20 beers to a case and 375ml of classic, crisp, clean beer in every bottle. Make your move now to King Lager â€“ itâ€™s world class', 'http://www.australianbrewingcorporation.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '-37.968, 144.525', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4841, 908, -1, -1, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'A red ale with rich and smooth flavors of malted barley, balanced by underlying hints of dark fruit. Brewed in homage to our hometown tulip festival, Red Tulip evokes springâ€™s renewing spirit. Excellent with roasted pork, red-meats and dried fruit.', 'http://newhollandbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4842, 908, -1, -1, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'A barrel-aged, strong-ale with a soft and rich caramel-malt character intermingled with deep vanilla tones dancing in an oak bath. Unmistakably distinctive and hauntingly remarkable, Dragonâ€™s Milkâ€™s warming complexity pairs well with smoked meats and cheeses, red meat, or a nice cigar.', 'http://newhollandbrew.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4843, 908, -1, -1, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Chestnut in color with a nutty malt profile from its signature Munich malt. A muted hop presence and smooth caramelized body culminate in a clean, dry finish. Excellent choice for hearty meals with dark flavors and sauces. Grilled meats, musty cheeses or pecan pie.', 'http://newhollandbrew.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4844, 908, 3, 35, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Consider it an extremely hoppy barleywine, or a really big IPA. Either way, ten hop additions contribute to its lush and intriguing body. Aggressive dry-hopping brings a strong citrus character to the aroma. The flavor and smell of orange-blossoms pervade throughout the experience.', 'http://newhollandbrew.com', 11.10, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4845, 908, 3, 35, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Pilgrimâ€™s Dole is a barleywine-style ale made with fifty percent wheat malt, or what we at New Holland call a wheatwine. Pilgrimâ€™s Dole blends warming and slightly sweet flavors with a unique caramelized character. It would be an excellent accent to nutty dishes, fruit crisps or creme brulee.', 'http://newhollandbrew.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4846, 908, 3, 38, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Robust in character yet smooth in delivery, Cabin Fever is a roasty brown ale and a hearty, comforting companion for long, mind-bending winters. Its rye, roast and raisin notes play off a subtle caramel sweetness and culminate in a dry finish. Excellent with roasts, stews, caramelized onions and snowfall.', 'http://newhollandbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4847, 908, 3, 35, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Ichabod combines malted barley and real pumpkin with cinnamon and nutmeg in a delicious and inviting brew. A rewarding complement to many dishes, Ichabod pairs well with autumnal foods such as poultry and root vegetables. After dinner, try it with your favorite dessert!', 'http://newhollandbrew.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4848, 908, 11, 116, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'A refreshing wheat ale, Zoomer is brewed to quench your summer thirst. American-grown wheat provides Zoomer''s straw color and its soft, clean body. With subtle, yet flavorful hints of citrus fruit in its finish, Zoomer is the perfect companion to all things summer. Food pairings include artisan cheeses, fresh greens, fish and chicken.', 'http://newhollandbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4849, 908, 3, 43, '66 East Eighth Street', 'Holland', 'Michigan', 'United States', 'Night Tripper is an Imperial Stout for a Fat Tuesday release. Dark, mysterious and poetic, Night Tripper''s abundance of roasted malts, combined with flaked barley create a rich, roasty beer with deeply intense and lush flavors. Night Tripper''s layered, nuanced tones invite intrigue and reward a curious palate.', 'http://newhollandbrew.com', 10.80, 0.00, 0.00, 0, '9999-01-01', '42.79, -86.1041', '2018-10-05');
