INSERT INTO beerbuddies_db.beer VALUES (4859, 978, 11, 121, '14800 San Pedro Avenue', 'San Antonio', 'Texas', 'United States', 'Pete''s Wicked Strawberry Blonde is truly a unique beer experience. Reward yourself with our golden lager made of the finest pale and wheat malts and Cluster Hops, with a kiss of natural strawberry flavor.', 'http://www.peteswicked.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '29.5761, -98.4772', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4860, 978, 11, 116, '14800 San Pedro Avenue', 'San Antonio', 'Texas', 'United States', 'The key ingredient to a good summer is a GREAT brew! Born to play, Pete''s Wicked Rally Cap Ale is crafted with a special blend of pale and wheat malts, Mt. Hood hops and a smack of natural lemon. Get in the game... Get Wicked!', 'http://www.peteswicked.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '29.5761, -98.4772', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4861, 978, 11, 113, '14800 San Pedro Avenue', 'San Antonio', 'Texas', 'United States', 'Peteâ€™s winter seasonal Wanderlust Cream Ale, is a velvety smooth brew offering endless fascination. Peteâ€™s Wicked Wanderlust Cream Ale is a light amber brew with a rhapsody of Cluster hops and select Munich and wheat malts. The rich, creamy taste invites you on a journey of wonderment and intrigue. Sit back. Enjoy the ride.', 'http://www.peteswicked.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '29.5761, -98.4772', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4862, 609, 3, 32, '1430 Vantage Court #104A', 'Vista', 'California', 'United States', '', 'http://www.greenflashbrew.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '33.136, -117.225', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4863, 751, 11, 116, '75-5629 Kuakini Highway', 'Kailua-Kona', 'Hawaii', 'United States', 'Wailua is Hawaiian for two fresh water streams mingling. This was just the inspiration we needed for our Limited Release wheat ale brewed with tropical passion Fruit. A refreshing citrusy, sun-colored ale with the cool taste of Hawaii.', 'http://www.konabrewingco.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '19.642, -155.996', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4864, 114, 8, 96, '550 South Wisconsin Avenue', 'Gaylord', 'Michigan', 'United States', 'An American-style "light beer". Formulated to appeal to those who prefer a lighter tasting brew.', 'http://www.bigbuck.com/gaylord.html', 3.20, 0.00, 0.00, 0, '9999-01-01', '45.0223, -84.6826', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4865, 114, 3, 26, '550 South Wisconsin Avenue', 'Gaylord', 'Michigan', 'United States', 'A standard American-style beer and our flagship brand. A small amount of corn is added to the grist to give the brew a smooth character. Features a rich, golden color and a light malt character balanced with a mild dose of hops.', 'http://www.bigbuck.com/gaylord.html', 5.20, 0.00, 0.00, 0, '9999-01-01', '45.0223, -84.6826', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4866, 114, 11, 116, '550 South Wisconsin Avenue', 'Gaylord', 'Michigan', 'United States', 'An American wheat beer made with malted barley and malted wheat. Lightly flavored with pure fruit to impart a subtle raspberry nose, a delicate fruit flavor and a slight pink hue.', 'http://www.bigbuck.com/gaylord.html', 4.80, 0.00, 0.00, 0, '9999-01-01', '45.0223, -84.6826', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4867, 1243, -1, -1, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Help us celebrate American Independence and American Beer Month in July with the release of the Terrapin All-American Imperial Pilsner. This beer was brewed using only American malts, American hops, and American yeast. Who says you have to import ingredients from Germany to make a true Pilsner? Of course, this Pilsner is made â€œTerrapin Styleâ€. Hence the 75 B.U.â€™s, the 7.5% alcohol and the term â€œIMPERIAL Pilsnerâ€.', 'http://www.terrapinbeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4868, 705, 11, 116, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'Our easy drinking wheat beer is light in color and body ... perfect for those looking for a lighter taste. The combination of wheat and barley give our Apricot Wheat a different malt character than any of our other ales. The hint of apricot gives this beer a fruity finish, making it a fun beer to drink.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4869, 705, 3, 38, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'The rich mahogany hue of the Nut Brown is the first thing you will notice. You''ll find subtle hints of both chocolate and coffee. We delicately blend chocolate and caramel malts with four others to make this flavorful, easy drinking beer. The malt character will appeal to those looking for a moderately dark ale, but the smoothness is what will surprise all.', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4870, 705, 3, 33, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'The name CascaZilla is a play on both the name of our local Cascadilla Gorge and the monster amounts of Cascade hops in this beer. This red ale gets its distinctive color from a healthy portion of caramel malt, which also lends some body and sweetness to the beer. The predominant flavor and aroma of this beer, however, is brought to you by the fresh American hops. If you haven''t done so yet, treat yourself to Ithaca Beer''s new monstrously hoppy Red Ale.', '', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4871, 705, 3, 31, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'Enjoy the clover honey hue and tropical nose. Simultaneously Punchy and soothing with a big body and a finish that boasts pineapple and grapefruit. Flower power is hopped and dry-hopped five different times throughout the brewing and fermentation process.', '', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4872, 705, 11, 116, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'Partly Sunny is hazy-straw colored wheat beer with coriander, and generous amounts of lemon zest. It''s a light refreshing beer with a subtle spicy start and a smooth citrus finish.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4873, 1243, 3, 32, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Double the malt, double the hops, and double the flavor of the original Rye Pale Ale recipe. (Hence the name Rye Squared.) With its mammoth hop aroma, bitterness and flavor, this beer is not for the faint at heart. The Rye Squared clocks in at a hefty 9.5% ABV so double your pleasure and double your fun because Terrapin went a little crazy with this one!', 'http://www.terrapinbeer.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4874, 1173, 2, 25, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Porter is our darkest beer, but not necessarily our strongest. It is widely held that the darker the beer, the stronger the beer, but this is a summarily false. The contribution of color comes directly from the color of malt that we use. Some malt is oasted to achieve dark color and coffee-like flavor which in turn get transferred to the beer. Our Porter is ruchly complex with overtones of chocolate and expresso beans followed by a subtle flavor of hops. It''s a nourishing beer without being too sweet or filling.', 'http://www.southerntierbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4875, 1173, 5, 61, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Don''t let Tripel''s light color and delicate aroma fool you, this is one serious beer brewed with maximum effort. First, we introduce the freshest barley to crystal filtered water. Second, we add the best hops shipped directly from Europe. Third, our special yeast is the catalyst for fermentations, gobbling sugar and creating alcohol as it works. Some say that the Belgian monks who first brewed this style called it triple to denote it''s high alcohol content. Still others believe triple''s origins lay in its triple fermentations; twice in the brewery and once in the bottle. Whatever the answer, ours is the Tripel threat.', 'http://www.southerntierbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4876, 1173, 4, 57, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4877, 1173, 1, 5, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4878, 1173, 11, 116, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Pour Hop Sun Summer Wheat Beer into a pint glass, give it a long whiff and youâ€™ll realize that this isnâ€™t your average wheatbeer. Filtered to a golden clarity and dry-hopped to perfection, Hop Sun is a fantastic session ale in which flavors of wheat, barley and hops commingle to a refreshing and zesty conclusion. Hints of lemon and sweet malts waft to the fore as a touch of bitterness contributes to Hop Sunâ€™s bright finish. Enjoy Hop Sun all summer long as a perfect balance to your outdoor recreation. Summer never tasted so good.', 'http://www.southerntierbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
