INSERT INTO beerbuddies_db.beer VALUES (4880, 1173, 3, 33, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
