INSERT INTO beerbuddies_db.beer VALUES (4882, 1173, 4, 50, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4883, 1173, 3, 33, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4884, 1173, 3, 32, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'At the Southern Tier Brewing Company, vigorously hopped beer is our standard and inspiration. We continue a commitment to innovation with our most aggressive offering yet. Unearthly is a manifestation of the brewerâ€™s craft; skillfully balancing art and the forces of nature to produce a divine liquid. Delicately pour a taste into a fluted glass. Smell the enchanting aromas of the hops waft forward as your first sip divulges this beerâ€™s fervent soul. To underestimate Unearthly is to trifle with the mysteries of the universe, so please consume wisely.', 'http://www.southerntierbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4885, 1173, 3, 43, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4886, 1173, 11, 123, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Pumking is an ode to PÃºca, a creature of Celtic folklore, who is both feared and respected by those who believe in it. PÃºca is said to waylay travelers throughout the night, tossing them on its back, and providing them the ride of their lives, from which they return forever changed. Brewed in the spirit of All Hallows Eve, a time of the year when spirits can make contact with the physical world and when magic is most potent. Pour Pumking into a goblet and allow itâ€™s alluring spirit to overflow. As spicy aromas present themselves, let itâ€™s deep copper color entrance you as your journey into this mystical brew has just begun. As the first drops touch your tongue a magical spell will bewitch your taste buds making it difficult to escape the Pumking.', 'http://www.southerntierbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4887, 1173, 1, 20, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4888, 1173, 3, 43, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'The Popol Vuh, the sacred book of the Maya, unfolds a complex web of mystery around a beverage known as xocoatl (ch-co-atle). At Southern Tier, weâ€™re not surprised that hieroglyphs of the ancient Maya depict chocolate being poured for rulers and gods. Even through the many voyages of Columbus, the mystical bean remained nothing more than a strange currency of the native peoples. Moving through centuries, the circular journey of cacao has been realized in our brewing house, encompassing the complexity of the darkest, bitter-sweet candy together with the original frothy cold beverage of the ancient Maya to bring to you our Blackwater Series Choklat Stout. We have combined the finest ingredients to tempt your senses & renew the power & interrelation of history in every bottle. 11.0% abv â€¢ 195Âº L â€¢ Imperial Chocolate Stout â€¢ 22 oz / 1/6 keg 2-row barley / caramel 60 malt / barley flakes / chocolate malt / bittersweet Belgian chocolate / kettle hops: chinook & willamette', 'http://www.southerntierbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4890, 723, 11, 116, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'Ruddy golden, with yeast driven esters of banana, spicy clove, and nutmeg all wrapped up with a generous dose of rapscillion delight.', 'http://www.jollypumpkin.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4891, 723, 5, 74, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'An Extra Special Farmhouse Ale. A Bam celebration of excess. More malt, more hops, same vivacious personality.', 'http://www.jollypumpkin.com', 4.70, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4892, 723, 5, 74, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'Dark, smooth, delicious. Aromas of worn leather and cool autumn nights. Notes of sweet plum and toasted raisin, hints of coffee and cacao. Lingering tart and refreshing finish. Only available for a few short months. Not to be missed.', 'http://www.jollypumpkin.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4893, 723, 3, 42, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'A Belgian inspired stout that is as dark as a moonless midnight, brimming of roasted malts and bitter hops. It will keep you good company in all places, be thay light or dark.', 'http://www.jollypumpkin.com', 8.10, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4894, 723, 3, 33, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'To catch a bit of soft radiance in each bottle, we wait for fall colors to begin their bright and fleeting glow before brewing this wonderful ale under their autumn fire. Gentle amber malt blend smooth caramel notes, gently lapping against a shore of distant forgotten spice. A beer to sip, contemplate and enjoy.', 'http://www.jollypumpkin.com', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4895, 723, -1, -1, '3115 Broad Street', 'Dexter', 'Michigan', 'United States', 'Deep mahogany and malty, layered hops, figs, raisins, sugar plums, cashews betwixt rum laden truffles.', 'http://www.jollypumpkin.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.3375, -83.8895', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4896, 1243, 5, 72, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'This Belgian IPA has a malt bill of a Belgian Tripel and a hop bill of a Double IPA. The yeast I chose for this beer comes from one of the 7 Trappist breweries. Believe it or not, this is the first time in my professional brewing career that I have used dextrose (corn syrup) in a Terrapin brew. True to style no doubt. â€œMonkâ€™s Revengeâ€ (otherwise known as the â€œBig Nastyâ€) has all the flavor and aroma of a Double IPA while hidden beneath lies the malt character of a fine Belgian Tripel. I hope you enjoy my interpretation of this very fun style.', 'http://www.terrapinbeer.com/', 9.80, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
