INSERT INTO beerbuddies_db.beer VALUES (4902, 56, 11, 116, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'Made with unmalted wheat, coriander and orange peel to help you live smart and enjoy everyday!', 'http://www.atwaterbeer.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4903, 56, 2, 25, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'A robust porter made with chocolate malt. We blend it with Vanilla and Java beans, and balance it with U.S. Golding Hops.', 'http://www.atwaterbeer.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4904, 56, 7, 92, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'This one is black and sweet! Its malty character is derived from two carmel malts along with Munich malt to create the smoothest high gravity beer this side of the "pond".', 'http://www.atwaterbeer.com', 9.50, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4905, 56, 3, 31, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'Our version of India Pale Ale. Brewed with European malts and Northwest hops and then generously Dry Hopped with Cascade Hops for a nice citrus finish. Truly a Salvation for all Hop Heads.', 'http://www.atwaterbeer.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4906, 56, 3, 33, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'Rost (pronounced Roast) is a German word for Amber. Our Amber gets its coppery color from Pilsner. Munich and Caramel malts. Its rich malty sweetness is perfectly balanced by a slight hop finish and creamy head.', 'http://www.atwaterbeer.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4907, 56, 7, 90, '237 Joseph Campau Street', 'Detroit', 'Michigan', 'United States', 'A traditional german helles bock, golden in color and brewed with only the finest imported malt and hops. The distinct malty sweetness is balanced by a pronounced hop finish. Brewed to Welcome the Spring Season.', 'http://www.atwaterbeer.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '42.3372, -83.0186', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4908, 463, 3, 33, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'An Irish style red (amber) beer. Light in finish but bold in taste. Melanoidin malt is added for the red color and the spicy finish comes through from the Chinook hops.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4909, 463, 11, 116, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'This German style wheat beer contains about 50% malted wheat and is balanced with Hallertau hops. This beer finishes low in gravity so the final taste is light on the palette and extremely drinkable. This is sure to be a favorite with first time and long time wheat beer drinkers.', '', 5.10, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4910, 463, 5, 72, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'Dragonmead''s signature product! This is the ultimate Belgian style. The very high gravity of this beer is balanced by the smoothness of its finish. Banana and Clove aromas come from the Belgian yeast strain combining with the generous dose of Belgian Candi Sugar. The Saaz hops help to give this beer a balanced bitterness with no noticeable hop aroma.', '', 8.50, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4911, 463, 5, 72, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'Grand Crus are traditionally known as "The best beer that a brewery makes." This Belgian-style quad lives up to that name and then some. Available once a year, in May to celebrate our Anniversary.', '', 11.60, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4912, 463, 5, 72, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'Sweet Orange Blossom Honey is combined with Belgian two-row malted barley and Munich malt to create another Belgian classic. Tetternger and E. Kent Goldings hops are added to round out the finish of this beer. The aroma of the honey remains without the sugary sweetness.', '', 6.80, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4913, 463, 5, 72, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'This Belgian beer is brewed in the style of the Trappist Monks. Belgian Candi Sugar, Pilsen, Aromatic and Caramunich malts are balance by E. Kent Goldings, Mt. Hood and Saaz hops to construct a "Big Beer". Traditional White Beer Yeast is used to make this beer have a large mouth-feel and lingering spice notes in the finish.', '', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4914, 463, 3, 31, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'If you like your beer on the bitter side then this one''s for you. This American Style IPA uses Pale Ale, Munich, and Caramunich malt blest with Cascade, Chinook, Willamette and Centennial (dry hopped) hops to create a brew that is fit for the crazy American hop addicts.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4915, 463, 3, 33, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'The American hop Cascade is used to give this brew its classic American Aroma. Pale and Crystal malt from the U.S. are used to give this beer a medium body and high hop flavor. This beer goes down easily and opens the door to a world of microbrewed beers.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4916, 463, -1, -1, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'Little more can be said about this beer than these two words: Chocolate and Stout. This brew fills the palate with slightly sweet, super chocolate, malty flavor.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4917, 463, 1, 1, '14600 East Eleven Mile Road', 'Warren', 'Michigan', 'United States', 'This fine English style Best Bitter is made with Imported English Pale Ale, Aromatic and Caramel malts. Galena and Willamette Hops add a moderate bittering level to make this a refreshing example of an English Bitter.', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.493, -82.9753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4918, 1149, 11, 119, '40 Van Dyke St', 'Brooklyn', 'New York', 'United States', 'Righteous Ale is actually a Rye Beer, brewed with a high amount of hops.', 'http://www.sixpointcraftales.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.674, -74.0118', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4919, 784, 3, 38, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'Styled after an English classic, this beer is brewed with American flair. Hearty brown in color and full-bodied, this beer has a distinct chocolate-malt finish.', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4920, 784, 8, 95, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'This beer is an all-malt lager, brewed with a subtle blend of German hops. Cool fermentation, followed by extended aging, produces a delicate and mild flavor.', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4921, 784, 11, 116, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'This light ale is an American interpretation of a German classic. It''s not filtered and has a pleasantly tart flavor. Served with a lemon wedge.', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4922, 784, 3, 26, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'This copper-colored ale has an intense bitterness and a floral hop aroma. Hops added during aging contribute to its distinct dryness.', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4923, 784, 11, 121, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', 'This brew combines the mild, tartness of a wheat beer with the flavor of real raspberries. The raspberry flavor is not overpowering. It has a wonderful berry aroma, and is a favorite even among those who claim to "not like beer".', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4924, 784, 2, 25, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', '', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4925, 784, 3, 33, '1321 Celebrity Circle', 'Myrtle Beach', 'South Carolina', 'United States', '', 'http://www.libertysteakhouseandbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.7187, -78.8831', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4926, 826, 3, 38, '', 'Jacksonville', 'Florida', 'United States', '', 'http://www.landsharklager.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.3617, -81.6966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4927, 44, 3, 37, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Beach Bum Blonde Ale is a traditional American blonde ale with a slightly spicy hop note and balanced malty flavor.', 'http://www.anheuser-busch.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4928, 751, 8, 95, '75-5629 Kuakini Highway', 'Kailua-Kona', 'Hawaii', 'United States', '', 'http://www.konabrewingco.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '19.642, -155.996', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4929, 397, 8, 95, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'Coopers Premium Lager is quite different to the famous Coopers ales. This lager produces a refreshing flavour with a good balance of malt and hop characters and is brewed using no sugar. With its subtle fruity esters and light golden colour, combined with a judicious blend of Pride of Ringwood and Saaz hops. This produces a Lager with a crisp malty full flavour.', 'http://www.coopers.com.au/', 5.00, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4930, 397, 1, 1, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'The ale by which all others should be measured. With its famous cloudy sediment and its distinctive balance of malt, hops and fruity characters, the old ''Red Label'' is a tasty slice of Coopers history. Little has changed since Thomas Cooper produced his first batch of Coopers Sparkling Ale in 1862. It''s still brewed naturally using the century old top fermentation method and it still tastes great! Sparkling Ale contains no additives or preservatives.', 'http://www.coopers.com.au/', 5.80, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4931, 397, 1, 1, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'Guaranteed to turn heads, this is the beer that inspired a new generation of ale drinkers. With its fruity character, and robust flavour, Coopers Pale Ale is perfect for every occasion. Naturally fermented in the ''Burton-on-Trent'' style, a secondary fermentation creates the trademark sediment that gives ''Pale'' its fine cloudy appearance. This cloudy residue can be stirred through the beer by tipping or rolling the bottle before drinking. Pale Ale has no additives or preservatives.', 'http://www.coopers.com.au/', 4.50, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4932, 397, 1, 10, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'This ale is the product of brewing with a selection of barley and wheat malt, and with no added sugar. This traditional brewing approach provides the smooth malt character which is balanced by a triple hopping of the brew with Pride of Ringwood and Saaz hops. The brew has fermented similarly to its stablemates Pale and Sparkling Ale, with the customary secondary fermentation in the bottle and can.', 'http://www.coopers.com.au/', 3.50, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4933, 397, 3, 42, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'Now here''s a beer with punch! Coopers Best Extra Stout is a beacon for lovers of a hearty brew. With its robust flavour it is everything a stout should be. Brewed naturally using a top fermentation method, Coopers Stout''s unique rich, dark texture comes from specially roasted black malt. Coopers Best Extra Stout contains no additives and no preservatives.', 'http://www.coopers.com.au/', 6.30, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4934, 397, 8, 96, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'Coopers Premium Light is brewed using malted barley and no sugar. Coopers has used traditional lager brewing techniques to produce a full-flavoured light beer. The light has a fresh aroma with clean floral hop notes, excellent head and colour presentation.', 'http://www.coopers.com.au/', 2.90, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4935, 397, 8, 96, '461 South Road', 'Regency Park', 'South Australia', 'Australia', 'Birell has all the hallmarks of a great premium beer, rich colour, full malty flavour and the ability to quench a thirst, with one important difference - virtually no alcohol. Brewed under license in Australia by Coopers, Birell is made using only the finest Australian malted barley, hops and yeast, with no artificial additives or preservatives. Coopers Birell may be found in most supermarkets (375ml bottles or cans).', 'http://www.coopers.com.au/', 0.50, 0.00, 0.00, 0, '9999-01-01', '-34.8727, 138.573', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4936, 1286, 7, 84, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', '', 'http://www.troegs.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4937, 1286, 5, 74, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #14-2008 is our interpretation of a farmhouse aleâ€”a once near-extinct winter-brewed (and summerâ€“imbibed) Belgian ale. Our celebratory brew starts with a black pepper and ginger nose. The nicely carbonated brew releases a honey-malt flavor that gives way to a tart crisp finish that masks the elevated ABV. We use a blended yeast strain (Saison Dupont & Le Chouffe) to create the traditional peppery, spicy earthy flavors of the saison. Slight hints of ginger also come through in the finish. Drink it â€˜til the wedding bells chime!', 'http://www.troegs.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4938, 111, 3, 37, 'Metaalweg 10', 'Roermond', '', 'Netherlands', 'Born as â€œChristoffel Bierâ€ this was the first beer brewed by Christoffel. After the introduction of Christoffel Robertus, this beer was named Blond refering to the colour of the beer. Blond is a low-fermenting beer with 6% alc.vol. Blond has a full body, a very balanced taste and a beautiful bitterness due to a generous addition of fresh hop during the brewing-process. The aroma is fruity and Blond has a fresh taste with a pleasant, hoppy finish.', 'http://www.christoffelbeer.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.1684, 6.0515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4939, 853, 3, 26, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'A commemorative brew styled after the Sebewaing Brewing Company''s signature beer. The Sebewaing Brewing Company brewed from 1880 until 1965. This brew was commissioned for the town of Sebewaing''s 150th anniversary celebration.', 'http://www.michiganbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4940, 853, 8, 95, '1093 Highview Drive', 'Webberville', 'Michigan', 'United States', 'Brightly filtered, highly carbonated, golden premium-style lager. It is lightly hopped with Polish Lublin hops. The beer will appeal to those who prefer the lighter American style beers.', 'http://www.michiganbrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '42.6616, -84.1946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4941, 44, 3, 33, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Budweiser American Ale is brewed with barley from America''s heartland and dry hopped with Cascade hops from the Pacific Northwest. Available Fall 2008.', 'http://www.anheuser-busch.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4942, 1031, 4, 50, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Brewed by the original Wheat Beer Pioneers, Pyramid Hefe Weizen is left unfiltered for extra flavor and aroma. Handcrafted with 60% malted wheat (10% more than Bavarian tradition calls for), our award-winning Hefe Weizen is unsurpassed in quality and exceptionally smooth and refreshing for the whole beer experience.', 'http://www.pyramidbrew.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4943, 1031, -1, -1, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Inspired by the traditional KÃ¶lsch style beers of Cologne, Germany, Curve Ball boasts a clean, crisp slightly herbal taste and a lighter body. With its sporty packaging and refreshing taste, Curve Ball is the perfect accompaniment to summer grilling and ballpark outings. Try swingin'' at it on a hot summer day!', 'http://www.pyramidbrew.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4944, 1031, 11, 121, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Brewed by the original Wheat Beer Pioneers, Pyramid Apricot Weizen Ale is left unfiltered for extra flavor and aroma. The gold medalist of fruit beers, Pyramid Apricot Weizen is an adventurous wheat ale that offers the pleasing aroma and flavor of fresh apricots, and smooth and refreshing character for which our wheat beers are known.', 'http://www.pyramidbrew.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4945, 1031, 11, 116, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Brewed by the original Wheat Beer Pioneers, Amber Weizen is left unfiltered for extra flavor and aroma. Rich amber in color, Pyramid Amber Weizen features three different kinds of caramel barley malts and nugget hops resulting in an exceptionally smooth and well-balanced beer that follows in the tradition of our flagship style, Pyramid Hefe Weizen.', 'http://www.pyramidbrew.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4946, 1031, 3, 31, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'It took only a couple of rounds of India''s finest for the 19th century British Colonists to write home, "Either send us some good beer or we''re outta here." India Pale Ale is what was sent. Originally made extra hoppy to survive the voyage, it''s unique flavor also survived the Colonists finicky tastes and became and instant favorite back home. Pyramid India Pale Ale has the distinctively hoppy flavor and aroma craft beer enthusiasts demand. Abundant helpings of Columbus hops gives this ale an astonishing 67 IBU''s - truly a beer for bold tastes! The distinguished Celebrator Beer News aptly named this brew "hophead nectar" (June/July issue, 1998).', 'http://www.pyramidbrew.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4947, 144, 3, 31, '161 River Avenue', 'Patchogue', 'New York', 'United States', '', 'http://www.bluepointbrewing.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4948, 1000, 11, 126, '5N404 Harvest Lane', 'St Charles', 'Illinois', 'United States', 'An ale flavored with fresh tomatoes, oregano, basil and garlic.', 'http://www.mammamiapizzabeer.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '41.9455, -88.4507', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4949, 477, 3, 37, '605 S. Talbot St.', 'St Michaels', 'Maryland', 'United States', '', 'http://www.easternshorebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.7814, -76.2222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4950, 477, 4, 50, '605 S. Talbot St.', 'St Michaels', 'Maryland', 'United States', '', 'http://www.easternshorebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.7814, -76.2222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4951, 869, 11, 116, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'Our popular summer seasonal brewed with honey, orange, and lemonrass.', 'http://www.townhallbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4952, 869, 8, 95, '1430 Washington Avenue South', 'Minneapolis', 'Minnesota', 'United States', 'This light german style Helles Lager was brewed with a small percentage of beechwood smoked malt. Light and delicate east drinking lager', 'http://www.townhallbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.9732, -93.2479', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4953, 44, 8, 95, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Redbridge beer doesnâ€™t need to make promises to stand out from the crowd; its very essence sets it apart. Redbridge is made without wheat or barley, so the approximately 3.2 million consumers who are unable to drink beer made with barley due to Celiac Disease or because they follow a wheat-free or gluten-free diet can once again enjoy a great tasting beer. Redbridge is a rich, full-bodied lager brewed from sorghum for a well-balanced, moderately hopped taste.', 'http://www.anheuser-busch.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4954, 858, 5, 66, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'SPECIAL COMMEMORATIVE BEER To commemorate the life of a huge-hearted and long-time friend from the homebrewing community, Midnight Sun Brewing Company brewed a very special beer in honor of David Yanoshek, who was fondly known as â€œYanoâ€. This big strong beer celebrates the abundant life of an incredible man with an enormous yet ever engaging laugh. Yano pursued life with a Viking spirit, endless love and boundless energy for family, friends, scoutsâ€¦and beer. A big strong beer for a big strong guy, The Viking Belgian-style Dark Strong Ale boasts a beautiful balance of character and complexity. Dark roasted malts, Belgian yeast, star anise and sweet-ripened raisins come together in an amazing ale that can be enjoyed now and cellared for later celebrations. As you lock horns with this commemorative ale, toast to Yano. With his incredibly stoic spirit and his irrepressible laugh, Yano was the gentle giant who will forever touch our lives. PrÃ¶st! All proceeds from sales of this beer will be donated to the Yanoshek family. Availability: AK - 22-oz bottles (limited release begins 09/12/2008)', 'http://www.midnightsunbrewing.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4955, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'P9 = 9th [non-] planet from The [Midnight] Sun Named after the ruler of the underworld, PLUTO was re-classified as a non-planet in AUG 2006. Here we celebrate our â€œFallen Planetâ€ by creating a Belgian-style Golden Strong Ale, aged in French oak Chardonnay barrels with Brettanomyces. Appropriately, the devilâ€™s in the details. LOGISTICS LOG: designed to represent the "Fallen Planet" with a Belgian beer style that includes beers traditionally named after the devil. primary fermentation and aging in stainless steel. phenomenal funk flavors realized with aging in oak barrels affected with Brettanomyces. bottle-conditioning achieved with secondary fermentation. devil-may-care data continues to develop. Availability: AK - draft and 22-oz bottles (limited release begins 08/29/2008)', 'http://www.midnightsunbrewing.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4956, 858, -1, -1, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'From the talented brewers of Midnight Sun comes an incredible, beautifully bright and sunny golden ale. Every sip entices the taste buds with a bold balance of pils malt and noble hops. Midnight Sun Kolsch is a traditional German-style beer that unites the liveliness of an ale with the crispness of a lager for real refreshment any time of year. Creating a beer that truly serves both newcomers to craft beer as well as avid beer aficionados is no easy task. Midnight Sun Kolsch brewers struck gold with this beer...and now you can too. Availability: AK - draft (year-round)', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4957, 858, 3, 33, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Oosik Amber Ale is a true German-style altbier, brewed with pale, Munich and crystal malts. Deep amber with copper highlights, Oosik sports a toasted and caramel malt profile, balanced by traditional noble hops. A special yeast strain ferments this ale at cooler lager temperatures, giving it a smooth malt character and a clean finish. Want to hangâ€”so to speakâ€”for a while? Oosik Amber Ale gives you hang time. Great flavor, big mouthfeel, satisfying finishâ€¦all in a session-worthy beer. Compare it to other ambersâ€”Oosik rules. Look for our 20-inch Oosik tap in better beer bars throughout AK. You can''t just have a little Oosik. BUY the Oosik "Love is Hard" tee - men''s and women''s styles available. Availability: AK - draft (year-round)', 'http://www.midnightsunbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4958, 858, 1, 15, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Full Curl Scotch Ale is brewed in the traditional Wee Heavy Scotch strong ale style. (This is not to be confused with the lighter-bodied Scottish ale style.) All about malt, Full Curl pours dark brown with a tan head. Its medium body provides sustenance while its strength boosts courage. With a stiff mug of Full Curl under your belt, you may even have what it takes to don a kilt.', 'http://www.midnightsunbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4959, 858, 3, 42, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Dark and full-bodied, Mammoth Extra Stout boasts a well-rounded melange of rich flavors, including chocolate, caramel, coffee, nut and date. Huge portions of pale and specialty malts give this mammoth brew a complex yet exceptionally smooth palate. Hops provide balance without overpowering the chewy malt profile.', 'http://www.midnightsunbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4960, 1149, 3, 31, '40 Van Dyke St', 'Brooklyn', 'New York', 'United States', 'Sixpoint Bengali Tiger is reminiscent of the century-old English IPA. In my perspective, many current IPAs suffer from lacking substance; unbalanced by a hoppy assertiveness that is not substantiated by a strong foundation of rich malt flavors. Our interpretation uses the highest-quality, floor-malted base malt, which lends a full-bodied and rich caramel flavor. We mash at high temperatures and add generous amounts of specialty malts to further emphasize a strong foundation of malt as leverage for our generous additions of hopsâ€¦ Which are indeed generous. We use a total of three different hop strains, and add a total of six different additions throughout the process. The Bengali Tiger has a hoppy snap upfront, but strides at a steady pace, and finishes balanced. The signature characteristic of the Tiger is the aromaâ€¦ we use massive quantities of whole East Kent Goldings hops to dry hop in our conditioning tanks. The result? The essential oils from the hops are an enticing treat before every sip. Notice the lacing of stripes around the pint glass as you finish your glass; itâ€™s the mark of the Tiger.', 'http://www.sixpointcraftales.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.674, -74.0118', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4961, 604, 3, 33, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Ridgeline Amber stands out as a stellar, complex choice in a sea of over-simplified amber beers available today. A malty, copper-hued treat from start to finish, Ridgeline begins with a distinctive, estery aroma. Followed with a complex, nutty malt flavor true to its Scottish-style heritage, Ridgeline delivers unparalleled character and dimension. A touch of hops rounds out its silky, full body, highlighting Ridgelineâ€™s subtle but engrossing character. Show your friends that you care about their taste buds by turning them on to our imminently balanced and perfectly complex Ridgeline Amber. Of interest to Great Divide historians â€“ Ridgeline originally debuted at the brewery as Great Divideâ€™s first beer, Arapahoe Amber. It was renamed in 2004 to better reflect the Colorado lifestyle that Great Divideâ€™s beers perfectly complement.', 'http://www.greatdivide.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4993, 1072, 3, 31, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', 'Yellow Snow IPA was originally introduced for the 2000 Winter Olympics in Salt Lake City. Yellow Snow is Rogueâ€™s tribute to winter sports everywhereâ€”downhill skiing, snowboarding, cross country, ice hockey, ice fishing, snowmobiling, and even curling. It will be available November 1st in select states where mountains and snow can be found. Pale golden in color with a hoppy fruity aroma. Big hop flavor up front complemented by medium body and hoppyness mid-pallet. Finishes with a characteristic lingering bitterness.', 'http://www.rogue.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4962, 604, 2, 25, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'St. Bridget, a legendary Irish saint, created a sensation by turning her bathwater into beer. What better way to celebrate her worthy miracle than with our zymurgistic tribute to her feat: St. Bridgetâ€™s Porter. St. Bridgetâ€™s is a smooth and elegant brown porter. Brimming with coffee and chocolate characteristics from dark barley malts, St. Bridgetâ€™s is carefully hopped to provide the perfect complement to its malty robustness. This beer is a â€œmust haveâ€ beer for all porter lovers. Prepare yourself for a religious experience', 'http://www.greatdivide.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4963, 604, 11, 121, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'What better way to surprise a beer lover than with a fruit beer that tastes like beer? Nine years ago, we began our quest to provide beer lovers with a worthy fruit beer, by rolling out Wild Raspberry Ale. Our mantra is that real fruit makes real beer, so we ferment Wild Raspberry Ale with hundreds of pounds of real red and black raspberries. We steadfastly refuse to fall prey to extracts and cheap syrups. Sure, squirting syrup into a keg of beer and rolling it around on the floor is easy, but the taste is... fake! Over the past nine years, we have stayed true to our commitment to real fruit, no matter what the time, expense, or late season frosts have thrown our way. One year, Mother Nature delivered a late cold snap that was so severe, we had to pre-order 85% of the harvestable U.S. black raspberry crop, just to meet the demand for Wild Raspberry Ale. Our efforts do not go unrewarded â€“ Wild Raspberry Ale is a truly effervescent, ruby red ale that achieves the almost impossible balance between malted barley and tart raspberry fruitiness. Its naturally tart character makes Wild Raspberry the ultimate accompaniment to spicy Mexican food or on its own as a stand-alone session beer.', 'http://www.greatdivide.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4964, 604, 5, 65, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Hades is a Belgian-style strong golden ale brewed with a rare Belgian yeast strain that gives the beer a distinctive spicy flavor and aroma. Noticeable hops and medium malt character make it an extremely well-balanced, crisp ale.', 'http://www.greatdivide.com/', 7.30, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4965, 609, 5, 72, '1430 Vantage Court #104A', 'Vista', 'California', 'United States', 'Extreme ale converging San Diego-style imperial pale ale and Belgian-style trippel.', 'http://www.greenflashbrew.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '33.136, -117.225', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4966, 110, 5, 72, 'Eindhovenseweg 3', 'Berkel-Enschot', '', 'Netherlands', '', 'http://www.latrappe.nl/', 5.00, 0.00, 0.00, 0, '9999-01-01', '51.544, 5.1285', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4967, 960, 1, 1, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'An English pale ale brewed by Otto''s for the Mount Hill Tavern in Harrisburg Pennsylvania.', 'http://www.ottospubandbrewery.com/index.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4968, 259, 5, 74, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'The second beer of the Brewmaster''s reserve line, Saison de Brooklyn is brewed in the style produced by old farmhouse breweries in Belgium and France. Well-hopped and fermented to a crisp dryness, Saisons were brewed in the spring to sustain farmers through the summer. Saison de Brooklyn is boldly hoppy, dry and flinty, with a bright spicy, citric aroma and pillowy white head. This beer has remarkable versatility with food, complementing spicy dishes particularly well.', 'http://www.brooklynbrewery.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4969, 1204, 5, 72, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', '', 'http://www.stonebrew.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4970, 1383, 1, 1, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Boasting superior taste and champion flavor, the Brawler is crafted in the style of English session ales. This malt-forward, ruby colored ale is great for when you want to go a few rounds.', '', 4.30, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4971, 1383, 3, 26, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Not to be boastful, but we honestly believe that all other ales pale in comparison to this one. Brewed with pilsner malt, Philadelphia Pale Ale is crisp and hoppy, bursting with citrus flavors and aromas. Philadelphia Pale Ale was named one of the best Pale Ales in the country by the New York Times.', '', 4.60, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4972, 1383, 3, 33, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Crafted from the finest ingredients and originally intended for the cask-ale connoisseur, Extra Special Ale is a robust and hearty amber ale with a malt body and aromatic hop finish.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4973, 1383, 3, 31, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'IPAs were originally brewed to survive the epic sea voyages from England to India. Ours is no different. Hailing from a firm malt background and loaded through and through with hops, this beer will surely survive the journey from your fridge to your couch.', '', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4974, 1383, 3, 42, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Straight from the heart of the City of Brotherly Love comes a dark and chocolatey seductive little stout dominated by roasted malt flavor. This is one Philly favorite that won''t break your heart and will always love you back.', '', 4.50, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4975, 905, 3, 31, '500 Linden Street', 'Fort Collins', 'Colorado', 'United States', 'Ever met a New Belgium Beer Ranger? They are our beloved folks out in the field. Spanning all 26 of our states from the Pacific to the Atlantic, our Beer Rangers do their best to protect, to pour and to partake. And explore many a beer from many a brewery, they do. The fellows up in the Northwest kept calling for â€œmore hops!â€ Soon it became a common theme across the land. Rangers, fans and craft lovers everywhere were searching for hoppier beers. So, here it finally is â€“ New Belgiumâ€™s foray into the true American India Pale Ales. Bring out the hops! This clear amber beauty bursts at the starting gate with an abundance of hops: Cascade (citrus), Chinook (floral/citrus), and Simcoe (fruity) lead off the beer, with Cascade added again for an intense dry hop flavor. Brewed with pale and dark caramel malts that harmonize the hop flavor from start to finish, Ranger is a sessionable splendor for all you hopinistas. Thank your Beer Ranger!', 'http://www.newbelgium.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.5929, -105.07', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4976, 1383, 11, 126, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'Brewed to celebrate Ben''s 300th birthday. Whether Ben Franklin ever said, "Beer is living proof that God loves us and wants us to be happy" is up for debate. Some say he said it, others say he didn''t. No one knows for sure. Historical facts or fictions aside, Yards Brewing Company has recreated Poor Richard''s Tavern Spruce Aleâ„¢ to celebrate Franklin''s affinity for fine ales. Poor Richard''s Tavern Spruce Ale is based on Franklin''s original recipe, which called for spruce essence and molasses, as barley and hops were not readily available at the time. Enjoy a taste of history courtesy of Yards Brewing Company, Philadelphia''s premier brewer and bottler.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4994, 1072, 7, 92, '2320 SE OSU Drive', 'Newport', 'Oregon', 'United States', '', 'http://www.rogue.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '44.6202, -124.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4977, 1383, -1, -1, '2439 Amber Street', 'Philadelphia', 'Pennsylvania', 'United States', 'All beers are not created equal. While Thomas Jefferson spent much of his time in Philadelphia drafting, editing, revising, and re-editing the Declaration of Independence, he longed to be home in Monticello, where twice a year his wife Martha would brew up one of his favorite beverages â€” beer. Thomas Jefferson Tavern Aleâ„¢ is a strong golden ale, based on Jefferson''s original recipe, which included ingredients specified and grown on his Virginia estate. Enjoy a taste of history, courtesy of Yards Brewing Company, Philadelphia''s premier brewer and bottler.', '', 8.00, 0.00, 0.00, 0, '9999-01-01', '39.9831, -75.1274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4978, 634, 11, 121, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'We have added natural raspberry flavor to our UFO Hefeweizen to create this beer. Consistent with the hefeweizen style, this beer is unfiltered and cloudy with a solid foamy head. UFO Raspberry has a distinctive, hazy rose color. The scent of fresh raspberries hits the nose immediately, along with a subtle bready aroma from the wheat and yeast. The body is light and the unfiltered yeast provides a soft mouthfeel. The taste of the fruit compliments the beer nicely, neither overwhelms the other. There is a faint sweetness on the palate, which finishes cleanly in a semi-dry, tart finish.', 'http://www.harpoonbrewery.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4979, 634, 3, 38, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'Harpoon Brown is brewed to accentuate the sweeter, rounder notes derived from six different malts, including a de-husked chocolate malt that adds a hint of chocolate. The blend of these malts produces a beer that is complex and delicious without being heavy. This drinkable beer is perfect as a session beer or paired with foods. This is the first year-round Harpoon beer the brewery has released in almost a decade. While the craft beer industry has seen a growing trend in "extreme" beers, the brewers of Harpoon wanted to create something they could sit down and enjoy over an extended period of time - a session beer. At 4.3% alcohol by volume, the Harpoon Brown Ale has the lowest alcohol content of all Harpoon beers. Harpoon Brown Ale will be available in bottles and on draft beginning in March 2007. An evening of celebrations to toast the beer''s release will be held at locations throughout New England on Thursday, March 8th, including tastings at Harpoon''s breweries in Boston, MA and Windsor, VT', 'http://www.harpoonbrewery.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4980, 1142, 7, 91, '1075 East 20th Street', 'Chico', 'California', 'United States', 'As winter begins its slide toward the sunny days of spring, we bring you Glissade Golden Bock to help you enjoy the ride. Glissade is a remarkably mellow take on the traditional spring bock. With restrained sweetness, we emphasize subtle malt flavor, balanced against delicate aromas of spicy and floral European hops. This complex balance helps Glissade slide across the palateâ€”bracing us against the last cold nights of winter, while its bright golden color turns our thoughts toward spring.', 'http://www.sierranevada.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4981, 634, 3, 38, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'Harpoon Munich Dark is a blend of dark malts that creates a deeper hue than some other beers brewed in this style. The grains which create a malty chocolate-like flavor also add a warm malty nose that mingles with the subtle hop aroma. This medium bodied beer is balanced quite well with a moderately bitter hop finish.', 'http://www.harpoonbrewery.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4982, 976, 7, 77, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4983, 976, 3, 26, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4984, 976, 3, 31, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4985, 976, 7, 84, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4986, 976, -1, -1, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', 'Our fourth in the Firehouse Ales Series, Pompier means "fireman" in French and represents our continued commitment to celebrate and honor the men and women who respond to the call day after day. Pompier is rich and smooth with complexities that come from a huge grain bill comprised of premium imported specialty malts, French Strisselspalt aroma hops and a 3 month aging process in oak hogsheads where it is combined with toasted French oak wood chips and champagne yeast. Pompier is intended to be a vintage quality English-Style Barleywine with a French twist. Appreciate its fine character and 12.1%ABV when we release this single 10 barrel batch sometime in December or you may choose to cellar it for many years to come. You will find Pompier on retail shelves packaged in the same 1 Liter Swing-Top bottle that has become a signature for our specialty beers.', 'http://www.pennichuckbrewing.com/', 12.10, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4987, 976, 1, 15, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4988, 976, 3, 33, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
