INSERT INTO beerbuddies_db.beer VALUES (4991, 976, 7, 86, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4992, 1009, 3, 31, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'ach and every fall, we experience a coastal experience in San Diego known as the "Super High Tide." This happens later in the Fall Season when the tidal swings reach a range of about 8 feet in difference between low and high tides. When this happens, there are days when the tide just gets too high and flattens out the surf. The lineups shut down and surfers are left to wait until the High Tide recedes. While waiting for the tides to shift in your favor, might we suggest a High Tide IPA? Brewed only once each year to coincide with the Hop Harvest in Yakima Washington, High Tide IPA is made with 180 lbs of Fresh Hops per batch that are plucked from the vines and sent straight to our brewery. We skip the whole drying and processing stage which means the hops are ultra fresh and full of flavors we can''t normally get. Like grapes, Hops are only harvested one time each year and as such, we make what we can when we get them.', 'http://www.portbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4995, 10, 11, 116, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Purple Haze is a crisp, American style wheat beer with raspberry puree added after filtration. Therefore, you may see raspberry pulp in the beer. The raspberries provide the lager with a subtle purple coloration and haze, a fruity aroma, and a tartly sweet taste.', 'http://www.abita.com/', 4.75, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4997, 1142, 3, 31, '1075 East 20th Street', 'Chico', 'California', 'United States', 'Sierra Nevada Torpedo Ale is a big American IPA; bold, assertive and full of flavor and aromas highlighting the complex citrus, pine and herbal character of whole-cone American hops. Named after the torpedo-shaped hopback employed in its making, is an IPA made with Chinook, Cascade and Centennial hops.', 'http://www.sierranevada.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4998, 520, 5, 67, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'FiftyFifty''s "Wit" beer, Foggy Goggle is a Belgian Style Wheat Beer, cousin of the German Hefeweizen. An unfiltered beer, Foggy Goggle is brewed true to style, using a yeast strain that originated in Belgium, with just a hint of orange peel, lemon peel, and chamomile. The appearance is an opaque yellow with a wonderfully fluffy head. The predominant aroma is citrus with a hint of coriander, and a unique spicy note. With citrus playing a big part of the flavor, Foggy Goggle is a very refreshing choice.', 'http://www.fiftyfiftybrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (4999, 1142, 3, 43, '1075 East 20th Street', 'Chico', 'California', 'United States', '', 'http://www.sierranevada.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5000, 100, 1, 15, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A Scotch Ale, â€œbrewed with 100% Michigan barley and a blend of Pacific Northwest and Michigan hops.â€', 'http://www.bellsbeer.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5001, 44, 11, 123, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Our fall seasonal is a subtle, well-balanced ale, copper in color, offering rich, full flavors and aromas of pumpkin and spices.', 'http://www.anheuser-busch.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5002, 44, 11, 116, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Sun Dog is an unfiltered beer, with a naturally cloudy appearance and fuller texture which allows it to stand up to spicy foods like Thai noodle salads and Cuban sandwiches. The beer is best served in a tall, wide-mouthed glass which opens up the aromas of the beer and showcases its beautiful long-lasting head of white foam.', 'http://www.anheuser-busch.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5003, 1173, 3, 43, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'It is beer #2 in our "Blackwater Series" of original Imperial Stouts. The first in the Series was "Is", a dark and bitter Russian Imperial Stout. "Oat" is the follow up; an Oatmeal Stout with major alcohol volume and tons of body to back it up. The cloying character of the oats in this brew lends itself to a chewy and almost oily mouthfeel. ABV. is off the charts at about 12.5%. Note, that this is an all malt beer fermented with our house ale strain of yeast. Judicious hopping with Columbus and Chinook produce a hoppy aroma that mingles nicely with the chocolate and de-bittered black barley from Belgium.', 'http://www.southerntierbrewing.com/', 12.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5004, 1301, 3, 37, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'Nothing beats a day at the beach... the sun, the sand and, of course, the scenery. Here in Lake Mills, the three beaches of Rock Lake have drawn young and old for generations... to laugh, to play, to frolic, to just escape stresses of life for a time. Three Beaches Honey Blonde is like a day at the beach... light, bleached blonde, gleefully effervescent, free from bitterness and sure to improve your attitude. When you need a little attitude adjustment, spend a day at the beach with Three Beaches Honey Blonde... and you won''t even have to wash the sand out of your suit! Three Beaches Honey Blonde is our Wisconsin version of the American Blonde Ale. This beer is light-bodied with a sweet touch of honey and a mild citrus accent.', 'http://www.tyranena.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5005, 1301, 4, 57, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'The ancient peoples that inhabited Wisconsin are known for building numerous celestial stone monuments and earthen effigy mounds to serve as symbols of their culture and their beliefs. Unfortunately, most of these structures have fallen victim to the farmer''s plow over the past 150 years. Not far from the brewery, lying preserved on the floor of Rock Lake, are two effigy mounds - a Headless Man and a Turtle. Legend tells us, as the Turtle can survive on both land and in water, its spirit helped guide the Headless Man into the afterlife. May the Turtle''s spirit guide you to happiness with a Headless Man Amber Alt. The Headless Man is brewed in the "old way" of a DÃ¼sseldorf-style Altbier. A unique cold lagering process gives this amber ale its smooth taste.', 'http://www.tyranena.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5006, 1301, 3, 38, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'Deep in the darkest depths of Rock Lake prowls a great saurian known today as Rocky. The legend of Rocky is old. The ancient inhabitants of Aztalan warned of the beast by building a giant serpent mound at the lakeâ€™s edge. The early residents of Lake Mills were forewarned of a guardian placed in the lake to protect its sacred stone tepees. And history tells of numerous encounters with Rocky, who became a source of great worry and fear. Although not seen for over a century, divers still experience a feeling of dread and being watched. Enjoy Rockyâ€™s Revenge, our offering to this legendary protector of Tyranena. Rockyâ€™s Revenge is an American brown ale with a portion aged in bourbon barrels. Each bourbon barrel will contribute its own unique character to this rich, satisfying ale.', 'http://www.tyranena.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5007, 1301, 4, 50, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'The Fargo brothers arrived in Lake Mills in 1845, armed with a strong collective will and a pioneering spirit. The Fargo family became leaders in commerce, industry, agriculture, civics and religion. Through the years, these hard working men and their families shaped the character and very essence of our beautiful hometown. Their legacy endures in the buildings and businesses they built and the civility they brought to this city. In this same pioneering spirit, we brew our Fargo Brothers Hefeweizen to honor this "first family" of Lake Mills. Fargo Brothers Hefeweizen is brewed in the tradition of a Bavarian-style weiÃŸbier with a clove-like flavor and aroma with banana undertones and no bitterness. The unfiltered yeast makes this beer cloudy.', 'http://www.tyranena.com', 5.25, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5008, 1301, 7, 84, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', 'Gemuetlichkeit translates from German as "the fondness of feasting, drinking and merry company." This is true of most everyone in Wisconsin, especially those of us at the brewery. Each September in the nearby city of Jefferson, Wisconsin, thousand turn out for Gemuetlichkeit Days, a celebration of the area''s German heritage. We invite you to celebrate the spirit of Gemuetlichkeit with us. Don your lederhÃ¶sen, kick up your heels with a polka and raise a stein of our Gemuetlichkeit Oktoberfest with a friend. Ein Prosit! Gemuetlichkeit Oktoberfest is a rich, amber lager with a malty aroma and balanced hop bitterness. This seasonal style is served at German Oktoberfests in liter steins.', 'http://www.tyranena.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5009, 1301, 3, 32, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', '', 'http://www.tyranena.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5010, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'In tribute to its namesake god of agriculture, SATURN celebrates a bountiful Pacific Northwest hop harvest. Ample malt sets the stage for this end-of-season party. Fresh Cascade and Centennial hops from Yakima Valley mingle with Belgian yeasts to impart abundant spice and earthiness.', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5011, 609, 3, 33, '1430 Vantage Court #104A', 'Vista', 'California', 'United States', 'Resinous hop character and bitterness balance the rich carmel malt base. We took it a step further and Amarillo dry-hopped the brew to 45 ibu''s, creating refreshing and savory hop flavors and aromas. Is it red IPA? That''s your call.', 'http://www.greenflashbrew.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '33.136, -117.225', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5012, 686, 3, 31, '856 10th Street', 'Arcata', 'California', 'United States', '', 'http://www.humboldtbrews.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '40.87, -124.087', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5013, 476, 5, 61, '6923 Susquehanna St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'THE UGLY AMERICAN is a perfectly enjoyable classic Belgian Trippel corrupted almost beyond recognition with a completely inappropriate amount of US hops. Only in America can such excessive excesses be fully appreciated, celebrated, and enjoyed...and for now, only at East End Brewing! To make this one a little more cellar-able, and a lot more portable, it''s going into the bottle.', 'http://www.eastendbrewing.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '40.4553, -79.9043', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5014, 476, 5, 67, '6923 Susquehanna St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'A "Belgian White" wheat beer, gently spiced with (new!) coriander and bitter orange peel. Light bodied with hints of orange and lemon. A great beer for hot weather or for those looking for something lighter all year round.', 'http://www.eastendbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.4553, -79.9043', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5015, 476, 3, 31, '6923 Susquehanna St.', 'Pittsburgh', 'Pennsylvania', 'United States', '', 'http://www.eastendbrewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '40.4553, -79.9043', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5016, 396, 1, 3, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Tavern Ale is a traditional English Bitter, dry bodied and light in color. This sessions ale utilizes Northdown and Kent Golding Hops. Tavern Ale is the creation of Assistant Brewer Adrian Bethel.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5017, 396, 3, 38, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Bumppo''s Brown Ale is a dark Dark Mild Ale. It is lightly hopped with a medium body, darkened and flavored with chocolate malt.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5018, 396, 1, 1, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Cooper''s Cave Pale Ale is an English Pale Ale throughout.It is a full bodied light colored ale with evenly pronounced hop bitterness. The grain bill consists of two English Pale Malts and an English Crystal Malt. The brewer''s favorite...need we say more.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5019, 396, 2, 25, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Pathfinder''s Porter is a robust, dark and hoppy ale originally brewed for street urchins of London. Our version does the job for the Glens Falls urchins of today.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5020, 396, 2, 22, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Cooper''s Cave Ale Company''s flagship ale is an Irish Red Ale. Three English Malts and one Belgian Munich Malt make up the grain bill. It is a full bodied Red Ale packed with flavor, blended with American Nugget hops for bitterness and East Kent Golding for flavor and aroma. This ale has turned the heads of many "dyed in the wool" American lager drinkers.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5021, 396, 3, 42, '2 Sagamore Street', 'Glens Falls', 'New York', 'United States', 'Sagamore Stout is a light, dry Irish Draught Stout. It is not only named for the street on which our brewery is located but also for the "Sagamore" of the Mohicans, the Chief Chingachgook. Best quaffed using a wide mouthed, full blown English Pint.', 'http://www.cooperscaveale.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.3177, -73.64', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5022, 314, 3, 31, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', 'This beauty is a complete work of art! Bryan and I picked 22 lbs of fresh Cascade hops from 3 gigantic hop vines Bryan has at his house. Hops produce an overabundance of hop cones and we were there for the picking. Even after 22 lbs, we hardly put a dent in the yield! So...here we are 3 weeks later, the beer is on tap and it is the freshest...hoppiest...flavorful beer you can imagine! Needless to say, we are proud of this beauty from the ground, up! We wanted a full-flavored IPA, so Bryan suggested we use our Requiem IPA recipe, and calculate for fresh, whole hop cones. Worked beautifully!! We ended up with an IPA with so much up-front flavor you would think you are enjoying a high octane Imperial! Instead, this is a middle-of-the-road IPA, at 5.2% abv!! This just goes to show how a hugely flavorful IPA can be loaded-up with fresh ingredients and come out the other end, a tasty LOW octane, treat! Bryan and I hope you get to stop in soon to try this one out! We decorated Bube''s with some of the actual hop vines we pulled from. For the true hophead, you will be in heaven. And for the all-around beer enthusiasts, we hope you can appreciate the creativity in this beer. I know I''m proud to say I had a hand in this one!!', 'http://www.bubesbrewery.com', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5023, 314, 8, 95, '102 North Market Street', 'Mount Joy', 'Pennsylvania', 'United States', '', 'http://www.bubesbrewery.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1119, -76.5031', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5024, 1038, 8, 95, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'It''s our very first beer - golden medium-bodied and brewed as a traditional Munich Helles style pale lager. It features a rounded maltiness without being too heavy. And like every proud Texan, it has a good head, is pleaseant but never overly sweet.', 'http://www.rahrbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5025, 1038, 3, 33, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Rahr''s Red is a delicious, medium-bodied red lager. Notes of caramel with a sound malt character. Not too hoppy, very smooth.', 'http://www.rahrbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5026, 1038, 3, 33, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Rahr''s Buffalo Butt is a smooth, medium-bodied amber lager. Notes of caramel with a sound malt character. Nice hop finish, it''s as smooth as a baby buffalo''s...!', 'http://www.rahrbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5027, 1038, 7, 86, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Ugly Pug is a schwarzbier, or black lager. But the real story is its name. Fritz saw his mother-in-lawâ€™s pug, Oscar, lounging in a chair and he (Fritz) shouted, â€œWhat an ugly pug!â€ Everyone laughed. Yourâ€™re right â€“ they were drinking a test batch that night.', 'http://www.rahrbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5076, 1125, 11, 121, '26 Front Street', 'Bangor', 'Maine', 'United States', 'Our unique contribution to the fruit ale category features the nutty quench of wheat ale combined with the delightful aromatics and subtle fruit flavor contributed by Maine wild blueberries.', 'http://www.seadogbrewing.com/', 3.50, 0.00, 0.00, 0, '9999-01-01', '44.7974, -68.77', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5028, 1038, 3, 31, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'During a fierce storm on his voyage across the ocean, William Rahr could be heard yelling from the tall masted ship: "Roll on old sea! And when you are done, when the storm clouds have destroyed themselves, we will still be standing and drinking!" Today, we have created the ultimate ale for a voyage such as this: A German-Style IPA - a traditional India Pale Ale with German Influence.', 'http://www.rahrbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5029, 1038, 3, 26, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Blind Salamander Pale Ale is the first of a series of Rahr beers called Rare Breed. These beers are dedicated to improving the lot of endangered Texas species. Rahr is making donations from these proceeds to the Texas Parks & Wildlife Foundation to help with the recovery of these species. The Texas Blind Salamander is a rare cave dwelling troglobite amphibian native to San Marcos, specifically the San Marcos Pool in the Edwards Aquifer. It has bright red external gills for absorbing oxygen from the water. Its mature length is 5 cm and its diet varies by what flows into its cave, including shrimp, snails and amphipods. Blind Salamander Pale Ale is a blend of the finest pale malts and East Kent Goldings hops. The fine balance of these toasted caramel malts and earthy hops makes Blind Salamander an easy drinking and satisfying ale.', 'http://www.rahrbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5030, 1038, 7, 91, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Bucking Bock - it''s a traditional German Spring Bock Beer - golden in color and mildly hopped...... Kick''n in at 8% alcohol - it has a smooth malty character that will surely thaw you out after a long cold winter. Spring is here and so is Rahr''s Bucking Bock!', 'http://www.rahrbrewery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5031, 1038, 4, 50, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'There is nothing more refreshing than a cold SUMMERTIME WHEAT at the end of a hot Texas day. This refreshing, lightly hopped ale has unique banana and clove-like characteristics. It is unfiltered so the yeast character comes through with a light but full body.', 'http://www.rahrbrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5032, 1038, 7, 84, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', '"O''zapft is!" The cry of happy beer drinkers at the start of the Munich Oktoberfest, which in German means "The keg is tapped!" Rahr''s Oktoberfest Celebration Lager is a traditional Marssen style Oktobefest lager - dark amber in color, super smooth, medium body with a sweet malty finish. True to tradition, this is a classic Oktoberfest Lager.', 'http://www.rahrbrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5033, 1038, 11, 141, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Warm up the long, cold nights of winter with Rahr''s latest seasonal offering. Wonderfully robust, rich and full-bodied, Rahr''s Winter Warmer is crated in the fine British tradition of holiday ales. Perfect for either holiday gatherings or quiet evenings at home.', 'http://www.rahrbrewery.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5034, 1038, 11, 141, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'This is a special edition of Rahr''s Winter Warmer. This fine English ale has been aged in freshly emptied Kentucky oak whisky barrels. The barrel aging has given this already big ale a beautiful whiskey nose along with notes of vanilla and oak. A perfect ale for sipping around a winter fire.', 'http://www.rahrbrewery.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5035, 1038, -1, -1, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', '', 'http://www.rahrbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5036, 1251, 5, 74, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'From the French word â€œGardeâ€ meaning something worth keeping, this Biere de Garde styled Farmhouse Ale is a most delicious companion to a loaf of freshly baked bread from the oven. Grab a seat on the porch, some soft cheese and a tree ripened apple from your grandmotherâ€™s old orchard. Relax and watch the evening arrive as the afternoon sun is consumed by the illuminating moon over the gardens. We brewed Avant Garde for you, our friends and families. Hereâ€™s to things worth guarding over.', 'http://www.lostabbey.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5037, 1251, 5, 72, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'Lost and Found- Modeled after the great Trappist and Monastic beers that inspired the founding of our brewery. A richly deep garnet colored ale created from a blend of Domestic and imported malts. As part of our commitment to interesting brewing endeavors, Chef Vince created a special raisin puree for this beer. Malts, raisins and a fantastic yeast strain working in harmony produce a beer of amazing complexity and depth. Available in 750ml bottles and on draft at select inspired locations.', 'http://www.lostabbey.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5038, 1251, 5, 74, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'This Farmhouse Ale traces its roots to the small rustic breweries of Southern Belgium. The word Saison comes to us from the French language and it means Season. Lightly spiced with Organic Ginger, Orange Peels, Black Pepper and Grains of Paradise, this brew promises to quench your thirst on the hottest Southern California days or wherever your travels may take you. Available in 750 ml bottles and on draft at select inspired locations.', 'http://www.lostabbey.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5039, 1251, 5, 62, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'A massive beer in every sense of the word. A stronger and more contemplative version of our Lost and Found Ale. Judgment Day is the base beer for our Cuvee de Tomme. Many of the Trappist Breweries produce a version of beer which ages incredibly well for many years to come. And, since none of us knows when the end of the world is coming, we suggest you stock up with lots of Lost Abbey beers so that when the end of the world magically appears from no where, youâ€™ll have a beer or two on hand for even the stingiest of angels. Available in 750ml bottles and on draft at select inspired locations.', 'http://www.lostabbey.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5040, 1251, 5, 64, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'Itâ€™s an unassuming road leading to the priory. Here, off the corner of two intersecting roads, dedicated monks have been making beer for over 150 years. Itâ€™s always been a simple life â€“ the kind that requires they brew only enough to sustain the activities of their monastery. In the silence of passing seasons, they pray, they brew and retire in solitary existence behind the sheltering walls. They live a most interesting life. Most likely one we couldnâ€™t sustain. Nearby, each summer, the trellised fields spring to life as rows of resinous green cones are trained toward the heavens. Rumor is some monks love these hops and being surrounded by budding yellow aromas and the leafy pungent fields inspired them. Since we arenâ€™t sensible enough to locate our brewery near hop fields, we can only offer this blond ale in celebration of our Abbey brethren and their steadfast Devotion.', 'http://www.lostabbey.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5041, 1251, 3, 43, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'The history of the bible and religion is indeed the struggle of good vs. evil. Our Serpentâ€™s Stout recognizes the evil of the dark side that we all struggle with. This is a massively thick and opaque beer that begs the saints to join the sinners in their path to a black existence. 10.5% ABV and available in 750 ml bottles and on draft at select locations.', 'http://www.lostabbey.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5042, 259, 8, 95, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'Please enjoy Brooklyn Oktoberfest, a rich, malty version of the beer brewed for the fall festival which originated in Germany with the betrothal of the Crown Prince of Bavaria in 1810. Brooklyn Oktoberfest is in the marzen style, an amber lager beer brewed in March and stored cold through the summer for sale in autumn.', 'http://www.brooklynbrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5043, 424, 5, 72, '', 'Tournai', '', 'Belgium', 'Daas Blond is the authentic Belgian strong golden beer, its honey spice aroma and perfect balance of bitter sweet flavours are followed by a classic dry hop finish. A perfect aperitif beer. Daas Beer is the only Belgian beer brewed in Belgium to carry both the UK Soil Assoc organic certification and the Belgian Certsys certification whist still upholding its Belgian tradition of brewing excellence using the finest organic ingredients.', 'http://www.daasbeer.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '50.6059, 3.3884', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5044, 424, 5, 67, '', 'Tournai', '', 'Belgium', 'The Daas Organic Witte is very well received by women beer drinkers; it is a naturally cloudy Belgian wheat beer. Its fruity blend of subtle citrus (baked oranges) and spice (coriander) flavors compliment its crispy dry and bitter hop finish.', 'http://www.daasbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.6059, 3.3884', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5045, 1093, 5, 74, '1441 Savannah Ave Unit E', 'Tarpon Springs', 'Florida', 'United States', 'A bottle conditioned Saison with a spicy and moderately hoppy profile true to the traditions of the farmhouse ales of Wallonia. A spiced saison with chamomile, rosemary and black pepper.', 'http://www.saintsomewherebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '28.1646, -82.7717', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5046, 1093, 5, 72, '1441 Savannah Ave Unit E', 'Tarpon Springs', 'Florida', 'United States', 'Brewed in the spirit of the abbey ales of Belgium. Brewed with the same care and attention to the Art of Brewing that is practiced in the monastic breweries of Belgium. A Belgian inspired amber. This beer gets itâ€™s color from the candi sugar, as it is made without dark or crystal malts.', 'http://www.saintsomewherebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '28.1646, -82.7717', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5047, 10, 3, 29, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Turbodog is a dark brown ale brewed with Willamette hops and a combination of British pale, crystal and chocolate malts. This combination gives Turbodog its rich body and color and a sweet chocolate-toffee like flavor. Turbodog began as a specialty ale but has gained a huge loyal following and has become one of our three flagship brews. Just a bit stronger than our other brews, so . . .beware of the dog!', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5048, 259, 5, 65, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'In Williamsburg, Brooklyn, we forge barley malt and hops from Germany, aromatic raw sugar from Mauritius and yeast from Belgium into our latest beer, Brooklyn Local 1. Behind the full golden color you''ll find an alluring aroma, a dynamic complex of flavors, Belgian flair, Brooklyn fortitude and a dusting of our special yeast. To create this beer, we use the old technique of 100% bottle re-fermentation, a practice now rare even in Europe. It gives this beer a palate of unusual depth. Enjoy it locally or globally, as an aperitif or with your favorite dishes. It is particularly nice with spicy seafood and with fine cheeses.', 'http://www.brooklynbrewery.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5049, 751, 2, 25, '75-5629 Kuakini Highway', 'Kailua-Kona', 'Hawaii', 'United States', 'Pipeline Porter is smooth and dark with a distinctive roasty aroma and earthy complexity from its diverse blends of premium malted barley. This celebration of malt unites with freshly roasted 100% Kona coffee grown at Cornwell Estate on Hawaiiâ€™s Big Island, lending a unique roasted aroma and flavor. A delicate blend of hops rounds out this palate-pleasing brew.', 'http://www.konabrewingco.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '19.642, -155.996', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5050, 923, 5, 67, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'This Belgian Ale is what you could call a wit with an attitude. We are generous with all our ingredients - including both orange peel and coriander. This does not stop this ale from being a good companion with seafood dishes.', 'http://nogne-o.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5051, 923, 1, 3, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'A light session ale, with an assertive hop aroma of E K Golding. Great beer to pair with lots of different food - a good allround.', 'http://nogne-o.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5052, 923, 1, 21, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'We usually do not make compromises, but this is probably the exception. Norwegians are dead scared of dark beers. This is an attempt to show that there are gentle dark ales. As such Havre Stout is smooth and drinkable.', 'http://nogne-o.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5053, 923, 5, 74, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'One of our most refreshing brews, made for those hot summer days, but satisfying year ''round. Recommended serving temperature 8Â°C/45Â°F. Goes well with seafood, particularly oysters.', 'http://nogne-o.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5054, 923, 3, 33, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'A rather malty brew, which we think goes very well with cheeses - even well matured blue cheeses. You can also try our Amber paired with a grilled dish. Recommended serving temperature 10Â°C/50Â°F.', 'http://nogne-o.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5055, 923, 3, 38, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'There is a long story to this malty ale. It was first brewed in the spring 2006 in NÃ¸rrebro Bryghus in Copenhagen, Denmark, as a joint brew between NÃ¸gne Ã˜ and NÃ¸rrebro. NÃ¸rrebro calls their version â€œDouble Knot Brownâ€. It is the perfect thing to drink with almost any cheese.', 'http://nogne-o.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5056, 923, 3, 31, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'A rich, malty, and very bitter ale. Cascade hops provide a long, fruity, and spicy after-taste. Recommended serving temperature 10Â°C/50Â°F. Ideal with barbequed or smoked meat dishes.', 'http://nogne-o.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5057, 923, 3, 35, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'Our 100th batch, brewed for the enjoyment of the brewers, but popular demand forced us to release it commercially. This malty, yet light bodied ale has a massive hop bitterness. Most enjoyable in a comfortable chair in front of a roaring fire.', 'http://nogne-o.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5077, 1031, 3, 33, '91 S Royal Brougham Way', 'Seattle', 'Washington', 'United States', 'Mahogany in color, this full-bodied ale features a floral aroma and malty finish for a taste that''s the perfect accompaniment to a crisp autumn afternoon.', 'http://www.pyramidbrew.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '47.5924, -122.334', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5058, 1173, -1, -1, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'St. Nicholas, aka Santa Claus, is a magical figure, the bringer of gifts and an icon of holiday spirit. Forgotten by most is his evil side kick and enforcer of â€˜the listâ€™. European tradition says while St. Nick is busy delivering presents to good little boys and girls, Krampus hands out punishments to the bad. A fanged, goat-horned bully, the Christmas Devil uses sticks and chains to beat the naughty children. Dark malts and aromatic hops create the diabolical spirit of this brew. It is finished with lager yeast and aged cold for no less than 30 days. This Imperial Helles Lager will warm even the darkest hearts. This season, replace the cookies with a bottle of Krampus. If he happens to pay a visit, toast to him with this devilish brew. Merry Kramp-mas to all, and to all a good pint! 9.0% abv. â€¢ 20Âº plato â€¢ Imperial Helles Lager â€¢ 22 oz / 1/6 keg', 'http://www.southerntierbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5059, 960, 3, 31, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', 'A classic American IPA with lots of floral punch and assertive hop presence. Hopped with Nugget, Palisade and Amarillo colored to a reddish hue thanks to Munich and Aromatic malts', 'http://www.ottospubandbrewery.com/index.php', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5060, 1337, 7, 84, 'Domring 4-10', 'Warstein', 'Nordrhein-Westfalen', 'Germany', '', '', 5.90, 0.00, 0.00, 0, '9999-01-01', '51.4416, 8.3519', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5061, 1179, 8, 95, '603 East Brewery Street', 'Shiner', 'Texas', 'United States', '', 'http://www.shiner.com', 4.90, 0.00, 0.00, 0, '9999-01-01', '29.426, -97.1607', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5062, 960, 3, 43, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', '', 'http://www.ottospubandbrewery.com/index.php', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5063, 1286, 1, 21, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #15-2008 is our first collaborative beer in the Scratch series. We teamed up with St. Thomas Roasters of Linglestown to create a Double Espresso Oatmeal Stout. The double in the name refers to the espresso (not the alcohol). Scratch #15â€™s espresso blend is a medium city-type roast featuring beans from three continents. St. Thomas Roasters roasted and ground the beans; we used them in our hopback. At the end of the boil the hot wort passed through the espresso beans to give a lush coffee espresso nose and hints of coffee flavor. Chocolate, roasted and caramel malt flavors stand out, while the addition of oats gives Scratch #15 a full, round mouth feel. Galena and Ken Goldings hops are added to balance the overall flavor and not drive up the bitterness. The head retention diminishes quickly because of the oils from the espresso beans.', 'http://www.troegs.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5064, 1009, -1, -1, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', '', 'http://www.portbrewing.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5065, 1142, 3, 31, '1075 East 20th Street', 'Chico', 'California', 'United States', 'We wanted to see if we could grow hops at our brewery in Chico, California so we planted our own hop field selecting our prized Cascade and Centennial varieties along with some specialty hop varieties to experiment with. To our surprise, we not only could grow hops, we were also able to harvest them in late summer due to Chicoâ€™s ideal climate. Chico Estate Harvest Ale is one of the very few estate harvest ales produced anywhere in the world today. All the hops in the beer are grown naturally on the premises of our brewery in Chico. We pick the hops ourselves and then take them directly to the brew kettle, without being dried, just after picking so they retain nearly all of their natural oils and resins. It is made with Cascade, Centennial and Chinook hops. Until now, this beer has only been available in draft. Starting this year, we will be bottling it on a very limited basis, with plans to expand its availability as we expand our Chico hop field in the coming years.', 'http://www.sierranevada.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5066, 1142, 3, 26, '1075 East 20th Street', 'Chico', 'California', 'United States', 'Our newest addition to our Harvest family is Southern Hemisphere Harvest. This is the first time we know of that an American brewer has put out a beer with fresh-picked hops from the southern hemisphere. The inaugural ale will debut in late April and will feature fresh Pacific Hallertau, New Zealand Motueka and New Zealand Southern Cross hops, all from New Zealand. Like our Celebration Ale, the fresh hops in this beer are dried right after being picked then shipped immediately to Chico for brewing so that they retain their peak aromatics and flavors. To ensure the freshest hops possible, we went to the added expense of flying these hops from New Zealand to Chico so we could brew with them the week after they were picked.', 'http://www.sierranevada.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5067, 1093, 5, 72, '1441 Savannah Ave Unit E', 'Tarpon Springs', 'Florida', 'United States', 'Amber ale with Palmetto berries and hibiscus.', 'http://www.saintsomewherebrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '28.1646, -82.7717', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5068, 1352, 5, 64, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'Alpha, the first entry in our one-off, brewer''s choice series is a Belgian-style Pale Ale at 6.2% ABV. Brewed with Pale, Carahell and Wheat malts, Amarillo and Cascade hops. This medium bodied beer is crisp on the palate with a smooth, not overly bitter hops flavor coupled with the fruity esters from the Belgian Abby yeast strain we used. Its bottle and keg conditioned, so expect a tall, fluffy head, and perhaps small amount of sediment. Just one batch was brewed in April 2008, kegs released in late May, and only 20 cases of bottles for sale only at the brewery at the special debut night event of June 13, 2008, from 5 to 8 pm. Recipe by Jeff Musselman, assistant brewer.', 'http://www.weyerbacher.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5069, 1352, 11, 116, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'As for Bravo, according to Head Brewer, Chris Wilson, the base of the beer comes from pale, wheat, and crystal malts and features some roasted barley while Pilgrim and Hallertauer make up the light hop profile.', 'http://www.weyerbacher.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5070, 1128, 11, 113, '121 North Market St.', 'Selinsgrove', 'Pennsylvania', 'United States', '', 'http://www.selinsgrovebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.801, -76.8614', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5071, 1128, 3, 31, '121 North Market St.', 'Selinsgrove', 'Pennsylvania', 'United States', '', 'http://www.selinsgrovebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.801, -76.8614', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5072, 1128, 1, 21, '121 North Market St.', 'Selinsgrove', 'Pennsylvania', 'United States', '', 'http://www.selinsgrovebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.801, -76.8614', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5073, 97, 3, 33, '100 Searsport Avenue', 'Belfast', 'Maine', 'United States', '', 'http://www.belfastbaybrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4295, -68.975', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5074, 97, 1, 21, '100 Searsport Avenue', 'Belfast', 'Maine', 'United States', '', 'http://www.belfastbaybrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4295, -68.975', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5075, 1125, 11, 121, '26 Front Street', 'Bangor', 'Maine', 'United States', 'Sea Dog Apricot Wheat Beer is a crisp and quenching wheat ale with a subtle essence of fresh apricots.', 'http://www.seadogbrewing.com/', 3.50, 0.00, 0.00, 0, '9999-01-01', '44.7974, -68.77', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5078, 490, 3, 33, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'This beautifully colored ale strikes an agreeable balance between malt and hops. Caramel + toffee notes from the use of more highly kilned malts step up to complement this beers assertive hop profile.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5079, 490, 3, 26, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'Much like the local icon it is named for, our version of American Pale Ale has a bold character. We add a healthy dose of hops in both the kettle and the finishing tank.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5080, 490, 11, 116, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'This light colored ale gains its subtle, bread-like flavor from a balance of gently kilned malted barley and choice malted wheat. A restrained addition of hops, contributes a pleasingly delicate floral aroma.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5081, 490, 3, 38, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'Proof that all dark beers, like trout, are not created equal. Chocolate and caramel malt flavors are at the heart of this very accessible and drinkable brown ale.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5082, 490, 2, 25, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'Named for our beloved State Park this Robust Porter draws its uniquely enticing roasted character from a thoughtful combination of malts. Generous hop additions ensure a satisfying beer drinking experience.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5083, 490, 1, 2, '100 West Main Street PO Box 432', 'Millheim', 'Pennsylvania', 'United States', 'Named for the spectacular and complete double rainbow that appeared in the northwest sky just outside the brewhouse during the inaugural mash in. With a foot in both the new and old worlds, this IPA is generously dry-hopped with English Fuggles, resulting in a strong, deep golden, very fresh, and fruity English flavor and aroma.', 'http://www.elkcreekcafe.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8911, -77.477', '2018-10-05');
