INSERT INTO beerbuddies_db.beer VALUES (5097, 1061, 1, 15, '312 Center Rd', 'Monroeville', 'Pennsylvania', 'United States', 'Medium in body, brown in color, this ale is delightfully malty with complex caramel overtones lending to the smoothest finish you will ever experience! Donâ€™t be afraid of the dark and try this deceptive delight!!!', 'http://www.myrivertowne.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.4465, -79.7642', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5098, 1061, 3, 38, '312 Center Rd', 'Monroeville', 'Pennsylvania', 'United States', 'Brewed in honor of Andrewâ€™s Grandfather LeRoy, this big bad nut brown ale has a fantastic malt character made up of caramel and chocolate flavors. One taste and you will see why this is the baddest beer in the whole damn town!!!', 'http://www.myrivertowne.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.4465, -79.7642', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5099, 1061, 3, 26, '312 Center Rd', 'Monroeville', 'Pennsylvania', 'United States', 'If you liked the Nobleman this one should blow you away! We took malt and hops from around the world to create this International Pale ale! This beer has an incredible amount of hop flavor and the perfect hop bite!', 'http://www.myrivertowne.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '40.4465, -79.7642', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5100, 1061, 3, 31, '312 Center Rd', 'Monroeville', 'Pennsylvania', 'United States', 'In honor of our friend and mascot, Wylie the fish, we are hooking you up with an aggressively hopped India Pale, the staple for any fishing trip! This beer is a hop loverâ€™s dream!', 'http://www.myrivertowne.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.4465, -79.7642', '2018-10-05');
