INSERT INTO beerbuddies_db.beer VALUES (5102, 45, -1, -1, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'This smoked bock is made with the finest smoked malt from Bamberg, Germany. The malts are kilned over aged beechwood chips which gives this deep copper ale a mellow smoky flavor.', 'http://www.abcbrew.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
