INSERT INTO beerbuddies_db.beer VALUES (5580, 633, 1, 5, '1938 Pacific Avenue', 'Tacoma', 'Washington', 'United States', 'This E.S.B. is definately the house favorite. Exclusively hopped with Fuggles, this full bodied amber ale finishes smooth and clean. 5.6% ABV', 'http://harmon.harmonbrewingco.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '47.2436, -122.437', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5107, 82, 7, 77, '1605 S 93rd Building E Unit L', 'Seattle', 'Washington', 'United States', 'Our pilsner is a traditional Northern German Style Pilsner. It has a fantastic malty aroma with a slight spice from the hops. The head is brilliant white and floats on the clean pale lager. The sparkling mouthfeel gives way to a soft malt sweetness that is followed by a long, dry, crisp finish. The balanced clean finish taunts the mouth to take another drink. Lagered for a minimum of 8-12 weeks to ensure smoothness and drinkability. All ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.', 'http://www.baronbeer.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '47.5203, -122.312', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5108, 82, 7, 86, '1605 S 93rd Building E Unit L', 'Seattle', 'Washington', 'United States', 'The Baron Schwarzbier is a classic German black lager, deep black with ruby and brown highlights. At first the Schwarzbier starts with a slight roasty nose and taste, followed by a faint chocolate-malty body with a very crisp, clean, lagered finish. Lagered for an average of 10-12 weeks to provide a very smooth, easy drinking Schwarzbier with full flavor provided by the dark malts. All ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.', 'http://www.baronbeer.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '47.5203, -122.312', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5109, 82, 7, 84, '1605 S 93rd Building E Unit L', 'Seattle', 'Washington', 'United States', 'The Baron Oktoberfest is a traditional German Style Oktoberfest / Marzen. Deep copper/amber in color with a rich but light malt flavor. Finishes crisp and easy, leaving the mouth desiring more. We age the Oktoberfest for a full three months to guarantee a fantastically smooth beer. All ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.', 'http://www.baronbeer.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '47.5203, -122.312', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5110, 82, 7, 91, '1605 S 93rd Building E Unit L', 'Seattle', 'Washington', 'United States', 'The Helles-Bock is similar to a traditional Maibock. Bocks are traditionally brewed in the winter / early spring months and are served during the spring / early summer months. The Helles Bock has a copper golden color with a brilliant white head. The body showcases a clean sweet maltiness that is offset by just enough hops to balance it. Very smooth and easy, drinkable yet deceptive at 6.4%. All ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.', 'http://www.baronbeer.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '47.5203, -122.312', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5111, 1191, 7, 84, 'HofbrÃ¤uallee 1', 'MÃ¼nchen', 'Bayern', 'Germany', 'HofbrÃ¤u brews a rich, full-bodied beer which goes down ideally with traditional Bavarian cuisine. With its deliciously bitter taste and alcoholic content of 6.3% volume, HofbrÃ¤u Oktoberfestbier is as special as the Beer Festival itself. Type: Bottom-fermented, light festive beer', '', 6.30, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5112, 919, 3, 33, '455 North Main Street', 'Fort Bragg', 'California', 'United States', 'Malt and hops are beautifully married in this full-bodied, copper-red Pale Ale. Red Seal is generously hopped for a long, spicy finish.', 'http://www.northcoastbrewing.com/home.htm', 5.50, 0.00, 0.00, 0, '9999-01-01', '39.4466, -123.806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5113, 858, 5, 62, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Venusâ€”goddess of love and beautyâ€”exudes grace and voluptuousness. Indulgent with lush dark malts and sensuous star anise, VENUS is decadent and divine in body and spirit. Leisure lounging in French oak Cabernet Sauvignon wine casks results in a lovely liquid feast of fabulously luxurious flavors.', 'http://www.midnightsunbrewing.com/', 16.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5114, 858, 11, 123, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Intriguing doses of sweet spices, dark cocoa and pumpkin transform an exceptional porter into a mesmerizing potion. Pour this tantalizing brew into a snifter and seek solace in the depths of its fascinating flavors. Cinnamon, nutmeg and cloves seem familiar but this brew is cloaked in deep, dark secrets that will forever haunt you. This beer is like nothing you have ever experienced. It is a majestic mÃ©lange of rich, impressive flavors that meld wonderfully with the warmth of alcohol. Will it appease or awaken your spirit?', 'http://www.midnightsunbrewing.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5115, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses. Obliteration IV is a tremendous Double Wheat beer. Its aroma is pungent with fragrant notes of citrus, spice, pine and alcohol. An even malt-to-wheat ratio provides a sturdy yet satisfying base for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. An American wheat beer yeast allows Obliteration IV to finish with unadulterated hop bitterness.', 'http://www.midnightsunbrewing.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5116, 157, 5, 67, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'We brewed this traditional witbier with orange peel and coriander, and then added a hint of blackberry. The flavor is very complex with malt and cereal notes, intense spice and citrus flavors and a smooth, sweet/tart finish. It will be available in January in its own 6-pack and in the Samuel AdamsÂ® Brewmaster''s Collection Variety 6 & 12-packs.', 'http://www.samueladams.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5117, 1136, 11, 123, '86 Newbury Street', 'Portland', 'Maine', 'United States', '', 'http://www.shipyard.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.6619, -70.2489', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5118, 1221, 3, 43, '4811 Dusharme Drive', 'Brooklyn Center', 'Minnesota', 'United States', 'This Russian Imperial Stout is a sipper. Problem is that you want to sip it all night. Look for this one to be released when the leaves change color and Halloween is approaching. Brewed with a blend of 8 different malts, oats and candi sugar. This huge stout reflects Surly''s commitment to brewing intensely flavored beers in small batches. Only 25 barrels of this beer were brewed.', 'http://www.surlybrewing.com/', 10.30, 0.00, 0.00, 0, '9999-01-01', '45.0429, -93.3246', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5119, 1136, 2, 25, '86 Newbury Street', 'Portland', 'Maine', 'United States', 'Imperial Porter is a full bodied, very dark, malty beer with a good roasted character coming from the Crystal, Chocolate and Black Patent Malts used in the mash. Warrior, English Fuggles, and East Kent Goldings Hops balance the malts with a good hop bite. The beer has an OG of 1.070, rounding out after fermentation with just a slight residual sweetness and cutting dry at the finish.', 'http://www.shipyard.com/', 7.10, 0.00, 0.00, 0, '9999-01-01', '43.6619, -70.2489', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5136, 954, 11, 121, '1301 Atlanta Avenue', 'Orlando', 'Florida', 'United States', 'When you make a pot of coffee, but only use half the water, you get some pretty rich coffee. That''s the approach we took with our latest offering. OBP Squared, with half the water, has 11% alcohol by volume-twice that of original OBP. The result is a bold, distinct taste of its own. Made with twice as much real orange blossom honey, all-natural ingredients and no refined sugar, it really is the new king bee of beers.', 'http://www.orlandobrewing.com', 11.00, 0.00, 0.00, 0, '9999-01-01', '28.5265, -81.3827', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5120, 1136, 3, 35, '86 Newbury Street', 'Portland', 'Maine', 'United States', 'Barley Wine Style Ale is a big beer made with six different malts (Pale Ale, Crystal, Caramunich, Wheat, Chocolate and Roasted Barley) and balanced with a very full hop charge of Summit, Challenger and Fuggles hops. It is a deep reddish brown color with a complex fruity nose, a very full body, and an interesting balance between grains and hops which ends with a pleasing dry taste. To fully enjoy all the flavours, this ale is best drunk at 55 degrees Fahrenheit.', 'http://www.shipyard.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '43.6619, -70.2489', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5121, 1054, 1, 10, '2323 N Milwaukee Ave', 'Chicago', 'Illinois', 'United States', 'Drinkable brown session beer with a nutty, toffee flavor. Served lightly carbonated from a traditional Brittish handpump.', 'http://revbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9234, -87.6982', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5122, 1379, 7, 86, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'This German-style black lager has a deep color and gently roasted flavors balanced by an understated hoppiness. A thirst-quenching version of dark beer. A 2008 Great American Beer Festival Gold Medal Winner in the German Schwarzbier category.', 'http://www.wynkoop.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5123, 1379, 11, 116, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'Anunfiltered wheat beer, weiss beer is a bavarian tradition. Our version is immensely refreshing and authentic, delivering the classic weiss aromas of clove and banana. A two-time Great American Beer Festival Medal winner in the German Style Wheat Ale category.', 'http://www.wynkoop.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5124, 1379, 11, 121, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'A light German-style beer made with Anaheim chiles and smoked Ancho peppers. A 2006 Great American Beer Festival Bronze Medal Winner in the Fruit and Vegetable Beer category anda Wynkoop specialty.', 'http://www.wynkoop.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5125, 1379, 7, 77, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'A Czech style Pilsner, Two Guns is golden in color with a soft malt character derived from Bohemian barley and just enough spicy bitterness to make another tasted desirable.', 'http://www.wynkoop.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5126, 1379, 3, 37, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'This blonde beer has a very light body and mild flavors of hops and pale malts. A hint of caramel malt gives color to this popular choice for craft beer newcomers', 'http://www.wynkoop.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5127, 1379, 3, 42, '1634 18th Street', 'Denver', 'Colorado', 'United States', 'A dark, deeply roasted and full-bodied ale. Rich with kisses of chocolate, coffee and oats, it''s a glorious version of an American-style stout. A longtime house favorite.', 'http://www.wynkoop.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5128, 1379, 7, 91, '1634 18th Street', 'Denver', 'Colorado', 'United States', '', 'http://www.wynkoop.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7535, -104.998', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5129, 531, 3, 26, '2035 Benson Avenue', 'St. Paul', 'Minnesota', 'United States', '', 'http://flatearthbrewing.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '44.9084, -93.1538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5130, 531, 5, 64, '2035 Benson Avenue', 'St. Paul', 'Minnesota', 'United States', '', 'http://flatearthbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '44.9084, -93.1538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5131, 44, 3, 29, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Dunkel Weisse fills a glass like few beers can. The pour releases banana and clove aromas. Roasted malt flavor is complemented by caramel and chocolate undertones. Then a crisp finish refreshes the palate. Undeniable proof that brewing is truly an art.', 'http://www.anheuser-busch.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5132, 68, -1, -1, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'So where can you taste a Kolsch? There are no Kolsches being imported into the United States. So you could fly to Cologne. A better idea is to come to Ballast Point Brewing Company and try our Yellowtail Pale Ale Kolsch. We make it with 5% Wheat, finish hop it with Liberty and Tettnanger hops, and ferment it with a yeast we borrowed from a brewery in Cologne. So come on in and enjoy a taste of the Rhineland!!', 'http://www.ballastpoint.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5133, 68, 3, 33, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'The Calico Amber Ale was inspired by the beers of England. In England most of the beer is some kind of "bitter". Bitter is a style that became popular in the late 1800''s. The most famous examples are brewed in Burton on Trent. This hard water gives these beer a pleasantly dry bitter finish, hence the name "bitter." A brewery usually brews several bitters of various alcohol strengths. The lowest in alcohol (and usually flavor) is called "bitter" or "ordinary bitter." A step up in alcohol and hop character gives us "best bitter" or "special bitter." Finally a beer is made that is full of hop aroma and flavor, has a maltiness to match, and a generous amount of alcohol is called an "extra special bitter" or E.S.B. Although inspired by the British Ales Ballast Point Calico Amber Ale uses distinctive American hops, which give not only the crisp bitterness to balance the malt, but also a hint of floral aroma. We brew Calico Amber Ale with 100% malt and use 4 different malts to give it a rich complexity. The blend of crystal malts give it flavors including toffee and caramel. A blend of American Cascade and Centennial hops provide a counterpoint to the malt. Finally our proprietary yeast provides a fruity background and a Madeira like richness that rounds out this gold medal winning ale.', 'http://www.ballastpoint.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5134, 68, 2, 25, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'Ballast Point Black Marlin Porter is a rich dark chocolaty Porter with a distinctive American hop character. It is a great beer to go with hearty foods and is surprisingly one of the few beers that goes well with dessert. One of our favorite combinations here at Ballast Point is Black Marlin Porter with apple pie a la mode.', 'http://www.ballastpoint.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5135, 68, 5, 67, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'Ballast Point Wahoo Wheat Beer is created using the same ingredients that were once used in Belgium. Flaked unmalted wheat, oats and malted barley comprise the grain. The unmalted wheat has a high protein content, which causes the beer to be hazy, thus giving it a cloudy, or "white" appearance. A special yeast gives a refreshing tangy flavor that is different from both the sour Weiss beers of Berlin or the banana and clovey Weizens of Bavaria. The mild hopping allows the unique malts to show through and does not conflict with the subtleties of the citrus spicing. This unique citrus character is created by adding a blend of curacao (bitter orange), sweet orange and coriander to the boil. White beers are light and refreshing, yet provide a complex reminder that interesting high quality beer does not have to be bitter and dark. Ballast Point Wahoo Wheat Beer is the perfect beer for sunny San Diego.', 'http://www.ballastpoint.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5150, 1289, 8, 95, '', 'Qingdao', 'Shandong', 'China', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '36.0663, 120.383', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5137, 1326, -1, -1, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'The tenacious grip of big, juicy hop aroma and character slides smoothly into rich, dark malts. This heavyweight battle between fresh, Yakima Valley hops and dark, roasted malts is resolved harmoniously as the flavors merge to deliver complex satisfaction with a warming edge. Enjoy the â€˜twilightâ€™ for the bright and brassy hops!', 'http://www.victorybeer.com', 8.90, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5138, 1352, 11, 126, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'A pitch black stout made with ginger, cinnamon and a touch of molasses. This mediumâ€“bodied ale has flavors of dark chocolate, roasted coffee beans and ginger snap cookies.', 'http://www.weyerbacher.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5139, 1352, -1, -1, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', '', 'http://www.weyerbacher.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5140, 796, 7, 77, '40 Mews Road', 'Fremantle', 'WA', 'Australia', 'Czech Saaz hops are added early in the boil with a late hopping using a hybrid variety we keep to ourselves, giving light flavour and a soft bitterness. Lightly kilned pilsner malt gives the beer both itâ€™s light, slightly golden colour, and leaves a crisp clean taste on the palate.', 'http://www.littlecreatures.com.au/', 4.60, 0.00, 0.00, 0, '9999-01-01', '-32.0597, 115.745', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5141, 982, -1, -1, '', 'Pont Fer', 'Phoenix', 'Mauritius', 'A polished, golden yellow beer with 5% alcohol. Phoenix beer is pasteurised after bottling, according to natural conservation methods. The quality of the underground water also allows us to produce a beer with no chemicals additives. Time of maturation before distribution is meticulously controlled.', 'http://www.phoenixbeveragesgroup.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '-20.2738, 57.4971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5142, 1287, 8, 95, '35 Soi Prommit, Sukumvit 39', 'Bangkok', '', 'Thailand', 'Phuket Beer was created as a refreshing â€˜boutiqueâ€™ beer in view of the exotic island of Phuket with a much lower formula of bitterness than any other domestic rivals in Thailand. Phuket Beer is the first regional beer brewed in Thailand and is positioned to appeal to both the international markets as well as the local population. This is manifested through the label and packaging designs presented in both English and Thai languages. Phuket Beer is well positioned as a premium brand located somewhere between the local standard brands and the imported premium brands. The efforts were inspired from the feeling of being in a tropical paradise. Thai beer consumers have become more sophisticated over the years, by selecting and demanding premium and high-end beers. initial consumer target was Phuket Island''s significant tourist sector, a sector that is prone to taste and drink locally produced brands.However, strategic positioning and selected marketing of Phuket Beer has resulted in a ray of successful export markets with overwhelming response from the initial markets overseas. The philosophy is to provide a â€˜tropical lifestyleâ€™ drinking experience in a fresh clean light tasting lager beer with 5% alcohol by volume, which is in total contrast to the other Thai beers that are very bitter with higher alcohol content.', 'http://www.tropbevco.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '13.7234, 100.476', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5143, 881, 11, 126, 'Cnr Turumaha and Herbert St', 'Greymouth', '', 'New Zealand', 'Monteithâ€™s Summer Ale is a refreshingly different beer. The opportunity to rediscover some flavour highlights of beer styles enjoyed on summer days past, and bring them back to life. At the end of last century, in England, Europe and the Americas and in New Zealand, there was still an adherence to brew with barley, wholesome grains, hops and other traditional brewing spices. Monteithâ€™s Summer Ale is a bright gold beer with great body from four different malts. Spiced with a single hop variety and a touch of history - a little Rata honey. Subtle, but enough to make all the difference. The result is a truly refreshing herbal spiced beer brewed for the Summer Season â€” a splendid thirst quencher. Monteithâ€™s Summer Ale enjoyed ice-cold with a simple range of fruits, perhaps refreshing wedge of orange or lime. Alternatively, match with summer salads and stir-frys to complement the light flavours.', 'http://www.monteiths.com/nz/', 5.00, 0.00, 0.00, 0, '9999-01-01', '-42.4505, 171.207', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5144, 881, 2, 22, 'Cnr Turumaha and Herbert St', 'Greymouth', '', 'New Zealand', 'Monteithâ€™s Celtic Beer is considered an â€˜Irish-style aleâ€™ in the heritage of beers of a burnt-red colour traditionally brewed in the Emerald Isle. Monteithâ€™s Celtic Beer has a dry roasted malt flavour characteristic of this style of brewing. This malty characteristic and crisp dryness is derived from malts of the roasted chocolate malt style. The hop character is medium to allow the chocolate malts to show through. Monteithâ€™s brewers have been able to develop traditional ale fermentation characters while allowing the interesting roasted malt notes to come through in the aroma.', 'http://www.monteiths.com/nz/', 4.40, 0.00, 0.00, 0, '9999-01-01', '-42.4505, 171.207', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5145, 1113, 8, 95, '180 Old Hume Hwy', 'Picton', 'NSW', 'Australia', 'A traditional German-style lager, fermented at 7-9Â°C and lagered at 4Â°C for 4-6 weeks. The storage produces a soft, natural carbonation. Full-bodied with high bitterness and hop flavour and a dry finish. Hoppy aromatic nose. Available on draught or in 780 mL champagne-style bottles. Can be difficult to acquire.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '-34.1855, 150.607', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5146, 506, 3, 26, '186 James Fletcher Drive, Otahuhu', 'Auckland', '', 'New Zealand', 'Supreme Champion Beer - New Zealand International Beer Awards', 'http://epicbeer.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '-36.9489, 174.821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5147, 1182, 3, 26, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'The story of the Seven Gates comes from rural Pennsylvania, not far from the Spring House Brewery. According to the legend, a mental asylum for the criminally insane stood in the middle of a dense forest. Surrounding the asylum were seven concentric gates, preventing would-be escapees. One terrifying night, the asylum caught fire, test link causing the inmates to flee into the menacing forest. As the tale goes, the former asylum residents were trapped by the seven gates, and eventually succumbed to the perils of the forest. The locals swear that the tormented souls of the inmates will torture anyone brave enough to attempt passage through the Seven Gates of the forest. Spring House Brewing Co. honors the local legend by producing a terrifyingly delicious brew that is as familiar as a friendly forest, yet possesses a mysterious quality that will haunt you from the first taste. The enormous, hopped flavor and the meticulous craftsmanship that goes into each bottle will have you believing that the master brewer must be a direct descendent of the former asylum residents.', 'http://www.springhousebeer.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5148, 1182, 5, 74, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'We welcome the release of â€œTwo Front Teeth Holiday Aleâ€ a Belgian style Saison with subtle real cherry flavoring. What a good way to drown out in-laws by enjoying a pint or two of this recent release from Spring House Brewing Company. This is not for the faint palate; this holiday offering is coming in at 9.4% ABV! We hope you stop by for a taste or a Growler fill but unfortunately you have to stop in for this one. Enjoy!', 'http://www.springhousebeer.com/', 9.40, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5149, 999, 2, 25, 'Promzona Parnas-4, 6 Proyezd, 9 Kvartal', 'Sankt-Peterburg', 'Sankt-Peterburg', 'Russia', '', '', 7.00, 0.00, 0.00, 0, '9999-01-01', '59.939, 30.3158', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5151, 1087, 8, 95, '', 'Barcelona', '', 'Spain', 'Estrella means star in Spanish and as its name suggests the brand has become a star to the people of Barcelona. It has evolved with the city reflecting its character - sophisticated and passionate yet at the same time relaxed and welcoming.', 'http://www.estrelladamm.es/', 4.60, 0.00, 0.00, 0, '9999-01-01', '41.3879, 2.1699', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5152, 1181, 3, 38, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', 'Seven varieties of malted barley are combined to give this English-style ale its complex flavor and deep, brown color. A select British yeast culture adds a subtle fruitiness and a blend of choice hops gives this non-bitter ale a soft finish.', 'http://www.sprecherbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5153, 1181, 3, 42, '701 West Glendale Avenue', 'Glendale', 'Wisconsin', 'United States', 'This tribute to St. Patrick''s Day is smooth and creamy, with distinctive flavors and aromas reminiscent of bitter-sweet chocolate and dark coffee. Just one precious batch of this robust, ebony colored stout is brewed each year.', 'http://www.sprecherbrewery.com/', 5.73, 0.00, 0.00, 0, '9999-01-01', '43.1, -87.9198', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5154, 1286, 11, 141, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #16-2008 combines the bitterness of two aroma hops, the lush sweetness of honey and malt and an earthly yeast taste creating a Winter Warmer designed to ward off the coldest days. The dark, rich amber color comes from a combination of molasses and crystal malts; the Thames Valley brings a distinct earthly flavor; white the blend of hops creates fruity (Amarillo) and piney (Cluster) bitterness. The Winter Warmer ends with a slight warming sensation from the elevated alcohol content. Enjoy this one throughout the winter months. Cheers.', 'http://www.troegs.com/', 6.30, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5155, 1170, 4, 57, '40 Bowden Square', 'Southampton', 'New York', 'United States', 'Reddish brown coloring. Aroma is slightly sweet, much like flavoring. Very drinkable. Recommended.', 'http://southamptonbrewery.com', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.8903, -72.3927', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5156, 1160, 5, 60, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Smuttynose Winter Ale is a full-bodied, amber beer brewed with a special Trappist ale yeast. Stylistically reminiscent of a Belgian Abbey Double, it features fruity aromas and flavor, balanced by soft Crystal hops. Warming, mellow & pleasantly complex, Smuttynose Winter Ale is your perfect cold weather companion.', 'http://www.smuttynose.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5157, 1160, 3, 26, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Our interpretation of a classic English beer style is copper-colored, medium-bodied and highly hopped. Its flavor is delightfully complex: tangy fruit at the start, with an assertive hop crispness and a long malty palate that one well-known beer writer has compared to the flavor of freshly-baked bread.', 'http://www.smuttynose.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5158, 1160, 3, 38, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Old Brown Dog has been cited as a classic example of the â€œAmerican Brown Aleâ€ style of beer. Compared to a typical English Brown Ale, Old Brown Dog is fuller-bodied and more strongly hopped. Old Brown Dog has been around for many years. It was first brewed in 1988 at the Northampton Brewery. In 1989 it won a silver medal in its category (American Brown Ale) at the Great American Beer Festival in Denver.', 'http://www.smuttynose.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5159, 1160, -1, -1, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Named in honor of our hometownâ€™s 375th anniversary, Smuttynose Portsmouth Lager is a full-flavored, medium bodied continental-style beer - deep golden in color, featuring a mouth-pleasing maltiness subtly balanced with spicy imported Saaz hops. One taste of this fine lager tells you this is no ordinary beer: From its mellow, velvety body to its lingering, fresh hop finish, Portsmouth Lager is smooth, complex and satisfying.', 'http://www.smuttynose.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5160, 1160, 3, 31, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Portsmouth is a colonial era seaport town, so it goes to follow that sooner or later we''d brew an India Pale Ale as a tribute to those big, hoppy 19th century ales that made the long sea voyage from England''s temperate shores, ''round the Cape of Good Hope, to the sultry climes of the faraway East Indies. But there''s another reason we brewed this beer, one that''s closer to our home and hearts. Hopheads. Ten years ago we brewed our first batch of Shoals Pale Ale, our American interpretation of the traditional British ESB (Extra Special Bitter) style. At the time, it was widely considered to be darned hoppy. However, a funny thing happened over the last decade - our Shoals Pale Ale didn''t change; beer lovers did, and we started to hear more and more: â€œWhy don''t you guys make a really hoppy beer?â€ You could say, then, that Smuttynose IPA is a physical salute to the glory of the American hop grower. The citrusy hop flavor coming from a mixture of Simcoe and Santiams is pleasantly balanced by a smooth bitterness from the Amarillo hops. The beer itself is light bodied and crisp with a golden color that will throw a slight haze, as we bottle it unfiltered. At 65 IBU''s, this is definitely not a training-wheels IPA, but is meant for hop lovers looking to satisfy their craving in a way that''s not easy to find. We think theyâ€™ll be quite pleased.', 'http://www.smuttynose.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5161, 1160, 2, 25, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'This hearty, mahogany colored ale is brewed to evoke the dark, full-bodied ales that were a favorite of dockworkers and warehousemen (hence the name â€œPorterâ€) in 19th century London. It is a good bet that when Dickensâ€™ Mr. Pickwick sat down for a pint, we would have been drinking an ale much like our Robust Porter.This is a smooth and very drinkable beer, characterized by its well-balanced malt and hops, plus subtle notes of coffee and chocolate.', 'http://www.smuttynose.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5162, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Uranus, ruler of the heavens, reigns supreme with beauty and brilliance. Gloriously gold in color, URANUS Golden Ale holds title to our first 100% Brettanomyces fermentation and conditioning. Brewed by mere mortals and blessed by the beer gods, this ale deserves to be worshipped.', 'http://www.midnightsunbrewing.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5163, 858, 5, 61, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', '', 'http://www.midnightsunbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5164, 658, 1, 3, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'A style of Pale Ale, Black Mountain Bitter will be lightly hopped with traditional British hop varieties to balance the malt sweetness yet encourage it to tend toward the dry side. We recently received our organic certification from Clemson University after undergoing a rigid inspection and two-month compliance process. Although this represents a big step for Highland, the idea of an all organic product is consistent with our corporate ethos and embrace of natural traditional brewing methods.', 'http://www.highlandbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5165, 62, 3, 32, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', '"Ale to the Chief! We the Brewers of Avery Brewing Company, in order to form a more perfect ale, require new leadership that can liberate us from our quagmires in foreign lands; embrace environmentally sound energy alternatives to imported oil; heal our ailing healthcare system; free us from tyrannical debt and resurrect the collapsing dollar. We hereby pledge to provide him with an ample amount of our Presidential Pale Ale to support in the struggle for the aforementioned goals! Hail to the New Chief!', 'http://www.averybrewing.com/', 8.75, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5166, 1081, 4, 50, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', 'This German inspired wheat ale is packed full of citrus flavor. We use torrified wheat, pale, and carafoam for balance, giving it a nice hazy, straw color and refreshing wheat taste. We ferment the White Horse at higher ale temps with a German style yeast that is known for producing world class wheat beers. We let the yeast take over the majority of the flavoring in our fermenters, providing the beer with banana and clove like esters. We pull some of the yeast with it to give this brew the proper style and to keep its body and character. We than age this brew with zests of citrus and a brewers spice that blends harmoniously with the esters of the yeast and balance out the sweetness of this brew. Truly a favorite in the summer time for breakfast, lunch, or dinner.', 'http://roypitz.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5167, 1081, 0, 0, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', '', 'http://roypitz.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5168, 1081, -1, -1, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', 'This brew was inspired by the historical burning of our hometown of Chambersburg, PA in July 1864. During the burning, the brewery in town, "Ludwigs Brewery" operated by George Ludwig was burned to the ground by Confederate soldiers under Gen. McCausland. In remembrance of this event we created a German style rauchbier, or dark smoked lager. This beer uses all its ingredients from Bamberg, Germany, which is where the style was born and in by coincidence, the same area where Ludwig himself was born and taught to brew. It is made with a special birch wood smoked malt that imparts a light smoky aroma, taste, and dryness to the palate. The pilsner malt and noble German hops are used to balance this dryness making it very enjoyable as well as different. We believe this beer resembles how Ludwig himself might have brewed it over 100 years ago.', 'http://roypitz.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5169, 1081, 3, 33, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', 'Our signature brew that started it all. This beer is made with four different specialty malts including two foreign caramel malts, a pale malt, and a toasted malt. These malts impart a subtle toasted/sweet taste. This malty brew is than graced with floral and aroma hops which balance the maltiness of this brew and leaves behind a smooth finish on the palate. Top notch ingredients and a truly "Honest" taste makes this a seriously drinkable ale, unlike many other bitter American ales.', 'http://roypitz.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5170, 1081, 11, 123, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', 'This Belgian style pumpkin ale was inspired by the legendary midnight ride of Ichabod Crane. It is a Belgian style ale complimented by a light touch of pumpkin and spice. Fresh toasted pumpkins are added in the mash with the grains adding a touch of the season to the brew. The complex fruitiness and dryness of the yeast is enhanced by the addition of sugars during fermantation. The beer is lightly spiced with pumpkin spice, all spice, and brown sugar. The pale and toasted malts used, provide a pie crust taste and smell in the beer as the higher alcohol''s produced round out the finish.', 'http://roypitz.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5171, 1081, 3, 32, '140 North Third Street', 'Chambersburg', 'Pennsylvania', 'United States', 'The one and only IPA that doesn''t leave your pallet with a bitter after taste. This beer took years of practice to get down and when we finally got it right, we knew it. The beer is made with three malts in considerable additions that leave it with a more malty and sweet taste. There are five different hop additions that were carefully planed out to impart just enough bitterness to give it the body and depth that it needed without leaving you with the astringent and bitter aftertaste. We then added a plethora of English flavor and aroma hops that round out the floral and citrus esters. With the beer being so well balanced between bitter and sweet, we than added "big sacks" of bittering hops to the conditioning vessel to impart all the wonderful citrus and floral notes deep into the beer while leaving the bittering aspects of the hop behind. The result was a beer that makes you want to nose dive right in complimented by the well balanced taste of this wonderful brew.', 'http://roypitz.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '39.939, -77.6566', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5172, 94, 7, 84, '345 Healdsburg Avenue', 'Healdsburg', 'California', 'United States', 'This malty, copper-colored lager is styled after Munich''s traditional "Oktoberfest" beers. A full-bodied, rich malt character is balanced by a slight bitter finish. Perfect for cooler fall days, it is lagered for five weeks. Prost!!', 'http://www.bearrepublic.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '38.6112, -122.871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5173, 39, 3, 26, '1705 Mariposa Street', 'San Francisco', 'California', 'United States', 'San Francisco''s famouse Liberty Ale was first brewed on the 18th of April, 1975 to celebrate the 200th anniversary of Paul Revere''s historic ride. It is virtually handmade by the brewers of Anchor Steam Beer in one of the smallest and most traditional breweries in the world. Liberty Ale is made with the finest barley malt, fresh, whole hops, top fermenting yeast, pure water and the simple natural methods which reflect our exceptional respect for the ancient art of brewing. It is "dry hopped," a classic ale tradition, and slowly completes its fermentation in sealed vats in our cellars. This unique process creates Liberty Ale''s distinctive bouquet and uncommonly delicate, entirely natural carbonation.', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '37.7635, -122.401', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5174, 1348, 11, 141, '', '', '', 'United Kingdom', 'The definitive winter beer and a longtime favourite, Winter Warmer has been making annual appearances on the bar every winter since the 1950s. A rich, ruby-coloured beer, luscious and fullbodied, with a splendid nutty flavour.', 'http://www.bombardier.co.uk/bombardier', 5.20, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
