INSERT INTO beerbuddies_db.beer VALUES (5179, 1173, -1, -1, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'The hexagram talisman has been used around the world for centuries to invoke magic and good luck. The sixâ€“point star is also the customary symbol of the brewer, representing the essential aspects of purity: water, hops, grain, malt, yeast, and of course, the brewer. Wishes of good fortune often collaborate with the brewerâ€™s creativity to yield dramatic results. We carefully chose the name for this Imperial India Black Ale, Iniquity â€“ a word opposing goodness. Why? This beer is contrary to what one may expect from an IPA; this is an ale as black as night. It is the antithesis of Unearthly. Some may consider it an immoral act to blacken an ale. We suggest they donâ€™t rely on conventional standards. Allow the darkness to consume you. Cheers!', 'http://www.southerntierbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5180, 765, 3, 32, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '', 'http://www.lagunitas.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5181, 858, -1, -1, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'To commemorate the 30th anniversary of Specialty Imports'' specialty wine and beer import business, Midnight Sun Brewing Company brewed a very special beer--a black double IPA--to honor this Alaska company''s long-term success. This black double IPA celebrates Specialty Imports'' success in importing and distributing the world''s best wines and beers to the appreciative folks in Alaska. This "Specialty Beer" brings together smooth, dark malts with intense aromatic hops to create a wonderfully balanced yet committed-to-flavor ale. Availability: AK - 22-oz bottles (limited release begins 01/16/2009) ** An oak-aged version will be released in Fall 2009.', 'http://www.midnightsunbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5182, 459, 11, 119, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'A neo-traditional Rye Bok brewed to commerate the 375th Anniversary of the First Town in the First State.', 'http://www.dogfish.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5183, 892, 3, 32, '15 Rowland Way', 'Novato', 'California', 'United States', 'In celebration of the hop,,,,, This is a "Hop" tribute, worthy of a Kings Imperial Court! Enjoy the blast of fresh Tomahawk, Chinook and Anthanum Hops as they stimulate the taste buds in a truly Imperial Fashion. Pucker up!', 'http://www.moylans.com/', 9.20, 0.00, 0.00, 0, '9999-01-01', '38.0941, -122.557', '2018-10-05');
