INSERT INTO beerbuddies_db.beer VALUES (5192, 520, 5, 61, '11197 Brockway Road', 'Truckee', 'California', 'United States', 'There are hundreds of Trappist Monasteries in the world, many of them make fruitcake. This beer is not made by Monks nor does it resemble fruitcake. Furthermore, Truckee has no Trappist Monastery and that, my friend, is why we at FiftyFifty bring you Trifecta. This is one of FiftyFifty''s seasonal ales, and is a high alcohol Belgian style beer. Brewed with inspiration from Belgian Trappist Ales, Trifecta also includes locally grown Purple Sage Honey. With a complex spiciness tempered by the sweeter notes from the sage honey, flavors of spicy sage, alcohol, and mild malt sweetness are apparent, and sage and clove like aromas predominate. Coming in at over 8%, this beer is deceptively strong.', 'http://www.fiftyfiftybrewing.com/', 8.10, 0.00, 0.00, 0, '9999-01-01', '39.322, -120.163', '2018-10-05');
