INSERT INTO beerbuddies_db.beer VALUES (5201, 384, 3, 31, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'This American-style, hop-driven beer starts with a citrus flavor, followed by two layers of caramel, and finishes on a hoppy note.', 'http://www.climaxbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5202, 384, 1, 5, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Our E.S.B. is a balanced beer with notes of honey, toffee and caramel, backed by a warm spicy hop bitterness.', 'http://www.climaxbrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5203, 384, 3, 38, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'This style of beer is based on the English Mild, which was a combination of a stout and a lighter beer favored by coal miners in Scotland, Ireland and North England. We''ve brought together the grains used to make both a Stout and a Pale Ale and balanced them in our Nut Brown Ale to produce a beer with a chocolate and molasses flavor and hints of caramel and coffee in the background.', 'http://www.climaxbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5204, 384, 11, 113, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Our Cream Ale is a light, crisp, yellow ale with hop-notes and citrus flavors. It''s a smooth, easy drinking summer beer that''s perfect for drinking on hot days and with light fare such as seafood and salads.', 'http://www.climaxbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5205, 384, 3, 35, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Brewed for our 10th Anniversary, the Barleywine is a bottle conditioned ale that''s meant to be laid down and enjoyed for years to come. Up front it has a hop nose and hop flavor on the tongue that fades into malty overtones with flavors of vanilla that go into chocolate. As it has aged, we''ve noticed flavors of dates and raisins as well.', 'http://www.climaxbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5206, 384, 7, 91, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'The Hoffmann Helles (pronounced Hell-es), which is German for "bright" is a pleasant and easy to drink summer beer with a bready/grainy taste.', 'http://www.climaxbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5207, 384, 7, 84, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Oktoberfest is typically available from August to November and has toasty caramel and malty flavor. It is made from German Noble Hops and massive amounts of MÃ¼nich Malt, which give it an orange color.', 'http://www.climaxbrewing.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5208, 384, 7, 92, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Traditionally brewed by Monks to sustain them while they fasted during lent; the Doppel Bock is a big-bodied and flavorful beer.', 'http://www.climaxbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5209, 384, 11, 116, '112 Valley Road', 'Roselle Park', 'New Jersey', 'United States', 'Hoffmann Hefeweizen is our newest offering and is a traditional German wheat beer made from 60% wheat malt and 40% barley malt. Wheat Ales such as this typically have banana and clove flavors but as Dave dislikes clove, he used a special yeast to strengthen the banana flavors. Hefeweizen is a nice, light, crisp summer beer that can be served with lemon or flavored syrups.', 'http://www.climaxbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.6598, -74.283', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5210, 956, 7, 77, '303 Main Street', 'Lyons', 'Colorado', 'United States', 'Mamaâ€™s Little Yella Pils - Our upcoming new canned good is a small-batch version of the beer that made Pilsen, Czechoslovakia famous. Mamaâ€™s is made with hearty amounts of pale malt, German specialty malts, and a blend of traditional (Saaz) and 21st century Bavarian hops. Our first canned lager, itâ€™s also fermented at cool temperatures with a German yeast. This tasteful reality Czech is the perfect antidote for the watered-down versions of pilsner clogging Americaâ€™s shelves. And Mamaâ€™s gentle hopping (about 35 IBUs) and low ABV (just 5.3%) mean weâ€™re finally honoring consumer requests for a delicious but less-challenging beer. (Hey, we like a good low-dose session beer, too.) Look for our Gold Metal Winner on US shelves in March. Sadly, the Feds rejected our â€œTake Two and Call Us in the Morningâ€ line on the can.', 'http://www.oskarblues.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '40.2246, -105.268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5211, 960, 7, 86, '2105 N. Atherton St.', 'State College', 'Pennsylvania', 'United States', '', 'http://www.ottospubandbrewery.com/index.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8098, -77.9101', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5212, 1182, -1, -1, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'Kerplunk! Imperial Chocolate Stout is named for the delicious sound made as large amounts of Wilbur chocolate and west coast hops are added directly into the simmering brew kettle. This hefty black imperial-style stout boasts a rich caramel sweetness lavished by a robust, deep-roasted heartiness you can sink your two front teeth into. The bold flavors found in Kerplunk! are produced using a generous blend of roasted barley, crystal malts and locally produced chocolate. The resulting brew exhibits a deliciously complex and unique profile of subtle mocha coffee and intense chocolate, balanced nicely by the underlying roasted hop bitterness. This is a balanced strong brew boasting an A.B.V. of 8.1% that can creep up on you.', 'http://www.springhousebeer.com/', 8.10, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5213, 1182, 3, 32, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'This beer is for those of you who have been enjoying Seven Gates Pale Ale, and are ready for that next step. Beyond the Gates Double IPA is a highly hopped brew featuring plenty of Cascade and Columbus hops. These varieties give Beyond the Gates a floral citrus aroma, and pack plenty of hopped up flavor into this full-bodied ale, which is coming in @ 7.5 ABV. Let us take you Beyond the Gates, and you''ll never look back!', 'http://www.springhousebeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5214, 771, 2, 25, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'A traditional lager-style beer, with its dark color and medium body, has a defined hop flavor balanced by the smoothness of extra special roasted malt. This healthy dose of over six malt flavors makes this beer perfect for the transition from winter into spring.', 'http://www.lancasterbrewing.com/index.html', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5215, 771, 2, 25, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', 'Lancaster Brewing Companyâ€™s newest release is their limited series of Shoo-Fly Porter. From the heart of Pennsylvania Dutch Country comes a delicious porter made with Lancaster County molasses, eight different malts and grains, and four different styles of hops. This beer has a deep, rich, brown color, medium to full body, and finishes with a smooth mouth feel.', 'http://www.lancasterbrewing.com/index.html', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5216, 771, 5, 61, '302 N. Plum St.', 'Lancaster', 'Pennsylvania', 'United States', '', 'http://www.lancasterbrewing.com/index.html', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.0438, -76.2984', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5217, 1211, 3, 33, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', 'Made exclusively for the Lancaster Dispensing Company.', 'http://www.stoudtsbeer.com/brewery.html', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5218, 1326, 3, 31, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', '', 'http://www.victorybeer.com', 6.70, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
