INSERT INTO beerbuddies_db.beer VALUES (5220, 858, 3, 26, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'RondyBrew 2009 is a rendezvous of playful pale malts and feisty American hops, designed to exhilarate your winter-weary soul. This copper-colored ale delivers citrusy and refreshing hop aroma and flavor. This yearâ€™s label features Rondyâ€™s hottest event: The Running of the Reindeer. If youâ€™re suffering from cabin fever, get out and run with the herd. But ready, set, RUN because this beer is only available for a limited time. RondyBrew adds refreshment and celebration to the festive fare and entertaining events enjoyed during Anchorageâ€™s Fur Rondy Festival.', 'http://www.midnightsunbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5221, 858, 2, 25, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'This version is even lovelier than the original. Share with your sweetie.', 'http://www.midnightsunbrewing.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5275, 509, 3, 42, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'Our commemorative ale honors Samson the elk. This is an oatmeal stout that is full-bodied with a wonderful roasted flavor and just a touch of sweetness.', 'http://www.epbrewery.net/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5222, 858, -1, -1, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Assistant Brewer Jeremiah works primarily at Midnight Sun Brewing Company with regular hours at the AK Rock Gym and the occasional shift or two Kaladi Brothers Coffee. To keep up with his weekly work schedule, he enjoys locally roasted coffee in the morning--OK, sometimes in the afternoon as well--and locally brewed beer in the evening-- OK, sometimes in the morning as well. This beer brings two of his worlds together as an incredible antidote for hibernation.', 'http://www.midnightsunbrewing.com/', 9.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5223, 1211, 7, 92, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', '', 'http://www.stoudtsbeer.com/brewery.html', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5224, 44, 11, 116, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Unfiltered American amber wheat ale brewed with a blend of imported and domestic hops for a balanced slightly citrus hop aroma and caramel malty taste.', 'http://www.anheuser-busch.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5225, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Launched in the year 1983, Haywards 5000 is synonymous with strong beer in India. Haywards 5000 is brewed with the choicest of malts and hops lending itself to a unique flavour profile to suit the Indian taste and preference. Haywards 5000 is the hallmark of original and authentic strong beer which other beer brands aspire for. With such credentials, it is not surprising to see men get together over Haywards 5000. It is the language of friendship amongst men who are proud of their masculinity and look forward to a great time with their friends and peers . http://www.sabmiller.in/brands_haywards_5000.html', 'http://www.sabmiller.in/', 7.50, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5226, 769, 3, 31, '1872 North Commerce Street', 'Milwaukee', 'Wisconsin', 'United States', '', 'http://www.lakefrontbrewery.com/index.html', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0547, -87.9053', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5227, 1055, 5, 72, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'This recipe is meant to replicate a Belgian Abbey-style ale. Tart from the Belgian yeast but malty and sweet from the addition of rock candy sugar. Reddish brown in color.', 'http://www.richbrau.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5228, 1055, 1, 21, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'If you donâ€™t do dark beers, do yourself a favor and cancel that policy for this Oatmeal Stout. Keywords: Sweet Lusciousness; Roasty chocolate. Served on a nitro tap.', 'http://www.richbrau.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5229, 1055, 5, 67, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'We brewed this pleasantly aromatic wheat beer with the addition of bitter orange peel, coriander and a Belgian Abbey ale yeast strain. This beer is unfiltered and its flavor is tart but sweet and perfumey.', 'http://www.richbrau.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5230, 1055, 3, 35, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'Malty, rich, complex with a notable hops balance. Aged for 90 days. For optimal taste allow the beer to warm on your table or from the heat of your hand around the glass. Â½ pints only. 12.3 abv! Offered downstairs at the Taphouse or Pub Bar/ Dining Room only.', 'http://www.richbrau.com/', 12.30, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5231, 1055, 3, 31, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'A hops showcase in aroma, flavor and bitterness. We used the delightful Amarillo hop as the most prominent choice.', 'http://www.richbrau.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5232, 1055, 2, 25, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'This dark brown porter has more bark than bite. It is actually fairly sweet and fruity with a nutty/chocolate flavor as well. Highly recommended.', 'http://www.richbrau.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5233, 1055, 3, 26, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'Our pale ale is located toward the lighter side of the beer spectrum and we hope it will serve as a stepping stone into the more flavorful world of craft beer. Amber, caramel, fruity, hoppy and bitter.', 'http://www.richbrau.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5234, 1055, 3, 37, '1214 East Cary St', 'Richmond', 'Virginia', 'United States', 'Our lightest and palest signature brew, the Griffin is our house session beer. Notice the spicy character imparted by the German hops we use in the Griffin.', 'http://www.richbrau.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '37.5356, -77.4338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5235, 876, 1, 20, '4366 Huntington Dr', 'Flagstaff', 'Arizona', 'United States', 'From Arizonaâ€™s high country comes Apache Trout Stout, a robust, full bodied, top fermented ale. Our brewers use mountain pure water, select roasted barley, hops and yeast to create this traditional style. Savor the balanced, roasted malt flavor and the lingering sweetness that makes this dry stout a cool weather treat.', 'http://www.mogbrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.2156, -111.59', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5236, 876, 3, 33, '4366 Huntington Dr', 'Flagstaff', 'Arizona', 'United States', 'This is our flagship ale. The label for this beer is adorned with the majestic Wapiti (aka elk). Wapiti are abundant in northern Arizona. They are large and beautiful creatures, which is why we chose this animal to represent this beer. Wapiti Amber Ale is hand crafted with mountain pure water, two row malted barley, yeast and Yakima Valley hops. Our brewers use traditional methods to create this full-bodied amber ale with a distinct hoppy aroma. Wapiti Amber Ale should be enjoyed cool, not cold, to best experience the complex character and flowery aroma. Serve at 43-47 deg F.', 'http://www.mogbrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.2156, -111.59', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5237, 876, 3, 26, '4366 Huntington Dr', 'Flagstaff', 'Arizona', 'United States', 'If you are searching for a light, refreshing pale ale, your search is over! Superstition Pale Ale is named after the Superstition Mountains which are just east of Phoenix. This American pale ale is brewed using mountain pure water, select domestic grain, yeast and hops from the Pacific Northwest. Superstition is copper in color with a clean, malty fullness and finishes with pronounced hop bitterness. Perfect for enjoying on a warm Arizona day.', 'http://www.mogbrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.2156, -111.59', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5238, 876, 4, 50, '4366 Huntington Dr', 'Flagstaff', 'Arizona', 'United States', 'A truly delicious beer, Heffevenom is a medium bodied, lightly hopped wheat beer brewed in the true Bavarian tradition. Our brewers combine mountain pure water, select wheat and domestic malted grain, hops and yeast to create a highly refreshing ale with a pronounced banana and clove bouquet. Perfect with a slice of lemon as garnish.', 'http://www.mogbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '35.2156, -111.59', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5239, 876, 3, 31, '4366 Huntington Dr', 'Flagstaff', 'Arizona', 'United States', 'If you like big, bold, pronounced hop character, then this beer is for you. One taste and youâ€™ll find yourself right smack in the middle of Hop Head Heaven! But this beer has more to offer than just hops. We use tons of the finest malted barley available to balance out this beer. The result of our efforts is a beer with a magnitude of hop aroma and bite, yet perfectly balanced with a clean, crisp malty flavor. WARNING: This beer is not intended for the masses that prefer a mild domestic beer, Itâ€™s big, bold characteristics and 7.1% a.b.v. are not intended for the weak.', 'http://www.mogbrew.com/', 7.10, 0.00, 0.00, 0, '9999-01-01', '35.2156, -111.59', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5240, 787, 5, 74, '', 'Stillwater', 'Minnesota', 'United States', 'This pale golden, Belgian-influenced ale is for everyone: Farm Girl, wannabe Farm Girl. In the Belgian Farmhouse tradition, this brew has a dry malt finish and a spiciness that only Belgian yeasts can create. Smooth and well rounded... this one can please anyone in any situation, whether you are on the water, in the sun, or hiding from winter''s chill.', 'http://www.liftbridgebrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '45.0565, -92.8222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5241, 787, 3, 26, '', 'Stillwater', 'Minnesota', 'United States', 'Well balanced amber pale ale accentuated by multiple additions of floral Cascade hops and our unique introduction of grapefruit zest to compliment the citrus notes of the hops.', 'http://www.liftbridgebrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '45.0565, -92.8222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5242, 787, 5, 66, '', 'Stillwater', 'Minnesota', 'United States', 'We drew inspiration from Steveâ€™s Grandmotherâ€™s holiday biscotti recipe to create this one of a kind brew. By utilizing an array of malts, oats, wheat, pure local honey, light European hops and delicately spicing with Grains of Paradise, Madagascar vanilla beans, whole star anise, all brought together with traditional Belgian yeast, the result is a cloudy, deep copper colored, complex experience. This delight to the senses should be served in a 12 ounce footed glass and allowed to warm to 50 degrees to fully gather the malt and spice spectrum.', 'http://www.liftbridgebrewery.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '45.0565, -92.8222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5243, 787, 3, 26, '', 'Stillwater', 'Minnesota', 'United States', 'Constant addition of fresh Cascade and Willamette hops from Bradâ€™s Stillwater hop garden during boil and fermentation process. Aromatic and caramel malts compliment the hop character for an incredibly balanced beer that celebrates the hop harvest without killing your tongue.', 'http://www.liftbridgebrewery.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '45.0565, -92.8222', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5244, 462, -1, -1, '8 Fourth Street', 'Hood River', 'Oregon', 'United States', 'In Cologne, Germany, many a brewery produces a light-bodied ale with a delicate fruitiness and rounded maltiness, attributable to the unique yeast strain commonly used. Our KÃ¶lsch is unfiltered and more generously hopped than its German cousin.', 'http://www.doublemountainbrewery.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '45.71, -121.515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5245, 462, 3, 26, '8 Fourth Street', 'Hood River', 'Oregon', 'United States', 'Itâ€™s easy to forget just how dynamite a well-made pale ale can treat you. Our Pale combines softness from our Pilsner malt, a touch of sweetness from English crystal malt, and plenty of fruity, resinous Northwest hop flavor. The finish is dry, clean and refreshing.', 'http://www.doublemountainbrewery.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '45.71, -121.515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5246, 462, 3, 31, '8 Fourth Street', 'Hood River', 'Oregon', 'United States', 'The â€œIRAâ€, as itâ€™s known around here, marries a ruby red color and rich body with the hop flavors of an IPA. Our unique ale yeast strain adds a delicious layer of complexity. One of the first beers we made, and an enduring favorite.', 'http://www.doublemountainbrewery.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '45.71, -121.515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5247, 462, 3, 31, '8 Fourth Street', 'Hood River', 'Oregon', 'United States', 'This big, glowing, powerful IPA is packed with assertive Northwest hops that are floral, citrusy and resinous. A healthy dose of Munich malt helps to provide backbone and balance against the hoppy attack. The result? Explosive!', 'http://www.doublemountainbrewery.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '45.71, -121.515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5248, 462, 4, 57, '8 Fourth Street', 'Hood River', 'Oregon', 'United States', 'This special German-style ale is still made faithfully in Dusseldorf, just down the road from Cologne. Our interpretation is light brown in color and cleanly malty, with a crisp hoppy bitterness in the finish. Brewed with organic Pilsner and Munich malt; Chocolate and wheat malt, and imported Spalt hops.', 'http://www.doublemountainbrewery.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '45.71, -121.515', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5249, 1388, 7, 90, '310 Mill Creek Avenue', 'Pottsville', 'Pennsylvania', 'United States', 'In celebration of our 180th Anniversary year, the marketplace will see one of the first seasonal offerings from the Yuengling Brewery in many years. Yuengling has produced a Bock Beer in its long and storied past, and we have now reinvented that product for limited release in 2009. The new brew is dark brown in color and offers exceptional flavor that lives up to the quality Yuengling drinkers have grown to expect. Yuengling Bock Beer will be offered in Â½ barrels only, beginning in late February and lasting for approximately 8-10 weeks. Letâ€™s all raise a pint of Yuengling Bock and celebrate the 180th Anniversary year!', 'http://www.yuengling.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.7, -76.1747', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5250, 1090, 5, 64, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', '', 'http://sacbrew.blogspot.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5251, 1090, 5, 72, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', 'Belgian IPA, West Coast hops meet belgian yeast. Spicy, fruity and citrusy notes combine for an interesting fusion brew.', 'http://sacbrew.blogspot.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5252, 1090, 1, 5, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', 'Low in alcohol but big in flavor. This beer is dry hopped like an IPA but the alcohol and bitterness have been reduced for a great session beer.', 'http://sacbrew.blogspot.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5253, 1090, 7, 90, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', 'A stronger German lager brewed with lots and lots of Munich malt for a toasty bready like aroma.', 'http://sacbrew.blogspot.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5254, 1090, 8, 95, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', 'A light all malt lager with delicate hop finish.', 'http://sacbrew.blogspot.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5255, 1090, 3, 38, '2713 El Paseo Lane', 'Sacramento', 'California', 'United States', 'A malty dark ale wtih ale with a chocolate and biscuit like flavor and balanced finish.', 'http://sacbrew.blogspot.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '38.6191, -121.4', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5256, 1245, 2, 25, '420 Harrison Drive', 'Centerport', 'New York', 'United States', 'A roasty robust porter. Brewed with malt that I smoke over alder and apple wood. Goes great with steak, burgers, as well as barbecued, grilled, or smoked food. Kielbasi! Cheeses? Try it with Gouda, Brie, Swiss, or Havarti.', 'http://www.blindbatbrewery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '40.8959, -73.3811', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5257, 1245, 4, 50, '420 Harrison Drive', 'Centerport', 'New York', 'United States', 'Malty and yeasty, with some sweetness along with hints of cloves and banana. (thanks to the yeast!) Low hop bitterness, highly carbonated. Unfiltered, and so a bit cloudy with that magical yeast. Pairs well with Thai, Szechuan, Mexican, and Caribbean -- und Deutsche Nahrung! (German Food!)', 'http://www.blindbatbrewery.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.8959, -73.3811', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5258, 1245, 3, 42, '420 Harrison Drive', 'Centerport', 'New York', 'United States', 'Brewed with real mashed Long Island Potatoes (or is it "Potatos"?) in the mash - hence, "twice mashed.', 'http://www.blindbatbrewery.com/', 3.90, 0.00, 0.00, 0, '9999-01-01', '40.8959, -73.3811', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5276, 509, 3, 33, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'Our red is a special bitter. This means it has medium body and mild bitterness. These balance well with the rich copper color. We use American hops.', 'http://www.epbrewery.net/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5259, 1245, 5, 67, '420 Harrison Drive', 'Centerport', 'New York', 'United States', 'A smoked wit, you say? Yup. Researching smoked beers led me to a world of smoked wheat beers, particularly a smoked wheat beer popular in Poland about 100 years ago. (I''ll list that one as one of the Blind Bat beers when I''m happy with the test batches and am ready to offer it to the public.) I didn''t find anything about smoked wit beers, but decided to experiment a bit (a wit is a wheat beer). I like it, and hope you will too. Pictured on the label is Long Island''s old Walt Whitman, enjoying a smoke and a book in what is purported to be his favorite spot in his native West Hills. Long Island''s springtime is awakening all around him.', 'http://www.blindbatbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.8959, -73.3811', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5260, 1245, 4, 50, '420 Harrison Drive', 'Centerport', 'New York', 'United States', 'Sometimes it''s good to keep it simple. Harborfields HefeWeizen is modeled after the German classic, but meant to be available fresh (like you would enjoy if you were in Germany). Shipping over long distances is not always a friend to beer. Named for the Centerport-Greenlawn area of Long Island that is home to the Blind Bat Brewery, Harborfields Hefeweizen goes great with fish, chicken, or a summer salad. Some even like it with brunch! (Please enjoy your waffles responsibly.)', 'http://www.blindbatbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.8959, -73.3811', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5261, 157, 3, 43, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams Imperial Stout is our take on the stouts brewed by 18th century English brewers for the Russian Imperial Court of Catherine II. The special malted barley in this intense and massive brew delivers rich flavours like dark chocolate, coffee and anise.', 'http://www.samueladams.com/', 9.20, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5262, 157, 5, 67, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams® Imperial White is a new perspective on the classic witbier style. Witbiers are normally light and refreshing with a fruity finish and we wanted to see how these characteristics would stand up when we amped up the recipe. We were totally blown away by the flavors that were created by this beer. This is not just a more intense version of our spring seasonal Samuel Adams® White Ale. Imperial White is a new recipe that stands on it own merits. In fact, it is more of a wine substitute than just another refreshing witbier. This is a beer that should be sipped and savored and you', 'http://www.samueladams.com/', 10.30, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5263, 678, 7, 77, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'Our Czech style pilsner is all malt all the time-no choicest rice or corn syrup here! Whole flower Czech Saaz hops balance the delicate honey flavor of our organic Canadian grown pilsner malt creating a golden beer with depth of character.', 'http://hopworksbeer.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5264, 678, 3, 31, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'Our namesake IPA is a Northwest classic. Generous additions of Amarillo, Centennial, and Ahtanum hops find their way into the kettle, hop-back, and dry-hop. This judicious use of the "brewers spice" creates rich and resinous flavors of citrus fruit and pine. The finest organic Canadian pilsner malt and organic German Munich and Caramunich malts then bring balance to your new favorite beer.', 'http://hopworksbeer.com/', 6.60, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5265, 678, 1, 5, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'This English Session Beer has a delicious floral hop aroma and flavor. A heaping helping of organic caramel malt and touch of organic chocolate malt give this beer its beautiful mahogany color while organic oats from Bob''s Red Mill velvetize the texture. Smoother than an infomertial host at half the price!', 'http://hopworksbeer.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5266, 678, 3, 26, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'This beer bridges east and west with a lane dedicated to riders who aren''t afraid to get dirty. Three kinds of organic caramel malts and a 24 pound whirlpool hop bomb keep things interesting while the wheels go round and round. Cheers to narrow knobbies, kazoos, and more cowbell!', 'http://hopworksbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5267, 678, 3, 30, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', '"Strong like bull but sweet like your momma. This unique beer is a trifecta of bold flavors. Hops, malt and alcohol bully the taste buds on the organic playground while the monitor blows the whistle!";"0', 'http://hopworksbeer.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5268, 678, 1, 21, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'Beer of the Ancients! Barley (Egyptian), Wheat (Mesopotamian), Oats (Egyptian), Amaranth (Aztec), Quinoa (Incan), Spelt (Mesopotamian), and Kamut (Egyptian) sustain the soul with a nutrients cultivated through the millennia. Finished with 15 pounds of cold-pressed Stumptown Hairbender espresso. Unlock the mystery entombed in darkness.', 'http://hopworksbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5269, 778, 3, 32, '1245 Puerta del Sol', 'San Clemente', 'California', 'United States', 'Here at Left Coast Brewing Co. we pride ourselves on being one of the first breweries to pioneer a Double IPA style beer. In 2003, we brewed our first Double IPA, and haven''t looked back since. This hop monster uses Premium American 2- Row and a touch of light crystal malt to create a solid malt foundation. The recipe calls for hops to be used in every step of the brewing process; in the mash, in a hop back, in the fermenter, and in the bright tanks. We use hop extract, hop pellets and hop flowers, hence the name Hop Juice. Hop Juice spends more than 4 weeks dry hopping in the fermenter and the bright beer tank. It is approximately 9.4% abv and has massive IBUs. Hop usage is over 4lbs per barrel. Hopeheads, step up to the plate!', '', 9.40, 0.00, 0.00, 0, '9999-01-01', '33.4577, -117.589', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5270, 509, 3, 31, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'Our award-winning India Pale Ale is a hop loverâ€™s dream. We use Galena and Cascade hops in the kettle and dry-hop with more cascade during conditioning. This copper-colored ale has a nice maltiness to balance all the hops.', 'http://www.epbrewery.net/', 5.80, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5271, 509, 11, 121, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'This is one of our most popular beers. It is a light and refreshing raspberry-flavored wheat ale. We use pure raspberry extract to give this beer its fruity aroma and flavor.', 'http://www.epbrewery.net/', 4.20, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5272, 509, 11, 116, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'We put close to a half a pound of Colorado honey per case in this wheat ale. The honey adds a sweetness and raises the alcohol content slightly. We use Mount hood and hallertau hops.', 'http://www.epbrewery.net/', 6.00, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5273, 509, 2, 25, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'Porters are dark ales without the roasted malt character of a stout. Our porter is a brown porter with a very smooth, balanced profile.', 'http://www.epbrewery.net/', 4.60, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5274, 509, 3, 37, '470 Prospect Village Dr.', 'Estes Park', 'Colorado', 'United States', 'This is our smooth golden ale. Our Gold has a medium body and low to medium hop bitterness and aroma.', 'http://www.epbrewery.net/', 4.20, 0.00, 0.00, 0, '9999-01-01', '40.3707, -105.526', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5277, 260, 3, 37, 'Broughton', 'The Borders', 'Scotland', 'United Kingdom', 'According to legend, gold panned from the crystal clear Border streams of the Yarrow valley, nearby the site of the Broughton Ales brewery, was used to make the third wedding ring of Mary Queen of Scots. This golden coloured ale is brewed with a skilful blend of organically grown hops and malt, and pure Scottish water to the exacting standards required by Soil Association Certification Ltd. of the United Kingdom. The end result is a light golden coloured, clean tasting beer with an excellent hop aroma and aftertaste. At 6.0% ABV a premium ale for those who know and care about what they eat and drink. Border Gold has won several awards, the most recent being a bronze medal in the International Brewing Awards in Munich 2005.', 'http://www.broughtonales.co.uk/', 6.00, 0.00, 0.00, 0, '9999-01-01', '55.6145, -3.4107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5278, 1286, 3, 35, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'This strong alluring ale is two beers in one. Cracking open a fresh bottle unleashes hops and heat with more than 100 IBUs emanating from three hop varieties and sweet burn of 9.3% ABV. Cellaring the Flying Mouflan in a cool dark place at 50 degrees for a minimum of four months will mellow out the hops and wash away the heat. If you can resist temptation you will be rewarded with two memorable beers in a single bottle.', 'http://www.troegs.com/', 9.30, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5279, 797, 4, 50, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', 'Modeled after the classic wheat beers of Bavaria, our HefeWeizen has a cloudy, straw-colored appearance with a thick, creamy head. It is fermented with an authentic Weizenbier yeast strain which imparts delicate notes of clove, vanilla and banana which harmonize perfectly with its mild refreshing tartness. Together these flavors create the perfect thirst quencher to beat the Texas heat. Available April - August', 'http://www.liveoakbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5280, 797, 7, 77, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', 'Crisp, clean, and refreshing, this pilsner is styled after the original Bohemian classic from the town of Pizen, Czech Republic, Pilz is a golden-colored brew that balances a pleasant hoppiness with its smooth malt flavor. It finishes dry with a moderate bitterness that is a hallmark of the style.', 'http://www.liveoakbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5281, 797, 3, 26, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', 'A delicious example of the "neo-classical" American beer style. It has a beautiful copper color and is topped with a thick rich head. With a hint of ale fruitiness in the nose, Pale Ale starts out malty, finishes dry and has plenty of Cascade hops in between. It is sure to satisfy the most discerning ale aficionados.', 'http://www.liveoakbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5282, 797, 7, 84, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', 'A fall classic, our Oaktoberfest emphasizes rich malt flavor. We use German malt and hops to give it an authentic Bavarian character. The rich, maltiness of this brew is a good match with spicy cuisine, as well as barbecue. Live Oak Oaktoberfest will certainly raise the level of enjoyment at your next fall gathering. Available September - December', 'http://www.liveoakbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5283, 797, 3, 31, '3301-B East Fifth Street', 'Austin', 'Texas', 'United States', 'With about 6.0% ABV, this one will surely warm the ol'' gullet during a cold central Texas winter - both days! Our India Pale Ale (IPA) is light in color and strong in hop character. Dry hopping with Cascade hops, gives this winter favorite a delicious citrus note reminiscent of a Texas Ruby Red. Yes, it''s warming but you don''t need to be huddled around the furnace to enjoy this one! IPA fans really love this ale during a beautiful Texas winter on the porch or indoors. Available December - April', 'http://www.liveoakbrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '30.2541, -97.7055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5284, 543, 3, 43, '638 W. 4th Street', 'Winston-Salem', 'North Carolina', 'United States', '', 'http://www.foothillsbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '36.0973, -80.2509', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5285, 100, 3, 30, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', '"Black, dense, and rich, this is a great ale for the cellar." This big brew is made with molasses and brewer''s licorice.', 'http://www.bellsbeer.com/', 12.50, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5286, 1320, 3, 32, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'A massively hopped Imperial IPA brewed to celebrate Valley Brews 10th anniversary. 1 pound of hops were added every 10 minutes during a 100 minute boil, a total of 10 different boiling hops. 4 different fresh hops were used in the hopback and then the beer was passed through a chamber containing 10 lbs of fresh hops on the way from the serving tanks to the bar taps. Hopperiffic.', 'http://www.valleybrew.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5287, 1320, 3, 42, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Our Black Cat Stout is brewed using a blend of Chocolate, Carafa, Crystal and Munich malts. A small amount of wheat and oatmeal are added to give the beer body and mouth feel. Small amounts of roasted malts are added to give the beer a dry coffee finish.', 'http://www.valleybrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5288, 1320, 3, 26, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Hitman Gold is an American Pale Ale. The flavor is smooth but aggressively hopped with Simcoe Hops. The beer is best described as a â€œmini-IPAâ€. The beer is inspired by the famous wrestler Bret The Hitman Hart, who also is the artist who designed and drew the logo.', 'http://www.valleybrew.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5289, 1320, 1, 10, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'A classic English Style Mild with a light hop profile. London Tavern Ale is a well balanced beer with caramel flavor and English character. Only traditional English Kent Goldings and Fuggles hops are used.', 'http://www.valleybrew.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5290, 1320, 3, 33, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'A flavorful Red Ale with a generous helping of fresh Cascade hops. A full-bodied unfiltered beer with a slightly dry and roasted finish.', 'http://www.valleybrew.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5291, 1320, 3, 32, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Our India Pale Ale is brewed in a California IPA style. The beer is generously hopped for bitterness with Magnum hops and finished with fresh Amarillo, Ahtanum and Cascade hops.', 'http://www.valleybrew.com/', 7.30, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5292, 1320, 11, 116, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'An American style Wheat Ale made with 50% malted 2 Row barley and 50% malted wheat. Valley Brew Pale Wheat is lightly hopped to produce a smooth and satisfying finish.', 'http://www.valleybrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5293, 1320, 3, 26, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Ports Pale Ale is an extremely light and easy to drink Pale Ale. It is brewed with the finest German and English Malt and Hops. Brewed for the local Stockton ports baseball team.', 'http://www.valleybrew.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5294, 1320, 11, 121, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Apricot Ale is a fruit beer produced using 100% Apricot fruit extract. The beer has a hint of Apricot in the nose and a sweet clean and refreshing finish.', 'http://www.valleybrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5295, 1320, 11, 121, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Valley Berry Wheat is a fruit beer produced using pure fruit extracts of Raspberry, Wildberry, Cherry and Blueberry. The beer has a wonderful fruity nose and a smooth clean finish.', 'http://www.valleybrew.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5296, 1320, 3, 37, '1950 W. Fremont St.', 'Stockton', 'California', 'United States', 'Fat City Ale is the newest release from Valley Brewing Company. Fat City Ale is produced using only the finest 2-Row Barley and fresh Hops resulting in a crisp and refreshing flavor.', 'http://www.valleybrew.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '37.9551, -121.322', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5297, 72, 3, 38, '8 Mt. Desert Street', 'Bar Harbor', 'Maine', 'United States', '', 'http://www.barharborbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '44.3875, -68.2046', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5298, 161, 3, 32, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Double-Wide I.P.A. uses Zeus and Magnum hops for both bittering and aroma, with Ahtanum hops added solely for aroma. Two additional dry hopping regimens employ Ahtanum, Centennial, and Chinook varietals. The resulting beer â€“ not surprisingly â€“ has a hop forward aroma, redolent of peach and apricot. The assertive flavor bursts forth with citrus notes of blood orange and lemon, a caramel malt backbone serves to balance the intensity of the hops. There is little restraint in the flavor of this beer; it is certainly not for the pedestrian palate.', 'http://www.blvdbeer.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5299, 161, 3, 31, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'The latest addition to the Boulevard family of year-around beers, Single-Wide I.P.A. is our take on a style that originated in 18th century Great Britain. This American version -- inspired by our Smokestack Series Double-Wide I.P.A. -- boasts a heady combination of six varieties of hops, some of which were employed for dry-hopping.', 'http://www.blvdbeer.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5300, 161, 2, 22, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Irish Ale, Boulevardâ€™s spring seasonal beer, is our Midwestern tribute to the legendary red ales of old Ireland. Our recipe combines six kinds of pale and roasted barley malts to provide a rich, toasty flavor and tawny reddish hue.', 'http://www.blvdbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5301, 161, 7, 91, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'First introduced in 2008, Boulevard Maibock is a new, limited-release seasonal brew. A welcome sign of Spring, this beer is a traditional German lager, lighter in color than other bocks. Boulevardâ€™s Maibock is a distinctive, refreshing take on this springtime classic.', 'http://www.blvdbeer.com/', 5.95, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5302, 161, 5, 67, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Boulevardâ€™s summer seasonal is our interpretation of a classic Belgian witbier. ZÅŒN (Flemish for â€œsunâ€) combines the subtle flavors of coriander and orange peel with other traditional ingredients to create a delightful, refreshing summertime brew. Available from May through August, in bottles and draught.', 'http://www.blvdbeer.com/', 4.40, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5303, 161, 7, 84, '2501 Southwest Boulevard', 'Kansas City', 'Missouri', 'United States', 'Boulevardâ€™s fall seasonal beer, Bobâ€™s â€™47 Oktoberfest is a medium-bodied, dark amber brew with a malty flavor and well-balanced hop character. With this Munich-style lager we solute our friend Bob Werkowitch, Master Brewer and 1947 graduate of the U.S. Brewerâ€˜s Academy. Available from September through October in bottles and on draught.', 'http://www.blvdbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '39.0821, -94.5965', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5304, 1173, 3, 32, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'The simplicity of Hoppe tests the skill and ability of the brewer to create something truly majestic. We craft this much like a sculptor who uses only a hammer and chisel to shape stone into a masterpiece. Hoppe is spawned of these few essentials: barley, wheat, hops, yeast and water. This limited palette is an exercise in minimalism, with refined elements which are deliberately selected. This simple combination creates a golden shimmering brew infused with delicate aromas. The artful nature of this beer is exposed with the first taste. As the malt and hops create a composition of flavors, an elegant finish leaves an impression that your tastes will not soon forget.', 'http://www.southerntierbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5305, 1173, 3, 32, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'High in the winter sky, two parallel stick figures are visible & known as â€œthe twins,â€ or the constellation Gemini. The astronauts of the 1960s flew as teams of two in a program named after the celestial pairing. At Southern Tier, we have our own fraternal twins, Hoppe & Unearthly. Blended together & placed in this vessel, the mission of our Gemini is to travel high & take passengers on a journey far into the heavens.', 'http://www.southerntierbrewing.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5306, 1166, 3, 31, '10426 East Jomax Road', 'Scottsdale', 'Arizona', 'United States', 'Our IPA has lots of malt and hop character. This style originated during Queen Victoriaâ€™s reign as a strong, flavorful ale, which was able to survive the ocean voyage from England to India during the British occupation.', 'http://www.sonoranbrewing.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '33.7268, -111.853', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5307, 1166, 3, 26, '10426 East Jomax Road', 'Scottsdale', 'Arizona', 'United States', 'The Burning Bird is our representation of the Phoenix, our cityâ€™s namesake, a mythical bird which lived 500 years, consumed itself by fire, then was reborn from its ashes. Like the phoenix of old, this pale ale is reborn from the time when fabulous hoppy brews were more than mere myths.', 'http://www.sonoranbrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '33.7268, -111.853', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5308, 792, 7, 77, '700 North Pennsylvania Blvd.', 'Wilkes Barre', 'Pennsylvania', 'United States', '', 'http://www.lionbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '41.2557, -75.8583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5309, 792, 8, 96, '700 North Pennsylvania Blvd.', 'Wilkes Barre', 'Pennsylvania', 'United States', '', 'http://www.lionbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.2557, -75.8583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5310, 1100, 5, 72, '10450-L Friars Road', 'San Diego', 'California', 'United States', 'Abbey ale with hints of bubble gum flavor.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '32.7922, -117.099', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5311, 534, 7, 77, 'Munketoft 12', 'Flensburg', 'Schleswig-Holstein', 'Germany', '', 'http://www.flens.co.uk/', 4.80, 0.00, 0.00, 0, '9999-01-01', '54.779, 9.4355', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5321, 1091, 3, 33, '2522 Fairway Park Drive', 'Houston', 'Texas', 'United States', 'A well balanced, full flavored, amber ale. It has a rich, malty body with a pleasant caramel character derived from a specialty Caravienne malt. A complex hop aroma, with a hint of floral and citrus comes from a combination of Cascades and Liberty hops. It has a rich, creamy head with a fine lace. The light fruitiness, characteristic of ales, is derived from a proprietary yeast strain. Saint Arnold Amber Ale is best consumed at 50 - 55Â° Fahrenheit.', 'http://www.saintarnold.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '29.8123, -95.4675', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5312, 656, 7, 91, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'Certain things seem interminable. The line at the DMV. The commencement address. Winter. But take heart. Even the longest, darkest winter gives way to spring and a new sense of optimism that the best is just ahead. That thoughtâ€”and an itchy wool robeâ€”sustained the monks through times of fasting. Their reward? A bock beer with the power to rejuvenate the body and the soul. That, and the opportunity to exchange the wool robe for a nice burlap one. So when youâ€™re stuck in the middle of that seemingly endless glass of mediocre beer, be optimistic. A Dundee Pale Bock awaits. A traditional German Maibock with a deep, golden color, malty-sweet aroma, and clean finish from Magnum and Czech Saaz hops.', '', 6.25, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5313, 656, 2, 25, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'More and more weâ€™re becoming a nation of milquetoasts. And nowhere is that more evident than in our beerâ€”puny liquids without calories, carbs, or cojones. But it neednâ€™t be that way, my friend! Sure, we donâ€™t want to make a living shoveling coal or washing clothes on a rock. But we can recapture the more robust spirit of a time gone by. Dundee Porter is a throwback to a different eraâ€”when times were tough and so were the people. They drank big beers, slapped each other on the back, and toasted the good lifeâ€”even though they only saw it from a distance. With Dundee Porter, you can get a taste of it. Big and malty flavor from aromatic dark-roasted grains balanced by a subtle hint of hops. Deep color and rich caramel flavor.', '', 6.50, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5314, 656, 11, 116, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'Senator Joseph McCarthy. The Hollow Earth Society. Members of the Spanish Inquisition. All convinced they were blessed with the gift of clarity. And proof that clarity might be overrated. Sometimes, being unclearâ€”and a little flexibleâ€”is a good thing. Like when you are looking for the perfect refreshment. Dundee Wheat Beer combines wheat and yeast into a refreshing hefeweizen-style brew. Unfiltered, so it is slightly cloudy and pleasantly unclear. So the next time youâ€™re convinced youâ€™re right about what youâ€™ve been drinking, give a little â€œunclarityâ€ a try. An American-style, unfiltered wheat beer. Pale straw in color with a light cloudiness from carefully selected wheat and yeast. Pleasant spicy malt aroma and a crisp hop finish.', '', 4.20, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5315, 656, 3, 26, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'Behold the hop. A flower, but too unsightly to be used for decoration. The ugly duckling of the flower family. Oh, but the secret it holds. Soak it in some water with the right companions and it surrenders its bouquet to use a corny flower metaphor. That unique hop flavor is the difference between a fine pale ale and more ordinary beers. Dundee Pale Ale understands the secret of the hop flowerâ€”the power to turn an ordinary beer into something extraordinary. And the power to make you indescribably hoppy. A wonderfully balanced true pale ale. Cascade, Tomahawk, and Amarillo hops create a citrusy aroma with a smooth, crisp finish. A subdued malt character nicely complements the hop complexity and produces an orangey amber hue.', '', 5.30, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5316, 656, 3, 31, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'It takes a bit of seasoning to understand that bitter can be a good thing. When youâ€™re a child, you want everything to be sweet. When youâ€™re a teenager, you want everything to be sweeeeet. But when you get a bit wiser and acquire some taste, you realize that bitter is an excellent alternative. Itâ€™s a sign of complexity. Itâ€™s a sign of maturity. Itâ€™s a sign of the times. Face it, modern life demands a little bitterness every once in a while. When you are in the mood for something bitter, Dundee IPA is hop bitterness at its finest. As the youngsters would say, thatâ€™s sweet. An aggressively hopped IPA brewed with Amarillo and Simcoe hops. Blended Crystal malts balance the flavors with a distinctive spicy aroma and a long, crisp finish.', '', 6.30, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5317, 656, 11, 141, '445 St.Paul Street', 'Rochester', 'New York', 'United States', 'So did you ever ask yourself...what exactly is there to be festive about during the holidays? Your brother in-law snoring on the air mattress? (Boy, letâ€™s hope thatâ€™s snoring.) The variety of toys with realistic sound effects? Fruit cake? Dundee Festive Ale may be one of the few exceptions. One sip of the carefully matched seasonal spices and you realize that the holidays are worth paying...waiting for. Oh, there may be one other thing to be festive about. Thereâ€™s a 13 to 1 chance against your brother in-lawâ€™s plane leaving on time. But at least thereâ€™s a chance. Festively hearty and full bodied with a mild nutmeg, allspice, cinnamon, and orange peel spice character and subtle crystal malt flavor.', '', 6.20, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5318, 851, -1, -1, '5121 N Ravenswood Ave,', 'Chicago', 'Illinois', 'United States', 'If malt and hops are the two poles of brewing, this beer is the gently spinning sweet spot between them. First, youâ€™ll notice the spicy aromas of Perle and Hallertau hops. Then - wipe the foam off the tip of your nose - dive into the toasty flavors of Vienna and Munich malts. Dynamo starts strong and finishes crisp and smooth. The balanced flavors, aromas, and even the coppery-red tones of this beer go great with everything. Fear no pairing. The best time to enjoy Dynamo is when youâ€™re thirsty. Dynamo Copper Lager goes great with pizza, neighborhood block parties, spring rolls, first dates, football games, whiskey, tapas, the Sunday newspaper, late-night burritos, veggie omelets, business lunches, grilled mushrooms, pretzels, political debate, corn-on-the-cob, classic sci-fi flicks, mixed greens, campfires, salmon, billiards, cherry pie, rock shows, pumpernickel, salsa, grand openings, peanuts, sewing bees, extra sharp cheddar cheese, and holidays.', 'http://www.metrobrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '41.975, -87.674', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5319, 851, 8, 95, '5121 N Ravenswood Ave,', 'Chicago', 'Illinois', 'United States', 'The kinetic beauty of spicy hops grabs you by the nose and lets you know: this is German-inspired beer. A mild, bready malt sweetness greets you at the lips, smoothing the crisp hop flavors. Flywheel is meant for bombastic celebrations of singing voices and clamoring mugs. But then, that first contented moment of happy hour is uniquely celebratory as well. Flywheel Bright Lager goes great with hot dogs, guitar jams, stir fry, bowling, taco salad, house warmings, baked potatoes, Saturday morning cartoons, tequila, gouda cheese, karaoke, bagel & schmear, Euchre, fresh berries, asparagus, 16-inch softball, sushi, darts, Pad Thai, family reunions, pb&j, flan, romantic weekend getaways, garlic bread, pay raises, nachos, baby showers, fondue, and Frisbee golf.', 'http://www.metrobrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.975, -87.674', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5320, 451, 7, 77, 'Tbinger Strae 46', 'Stuttgart', 'Baden-Wrttemberg', 'Germany', '', '', 4.90, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5338, 508, 7, 77, '2109 Hickory Street', 'Cross Plains', 'Wisconsin', 'United States', '', 'http://www.essersbest.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.1147, -89.6531', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5339, 628, 4, 57, '', 'Mnchengladbach', 'Nordrhein-Westfalen', 'Germany', 'Classic German Alt', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '51.1913, 6.4421', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5322, 1091, 3, 31, '2522 Fairway Park Drive', 'Houston', 'Texas', 'United States', 'A traditional India Pale Ale, the Elissa IPA is very hoppy with a properly balanced malty body. Elissa has huge hop additions in the kettle that give it a wonderful bitterness and is then dry-hopped in the fermenter to create the pleasant floral, hoppy nose. Our reverse osmosis water makes the bitter very soft with no harsh notes to it. The maltiness is derived from British Maris Otter malt. Its rich flavor stands up to the hops that would otherwise dominate this beer. The Elissa is an authentic version of an India Pale Ale (IPA) style.', 'http://www.saintarnold.com', 6.60, 0.00, 0.00, 0, '9999-01-01', '29.8123, -95.4675', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5323, 1091, 7, 90, '2522 Fairway Park Drive', 'Houston', 'Texas', 'United States', 'An authentic, German-style Bock, celebrating the coming of spring. This strong, deeply flavored lager has been aged to create a smooth, malty taste with a hint of sweetness. A light addition of German hops balances the malt flavor. Saint Arnold Spring Bock is best consumed at 40Â° Fahrenheit.', 'http://www.saintarnold.com', 6.40, 0.00, 0.00, 0, '9999-01-01', '29.8123, -95.4675', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5324, 692, 1, 13, '3913 Todd Lane #607', 'Austin', 'Texas', 'United States', 'Brilliantly golden, Jasperilla is a unique take on an old ale. Biscuity malt flavors meld with subtle plum and berry notes, produced by a special blend of English Old Ale and Chico yeasts. Brewed once a year, and aged for six months prior to release, the Jasperilla is smooth despite its 9% abv. Jasper dressed as Hosehead from Strange Brew We named this beer after our dog Jasper because he has brought so much joy to our lives. We got Jasper from a local dog rescue group called Mixed Breed Rescue. He has been a constant source of smiles and kept our spirits high through many late nights and long hours at the brewery. Jasperilla is so good and smooth that you''ll beg like a dog for more, roll over for a belly rub, howl at the moon...you get the picture.', 'http://www.independencebrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '30.2131, -97.7358', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5325, 714, 7, 77, '', 'Jever, Germany', '', 'Germany', 'A Norther German (Friesian) Pilsener that is cattegoristic of the style. It is a little more hoppy than Czech pilseners giving it a more herb (bitter?) flavor.', 'http://www.jever.de/', 4.90, 0.00, 0.00, 0, '9999-01-01', '53.5757, 7.9003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5326, 1350, 7, 77, '', 'Steinberg-WernesgrÃ¼n, Germany', '', 'Germany', 'A classic German-style Pils', 'http://www.wernesgruener.de/', 4.90, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5327, 514, -1, -1, '1714 Camus Lane', 'Madison', 'Wisconsin', 'United States', '', 'http://www.fauerbachbrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '43.0844, -89.4761', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5328, 1330, 5, 65, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'Our Gran Met (Grand Master) is an Ale made from our Propriatery yeast from a small brewery in Belgium. We use Cane and Beet sugar, along with German Pilsner Malt to create the unique flavor of this age old style. We also use a unique fermentation process of slowly adding the sugars to the fermentation during fermentation. This allows the yeast to more slowly ferment the beer without overloading the yeast. This process allows for a more clean, tight flavor profile.10% alc by vol. Bottle Conditioned and Refermented.', 'http://www.voodoobrewery.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5329, 1330, 11, 116, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'This Wheat ale is made with a little Voodoo Twist. We use our house Belgian Ale yeast and add the average unmalted wheat, wheat, barley,raw oats, malted rye and just add more of each. Hopped evenly and spiced with coriander, bitter and sweet orange peel, juniper berries, 12 varieties of peppercorns,lemon grass and caraway. About 6.75% alc by vol. Bottle Conditioned and Refermented. NOT A WIT BIER!!! Just stuff we like in beer that goes great with food. This beer is to be the answer to those hot summer days. Blows away carbonated water!!!!!', 'http://www.voodoobrewery.com/', 6.75, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5330, 1330, 5, 61, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'This is our Gran Met Ale aged on intimate Passion Fruit, Raspberry and Michigan Tart Cherry. Lightly spiced with passion. Light Reddish hue and with a alcohol strength of 10% and nicely carbonated in the bottle. Again Bottle Conditioned and Fermented. Enjoy a couple and have your own Voodoo Love Child later!!!', 'http://www.voodoobrewery.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5331, 1330, 3, 43, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'This is an Imperial Stout that is Brewed to great strength and complexity. We then gently age that beer in Elaigh Craig 13 1/2 year old Bourbon Barrels for 1 yr. and then primed and bottled to bottle condition for continued aging and celler life. Black Magick should be able to be aged up to about 5 years, to heighten the complexity and smooth nature of this beer. This beer should be opened to breath, pour into snifter and enjoy at 55-60 F. This is a truly Barrel aged ale and is not to have a large carbonation. We bottle condition it to achieve cask like characteristics.', 'http://www.voodoobrewery.com/', 15.00, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5332, 1330, 3, 31, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'India Pale Ale is a wonderful example of marriage. Bitter Hops and Boasting Barley come together to make one of the most sought after ales of the Craft Beer masses. Bottle Conditioned and Refermented.', 'http://www.voodoobrewery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5333, 1330, 3, 43, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'This is our Imperial Stout that we age in conditioning tanks with oak staves. This adds a classic character of old world aging with out the Bourbon tones. This black ale is about 12% alc. and very rich in roasted and chocolate malt tones. Velvety smooth and able tobe aged for years. For now this will be a Seasonal Beer Offering. All Beers to be bottle conditioned and Refermented.', 'http://www.voodoobrewery.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5334, 1330, -1, -1, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'Pilzilla is a beer that I''ve been brewing for years. Each year it gets bigger and bigger. Nicknamed "The beer that took over Tokyo". It is an unfiltered Keller Bier. Nicley hopped at this point with 9 different kinds of hops at 10 additions and about 6.75 % alc. Each year we will add another variety of hop and bump the alc a bit. This is listed on Beer Advocate as the highest rated Kellerbier in the world. Bottle Conditioned and Refermented. This is not your average pilsner, get it before we drink it all! Prost!!', 'http://www.voodoobrewery.com/', 6.75, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5335, 1330, 3, 38, '215 1/5 Arch St.', 'Meadville', 'Pennsylvania', 'United States', 'This is named after a song that sparked the idea to make this ale. Brown ales seem to be there, but not really there, do you know what I mean? Well that won''t be the mistake with Wynona! We Voodooed out this style and added more that''s what we say. Mildly hoppy and smooth with hints of chocolate and tons of brown malt to let you know it''s there. Currently 7.3% by vol. Bottle conditioned and Refermented. Get down with the brown, You''ll be Happy You Did!!', 'http://www.voodoobrewery.com/', 7.30, 0.00, 0.00, 0, '9999-01-01', '41.6372, -80.1549', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5336, 514, 8, 95, '1714 Camus Lane', 'Madison', 'Wisconsin', 'United States', 'Actually a Dortmunder/Export style', 'http://www.fauerbachbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0844, -89.4761', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5337, 508, 8, 95, '2109 Hickory Street', 'Cross Plains', 'Wisconsin', 'United States', 'German Style Lager', 'http://www.essersbest.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.1147, -89.6531', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5341, 402, 2, 25, '339 Fairground Rd', 'Millmont', 'Pennsylvania', 'United States', 'Our Porter has a deep dark color and a light creamy head. The aroma and flavor lingers of burnt grains and roasted coffe. We hope you enjoy this special brew.', 'http://www.ckbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8942, -77.1971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5342, 402, 11, 116, '339 Fairground Rd', 'Millmont', 'Pennsylvania', 'United States', 'A nice traditional cloudy wheat beer. It is light in color with a banana and yeasty fragrance. This would go nice on a hot summer day or anytime you want a refreshing drink.', 'http://www.ckbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8942, -77.1971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5343, 402, 5, 66, '339 Fairground Rd', 'Millmont', 'Pennsylvania', 'United States', 'This beer is medium dark in color but it has a light body and a smooth mouthfeel. Coriander and orange will surround your senses and keep you coming back for more.', 'http://www.ckbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.8942, -77.1971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5344, 402, 5, 60, '339 Fairground Rd', 'Millmont', 'Pennsylvania', 'United States', 'The Dubbel is a nice brown creamy sweet, malty and strong ale. It is a traditional Belgian dubbel ale with a secondary fermentation. This complex ale has many flavor characteristics. At 8% abv you will notice a slight alcohol warmth at the finish .', 'http://www.ckbrewery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.8942, -77.1971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5345, 409, 3, 31, '237 West Butler Avenue', 'Chalfont', 'Pennsylvania', 'United States', 'This extra hoppy ale is characteristic of the classic pale ales. Using the very flavorful Mount Hood and Liberty hops we have created classic IPA goodness every sailor knows.', 'http://www.crabbylarrys.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '40.2795, -75.2143', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5346, 409, -1, -1, '237 West Butler Avenue', 'Chalfont', 'Pennsylvania', 'United States', 'How about trying a glass of traditional Irish stout. Our stout however is not particularly dry and has overtones of dark chocolate and toffee. The infused nitrogen gives a wonderful cascading effect in the glass and a rich, creamy head. Particularly tasty when paired with our oysters on the half shell.', 'http://www.crabbylarrys.com/', 3.90, 0.00, 0.00, 0, '9999-01-01', '40.2795, -75.2143', '2018-10-05');
