INSERT INTO beerbuddies_db.beer VALUES (5348, 338, 3, 33, '7734 Terrace Avenue', 'Middleton', 'Wisconsin', 'United States', '', 'http://www.capital-brewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0949, -89.5163', '2018-10-05');
