INSERT INTO beerbuddies_db.beer VALUES (5351, 338, 3, 26, '7734 Terrace Avenue', 'Middleton', 'Wisconsin', 'United States', '', 'http://www.capital-brewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0949, -89.5163', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5352, 1250, 3, 38, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Every winter 300 hardy Telemark skiers converge at Mt. Bohemia and the Porcupine Mountains ski areas for three days of back country touring, lift served high speed runs, chili cook offs, and dancing and beer drinking to Finnish Reggae, Bluegrass, or whatever else comes out of the woodwork. Steve brews this hoppy American Brown Ale in honor of his good friends and ski buddies from all over the Midwest and Canada who attend. Rich, malty, and dry-hopped to perfection. Available December through March.', 'http://liverybrew.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5353, 1250, 3, 31, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'India Pale Ales, or IPAâ€™s, were brewed for British soldiers stationed in India. These ales needed to higher in alcohol and have more hops than normal to survive the long journey, and ours is no exception. Brewed with Belgian and German malts and dry hopped with loads of Cascades, our version honors our friend who had his own grueling journey involving a boat and cold water!', 'http://liverybrew.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5354, 1250, 3, 26, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Named after one of the longest running bicycle races in France and aptly nicknamed "The Hell Of The North", the Paris-Roubaix has been held every April since 1915. This Pale Ale is brewed with Belgian and German malts and bittered with 3 different American hops for a pleasing balance.', 'http://liverybrew.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5355, 1250, 11, 116, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'This dark version of our Hefe Weizen retains the banana and clove flavors from the yeast and also has a richer malt flavor. Available November through April', 'http://liverybrew.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5356, 1250, 3, 32, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'A single malt and single hop version of an American Brewers classic style. This is definitely our hoppiest beer and quickly becoming a hop head cult classic!', 'http://liverybrew.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5357, 474, 11, 126, '16 Church Street PO Box 684', 'Queenstown', '', 'New Zealand', 'An old fashioned style ginger beer brewed naturally with honey, malt, lemon and fresh root ginger, leaving you with a refreshing crisp zesty flavour.', 'http://www.thedux.co.nz/', 4.00, 0.00, 0.00, 0, '9999-01-01', '-45.0331, 168.661', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5358, 1250, -1, -1, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Brewed in the style of Northern England, this brown ale is dark and rich, with just a hint of chocolate malt and East Kent Golding hops in the finish.', 'http://liverybrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5360, 1250, 1, 2, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Named for mug club member and local jewelry maker, Angie Caldwell. English Maris Otter pale malt, English Crystal malt, and a blend of English and North American hops create this amber, hoppy IPA with just the right balance.', 'http://liverybrew.com/', 5.75, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5361, 1250, 3, 32, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Way up in the Keewenaw Peninsula in Michigans UP, Mt. Bohemia ski area has a powder run hidden at the top called "Cousin Jack" (named after the Cornish miners)that winds its'' way steeply through the rocks and trees. AAAHHH WINTER!!! Double the Belgian Malt, double the Amarillo hops-a perfect way to end any day. Everyones'' favorite cousin! Also available barrel aged.', 'http://liverybrew.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5362, 1250, 3, 32, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Way up in the Keewenaw Peninsula in Michigans UP, Mt. Bohemia ski area has a powder run hidden at the top called "Cousin Jack" (named after the Cornish miners)that winds its'' way steeply through the rocks and trees. AAAHHH WINTER!!! Double the Belgian Malt, double the Amarillo hops-a perfect way to end any day. Everyones'' favorite cousin!', 'http://liverybrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5363, 1250, 4, 50, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'A lightly hopped, refreshing, Bavarian style wheat ale that has hints of banana and clove in the finish. Available May until October.', 'http://liverybrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5364, 1250, 3, 33, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'This deep copper colored Ale is named after Steve''s homebrew buddy Thom Phillips, who has had a part in helping to formulate some of the final Ale recipes at the Livery. Hints of caramel make their way through the aromatic bitterness of Centennial hops.', 'http://liverybrew.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5365, 1250, -1, -1, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Named after a drawing of an old cedar tree growing out of a cliff on the Lake Superior shoreline done by friend and artist Ladislav Hanka, this beer is copper colored and hopped with American Centennial and English East Kent Golding hops.', 'http://liverybrew.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5366, 1250, 3, 33, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Named for our friend and patron Tad Eastman, whose Laughing Dragon Tie-Dye studio puts out our fabulous shirts-each one an individual work of art signed by Tad! Reddish Amber in color, this beer has a very bold Chinook hop character.', 'http://liverybrew.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5367, 1250, 1, 2, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'This India Pale Ale is brewed with English Maris Otter pale malt and Chocolate malt, giving it a dark color and is generously hopped with English Fuggles hops. Named for mug club member and brewery supporter Herb Caldwell.', 'http://liverybrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5368, 1250, 1, 2, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'This is a single malt-English pale, and single hop-English Fuggles, India Pale Ale with a rich golden color and spicy finish. Named for brewery supporters John and Cindy Bundick, with reference to John''s service on a submarine.', 'http://liverybrew.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5369, 1250, 1, 15, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Our version of a Scotch Ale is made with a portion of peat smoked barley. Very malty, with a subtle smoky finish. Also available in a barrel aged version.', 'http://liverybrew.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5370, 1250, 5, 74, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Maillot Jaune, or "Yellow Shirt", is named for the jersey of honor given to the leader of the Tour De France bicycle race held every July. American Lance Armstrong is the only person in history to wear the Maillot Jaune 7 times in a row! Golden in color and blessed with a kiss of hop bitterness, this ale is also available barrel aged. Steve swears that he does not use any performance enhancing drugs in the production of this beer!', 'http://liverybrew.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5371, 1250, 3, 31, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'A true North American IPA! All North American malts, Northwest Mt. Hood hops, and American Ale yeast all blend for a perfectly balanced bitter ale.', 'http://liverybrew.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5372, 1250, 5, 66, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Brewmaster Steve took his Belgian Amber Ale and re-fermented it in a merlot cask with 100# of sweet Michigan cherries from Husteds Farm Market. He than moved the resulting beer into another cask with 30# of tart cherries. 5 fermentations due to wild yeast and 9 months later, we have our version of a Belgian Kriek. Named after our good friend and musician, April Verch.', 'http://liverybrew.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5373, 753, 8, 95, '270 53', 'KruÅ¡ovice', '', 'Czech Republic', '', 'http://www.krusovice.cz/', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5374, 1142, 4, 50, '1075 East 20th Street', 'Chico', 'California', 'United States', '', 'http://www.sierranevada.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7246, -121.816', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5375, 259, 5, 66, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', '', 'http://www.brooklynbrewery.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5376, 1250, 1, 5, '190 5th Street', 'Benton Harbor', 'Michigan', 'United States', 'Extra Special Bitter, or ESB, were the benchmark beers for British brewers to serve to their special customers. Brewed with British pale and crystal malt, this reddish copper beer finishes with a subtle dose of English Fuggles hops.', 'http://liverybrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.1185, -86.4537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5377, 1023, 4, 50, 'Emil-Ott-Strasse 1-5', 'Kelheim', '', 'Germany', 'Schneider & Brooklyner Hopfen-Weisse is a collaboration between brewmasters Hans-Peter Drexler of the Schneider Weissbier Brewery and Garrett Oliver of the Brooklyn Brewery. Garrett and Hans-Peter have long admired each others beers. Now together they bring you a new sensation, a pale weissbock robustly dry-hopped with the Hallertauer Saphir variety grown in the fields near the Schneider brewery. Hoppy, zesty and supremely refreshing, Scheider & Brooklyner Hopfen-Weisse is a delicious blend of Bavarian craftsmanship and American ingenuity.', 'http://www.schneider-weisse.de', 8.20, 0.00, 0.00, 0, '9999-01-01', '48.9175, 11.8735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5378, 1168, 3, 33, '104 Mill St.', 'Fawn Grove', 'Pennsylvania', 'United States', 'This American style amber ale will be our opening release and house beer for SCBC. AmericAle is smooth and diverse all in one shot. With a medium malt body and fresh hop aroma we hope you enjoy drinking it as much as we do making it.', 'http://www.southcountybrewing.com/', 6.33, 0.00, 0.00, 0, '9999-01-01', '39.7323, -76.4496', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5379, 1168, -1, -1, '104 Mill St.', 'Fawn Grove', 'Pennsylvania', 'United States', 'Crisp and smooth. This beer is deep amber in color. Toasty, malty flavor. Full-bodied with a clean finish.', 'http://www.southcountybrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.7323, -76.4496', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5380, 1168, 2, 25, '104 Mill St.', 'Fawn Grove', 'Pennsylvania', 'United States', 'Our Brigantine Smoked Porter, much like the high seas, can be a wild ride. This beer is dark brown and full bodied with roasted tones and a hint of chocolate. As if that weren''t enough it finishes with a smoked flavor that seems right at home during cooler months here in Southern York County.', 'http://www.southcountybrewing.com/', 8.54, 0.00, 0.00, 0, '9999-01-01', '39.7323, -76.4496', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5381, 1182, -1, -1, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'Brewed to give the stout a smoother, almost slick, mouthfeel with a nice finish of coffee provided by Cumberland Coffee and Tea Company. Dark malts are used to give this beer a very complex roast flavor. Lower bittering rates ~30 IBUâ€™s helps put the flavor highlighting the maltiness, and roasted malt. ABV is coming in around 7% on this one!', 'http://www.springhousebeer.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5382, 836, 3, 31, '4405 Honoapiilani Highway #217', 'Lahaina, Maui', 'Hawaii', 'United States', 'India Pale Ale was developed in Burton, England, as a "Super-Premium" hoppy pale ale around 1800. The extra strength in alcohol and hops helped preserve the beer on its long export journeys to India and beyond. The style developed a following worldwide. Its flavor begins with a smooth, malty creaminess followed with a big burst of dry-hop flavor from English Kent Golding Hops. It then finishes with a lingering yet pleasant bitterness.', 'http://mauibrewingco.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '20.9721, -156.677', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5581, 633, 2, 25, '1938 Pacific Avenue', 'Tacoma', 'Washington', 'United States', 'Our brown porter is brewed with eight different malts to produce a smooth, well balanced, dark beer. A specially roasted barley provides a hint of chocolate. 5.6% ABV', 'http://harmon.harmonbrewingco.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '47.2436, -122.437', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5383, 836, 2, 25, '4405 Honoapiilani Highway #217', 'Lahaina, Maui', 'Hawaii', 'United States', 'Our Coconut Porter is a classic robust porter spiced with all natural toasted coconut. It is black in color and crowned with a creamy, dark tan head. It begins with a malty-toasted coconut aroma followed by a rich, silky feel with tastes of dark malt, chocolate, and hints of coffee. It then finishes with flavors of toasted coconut and hoppy spice to balance the finish.', 'http://mauibrewingco.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '20.9721, -156.677', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5384, 836, -1, -1, '4405 Honoapiilani Highway #217', 'Lahaina, Maui', 'Hawaii', 'United States', 'Our lightest beer, made from 100% malted barley. This blonde lager is what sailors really swam to shore for; it''s light, with very little bitterness and a slight malt finish.', 'http://mauibrewingco.com/', 3.80, 0.00, 0.00, 0, '9999-01-01', '20.9721, -156.677', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5385, 245, 7, 77, '', '', 'Ceske Budejovice', 'Czech Republic', 'Our Czech Premium Lager is beer for light beer lovers. The most gentle heads of the high quality Å½atec hop, virgin clear natural water and granules of selected species of Moravian barley make it the beverage of real experts. The 700-year long tradition in production of ÄŒeskÃ© BudÄ›jovice beer and the unique, 90-day period of maturity increase its unique character. You can taste Budweiser Budvar Czech Premium Lager with all your senses. First of all you will delight your eyes with its beautiful colour and rich dense foam, then you will feel the fine aroma of the hops, in your palm you will stroke the dewy glass and, in the end, you will taste the fine to medium strong bitterness. You will remember well, our perfect lager.', 'http://www.budvar.cz/', 5.00, 0.00, 0.00, 0, '9999-01-01', '48.9739, 14.475', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5386, 1253, 3, 33, '10983 Hills Road', 'Baroda', 'Michigan', 'United States', 'Our Amber Ale is a deep, copper ale with rich notes of caramel balanced with a hop finish, making it a great all-around beer that pairs well with roasted meats or a favorite sandwich. Round Barn beer is bottle conditioned, decant into a pint glass before drinking for the best taste experience.', 'http://www.roundbarnwinery.com/brewery.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9211, -86.4583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5387, 1253, 1, 20, '10983 Hills Road', 'Baroda', 'Michigan', 'United States', 'Our Cocoa Stout boasts a beautiful black body and tan head with notes of roasted barley, coffee, and bittersweet chocolate. Enjoy with dessert â€¹ especially good in a float with vanilla ice cream. Round Barn beer is bottle conditioned, decant into a pint glass before drinking for the best taste experience. Contains lactose (milk sugar).', 'http://www.roundbarnwinery.com/brewery.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9211, -86.4583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5388, 1253, -1, -1, '10983 Hills Road', 'Baroda', 'Michigan', 'United States', 'Our KÃ¶lsch style beer is a golden-blonde ale that is our version of Cologne''s native style. Soft, subtle maltiness and a clean finish make it a great thirst-quencher. KÃ¶lsch pairs well with spicy foods, or by itself. Enjoy with friends and in good health. Round Barn beer is bottle conditioned, decant into a pint glass before drinking for the best taste experience.', 'http://www.roundbarnwinery.com/brewery.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9211, -86.4583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5389, 1253, 11, 116, '10983 Hills Road', 'Baroda', 'Michigan', 'United States', 'An unpretentious American pale wheat beer, our Summer Wheat pours a cloudy golden-orange, just like a sunset over Lake Michigan. Its assertive wheat flavor is complimented with hints of citrus zest. Garnish with a slice of orange or lemon. Round Barn beer is bottle conditioned, decant into a weizen glass before drinking for the best taste experience.', 'http://www.roundbarnwinery.com/brewery.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9211, -86.4583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5390, 1253, -1, -1, '10983 Hills Road', 'Baroda', 'Michigan', 'United States', 'Our Winter Wheat is a rich, brown beer with hints of caramel and citrus creating a warming yet refreshing winter beer. Enjoy with Cajun or spicy cuisine. Round Barn beer is bottle conditioned, decant into a pint glass before drinking for the best taste experience.', 'http://www.roundbarnwinery.com/brewery.php', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9211, -86.4583', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5391, 459, 3, 31, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'Johnny Cask has entered the building! Weâ€™ve retrofitted a 15 barrel tank to perfectly produce a very special cask conditioned ale (so, we have a little time to play around during winters at the Delaware coast). This beer, known as Dogfish Head 75 Minute IPA is a blend of 60 and 90 Minute IPAs with a special whole leaf cascade dry-hopping session.', 'http://www.dogfish.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5392, 1148, 3, 31, '1300 Central Avenue', 'McKinleyville', 'California', 'United States', '', 'http://www.sixriversbrewery.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.9491, -124.102', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5393, 1304, 2, 25, '1722 South Fremont Drive (2375 West)', 'Salt Lake City', 'Utah', 'United States', 'King''s Peak Porter is deep mahogany in color and has a full-bodied malty flavor. Hints of chocolate malt are easily detectable. Topped with a tan creamy head, this beer has a definite hop character that nicely balances its mild bitterness. King''s Peak is the highest point in the state of Utah at 13,528 feet, located in northeastern Utah in the Uinta Mountains.', 'http://www.uintabrewing.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.7326, -111.954', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5394, 177, -1, -1, '121, rue de la Chapelle', 'St-Sylvestre-Cappel', '', 'France', '', 'http://www.brasserie-st-sylvestre.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '50.7975, 2.5412', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5395, 63, 3, 26, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'Back Road Brewery''s flagship beer, and first original recipe of 1997, is also our house beer. This mildly hopped copper colored brew has a rich smooth taste. Hop varieties such as Styrian Goldings and English Fuggles are used to balance the beers maltiness. A technique called dry hopping is used after fermentation to add fresh herbal aroma. It is a great session beer and was made to satisfy a wide variety of palates. Drink and enjoy LaPorte County''s first production craft beer.', 'http://www.backroadbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5396, 63, 3, 42, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'A notorious drink that''s as dark as its'' namesakes history!! It is named after the infamous LaPorte, Indiana serial killer herself, Belle Gunness of 1908. This Irish-style dry stout is amazingly smooth to drink. You will taste chocolate, coffee and roasty flavors in every sip. Don''t be afraid of the dark. A true dark beer lover would die to try it. It definitely would not kill you to dig some up.', 'http://www.backroadbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5397, 63, 3, 26, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'If you are looking for a straight shooting quaffable beer with plenty of hops, this is it. Straw colored from plump North American 2-row malted barley and deliciously hopped with Cascades from the USA, any patriot can enjoy this beer. Cascade hops have a pleasant taste and fresh smell best described as florally or mildly citrusy. A nice balance is struck between the malt and hops. So how about it Yank? Put that capitalism to work and buy some today!', 'http://www.backroadbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5445, 469, 1, 20, '4519 W. Pine Street', 'Farmville', 'North Carolina', 'United States', 'The Duck-Rabbit Milk Stout is a traditional full-bodied stout brewed with lactose (milk sugar). The subtle sweetness imparted by the lactose balances the sharpness of the highly roasted grains which give this delicious beer its black color.', 'http://www.duckrabbitbrewery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '35.6003, -77.5971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5398, 63, 3, 31, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'It means India Pale Ale. It''s all about the hops on this one. Brewers use hops to add bitterness and aroma to their beers. If not for hops your beer would be too sweet. Our IPA uses plenty of Chinook and Columbus hops from the Pacific Northwest. The flavor can best be described as strong resiny grapefruit. The long drawn out hop flavor is essential to the character of the beer. So smack your buds on this one all you HOP HEADS.', 'http://www.backroadbrewery.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5399, 63, 7, 77, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'A classic pilsner.', 'http://www.backroadbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5400, 63, 7, 84, '310 Perry Street', 'LaPorte', 'Indiana', 'United States', 'No, there is no maple flavor here, just a great beer with a good name. LaPorte, Indiana is known as the "Maple City" because of its trees. This German style Oktoberfest lager beer has a golden copper color and intense malty flavor. We make this beer 4 times a year, but it is hard to find because it goes so fast. Give it a try and you may find it worthy of the gold.... or at least another round', 'http://www.backroadbrewery.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '41.6124, -86.7268', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5401, 763, 7, 77, '117 South First Street', 'LaConner', 'Washington', 'United States', '', 'http://www.insidelaconner.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '48.3917, -122.495', '2018-10-05');
