INSERT INTO beerbuddies_db.beer VALUES (5406, 426, 3, 31, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'Inspired by West Coast I.P.A.''s, but brewed with Michigan style. The Crooked Tree is heavily dry hopped to give it a big aroma of pine and citrus. The flavors are big, yet very balanced between fresh hops and malt. Often described as "grapefruit" our hops give this beer an excellent fruit flavor that finishes dry, crisp, and clean. It will pour a nice deep copper color with a bit of haziness. Because of our almost patented "Intense Transfer Methods" our Crooked Tree has won several medals in the India Pale Ale category.', 'http://www.darkhorsebrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5407, 487, 1, 21, '17605 Monterey Road', 'Morgan Hill', 'California', 'United States', '', 'http://www.eltorobrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.1553, -121.676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5408, 783, 3, 31, '939 Getchell Street', 'Helena', 'Montana', 'United States', 'A GOLD MEDAL WINNER at the Great American Beer Festival, beating out 98 other IPA''s and chosen as the best IPA in the country! It''s amber color and incredible hoppy aroma will keep you coming back for more. R-U-HOPPY?', 'http://lewisandclarkbrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '46.5977, -112.037', '2018-10-05');
