INSERT INTO beerbuddies_db.beer VALUES (5422, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Beer Description: This deep amber Imperial Abbey Ale melds malt and earth, spice and fruit to create a wonderful vehicle to wind down the day. Belgian yeast contributes flavor notes that accent the raisins and grains of paradise used in the brewing process. With strength and stamina, DESCENT is deliberately impetuous in its mission.', 'http://www.midnightsunbrewing.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5423, 858, 5, 67, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'This Belgian witbier begins with equal parts malted wheat and pale barley to create its traditional cloudy white appearance. The addition of Brettanomyces gives ANCHOR its trademark "green apple" or "horse blanket" aroma and lends tartness to the flavor and finish. At over 6% ABV, this ANCHOR''s got a bit of more kick than most wits.', 'http://www.midnightsunbrewing.com/', 6.25, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5424, 1136, 3, 32, '86 Newbury Street', 'Portland', 'Maine', 'United States', 'XXXX IPA is a non-traditional American IPA with a brilliant copper color and the classic citrus nose of Cascade hops. This beer demonstrates a unique balance of malt-inspired, delicate red grapefruit sweetness and lingering hop dryness. The OG and final ABV provide the structure and body to balance the harmony of distinct flavours. Cascade, Warrior, Summit and Glacier Hops are used for bittering and Cascade Hops are added for dry hopping after fermentation. This hop blend is well balanced with Malted Wheat, Pale Ale, Crystal, and Caramalt Malts. To fully enjoy all the flavours, this ale is best drunk at 55 degrees Fahrenheit. This beer pairs well with Cajun dishes, blackened fish, and BBQ. XXXX draws its name from the British brewing convention of using Xâ€™s to denote style. 70 BUâ€™s, 1.092 OG, 9.25% ABV.', 'http://www.shipyard.com/', 9.25, 0.00, 0.00, 0, '9999-01-01', '43.6619, -70.2489', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5444, 469, 2, 25, '4519 W. Pine Street', 'Farmville', 'North Carolina', 'United States', 'The Duck-Rabbit Porter is very dark in color. This robust porter features a pronounced flavor of roasted grains reminiscent of dark chocolate. Also, Paul and Brandon add oats to the grist to give a subtle round silkiness to the mouthfeel. Weâ€™re confident that youâ€™re really going to love this yummy porter!', 'http://www.duckrabbitbrewery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '35.6003, -77.5971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5425, 634, 11, 126, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'Winter Warmer was Harpoonâ€™s first seasonal beer. It was designed to be enjoyed during the holiday season. When you bring a glass of this dark copper ale to your lips to take your first sip you will notice the aroma of cinnamon. There is no aromatic hop added that might overpower the distinct spice scent. The medium body of this beer is formed from caramel and pale malts. These create enough body to support the spices without making the beer excessively rich. Bittering hops are added to counter the sweetness of the malt and spice. The finish of the beer is a blend of cinnamon and nutmeg. The combination of these two spices results in a balanced, pumpkin-pie flavor. The overall character is a smooth, medium bodied ale spiced with cinnamon and nutmeg', 'http://www.harpoonbrewery.com', 5.90, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5426, 1173, -1, -1, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'A Jahva-Choklat hybrid.', 'http://www.southerntierbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5427, 524, 3, 26, '1400 Ramada Drive', 'Paso Robles', 'California', 'United States', 'One of the most award-winning American style pale ales in the country. This is the American beer style that started a revolution in taste. Weâ€™ve taken the classic British pale ale and elevated it with a wonderful dose of northwest American hops. A crisp floral hop aroma precedes a medium-bodied clean finishing ale.', 'http://www.firestonewalker.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '35.5953, -120.694', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5428, 524, 3, 31, '1400 Ramada Drive', 'Paso Robles', 'California', 'United States', 'The newest member of the Firestone family, Union Jack is the aggressive IPA that youâ€™ve been searching for. Citrus, pineapple, and a full chewy malt profile finish clean on your palate. Over 70 IBUs and 7.5% alcohol by volume, Union Jack wonâ€™t have any problem competing with the big India Pale Ales. A beer true to its origins; deeply hopped and bolstered for a long voyage.', 'http://www.firestonewalker.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '35.5953, -120.694', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5429, 604, 5, 72, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'The Roman name for the Low Countriesâ€“is a marriage of the best in American and Belgian brewing traditions. Belgian pilsner malt, a generous amount of American and European hops and a unique Belgian yeast strain combine to give Belgica big notes of citrus and spice, creating a lively concoction perfect for spring in the Rockiesâ€“or the Ardennes.', 'http://www.greatdivide.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5430, 604, -1, -1, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Think of it as a hefeweizenâ€™s older brother. A hearty mix of wheat and dark German barley malts gives it a medium body and muddy brown hue, while our proprietary yeast strain provides the signature notes of banana and clove. If you like wheat beers, come to the Dunkel side. You wonâ€™t be disappointed. Just donâ€™t put any lemon in it.', 'http://www.greatdivide.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5431, 604, 5, 74, '2201 Arapahoe Street', 'Denver', 'Colorado', 'United States', 'Our homage to the beers that have quenched the thirst of Belgian farm workers for centuries. Brewed with barley, wheat and rice and fermented at high temperatures with a special blend of four different yeast strains, Saison is fruity and slightly tart, with a dry finish that makes it that rarest of treatsâ€“a beer as refreshing as it is complex.', 'http://www.greatdivide.com/', 7.30, 0.00, 0.00, 0, '9999-01-01', '39.7539, -104.989', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5432, 10, 3, 26, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Restoration Pale Ale was created after the back-to-back hurricanes devastated Louisiana. With your help, the abita Brewing Company raised over $500,000 for hurricane relief. This brilliant, golden pale ale has a rich body, mild bitterness and a snappy, fresh citrus hop flavor and aroma. Cold filtered and brewed in small batches using no additives or preservatives, the Abita Company is proud to be Louisiana True.', 'http://www.abita.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5433, 1182, 3, 33, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'We welcome the latest release Atomic Raygun Imperial Red! Brewed with Pilsner, Chocolate and Caramel malts but well balanced with Columbus and Centennial Hops and coming in at 90 IBU''s. The Octane level on this one is coming in at 8.3!', 'http://www.springhousebeer.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5434, 304, 5, 72, 'Lindenlaan 25', 'Ertvelde', 'Oost-Vlaanderen', 'Belgium', 'Sweet with some tropical flavors, some banana, a hint of clove.', '', 10.50, 0.00, 0.00, 0, '9999-01-01', '51.1766, 3.7462', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5435, 160, 3, 38, '2880 Wilderness Place', 'Boulder', 'Colorado', 'United States', 'Flashback Anniversary Ale is an India-Brown Ale with 6.8% ABV. This is the first beer weâ€™ve made here that uses one single hop variety (Cascade) in the recipe in five separate additions. The fresh Cascade hop aroma and flavor is perfectly balanced with the dark roasted grains, making Flashback a very unique beer. Weâ€™re calling it an India Brown Ale to help illustrate its flavor to the consumer. Itâ€™s hoppy like an IPA but dark and roasty like a Brown Ale. Put them together and voila! Flashback at its finest!', 'http://boulderbeer.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '40.0267, -105.248', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5436, 549, 11, 121, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', '', 'http://www.foundersbrewing.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5437, 549, 3, 32, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', '', 'http://www.foundersbrewing.com/', 9.40, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5438, 954, 3, 26, '1301 Atlanta Avenue', 'Orlando', 'Florida', 'United States', '', 'http://www.orlandobrewing.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '28.5265, -81.3827', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5439, 1150, 1, 20, '545 Turner Drive', 'Durango', 'Colorado', 'United States', 'This traditional English Cream Stout is brewed with actual milk sugar to create a creamy and sweet brew. Jet black in color, the latte frothy head will make you mooo for more.', 'http://www.skabrewing.com/', 5.40, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5440, 886, 8, 95, '89 Main Street West', 'Saint John', 'New Brunswick', 'Canada', '', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '45.2567, -66.096', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5441, 160, 3, 32, '2880 Wilderness Place', 'Boulder', 'Colorado', 'United States', '', 'http://boulderbeer.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.0267, -105.248', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5442, 469, 3, 33, '4519 W. Pine Street', 'Farmville', 'North Carolina', 'United States', 'Duck-Rabbit Amber Ale is a medium bodied beer with a lovely tawny copper or bronze color. This brew emphasizes malt complexity with layered caramel malt flavors. We put a lot of effort into getting this amber ale just right and we''re extremely proud of the result!', 'http://www.duckrabbitbrewery.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '35.6003, -77.5971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5443, 469, 3, 38, '4519 W. Pine Street', 'Farmville', 'North Carolina', 'United States', 'The Duck-Rabbit Brown Ale is an American brown ale brewed with loads of hops from start to finish (itâ€™s hoppy and beautifully bitter). Amarillo hops in the boil provide a spicy citrusy bitterness. Saaz dry hops in the fermentor provide a refined flowery aroma. These hops are supported by a grain bill of seven varieties of malt. Oh yeah!', 'http://www.duckrabbitbrewery.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '35.6003, -77.5971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5446, 1173, 3, 35, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Long ago, British farmhouse brewers made special ales using the first runnings of the mash. These beers, now called barley wine, are brewed in the tradition of days past. At Southern Tier this long awaited brew is placed on the back burner until the start of the new year. Back Burner Barley Wine is a celebration of things to come and things remembered. Itâ€™s conceived in three small batches, using voluminous amounts of barley and hops. The process starts early in the morning and ends late into the night. We hope this rare brew reignites your spirit for another trip around the sun.', 'http://www.southerntierbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5447, 1173, 11, 116, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'It is through the movement of the universe that life presents itself in transformation. It is in this spirit that we make ÃœberSun, a tribute to the dynamic energy of summer. The alignment of wheat and barley through this hop-infused brew embodies the solar system itself... This may be a difficult task, but one our brewers revel in! They brew a galaxy of taste into every batch. ÃœberSun is the ultimate experience that will challenge you with each sip. ÃœberSun Imperial Summer Wheat Beer takes off where our Hop Sun finishes. Like itâ€™s little brother, ÃœberSun is clean and full of flavor, but donâ€™t pull an Icarusâ€“ this is one big beer! Pour a glass or drink straight from the bottle, itâ€™s meant to be consumed wisely with friends between summer solstice and autumnal equniox.', 'http://www.southerntierbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5448, 1173, 11, 116, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Pour 422 Pale Wheat Ale into a pint glass, give it a long whiff and youâ€™ll realize that this isnâ€™t your average pale golden wheat. Preserved in its unfiltered state, 422 is a fantastic session ale in which flavors of wheat, barley and hops commingle to a refreshing and zesty conclusion. Hints of orange and sweet malts waft to the fore as a touch of bitterness contributes to a smooth finish. 422 is brewed as a tribute to preserving our precious planet and itâ€™s environment. It is responsibly packaged with over 80% recycled consumer products and is completely recyclable. Enjoy 422 all year as to take one stride closer to a eco-friendly life.', 'http://www.southerntierbrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5449, 587, 5, 65, '3804 S.W 30th Ave', 'Fort Lauderdale', 'Florida', 'United States', '', 'http://holymackerelbeers.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '26.0745, -80.1806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5450, 587, 3, 30, '3804 S.W 30th Ave', 'Fort Lauderdale', 'Florida', 'United States', '', 'http://holymackerelbeers.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '26.0745, -80.1806', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5451, 391, 11, 121, '209 Lakeside Avenue', 'Coeur d''Alene', 'Idaho', 'United States', '', 'http://www.cdabrewing.com/', 3.50, 0.00, 0.00, 0, '9999-01-01', '47.6745, -116.784', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5452, 1125, 11, 116, '26 Front Street', 'Bangor', 'Maine', 'United States', 'Sea Dog Raspberry Wheat Ale is a dry, crisp refreshing ale with the added essence of raspberries.', 'http://www.seadogbrewing.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '44.7974, -68.77', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5453, 812, 11, 121, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'This beer truly defies style. A portion of the fermentable sugars that make up this beer come from beet sugar. Real beet extract is used which gives the beer a beautiful light red color. Itâ€™s body is inviting and the taste is smooth. Hops are barely perceivable and are there to balance out the sweetness from the malt.', 'http://www.magichat.net/', 4.50, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5454, 259, 3, 43, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'Brooklyn Black Ops does not exist. However, if it did exist, it would be a robust stout concocted by the Brooklyn brewing team under cover of secrecy and hidden from everyone else at the brewery. Supposedly â€œBlack opsâ€ was aged for four months in bourbon barrels, bottled flat, and re-fermented with Champagne yeast, creating big chocolate and coffee flavors with a rich underpinning of vanilla-like oat notes. They say there are only 1,000 cases. We have no idea what theyâ€™re talking about.', 'http://www.brooklynbrewery.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5455, 563, 1, 5, 'Chiswick Lane South', 'London', 'London', 'United Kingdom', 'ESB was launched into the Fuller''s family in 1971, as a winter brew to replace a beer named Old Burton Extra. The potential of the beer was soon realised and ESB was installed as a permanent fixture, creating an immediate impact. Not only was it one of the strongest regularly brewed draught beers in the country (at 5.5% ABV), it was also one of the tastiest, and as the awareness of the beer grew, so did its popularity. ESB''s reputation was soon enhanced after being named CAMRA''s (Campaign for Real Ale) Beer of the Year in 1978, and the beer has not stopped winning since! With three CAMRA Beer of the Year awards, two World Champion Beer awards, and numerous other gold medals to speak of, ESB is, quite simply, the Champion Ale.', 'http://www.fullers.co.uk/', 4.50, 0.00, 0.00, 0, '9999-01-01', '51.4877, -0.2498', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5456, 1092, 7, 84, '2100 Locust Street', 'Saint Louis', 'Missouri', 'United States', 'A malty, full-bodied, deep reddish-amber lager. Traditionally brewed in March for the Oktoberfest in the fall, this style is also known as MÃ¤rzen. Also available in bottles.', 'http://www.schlafly.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '38.633, -90.21', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5457, 1193, 8, 95, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'A dry, crisp refreshing filtered lager. A good balance between sweet malt and light bitter hops. This beer is made with a Southern German lager yeast, Saaz, and Hershbrucker hops.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5458, 1193, 3, 31, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'This unfiltered ale retains a medium maltiness and body and features a flowery hop perfume and pleasant bitterness.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5459, 1193, 3, 32, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'An unfiltered ale with intense hop bitterness, flavor and aroma. This ale is well balanced with higher alcohol, maltiness and hop character. (95 IBU.)', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5460, 1193, 3, 33, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'A light copper-colored ale with moderate hoppiness which exhibits a spicy hint of fruit, notable maltiness and a medium body.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5461, 1193, 4, 50, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'This unfiltered wheat ale has very low bitterness. A Bavarian hefeweizen yeast is used which imparts a banana and clove aroma.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5462, 1193, 5, 74, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'A Belgian "seasonal" ale brewed during winter for the spring and summer months. This is a crisp, refreshing beer with hints of spice and fruit.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5463, 1193, 3, 42, '101 Oak Street', 'Ashland', 'Oregon', 'United States', 'With its dark-roasted coffee aroma, espresso and chocolate flavor, this stout has flaked oats which create a velvety body and a dry finish.', 'http://www.standingstonebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1976, -122.715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5464, 123, 3, 31, '4133 University Way NE', 'Seattle', 'Washington', 'United States', 'Building on a classic English style and adding some uniquely Northwest touches, Bhagwan''s Best has developed fiercely loyal following wherever it is served. Bursting with local hop flavor, bitterness, and aroma, it is a particular treat when served dry-hopped and cask-conditioned on Big Time''s beer engine. O.G. 16 Plato (1.064), alcohol is approximately 5% by weight.', 'http://www.bigtimebrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '47.6576, -122.313', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5465, 1058, 3, 37, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'Great summer memories are born out of uncomplicated times. We''ve made that the basis for our summer blonde recipe and kept this ale pure and simple. Relax and enjoy this all natural, light, golden beauty; a seasonal offering from the River Horse Brewing Company.', 'http://www.riverhorse.com', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5466, 1058, 8, 95, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'We mill the choicest two row barley malt in our 100 year old mill room for this all natural, unfiltered Lager. Lightly hopped, fermented slowly. River Horse Lager gets plenty of quality time with us before we pass it on to you.', 'http://www.riverhorse.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5467, 1058, 3, 26, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'Brewing the perfect ale is truly a balancing act...hazardous work you might say. With Hop Hazard our challenge was to hand craft a malt rich base that could counterbalance a combustible five-hop blend and still leave your taste buds with enough room to enjoy a unique, crisp hop finish.', 'http://www.riverhorse.com', 5.50, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5468, 1058, 3, 29, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'As the days grow shorter and frost becomes snow, our Belgian Freeze winter ale is the perfect remedy to loosen the spirits. This deep amber tonic is brewed with lots of roasted caramel malt for body and warmth to bring in the holidays and see you through the spring.', 'http://www.riverhorse.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5469, 1058, 5, 61, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'Notice a unique aromatic nose with a hint of vanilla esters, which comes from the Belgian ale yeast. Tripel Horse has a big body and rich mouth feel and finishes mostly dry with only a touch of sweetness. If you shy from some of the sweeter Belgian ales, we think you will enjoy this one. The palate improves with age, so keep some on hand and you can ride Tripel Horse down a new path with each opened bottle.', 'http://www.riverhorse.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5470, 1058, 1, 5, '80 LAMBERT LANE', 'Lambertville', 'New Jersey', 'United States', 'It''s been with us from the start and hasn''t changed since that first brew way back in 1996. Ample quantities of caramel malt give this English ale a soft copper hue and the colorful addition of carapils malt adds a slight sweetness you might mistake for honey.', 'http://www.riverhorse.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '40.3688, -74.9477', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5471, 1246, 5, 67, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Orchard White is an unfiltered, bottle conditioned Belgian-style witbier. This hazy, straw yellow beer is spiced with coriander, citrus peel and lavender added to the boil and whirlpool. A spicy, fruity yeast strain is used to add complexity, and rolled oats are added for a silky texture.', 'http://www.thebruery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5472, 1246, -1, -1, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Black Orchard is an unfiltered, bottle conditioned Belgian-style black wheat beer, or â€œblack witâ€, if you will. This dark but surprisingly light bodied beer is very drinkable while still having character and complexity. Chamomile is added for its floral aroma, while the coriander and citrus peel give the characteristics of a traditional witbier.', 'http://www.thebruery.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5473, 1246, 5, 74, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Saison Rue is an unfiltered, bottle conditioned, Belgian/French-style farmhouse ale. This is a beer of subtlety and complexity, with malted rye, spicy, fruity yeast notes, biscuit-like malt backbone, and a slight citrus hop character. With age, this beer will dry out and will become more complex with rustic notes of leather and earth from the contribution of a wild yeast strain. Being a Saison, Saison Rue is ambiguous unto itself as it is a different beer when fresh and when aged. We hope you enjoy it in all of its incarnations.', 'http://www.thebruery.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5474, 1246, 5, 74, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Our Spring Saison is light blonde in color with a fresh hoppiness and a wild and rustic Brettanomyces character. Lighter in color and alcohol than our Saison Rue, yet equally complex in its own way. Perfect for warmer weather and Spring celebrations.', 'http://www.thebruery.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5475, 1246, 5, 61, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Our Summer seasonal, Trade Winds Tripel is a Belgian-style Golden Ale with a Southeast Asian twist. Instead of using candi sugar (typical for such a beer), we use rice in the mash to lighten the body and increase the gravity, and spice with Thai Basil. The result is an aromatic, digestible and complex beer made for a lazy summer evening.', 'http://www.thebruery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5476, 1246, 11, 123, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Brewed with 17 lbs. of yams per barrel (in other words, a lot of yams!), this autumn seasonal is a different take on the â€œpumpkinâ€ beer style. Brewed with cinnamon, nutmeg, allspice, vanilla, molasses, and maple syrup, and fermented with our traditional Belgian yeast strain, this bold and spicy beer is perfect on a cold autumn evening.', 'http://www.thebruery.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5477, 1246, 5, 62, '715 Dunn Way', 'Placentia', 'California', 'United States', 'Our holiday beer is a Belgian-style Dark Strong Ale, brewed with our brewery-made dark candi sugar, Munich and Vienna malts. Dark brown in color, fruity and complex with a rich malt backbone. This is a simple yet immensely complex beer meant to be savored and shared with friends and family.', 'http://www.thebruery.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5494, 1170, 11, 116, '40 Bowden Square', 'Southampton', 'New York', 'United States', 'What do brewmasters do in their free time? If you''re Phil Markowski, the obsesseive brewmaster of Southampton, you brew at home, of course! Phil turned his fascination with Belgian-style white ales into a quest to master one of the most challenging beers to brew. Using rustic ingredients like un-malted wheat, Phil experimented over his stove until he felt it was perfect. Take one taste and you''ll agree, Phil got it "white.";"0', 'http://southamptonbrewery.com', 6.60, 0.00, 0.00, 0, '9999-01-01', '40.8903, -72.3927', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5582, 150, 3, 26, '404 South Figueroa Street #418', 'Los Angeles', 'California', 'United States', 'Light amber color and a mild malty background. Well-hopped featuring Cascade hops with a distinct floral finish.', 'http://www.bonaventurebrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '34.0532, -118.256', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5478, 1286, 1, 21, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Every beer tells a story, and some are longer than others. Consider Scratch #19; originally designed as an enhanced take on Scratch #15 with a slightly higher ABV, our brewers went to town to deliver a brew slightly more akin to our fabled Scratch #5, the Imperial Oatmeal Stout brewed for The Flying Mouflan Experience. For Scratch #19, we teamed up with St. Thomas Roasters of Linglestown to create a special blend of espresso beans. They added Kenyan beans to the mix because of a strong citrus flavor that compliments the hops. Creating en environment akin a French press, the beans are combined with whole flower hops in the hopback, and the hot wort passes through the vessel on the way to fermentation giving Scratch #19 a lush coffee espresso nose and hints of coffee flavor. There is a silky quality to the mouthfeel and a citrus hop finsh coming from the Kenyan beans and hops. Some stories have twists, and unfortunately a faulty valve in the fermentation cellar led to a dramatic beer tragedy one afternoon in the brewery. Risking life and limb (while keeping his mouth open to sample the beer), a heroic brewery team member took the dive reconnecting the valve and saving about half the batch of Scratch #19. So for your amusement (and our final relief), we give you a draft-only release of a third-take on a style that demands continued research for the Troegs Brewery staff. Enjoy!', 'http://www.troegs.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5479, 405, 3, 33, '307 Oliphant Lane', 'Middletown', 'Rhode Island', 'United States', 'The first offering from the Coastal Extreme Brewing Company blends some of the world''s finest ingredients into a delightful beer. In producing our amber ale, we selected the highest quality European and American malts and hops. This ale has a malt character which is delicately balanced with its hop profile so that consumers of all levels enjoy drinking it. Hurricane Amber Ale is a full flavored beer which clearly has more taste than other domestic and imported light beers while at the same time does not overpower the drinker with heavy body or excessive bitterness. So find yourself a cold ''Hurricane'' and ENJOY!', 'http://www.newportstorm.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '41.537, -71.2796', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5480, 844, 2, 25, '2 Penhall Road', 'Greenwich', 'London', 'United Kingdom', 'Whilst we wouldnâ€™t recommend having this at breakfast with your bacon and eggs, our Coffee Beer is made with real coffee and has a caffeine hit to match. The natural flavours of the beans selected and hand roasted by our friends at the Union Coffee Roasters go well with the roast barley in the beer to give a silky-smooth drink with distinct chocolate and vanilla notes. Our first formulation of this beer was the first UK brewed beer to carry the Fairtrade logo, and, although we have reformulated it to create an even better blend of malt and roast coffee flavours, we can no longer get enough coffee in each bottle to qualify for Fairtrade status. However we are still using the same Faitrade Araba Bourbon beans from Rwandaâ€™s Abuhuzamugambi Bakawa Co-operative. At the Meantime Brewing Co we love flavour, so it wasnâ€™t exactly difficult for us to see how the scents and aromas of coffee and barley would create a perfect match like just like mint and lamb, toffee and banana, peaches and cream, peanut butter and jam. Serve lightly chilled with as many chocolate truffles as your conscience allows. Each serving is equal to one cup of coffee', 'http://www.meantimebrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '51.4899, 0.038', '2018-10-05');
