INSERT INTO beerbuddies_db.beer VALUES (5485, 594, 3, 26, '430 Old Jackson Highway', 'Victor', 'Idaho', 'United States', 'ur Old Faithful Ale is a Pale Golden Ale with a crisp body and light malt sweetness. We cold condition this ale to give it a pleasantly smooth character and dry palate. The Willamette and imported UK Goldings hops give this beer a light floral hop aroma, making it exceptionally easy to drink.', 'http://www.grandtetonbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.5984, -111.108', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5486, 349, 3, 31, '110 Barley Park Lane', 'Mooresville', 'North Carolina', 'United States', 'This brew is a favorite for those who love hops! This medium copper-colored ale is dry hopped for a strong hop nose with medium malt overtones and hint of caramel that blend for one great tasting beer!', 'http://www.carolinabeer.com/', 5.90, 0.00, 0.00, 0, '9999-01-01', '35.6231, -80.8011', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5487, 325, 8, 95, '98 Horseneck Rd', 'Westport', 'Massachusetts', 'United States', 'Our Lager (Dortmund-style) is brewed with pale, Munich and Vienna malts and is moderately hopped with Hallertauer hops. Dortmund is an industrial, steel-making town and its lagers are hearty, easy drinking brewskies. The hops balance the malt but not overtly so. A great brew for the end of a hard day at work. Winner of the Gold Medal for Best European Style Pilsner at the 2000 Great American Beer Festival , Gold Medal at the 5th and 6th Great International Beer Festival, Silver Medals at the 7th Great International Beer Festival and 9th Great International Beer Festival, and Bronze Medal at the 8th Great International Beer Festival and 11th Great International Beer Festival!', 'http://www.buzzardsbrew.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '41.5713, -71.0571', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5488, 1127, 3, 31, '1814 Second Street', 'Santa Fe', 'New Mexico', 'United States', '', 'http://www.secondstreetbrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '35.6631, -105.966', '2018-10-05');
