INSERT INTO beerbuddies_db.beer VALUES (5490, 1137, 3, 32, '', 'San Francisco', 'California', 'United States', 'Ladies and Gentlemen, Shmaltz Brewing Co. is proud to introduce Bittersweet Lenny''s R.I.P.A. Brewed with an obscene amount of malts and hops. Shocking flavors - far beyond contemporary community standards. We cooked up the straight dope for the growing minions of our nation''s Radical Beer junkies. Judges may not be able to define "Radical Beer," but you''ll damn well know it when you taste it. Bruce died, officially declared a pauper by the State of California, personally broken and financially bankrupt simply for challenging America''s moral hypocrisies with words. The memorial playbill read: "Yes, we killed him. Because he picked on the wrong god." -Directed by, the Courts, the Cops, the Church... and his own self-destructive super ego. Like Noah lying naked and loaded in his tent after the apocalyptic deluge: a witness, a patron saint, a father of what was to come. Sick, Dirty, Prophetic Lenny: a scapegoat, a martyr, a supreme inspiration.', 'http://www.shmaltz.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '37.7749, -122.419', '2018-10-05');
