INSERT INTO beerbuddies_db.beer VALUES (5495, 47, 1, 13, '103 West Michigan Avenue', 'Battle Creek', 'Michigan', 'United States', 'Somewhat of a cousin to Barleywine, Big Dickâ€™s is a classic English-style Olde Ale. Sweet and full-bodied malt flavors are complemented by a fragrant but mild hop bitterness. Sweet, bready malt aromas combine with rich flavors of dark fruit, brown sugar, caramel, and sweet nuts. A beer for keeping, Big Dickâ€™s Olde Ale will age gracefully, while fruity flavors continue to develop and bitterness will subside. This is not only a BIG beer, it is a Well-Endowed Ale! We took a traditional English-style Ale and made it our own. Delightful on its own or as a digestif with a full-bodied cigar, Big Dickâ€™s is also big enough to stand up to many boldly-flavored foods.', 'http://www.arcadiaales.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '42.322, -85.1851', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5496, 1336, 3, 32, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'This hophead''s delight contains 7 hop additions. A malt background balances the hoppy bitterness for a complex flavor.', 'http://walldorffbrewpub.com/', 7.45, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5497, 1336, 3, 37, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'An easy drinking ale that goes well with our food offerings. Also a great introduction to the world of craft brewing.', 'http://walldorffbrewpub.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5498, 344, -1, -1, 'Vesterflledvej 100', 'Kbenhavn', '', 'Denmark', 'Original Dark Lager is brewed according to J.C. Jacobsen''s original recipe. The colour is chestnut. It has a Hersbrucker hiop aroma while the floor malted Munich malt adds a caramel character. The carbonisation is gentle and the hop bitterness is soft. Enjoy at 6-8C.', '', 5.80, 0.00, 0.00, 0, '9999-01-01', '55.6667, 12.5393', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5499, 1336, 1, 21, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'A dark rich full-bodied stout with a dense creamy head. Full of character and very satisfying.', 'http://walldorffbrewpub.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5500, 1336, 11, 119, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'A smooth golden ale flavored with Pilsner malt and fresh local honey from Schaefer Shack Farms.', 'http://walldorffbrewpub.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5501, 1336, 3, 33, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'A clean crisp ale with a beautiful reddish caramel color and a superb balance of hops and malts.', 'http://walldorffbrewpub.com/', 4.85, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5502, 1336, 3, 26, '105 East State Street', 'Hastings', 'Michigan', 'United States', 'A mild pleasant ale with lingering hoppy notes.', 'http://walldorffbrewpub.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.6488, -85.2875', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5503, 1297, 2, 25, '3201 Walnut Street Ste A', 'Boulder', 'Colorado', 'United States', 'A Baltic Porter made to celebrate Boulder''s 150th anniversary. Available for the entirety of 2009.', 'http://www.twistedpinebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.0201, -105.251', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5504, 1297, -1, -1, '3201 Walnut Street Ste A', 'Boulder', 'Colorado', 'United States', 'A favorite of many coffee-loving beer drinkers, Big Shot Espresso Stout boasts about a shot of espresso in every pint. Twisted Pine teamed up with popular Amante Coffee in Boulder to produce what Amante co-owner and founder Greg Buchheister calls "the most perfectly balanced buzz." The earthy, dark chocolate flavors of the Amante Espresso blend to the flawless balance of the beer.', 'http://www.twistedpinebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.0201, -105.251', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5505, 1232, 3, 33, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'Why put everything in a category? Live outside the box. The â€˜flagshipâ€™ of TailGate Beer, Amber Wave, is a completely unique and individual beer that raises the standards and breaks all the molds. Amber Wave was inspired by America''s amber waves of grain and is as unique as apple pie. The intellectuals behind TailGate Beer created this dark, rose colored ale that drinks like honey and lingers of light caramel, with notes of chocolate and sweet subtle hops. Surprise yourself, and others, with your sophisticated palate and acute ability to find the best beer brewed for drinking, not sampling.', 'http://www.tailgatebeer.com/indexmain.php', 6.20, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5506, 1232, 3, 38, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'This is your solution to the same ol'' ho hum brown ale you drink all the time. This ale might be dark and intimidating in a glass, yet the first sip proves to be a surprisingly refreshing assault on your taste buds. Complex blends of chocolate and roasted oats complement the essence of bittering hops, and sweet malts. The balanced combination makes this full flavored ale one to be enjoyed in any occasion.', 'http://www.tailgatebeer.com/indexmain.php', 5.90, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5507, 1232, 3, 31, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'This is what beer is all about. First swallow offers a nice little bite, followed by a blossom of flavors delivered by our handpicked aromatic hops. Flavor carries through the end with a full fisted kick of alcohol content that rocks the Richter scale at 6.5%. A nose of citrus with a floral essence of spice tickles the tongue in this ode to hops. Discover an IPA that encourages how to enjoy what beer is all about.', 'http://www.tailgatebeer.com/indexmain.php', 6.50, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5508, 1232, 1, 20, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'Bronze medal award winner - Sweet Stout Category â€“ California State Fair 2008 Commercial Craft Brew Competition Donâ€™t be afraid of the dark. This Sweet Stout is a surprisingly charming, and yet extremely robust ale that spills a soothing bouquet of caramel, chocolate and lightly roasted oats. As a truly unique foray into the world of stout ales, this sweet stout drinks so light you might be surprised at how apt you are to enjoy the darkest of TailGate Beerâ€™s. The flavors are so rich and smooth that this TGB Sweet Stout can cool you on the hottest of days and warm you in the worst that winter can bring. Here is heaven in a bottle. If it weren''t so wrong, this is what you wish mom could have given you in your baby bottle. Treat yourself right and enjoy an experience that is the best dessert to pass through your lips since mom last made her best fruit pie for you.', 'http://www.tailgatebeer.com/indexmain.php', 6.60, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5509, 1232, 8, 96, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'Why settle for a watered down version of delicious barley and hops when the TailGate Beer Light will make you a convert to the world of light ales. Eat hardy, and enjoy a light beer with serious flavor, lower calories and the most serious attention to the powers that flavor beer. A nose of citrus and spice with a tongue of vanilla are just a few of the very unique flavors to grace your senses in this Light Ale. This is the light beer lovers of beer have been waiting for. This is not a watered down version of a good idea.', 'http://www.tailgatebeer.com/indexmain.php', 4.70, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5562, 585, 2, 25, '1800 North Clybourn Avenue', 'Chicago', 'Illinois', 'United States', 'We begin with a custom mixture of dark and roasted barley malts, then we add the choicest hops. The resulting ale has a dark chestnut color and a deep nutty flavor. Brewed specially for Trader Joe''s.', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.9137, -87.6543', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5563, 460, 7, 77, 'Steigerstrae 20', 'Dortmund', 'Nordrhein-Westfalen', 'Germany', '', '', 4.80, 0.00, 0.00, 0, '9999-01-01', '51.5298, 7.4692', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5510, 1232, 4, 50, '6648 Reservoir Ln', 'San Diego', 'California', 'United States', 'TailGate Beer does the German style wheat beer right. Hints of citrus, complemented by sprinkles of spice that makes a German, full flavored brew that is really hard to say right. Proud of the names â€˜weizenâ€™ (wheat) base ingredient, TGB draws most of its flavor from the famed grass plant. This Hef is one truly crisp, and refreshing unfiltered ale that garnishes well with a lemon or an orange! Be sure to impress your friends with your fine tuned palate and sophisticated verbiage next time you belly up to order your TailGate Beer â€œHEH-feh-vite-zehnâ€', 'http://www.tailgatebeer.com/indexmain.php', 5.00, 0.00, 0.00, 0, '9999-01-01', '32.7732, -117.055', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5511, 563, 1, 13, 'Chiswick Lane South', 'London', 'London', 'United Kingdom', 'I have crafted this very special ale from the finest Challenger and Northdown hops, Maris Otter malted barley, and of course, our unique yeast, to create a truly extraordinary limited edition brew. Individually packed and numbered, this bottle is one of only one hundred and forty-five thousand produced.', 'http://www.fullers.co.uk/', 8.50, 0.00, 0.00, 0, '9999-01-01', '51.4877, -0.2498', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5512, 1186, 1, 3, '63 Trevarthian Road', 'St. Austell', 'Cornwall', 'United Kingdom', 'A Supreme Champion Ale of Cornwall as voted by CAMRA*, and the South West''s Favourite cask beer**, Tribute is a popular favourite with locals and visitors to Cornwall, as well as being a much sought after guest ale throughout the rest of the UK. It is brewed using specially grown Cornish Gold Malt and is a perfect accompaniment to chicken, gammon or fish. The ideal alternative to a fine white wine.', 'http://www.staustellbrewery.co.uk/', 4.20, 0.00, 0.00, 0, '9999-01-01', '50.3416, -4.7883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5513, 1186, 1, 2, '63 Trevarthian Road', 'St. Austell', 'Cornwall', 'United Kingdom', 'Proper Job is an authentic IPA brewed with Cornish spring water and malt made from a blend of malts including Cornish grown Maris Otter barley.', 'http://www.staustellbrewery.co.uk/', 5.50, 0.00, 0.00, 0, '9999-01-01', '50.3416, -4.7883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5514, 1186, 1, 3, '63 Trevarthian Road', 'St. Austell', 'Cornwall', 'United Kingdom', 'St Austellâ€™s most legendary ale, HSD is fullbodied strong and Cornish, brimming with a kaleidoscope of flavours. Brewed with plenty of malt and lashings of English Fuggles and Golding hops, HSD is truly a classic ale of considerable depth and complexity. The real ale alternative to a well rounded premium red wine and simply superb with steaks and other red meat dishes.', 'http://www.staustellbrewery.co.uk/', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.3416, -4.7883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5515, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Country of origin: India Beer type: Lager Alcohol content by volume: < 7.5% by volume Carbohydrates: - Taste: full bodied malty flavour Malts: Indian malts, 6 row barley Hops: German hop extract (CO2) & Indian hop palate Colour: Golden yellow Availability: India - all seasons, South East Asia, Middle East and Europ Fermentation process: Bottom-fermented Serving temperature: 7 - 9 Â°C Packaging: 650 ml and 330 ml Indian standard glass amber bottle ; 500 ml Non returnable bottles ; 500 ml cans and 330 ml cans ( in select markets) http://www.sabmiller.in/brands_haywards_5000.html', 'http://www.sabmiller.in/', 7.50, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5516, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Peroni its unique taste which is refreshing and dry, with a clear-cut, clean character and clarity, achieved through the exclusive brewing process. This ensures that the beer has both a fresh and natural quality. Positioned as â€˜Italian style in a bottleâ€™, from presentation to pouring the brand, Peroni has struck a chord with modern urbanites looking for cosmopolitan class. http://www.sabmiller.in/brands_peroni.html', 'http://www.sabmiller.in/', 5.10, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5518, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Haywards Black, Indiaâ€™s first genuine stout beer , is handcrafted from a rich blend of the world famous Caledon valley dark roasted barley malt along with a blend of imported and locally produced pale malts. New Zealandâ€™s super alpha hops give Haywards Black a unique and pleasantly bitter taste with a hop like aroma. The Dark Roasted malt provides a rich dark colouring along with a unique smoky taste and aroma. The Slow brewing process which incorporates specially managed yeast creates the creamy head and the rich smooth taste that stout is so much loved for. http://www.sabmiller.in/brands_haywards_black.html', 'http://www.sabmiller.in/', 8.00, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5519, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Foster''sÂ® Lager is a uniquely Australian beer, brewed with the finest sun-dried malted barley, the purest water, and Foster''sÂ® own specially bred ''Pride of Ringwood'' hops imported directly from Australia to give the beer an authentic flavor. Foster''sÂ® Lager Beer has always been at the forefront of brewing technology and the Foster''sÂ® Lager brewed today is the result of over a century of attention of the brewing art. Quality has been the strength of Foster''sÂ® since its earliest days and remains a paramount concern at every stage of the beer''s journey from brewery to consumer. Foster''sÂ® crisp, clean flavour won it immediate international acclaim when it was first brewed in Melbourne in 1888. Today, more than one hundred years later, it is still recognized as one of the world''s best beers.', 'http://www.sabmiller.in/', 4.90, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5521, 1089, -1, -1, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'BEER TYPE Indus Pride is a 100% malt beer PRODUCT PROPOSITION Made of 100% malt lending it a unique rich flavor ALCOHOL CONTENT BY VOLUME 4.8% by volume TASTE Rich in flavors with a clean head and foam COLOUR Sunrise Yellow SERVING TEMPERATURE 7 degree Celsius PACKAGING 650 ml glass bottles : 12 bottles per case 330 ml pack : 24 bottles per case http://www.sabmiller.in/induspride.html', 'http://www.sabmiller.in/', 4.80, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5522, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Royal Challenge Premium Lager is the second largest selling mild beer in India. Royal Challenge is brewed with the choicest 6 malt barley. Its long brew duration provides it with a distinct, smooth taste and rich flavour. It has all the hall marks of a great beer - Color that is golden honey, taste that is smooth and crisp, lace that sticks to the wall of the glass. Royal Challenge Premium Lager is the beer for the discerning who have the confidence to make their choices based on their superior taste and knowledge rather than follow the crowd. http://www.sabmiller.in/brands_royal-challenge.html', 'http://www.sabmiller.in/', 5.00, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5523, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Country of origin: India Beer type: Lager Alcohol content by volume: < 8 % by volume Carbohydrates: - Taste: Smooth and strong with a rich malty taste Malts: Indian malts, 6 row barley Hops: Hops extract from Germany and Indian hops palate Colour: Golden yellow Availability: India Fermentation process: Bottom-fermented Serving temperature: 7 - 9 Â°C Packaging: 650 ml, 330 ml Indian standard glass bottle ; 500 ml cans and 330 ml cans,( in select markets) http://www.sabmiller.in/brands_knock-out.html', 'http://www.sabmiller.in/', 8.00, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5524, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Haywards 2000 H2K is India''s only beer with an ABV of 5.5%, whilst the rest of the beers are either less than 5% or greater than 7.5% - 8% Taste: Rich, smooth and crisp taste Malts: Indian malts, 6 row barley Hops: Hop extract from Germany and Indian hops palate Colour: Gold Availability: Parts of India Fermentation process: Bottom-fermented Serving temperature: 7 - 9 Â°C Packaging: 650 ml and 330 ml glass bottle and 330 ml cans http://www.sabmiller.in/brands_haywards_2000.html', 'http://www.sabmiller.in/', 7.50, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5525, 351, 3, 33, '1022 Main Ave.', 'Durango', 'Colorado', 'United States', 'A well balanced American Amber Ale. Smooth malt character balanced with a healthy dose of Cascade hops aged on oak chips - our most popular beer.', 'http://www.carverbrewing.com/_/home.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.2748, -107.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5526, 351, 8, 95, '1022 Main Ave.', 'Durango', 'Colorado', 'United States', 'A light bodied golden ale, low in hop character with a spicy aroma from whole Czech Saaz hops.', 'http://www.carverbrewing.com/_/home.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.2748, -107.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5527, 351, 1, 21, '1022 Main Ave.', 'Durango', 'Colorado', 'United States', 'One of these beers is available all of the time. Our heartiest beers emphasize roasted malts and the generous use of hops. Creamy, smooth and always nitrogenated, these beers are nearly a meal or a dessert in themselves.', 'http://www.carverbrewing.com/_/home.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.2748, -107.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5528, 351, 3, 38, '1022 Main Ave.', 'Durango', 'Colorado', 'United States', 'The slightly roasted flavor and nutty palate with a hint of hops make this beer subtle and drinkable.', 'http://www.carverbrewing.com/_/home.htm', 0.00, 0.00, 0.00, 0, '9999-01-01', '37.2748, -107.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5529, 1224, 2, 25, '195 Ottley Drive', 'Atlanta', 'Georgia', 'United States', 'This is a classic American Porter, poured on tap it has a good head that stays and leaves a nice lace. It is defined by its chocolate malt, medium body, and smooth mouthfeel. Balanced by the Golding and Columbus hops on the finish is a hint of bitterness. Donâ€™t be afraid of the dark.', 'http://www.sweetwaterbrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '33.8087, -84.3813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5530, 1108, 3, 26, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'Anything but a typical American Pale, Santa Fe Pale Ale is as full bodied as its most robust English counterparts, while asserting its American origin with a healthy nose resplendent with Cascade and Willamette hops. It finishes with a well-balanced combination of the subtle, almost Pilsner-like maltiness accentuated by the German yeast used to brew this Santa Fe classic, and a hop bite sufficient to leave a lingering smile on the face of any fan of American Pale Ales.', 'http://www.santafebrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5531, 1108, 11, 116, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'A true Bavarian wheat yeast, sixty percent wheat malt, and German hops make Santa Fe Wheat Beer as true to the style as any American rendition can be. German Wheat Beer, with its hints of banana and clove, its delectable, spicy, hops, and its pale golden color, is becoming increasingly popular in Americaâ€™s craft brewing world, and with good reason: wheat beers are both light enough to please light beer drinkers, and complex enough to please true micro-brew connoisseurs. To mimic a classic German Hefeweisen, after pouring your Santa Fe Wheat Beer into a glass, swirl the last few drops in the bottle to loosen the yeast from the bottom, then pour the yeast over the top of your beer.', 'http://www.santafebrewing.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5532, 1108, 3, 38, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'The Brown Ale style originated in the pubs of England, where beer drinkers desired a beer that was both flavorful and complex, but at the same time mild enough to be a session beer. The Santa Fe Brewing Company''s interpretation of this style uses a combination of high mash temperature, hard water, and low-alpha acid hops to produce a product that is both true to the style and distinctly Santa Fe. Brewing jargon aside, Santa Fe Nut Brown Ale is an easy-drinking beer, mild, smooth, and always a favorite. Try a keg at your next party!', 'http://www.santafebrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5533, 1108, 2, 25, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'A trademark beer of the Santa Fe Brewing Companyâ€™s master brewer, Ty Levis, the State Pen Porter has every reason to be one of his favorites. It is flavorful, swimming with notes of nuts and chocolate; it is drinkable, so drinkable that it is almost as if pint after pint were drinking itself.', 'http://www.santafebrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5534, 1108, -1, -1, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'A hearty sip of the Santa Fe Stout delights oneâ€™s taste buds first with a generous Irish serving of roast malt that rolls off the tongue with a creamy bitterness reminiscent of the finest coffee. Supported by the complex, yet light body only possible with a good Irish yeast strain, this coffee-like creaminess eventually yields to the warmth of a subtle variety of hops, and their mild, full flavor. A favorite with regular customers, this rare brew can occasionally be found on draft at restaurants in Santa Fe, but is more likely on tap at the Brewery''s tasting room. Despite its intimidating dark color, this brew has an uncanny ability to convert those who claim not to like beer. The balance of flavors and complexity of aroma are recognized and appreciated by all who taste this fine brew.', 'http://www.santafebrewing.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5535, 1108, 3, 35, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'Chicken Killer Barley Wine is the revolutionary beer that will someday define America''s unique Barley Wine style. It is brewed with twice the ingredients of the Santa Fe Brewing Company''s other beers, and only half the usual amount of liquid is extracted from these ingredients. This makes one substantial beer. At over ten percent alcohol, Chicken Killer is actually as substantial as wine, but this is not to say that it is difficult to drink. On the contrary; be careful with this one. The flavors of the beer are at first as overwhelming as the intense Santa Fe sun. But in the same way our sun gives us the unrivaled brilliant colors of Santa Fe, the potency of Chicken Killer gives us the remarkable spectrum of flavors that can be found in no other beer, in no other city. If you did not have the opportunity to try last year''s vintage, come try this year''s!', 'http://www.santafebrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5536, 1108, 3, 31, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'A classic beer for those beer lovers who love their hops, Fiesta IPA will take the Pepsi Challenge (or IPA challenge, as we say in New Mexico) against any other pretenders to the throne. Was it divine providence that made this beer the king of the IPA world? Was it a tireless pursuit of glory? No, this IPA has a top-secret recipe to thank for its success, and this meticulously formulated combination of several different hops combined with a very specific brewing process give Fiesta IPA a spicy, citric, and floral infusion of hop character, which is masterfully counterbalanced with the full-bodied maltiness characteristic of the Santa Fe Brewing Companyâ€™s distinctive beers.', 'http://www.santafebrewing.com/', 6.30, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5537, 1108, 7, 77, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'As its name suggests, this Pilsner does not like to be categorized. Inquiring whether it is a German, Czech, Bavarian, American, or any other style pilsner will result in an impatient sigh and the explanation that the whole philosophy behind this pilsner is that it does not fall into any categories. True, it is brewed with traditional ingredients (soft water, pilsner malt, saaz hops, and German yeast), but it is the way that these ingredients interact, and the characteristics of the yeast, that cause this particular pilsner to defiantly stand alone. The assertively hopped Freestyle pils exudes the flavor and the aroma of the classic Saaz hop (a tribute to â€œthe originalâ€ pilsner), while maintaining enough body to balance but not overpower this hopâ€™s pleasant, spicy tone. An unhurried lagering process so frequently overlooked by American craft brewers is strictly adhered to in the production of Freestyle, which makes this beer by far the most light, clean, and quenching beer in the Santa Fe Brewing Companyâ€™s line up.', 'http://www.santafebrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5538, 1108, 5, 60, '35 Fire Place', 'Santa Fe', 'New Mexico', 'United States', 'Viszolay is a distinctly continental ale with a hint of the southwest. Belgian malt, Bavarian and Czech hops, and a secret blend of German and Belgian yeast strains provide this beer, inspired by the Trappistâ€™s Dubbel style ale, with a strong traditional base, while a hint of New Mexico wildflower honey infuses it with that ethereal quality that we New Mexicans simply call, â€œenchantingâ€. Like the Trappist ales from which it sprung, Viszolay is light and refreshing. The hopâ€™s subtle notes are overpowered by complex fruity flavors derived from the Belgian yeast, leaving Viszolay a very drinkable (yet rather potent) addition to the Santa Fe Brewing Companyâ€™s family of beers.', 'http://www.santafebrewing.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '35.5966, -106.052', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5539, 1202, 7, 84, 'KendlerstraÃŸe 1', 'Salzburg', '', 'Austria', 'This wonderfully refreshing beer specialty from Stiegl, Austriaâ€™s largest privately owned brewery is brewed in strict adherence with the 1516 purity law of only using water, malt and hops. Stiegl-GoldbrÃ¤u is an Austrian styled beer with its own distinctive Salzburg lager flavor. The 12o original gravity is unparalleled in its even taste and ability to refresh. It is mildly hopped is golden in color has a great head with a superb finish. Stiegl-GoldbrÃ¤u is considered by many connoisseurs to be the worldâ€™s finest beer.', 'http://www.stieglbrauerei.at/', 4.90, 0.00, 0.00, 0, '9999-01-01', '47.8005, 13.0444', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5540, 1202, -1, -1, 'KendlerstraÃŸe 1', 'Salzburg', '', 'Austria', 'Stiegl Weizengold. It has 12o original gravity; the choicest ingredients and a top fermentation process are responsible for the highest possible quality and an unmistakable flavor. It is brewed according to the classic wheat beer recipe: 60 % wheat malt and 40 % barley malt, top fermentation and in compliance with the Purity Law of 1516. This dark wheat beer specialty is a natural and spicy beer brand.', 'http://www.stieglbrauerei.at/', 0.00, 0.00, 0.00, 0, '9999-01-01', '47.8005, 13.0444', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5541, 1202, 8, 96, 'KendlerstraÃŸe 1', 'Salzburg', '', 'Austria', 'This is a light beer with a full taste and a third less alcohol so therefore 30% less calories. It is ideal for beer lovers who prefer light beers but do not want to renounce the taste.', 'http://www.stieglbrauerei.at/', 3.30, 0.00, 0.00, 0, '9999-01-01', '47.8005, 13.0444', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5542, 1202, -1, -1, 'KendlerstraÃŸe 1', 'Salzburg', '', 'Austria', 'Paracelsus Zwickl is a natural beer specialty with a mellow impression on the tongue. The aftertaste unfolds a slight bitterness. Zwickl-beer is not filtered and therefore shows some cloudiness due to rests of yeast, minerals and trace elements. This very special beer is brewing at its best using a sophisticated recipe combined with love and dedication. Stiegl only uses excellent ingredients from Austrian agricultural suppliers, applying biological techniques. As a result of this Paracelsus Zwickl beer was awarded the Bio-Austria certificate. Bio-production is subject to strict yearly controls by â€œAustria-Bio-Guarantyâ€. â€œBier is a really divine medicineâ€. This quotation comes from Paracelsus (1493 â€“ 1541). He was a well known physician, forward thinker and visionary who lived in Salzburg for many years. He found out that beer had healing powers.', 'http://www.stieglbrauerei.at/', 5.00, 0.00, 0.00, 0, '9999-01-01', '47.8005, 13.0444', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5543, 958, -1, -1, 'Ottakringerstrasse 91', 'Wien', '', 'Austria', '', 'http://www.ottakringer.at/', 5.10, 0.00, 0.00, 0, '9999-01-01', '48.2133, 16.3229', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5544, 49, 3, 42, 'St. James''s Gate', 'Dublin', '', 'Ireland', 'To mark the 250 year anniversary of the signing of the lease on St. Jame''s Gate Brewery by Arthur Guinness, we introduce a special commemorative stout. This premium recipe provides a refreshing taste, which underlies the complex flavor of stout.', 'http://www.guinness.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '53.3433, -6.2846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5545, 858, 7, 77, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Reid is our onsite go-to beer guy who handles the bulk of our to-go beer sales. Reid is a full-time UAA student who manages to sell beer at MSBC, run a side welding business, keep the golf discs flying all year-round & create music with his band, Bushwood. He wrote and performed his song "No 9 to 5", which resonates his idea of a fairway to heaven. FAHRWASSER means "fair water" or "fairway". This inspired pilsner breaks par with every sip. Availability: AK - draft and 22-oz bottles (limited release begins 05/15/2009)', 'http://www.midnightsunbrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5546, 858, 11, 121, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'SPECIAL COMMEMORATIVE BEER Former brewer Ken Pajak teamed up with MSBC to create a very special beer to celebrate the 10 years that he and wife Shauna have owned CafÃ© Amsterdam. Since taking over this mid-town establishment, the Pajaks added a â€œbeer & wine licenseâ€ and subsequently transformed the European-style cafÃ© into a beer-centric place to grab breakfast, lunch, dinner and all beers during, around and between these fabulous meals. The cafe''s beer menu is extensive and all-encompassing. The staff is knowledgeable and enthusiastic. And the beer pour is always rightâ€” temperature, glass, presentation. â€œNo hops were harmed in the brewing of this beer.â€ Gruit is an old styleâ€”one that incorporates spices, herbs and fruit but no hops. The latter detail makes this style very rare in modern times. CafÃ© Amsterdamâ€™s Gruit is dark, strong and interesting. This combination of pale and dark malts, sage, thyme, cinnamon, black peppercorn and fresh orange peel composes distinctive, substantial flavors that meld together wonderfully. And at 12% ABV, this cellar-friendly ale is ready to lay you down! Thoroughly enjoy this old-world beer now but stash some away for later dwelvings. Availability: AK - 22-oz bottles (limited release begins 05/29/2009)', 'http://www.midnightsunbrewing.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5547, 1318, 8, 95, '1763 South 300 West', 'Salt Lake City', 'Utah', 'United States', 'A turn of the century pure malt, crisp lager. 1st Amendment Lager is made with European style hops and Munich malts. This beer has a wonderful, clean, crisp flavor certain to please all.', 'http://www.utahbeers.com/', 4.00, 0.00, 0.00, 0, '9999-01-01', '40.7322, -111.9', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5548, 911, 1, 1, '', '', '', 'New Zealand', '', 'http://www.steinlager.co.nz/', 4.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5549, 398, 3, 26, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Old Slugger" is a hearty Pale Ale, copper in color, crisp malty fullness on the front of the palate and lingering hop bitterness on the back with a dry finish. It is brewed with four barley malts, including two-row English pale and crystal malts, balanced with Mt. Hood, Cascade and Fuggle hops, and fermented in open vessels by Ringwood Yeast, a true top-fermenting ale yeast. "Old Slugger" is the flagship beer of the Cooperstown Brewing Company and was first brewed in July 1995 and bottled in November 1995.', 'http://www.cooperstownbrewing.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5550, 398, 3, 37, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Nine Man" is a golden ale, brewed from English pale and crystal malts, and with torrified wheat. It is bittered with Cascade and Cluster hops and finished with Cascade hops. "Nine Man Ale" was first brewed as a summer seasonal beer in 1996. It was kegged the first season but not bottled until the opening of the baseball season in April 1997.', 'http://www.cooperstownbrewing.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5551, 398, 2, 25, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Benchwarmer" is a very smooth Porter brewed in accordance with the original "high gravity" porters of early London. More than 4% chocolate malt, which is the most similar to the brown malts of the early 1700â€™s, gives "Benchwarmer" its dry coffee-like finish. It is fermented with the Ringwood yeast which is an excellent yeast for the brewing of porters. The widely accepted theory of how porter got its name is that it was a very popular beer among the porters who hauled produce and goods around the marketplace of early industrialized London.', 'http://www.cooperstownbrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5552, 398, 3, 42, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Strike Out" is brewed with 6 malts including a balanced portion of chocolate and crystal malts. It is also brewed with 5% flaked oats for a velvet-like mouth feel. English pale, Munich and black malt, plus roasted barley round out the malt bill. Considerably lower in alcohol than both Benchwarmer Porter and Old Slugger Pale Ale, "Strike Out" is a well-rounded stout, opaque black in color with a roasted palate.', 'http://www.cooperstownbrewing.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5553, 398, 1, 2, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Back Yard" is a golden India Pale Ale. Historically, ale shipped to India in the 19th Century was brewed to higher gravities so that it could mature during the long sea voyage. English brewers also hopped these ales heavily to protect them from spoiling. The term "India pale Ale" or "I.P.A." is still used by brewers to denote a super-premium, hoppy pale ale style. Backyard IPA is no exception. English pale barley malt is predominant in this beer with just a small amount of crystal malt. It is well bittered with Cluster and Cascade hops and finished with a mix of local hop and larger amounts of Fuggle hop.', 'http://www.cooperstownbrewing.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5554, 398, -1, -1, 'River Street, P.O. Box 276', 'Milford', 'New York', 'United States', '"Pride of Milford" is a very special ale with a tapestry of complex flavors and aromas. It is brewed with five malts and fermented with the Ringwood yeast at a higher temperature which gives this beer a uniqueness all its own. "Pride" has a distinctive reddish copper color. It is strong and rich beer. When "Pride" was first brewed in December 1999, many thought the flavor and aromas of this beer had fruit overtones. No fruit or adjunct flavoring is added to this beer. The unique flavor comes from our special brewing process.', 'http://www.cooperstownbrewing.com/', 7.70, 0.00, 0.00, 0, '9999-01-01', '42.5893, -74.9403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5555, 1260, 3, 32, '9750 Indiana Parkway', 'Munster', 'Indiana', 'United States', '', 'http://www.threefloydspub.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '41.5354, -87.5158', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5556, 1332, 3, 30, '175 State Road East', 'Westminster', 'Massachusetts', 'United States', 'A BIG PALE ALE with an awsome balance of Belgian malts with Fuggles and East Kent Golding hops.', 'http://www.wachusettbrew.com', 7.30, 0.00, 0.00, 0, '9999-01-01', '42.5586, -71.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5557, 1173, 3, 43, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'When empirical and creative impulses collide, the result is often timeless. The classic utility-art aesthetic of the coffee maker is an example of design and engineering working in concert. It is through similar cooperation that the simple bitter cocoa bean is transformed into a sweet treat. As scientists, our brewers utilize their materials to exacting standards. As artists, they couldnâ€™t resist the temptation to combine two of our highly acclaimed Blackwater Series Imperial Stouts: Jahva and Choklat. Alone each is perfect, but together as Mokah they are an inimitable expression of two of the worldâ€™s most sought after flavors. Enjoy Mokah stout with â€“ or as â€“ your favorite dessert! 11.0% abv â€¢ 27Âº plato â€¢ Imperial Stout Brewed with Coffee & Chocolate â€¢ 22 oz / 1/6 keg 2-row pale malt â€¢ 2-row barley â€¢ caramel, chocolate & black malts â€¢ roasted barley barley flakes â€¢ Jamaican roasted coffee â€¢ bittersweet Belgian chocolate â€¢ chinook, willamette, cascade & columbus hops', 'http://www.southerntierbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5558, 68, 3, 31, '5401 Linda Vista Road #406', 'San Diego', 'California', 'United States', 'The Sculpin IPA is a testament to our humble beginnings as Home Brew Mart. Founded in 1992, the Mart continues to be a catalyst for the San Diego brewing scene, setting the trend for handcrafted ales. Inspired by our customers, employees and brewers, the Sculpin IPA is bright with aromas of apricot, peach, mango and lemon. Its lighter body also brings out the crispness of the hops. This delicious Ballast Point Ale took a Bronze Medal at the 2007 Great American Beer Festival in the Pro Am category. The Sculpin fish has poisonous spikes on its fins that can give a strong sting. Ironically, the meat from a Sculpin is considered some of the most tasty. Something that has a sting but tastes great, sounds like a Ballast Point India Pale Ale.', 'http://www.ballastpoint.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '32.7668, -117.195', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5559, 1301, 11, 119, '1025 Owen Street', 'Lake Mills', 'Wisconsin', 'United States', '', 'http://www.tyranena.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '43.0862, -88.8967', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5560, 605, 4, 55, '2516 Market Avenue', 'Cleveland', 'Ohio', 'United States', '', 'http://www.greatlakesbrewing.com', 8.00, 0.00, 0.00, 0, '9999-01-01', '41.4844, -81.7042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5561, 974, 3, 38, '33180 Cape Kiwanda Drive', 'Pacific City', 'Oregon', 'United States', 'Our American Brown Ale has a dark brown color, with a balanced aroma of roasted malts and Northwest-grown hops. The sweetness of the ale and crystal malts blend beautifully with the assertive flavors of Cascade and Mt. Hood hops. A brew to be savored. This beer originated as a prize-winning homebrew many years ago. When Darron, the Head Brewer, began designing the beers for the Pelican Pub and Brewery, he adapted his old 5 gallon homebrew recipe to his new 15 bbl (465 gallon) brewery. It was well worth the effort, for not only has the Doryman''s Dark Ale been a perennial favorite here at the Pelican Pub, but it has garnered prestigious professional awards.', 'http://www.pelicanbrewery.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '45.2152, -123.97', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5564, 874, -1, -1, '', 'Utica', 'New York', 'United States', 'A-It''s got a nice dark tan texture to it. The description on the bottle says it all. S-It''s got a coffee like smell to it. It smells pretty good. T- It tastes a tad like Bass with a hint of coffee to it. At least to me it had a coffee taste. It''s got a nice even taste. It''s not too strong and not too weak. It''s a happy medium. M-It feels good when swallowing. It leaves a mild aftertaste but it''s a good aftertaste. D-Well I drank the whole jug w/ no problem and enjoyed myself so that spoke for itself. Overall, I recommend this beer. If you find it, it''s worth having. It goes well when watching a movie too. Serving type: bottle', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.687, -73.708', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5565, 10, 5, 67, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Real Louisiana Satsumas, golden wheat, oats and the finest barley create Abita Satsuma Harvest Wit. Pale and cloudy, like the haze on a hot summer day, this white beer has a sweet and subtle citrus flavor with a touch of spice that is cool and refreshing. Abita Satsuma Harvest Wit is very versatile and can compliment a number of dishes. This brew pairs well with salads, fish, shrimp and lobster, as long as the dishes are not too spicy. Thai dishes, which often have citric notes in their flavor profile, would also perfectly compliment the orange flavors in Abita Satsuma Harvest Wit.', 'http://www.abita.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5566, 863, 8, 96, '3939 W. Highland Blvd', 'Milwaukee', 'Wisconsin', 'United States', '', 'http://www.millerbrewing.com', 2.80, 0.00, 0.00, 0, '9999-01-01', '43.0445, -87.9626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5567, 1282, 3, 31, '1446 Garden of the Gods', 'Colorado Springs', 'Colorado', 'United States', '', 'http://trinitybrew.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.8967, -104.855', '2018-10-05');
