INSERT INTO beerbuddies_db.beer VALUES (5569, 94, 3, 33, '345 Healdsburg Avenue', 'Healdsburg', 'California', 'United States', 'The brew of choice for mountain bikers, and adventurous types worldwide. (Are you excited now!) This fiery red ale is not for the weak at heart. It originally started out as a Scottish red ale but has taken on flavors of its own. This is a very complex recipe using five different grains to achieve its unique flavor. The caramel malt used is a mixture of Belgian Caravienne and Hugh Bairds Crystal malts. Red Rocket is a full bodied, hoppy brew which finishes on the pallet with caramel malts. Centennial and Cascade hops are used for bittering and aroma.2004 L.A. Commercial Brewing Competition, Gold Medal Winner; 2004 West Coast Commercial Brewers Competition, First Place; 2003 California State Fair, Gold MedalWinner; 2002 California State Fair, Silver Medal Winner; 2001 California State Fair Gold Medal Winner; 2001 Real Ale Festival, Chicago, Bronze Medal Winner; 2000 California State Fair, Bronze Medal Winner; 1999 Great American Beer Festival, Silver Medal Winner; 1998 Great American Beer Festival, Silver Medal Winner - og 1.067, ABV 6.8%, IBU 65+.', 'http://www.bearrepublic.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '38.6112, -122.871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5570, 1286, 3, 32, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #20 has been dubbed Apollo Imperial Ale because of our experimentation with a new hop variety. Apollo hops are high alpha acid with an intense aroma. Married with other high alpha hops, with almost two pounds of hops added per barrel produced, AIA has an intense staying power in the back of the throat. After a long discussion between Chris, John and the brewers, they dubbed this hop flavor stinky grapefruit with a hint of perfume. The dark color might lead you to believe the some malt may shine through; but no, the hops are the true player in this ale. Scratch #20 has a dual role, also serving at The Drafting Roomâ€™s Anniversary Ale for 2009. We brewed a bit more to serve the brewery and The Drafting Room, but get it while when you see it. Before this intense hop flavor subsides, this beer will be sold out.', 'http://www.troegs.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5571, 259, 3, 37, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'It is light with a bit of a citrus flavor. A pretty standard summer seasonal.', 'http://www.brooklynbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5572, 539, 3, 33, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'Buffaloâ€™s favorite red ale. Ruby red and malty flavored with a medium body and a spicy hop signature to balance. Available in bottles and on draft', 'http://www.flyingbisonbrewing.com', 5.25, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5573, 539, 3, 26, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'Our American Pale Ale. Made with American pale malt for a brilliant straw gold color, American hops (Cascade) for a refreshing citrusy hop character, and our signature ale yeast for a clean smooth finish. Available on draft, and seasonally in our Mixed', 'http://www.flyingbisonbrewing.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5574, 539, 8, 95, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'Light bodied golden beer, very balanced flavor with soft, clean finish. Available bottles at your favorite store and at an increasing # of bars.', 'http://www.flyingbisonbrewing.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5575, 539, 1, 2, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'Our true English style IPA. Bready English Malt gives this beer a firm backbone to hang truckloads of East Kent Golding Hops on. Available on draft at the brewery and select â€œBeer Geek Barsâ€ Feb. March April (if it lasts that long).', 'http://www.flyingbisonbrewing.com', 8.26, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5576, 539, 7, 90, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'Although itâ€™s named after our most famous weather event, this beer has nothing in common with the harsh bite of winter. In fact itâ€™s smooth slightly chocolaty flavor helps you forget Jack Frost altogether. German pale and Munich malts form the base flavors with hints of chocolate and caramel. Very soft, floral German hops ease the finish into dryness. Available on draft and in bottles from November to March.', 'http://www.flyingbisonbrewing.com', 6.10, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5577, 539, 1, 15, '491 Ontario Street', 'Buffalo', 'New York', 'United States', 'With a coppery-amber color and a full malty body with flavors of nuts and toffee. The English hops lend enough â€œspiceâ€ to leave a very drinkable finish to this comfort food of a beer. Available on draft from November to May.', 'http://www.flyingbisonbrewing.com', 6.50, 0.00, 0.00, 0, '9999-01-01', '42.9561, -78.8966', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5578, 633, 3, 37, '1938 Pacific Avenue', 'Tacoma', 'Washington', 'United States', 'German Pilsner Malt and a touch of flaked wheat are used to produce this light bodied, straw colored ale. Horizon and Glacier hops provide the balance. This beer finishes crisp and dry. Try this with and orange slice. 3.8% ABV', 'http://harmon.harmonbrewingco.com/', 3.80, 0.00, 0.00, 0, '9999-01-01', '47.2436, -122.437', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5579, 633, 3, 26, '1938 Pacific Avenue', 'Tacoma', 'Washington', 'United States', 'This is a light bodied mildly hoppy ale brewed with a 2-row malted barley, Crystal, and a special Vienna malted barley. Golding and Cascade hops are used to provide the balanced palate for this fine session beer. 4.2% ABV', 'http://harmon.harmonbrewingco.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '47.2436, -122.437', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5583, 673, 3, 43, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'This Bodacious Oatmeal Russian Imperial Stout will crush you like no other! This is the grand-daddy of all stout styles, with an intensely deep roasted and full bodied flavor. A robust hop character adds a refreshing balance.', 'http://www.hoppinfrog.com/', 9.40, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5584, 100, 3, 32, '8938 Krum Ave.', 'Galesburg', 'Michigan', 'United States', 'A double IPA that is sure to make you as all-knowing as Pythia. Itâ€™s just a matter of interpretation.', 'http://www.bellsbeer.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.2843, -85.4538', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5585, 1182, 11, 116, '2519 Main St.', 'Conestoga', 'Pennsylvania', 'United States', 'This beer is lighter style and dry to the palate and with the distinct flavor of wheat makes for a perfect thirst-quenching beer. It is the ideal drink for beer drinker who appreciates tradition and personality in their beer, but also seeks a lighter, refreshing style, perfect for the summer months.', 'http://www.springhousebeer.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.9525, -76.3295', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5586, 1099, 11, 141, 'High Street', 'Tadcaster', 'North Yorkshire', 'United Kingdom', '', '', 6.00, 0.00, 0.00, 0, '9999-01-01', '53.8834, -1.2625', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5587, 1211, -1, -1, '2800 North Reading Road', 'Adamstown', 'Pennsylvania', 'United States', '', 'http://www.stoudtsbeer.com/brewery.html', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.2369, -76.072', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5588, 385, 7, 84, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Malt focused, made with five types of grain including Vienna and Munich malts â€“ plus a secret extra malt that we use only in our Prosit! Consider this bomber to be the burly big brother to our Clipper City MarzHon, a three year in a row winner at the Great American Beer Festival. Weâ€™ve balanced the sweetness of the malt with three kinds of hops making this one of the boldest marzen style lagers youâ€™ll ever try. 5 Kinds of Malt, 3 Kinds of Hops estimated ABV 9% estimated IBU 25', 'http://www.ccbeer.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5589, 385, 11, 123, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'The secret is in the 2.5 pounds of spice per barrel for this fall brew. We add the pumpkin during the mash at precisely the right time to create just the perfect balance of malt, hops, pumpkin and spice. estimated ABV 8.5% estimated IBU 25 Malt, Hops, Pumpkin & our Secret Spices', 'http://www.ccbeer.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5590, 1258, 7, 84, '16 Tobey Road', 'Bloomfield', 'Connecticut', 'United States', 'Originally brewed to celebrate the beginning of the German brewing season and the 1810 wedding of crown prince Ludwig of Bavaria and his bride-to-be, princess Therese of Saxon-Hildburghausen. This amber beer was brewed in March ("Marzenbier") and left to age in cool lagering caves during the heat of the summer. Our rich and satisfying Bavarian-style OctoberFest comes from a special blend of imported German malts that creates a full-bodied brew and stresses a malty flavor and lingering aroma. Gently hopped and delicately balanced, its true-to-style, slow fermentation and long, cold maturation produces a luxuriously smooth, award-winning brew.', 'http://www.hookerbeer.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '41.8087, -72.7108', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5591, 1243, 3, 26, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'By using an exact amount of rye, a grain seldom found in other micro brewed beers, the Rye Pale Ale acquires its signature taste. Made with five varieties of hops and a generous amount of specialty malts, it offers a complex flavor and aroma that is both aggressive and well balanced â€“ a rare find among beers. The Terrapin Rye Pale Ale was released in Athens, GA in April of 2002 at the Classic City Brew Fest. Six months later this beer which was sold only in Athens was awarded the American Pale Ale Gold Medal at the 2002 Great American Beer Festival, the most prestigious competition in North America. We hope you will agree with our peers in the brewing industry that this is truly one of the best pale ales in the country.', 'http://www.terrapinbeer.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5592, 1243, 3, 38, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'The Terrapin India Style Brown Ale is a head on collision between a hoppy, west coast IPA and a complex, malty brown ale. Brewed with 5 varieties of hops and 7 different malts, this hybrid style represents the best of both worlds.', 'http://www.terrapinbeer.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5593, 1243, 11, 116, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'The Sunray Wheat is a German-style unfiltered wheat beer brewed with a touch of local Georgia Coast Tupelo honey from the Savannah Bee Company. Its inviting banana and sweet clove like aroma gives way to a pleasant, clean finish with a hint of tartness. This beer is available in the Terrapin â€œAll The Hitsâ€ Variety 12-pack as well as in individual 6-packs.', 'http://www.terrapinbeer.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5594, 1243, 11, 113, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Terrapin Beer Company was started by two guys who love big, bold beers. We are known for using a ton of flavorful ingredients and for pushing the envelope with the brews we create. We have also been known to take pleasure in hiking, biking, kayaking, and just plain having fun in the great outdoors. When we get hot and sweaty even hopheads like us want nothing more than to enjoy a beer that is crisp and refreshing. Which is why we created the perfect session beer â€“ the Terrapin Golden Ale.', 'http://www.terrapinbeer.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5595, 1204, 3, 30, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Stone 13th Anniversary Ale pours brilliant deep red with a light tan foam. Up front, the aroma is all piney, resinous and citrus hops. Upon tasting, the hops are still on the front, and they are balanced with the malty, toffee like flavors contributed from the blend of crystal and amber malts used in the brewhouse. The finish is deliciously bitter, with a touch of warmth provided by the 9.5% alcohol. Bitterness comes in at 90+ IBU.', 'http://www.stonebrew.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
