INSERT INTO beerbuddies_db.beer VALUES (5604, 1089, 8, 95, 'SKOL Breweries Limited', 'Bangalore', 'Karnataka', 'India', 'Peroni Nastro Azzurro is an intensely crisp and refreshing lager beer, with an unmistakable touch of Italian style http://www.sabmiller.in/brands_peroni.html Peroni Beer, Peroni Lager Beer, Peroni Nastro Azzurro Bee', 'http://www.sabmiller.in/', 5.10, 0.00, 0.00, 0, '9999-01-01', '12.9683, 77.657', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5605, 44, 5, 67, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.anheuser-busch.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5606, 1184, 3, 26, '', 'St. John', 'Virgin Islands', 'United States', 'Our flagship beer that embodies the uniqueness and character of the Caribbean. Subtle malt notes start this beer off and it finishes with just the right amount of hops for balance. Tropical Mango Pale Ale is a light pale ale with a mango fruit essence that is one of a kind taste. No matter where you are enjoying one it will bring you to a Caribbean state of mind.', 'http://www.stjohnbrewers.com/index.html', 4.50, 0.00, 0.00, 0, '9999-01-01', '18.3368, -64.7281', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5607, 940, 3, 42, '1284 McD Drive', 'Dover', 'Delaware', 'United States', 'Dominion Oak Barrel Stout raises the bar for American stouts. We use smoked and peated malts to create an intricate malt foundation. Willamette and Cascade hops balance the malt character and our method of dry hopping with vanilla beans and oak chips pushes the depth of our stout''s flavor spectrum even further.', 'http://www.olddominion.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '39.154, -75.4884', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5608, 3, 5, 70, 'Hoogstraat 2A', 'Beersel', 'Vlaams Brabant', 'Belgium', '', 'http://www.3fonteinen.be/index.htm', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.7668, 4.3081', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5609, 495, 7, 86, '222 West St # 46', 'Keene', 'New Hampshire', 'United States', '', 'http://www.elmcitybrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '42.9324, -72.2867', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5610, 657, 7, 92, '22 Park Place', 'Butler', 'New Jersey', 'United States', 'Also referred to as a Doppelbock, this is the strongest beer made by High Point. Rich creamy head with bouquet of wheat malt, black current, clove, and apple. Deep full flavors of caramel and chocolate malt balance with hops for a smooth warming character. The finish is smooth and malty leading to a subtle alcohol and dark caramel finish. The wonderful balance of this beer provides a complex profile that hides the 9.5% alcohol content. The perfect companion for a cold winter night.', 'http://www.ramsteinbeer.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '41.0016, -74.3403', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5611, 756, 3, 42, '5919 Chicago Road', 'Warren', 'Michigan', 'United States', 'Black ale beer, made with real coffee. This java stout goes through a unique process, involving caramelizing brown sugar to give it an intense caramel & vanilla aroma.', 'http://www.kbrewery.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '42.5278, -83.0472', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5612, 767, 3, 31, '813 Mirror Lake Drive', 'Lake Placid', 'New York', 'United States', '', 'http://www.ubuale.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '44.2829, -73.9813', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5613, 51, 3, 31, '675 Merrimon Avenue', 'Asheville', 'North Carolina', 'United States', 'A generous portion of American hops create a crisp citrus nose combined with a light, sweet finish â€“ a well balanced beer that destroys the paradigm of an IPA.', 'http://www.ashevillepizza.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '35.6221, -82.5536', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5614, 51, 1, 5, '675 Merrimon Avenue', 'Asheville', 'North Carolina', 'United States', 'Cascade hops lend this ale a lively and spirited edge that perfectly complements its effervescent amber maltiness.', 'http://www.ashevillepizza.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '35.6221, -82.5536', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5615, 1286, 5, 72, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #21-2009 is an exercise in deconstruction and minimalism. This Belgian Ale has distinct roots in The Mad Elf minus some key components. The cherries? Gone. The honey? Gone. The chocolate malt? Gone. Wait, this sounds familiar. It almost sounds like a naked version of The Mad Elf. Coming in just under 8% ABV, this unfiltered golden beauty shows off the pronounced yeast flavor that made The Mad Elf famous as well as a touch of alcohol and some mellow malt flavors.', 'http://www.troegs.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5616, 1286, 3, 42, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'We teamed up with St. Thomas Roasters of Linglestown, PA to create a special blend of espresso beans. They added Kenyan beans to the mix because of a strong citrus flavor that compliments the hops. Creating an environment akin a French press, the beans are combined with whole flower hops in the hopback, and the hot wort passes through the vessel on the way to fermentation giving Java Head a lush coffee espresso nose and hints of coffee flavor. There is a silky quality to the mouthfeel and a citrus aromas from the combination of Kenyan beans and whole flower hops.', 'http://www.troegs.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5617, 1286, 5, 67, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', '', 'http://www.troegs.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5618, 959, 3, 32, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Originally brewed for thirsty British troops stationed on the subcontinent of India, India Pale Ales had to withstand the sea voyage around Africa. Brewers need to take full advantage of two preservatives at the time: hops and alcohol. They increased their hopping rates, doubled their malt useage to increase alcohol content, and dry-hopped the brew before it set out on its voyage. Our Imperial IPA carries on this tradition- and then some! The fruity and citrusy hop aroma intermingles perfectly with an assertive malty backbone. Our brewers added a generous supply of hops to this brew throughout the entire process to provide an enormous hop flavor and balance the elevated alcohol content. This beer is 11% alcohol by volume, and 135 IBU!', 'http://www.ottercreekbrewing.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5619, 923, 3, 32, 'Gamle Rygene Kraftstasjon', 'Grimstad', 'Lunde', 'Norway', 'Brewed in collaboration with brewmaster Toshi Ishii from Yo-Ho Brewing, Japan. Malt: lager, mÃ¼nchener, crystal Hops: Millennium, Centennial, Chinnok, Amarillo and Brewers Gold. 19Â° P, 100 IBU, 8% ABV.', 'http://nogne-o.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5620, 133, 5, 65, '600 Brea Mall', 'Brea', 'California', 'United States', '', 'http://www.bjsrestaurants.com/beer.aspx', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.9132, -117.889', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5621, 507, 11, 121, '1213 Veshecco Drive', 'Erie', 'Pennsylvania', 'United States', 'Brewery folklore tells a story about a train engineer with a passion for the taste of Railbender Ale. With every stop he made in Erie came an equal number of stops at our brewery. One extended visit to our fermenter left the engineer in a rather befuddled state of mind. On his fateful trip out of Erie that evening, his train mysteriously derailed. The engineer swears that a huge black cherry tree had fallen across the tracks as the culprit. No such tree was ever found, but the front of the locomotive was spattered with hundreds of red sports. In tribute to this folklore our expert brewers introduce Derailed Black Cherry Ale â€“ brewed with fresh sweet black cherries and the finest malted barley to create a truly cherrylicious ale. Please enjoy responsibly, as we would never want you to get derailed!', 'http://www.eriebrewingco.com', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.1112, -80.113', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5800, 426, 3, 42, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'Brewed with all malted barley and peat malt (smoked malt). This beer is full bodied with chocolate, roasted barley flavors, and a smokey almost BBQ finish.', 'http://www.darkhorsebrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5622, 385, 3, 32, '4615-B Hollins Ferry Road', 'Baltimore', 'Maryland', 'United States', 'Big DIPA â€“ Double IPA, is the first in the Heavy Seas Special Edition Series due to be released in mid June. Hopped 3 times in the brewing process, Big DIPA has an earthy hop aroma. In keeping with the Heavy Seas philosophy we''ve made a big beer with a surprising balance. The best part is that youâ€™ll hardly notice itâ€™s 10.6% ABV (est). The label artwork was created by Kurt Krol, one of our brewers who also helped to develop the recipe.', 'http://www.ccbeer.com/', 10.60, 0.00, 0.00, 0, '9999-01-01', '39.2308, -76.6751', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5623, 885, 3, 31, '3300 Old Seward Highway', 'Anchorage', 'Alaska', 'United States', 'A hop lover and beer connoisseur''s favorite, this ale is surprisingly drinkable and fully delights with its hoppy aromatics. Stick your nose in this one.', 'http://www.moosestooth.net/', 6.10, 0.00, 0.00, 0, '9999-01-01', '61.1902, -149.869', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5624, 885, 3, 38, '3300 Old Seward Highway', 'Anchorage', 'Alaska', 'United States', 'A deep-red, full-bodied, malty ale heavily hopped with Centennial hops to produce a citrusy, spruce-like flavor and aroma. A final dose of Centennail hops in the conditioning tank lends an India Pale Ale-like aroma to the finished beer.', 'http://www.moosestooth.net/', 6.20, 0.00, 0.00, 0, '9999-01-01', '61.1902, -149.869', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5625, 885, 11, 121, '3300 Old Seward Highway', 'Anchorage', 'Alaska', 'United States', 'Brewed with wheat and barley malts and flavored with pureed raspberries, this pink-hued, slightly tart ale gives a clean sip.', 'http://www.moosestooth.net/', 4.20, 0.00, 0.00, 0, '9999-01-01', '61.1902, -149.869', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5626, 17, 5, 67, '5429 Shaune Drive', 'Juneau', 'Alaska', 'United States', 'Alaskan White Ale has a soft, slightly sweet base with the unique spice aroma of coriander and crisp, citrus finish of orange peel. A light and effervescent body combined with the smooth palate creates a complex and delicate beer that is deliciously refreshing in any season.', 'http://www.alaskanbeer.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '58.3573, -134.49', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5627, 10, 7, 92, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'The Andygator is a fearsome beast...much too big for any little bottle. Don''t let his toothy grin, slightly sweet flavor and subtle fruit aroma fool you: this cold-blooded creature is a Helles Doppelbock that can sneak up on you. Sip, don''t gulp and taste the wild of Abita Andygator', 'http://www.abita.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5628, 441, 3, 31, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'Red Chair IPA is named after the oldest operating lift at Mt. Bachelor, a classic old school double that locals flock to on fresh powder mornings. This beer has been wildly popular with our pub regulars, who always seem to know when we have hit on something special. This IPA is a bright copper beauty with a solid head and perfect lacing that typifies Deschutes ales. It has a plush body with satiny caramel flavors derived from seven varieties of malt. Despite all of this, Red Chair is still a hop forward ale, but not in the way many have gotten used to. You will find no cloying, mouth puckering bitterness here. In its place a straight up succulent citrus punch to the nose.', 'http://www.deschutesbrewery.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5629, 658, 11, 116, '12 Old Charlotte Highway', 'Asheville', 'North Carolina', 'United States', 'An invigorating wheat beer with 100% organic grains, a hint of rye and the tang and hue of organic hibiscus, this refreshing brew is as cool as the breeze that blows down from Mount Mitchell to Cattail Peak. Enjoy this delicious creation when the hottest summer day demands the best of the Blue Ridge.', 'http://www.highlandbrewing.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '35.5716, -82.4991', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5630, 885, -1, -1, '3300 Old Seward Highway', 'Anchorage', 'Alaska', 'United States', 'Dark Knight (Baltic Porter) A Baltic porter is kind of a cross between an English porter and an Imperial Stout. Ours features a rich maltiness with hints of caramel, toffee and chocolate in both the flavor and aroma. Restrained hopping contributes a smooth full finish.', 'http://www.moosestooth.net/', 5.40, 0.00, 0.00, 0, '9999-01-01', '61.1902, -149.869', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5631, 1155, 1, 1, '717 W. 3rd Ave', 'Anchorage', 'Alaska', 'United States', 'This tasty English pale ale gets its charm from Imported Maris Otter Pale Malt, East Kent goldings and a few secret ingredients to keep our competitiors guessing. Styled after a classic English Bitter, Urban Wilderness is supremely balanced, smooth and easy to drink.', 'http://www.alaskabeers.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '61.2196, -149.896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5632, 62, 5, 64, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', '', 'http://www.averybrewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5633, 441, 2, 25, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'It usually means bigger. Richer. And we can think of no better way to describe the taste of this even-bolder take on our classic, Black Butte Porter. Black Butte XX is an imperial porter with a lot more malt and hops, a wealth of coffee, cocoa nibs and aged in bourbon oak barrels. XX. It also means 20. Enjoy one during our 20th anniversary. On the flavor scale - Itâ€™s legendary.', 'http://www.deschutesbrewery.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5634, 441, 3, 35, '901 SW Simpson Avenue', 'Bend', 'Oregon', 'United States', 'The Reserve Series romance all began with our first release of this limited-edition brew. Mirror Mirror, born of a double batch of Mirror Pond Pale Ale, is an inspired, barrel-aged barley wine layered with intriguing nuances. Explore this latest incarnation and enjoy its delicious complexity in every sip.', 'http://www.deschutesbrewery.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '44.0474, -121.323', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5635, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses. Obliteration I is a Double IPA, heavily hopped with a big malt base. Its aroma is pungent with citrus, onion, and a touch of alcohol. The sweetness of caramel malt is offset with spice and pepper flavors that lead into an overwhelmingly bitter finish.', 'http://www.midnightsunbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5636, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses. Obliteration II is yet another dynamic Double IPA. Its aroma is intense with fragrant notes of citrus, spice, pine and alcohol. A sturdy malt platform provides the perfect stage for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. Obliteration II finishes with poignant bitterness.', 'http://www.midnightsunbrewing.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5886, 1411, 11, 127, '30 Bridge St', 'Millers Falls', 'MA', 'United States', 'American Black Ale. Aromas of an American IPA, dark toffee and chocolate flavors without roasted bitterness.', 'http://www.elementbeer.com', 8.75, 65.00, 22.00, 2147483647, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5637, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses. Obliteration V is yet another exciting Double IPA. Its aroma is pungent with fragrant notes of citrus, spice, pine and alcohol. A sturdy malt platform provides the perfect stage for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. Living up to its name, Obliteration V finishes with poignant bitterness.', 'http://www.midnightsunbrewing.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5638, 686, 3, 43, '856 10th Street', 'Arcata', 'California', 'United States', 'A bourbon barrel aged Imperial Stout infused with coffee.', 'http://www.humboldtbrews.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.87, -124.087', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5639, 1286, -1, -1, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'In honor of Oktoberfest, we give you Scratch #23-2009, Kellar Fest. This unfiltered lager features all German malts and noble hops. Fermented with the Augustinerbrau yeast strain, Kellar Fest is a blend of Bohemian Pils, Munich and Vienna malts. The Magnum hops provide a crisp bitterness and the Hallertau noble hops impart a slight earthy taste. Kellar Fest finishes crisp and dry with hints of fruit. Grab a lamb handle and savor this Kellar Fest.', 'http://www.troegs.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5640, 1223, 1, 21, '45980 Waterview Plaza', 'Sterling', 'Virginia', 'United States', 'A rich, smooth...long dry-roast finish...ebony', 'http://www.greatamericanrestaurants.com/sweetMainSter/index.htm', 4.80, 0.00, 0.00, 0, '9999-01-01', '39.0324, -77.4097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5641, 1223, 3, 26, '45980 Waterview Plaza', 'Sterling', 'Virginia', 'United States', 'A fruity, copper-colored ale with a firm maltiness & dry hop.', 'http://www.greatamericanrestaurants.com/sweetMainSter/index.htm', 5.70, 0.00, 0.00, 0, '9999-01-01', '39.0324, -77.4097', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5642, 1328, 3, 31, '50 Catoctin Ct. NE #100', 'Leesburg', 'Virginia', 'United States', 'An American style India Pale Ale. This medium bodied, light bronze hued brew has an aggressive hop character and flavor from the use of American hops in dry hopping. Our interpretation comes in at 13.0 degrees plato with IBUâ€™s in the mid 40â€™s. The American hop varietals used as Kettle additions were Amarillo and Chinook and this was dry hopped with Chinook as well.', 'http://www.vintage50.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.1126, -77.5537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5643, 1328, 3, 26, '50 Catoctin Ct. NE #100', 'Leesburg', 'Virginia', 'United States', '', 'http://www.vintage50.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.1126, -77.5537', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5644, 791, -1, -1, 'No-254, Colombo Road', 'Colombo', '', 'Sri Lanka', 'Lion Imperial Lager, from Sri Lanka, is brewed using the finest natural ingredients - delivering a rich smooth taste and refreshment. Enjoy its bite.', 'http://www.lionbeer.com/', 8.80, 0.00, 0.00, 0, '9999-01-01', '38.7548, -9.1883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5645, 1062, 3, 31, '254 Wilkins Street', 'Morrisville', 'Vermont', 'United States', 'A light copper body low bitterness with good hop flavor. This is my impression of what the English troops may have been drinking when they occupied India. The pale ale they drank had mellowed considerably. The wooden casks had spent many months traveling on ships and long inland journeys to the troops, where they were then tapped and enjoyed.', 'http://www.rockartbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.5693, -72.6034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5646, 284, 5, 72, 'Guido Gezellelaan 49', 'Mechelen', 'Antwerpen', 'Belgium', 'Gouden Carolus Hopsinjoor completes the taste pallet of the gamma Carolus-beers. "Hopsinjoor" is a wordplay to for one thing the several hops which were used, and on the other hand the typical character of Mechelen of Gouden Carolus: the figure "opsinjoor" is intertwined with the history of Mechelen. 4 types of hops are used: Golding, Spalt, Hallertau and Saaz. These hops were fractioned at several times in the cooking process in order to keep a maximum of aroma. Regarding to taste we can say that the beer has a gentle, but nevertheless bitter aftertaste. Gold-yellow colour. Hoppy aroma.', 'http://www.hetanker.be/', 8.00, 0.00, 0.00, 0, '9999-01-01', '51.0325, 4.473', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5647, 575, 7, 90, '737 W. 5th Ave., Suite 110', 'Anchorage', 'Alaska', 'United States', 'This dark lager combines the characteristics of three winter beer styles. All three of these styles traditionally come from the colder harsher areas of Europe. The styles are (1) Black Beer (aka schwartzbier) originating from the former East Germany); (2) Rye Beer which at one time was only made in hardier areas of Eastern and Baltic Europe; and (3) Bock Beer which is widely known as a higher alcohol lager of Northern Germany. Our Black Rye Bock has a distinctive bitter chocolate palate and black color reminiscent of a black beer. The spiciness from the rye malt shines through in the flavor. The high alcohol balanced with malty sweetness rounds out this cold season bock. Smooth drinking with a punch makes this lager a perfect quaffer for our Arctic winter. 6.2% alcohol by volume.', 'http://www.glacierbrewhouse.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '61.2179, -149.896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5648, 454, 8, 95, '2401 Tulane Avenue', 'New Orleans', 'Louisiana', 'United States', 'Inspired by old-world brewing methods, this bewitching all-malt brew is a darkly rich, exotic lager, crafted with a touch of magical New Orleans spirit.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '29.9606, -90.0871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5649, 1243, 1, 20, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Terrapin Midnight Project Brew Two 2009. Sometime around midnight in a city nobody can agree on, the idea for Terrapin and Left Hand to brew a collaboration beer was born. Depth Charge is the second in the series of one-time releases between the two breweries. Be wary of the calm before the storm. This creamy, deeply delicious milk stout will seduce you into submission while the explosion of hand roasted gourmet espresso will blow you into next week. We Shall Drink in the breweries. We Shall Drink in the pubs, We Shall Drink the the comfort of our homes. We Shall Never Surrender.', 'http://www.terrapinbeer.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5650, 898, -1, -1, 'Industrial Area, Thessaloniki', '', 'Sindos', 'Greece', '', 'http://www.mythosbrewery.gr/', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5651, 54, 2, 25, '2323 Defoor Hills Rd NW', 'Atlanta', 'Georgia', 'United States', 'A robust porter brewed with lots of chocolate malt and roasted barley. This gives the beer its nearly black color and coffee and dark chocolate flavors. These flavors are then tempered with the use of flaked oats which provide an almost creamy texture to the beer. The 7.7% abv is deceptive but is not completely unnoticed.', 'http://www.atlantabrewing.com/', 7.70, 0.00, 0.00, 0, '9999-01-01', '33.818, -84.4353', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5652, 882, 5, 72, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', '', 'http://www.moonriverbrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5653, 882, 1, 3, '21 W. Bay St.', 'Savannah', 'Georgia', 'United States', '', 'http://www.moonriverbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '32.081, -81.0915', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5654, 469, 7, 86, '4519 W. Pine Street', 'Farmville', 'North Carolina', 'United States', '', 'http://www.duckrabbitbrewery.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '35.6003, -77.5971', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5655, 1160, 11, 123, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Smuttynose Pumpkin Ale is our homage to the craft and heritage of Americaâ€™s brewers. Recipes calling for the use of pumpkins in beer date back to early colonial times, when brewers sought to extend their supply of costly imported malt with locally grown ingredients, such as squash and â€œpompions.â€ In that spirit, we brew our ale with the addition of pumpkin to the mash, along with traditional spices to create a delicious American original.', 'http://www.smuttynose.com/', 5.10, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5656, 858, 3, 35, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'This kick ass American Barley Wine is all about hops â€”Nugget, Chinook, Simcoe and Centennial. And, yeah, LoTs of â€˜em. OKâ€¦thereâ€™s a substantial malt base on which these juicy Pacific NW hops lie down and do their dirty work. Maybe thatâ€™s too much infoâ€¦', 'http://www.midnightsunbrewing.com/', 11.90, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5657, 959, 3, 43, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'The style was first brewed in England for the Russian Czar and it is the king of stouts. Plenty of big malt flavors- chocolate and roasted- and high alcohol with lower carbonation and mild hops. We brewed this beer with double the malts and four times the hops of regular stouts! Otter Creek Russian Imperial Stout clocks in around 10% ABV- a beer to be savored responsibly. True to style, this beer will last for years so you may want to stock up on a few bottles for your cellar while it''s available. Russian Imperial Stouts pair well with creamy cheeses such as camembert (we recommend Vermont-made!), decadent chocolate desserts, or a hearty meal.', 'http://www.ottercreekbrewing.com/', 10.60, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5658, 476, 3, 31, '6923 Susquehanna St.', 'Pittsburgh', 'Pennsylvania', 'United States', '', 'http://www.eastendbrewing.com/', 7.40, 0.00, 0.00, 0, '9999-01-01', '40.4553, -79.9043', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5659, 1204, -1, -1, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Brace yourself, bereaved fans of Stone 11th Anniversary Ale, for your joyous new day has finally come! Itâ€™s like your first crushâ€“you know, the one who broke your heart when she/he decided to go to the junior prom with whatâ€™s-their-nameâ€“has suddenly come back to you to go for a cruise down the main drag on Friday night. Itâ€™s likeâ€¦itâ€™s like finding that long lost gold watch, given to you by your father, who got it from his father, who got it from his father. Itâ€™s like when your best buddy in the world, Sam the family dog, finally sauntered up the front porch steps one sunny afternoon after having been on a six-week runaway. Yes, itâ€™s just like that. And itâ€™s like this: A brilliantly hopped double IPAâ€“providing a wake up call of floral and citrus aromasâ€“backed up by a deliciously smooth and dark roasted maltiness. You get the best of both worlds with this black double IPA.', 'http://www.stonebrew.com/', 8.70, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5660, 171, 5, 66, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'Abbaye Saint-Martin Brune was named World''s Best Abbey (Dark) Beer @ the 2009 World Beer Awards (London). Aroma of caramel and liquorice. Less sweet than most traditional Dark Abbey Ales. Many people prefer this double at room temperature. It is especially popular when paired with dessert. Abbye St. Martin Ales are pure Belgium.', 'http://www.brunehaut.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5661, 171, 5, 72, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'Three varieties of malt and three of hops create the robust character of this St. Martin triple abbey ale. Abbye St. Martin Ales are pure Belgium.', 'http://www.brunehaut.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5662, 171, 5, 67, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'A classic Belgian ''white beer'' from the Hainaut region in the southwest Belgium, near the French border. Top-fermented and bottle-conditioned, this is a clean, refreshing regional ''artisan'' beer. Presents a light hazy yellow colour with citrus and coriander aromas and fairly subtle malt and hops on the palate. The finish is dry and satisfying. Hazy yellow golden colour. Lemon custard, lime zest, and delicate spice melange aromas. Well-balanced, a frothy entry leads to a dryish medium body of nuts, baked oranges, and slightly phenolic mineral flavors. Finishes with a metallic ore dust, salt, and dried lemon fade. This beer is certified as organic.', 'http://www.brunehaut.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5663, 171, 5, 72, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'A classic Belgian blonde ale from the Hainaut region in the southwest Belgium, near the French border. Top-fermented and bottle-conditioned, this is a clean, refreshing regional ''artisan'' beer. This organic blonde ale presents a nice yeasty nose, long-lasting head and a spicy, earthy note on the palate.', 'http://www.brunehaut.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5664, 171, 3, 33, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'Amber copper color with a beige head. Caramel malt aromas reminiscent of vanilla, along with toffee, butterscotch and ripe fruits. Top-fermented and bottle-conditioned, this is a clean, refreshing regional ''artisan'' beer. Hazy amber to brown coloured beer, with a fluffy off-white head. Nice aroma of spices, yeast and oak. The alcohol subtle. Flavour is moderately spicy and slightly fruity, with balanced hops. This beer is certified organic.', 'http://www.brunehaut.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5665, 171, -1, -1, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'A limited production, spiced Christmas ale available during the cold-weather months. (across the northern hemisphere) Abbye St. Martin Ales are pure Belgium.', 'http://www.brunehaut.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5666, 171, -1, -1, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'A classic Belgian BiÃ¨re de Garde - full of fruity esters, alcohol phenols, Belgian malts, noble hops and a dry, refreshing after-taste. Award-wining Mont Saint-Aubert received ''World''s Best" recognition in the BiÃ¨re de Garde category during the 2009 World Beer Awards (London). In 2008 Mont Saint-Aubert took Silver medals in the Belgian-Style Pale Strong Ale category at the Brewers Association World Beer Cup and the Australian International Beer Awards.', 'http://www.brunehaut.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5667, 171, 5, 72, 'Rue de Panneries 17', 'Brunehaut', 'Hainaut', 'Belgium', 'A unique 7% Belgian blonde ale, flavoured with juniper berries. The beer has bittersweet malt flavours, and a heady perfumed aroma of orange and juniper.', 'http://www.brunehaut.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '50.5109, 3.3883', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5668, 1363, 11, 123, '4607 Wedgewood Blvd.', 'Fredrick', 'Maryland', 'United States', 'Our Fall Seasonal, Pumpkin Patch Ale, is the perfect beer for an autumn night. Pumpkin Patch pours a hazy orange with frothy, ivory colored head. The nose immediately conjures images of Grandma baking pumpkin pie with notes of nutmeg, cinnamon and ginger. Medium body and mild carbonation yield a spicy, pumpkin flavor - from the 300 lbs. of pumpkin we use to brew this unique beer.', 'http://www.wildgoosebrewery.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '39.3628, -77.4265', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5669, 1204, 5, 66, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', '', 'http://www.stonebrew.com/', 8.90, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5670, 1286, -1, -1, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', '', 'http://www.troegs.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5671, 1062, 3, 33, '254 Wilkins Street', 'Morrisville', 'Vermont', 'United States', 'The unofficial name for this beer is â€œSuper Glideâ€. Malty rich with a hint of spicy hops and roasted grains. This beer is one smooth ride with a clean finish! We brewed this one with American Pale, oats, flaked barley, black, chocolate, red malt, melandolin malt. American hops include Magnum, Centennial, Liberty and Crystal. Enjoy!', 'http://www.rockartbrewery.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '44.5693, -72.6034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5672, 1062, 3, 35, '254 Wilkins Street', 'Morrisville', 'Vermont', 'United States', 'We brewed THE VERMONSTER with 110 pounds of malt per barrel and jacked up the pour into a wide mouth thin glass goblet. For an amazing pairing get some Smoked Gouda from Taylor Farm Cheese and a friend!', 'http://www.rockartbrewery.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '44.5693, -72.6034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5673, 476, 3, 43, '6923 Susquehanna St.', 'Pittsburgh', 'Pennsylvania', 'United States', 'This beer is an Imperial version of our Black Strap Stout, this time brewed with MORE blackstrap molasses and MORE brown sugar, plus a whole lot more malt and hops too. Part of our FESTIVAL OF DARKNESS, this one clocks in at over 10%ABV, and is the thickest beer we''ve ever brewed here.', 'http://www.eastendbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '40.4553, -79.9043', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5674, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'The extensive distance between two breweries on the West Coast â€“ 3767 miles â€“ is bridged by this collaboration beer. Brewers Gabe Fletcher of Midnight Sun Brewing Company [Anchorage, AK] and Colby Chandler of Ballast Point Brewing Company [San Diego, CA] designed and brewed an exciting representation of their passions: hops, Belgian yeast, oak aging and Brettanomyces. Just prior to the Great Alaska Beer & Barley Wine Fest in JAN 2009, Gabe and Colby brewed a West Coast-worthy IPA at Midnight Sun Brewing Company. This hop-centric beer became the jumping-off point for other intense flavors. During its course to completion, 3767 was affected by three different yeast strains--including Brettanomyces, aged for several months in French oak Cabernet Sauvignon barrels, and then bottle- and keg-conditioned. The plan is for 3767 to hit Anchorage, Seattle, Portland, San Francisco and San Diego in NOV 2009 for a West Coast Toast. Hereâ€™s to the collaborative spirit readily found in our brewing industry. Clink!', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5675, 858, 5, 67, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Close your eyes. The delicate aroma, flavor, texture of this beer whisper â€œwitbierâ€. Now open your eyes. The color is deceiving. You take another sip. Yes, witbier â€¦ but black as night. It is something quite peculiarâ€”BuT it is brilliantâ€”something shimmering and [not so] white.', 'http://www.midnightsunbrewing.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5676, 44, 11, 141, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'During even the coldest of weather, warm up to the smooth, robust taste of our Winter''s Bourbon Cask Ale. Full of rich aromas that you find in the winter months, hints of vanilla and flavorful hops, this is a beer that is great for pouring into a large tulip glass and enjoying with friends around a fireplace.', 'http://www.anheuser-busch.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5677, 172, 5, 66, '', '', '', 'Belgium', 'Tournay Black is a bottle conditioned, Belgian stout brewed by Brasserie de Cazeau which is a farm-brewery located in the south of Belgium. It was originally brewed as a winter ale under the name Tournay de Noel, but later became a year-round release. They didn''t provide much specific detail about how it was brewed except to say that it is made with water, malts, candi-sugar, hops, and yeast. It is 7.6% ABV with a recommended drinking temperature of +/- 50 degrees. The brewer states that the tasting notes are of, "roasted malts, coffee, bitter chocolate, earth, and cigar ash." Well, I am a prodigious cigar smoker and I can''t say that I would want to consume the ash.', '', 7.60, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5678, 940, 3, 26, '1284 McD Drive', 'Dover', 'Delaware', 'United States', '', 'http://www.olddominion.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '39.154, -75.4884', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5679, 136, 7, 77, 'P.O. Box 315', 'Blacksburg', 'Virginia', 'United States', '', 'http://www.blacksburgbrewing.com/', 4.70, 0.00, 0.00, 0, '9999-01-01', '37.23, -80.41', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5680, 1160, 3, 32, '225 Heritage Ave', 'Portsmouth', 'New Hampshire', 'United States', 'Our Big A IPA has earned its share of praise over the last few years. In 2004 the New York Times named it its top IPA , and in 2007 Mens Journal Magazine included it on its list of 25 best beers in America. The last of each year''s edition typically leaves our warehouse around mid-May, and, as always, it doesn''t last long. Stash Wojciechowski, the â€œKiller Kielbasa,â€ created this bonafide India Pale Ale recipe exclusively for the Smuttynose Big Beer Series.', 'http://www.smuttynose.com/', 9.60, 0.00, 0.00, 0, '9999-01-01', '43.0325, -70.7948', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5681, 1009, 3, 32, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', '', 'http://www.portbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5682, 858, 11, 123, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'OK, what do you get when we toss pale malted barley, pumpkin and spices into a stainless steel cauldron then stir in some magic? Uh, Trickster! The â€œmagicâ€ is actually mischievous Belgian yeast at play with cardamom, nutmeg and coriander. This spooky cool brew will make your glass glow bright despite the gloominess of the season. Designed to conjure up a little fun during the darkening days of autumn, Trickster is a frivolous concoction of earthy pumpkin, comforting malt, and lively spices. This makes Trickster the brew to accompany your post-winterizing duties, family fall dinners, ghost stories, U-boast-iT stories, and â€œsupposedly hauntedâ€ garage parties. But the flavor range of Trickster also pairs well with citrusy and spicy cuisine. Try a glowing glass with your favorite dishes that incorporate nutmeg, cardamom or corianderâ€”like Thai curries, Swedish meatballs, gingerbread, roasted pumpkin soup. Add Trickster to soups and sauces, batters and doughs, glasses and mugs.', 'http://www.midnightsunbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5683, 858, 3, 43, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Vicious and viscous, this menacing brew pours opaque black with a creamy maduro-colored head. Its aroma offers seductive whiskey, chewy red wine, dark fruit and lavish tobacco. Berserker Imperial Stout invades your taste buds with in-your-face flavor. Weighing in at almost 13% alcohol by volume, Berserker is completely out-of-control. Give it a good fight. This version of Berserker Imperial Stout was aged in both red wine and whiskey barrels. The entire batch was brought back together before being packaged in kegs and 22-oz bottles.', 'http://www.midnightsunbrewing.com/', 12.70, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5684, 1204, 3, 43, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Brewed in the authentic historical style of an Imperial Russian Stout, this ale is massive. Intensely aromatic (notes of anise, lack currants, coffee, roastiness and alcohol) and heavy on the palate, this brew goes where few can --- and fewer dare even try. The style originated from Czarist Russia''s demand for ever thicker English stouts. Expect our version of this mysterious brew to pour like Siberian crude and taste even heavier!', 'http://www.stonebrew.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5685, 812, 8, 95, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Born of dark and cold and snow in the marrow of the northeast''s longest night, HOWL comes in on wailing winds with winter-weary eyes burning holes in sunless shadows. In its darkened depths out inner voids are warmed.', 'http://www.magichat.net/', 4.60, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5686, 1062, 3, 37, '254 Wilkins Street', 'Morrisville', 'Vermont', 'United States', 'Our golden American ale has a crisp body and slightly dry, hoppy finish. This is a real treat for the beer lover. Pale, wheat and torrified wheat malts are used with Northern Brewer and Mt. Hood hops.', 'http://www.rockartbrewery.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '44.5693, -72.6034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5687, 62, 3, 32, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'Lupulin Rapture Incarnate! As fervent Â devotees of hops, we found ourselves on a quest to create a transcendental IPA capable of quenching our voracious lupulin desires. Our mantra became "unity of bitterness, hop flavor and aroma." Enlightened, duganA IPA was born: A brutally bitter, dank, piney and resinous ale designed for those seeking a divine hop experience.', 'http://www.averybrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5688, 1352, 4, 50, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'A Brewer''s Select Series, Golf is a fest-weisse hybrid or ''Festeweizen.'' It will weigh in at 5.0% and is made with Munich, Wheat, and CaraVienna malts and Spalt hops.', 'http://www.weyerbacher.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5689, 1035, 3, 31, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Our India Pale Ale is hoppy and bitter with a nice sweet malt finish. Slow dry-hop conditioning brings out the herbal hop aromas.', 'http://www.raclodge.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5690, 1035, 11, 121, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Razberry Wheat is crisp with a refreshing tartness and the fresh aroma of raspberries. This salmon pink ale is just the thing to transport you to berry time in the summer.', 'http://www.raclodge.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5691, 1035, 3, 33, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Celtic Copper is a mahogany hued ale with rich malt flavor and subtle hop balance; an excellent choice for those who prefer amber ales.', 'http://www.raclodge.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5692, 1035, 3, 26, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Ring Tail Pale is light in body and straw-gold in color, with a crisp hop finish. This beer is a great choice for domestic lager drinkers.', 'http://www.raclodge.com/', 4.20, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5693, 1035, 7, 91, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Our Blond Bock is gold in color and features a malty profile and a spicy finish courtesy of Saaz hops. This beer boasts the flavor of a traditional Bock without the cloying aftertaste.', 'http://www.raclodge.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5694, 1035, 5, 70, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'Features the intense aroma of fresh-picked, slow ripened Northwest apricots warmed by the summer sun. Based on a Belgian Tripel, this beer went through 16 months lactic fermentation and aging in French oak wine barrels.', 'http://www.raclodge.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5695, 1035, -1, -1, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'A Belgian Flanders Style Red Ale refermented with a sweet blend of fresh whole Northwest cherries. This beer spent more than six months of lactic fermentation and aging in small French oak wine barrels before being hand-bottled.', 'http://www.raclodge.com/', 6.60, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5696, 1035, -1, -1, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'A careful blending of select barrels of Flanders Reds and soured Belgian Triples aged in oak for up to 18 months. Then blended with fresh 25Â° Plato Blond Quadruppel. Hand-bottled, corked and then aged allowing lactic fermentation.', 'http://www.raclodge.com/', 8.41, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5697, 1035, -1, -1, '7424 SW Beaverton-Hillsdale Hwy', 'Portland', 'Oregon', 'United States', 'This Northwest style sour red is a bottled version of our popular Mouton Rouge. This blend of barrels, with up to 16 months of oak barrel lactic fermentation and oak barrel aging, features dark fruit, sour, oak and funk flavors that sweep over your taste buds like an incoming tide.', 'http://www.raclodge.com/', 8.87, 0.00, 0.00, 0, '9999-01-01', '45.4856, -122.754', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5698, 541, 11, 116, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'Exit 11 Hoppy American Wheat Ale is the second in their wildly popular Exit Series of Big Bottle Beers. Exit 11 is a confluence of styles and ingredients, just as Exit 11 is the point in New Jersey where the Garden State Parkway, the New Jersey Turnpike and several other highways come together. â€œExit 11 is the point on the Turnpike where the Garden State Parkway branches off and takes hundreds of thousands of travelers to the renowned Jersey Shore,â€ says Flying Fish Founder Gene Muller. â€œOur Exit 11 Wheat Ale is a fresh, citrus-y summer beer perfect for beachgoers and those who only wish they were headed â€˜downa shoreâ€™.â€ Exit 11 is an American-style wheat beer brewed with English ale yeast and three Pacific Northwest hops, Columbus, Palisade and Amarillo. It is brewed with 50% Belgian pale malt and 50% white wheat, and is an ideal summer thirst quencher, with its bouquet of tangerines and apricots. Exit 11 is available only during this one-time release, and only until it sells out across New Jersey, Pennsylvania and Delaware.', 'http://www.flyingfish.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5699, 420, 3, 33, '', 'Mexicali', 'Baja', 'Mexico', 'A Craft Amber Ale, brewed using Honey from Northern Mexico.', 'http://www.cucapa.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '31.7291, -116.578', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5700, 57, 8, 95, '1860 Schell Road', 'New Ulm', 'Minnesota', 'United States', 'This beer has changed hands a bit over its 60+ year history - first brewed by the Grain Belt Brewery in Minneapolis, then by the now-defunct Minnesota Brewing and currently by August Schell Brewing Co. in New Ulm.', 'http://www.schellsbrewery.com/', 4.60, 0.00, 0.00, 0, '9999-01-01', '44.2896, -94.449', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5701, 1286, 11, 119, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'This mahogany ale packs a lingering, earthy hoppiness. The addition of more than 20% rye to the grain bill gives a creamy mouthfeel and hints of spice that compliment the bitterness of hops. Subtle fruitiness come through from the Bravo hops added during the boil, but the Cluster and Liberty varieties used in dry-hopping this beer are the true flavor drivers in this spicy ale. Dark in color and intense is flavor, Scratch 25-2009 finds true balance in a beer that could have easily gone way over the top. Enjoy.', 'http://www.troegs.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5718, 1286, 5, 61, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'The transformation of Scratch #3-2007 to Splinter Gold has been a slow rest in oak wine barrels dosed with brettanomyces. During a two-year aging period the horsy flavors of the brett combined with the Westmalle yeast used during primary fermentation to create a complex blend of flavors. Bone-dry and 12% abv, Splinter Gold is highly carbonated.', 'http://www.troegs.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5702, 241, 3, 31, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'This 6% trans-atlantic fusion IPA is light golden in colour with tropical fruits and light caramel on the nose. The palate soon becomes assertive and resinous with the New Zealand hops balanced by the biscuit malt. The finish is aggressive and dry with the hops emerging over the warming alcohol. This fresh, full flavour natural beer is our tribute to the classic IPAs of yester-year. The post modern twist is the addition of amazing fruity hops giving an explosion of tropical fruit flavours and a sharp bitter finish.', 'http://brewdog.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5703, 241, 3, 43, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'A strong, silky smooth imperial stout with a deep, dark ruby appearance. Mocha, bitter chocolate, liquorice and dark cherry flavours prevail, before the balanced, warming and encapsulating finish. A contemporary Scottish take on an age old Russian classic style originally brewed for the Tsars. Our interpretation brings together hops from both sides of the Atlantic, amazing flavoured malts and dark sugars. Like the original BrewDog, this beer would never bite you but would much rather give you a lick on the face. Look Out! Serving Suggestion: Enjoy with an air of aristocratic nonchalance', 'http://brewdog.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5704, 241, 3, 43, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', '', 'http://brewdog.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5705, 241, 1, 5, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', '', 'http://brewdog.com/', 5.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5706, 241, 8, 95, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', '', 'http://brewdog.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5707, 241, 3, 32, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'This little bottle has a grandiloquent story to tell. 2,204 malted Maris Otter grains gave all they had to offer the world to provide the robustly delicate toffee malt canvas for the ensuing epic. 6 Hop Cones willingly sacrificed themselves in fiery cauldron that is our brew kettle to ensure your mouth is left feeling punished and puckering for more. 9,900,000,000 yeast cells frantically fermented their little hearts out as the sugars were magically turned into alcohol in the dark depths of our fermentation tanks. This explicit ale has more hops and bitterness that any other beer brewed in the UK. This is an extreme beer rollercoaster for freaks, gypsies and international chess superstars.', 'http://brewdog.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5708, 241, 1, 4, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'A titillating, neurotic, peroxide, punk of a pale ale. Combining attitude, style substance and a little bit of low self esteem for good measure; what would your mother say? You really should just leave it alone... ...but you just cant get the compulsive malt body and gorgeous dirty blonde colour out of your head. The seductive lure of the sassy passion fruit hop proves too much to resist. All that is even before we get onto the fact that there are no additives preservatives, pasteurization or strings attached. All wrapped up with the customary Brewdog bite and imaginative twist. This trashy blonde is going to get you into a lot of trouble.', 'http://brewdog.com/', 4.10, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5709, 241, 7, 77, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'A Lager that actually tastes of something? You have to be kidding, right? 77 lager is made with 100% malt and whole leaf hops. It contains no preservatives, additives, cheap substitutes or any other junk. Maybe we are crazy. So what? Taste 77 Lager and we are pretty sure you will agree that the fine line between genius and insanity has just become a little more blurred.', 'http://brewdog.com/', 4.90, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5710, 241, 11, 126, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'Dogma is an innovative, enigmatic ale brewed with guarana, poppy seeds and kola nut all blended together with Scottish heather honey. A conspiracy of transcontinental ingredients infused with some devastatingly BrewDog imaginative thinking. The flavours, intricacies and nuances of this beer are best enjoyed while musing over some obscure 17th Century philosophical meanderings, such as: "If we disbelieve everything because we cannot certainly know all things we will do much, what as wisely as he who would not use his wings but sit still and perish because he had no wings to fly.', 'http://brewdog.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5711, 241, 3, 43, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'The irony of existentialism, the parody of being and the inherent contradictions of post-modernism, all so delicately conveyed by the blocky, pixelated arcade action have all been painstakingly recreated in this bottles contents. This imperial stout is brewed with copious amounts of speciality malts, jasmine and cranberries. After fermentation we then dry-hop this killer stout with a bucketload of our favourite hops before carefully ageing the beer on French toasted oak chips. It is all about moderation. Everything in moderation, including moderation itself. What logically follows is that you must, from time, have excess. This beer is for those times.', 'http://brewdog.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5712, 241, 3, 43, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', '', 'http://brewdog.com/', 18.20, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5713, 241, 3, 43, 'AB43 8UE', 'Fraserburgh', '', 'United Kingdom', 'This is the worlds strongest ever beer, ever (yes ever). No Penguins were harmed in the making of this beer; some humans did get very, very cold though. It was worth it. The Antarctic name, inducing schizophrenia, of this Å¸ber-imperial stout originates from the amount of time it spent exposed to extreme cold. This beer was initially double barrel aged for 14 months; maturing in the deep, rich oak of Scottish whisky casks. After this epic maturation the beer was then frozen, then frozen again, then frozen again. This is an extremely strong beer, it should be enjoyed in small servings and with an air of aristocratic nonchalance. In exactly the same manner that you would enjoy a fine whisky, a Frank Zappa album or a visit from a friendly yet anxious ghost.', 'http://brewdog.com/', 32.00, 0.00, 0.00, 0, '9999-01-01', '57.683, -2.003', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5714, 1243, 3, 31, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Here ye, here yeâ€¦All hopheads shall herewith rejoice! Terrapin has recruited ye old HOPSECUTIONER to execute the exact hop profile for this killer IPA!', 'http://www.terrapinbeer.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5715, 1243, 3, 43, '196 Alps Road', 'Athens', 'Georgia', 'United States', 'Black as night, this coffee stout is thick, rich and full of real coffee flavor. Brewed with the Terrapin Wake-n-Bake coffee blend created by Terrapin & Jittery Joeâ€™s Coffee.', 'http://www.terrapinbeer.com/', 8.60, 0.00, 0.00, 0, '9999-01-01', '33.9459, -83.4105', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5716, 976, 2, 25, '127 Elm St., Unit C', 'Milford', 'New Hampshire', 'United States', '', 'http://www.pennichuckbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.8368, -71.6626', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5717, 1286, 3, 30, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Before filtering the final batch of 2008 Mad Elf we racked some beer into bourbon barrels for six weeks of tender loving care. After bottling, we aged the beer for approximately eight months. This allows the tart cherries to push to the front. Subtle vanilla, bourbon, charred wood, coconut and toasted nut endnotes emanate from Splinter Red.', 'http://www.troegs.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5719, 1062, -1, -1, '254 Wilkins Street', 'Morrisville', 'Vermont', 'United States', 'â€œRobust, Dark and Smooth, hold on to your hat cause youâ€™ll lose your feet on this one!â€ Brewed with pale, dark crystal, Munich, flaked barley, black and chocolate malts. Hops include Cascade, Crystal, Challenger and Perle.', 'http://www.rockartbrewery.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '44.5693, -72.6034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5720, 929, 2, 22, '2050 Yavapai Dr', 'Sedona', 'Arizona', 'United States', '', 'http://oakcreekbrew.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '34.8661, -111.796', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5721, 1220, 3, 33, '910 Montreal Circle', 'Saint Paul', 'Minnesota', 'United States', 'A richer shade of Red. Summit has artfully crossed the boundaries of traditional IPA and Amber styles to create a brew all our own. Featuring an aromatic blend of Horizon, Amarillo and Cascade hops with nicely balanced malts for a flavor youâ€™ll enjoy to the fullest.', 'http://www.summitbrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '44.9139, -93.1396', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5722, 259, 11, 141, '79 North Eleventh Street', 'Brooklyn', 'New York', 'United States', 'A seasonal winter beer from Brooklyn', 'http://www.brooklynbrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.7215, -73.9575', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5723, 1203, 5, 74, '', 'Baltimore', 'Maryland', 'United States', 'An ''American Farmhouse Ale.'' It''s a Belgian-inspired brew that uses a combination of European malts, hops from New New Zealand and the United States.. and a classic farmhouse yeast to achieve a fruity, yet spicy, melange of flavors and aroma.', 'http://www.stillwaterales.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.2904, -76.6122', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5724, 379, 3, 31, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'Jai Alai IPA is a monster interpretation of an American IPA. In fact, it is so big that it equals the alcohol of some double IPAs on the market. Our IPA uses 6 different hop varietals, with Simcoe hops only being used for dry hopping. The rest of the hop additions are blended at different IBU''s (International Bittering Units) in groups of three hops per addition in order to create more hop complexity. At CCB, we love hops but also feel that balance is important for IPAs. So Jai Alai features a sturday caramel malt component which helps to create balance, staving off hop astringency. Ultimately, Jai Alai is a very strong interpretation of a single American IPA. We hope that it makes Tampa Bay natives happy because this is head brewer Wayne Wamble''s favorite Cigar City beer and he''d love to share one with you!', 'http://cigarcitybeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5725, 379, 3, 38, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'Maduro is a Northern English-style brown ale with some American affectations. It is unlike the typical American Brown Ale, as it doesnâ€™t have the big hop character common in American-brewed Brown Ales. And Maduro is higher in alcohol than the common English brown ale. Maduro also has oats, in the malt bill which imparts a silky body and aids in making the roasted, toasted and chocolate components mesh together in Maduro''s complex malt profile. The end result is a remarkably full flavored yet approachable and sessionable brown ale that pairs well with cigars.', 'http://cigarcitybeer.com/', 5.50, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5726, 379, 3, 43, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'This Russian Imperial Stout is dedicated to Gregory Zhukov. Arguably one of World War II''s finest generals and a man bold enough to appreciate the rich, complex flavors of a beer brewed to fortify a body through the Russian winter. Like military geniuses, Russian Imperial Stouts reach their peak with a little age on them, so we release Marshal Zhukov''s Russian Imperial Stout in sweltering August so that it will be at peak flavor come January or February. Opaque black in color, the aroma has notes of espresso, chocolate, dark sweet toffee with hints of black strap molasses. The flavor starts with an unsweetened chocolate character and supporting notes of herbal dryness from English hop varietals. It then moves into dark toffee sweetness and closes with a slap of roasty espresso. Zhukov''s Imperial Stout pairs well with Mushroom Solyanka, dark chocolate, cherries and ground wars in Russia. Enjoy, comrade.', 'http://cigarcitybeer.com/', 11.00, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5727, 379, 5, 74, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'Guava Grove is a Saison which is fermented with guava. The guava adds sweetness and acidity to the prodigious fruity esters imparted by the warm fermentation temperatures of the Belgian yeast strain.', 'http://cigarcitybeer.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5728, 379, 1, 15, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'Big Sound Scotch Ale is dedicated to our good buddy Gino, the most punk rock bagpiper you''ll ever meet, and the rest of the men and women of Tampa Bay Pipes and Drums. Brown in color, Big Sound has huge notes of dark sweet toffee with underlying mild notes of coffee in the aroma. The flavor starts with a slight note of cherry and then opens into a Goliath of a malt character with notes of dark sweet toffee, slight hints of coffee and mild notes of toasted bread in the finish. Big Sound Scotch Ale pairs well with Haggis, Highland Games, Huge Heads and Enormous Pillows and of course Bagpipe music.', 'http://cigarcitybeer.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5729, 1150, 3, 31, '545 Turner Drive', 'Durango', 'Colorado', 'United States', '', 'http://www.skabrewing.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5730, 718, 3, 31, '87 Doe Run Rd', 'Manheim', 'Pennsylvania', 'United States', 'This is our offering to the hop heads! A decidedly hoppy, bitter, and moderately strong American IPA. We use a generous amount of whole leaf Cascade, Centennial and Citra hops to showcase the freshness and earthy flavors that only hops can provide.', 'http://www.joboysbrewpub.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '40.1707, -76.3838', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5731, 718, 3, 42, '87 Doe Run Rd', 'Manheim', 'Pennsylvania', 'United States', 'An intense and rich, dark, roasty ale with substantial alcohol warming. Requires several months of aging.', 'http://www.joboysbrewpub.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1707, -76.3838', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5732, 718, 11, 113, '87 Doe Run Rd', 'Manheim', 'Pennsylvania', 'United States', 'A crisp, clean, easy drinking, refreshing American ale with a light body.', 'http://www.joboysbrewpub.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.1707, -76.3838', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5733, 1091, 3, 43, '2522 Fairway Park Drive', 'Houston', 'Texas', 'United States', 'Important: let this beer warm to at least 50Â° before enjoying. This beer is black with some ruby highlights. The nose is full of pumpkin pie spices and some alcohol. There are notes of nutmeg, caraway and vanilla. The taste starts with chocolate malt with a hint of spice and rolls into a warm spicy alcohol taste which has the effect of creating the balance that usually comes from the hop bitter. There is some hop bitter on the finish, but not much. Overall, this beer finishes relatively dry for such a big beer. As it warms, the spices move forward in the taste and the chocolate moves to the finish. The pumpkin provides a pleasant undertone and a nice mouthfeel. The spices will probably fade some over time; they mellowed considerably while still in the fermenter.', 'http://www.saintarnold.com', 11.00, 0.00, 0.00, 0, '9999-01-01', '29.8123, -95.4675', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5799, 426, 3, 42, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'A full bodied stout made with all malted barley and blueberry. Flavors of chocolate, roast malt and light blueberry make up the palate with lots of fruity blueberry aroma.', 'http://www.darkhorsebrewery.com/', 4.50, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5734, 1044, 1, 5, '231 San Saba Court', 'Blanco', 'Texas', 'United States', 'Our winter seasonal is inspired by the great ales of the UK but brewed with a distinctively American attitude. English crystal malt gives Phoenixx its subtle toffee and caramel notes, but this ale is about hops. The blend of English hops, highlighted by its namesake, Phoenix, yields a complex hop character that dominates this special brew.', 'http://www.realalebrewing.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '30.113, -98.4156', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5735, 1, 5, 67, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'Made in the style of the Belgian wheat beers that are so refreshing, (512) Wit is a hazy ale spiced with coriander and domestic grapefruit peel. 50% US Organic 2-row malted barley and 50% US unmalted wheat and oats make this a light, crisp ale well suited for any occasion.', 'http://512brewing.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5736, 1, 3, 26, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'With Organic 2-row malted barley, (512) Pale is a copper colored American Pale Ale that balances earthy hop bitterness and hop flavor with a rich malty body.', 'http://512brewing.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5737, 1, 3, 31, '407 Radam, F200', 'Austin', 'Texas', 'United States', '(512) India Pale Ale is a big, aggressively dry-hopped American IPA with smooth bitterness (~65 IBU) balanced by medium maltiness. Organic 2-row malted barley, loads of hops, and great Austin water create an ale with apricot and vanilla aromatics that lure you in for more.', 'http://512brewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5738, 1, 2, 25, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'Nearly black in color, (512) Pecan Porter is made with Organic US 2-row and Crystal malts along with Bairdâ€™s Chocolate and Black malts. Its full body and malty sweetness are balanced with subtle pecan aroma and flavor from locally grown pecans. Yet another true Austin original!', 'http://512brewing.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5739, 1, 4, 57, '407 Radam, F200', 'Austin', 'Texas', 'United States', '(512) ALT is a German-style amber ale that is fermented cooler than typical ales and cold conditioned like a lager. ALT means â€œoldâ€ in German and refers to a beer style made using ale yeast after many German brewers had switched to newly discovered lager yeast. This ale has a very smooth, yet pronounced, hop bitterness with a malty backbone and a characteristic German yeast character. Made with 98% Organic 2-row and Munch malts and US noble hops.', 'http://512brewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5740, 1, 3, 38, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'At once cuddly and ferocious, (512) BRUIN combines a smooth, rich maltiness and mahogany color with a solid hop backbone and stealthy 7.6% alcohol. Made with Organic 2 Row and Munich malts, plus Chocolate and Crystal malts, domestic hops, and a touch of molasses, this brew has notes of raisins, dark sugars, and cocoa, and pairs perfectly with food and the crisp fall air.', 'http://512brewing.com/', 7.60, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5741, 1, 2, 25, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'Our first barrel project is in kegs and on itâ€™s way to beer bars around Austin. This is a bigger, bolder version of our mainstay Pecan Porter, with a richer finish. Two months on recently emptied Jack Daniels select barrels imparted a wonderful vanilla character from the oak and a pleasant amount of whiskey nose and flavor. All in all, Iâ€™m really proud of the hard work and effort put into this beer. Our first attempt at brewing it and our first attempt at managing barrels has paid off for everyone! Seek out this beer, but donâ€™t put it off. There is a very limited number of kegs available and it might go fastâ€¦', 'http://512brewing.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5742, 1173, 3, 32, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', '', 'http://www.southerntierbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5743, 157, 7, 77, '30 Germania Street', 'Boston', 'Massachusetts', 'United States', 'Samuel Adams Noble Pils is one of the only brews made with all five Noble hops from the worldâ€™s growing regions. its bright flavor and lively, citrus hop character reminds us that the warm days of spring are just a few weeks away.', 'http://www.samueladams.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '42.3144, -71.1034', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5744, 1286, 3, 42, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch #27-2010 begins a new fold in the Scratch series. For the next several batches individual Troegs brewers will create recipes of their choice. First up, The Ticeman had a hankering for a sweet stout, so the Troegs brothers and all the brewers met with Scharffen Berger Chocolate Company engineers to eat ridiculous amounts of cocoa nibs and chocolates over a few pints of beer. This collaboration resulted in the delivery of a special blend of cocoa nibs that were added during the boiling process. In addition to the nibs, lactose was added at the end of the boil to give a little sweetness in the body. The addition of Galena and Simcoe hops lends a subtle fruity balance. After primary fermentation, the beer was aged for three weeks on a blend of cocoa nibs and Ugandan vanilla beans. Dubbed Cocaoabunga, this unfiltered beer has a pleasant cocoa aroma, a subtle sweetness in the mouthfeel, a full-bodied flavor, and hints of vanilla. Enjoy!', 'http://www.troegs.com/', 6.70, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5745, 341, 3, 26, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'One of the first beers I brewed after moving out to California to begin my brewing education was a Pale Ale. This version is a true testament to the influences the Wild West had on my early brewing. My Pale Ale is loaded with US-grown Cascade, Crystal, and Columbus hops, so be sure to take a good sniff to enjoy their robust aromas before taking your first sip.', 'http://www.captainlawrencebrewing.com/', 5.60, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5746, 341, 5, 61, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'This beer is the result of the marriage between two very distinct beer styles; the Belgian Tripel & American IPA. We have taken the best qualities from both styles and allowed them to shine through. The fruity and spicy notes from the imported Belgian yeast strain & the pungent flavors and aromas of the American grown Amarillo hops flow seamlessly together to create this flavorful ale. Straight from the Captainâ€™s cellar to yours, we hope you enjoy.', 'http://www.captainlawrencebrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5747, 341, 5, 64, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'Don''t let the golden color fool you - this isn''t your father''s lite beer! Brewed with imported German malts and US-grown hops, this beer is a full-flavored introduction to craft-brewed beer. We add the hops late in the boil, allowing you to enjoy the flavor and aroma of the hops without an aggressive bitterness.', 'http://www.captainlawrencebrewing.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5748, 341, 2, 25, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'A complex beer, with layers of flavors unfolding as this beer slides down your throat. Before the introduction of indirect-fired malt kilns, all beers had a smoky flavor. Today only a handful of brewers produce beer reminiscent of those of the past. We use imported German smoked malt to add depth and complexity to our Smoked Porter.', 'http://www.captainlawrencebrewing.com/', 6.40, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5749, 341, 3, 32, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'This beer is a salute to the ingenuity and creativity of the American craft brewers. A uniquely American style of beer, the Double or Imperial IPA, has become the calling card of many craft brewers who aren''t afraid to push the limits of what hops can add to a beer. This beer is big and hoppy - not for the faint of heart! Be prepared to experience sensory overload as you savor this Imperial IPA.', 'http://www.captainlawrencebrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5750, 341, 5, 67, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'This beer was created as a summer thirst quencher, because we all know how hot and humid it can get in New York during the summer. We brewed this beer using both coriander and orange peel in the boil to increase both the aroma and flavor of this beer. Make sure you donâ€™t get burned this summer, drink your Sun Block.', 'http://www.captainlawrencebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5751, 341, 3, 38, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'Named after the little birds that fly by the brewery looking for grain after the weather turns cold, this was originally to be a Fall/Winter seasonal. Clearly we underestimated the market for this smooth and malty brown ale, and we have decided to keep it for year round enjoyment.', 'http://www.captainlawrencebrewing.com/', 4.80, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5752, 341, 5, 66, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'This is a truly unique brew, combining some unusual elements to create a powerful, yet flavorful brew. I brewed a similar beer to this one back in 1998, while I was home brewing out in California. Only this time around I decided to age it in bourbon barrels to add a new element to the already rich sensory profile. The combination of dark malt, elderberries and bourbon barrels makes for an interesting tasting experience. This is a sippinâ€™ beer, so sit back by the fire and enjoy. 12% alcohol by volume.', 'http://www.captainlawrencebrewing.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5753, 341, 5, 61, '99 Castleton Street', 'Pleasantville', 'New York', 'United States', 'Thereâ€™s nothing quite likes Momâ€™s apple pieâ€¦But I am willing to bet this beer is pretty darn close. An American Tripel, dry-hoped with Amarillo hops and aged in Apple Brandy barrels from one of this countryâ€™s oldest distilleries. The tropical aroma of the hops and the delicate apple aroma from the barrels are a perfect match. Straight from the Captainâ€™s cellar to yours, we hope you enjoy.', 'http://www.captainlawrencebrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.126, -73.7896', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5754, 705, -1, -1, '600 Elmira Road', 'Ithaca', 'New York', 'United States', 'Brewed with New York State Blueberries and Brettanomyces, Le Bleu is a blend of barrels filled in 2007, 2008, and 2009. It''s finished in the bottle with Champagne yeast. Enjoy the dusty rose appearance, mouthwatering aroma of ripe berries, piquant flavor and quick finish.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '42.4145, -76.5315', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5755, 549, 3, 43, '235 Grandville Avenue SW', 'Grand Rapids', 'Michigan', 'United States', '', 'http://www.foundersbrewing.com/', 9.40, 0.00, 0.00, 0, '9999-01-01', '42.9585, -85.6735', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5756, 540, 5, 72, '2401 Blake St.', 'Denver', 'Colorado', 'United States', 'â€œTwo inflammatory words... one wild drink. Nectar imprisoned in a bottle. Let it out. It is cruel to keep a wild animal locked up. Uncap it. Release it....stand back!! Wallow in its golden glow in a glass beneath a white foaming head. Remember, enjoying a RAGING BITCH, unleashed, untamed, unbridled- and in heat- is pure GONZO!! It has taken 20 years to get from there to here. Enjoy!â€', 'http://www.flyingdogales.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '39.7582, -104.99', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5757, 1103, 3, 31, '320 Pierce St', 'Black River Falls', 'Wisconsin', 'United States', '', 'http://www.sandcreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.2929, -90.8511', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5758, 858, 5, 72, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Chaotic yet hypnotic, Mayhem is a deliberate Double IPA, brewed and conditioned with a special Belgian yeast that contributes complexity and spice. Abundant American hops offer grapefruit, pine, must and mint, which play off the fullness and sweetness of pale malts then provide a biting yet enticing finish. Mayhem Double IPA accents the complex spice combinations found in Thai, Indian, Cajun, Morrocan, Mexican and Southwest American cuisines as well as BBQ marinades, dry rubs and sauces. Mayhem creates MAYHEM.', 'http://www.midnightsunbrewing.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5759, 858, 7, 92, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Beer Description: This double bock provides smooth sailin'' in rough seas. The fact that this luscious lager was aged in rum barrels creates the illusion that the open sea is a safe place. And while riding out these waves of grain, you may fall victim to the dangers of pirates, rum, bock. OK...maybe the beach is a bit over-rated.', 'http://www.midnightsunbrewing.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5760, 858, 11, 126, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'This gruit ale was inspired by the Phish song of the same name. A traditional gruit in style, Bathtub Gin was brewed without hops. Instead Ben spiced his beer with botanicals typically used to flavor gin: juniper berries, orris root, angelica root, grains of paradise, lemon peel, orange peel and coriander. The result is intensely fragrant, flavorful and fabulous.', 'http://www.midnightsunbrewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5761, 1173, 8, 95, '2051A Stoneman Circle', 'Lakewood', 'New York', 'United States', 'Neolithic humans evolved from nomadic hunters into a more settled agricultural society, changing life forever. The â€˜founderâ€™ crops they raised included wheat and barley. It is little surprise that the first examples of brewing appeared during this age. Brewers owe much to the epoch. Similarly, we thank our farmer friends of today for cultivating the ingredients the are responsible for the beers we now enjoy. Their laborious days spent ourdoors under the hot sun earn them respect, as well as a mark of distinction: the farmer''s tan. Yes, the inevitable red and white hallmark of hard work.', 'http://www.southerntierbrewing.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '42.1008, -79.3357', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5762, 1352, 3, 31, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'The latest in our Brewersâ€™ Select One-offs, India is a West Coast style IPA at [7.2%] ABV, with incredibly delicious hoppiness! Golden in color, this beer is tilted way over toward the hops by way of less specialty malts used in the mash. Draft will be going out to select wholesalers in PA, NJ, FL, and MD.â€ 70+ IBUâ€™s.', 'http://www.weyerbacher.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5763, 812, -1, -1, '5 Bartlett Bay Road', 'South Burlington', 'Vermont', 'United States', 'Magic Hat''s seasonal Lager is also called Vinyl', 'http://www.magichat.net/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4284, -73.2131', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5764, 459, 3, 32, '6 Cannery Village Center', 'Milton', 'Delaware', 'United States', 'An unfiltered and 100% bottle-conditioned version of 90 Minute IPA that''s dry-hopped with Palisade, Amarillo, Simcoe, Cascade, CTZ, and Willamette hops. Brewed to honor the Rogue Gallery in Portland, Maine, who will also be releasing a DFH designed clothing line in the summer of ''09.', 'http://www.dogfish.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '38.7683, -75.3107', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5765, 634, 3, 26, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'For the 28th session of the Harpoon 100 Barrel Series, weâ€™re celebrating this yearâ€™s hop harvest with Glacier Harvest Wet Hop beer, a pale ale made with fresh Glacier hops. Wet hop beers are brewed using fresh, â€œwetâ€ hops instead of traditional dried hopsâ€”hops contain about 60% moisture when they are first picked. Typically, when hops are picked they are quickly dried and refrigerated to increase shelf life and make them more consistent for brewing. Freshly picked wet hops, however, need to be used within hours of harvest or they will begin to degrade rapidly. Wet hops retain more of their natural aroma and volatile flavors that dissipate when dried. This gives wet hop beers a fresher hop flavor and aroma than that of beers hopped with processed hops. This yields an immersed, intense hop flavor in the beer. Harpoon brewer Ray Dobens, creator of the beer, added a heroic dose of fresh hops the day of the harvest.The hop flavor and aroma from this copper-colored ale comes from a generous late addition of freshly harvested â€œwetâ€ hops.', 'http://www.harpoonbrewery.com', 6.70, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5766, 44, 2, 22, 'One Busch Place', 'Saint Louis', 'Missouri', 'United States', 'Born of Irish tradition, this all-malt ale uses kilned and toasted malts to produce its all-natural, signature red shade. A beer with exceptional balance, Irish Red displays an initial sweetness that fades to a clean, dry finish.', 'http://www.anheuser-busch.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '38.5983, -90.209', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5767, 765, 3, 33, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', 'Our 13th Anniversary Beer in was a Staff Favorite, So We Make it Each Year. BIG on the Amarillo Hops and Rich Dark Malts for a Round and Huge, Smoky Flavor.', 'http://www.lagunitas.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5768, 1172, 3, 42, '1207 N. FM 3083 E.', 'Conroe', 'Texas', 'United States', 'Jet-black in color, this monster smells of coffee and chocolate. The taste is much of the same, with hints of creamy toffee and roasted malt. Smooth and delicious, this medium bodied ale is all about the malts, but has enough hop bitterness to be balanced.', 'http://www.southernstarbrewery.com/', 8.25, 0.00, 0.00, 0, '9999-01-01', '30.3489, -95.4427', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5769, 202, 5, 70, 'Gheudestraat 56', 'Anderlecht', 'Brussel', 'Belgium', 'The name Vigneronne Cantillon was given in 1987. This name reminds us that, while it belongs to the beer patrimony, the spontaneous fermentation, the ageing in the barrels for several years and the addition of grapes make it a distant cousin of certain white wines. In spite of its success, the Vigneronne represents less than 5% of the total production of the Cantillon brewery. In order to obtain grapes which are as mature as possible, we buy them at the end of the season. Every year, 1000 kilos of white italian grapes are delivered at the Cantillon brewery in the beginning of October.', 'http://www.cantillon.be/', 5.00, 0.00, 0.00, 0, '9999-01-01', '50.8416, 4.3355', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5770, 541, 3, 32, '1940 Olney Avenue', 'Cherry Hill', 'New Jersey', 'United States', 'The fourth stop on our multi-year trip to explore New Jersey takes us to one of the most maligned places in the state- the Hackensack Meadowlands. Itâ€™s the place usually identified with landfills, pipelines, mob burials (alleged) and sports teams that say theyâ€™re from New York. Although no longer home to forests of giant cedars and salt hay marshes teeming with aquatic life, the Meadowlands is still an amazingly diverse ecosystem providing vital animal and plant habitat. In a nod to a once common food plant here, weâ€™ve brewed this beer with wild rice. We also used brown and white rice, as well as two malts. Rice helps the beer ferment dry to better showcase the five different hops weâ€™ve added. Lots and lots of them. We then dry-hopped this Double IPA with even more-generous additions of Chinook and Citra hops to create a nose that hints at tangerine, mango, papaya and pine.', 'http://www.flyingfish.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '39.9121, -74.9701', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5771, 765, 3, 31, '1280 North McDowell Boulevard', 'Petaluma', 'California', 'United States', '', 'http://www.lagunitas.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '38.2724, -122.662', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5772, 426, 3, 43, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'It''s big and full bodied with lots of roasted malts and balanced with heavy hops to put this imperial in a league of its own.', 'http://www.darkhorsebrewery.com/', 12.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5773, 776, -1, -1, '7030 Roscoe Turner Rd', 'Kiln', 'Mississippi', 'United States', 'Southern Pecan Nut Brown Ale is the first beer in the world, to our knowledge, made with whole roasted pecans. The pecans are used just like grain and provide a nutty characteristic and a delightful depth to the flavor profile. This beer is very lightly hopped to allow the malty, caramel, and nutty flavors shine through. The color is dark mahogany. Southern Pecan won a Bronze Medal in the 2006 World Beer Cup in the Specialty Beer category.', 'http://www.lazymagnolia.com/', 4.25, 0.00, 0.00, 0, '9999-01-01', '30.3764, -89.4497', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5774, 1352, 3, 32, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', 'In 750ml corked â€™nâ€™ caged bottles this will be and unfiltered, fully bottle conditioned version of the super popular Double Simcoe. Expect Cask taste in a bottle, with more pronounced hoppy flavor and aroma due to being unfiltered. Also, carbonation will be a bit higher as is usual in our cork n cage series in keeping with tradition. It all comes together to form a uniquely great experience for hopheads.', 'http://www.weyerbacher.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5775, 1086, -1, -1, '725 Fourth Street', 'Santa Rosa', 'California', 'United States', 'Brown ale aged in Pinot Noir wine barrels for one year with sour cherries, Brettanomyces yeast, and Lactobacillus & Pedicoccus bacteria.', 'http://www.russianriverbrewing.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '38.4418, -122.712', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5776, 1260, 3, 32, '9750 Indiana Parkway', 'Munster', 'Indiana', 'United States', 'A dry and stupendously hopped medium bodied Imperial IPA brewed with Canadian two-row malt, dextrose sugar and lots of American hops. Arctic Panzer Wolf has superior aromas of marmalade, white wine, pine and apricot all mixed with an intense American hop bitterness.', 'http://www.threefloydspub.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '41.5354, -87.5158', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5777, 858, 3, 32, '8111 Dimond Hook Drive', 'Anchorage', 'Alaska', 'United States', 'Free Loader Double Red IPA was "double-brewed". [How''s that for a catchy term that those BiG brewers can''t TouCH. I love it, LoVe it, LOVE it.] The first batch of red IPA was mashed, sparged, and transferred to the kettle. The second batch of red IPA was mashed, sparged and transferred to the kettle using the sweet wort from batch one as its mash "water". Hmmm...using "beer" to make beer. Hence the name FREE LOADER. This Double Red IPA is just that--big, red, hoppy.', 'http://www.midnightsunbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '61.1473, -149.844', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5778, 673, 3, 43, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'This extreme Double Oatmeal Russian Imperial Stout will overwhelm, satisfy, and destroy your taste buds like no other!! D.O.R.I.S. is even darker, hoppier, and stronger than our gold medal winning B.O.R.I.S. The Crusher Stout. Dry hopped and first wort hopped and first wort hopped with the finest American hops for a great Imperial hops for a great Imperial Stout experience! Enjoy the darkness!', 'http://www.hoppinfrog.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5779, 673, 3, 32, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Some say â€œbigger is better!â€. At Hoppinâ€™ Frog, we built a massive hop dam to handle the enormous amount of hops added to this colossal American Triple I.P.A. An intense experience of citrus and piney hop character is complimented by layers of rich malt flavor. Behold our new standard for hoppy beers.', 'http://www.hoppinfrog.com/', 10.00, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5780, 673, 11, 141, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'The essence of Christmas is captured in this very bottle you are holding. Perfectly blended spices compliment Frosted Frogâ€™s rich malt flavors, creating the ultimate Christmas experience. Celebrate the holidays as you savor this very special seasonal offering.', 'http://www.hoppinfrog.com/', 8.60, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5781, 673, 3, 26, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Special hoppy flavors and aromas are captured by adding freshly picked, undired hops during the harvest. These wet hops impart a character unlike other brews, that is quite unique and satisfying for those who love hops â€“ the spice of beer. Smell the hop fields, smell the freshness.', 'http://www.hoppinfrog.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5782, 673, 11, 123, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'There''s a Place just south they call Frog''s Hollow, with cauldrons afire in Fall, and they only speak in whispers of the name. There''s a brewery they say who has the secret, of spices picked just right. With a crying shout, they''ll knock it out, and hand you this Frog''s delight.', 'http://www.hoppinfrog.com/', 8.40, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5783, 673, 1, 15, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Rich, malty flavors of caramelized and toasted grains dominate this strong Scotch ale. A hint of rye adds a crisp, Scotch-like, old-world beer character, reminiscent of a simpler life from centuries ago. â€œIt is a wee bit heavyâ€', 'http://www.hoppinfrog.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5784, 673, 3, 43, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Made from our B.O.R.I.S. Imperial Stout, that was rated one of the Worldâ€™s 50 Best Beers, and won the Gold Medal at the GABF in 2008. BARREL-AGED B.O.R.I.S. has picked up rich characters of vanilla, dark fruit, oak, and spice. Itâ€™s unbelievably complex and savory', 'http://www.hoppinfrog.com/', 9.40, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5785, 673, 5, 72, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'American hops and Belgian abbey beer flavors intermingle to create a spicy and assertive beer style all their own. Citrusy character from select hops dominate this assertive Double I.P.A., complimented by a unique Belgian flavor to add complexity and ultimate beer satisfaction. The result is a flavor combination thatâ€™s a whirlwind of taste sensations.', 'http://www.hoppinfrog.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5786, 673, 3, 32, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Explore the extremes of hops, and experience all of their bitterness, flavor and aroma with this Double I.P.A. An extreme, super-assertive and satisfying amount of American hop character is balanced with a toasty, caramelized, intense malt presence.', 'http://www.hoppinfrog.com/', 8.20, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5787, 673, 3, 31, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Raise your glass to the heavens in a toast to HOPS â€“ the spice of beer! This classic American I.P.A. features the finest American hops to add a spicy, assertive, and citrusy character to its full-bodied, rich malt taste', 'http://www.hoppinfrog.com/', 6.80, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5788, 673, 2, 25, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Dark, robust and silky-smooth, with many flavors of roasted, toasted and caramel malts. Porter is an old-world beer style, so popular that it helped start the industrial revolution. Taste the history.', 'http://www.hoppinfrog.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5789, 673, -1, -1, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'I.P.A. and Stout converge for a really great flavor combination! The assertive, hoppy character of our Hoppinâ€™ To Heaven I.P.A. is perfectly complimented by the intense, deep roasted taste of our B.O.R.I.S. Oatmeal-Imperial Stout.', 'http://www.hoppinfrog.com/', 7.80, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5790, 673, 5, 65, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Smooth malt flavors of this golden Belgian-style abbey ale are complimented by traditional imported ingredients. A slightly spicy and complex flavor makes this European celebration-style beer unique and refreshing', 'http://www.hoppinfrog.com/', 10.50, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5791, 673, 4, 50, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Traditional German-style, unfiltered wheat beer, with a lively balanced flavor. Although no fruit or spices were used in the brewing, these flavors are created by fermentation with special yeast from the oldest brewery in the world. Try Wild Frog Wheat with a slice of orange for a crisp, refreshing experience', 'http://www.hoppinfrog.com/', 6.00, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5792, 673, 11, 121, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'An abundance of fresh, natural fruit flavor makes this beer something special. You would think we picked the fruit moments before brewing.', 'http://www.hoppinfrog.com/', 4.30, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5793, 673, 11, 121, '1680-F East Waterloo Rd.', 'Akron', 'Ohio', 'United States', 'Fresh, natural fruit flavor and a hint of chocolate malt makes this dark beer something really special. The just picked, fresh fruit flavor is very evident in this beer.', 'http://www.hoppinfrog.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '41.0247, -81.4676', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5794, 605, 3, 43, '2516 Market Avenue', 'Cleveland', 'Ohio', 'United States', 'A Russian Imperial Stout with a hearty malt body and bold hop flavor.', 'http://www.greatlakesbrewing.com', 9.00, 0.00, 0.00, 0, '9999-01-01', '41.4844, -81.7042', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5795, 94, 3, 32, '345 Healdsburg Avenue', 'Healdsburg', 'California', 'United States', 'Crafted with a blend of American and English malts and aggressively hopped with Pacific Northwest hops, this beer reflects what our brewers believe to be the Apex of IPA.', 'http://www.bearrepublic.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '38.6112, -122.871', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5796, 645, -1, -1, '', 'Ocean', 'New Jersey', 'United States', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '39.9653, -74.3118', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5797, 444, 2, 25, '323-C Cross Street', 'Little Rock', 'Arkansas', 'United States', 'This medium bodied porter has notes of roasted and chocolate malts, making it a perfect balance of sweet and bitter. Generous hops give this brew a dry finish.', 'http://www.diamondbear.com/', 4.99, 0.00, 0.00, 0, '9999-01-01', '34.7473, -92.2839', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5798, 1038, 1, 15, '701 Galveston Ave', 'Fortworth', 'Texas', 'United States', 'Break out the bagpipes with your lederhosen! Weâ€™re proud to present our Iron Thistle Scotch Ale â€“ Rahrâ€™s first National Grand Champion winner. This dark, Scottish ale has a bold taste dominated by a smooth, sweet maltiness balanced with a low, hoppy bitterness. So don your kilts and enjoy. Hereâ€™s to your health â€“ SlÃ inte! Prosit!', 'http://www.rahrbrewery.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '32.7366, -97.3274', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5801, 426, 1, 21, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'Number one in a series of five stouts produced to help ease you through the cold and grey midwestern winters. This beer is full bodied with hints of chocolate, roasted barley, coffee flavors and a nice creamy head.', 'http://www.darkhorsebrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5802, 426, 1, 20, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'This beer is made with milk sugar (lactose) which gives this beer a nice creamy mouth feel which mingles with hints of chocolate and roasty flavors.', 'http://www.darkhorsebrewery.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5803, 426, 3, 35, '511 S. Kalamazoo Ave.', 'Marshall', 'Michigan', 'United States', 'A barley wine style ale brewed to 15% alc with hints of raisin, chocolate, carmel, sherry, cherry, and alcohol, just to name a few and this beer will only get better with age.', 'http://www.darkhorsebrewery.com/', 15.00, 0.00, 0.00, 0, '9999-01-01', '42.2667, -84.9641', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5804, 29, 3, 31, '2351 Alpine Boulevard', 'Alpine', 'California', 'United States', 'A West Coast IPA. Our original single IPA made with Simcoe and Amarillo hops â€œin harmony.â€ 1.065 OG 45 IBU 7%ABV', 'http://www.alpinebeerco.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '32.8355, -116.765', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5805, 29, 3, 31, '2351 Alpine Boulevard', 'Alpine', 'California', 'United States', 'A Golden Rye IPA. An outstanding hop from New Zealand, Nelson Sauvin, is generously used throughout the brewing and dry-hopping of this unique beer. European rye is added for a smooth, malty addition to flavor. 1.065 OG 7%ABV', 'http://www.alpinebeerco.com/', 7.00, 0.00, 0.00, 0, '9999-01-01', '32.8355, -116.765', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5806, 678, -1, -1, '2944 SE Powell Blvd', 'Portland', 'Oregon', 'United States', 'Secession is a Black IPA, or Cacadian Dark Ale. This emerging beer style is characterized by an alliance of North-west hop flavors as formidable as the Cascade Mountain Range and roasted malts as dark as a moonless night. Join the party and uncap a revolution!', 'http://hopworksbeer.com/', 6.50, 0.00, 0.00, 0, '9999-01-01', '45.4969, -122.635', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5807, 379, 3, 31, '3924 West Spruce Street Suite A', 'Tampa', 'Florida', 'United States', 'he Humidor Series is a rotating offering of Cigar City Brewing beer aged on cedar. Cedar has a more subtle effect on beer than more traditional woods like oak. But, we think that once you taste it youâ€™ll agree that cedar deserves a place alongside oak in the brewerâ€™s wood-aging toolbox.', 'http://cigarcitybeer.com/', 7.50, 0.00, 0.00, 0, '9999-01-01', '27.9587, -82.5093', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5808, 825, 3, 31, '111 Marble Ave NW', 'Albuquerque', 'New Mexico', 'United States', 'Congratulations! By drinking Marble Brewery India Pale Ale, you show exceptionally good taste. Our obsession with quality and attention to detail ensures that every bottle will meet your high expectations. The Columbus, Amarillo and Centennial hops lend a fragrant citrus aroma and snappy hop character. We think you will agree that this is one rock solid beer.', 'http://marblebrewery.com/', 6.20, 0.00, 0.00, 0, '9999-01-01', '35.0928, -106.647', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5809, 1009, 3, 32, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'A Double IPA brewed in memory of the brew cat. In honor of Mongo, Mike Rodriguez made his first Double IPA, as he loved the cat and wanted to honor him with this beer. This 8.5% abv beer was made with Columbus hops (Mongoâ€™s Birthname), Cascade for the Mama cat, and Simocoe because that is Mikeâ€™s favorite hop.', 'http://www.portbrewing.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5810, 328, 3, 31, '540 Clover Lane', 'Ashland', 'Oregon', 'United States', 'IPA brewed with 100% Centennial hops. Big round mouthfeel, very perfumey. Different from our canned IPA. Gotta love the Pacific NW!', 'http://www.calderabrewing.com', 6.80, 0.00, 0.00, 0, '9999-01-01', '42.1844, -122.663', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5811, 1213, 1, 1, 'Braidleigh Lodge 22 Shore Road', 'Killyleagh', 'County Down', 'Ireland', 'Brilliant golden ale with an inviting citrus fragrance of late added Cascade and Glacier hops. The fine hop and light malt aromas carry through to the palate to give an ale that is full but refreshing, with a clean caramel malt bitter finish.', 'http://slbc.ie/', 4.70, 0.00, 0.00, 0, '9999-01-01', '54.3906, -5.6548', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5812, 1213, 1, 3, 'Braidleigh Lodge 22 Shore Road', 'Killyleagh', 'County Down', 'Ireland', 'Light and refreshing on the palate, our session best bitter has a classic Irish malt & traditional hop aroma. Light amber in colour, this smooth beer has hints of caramel with a woody bitterness.', 'http://slbc.ie/', 4.20, 0.00, 0.00, 0, '9999-01-01', '54.3906, -5.6548', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5813, 1213, 1, 1, 'Braidleigh Lodge 22 Shore Road', 'Killyleagh', 'County Down', 'Ireland', 'Golden with a hint of red (towards sunset). Barelegs tastes of fresh fruit, especially red current and malt fragrance. Full drinking with a subtle hoppy finish. Refreshing for a beer of this strength.', 'http://slbc.ie/', 4.50, 0.00, 0.00, 0, '9999-01-01', '54.3906, -5.6548', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5814, 1213, 11, 116, 'Braidleigh Lodge 22 Shore Road', 'Killyleagh', 'County Down', 'Ireland', 'Our smooth yet powerful wheat beer is unusually refreshing on the pallet. Golden in colour, St. Patrick''s Gold is brewed with barley and wheat malt. Citrus peel and coriander are added to the Goldings and Saaz hops for a symphony of authentic flavour.', 'http://slbc.ie/', 4.80, 0.00, 0.00, 0, '9999-01-01', '54.3906, -5.6548', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5815, 1213, 1, 1, 'Braidleigh Lodge 22 Shore Road', 'Killyleagh', 'County Down', 'Ireland', 'A deep copper coloured traditional Irish Ale with highly developed and complex flavours. St Patrickâ€™s Ale/Dark is brewed with four malts and two hops, carefully married together to complement eachother producing a satisfying full flavour, ending with a Styrian late hop for a truly brilliant finish.', 'http://slbc.ie/', 6.00, 0.00, 0.00, 0, '9999-01-01', '54.3906, -5.6548', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5816, 718, 3, 33, '87 Doe Run Rd', 'Manheim', 'Pennsylvania', 'United States', 'Our flagship beer, is amber to red in color with a medium body, slight caramel sweetness, and a balance more towards malt than hops. This beer is a true crowd-pleaser and keeps you coming back for more.', 'http://www.joboysbrewpub.com/', 5.25, 0.00, 0.00, 0, '9999-01-01', '40.1707, -76.3838', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5817, 585, 3, 43, '1800 North Clybourn Avenue', 'Chicago', 'Illinois', 'United States', 'Everyday Goose Island smells the wonderful coffee roasting next to our brewery at Chicago''s Intelligentsia Coffee and Tea. They put the same passion and skill into their coffee as Goose Island does with its beer. This excellent stout is made with Black Cat Espresso beans from our friends next door. You''ll like the combination.', '', 13.00, 0.00, 0.00, 0, '9999-01-01', '41.9137, -87.6543', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5818, 1251, 3, 30, '155 Mata Way Suite 104', 'San Marcos', 'California', 'United States', 'own in Kentucky and across the pond in Scotland, distillers who age their whiskeys for many years refer to the evaporation of the spirits from their barrels as "The Angel''s Share." We couldnâ€™t agree more. Each time a barrel is filled, a measure of liquid seeps into the oak and is lost for good. This striking Strong Ale is brewed with copious amounts of Caramel malt to emphasize the vanilla and oak flavors found in freshly emptied bourbon or brandy barrels. The beer spends a year in oak before it is packaged for release. The beer is 12.5% ABV and is available in 375ml and 750ml bottles and on draft at inspired locations.', 'http://www.lostabbey.com/', 12.50, 0.00, 0.00, 0, '9999-01-01', '33.1406, -117.15', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5819, 1352, 4, 57, '905 Line Street', 'Easton', 'Pennsylvania', 'United States', '', 'http://www.weyerbacher.com/', 8.50, 0.00, 0.00, 0, '9999-01-01', '40.6732, -75.2249', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5820, 87, 3, 32, '429 W. 3rd St', 'Williamsport', 'Pennsylvania', 'United States', '2x4 India Pale Ale (7% ABV, 65 IBUs) sports Columbus, Nugget and Amarillo hops for a spicy, citrusy blend in both flavor and aroma. Backed by golden pale malts and a kick from flaked rye, the hops are pleasantly robust with just the right touch of bitterness at the end.', 'http://www.bavarianbarbarian.com', 7.00, 0.00, 0.00, 0, '9999-01-01', '41.238, -77.0103', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5821, 358, -1, -1, '351 Allen Street', 'Amherst', 'Wisconsin', 'United States', 'A coffee lover''s delight! A wonderful stout infused with coffee that is specially roasted for us by Emy J''s (www.emyjs.com) in Stevens Point, WI.', 'http://www.centralwaters.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.4419, -89.2797', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5822, 656, -1, -1, '445 St.Paul Street', 'Rochester', 'New York', 'United States', '', '', 5.68, 0.00, 0.00, 0, '9999-01-01', '43.1646, -77.6155', '2018-10-05');
