INSERT INTO beerbuddies_db.beer VALUES (5824, 859, 3, 31, 'Slien 2, 2. tv', 'KÃ¸benhavn', '', 'Denmark', 'The first in a new series of single hop IPA''s from Mikkeller. Brewed with Simcoe, known for many great US micro-brews. An extremely fresh-hopped IPA.', 'http://www.mikkeller.dk/', 6.90, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5825, 700, 3, 32, '620 South Madison Street', 'Wilmington', 'Delaware', 'United States', 'American style double IPA, full bodied malt flavor supports a ridiculous amount of hops, giving it pronounced bitterness and overwhelming hop flavor and aroma. Made with 5 pounds of hops per barrel.', 'http://www.ironhillbrewery.com/', 9.00, 0.00, 0.00, 0, '9999-01-01', '39.745, -75.5561', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5826, 1172, 3, 26, '1207 N. FM 3083 E.', 'Conroe', 'Texas', 'United States', 'A deep copper colored ale with a substantial malt backbone accented with British crystal malts with aggressive hop bitterness and substantial American hop flavor and aroma. The yeast profile is neutral.', 'http://www.southernstarbrewery.com/', 6.30, 0.00, 0.00, 0, '9999-01-01', '30.3489, -95.4427', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5827, 45, 11, 141, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', '', 'http://www.abcbrew.com', 7.70, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5828, 236, 3, 32, '471 Kalamath Street', 'Denver', 'Colorado', 'United States', 'Hoppy? Brother, 471 IPA redefines hoppy. 471 is a small batch, limited edition ale that was created by our Brewmaster to separate the weak from the strong. 471 is a double IPA, that combines Pale, Munich, Caramel-30, Carapils and Torrified Wheat malts, with Chinook, Centennial, Simcoe and Fuggles hops. It has a big sweet mouthfeel, followed by more hoppiness than you''ve ever had at one time. Enjoy.', 'http://www.breckbrew.com/', 9.20, 0.00, 0.00, 0, '9999-01-01', '39.7236, -105.001', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5829, 45, 3, 31, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'A series of single hop, small batch IPAs brewed in Camp Hill. These IPAs showcase the bitterness, flavor, and aroma of each particular hop variety.', 'http://www.abcbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5830, 45, 3, 31, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'A series of single hop, small batch IPAs brewed in Camp Hill. These IPAs showcase the bitterness, flavor, and aroma of each particular hop variety.', 'http://www.abcbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5831, 45, 3, 31, '50 N. Cameron St.', 'Harrisburg', 'Pennsylvania', 'United States', 'A series of single hop, small batch IPAs brewed in Camp Hill. These IPAs showcase the bitterness, flavor, and aroma of each particular hop variety.', 'http://www.abcbrew.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.2659, -76.8753', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5832, 133, 5, 67, '600 Brea Mall', 'Brea', 'California', 'United States', '', 'http://www.bjsrestaurants.com/beer.aspx', 4.70, 0.00, 0.00, 0, '9999-01-01', '33.9132, -117.889', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5833, 1286, 3, 31, '800 Paxton Street', 'Harrisburg', 'Pennsylvania', 'United States', 'Scratch 31, the brothers and the brewers decided to revisit one of our favorite sweet spots â€“ IPA â€“ and have some fun with hop flavors. Dubbed â€˜Citra of Brotherly Loveâ€™ in honor of Philly Beer week, Scratch #31 has generous amounts of Apollo, Cascade and Citra hops. This is our first use of Citra hops, which is known for an intense grapefruit aroma and flavor. While showcasing the intense Citra flavor we added additional bitterness with Apollo and Chinook hops as well. Scratch #31 went through a bed of Chinook hops in the hopback and was dry-hopped with Cascade and Citra hops.', 'http://www.troegs.com/', 7.40, 0.00, 0.00, 0, '9999-01-01', '40.2559, -76.8715', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5834, 634, 3, 32, '306 Northern Avenue', 'Boston', 'Massachusetts', 'United States', 'Harpoon Leviathan Imperial IPA will challenge your senses and your palate. As the vibrant aroma rushes out of your glass you will notice the blend of piney and tropical fruit notes. At first sip, this big beer starts with apowerful hop bitterness up front and an aggressive hop flavor and character throughout. Leviathan Imperial IPA is brewed with tons of pale malt and just enough caramel malt to provide a sweet malt body to balance the hop intensity. We used copious amounts of a variety of hops including Chinook, Centennial, Simcoe, and Amarillo at various points during the boil to create a complex hop flavor and clean lingering bitter finish. We then fermented the beer with Harpoonâ€™s own versatile proprietary yeast. Finally, we dry hopped at a rate of over 1 lb a barrel to produce this beerâ€™s massive aroma.', 'http://www.harpoonbrewery.com', 10.00, 0.00, 0.00, 0, '9999-01-01', '42.3465, -71.0338', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5835, 1044, 11, 119, '231 San Saba Court', 'Blanco', 'Texas', 'United States', 'Tawny red and full of malt and hops, Full Moon''s unique flavor truly satisfies. The smooth sweetness of malted rye and barley is complemented by generous helpings of Willamette and Cascade hops, resulting in an assertive American amber ale.', 'http://www.realalebrewing.com/', 5.70, 0.00, 0.00, 0, '9999-01-01', '30.113, -98.4156', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5836, 1044, 3, 26, '231 San Saba Court', 'Blanco', 'Texas', 'United States', 'Deep golden and malty, with a spicy hop flavor and well balanced hop bitterness, Rio Blanco is a uniquely Texan interpretation of an English-style pale ale. Czech Saaz hops provide a crisp finish and delicate aroma.', 'http://www.realalebrewing.com/', 5.30, 0.00, 0.00, 0, '9999-01-01', '30.113, -98.4156', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5837, 742, 3, 30, '1257, Kounsosu', 'Ibaraki', 'Kanto', 'Japan', 'Dark ale with a tan head. Subtle sake flavor from cask aging.', '', 8.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5838, 914, 3, 42, '', '', '', 'Japan', 'A very yeasty beer with an earthy aroma. Rich flavors deepen the stout character.', '', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5839, 1348, 11, 121, '', '', '', 'United Kingdom', 'A silky, crisp, and rich amber-colored ale with a fluffy head and strong banana note on the nose.', 'http://www.bombardier.co.uk/bombardier', 5.20, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5840, 23, 5, 74, '100 Industrial Way', 'Portland', 'Maine', 'United States', '', 'http://www.allagash.com/', 8.30, 0.00, 0.00, 0, '9999-01-01', '43.7028, -70.3166', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5841, 1394, 2, 22, '209 Technology Park Lane', 'Fuquay Varina', 'North Carolina', 'United States', 'A somewhat classic Irish Red Ale. This ale is feisty and a bit hoppy. There is a malty sweetness and a somewhat dry finish. Traditional East Kent Goldings but with a nice touch of Cascade and dash of roasted barley give this ale a great taste. ALWAYS AVAILABLE...or at least we try.', 'http://www.aviatorbrew.com/', 6.10, 0.00, 0.00, 0, '9999-01-01', '35.6197, -78.8085', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5842, 1394, 3, 30, '209 Technology Park Lane', 'Fuquay Varina', 'North Carolina', 'United States', 'A hearty extra special beer or basically a pale ale on steroids. A dark amber beer with a rich blend of malts. The base malt is full kilned pale 2-row barley and is combined with full tasting crystal malt. This beer has a great heavy late hop addition of East Kent Goldings (that cost us our lunch money for weeks...). ALWAYS AVAILABLE or at least we try.', 'http://www.aviatorbrew.com/', 5.80, 0.00, 0.00, 0, '9999-01-01', '35.6197, -78.8085', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5843, 1, 5, 65, '407 Radam, F200', 'Austin', 'Texas', 'United States', 'Our first anniversary release is a Belgian-style strong ale that is amber in color, with a light to medium body. Subtle malt sweetness is balanced with noticeable hop flavor, light raisin and mildly spicy, cake-like flavors, and is finished with local wildflower honey aromas. Made with 80% Organic Malted Barley, Belgian Specialty grains, Forbidden Fruit yeast, domestic hops and Round Rock local wildflower honey, this beer is deceptively high in alcohol.', 'http://512brewing.com/', 8.00, 0.00, 0.00, 0, '9999-01-01', '30.2234, -97.7697', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5847, 1396, 3, 33, '555 North Mill Street', 'Aspen', 'Colorado', 'United States', 'Have you ever heard of an ESB? In most cases, it stands for Extra Special Bitter, and man is this red extra special. Conundrum walks the line between a malt-centric sweet ale and a hop-centric bitter ale so well, it', 'http://aspenbrewingcompany.com', 7.00, 65.00, 13.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5848, 1397, 3, 31, '8845 Quail Lane', 'Manhattan', 'KS', 'United States', 'Oasis is a Double ESB/IPAish beer that came about from playing around with one of Jeff', 'http://www.tallgrassbeer.com', 7.20, 93.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5849, 1399, 3, 26, '4201 Tonnelle Avenue', 'North Bergen', 'NJ', 'United States', '', 'http://www.njbeerco.com', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5850, 1326, 3, 41, '420 Acorn Lane', 'Downingtown', 'Pennsylvania', 'United States', 'The tenacious grip of big, juicy hop aroma and character slides smoothly into rich, dark malts. This heavyweight battle between fresh, Yakima Valley hops and dark, roasted malts is resolved harmoniously as the flavors merge to deliver complex satisfaction with a warming edge. Bask in the', 'http://www.victorybeer.com', 8.70, 0.00, 0.00, 0, '9999-01-01', '40.0061, -75.6942', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5851, 1400, 2, 22, '619 10th St. South', 'Minneapolis', 'Minnesota', 'United States', 'Finnegans Irish Amber is brewed with potatoes and three varieties of imported two-row malts. The beer is pale amber in color but light in body. A gentle hop bitterness compliments its complex malt character. Finnegans is currently available on tap and in liquor stores throughout the state of Minnesota. Finnegans is unique in that 100% of the profits are donated to The Finnegans Community Fund which disburses grants to help the working poor and at-risk youth throughout Minnesota.', 'http://www.finnegans.org', 4.60, 0.00, 0.00, 2147483647, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5852, 415, 1, 3, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'A tasty, moderately hoppy, easy to drink beer with an orange marmalade hue with a frothy, off-white head. An herbal hop aroma with a hint of lemon and pine. This beer is not overly bitter, with orangy citrus and pine hop with slight earthy notes! There is a malty biscuit flavor that balances the hops. Makes me wish I had some Fish & Chips!!', 'http://www.crickethillbrewery.com', 5.50, 31.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5853, 415, 8, 105, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'Cricket''s Nocturne: a dark lager that combines a mild crispness with subtle toasty, chocolate notes to make it the perfect thirst quencher on days when there''s a chill in the air. It;s a great accompaniment to hearty winter meals, or dessert by the fireside.', 'http://www.crickethillbrewery.com', 4.50, 19.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5854, 415, 3, 33, '24 Kulick Road', 'Fairfield', 'New Jersey', 'United States', 'Our Fall release is a harvest Ale with a lighter amber color and a beige head with good retention. There is a good balance of earthy malt and a blend of floral and pine hops in the nose. Biscuit notes mixing with caramel sweetness.do their job to complement the rest of the flavors.This is an enjoyable seasonal for sure!', 'http://www.crickethillbrewery.com', 4.80, 0.00, 0.00, 0, '9999-01-01', '40.8726, -74.2964', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5855, 1401, 3, 31, '550 Roseberry Street', 'Winnipeg', 'Manitoba', 'Canada', 'To admit that the brewer at Half Pints is a bit of a hophead is an understatement. This India Pale Ale is unabashedly hoppy, not only from the Amarillo hops we add to the brew kettle, but also from the northwest U.S. variety called Cascade that we add directly to the final tank. A firm toasted malt presence forms the background for all of these hops, and we''re confident our Little Scrapper IPA could take other so-called IPA''s to the mat if called upon to do so. Try it with a curry or a basket of beer battered fish & chips. Serve in a glass at 8 degrees celcius. Unpasturized.', 'http://www.halfpintsbrewing.com', 6.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5856, 10, 3, 38, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Christmas Ale is an American style Brown Ale. It is hopped with Willamette, Cascade, and Columbus hops and has a good hop flavor and aroma.', 'http://www.abita.com/', 5.50, 38.00, 35.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5857, 62, 1, 14, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'A super-caramelly, oak-aged English-style strong ale. The oak is very apparent in this rich and high gravity ale. Additional depth and complexity result in a woody and cask-like nose, with a pronounced vanilla flavor on the palate. As of 2007, the use of additional roasted malt has resulted in subtle bitternes to balance the natural sweetness.', 'http://www.averybrewing.com/', 14.50, 41.00, 12.00, 7, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5858, 62, 1, 14, '5763 Arapahoe Avenue', 'Boulder', 'Colorado', 'United States', 'A winter strong ale with mahogany hue, a hint of hazelnuts and a finish reminiscent of mocha and toffee. No spices, just a perfect blend of five specialty malts.', 'http://www.averybrewing.com/', 8.00, 30.00, 0.00, 7, '9999-01-01', '40.0166, -105.219', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5859, 144, 3, 26, '161 River Avenue', 'Patchogue', 'New York', 'United States', 'Blue Point Brewing''s Pale Ale has a light golden color but explodes with a rich full-flavor. This refreshing ale is top-fermented and hopped at four different stages of the brewing process. English pale malt lends complexity to this brew. Small amounts of Wheat and Carapils round out the malt bill. Brewed to satisfy the hop lover, this pale ale has an immediate floral-citrus flavor that pervades the overall character of this hoppy, quenching microbrew.', 'http://www.bluepointbrewing.com/', 5.00, 36.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5860, 144, 7, 84, '161 River Avenue', 'Patchogue', 'New York', 'United States', 'Blue Point Octoberfest is another palate-pleasing seasonal brew. Originally brewed in 1810 to celebrate the betrothal of the Crown Prince of Bavaria, Blue Point continues the celebration by traditionally brewing this special malty amber lager every October. Octoberfest lager is stored cold for 2 months to ensure its distinct smooth flavor. Tap a pint and celebrate the season!', 'http://www.bluepointbrewing.com/', 5.01, 28.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5861, 144, 3, 43, '161 River Avenue', 'Patchogue', 'New York', 'United States', 'An extremely complex version of the classic Russian beer style. Roasted, black, and chocolate malts deliver multi-layered coffee and sherry notes in a surprisingly smooth package. The beer is then matured with just a kiss of real sour red cherries.', 'http://www.bluepointbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '40.7591, -73.0215', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5862, 49, 2, 24, 'St. James''s Gate', 'Dublin', '', 'Ireland', 'Foreign Extra Stout is brewed with generous hops and roasted barley for a bittersweet balance & full-flavored, natural bite. Developed over 200 years ago for global export from Ireland, the addition of extra hops ensured this Stout would arrive to its destination in perfect condition. Today, Guinness Foreign Extra Stout is enjoyed by millions of people around the world.', 'http://www.guinness.com', 7.50, 0.00, 0.00, 0, '9999-01-01', '53.3433, -6.2846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5863, 1149, 11, 113, '40 Van Dyke St', 'Brooklyn', 'New York', 'United States', 'Our most basic interpretation of what makes beer great -- sweetness from the barley malt and active spice from the hops. It is hazy golden in color, with a sweet honey aroma, and a dry, crisp flavor', 'http://www.sixpointcraftales.com/', 5.20, 0.00, 0.00, 0, '9999-01-01', '40.674, -74.0118', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5864, 1204, 5, 64, '1999 Citracado Parkway', 'Escondido', 'California', 'United States', 'Fermented with the legendary Ardennes strain of Belgian yeast, 10.10.10 is a Belgian Strong Pale Ale brewed with pale malt and triticale (a cross of wheat and rye), hopped with German Perle hops, and steeped with chamomile during the whirlpool stage. In secondary fermentation, we added a juice blend of Muscat, Gewurztraminer, and Sauvignon Blanc grape varieties.', 'http://www.stonebrew.com/', 9.50, 0.00, 0.00, 0, '9999-01-01', '33.1157, -117.12', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5865, 1271, 3, 38, '1401 Miner Street', 'Idaho Springs', 'Colorado', 'United States', 'Commemorating the 10th anniversary of Tommyknocker Brewery, this special brew is meticulously crafted with pure maple syrup, the highest quality chocolate and crystal malts and is accented with the finest blend of European and American hops. Imperial Nut Brown Ale, at 9.8% alcohol by volume, is a bigger, bolder version of their Maple Nut Brown.', 'http://www.tommyknocker.com/', 9.80, 0.00, 0.00, 0, '9999-01-01', '39.7418, -105.518', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5866, 959, 3, 46, '793 Exchange Street', 'Middlebury', 'Vermont', 'United States', 'Brewed with organic roasted barley and chocolate malts for a rich, dark and robust flavor with an infusion of organic vanilla beans and coffee from the Dominican Republic farm community Alta Gracia.', 'http://www.ottercreekbrewing.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '44.0197, -73.1693', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5867, 206, 7, 79, 'Am Deich 18-19', 'Bremen', 'Bremen', 'Germany', '', '', 0.00, 0.00, 0.00, 0, '9999-01-01', '53.0787, 8.7901', '2018-10-05');
