INSERT INTO beerbuddies_db.beer VALUES (5869, 618, 8, 96, '', 'Mexico City', '', 'Mexico', '', 'http://www.gmodelo.com.mx/', 4.10, 0.00, 0.00, 0, '9999-01-01', '19.427, -99.1276', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5870, 1402, 11, 121, '114 Little York Rd', 'Warwick', 'NY', 'United States', '', 'http://www.wvwinery.com', 4.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5871, 1246, 3, 33, '715 Dunn Way', 'Placentia', 'California', 'United States', '75% American Red Ale, 25% Ale Aged in American Oak Barrels. A brash American Red ale, dripping with citrusy Centennial hops, mellowed by a touch of oak. Aromas of toffee, citrus, crushed herbs, vanilla and fresh sawn oak. Complex!', 'http://www.thebruery.com/', 6.90, 0.00, 0.00, 0, '9999-01-01', '33.8614, -117.88', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5872, 1312, 8, 96, '1/1 Vittal Mallya Road', 'Bangalore', '', 'India', '', '', 4.80, 0.00, 0.00, 2147483647, '9999-01-01', '12.9689, 77.5946', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5873, 1092, 3, 26, '2100 Locust Street', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.schlafly.com/', 5.90, 50.00, 10.00, 0, '9999-01-01', '38.633, -90.21', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5874, 1092, 3, 42, '2100 Locust Street', 'Saint Louis', 'Missouri', 'United States', '', 'http://www.schlafly.com/', 5.70, 30.00, 47.00, 0, '9999-01-01', '38.633, -90.21', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5875, 1404, 3, 26, '2100 Locust Street', 'St. Louis', 'MO', 'United States', 'APPEARANCE: Amber red, bright PROCESS: Classic English HOPS: East Kent Goldings (UK), Northdown (UK), Pilgrim (UK) MALTS: 2-Row and Caramel Malted Barley YEAST: London Ale OG: 11.2 SRM: 13.5', 'http://http://www.schlafly.com', 4.40, 25.00, 13.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5876, 1405, 9, 106, '6 Verkhny per., d. 3', 'St. Petersburg', '', 'Russia', 'appearance: deep, dark brown to black, deep tan head smell/taste: sweet, malty, roasted coffee, molasses full-bodied, smooth, minimal carbonation', 'http://baltikabeer.com/', 7.00, 20.00, 30.00, 2147483647, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5877, 1407, 3, 31, 'P.O. Box 1154', 'Glen Alpine', 'NC', 'United States', 'This golden straw colored IPA is made with 5 varieties of malts and 6 massive hop additions. It is outstanding in flavor and aromatics.', 'http://www.catawbavalleybrewingcompany.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5878, 49, 2, 23, 'St. James''s Gate', 'Dublin', '', 'Ireland', '', 'http://www.guinness.com', 4.30, 0.00, 0.00, 0, '9999-01-01', '53.3433, -6.2846', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5879, 1409, 4, 58, '525 Short St.', 'Columbus', 'OH', 'United States', 'This traditional Bavarian-style kellerbier originated from the small artisanal breweries of Franconia, where it is still a favorite in the local beer gardens. Ours is served unfiltered with a crisp, smooth finish that taste like sunshine.', 'www.columbusbrewingco.com', 5.30, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5880, 1410, 3, 34, '1812 Post Road', 'Plover', 'WI', 'United States', 'Anniversary offering, Imperial Red. Heavily hopped and oak aged, very balanced. 12 oz. bottles; 4 pack. ABV: 9.2%', 'http://www.osobrewing.com/Home.php', 9.20, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5881, 1391, 3, 38, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'Many Mexican beer styles today are descendants of old Austrian styles, from when Austria ruled Mexico in the late 19th century. Our Dos Perros is made with German Munich malt, English Pale malt, and Chocolate malt, and hopped with Perle and Saaz hops. To lighten the body, as many Mexican brewers do, we add a small portion of flaked maize. The result is a wonderfully bready malt aroma, balanced with some maize sweetness and a noble hop finish.', 'http://www.yazoobrew.com', 3.50, 21.00, 13.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5882, 1391, 3, 30, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'A new version of an American classic. Our Yazoo Pale Ale bursts with spicy, citrusy hop aroma and flavor, coming from the newly discovered Amarillo hop. The wonderful hop aroma is balanced nicely with a toasty malt body, ending with a cleansing hop finish. Made with English Pale, Munich, Vienna, and Crystal malts, and generously hopped with Amarillo, Perle, and Cascade hops. Fermented with our English ale yeast.', 'http://www.yazoobrew.com', 5.80, 55.00, 6.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5883, 1391, 4, 50, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'An authentic example of a Bavarian Hefeweizen.', 'http://www.yazoobrew.com', 5.00, 13.00, 3.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5884, 1391, 3, 46, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'A rich, chocolaty English Porter with a clean finish. We use the finest floor-malted Maris Otter malts from England, the same malts used for the best single-malt scotch. A portion of malted rye gives a spicy, slightly dry finish.', 'http://www.yazoobrew.com', 5.70, 28.00, 29.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5885, 1391, 3, 42, '910 Division St', 'Nashville', 'Tennessee', 'United States', 'The tan lace clings to the glass as you raise the pint to your lips. Close your eyes and smile as the rich espresso notes fade to a dry, roasted finish. Exceptionally smooth and satisfying. Made with English Pale malt, roasted barley, black patent malt, and flaked barley. Hopped with East Kent Goldings and Target hops, and fermented with our English ale yeast.', 'http://www.yazoobrew.com', 3.80, 35.00, 45.00, 0, '9999-01-01', '36.151, -86.7821', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5887, 1412, 1, 3, 'Robert Cain Brewery', 'Liverpool', 'Merseyside', 'United Kingdom', 'A regular winner of awards for quality and flavour, and winner of the silver medal at the International Brewing Industry Awards 2002, this refreshing yet full-bodied bitter is a favourite with beer drinkers everywhere. The rich flavours of premium malt and goldings hops are unmistakable in this well balanced, traditionally brewed bitter.', 'http://www.cains.co.uk/', 4.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5888, 1412, 1, 4, 'Robert Cain Brewery', 'Liverpool', 'Merseyside', 'United Kingdom', 'FA is no small beer: despite its deceptively pale golden colour, it boasts a big, smooth flavour and strong punch. Brewed with the finest English malts, and conditioned in cask with dry hops to produce fresh hop aromas and a fuller flavour, delighting the mouth and stimulating the tongue.', 'http://www.cains.co.uk/', 4.80, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5889, 1412, 1, 2, 'Robert Cain Brewery', 'Liverpool', 'Merseyside', 'United Kingdom', 'IPA is one of Cains', 'http://www.cains.co.uk/', 3.50, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5890, 1412, 1, 11, 'Robert Cain Brewery', 'Liverpool', 'Merseyside', 'United Kingdom', 'This is a smooth, full flavoured, truly dark mild with a rich creamy head. It has a full body and distinctive roasted malt taste, balanced by its fresh hop character. Complex flavours and aromas are achieved by blending deeply roasted malt and adding a selected blend of English hops, including dry hops, to the cask conditioned beer.', 'http://www.cains.co.uk/', 3.20, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5891, 1412, 1, 3, 'Robert Cain Brewery', 'Liverpool', 'Merseyside', 'United Kingdom', 'A full, clean and refreshing pale coloured bitter with an abundance of citrus hop character created by the blend of dry and late hopping techniques. It also has subtle hints of malt and fruit on aroma and palate which gives the beer a well rounded balance.', 'http://www.cains.co.uk/', 5.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5892, 1413, 1, 2, '125B Roberts St', 'Asheville', 'NC', 'United States', 'English Style India Pale Ale, Maris Otter 2-row, Canadian Honey Malt and Belgian Crystal. Centennial, Kent Golding, and Cascade are added Five times during the process, including Dry Hopping. Aroma: Earthy, Citrusy, and Resinous Tasting/Flavor: Orangy and Sugary Apricots Finish: Malt Sweetness Balanced by Dry Hops', 'http://wedgebrewing.com/', 7.20, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5893, 1414, 11, 130, 'Black Creek Pioneer Village', 'Toronto', 'Ontario', 'Canada', 'Porter is a dark-coloured beer developed in the 1750s. Porter has a heavier flavour and aroma and a slightly sweet taste. Its name probably originates in the belief that this strong, nourishing drink was ideal for hard-working porters and labourers. Black Creek Porter is wonderful on its own, or with salty snacks.', 'http://www.blackcreekbrewery.ca/', 0.00, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5894, 1416, 5, 61, '925 Cherry Street SE', 'Grand Rapids', 'MI', 'United States', 'A classic golden ale, with subtle esters of banana and bubblegum. This beer pours with a creamy head and ends with a sweetness of light Belgian candi sugars. Our brewmaster aged this ale for an extended period to round out the flavors. A great traditional Belgian brew.', 'http://breweryvivant.com', 9.25, 0.00, 0.00, 0, '9999-01-01', '', '2018-10-05');
