INSERT INTO beerbuddies_db.beer VALUES (5903, 10, 7, 82, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Amber is a Munich style lager. It has a smooth, malty, slightly caramel flavor and a rich amber color.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5904, 10, 7, 77, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Save Our Shores (S.O.S) is an unfiltered weizen pils and has a brilliant golden color. A Charitable Pilsner', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5905, 10, 8, 95, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Golden is a crisp, clean continental lager. Just four ingredients are all it takes.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5906, 10, 8, 96, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Uniquely hand-crafted using 100% all natural ingredients: The result is the smoothest, most flavorful light beer.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5907, 10, 1, 1, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abbey Ale is a strong malty ale brewed in the style of the Trappist Monks. 22oz bottles only', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5908, 10, 7, 82, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Abita Wheat is a lager, not ale, and contains a generous amount of wheat which produces a clean, simple flavor.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5909, 10, 11, 121, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Similar to the Harvest Wit but with a lot more punch. A very pronounce citrus aroma with a triple hop flavor makes for one great beer.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5910, 10, 11, 128, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'This beer is not very bitter which allows the flavors of the rye and honey to come through. The result is a full bodied, sweet, and malty beer.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5911, 10, 11, 121, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'Strawberry Harvest Lager is a wheat beer made with real Louisiana strawberries.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
INSERT INTO beerbuddies_db.beer VALUES (5912, 10, 11, 121, 'PO Box 1510', 'Abita Springs', 'Louisiana', 'United States', 'This Wit beer has a sweet and subtle citrus flavor with a touch of spice that is cool and refreshing.', 'http://www.abita.com/', 0.00, 0.00, 0.00, 0, '9999-01-01', '30.5049, -89.944', '2018-10-05');
